(68, 63, 32, 'Startup koji sam osnovao razvija web aplikaciju koja rešava veliki problem u svetu IT-ja na 3 fronta:\r\n\r\n- Rešava problem osobama koje traže prvi posao u IT industriji\r\n- Dodatno povećava prihod osobama koje se već nalaze u IT industriji\r\n- Olakšava kompanijama proces zapošljavanja i spaja ih sa obučenim inženjerima.\r\n\r\nNaime, svako ko je programer će Vam reći da je najefikasniji način da se nauči programiranje kroz mentorstvo, tako zapravo i funkcionišu kompanije koje zapošljavaju praktikante i juniore gde isti odmah dobijaju mentora.\r\n\r\nLično sam pokrenuo taj koncept pomaganja početnicima da dođu do prvog posla u IT industriji kroz 1 na 1 mentostvo i ubrzo sam postao prepunjen klijentima od prevelike zainteresovanosti a pritom niko to ne radi trenutno na Balkanu.\r\n\r\nKroz web aplikaciju koju razvijamo između ostalog povezivaće se klijenti i mentori iz IT industrije u raznim oblastima (Web development, Mobile development, QA testing itd.) u zavisnosti od toga šta klijent želi da izuči kako bi došao do prvog posla.\r\n\r\nOvo je samo hiljaditi deo ideje, aplikacija će sadržati puno funkcionalnosti koje će olakšavati rešavanje prethodno navedenih problema na tri fronta.', NULL, NULL),
(71, 71, 35, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(73, 17, 37, 'Startup koji sam osnovao razvija web aplikaciju koja rešava veliki problem u svetu IT-ja na 3 fronta:\r\n\r\n- Rešava problem osobama koje traže prvi posao u IT industriji\r\n- Dodatno povećava prihod osobama koje se već nalaze u IT industriji\r\n- Olakšava kompanijama proces zapošljavanja i spaja ih sa obučenim inženjerima.\r\n\r\nNaime, svako ko je programer će Vam reći da je najefikasniji način da se nauči programiranje kroz mentorstvo, tako zapravo i funkcionišu kompanije koje zapošljavaju praktikante i juniore gde isti odmah dobijaju mentora.\r\n\r\nLično sam pokrenuo taj koncept pomaganja početnicima da dođu do prvog posla u IT industriji kroz 1 na 1 mentostvo i ubrzo sam postao prepunjen klijentima od prevelike zainteresovanosti a pritom niko to ne radi trenutno na Balkanu.\r\n\r\nKroz web aplikaciju koju razvijamo između ostalog povezivaće se klijenti i mentori iz IT industrije u raznim oblastima (Web development, Mobile development, QA testing itd.) u zavisnosti od toga šta klijent želi da izuči kako bi došao do prvog posla.\r\n\r\nOvo je samo hiljaditi deo ideje, aplikacija će sadržati puno funkcionalnosti koje će olakšavati rešavanje prethodno navedenih problema na tri fronta.', NULL, NULL),
(76, 22, 37, 'Da, radili smo na sličnoj aplikaciji vezanoj za konsalting.', NULL, NULL),
(78, 23, 37, 'Doprinos.\r\n\r\nKroz svaku ideju koju sam imao do sada želeo sam da načinim neki doprinos. Ovaj program vidimo kao priliku da realizujemo trenutnu ideju do kraja i da poboljšamo obrazovni sistem u IT industriji.\r\n\r\nTakođe još jedna od motivacija jeste povezivanje sa istomišljenicima i inovativnim ljudima.', NULL, NULL),
(80, 24, 37, 'You\'re just one mentor away from your first job in the IT industry', NULL, NULL),
(82, 25, 37, 'Adekvatno sticanje veština početnika kako bi došli do prvog posla u IT industriji. Globalni problem. Ovaj problem nije toliko teško rešiti ali jeste težak za klijente koji na primer rade u ovom trenutku za neku malu svotu novca a imaju želju da uđu u IT industriju međutim ne znaju odakle da krenu.', NULL, NULL),
(84, 26, 37, 'Za početak Balkan a kasnije i globalno tržište.', NULL, NULL),
(86, 27, 37, 'U slobodno vreme čitaju motivacione i biznis knjige. Ne zarađuje i želi da dođe do prvog visoko plaćenog posla u IT industriji ili nije zadovoljan svojim trenutnim radnim odnosom. Briga: upravljanje vremenom. Strah: Finansijska nestabilnost. Vršio sam intervju sa nekih 10-ak potencijalnih klijenata i svi imaju slične paterne ponašanja. Čitaju knjigu Rich Dad Poor Dad, uzor im je Elon Musk.', NULL, NULL),
