(193, 63, 87, 'Naša ideja jeste da budemo prodavci usluga Online. Konkretno se radi o putnom zdravstvenom osiguranju. NBS je dozvolila Turističkim Agencijama da se bave prodajom putnog osiguranja i samim tim smo odlučili da se ta prodaja vrši putem interneta.', NULL, NULL),
(194, 71, 88, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(195, 17, 89, 'Naša ideja jeste da budemo prodavci usluga Online. Konkretno se radi o putnom zdravstvenom osiguranju. NBS je dozvolila Turističkim Agencijama da se bave prodajom putnog osiguranja i samim tim smo odlučili da se ta prodaja vrši putem interneta.', NULL, NULL),
(196, 22, 89, 'Radili smo i saradjivali na raznim biznis idejama, odredjenim takmičanjima i slično...  Možete pogledati nešto više na: https://youtu.be/PTMvBhO3L1k', NULL, NULL),
(197, 23, 89, 'Naš glavni motiv jesu inovacije. Svesni smo da ova naša ideja nije potpuno inovativna, medjutim smatramo da ima velikog prostora da napredujemo i da usavršavamo načine prodaje ovog proizvoda/usluge.', NULL, NULL),
(198, 24, 89, 'Better Together', NULL, NULL),
(199, 25, 89, 'Uticaj pandemije Covid 19 je jako uticao na sve privredne grane kao i na društvo u celini. Došlo je do ubrzane i globalne digitalizacije, gde smatramo da je naša šansa za pokretanje biznisa. Ljudi danas žive sve brže, imaju sve manje slobodnog vremena, smatramo da kada bi im bila dostupna ova uluga online, da bi se vremenom navikavali i počeli potpuno online koristiti neke usluge.', NULL, NULL),
(200, 26, 89, 'Naše tržište jeste tržište Republike Srbije, jer putno osiguranje je moguće prodavati samo gradjanima Srbije ili ljudima koji imaju boravište ili naš pasoš. Pokušali bi online promocijom doći do 1.000.000 ljudi u  Srbiji.', NULL, NULL),
(201, 27, 89, 'Naši kupci jesu svi oni ljudi koji putuju, nebitno bilo to jednom godišnje ili 10 puta godišnje. Naš cilj jeste doći do kupaca koji imaju svest o osiguranju, kao i koji su digitalno obrazovaniji, kako bi znali kako kupovati ove uluge/proizvode.', NULL, NULL),
(202, 28, 89, 'Naša Inovacije ovde jeste način i sitem prodaje proizvoda. Postoji mogućnost kupovine osiguranja putem interneta, medjutim to nije toliko zastupljeno, i ne postoji praksa u društvu za kupovinu na taj način. Mi želimo putem FaceBook-a, Instagrama, YouTube-a, i drugih platformi da informišemo društvo i povezujemo Osiguravajuće kompanije sa potrošačima.', NULL, NULL),
(203, 30, 89, 'Naši kupci trenutno moraju ići u filijale osiguravajućih društva ili u turističke agencije lično kako bi kupovali polise putnog osiguranja. Takodje postoji mogućnost online kupovine, ali je učestalost kupovine veoma mala. 1% od ukupne kupovine se ostvari putem internet prodavnica.', NULL, NULL),
(204, 29, 89, 'Omogućujemo kupcima da brže, jednostavnije, lakše dodju do odredjenih informacija. Kupci mogu u samo par koraka doći do putnog osiguranja koje stiže u vidu E-Polise na korisnikov E-mail. Dobro je to što kupac neće morati fizički biti prisutan prilikom kupovine polisa, veliki benefit jeste što neće morati fizički posedovati posliu, već je može imati u elektronskoj formi.', NULL, NULL),
(205, 32, 89, 'Naš proizvod, kao i osiguranje generalno u Srbiji nije toliko popularno i zastupljeno. Želimo da promenimo to, da informišemo i edukujemo ljude i društvo u celini kako bi stvorili svest o osiguranju. To sve bi želili da uradimo na početku kroz putno osiguranje koje je najeftiniji proizvod osiguranja, i polako kroz vreme stvaramo poverenje kao Zastupniča Agencija.', NULL, NULL),
(206, 37, 89, 'Zaštitili bi par Logo-a, koji bi bili u sklopu cele naše koncepcije i poslovanja. Vlasnik svakog Logo-a jeste Stefan Petković (0701002781032) koji je lično dizajnirao te Logo-e.', NULL, NULL),
(207, 40, 89, 'Na osnovu prodatih polisa, osiguravajuće društvo odobrava odjredjenu proviziju na svaku prodatu polisu, koja iznosi od 25% do 35% u zavisnosti od obima prodaje.', NULL, NULL),
(208, 41, 89, 'Napravili Instagram Profil, napravili YT kanal, Fb stranicu, krenuli u pregovore sa odredjenim pratnerima koji bi nas promovisali. Uradili smo kompletno testiranje ovog načina prodaje, u uvideli da funkcioniše besprekorno, veoma brzo i jednostavno za svakog čoveka/ženu. Počeli smo da kreiramo sadržaj za sve društvene mreže.', NULL, NULL),
(209, 44, 89, 'Stefan Petković je učestvovao na mentorskom programu u Coca-Cola HBC Srbija, kao i Mentroskom programu Biznis Inkubatora Kruševac.', NULL, NULL),
(210, 45, 89, 'Prikupili smo do sada 5.000e koji su nam potrebni za početni kapital u smislu nabvke odredjene opreme, kao i plaćanje reklama i promocija na internetu. Taj novac finansiramo iz ličnih sredstava.', NULL, NULL),
(211, 48, 89, 'Najpotrebnija podrška nam je u istraživanju novih načina marketinga i promocije ovog proizvoda, kao i finansijska podrška za realizaciju ideje.', NULL, NULL),
(212, 49, 89, 'Potrebno nam je 15.000e (5.000 već obezbedjeno) najviše za promociju putem interneta kako bi došli do gore navedenih 1.000.000 ljudi u Srbiji.', NULL, NULL),
(213, 52, 89, 'Prezentaicja: https://www.canva.com/design/DAEwxX_dZg0/LsaADb_JDfw_kqxuRtmwgg/view?utm_content=DAEwxX_dZg0&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink', NULL, NULL),
