(223, 71, 99, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(224, 63, 100, 'BizDev Matrix je softverska podrška poslovnom razvoju organizacijama svih profila zasnovana na veštačkoj inteligenciji. Direktna je podrška digitalnoj transformaciji i uvođenju digitalnog poslovanja. Osnovna poglavlja koja aplikacija obuhvata su marketing, prodaja, usluge za korisnike, sistem za upravljanje sadržajem (CMS) i poglavlje vezano za operacije tj. povezivanje, sinhronizaciju, ažuriranje i automatizaciju poslovnih procesa. Poslovnorazvojna matrica mogućava laku i jednostavnu izrada plana i kontrolu svih aktivnosti koje se vezuju za digitalni poslovni razvoj u okviru jedne organizacije. Ključna prednost aplikacije je mogućnost personalizovanih izbora usluga i aktivnosti i njihovog obima koja je u saglasnosti sa organizacionom digitalnom strategijom.', NULL, NULL),
(225, 71, 101, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(226, 17, 102, 'BizDev Matrix je softverska podrška poslovnom razvoju organizacijama svih profila zasnovana na veštačkoj inteligenciji. Direktna je podrška digitalnoj transformaciji i uvođenju digitalnog poslovanja. Osnovna poglavlja koja aplikacija obuhvata su marketing, prodaja, usluge za korisnike, sistem za upravljanje sadržajem (CMS) i poglavlje vezano za operacije tj. povezivanje, sinhronizaciju, ažuriranje i automatizaciju poslovnih procesa. Poslovnorazvojna matrica mogućava laku i jednostavnu izrada plana i kontrolu svih aktivnosti koje se vezuju za digitalni poslovni razvoj u okviru jedne organizacije. Ključna prednost aplikacije je mogućnost personalizovanih izbora usluga i aktivnosti i njihovog obima koja je u saglasnosti sa organizacionom digitalnom strategijom.', NULL, NULL),
(227, 22, 102, 'Nismo sarađivale na razvoju startap ideje do sada niti u istim poslovnim aktivnostima. No i mimo toga pošto smo rođene sestre, smatramo da imamo odlično poslovno razumevanje i sklonost zajedničkim radnim aktivnostima.', NULL, NULL),
(228, 23, 102, 'Ključna i jedina motivacija za prijavu na Program je inovativna ideja koju izlažemo ovim putem.', NULL, NULL),
(229, 24, 102, 'Custom business development matrix', NULL, NULL),
(230, 25, 102, 'Inovativnom idejom se postiže centralizovano upravljanje, kreiranje i pregled organizacionih aktivnosti digitalnog poslovanja koji prati organizacionu digitalnu strategiju. Uz to postoji mogućnost personalizacije  paketa poslovnih usluga digitalnog razvoja.\r\nIstraživanjem ove problematike kreator idejnog rešenja bavi se zadnjih par godina.', NULL, NULL),
(231, 26, 102, 'Inovativnom softverskom uslugom se targetira globalno B2B tržište.  Za širenje biznisa u naredne 2 godine pored Jugoistočnog dela Evrope primarno se planira proširenje na evropsko, američko i australijsko, odnosno globalno tržište.', NULL, NULL),
(232, 27, 102, 'Naši potencijalni kupci su svi korisnici usluga digitalnog poslovnog razvoja iz marketinga, preciznije govoreći iz oblasti prodaje, promocije, usluga za korisnike, sistema upravljanja sadržajem i poslovnim procesima.\r\n Sprovedena su preliminarna istraživanja  i prvi relevantni zaključci ukaziju na realnu potrebu za uvođenjem organizovanog digitalnog poslovnog razvoja.', NULL, NULL),
(233, 28, 102, 'Inovativna usluga koju planiramo da razvijemo softverskom aplikacijom zasniva se na AI tehnologijama a njene glavne karakteristike su mogućnosti izbora, kontrole i merljivosti poslovnih aktivnosti; i personalizacija, odnosno kreiranje jedinstvenog spektra aktivnosti usluga. Jedinstvenost inovacije je što povezuje digitalnu strategiju organizacije sa aktivnostima njenog poslovnog razvoja, pri čemu je digitalna strategija direktno vezana sa primarnom delatnošću i tokovima poslovanja. Na taj način se postižu tačne informacije u realnom vremenu, na osnovu kojih se predviđaju optimalni poslovni potezi za buduće aktivnosti poslovnog razvoja.', NULL, NULL),
(234, 30, 102, 'Pitanja interaktvnih aktivnosti poslovnog razvoja na kojem radimo nisu softverski rešena do sada. Postoje softveri koji su zastupljeni u poslovnom razvoju ali ni jedan ne obuhvata elemente koje mi objedinjujemo u BizDev Matrixu.', NULL, NULL),
(235, 29, 102, 'Postiže se organizaciona digitalna transformacija kroz organizaciju elemenata poslovnog razvoja o kojem je već bilo reči, pregled njihovih relacija, predviđanja budućih tokova poslovanja i predlaganje konkretnih poslovnih aktivnost na osnovu elemenata strategije digitalnog poslovanja organizacije.', NULL, NULL),
(236, 32, 102, 'Ključni razlog je forma matriksa i reverzibilno sugestivna komunikacija između strategije, polja vezanih za aktivnost, njuhovu merljivost i odluka kojih povlači čovek, odnosno menadžer poslovnog razvoja ili menadžer digitalnog marketinga. U mikro i manjim organizacijama tu ulogu može obavljati i direktor.', NULL, NULL),
(237, 37, 102, 'Istraživanje na temu intelektualne svojine je sprovedeno u doktorskoj disertaciji inovatora ove poslovne inovativne ideje. O zaštiti prava intelektualne svojine planiramo kontaktirati Zavod za intelektualnu svojinu Srbije kada projekat dođe do tačke razvoja kada je potrebna ta aktivnost.', NULL, NULL),
(238, 40, 102, 'Samoodrživost startapa odnosi se na osnovne marketing usluge, a pored toga bi se istim kupcima promovisao i prodavao softver.', NULL, NULL),
(239, 41, 102, 'Tim razvija ideju poslednju godinu dana kao sporednu radnu aktivnost. Do sada je osmišljen projekat, urađeno je istraživanje i analiza postojećih softverskih rešenja iz oblasti razvoja poslovanja i njihovih principa rada. Kreiran je uzorak sa aktivnostima kako bi se inovacija adekvatno mogla predstaviti.', NULL, NULL),
(240, 44, 102, 'Nismo učestvovale ni pojedinačno niti u timu s drugima.', NULL, NULL),
(241, 45, 102, 'Nismo, ovo je prvo potraživanje sredstava.', NULL, NULL),
(242, 48, 102, 'Očekujemo incijalnu podršku razvoja inovacije. Podrška nam je potrebna za izradu prve verzije inovaticne usluge pod nazivom BizDev Matrix koja bi se prodavala uz ostale usluge koje bi ozbeđivala kompanija, a koje su obuhvaćene Poslovnorazvojnom matricom.', NULL, NULL),
(243, 49, 102, 'U trenutnoj fazi razvoja neophodna su nam sredstva za alfa verziju softvera. Do sada je postignuto istraživanje i na osnovu njega izrađen dokument koji u formi tabele (matrixa) predstavlja inovaciju BizDev Matrix.', NULL, NULL),
