(273, 71, 119, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(274, 63, 120, 'Naša inovacija je potpuno nov uređaj za organsko uklanjanje pčelinjeg krpelja (varoe) sa efikasnošću od 95% . Zasniva se na tome da u jednakim vremenskim intervalima pusti određenu količinu mravlje kiseline u isparivač koji se nalazi u košnici. Ovo je sasvim novi metod, dosada se mravlja kiselina implementirala primitivno pomoću sunđera koji se postavljao na saće sa koga se izlivala mravlja kiselina i zahtevalo je otvaranje košnice na svakih par dana što remeti njenu mikro klimu. Uređaj uklanja varou na pčelama i pčelinjem leglu, što nije bio slučaj sa dosadašnjim sredstvima. Invencija ima velike mogućnosti da osvoji i dominira tržištem jer od druge polovine 20. veka kada se varoa masovno proširila po Evropi nije se napredovalo po pitanju borbe protiv nje organskim sredstvima. Naša očekivanja su da bi uređaj dominirao tržištem u najmanjem periodu od pola veka.', NULL, NULL),
(275, 71, 121, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(276, 17, 122, 'Naša inovacija je potpuno nov uređaj za organsko uklanjanje pčelinjeg krpelja (varoe) sa efikasnošću od 95% . Zasniva se na tome da u jednakim vremenskim intervalima pusti određenu količinu mravlje kiseline u isparivač koji se nalazi u košnici. Ovo je sasvim novi metod, dosada se mravlja kiselina implementirala primitivno pomoću sunđera koji se postavljao na saće sa koga se izlivala mravlja kiselina i zahtevalo je otvaranje košnice na svakih par dana što remeti njenu mikro klimu. Uređaj uklanja varou na pčelama i pčelinjem leglu, što nije bio slučaj sa dosadašnjim sredstvima. Invencija ima velike mogućnosti da osvoji i dominira tržištem jer od druge polovine 20. veka kada se varoa masovno proširila po Evropi nije se napredovalo po pitanju borbe protiv nje organskim sredstvima. Naša očekivanja su da bi uređaj dominirao tržištem u najmanjem periodu od pola veka.', NULL, NULL),
(277, 22, 122, 'Svi članovi tima su učenici ETŠ \"Nikola Tesla\" u Beogradu smer elektrotehničar računara. Nikola, Miodrag i Ivan su kao tim u predhodnih godinu dana učestvovali na takmičenju za Najbolju tehnološku inovaciju, takmičenju FELIX i na festivalu roborike PROF STAR u Moskvi. Na svim od navedenim takmičenjima su zauzeli PRVO mesto! Anastasija je kao članica tima došla pre 3 meseca jer je uvidela da može u njemu implementirati svoje dosada stečeno znanje iz programieanja na praktičan način.', NULL, NULL),
(278, 23, 122, 'Već duže vreme nam je cilj da ostvarimo saradnju sa Naučno tehnološkim parkom Beograd, jer su do sada stizale samo reči hvale o njemu od strane bivšeg učenika Nikole Krstića kreatora rukavice za slepe Anora. Smatrali smo da bi nam podrška parka u mnogome doprinela u usavršavanju našeg projekta kroz resurse koje on pruža. Program Raising Starts se pojavio kao savršeno rešenje za naše trenutno stanje kada ne znamo tačno šta dalje ali naravno i novčana podrška bi nam puno značila.', NULL, NULL),
(279, 24, 122, '\"Zdrave pčele su zdrav svet! \"', NULL, NULL),
(280, 25, 122, 'Nikola kao pčelar je uvideo problem varoe(pčelinjeg krpelja) koji može uništiti i do 45% pčelinjih društava ako se pravilno ne suzbija. Pčelari su opterećeni ovim problemom od sredine prošlog veka, kada se ovaj insekt proširio na ceo svet ljudskom nemarnošću prenošenjem pčela sa jednog kontinenta na drugi radi ukrštanja i dobijanja kvalitetnijih vrsti pčela i tako se proširivši iz Azije na ceo svet.', NULL, NULL),
(281, 26, 122, 'Veliki vetar u leđa vidimo u tome da je Srbija zemlja sa najvećim brojem košnica po glavi stanovnika čak jedna na sedam građana. Na tržištu u Srbiji koje je po popisima SPOSA (Saveza pčelarskih organizacija Srbije) iznosi 28000 pčelara i oko 1300000 košnica po popisu iz 2018. godine dok neprovereni izvori za 2021. godinu tvrde da ima 1500000 košnica. Dok ako bi smo se plasirali na Nemačko tršište (već poseduju svest o ogomnom značaju organske proizvodnje meda) tamo nas čeka 120 000 pčelara sa više miliona košnica.\r\nhttps://spos.info/1-295-545-obelezenih-kosnica-u-srbiji/ \r\nhttps://www.rts.rs/page/stories/sr/story/13/ekonomija/4613947/pcele-kosnice-subvencije-obelezavanje-broj.html', NULL, NULL),
(282, 27, 122, 'Bazirali bi smo se prvenstveno na mlade pčelare i one koji su zainteresovani za organsku proizvodnju meda. Pored njih ne bi smo ni zapostavili osobe kojima je pčelarstvo drugi posao ili hobi, naš uređaj će im omogućiti da smanje utrošeno vreme na pčelinjaku samim time smanje i ulaganja i povećaju zaradu. Njihov glavni izvor informacija o pčelarstvu sem interneta su i predavanja koja organizuju udruženja pčelara na lokalnom nivou. Kroz seriju predavanja kako online tako i uživo bi smo im se približili i predstavili naš uređaj. Dosada postojeći strah o neefikasnosti organskih tretmana bi smo otklonili uz predstavljanje istraživanja koja su već urađena koja garantuju efikasnost ovakvog načina tretiranja od 95%. Kroz par anketu koju smo proveli u 2 lokalnoa udruženja pčelara na uzorku od njih 80 preko 50 ih je bilo zainteresovano za probu uređaja  a glavna zamerka im je bila cena uređaja na kojoj tenutno radimo da bude što manja.', NULL, NULL),
(283, 28, 122, 'Trenutno razvijamo tojest već je izrađen drugi prototim uređaja koji ima za cilj da uklanja pčelinjeg krpelja(Varou) na organski način. U njegegovoj izradi smo koristili naše znanje iz programiranja (IT), elektronike, hemije i pčelarstva. Uređaj uz pomoć spoljašnjih senzora određuje najpovoljniji trenutak za tretman mravljom kiselinom za čija je efikasnost već poznata. Dosadašnja rešenja primoravala su pčelara na skoro svakodnevni rad i hlađenje kiseline na -18 °C što je iziskivalo veliki napor i korišćenje zamrzivača što nije slučaj kod našeg uređaja. On postepeno dozira kiselinu tako da ne postoji bojazan o prevremenom isparavanju i šok efektu na pčele.', NULL, NULL),
(284, 30, 122, 'Na domaćem tržištu nemamo direktnog konkurenta koji može parirati našem uređaju jer svi postojeći tretmani iziskuju fizički rad na pčelinjaku a to je od organskih klasična mravlja kiselina a od neorganskih amitraz. Na inostranom tržištu postoji dva automatizovana načina tretiranja koji rade na principu zagrevanja košnice a to su VARETREAT i VARROA CONTOLLER  koji svojim radom znatno ometaju pčele vojim delovanjem što nije slučaj kod našeg uređaja. Uz to ova dva uređaja zahtevaju izvor električne energije dok je naš opremljen sopstvenim izvorom (solarnom ćelijom).', NULL, NULL),
(285, 29, 122, 'Kao prvo organski tretman omogućuje konzumaciju meda i ostalih pčelinjih proizvoda ohmah nakon tretmana. Svojim samostalnim radom uređaj pčelaru štedi vreme potrebno za odlazak na pčelinjak i gorivo u slučaju da je pčelinjak udaljen u čemu takođe vidimo benefit zaštite životne sredine.', NULL, NULL),
(286, 32, 122, 'Mi nismo izmislili novi način tretiranja protiv varoe, već smo postojeći mravljom koselinom koji je iziskivao mnogo rada da bi postigao željenu efikasnost automatizovali i osavremenili našim uređajem.', NULL, NULL),
(287, 37, 122, 'U konsultaciji sa Zavodom za intelektualnu svojinu dobili smo odgovor da pošto smo maloletni a svega par meseci nam je ostalo do punoletstva postupak pokrenemo tada da se ne bismo upuštali u proces uz pomoć pravnog zastupnika. Do tada usavršavamo prijavu za podnošenje zaštite intelektualne svojine.', NULL, NULL),
(288, 40, 122, 'Pored same prodaje uređaja, planiramo da dodatnu zaradu ostvarimo prodajom mravlje kiseline postrebnom za rad uređaja. Onemogućili bismo kupovinu mravlje kiseline kod drugih prodavaca tako što bi bočica koja odgovara našem uređaju bila zaštićena sa svojim navojem i tako bi morali samo kod nas da kupuju kiselinu. Naravno tu je i popravka i servisiranje uređaja.', NULL, NULL),
(289, 41, 122, 'Tim Eco Hive nastao je februara 2021. godine na inicijativu našeg mentora i nastavnika praktične nastave Milana Stanojčića u ETŠ \"Nikola Tesla\" u Beogradu. Po pozivu nastavnika na takmičenje za \"Najbolju tehnološku inovaciju\" formirao se tim od: Nikole Teomirovića, Miodraga Milanovića i Ivana Nikolića. Nikola kao pčelar je uvideo varou kao problem za koji ne postoji rešenje koje ispunjava ekološke norme. Koristeći naše znanje iz elektronike i programiranja nastala je naša inovacija Ekološka antivarozna košnica sa kojom smo ostvarili sledeće uspehe:\r\n1. mento na takmičenju FELIX u organizaciji Prirodno matematičkog fakulteta-Univerziteta u Kragujevcu. 1. mento na takmičenju Prof Star u organizaciji Visoke poslovne škole Lomonosov Univerziteta u Moskvi. 1. mesto na takmičenju za \"Najbolju tehnološku inovaciju\" u organizaciji Ministarstva Prosvete. Posle ovih uspeha našem timu se priključila Anastasija Živković jer je uvidela da u našem timu može primeniti svoje stečeno znanje u praksi.', NULL, NULL),
(290, 44, 122, 'Na takmičenju za Najbolju tehnološku inovaciju mentor nam je bio naš profesor praktične nastave Milan Stanojčić čiji LindedIn profil  prilažemo:https://www.linkedin.com/in/milan-stanojcic-86063a174/?originalSubdomain=rs', NULL, NULL),
(291, 45, 122, 'Tim je do sada od novčanih sredstava dobio prvu nagradu na takmičenju za Najbolju tehološku inovaciju u iznosu od 180000 dinara pri čemi mentoru tima odlazi 45000 dinara. Pritom treba napomenuti da je obračunat porez na ovu cifru u visini od 20% tako da je tim na kraju dobio 108000 dinara.', NULL, NULL),
(292, 48, 122, 'Očekivanja od programa  Raising Starts pomoć u najrizičnijem dobu za svaki start up a to je izrada finalnog proizvoda i prvo pojavljivanje na tržištu. Znamo da ćemo uz mentorsku prodršku koju pružate prebrodit sve prepreke koje se pojave pred nama. A da će nam finansijska podrška koju pružate biti dovoljna pomoć za konačnu realizaciju.', NULL, NULL),
(293, 49, 122, 'Trenutno bi smo sva sredstva uložili u tehničnko usavršavanje uređaja(pod time mislimo rad na povećavanju efikasnosti uređaja i rešavanje zamerki koje dobijemo od kupaca), zaštitu intelektualne svojine i marketing. Naravno jedan deo novca bi smo uložili u kupovinu alata kao što su cnc mašina i 3D šzampač koji bi nam pomogli u usavršavanju projekta. Verujemo da će cifra od 15000 chf koju pružate biti dovoljna da pokrije navedene troškove.', NULL, NULL),
