(298, 71, 129, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(299, 63, 130, 'eSpoon aplikacija nudi korisnicima mogućnost rezervacija mesta u restoranima. Prednosti korišćenja eSpoon aplikacije se mogu sagledati sa strane korisnika i samih restorana. Sa strane korisnika, prednosti su: 1) Ušteda vremena za traženje restorana na više sajtova 2) Lakše iskustvo rezervacije 3) Mogućnost odabira mesta sedenja 3) Podsetnici za rezervacije\r\nPrednosti za restorane ubrajaju: 1) Lakše vođenje rezervacija (restoran preko aplikacije može i svoje rezervacije da evidentira a ne samo rezervacije preko aplikacije 2) Povećanja vidljivost ka korisnica 3) Jednostavnost 4) Feksibilnost za organizaciju rezervacija koja se ne može postići putem poziva.', NULL, NULL),
(300, 71, 131, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(301, 17, 132, 'eSpoon aplikacija nudi korisnicima mogućnost rezervacija mesta u restoranima. Prednosti korišćenja eSpoon aplikacije se mogu sagledati sa strane korisnika i samih restorana. Sa strane korisnika, prednosti su: 1) Ušteda vremena za traženje restorana na više sajtova 2) Lakše iskustvo rezervacije 3) Mogućnost odabira mesta sedenja 3) Podsetnici za rezervacije\r\nPrednosti za restorane ubrajaju: 1) Lakše vođenje rezervacija (restoran preko aplikacije može i svoje rezervacije da evidentira a ne samo rezervacije preko aplikacije 2) Povećanja vidljivost ka korisnica 3) Jednostavnost 4) Feksibilnost za organizaciju rezervacija koja se ne može postići putem poziva.', NULL, NULL),
(302, 22, 132, 'Nismo saradjivali u zajedničkim projektima.', NULL, NULL),
(303, 23, 132, 'Pri odlasku u restoran često je neophodno napraviti rezervaciju, medjutim, taj proces zna da bude nepotrebno komplikovan i staromodan. Često se desi da se restorani ne jave ili da se osoblje restorana javi dok je neka gužva, pa zbog buke i žurbe dodje do nesporazuma. Takodje, svakom može da se desi da zaboravi tačno vreme rezeravije, u kom slučaju mora opet da se zove restoran i prolazi kroz iste komplikacije. Još jedan problem je što može da se desi da se dobije veoma loše mesto u samom restoranu bez znanja mušterije. \r\nSa strane restorana, problem je u organizaciji jer sve sve zapisuje užurbano, na papiru, kao i poteškoće pri javljanju na telefon kada je felika gužva i buka.\r\nNavedeni problemi su česti kod restorana, stoga je neophodan softver koji bi rešio sve ove probleme i modernizovao proces rezervacija. Tu je nastala ideja za eSpoon, jednostavan softver koji rešava sve probleme.', NULL, NULL),
(304, 24, 132, 'Don\'t cook, just book.', NULL, NULL),
(305, 25, 132, 'eSpoon aplikacija pokušava da napravi efikasniji i lakši proces rezervacija. Sama aplikacija sadrži mogućnost odabira mesta u restoranima koji garantuje korisniku da će dobiti željeno mesto.', NULL, NULL),
(306, 26, 132, 'Na zvaničnom sajtu Rebubličkog zavoda za statistiku, možemo videti rast industrije kao i veličinu ugostiteljskog sektora koja predstavlja 73.439.609.000 za 2020. godinu, ili oko 624 miliona eura. Ovaj sektor jevelik i nudi veliku mogućnost daljeg rasta. Takodje, sama aplikacija može da posluje i van teritorije Srbije gde je potencijal zarade i sama veličina tržišta znatno veća.', NULL, NULL),
(307, 27, 132, 'Restoranima i korsinicima koji posećuju ugostiteljske objekte.', NULL, NULL),
(308, 28, 132, 'Proizod je već razvijen i u funkciji. Tehnologije koje se koriste su React Native (za mobilne aplikacije IOS i Android), MongoDB, JavaScript za web applikaciju, angular framework, Amazon Web Services (AWS), Google cloud. Širenje funkcionalnosti planirano u daljem poslovanju firme.\r\nNaš proizvod se ističe svojom brzinom, jednostavnošću i modernim dizajnom.', NULL, NULL),
(309, 30, 132, 'Nema rešenja za navedeni problem. Kupci imaju izbor samo da zovu telefonom.', NULL, NULL),
(310, 29, 132, 'Kupci dobijaju brzinu, jednostavnost i lakši odabri ugostiteljskih objekata pri korišćenju aplikacije. Takodje, mogućnost odabira mesta u restoranima, što smanjuje šansu da dobiju mesto koje im ne odgovara.', NULL, NULL),
(311, 32, 132, 'Na osnovu prikupljenih informacija zaključili smo da postoji znatan broj ljudi kojima je donekle poznata ideja proizvoda, ali niko nije našao dobar proizvod koji može da se koristi u Srbiji. Istovremenmo postoji velik broj ljudi koji nije upoznat sa samom idejom. Samim tim, ovaj proizvod je donekle poznad tržištu ali je neophodan kvalitetan softver i inforisanje potencijalnih korisnika o ideji.', NULL, NULL),
(312, 37, 132, 'Trenutno smo samo proverili da li je naš žig u konfliktu sa već zaštićenom intelektualnom svojinom. Ovaj zahtev je potvrdio da ne postoji sličan žig i da možemo da podnesemo novi zahtev za zaštitu intelektualne svojine.', NULL, NULL),
(313, 40, 132, 'Primarni izvor prihoda: naknada po rezervaciji ili mesečna naknada za korišćenje softvera.\r\nSekundarni izvor prihoda: marketing koji bi restorani plaćali da se istaknu na našoj aplikaciji.', NULL, NULL),
(314, 41, 132, 'Trenutno potencijalni kupci kao Madera, Kalemegdanska Terasa i ostali elitni restorani su zainteresovani za buduću saradnju. Povratne informacije od postojećih korisnika i restorana su pozitivne. Već smo imali prave, organske rezervacije preko aplikacije.', NULL, NULL),
(315, 44, 132, 'Nismo učestvovali', NULL, NULL),
(316, 45, 132, 'Trenutno je samo osnivački kapital korišćen za finansiranje razvoja proizvoda.', NULL, NULL),
(317, 48, 132, 'Segment u kom nam je potrebna najveća podrška je za marketing i prodaju. Već imamo funkcionalan proizvod ali je neophodno da se ideja proširi i da više ljudi se upozna sa proizvodom. Za marketing je teško odrediti tačan budžet, ali što veći budžet to bolje.', NULL, NULL),
(318, 49, 132, 'Trenutno za marketing je neophodan budžet za finansiranje SEO optimizacije, marketing društvenih mreža, unajmiljivanje marketing agencije kao i drugih, tradicionalnijih izvora marketinga.', NULL, NULL),
