(323, 89, 139, 'Obrazovanje: \r\n- Studiranje finansija u inostranstvu. Uključujući predmete za preduzetništvo. \r\n- Seminar o inovacijama, uz radionice sa uspešnim preduzetnicima. \r\n- Citanje razne literature i praćenje raznih izvora informacija na temu preduzetništva\r\nIskustvo: \r\n- Rad u softverskim firmama FIS i Infaloom (Programerske veštine,  razumevanje IT sistema i finansijsko znanje).\r\n- Saradnja sa drugim start-apima.\r\n- Prakse vezane za prodaju.', NULL, NULL),
(324, 90, 139, 'U većoj meri posvećen. Kreator ideje.\r\nZadužen za:\r\n- Odlazak na sastanke sa restoranima,\r\n- Praćenje razvoja novih funkcionalnosti i stabilnosti sistema. \r\n- Organizacija poslova drugih članova tima. \r\n- Pregovori i izrada biznis plana. \r\n- Paraćenje razvoja firme. \r\n- Raučnovodstveni poslovi', NULL, NULL),
(325, 91, 139, 'Full time posao u Infaloom softverskoj firmi kao \"Business Analyst\". Velika fleksibilnost u radnom vremenu je moguća u ovoj firmi u skladu sa dogovorom sa šefom firme. Samim tim, podrška pri razvoju eSpoon projekta.  Takođe, obezbeđuje stabilan izvor prihoda za ulaganje u eSpoon aplikaciju. IT saveti i znanje su dodatna pogodnost rada u ovoj firmi.', NULL, NULL),
(326, 89, 140, 'Obrazovanje:\r\nRudarsko geloški fakultet. Inženjer za podzemene kopove.', NULL, NULL),
(327, 90, 140, 'U većoj meri posvećen.\r\nZadužen za:\r\nIzradu nacrta restorana i drugih uslužnih objekata u AutoCAD sofveru,\r\n- Održavanje vebsajta,\r\n- Pomoć za operativne poslove.', NULL, NULL),
(328, 91, 140, 'Master studije, fleksiblinih rokova i obaveze. Velika dostupnost za razne zadatke projekta.', NULL, NULL),
(329, 89, 141, 'Obrazovanje:\r\nZavršen fakultet za menadžment i HR u švedskoj. \r\nRad na raznim multimedija projektima i radionicama.\r\n\r\nIskustvo:\r\nProjekti u photoshop-u, canvi, izrada podcast emisija, drugi kreativni projekti.\r\nRad u administraciji u firmi Intersolia.', NULL, NULL),
(330, 90, 141, 'Delimično posvećena. \r\nZadužena za:\r\n- Izradu marketing materijala i vođenje društvenih mreža,\r\n- Analiza marketing trendova,\r\n- Predlog za korišćenje marketing budžeta.', NULL, NULL),
(331, 91, 141, 'Rad u administraciji u firmi Intersolia. \r\nSa obzirom da izrada marketing materijala ne zahteva specifično vreme rada, posao ne predstavlja prepreku za projekat.', NULL, NULL),
(332, 89, 142, 'Obrazovanje:\r\nITS smer za multimediju, dizajn i video obradu.\r\n\r\nIskustvo:\r\nZaposlen kao grafički dizajner, rad u PhotoShop-u, Illustratoru, Adobe after effects, ostali softver za dizajn.', NULL, NULL),
(333, 90, 142, 'Delimično posvećen.\r\nZadužen za:\r\n- Izradu vizit karti, flajera i drugog reklamnog materijala,\r\n- Izrada objava za društvene mreže koje zahtevaju intezivniju grafičku obradu.', NULL, NULL),
(334, 91, 142, 'Full time zaposlen kao grafički dizajner.\r\nSa obzirom da se objave spremaju unapred, fiksno vreme rada nije neophodno za ovu poziciju.', NULL, NULL),
(335, 89, 143, 'Obrazovanje:\r\nPravni fakultet u Beogradu,\r\nMaster za intelektualnu svojinu,\r\nPoložen ispit za advokaturu.\r\n\r\nIskustvo:\r\nSu-osnivač avokatske firme \"BTS law\".', NULL, NULL),
(336, 90, 143, 'U većoj meri posvećen:\r\nZadužen za:\r\n- Pravljenje ugovora i drugih pravnih formi,\r\n- Odgovaranje na pravna pitanja od korisnika,\r\n- Izrada uslova korišćenja i pravila očuvanja privatnosti korisnika', NULL, NULL),
