(339, 90, 144, 'U većoj meri:\r\nZadrućen za:\r\n- Oragnizovanje prezentacija potencijalnim klijentima,\r\n- Odlazak na sastanke,\r\n- Pronalaženje potencijalnih klijenata', NULL, NULL),
(340, 91, 144, 'Osnovne studije.\r\nPosvećenost projektu je na visokom nivou izuzev za vreme ispitnih rokova.', NULL, NULL),
