(342, 89, 147, 'Posedujem razna iskustva iz oblasti razvoja poslovanja.\r\n\r\nStečeno obrazovanje:\r\n- Diplomirani ekonomista\r\n- Magistar ekonomskih nauka\r\n- Doktor političkih nauka', NULL, NULL),
(343, 90, 147, 'Julija Švonja je kreator ideje i ukoliko dođe do osnivanja pravnog subjekta biće potpuno posvećena ili u većoj meri, zavisno od potreba po projektnim fazama.', NULL, NULL),
