(348, 63, 150, 'CQC - Concrete Quality Control je multi funkcionalni softverski alat koji omogućava digitalizaciju kompletnog procesa ugradnje i kontrole kvaliteta svežeg betona u građevinskoj industriji. Obavlja funkcije unosa, praćenja i analize podataka na građevinskim projektima, a u vezi za praćenjem kontrole kvaliteta, proizvodnje, transporta i ugradnje sveže betonske mase. Takodje omogućava automatizovan i digitalizovan proces od porudžbine do ugradnje betona po pojedinačnim otpremnicama - segmentima građevinskog objekta.', NULL, NULL),
(349, 71, 151, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(350, 17, 152, 'CQC - Concrete Quality Control je multi funkcionalni softverski alat koji omogućava digitalizaciju kompletnog procesa ugradnje i kontrole kvaliteta svežeg betona u građevinskoj industriji. Obavlja funkcije unosa, praćenja i analize podataka na građevinskim projektima, a u vezi za praćenjem kontrole kvaliteta, proizvodnje, transporta i ugradnje sveže betonske mase. Takodje omogućava automatizovan i digitalizovan proces od porudžbine do ugradnje betona po pojedinačnim otpremnicama - segmentima građevinskog objekta.', NULL, NULL),
(351, 22, 152, 'Radili smo zajednički na projektima koji nisu vezani za trenutni startup.', NULL, NULL),
(352, 23, 152, 'Problemi koji su se pojavljlivali dugi niz godina u poslovanju Gorana Bajica kao organizatora poslovanja fabrike betona.', NULL, NULL),
(353, 24, 152, 'The Future of Construction', NULL, NULL),
(354, 25, 152, 'Naručivanje Beonta i dobijanje dodatnih informacija u toku isporuke komunikacija se vrši telefonom, ređe mejlom. Evidencija porudžbina se uglavnom vodi u sveskama ili u posebnim fajlovima gde je faktor ljudske greške visok, a analiza ručno unetih podataka dodatno otežana.', NULL, NULL),
(355, 26, 152, 'Prema godišnjim izveštajima vodećih proizvođača cementa za 2020. godinu, količina proizvedenog betona u svetu u 2020. je 8 215 000 000 m3. Naša analiza je pokazala da je za postizanje planiranog profita na kraju prve saradnike druge godine je pokazala da je srpsko tržište je malo, a internacionalizacija softvera se podrazumeva', NULL, NULL),
(356, 27, 152, 'Investitori, izvođači građevinskih radova, nadzor građevinskih radova, proizvođači betona. Sve kompanije koje učestvuju u izgradnji objekta, od projektovanja i izvođenja građevisnkih radova do nadzora.Sporveli smo anketiranje i registrovali smo veliku potrebu za našim rešenjem, sa ljudima koji su popunjavali ankete krenuli smo u dalje rešenje i fazu razvoja proizvoda smo analizirali sa njima.', NULL, NULL),
(357, 28, 152, 'CQC Softver je Web i Mobilna Aplikacija koja je prilagodiva svim uređajima. Softver je na engleskom jeziku, sa planom da da se dodaju novi jezici kako se budu osvajala nova tržišta. Osmišljen je tako da pokriva aktivnosti pet učesnika u projektu. Šef Gradilišta, Operater, Investitor, Nadzor, Vozač', NULL, NULL),
(358, 30, 152, 'Gradjevinska industrija je jedna od najmanje digitalizovanih industrija na svetu. Trenutno se celokupan proces od poručivanja betona pa do ugradnje vodi kroz rokovnike operatera, telefonskim pozivima, exel tabelama, viber grupama.', NULL, NULL),
(359, 29, 152, 'CQC softver predstavlja jedinstveni alat koji unapređuje praćenje kvaliteta betona koji se zahtevaju kod proizvođača betona i na objektu koji se gradi, omogućava sinhronizaciju i optimizaciju svih procesa, omogućava uvid u realne podatke na svakom koraku, predstavlja modernizaciju i digitalizaciju procesa, i pomoću CQC može da se vrši uporedna analiza podataka.', NULL, NULL),
(360, 32, 152, 'Na tržištu ne postoji software koji pokriva celokupne aktivnosti u proizvodnji sveže betonske mase.', NULL, NULL),
(361, 37, 152, 'Imali smo period od 4 meseca gde smo se konstantno konsultovali sa advokatskom kancelarijom Karanovic and Partners oko procesa zaštite, ostalo je na tome da trebamo da podnesemo prijavu za zaštitu na teritoriji EU. Sva prava će posedovati kompanija Conssoft koja je u našem vlasništvu.', NULL, NULL),
(362, 40, 152, 'Princip zarade je formiran po licnencama koje se razlikuju u zavisnosti koliko korisnika kompanija planira da licencira kako bi koristili naš software. Takodje postoji i fleksibilan paket u kome možemo da prilagodimo naš software njihovim potrebama.', NULL, NULL),
(363, 41, 152, 'Naš tim je okupljen 9 meseci oko razvoja ove ideje, primarni cilj nam je bio da prikupimo ne mala sredstva za sam razvoj Softvera, medjutim kroz pitch IT kompanija je prepoznala potencijal ovog Startupa i rešila da investira svoje zaposlene koje bi full time radili na izradi ovog softverskog rešenja, i od pre dva meseca aktivno testiramo naš MVP na dva gradilišta u Srbiji.', NULL, NULL),
(364, 44, 152, 'Imali smo prilike da 2021 godine budemo izabrani u 5 najbolji startupa koji su se prijavili i da četri meseca učestvujemo u  \"Delta Biznis Inkubatoru\" https://deltabiznisinkubator.rs/', NULL, NULL),
(365, 45, 152, 'Do sada nismo prikupili nikakvo eksterno finansiranje.', NULL, NULL),
(366, 48, 152, 'Ubrzan razvoj, povezivanje sa zajednicom i mentorsku podršku za globalni razvoj satartupa. Podrška nam je najpotrebnija u vidu formiranja tima za otvaranje novih tržišta.', NULL, NULL),
(367, 49, 152, '70.000 EUR, za otvaranje kanclarije, troškove zaposlenih, troškove platforma, troškove IT, Servera itd...', NULL, NULL),
