(378, 89, 161, 'Tim koji je učestvovao u izradi velikog broja softverskih rešenja na teritoriji US, prepoznali su potencijal naše startupa i ušli u vlasničku strukturu kako bi se bavili programerskim aktivnostima svkaodnevno.', NULL, NULL),
