(382, 63, 166, 'Digitalna platforma za automatizovanu izradu e-vodica za poljoprivredne proizvodjace sa ciljem optimizaccije procesa ulaganja u proizvodnju  i mogucnoscu predvidjanja ekonomskih rezultata proizvodnje.', NULL, NULL),
(383, 71, 167, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(384, 17, 168, 'Digitalna platforma za automatizovanu izradu e-vodica za poljoprivredne proizvodjace sa ciljem optimizaccije procesa ulaganja u proizvodnju  i mogucnoscu predvidjanja ekonomskih rezultata proizvodnje.', NULL, NULL),
(385, 22, 168, 'Kao  tim u ovom sastavu do sada nismo zajedno ucestvovali na nekom od projekata,ali odredjeni clanovi tima imaju iskustva u zajednickom radu na projektima.Ovo se odnosi na clanove tima koji su saradjivali u poslovanju u okviru iste organiyacije,a to su kreator prototipa resenja i autor projekta ABS digitalne platforme/', NULL, NULL),
(386, 23, 168, 'Motiv da se prijavimo za ovaj Program lezi u nasim ocekivanjima.\r\nOčekivanja od ovog programa usmerena su prvenstveno na snažnu mentorsku podršku u daljem razvoju našeg rješenja i ulasku na tržište.\r\nOčekujemo da ćemo uz finansijsku podršku kroz ulazni grant dobiti i ono što smatramo mnogo vrednijim, a to je znanje.\r\nZnanje kako savladati nove veštine i pripremiti se za uspešan početak na tržištu.\r\nOčekujemo da ćemo nakon završetka programa biti dobro obučeni kako bismo mogli uspesno skalirati nas proizvod i privući potencijalne investitore.\r\nOčekujemo da će nakon završetka programa naša poslovna filozofija doživeti pozitivnu transformaciju u pravcu kreiranja novog kvaliteta u realizaciji nasih zadataka.', NULL, NULL),
(387, 24, 168, 'Mocan alat za donosenje pravih odluka-ABS digitalna platforma', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(388, 25, 168, 'Nedovoljna efikasnost, sigurnost i održivost poljoprivredne proizvodnje farmera je globalni problem koji otklanjamo ovim resenjem.\r\nU potpunosti otklanjamo  mogucnost donošenja pogrešnih odluka farmera o izboru optimalne tehnologije i vrste proizvodnje.\r\nEfikasnog predviđanja ekonomskih rezultata buduće proizvodnje jedan je od najvećih problema za farmere koji vrlo efikasno resavamo.', NULL, NULL),
(389, 26, 168, 'Proizvod je namenjen globalnom trzistu .U analizi smo posli od geografski blizih trzista.	\r\nTAM Evropa - 10,5 miliona potencijalnih korisnika ukupne vrednosti 2,68 milijardi evra*\r\nSAM Bivše jugoslovenske republike - 1,55 miliona potencijalnih korisnika ukupne vrednosti 395 miliona evra**\r\nSOM Srbiju - 576 hiljada potencijalnih korisnika ukupne vrednosti 144 miliona evra***\r\nIzvori ne stanu !', NULL, NULL),
(390, 27, 168, 'Idealni korisnici su u grupi farmera sa posedom zemljista preko 10 ha, koji se bave biljnom proizvodnjom, do 40 godina starosti i digitalno su opremljeni i lako implementiraju predložene modele optimizacije proizvodnje.\r\nPrema anketi od 370 farmera u ZBO 73% je izrazilo interesovanje, 45% bi ga kupilo, što je tržište od 33.000 potencijalnih kupaca u vrednosti od 8,25 miliona evra.', NULL, NULL),
(391, 28, 168, 'Rešenje je ABS digitalna platforma, koja na potpuno automatiziran način farmerima kreira personalizirani e-vodič za optimizaciju  ulaganja u poljoprivrednu proizvodnju.\r\nInformation and communications technology (ICT) \r\nSveobuhvatnost uticaja aktivnosti različitih privrednih oblasti na finansijski rezultat buduće poljoprivredne proizvodnje farmera je osnovna jedinstvenost naseg resenja.', NULL, NULL),
(392, 30, 168, 'Danas potencijalni kupci problem resavaju na nacin da su prinudjeni da koriste vise razlicitih resenja kako bi bili u mogucnosti zadovoljiti deo svojih potreba za optimizacijom Neki od njih su \"Agrivi\",\"Agrosense\",\"Agrolife\" itd. \r\nDeo problema koji se odnosi na efikasnu projekciju ekonomskih rezultata buduce farmerove proizvodnje u dobrom delu je do sada bio neresen.', NULL, NULL),
(393, 29, 168, 'Znacajno skraćujemo vreme potrebno farmeru da prikupi i obradi sve neophodne pouzdane i ažurne trzisne informacije o proizvodnji i to na pristupacan i krajnje komforan nacin.\r\nVrsimo deblokadu dilema po pitanju odluke farmera o izboru najoptimalnije tehnologije i vrste proizvodnje. Kompletna projekcija ekonomskih rezultata proizvodnje,pre nego je farmer otpoceo sa ulaganjem u proizvodnju.', NULL, NULL),
(394, 32, 168, 'Znacajno poboljsanje vec postojecih resenja  ogleda se u mogucnosti automatizovane obrade uticaja sirokog spektra privrednih aktivnosi   na konacan ekonomski rezultat \r\n buduce farmerove poljoprivredne proizvodnje. \r\nMogucnost optimizacije ulaganja u proizvodnju i za diferencirane proizvodne povrsine-precizna poljoprivreda,bez ogranicenja u pogledu velicine i broja parcela.', NULL, NULL),
(395, 37, 168, 'Do sada smo izvrsili upis u evidenciju autorskih dela i predmeta srodnih prava i deponovali u  zavodu za intelektualnu svojinu autorsko delo \"ABS digitalna platforma-Agro budzet sistem\"\r\nAutor dela je Aleksandar Marotic sa kojim \"Agro budzet sistem\" doo ima zakljucen ugovor o prenosu autorskih prava.', NULL, NULL),
(396, 40, 168, 'Osnovni izvor prihoda predstavlja prodaja paketa usluga za izradu e-vodica za farmere,podeljenih u tri cenovne kategorije..Prosecna cena po jednoj optimizaciji tj e-vodicu  za jedan usev iznosi 70 eur, ,sto predstavlja 0.8% ukupnih prosecnih prihoda po farmeru na nasem ciljnom trzistu.\r\nProfitna stopa bi se kretala od 54-73%,', NULL, NULL),
(397, 41, 168, 'Nas tim se okupio godinu  dana pre osnivanja privrednog drustva koje je osnovano u novembru 2020 godine. Prosli smo  put od razvoja ideje do statusa MVP nase digitalne platforme i to smatramo najvecim uspehom u dosadasnjem razvoju. \r\nBroj saradnika na projektu se konstantno uvecava,a taj trend ce biti nastavljen i u daljim fazama razvoja.\r\nPovratne informacije od farmera integrisane u resenje.', NULL, NULL),
(398, 44, 168, 'Nismo do sada ucestvovali .', NULL, NULL),
(399, 45, 168, 'Do sada nismo prikupili sredstva iz bilo kakvih izvora finansiranja.', NULL, NULL),
(400, 48, 168, 'Očekivanja od ovog programa usmerena su prvenstveno na snažnu mentorsku podršku u daljem razvoju našeg rešenja i ulasku na tržište.\r\nOčekujemo da ćemo uz finansijsku podršku kroz ulazni grant dobiti i ono što smatramo mnogo vrednijim, a to je znanje.\r\nZnanje kako savladati nove veštine i pripremiti se za uspešan početak na tržištu.\r\nOčekujemo da ćemo nakon završetka programa biti dobro obučeni kako bismo mogli uspesno skalirati nas proizvod i privući potencijalne investitore.\r\nOčekujemo da će nakon završetka programa naša poslovna filozofija doživeti pozitivnu transformaciju u pravcu kreiranja novog kvaliteta u realizaciji nasih zadataka.\r\nSegment u kome bi nam podrska bila najpotrebnija je segment skaliranja proizvoda i kreiranja efikasne marketing kampanje.', NULL, NULL),
(401, 49, 168, 'Kako bi smo nas MVP doveli do konacne prve verzije platforme i zapoceli  plasman  na trziste u ovoj fazi bi nam bilo potrebno oko 50.000 eur. Sredstva bi se uglavnom usmerila na plate i naknade kljucnih clanova osoblja kao i za nabavku dela neophodne opreme.\r\nDeo sredstava bi se usmerio u kreiranje marketing kampanje,kako u digitalni marketing,tako i u promocije i prezentacije na terenu u direktnom kontaktu sa nasim potencijalnim kupcima.', NULL, NULL),
(402, 52, 168, NULL, NULL, NULL),
