(405, 83, 174, NULL, NULL, NULL),
(406, 89, 175, 'dipl.ecc.-poseduje iskustvo u bankarskom sektoru', NULL, NULL),
(407, 90, 175, 'Direktor \"Agro Budzet Sistem\"doo,\r\nPotpuno posvecena', NULL, NULL),
(408, 91, 175, NULL, NULL, NULL),
(409, 71, 177, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(410, 63, 178, 'Tapni.co je kompanija koja je zauzela evrposko trziste, mi smo napravili isti proizvod, sa domacom proizvodnjom u Srbiji. Cilj nam je da zauzmemo balkansko trziste, medjutim problem je sto je tapni dobio investicije i planira da se prosiri i po balkanu, a nas domaci proizvod ce propasti, jer mi nemam takve investicije da ubrzamo proizvodnju i marketing. Resenje postoji aplikacija koja radi, i par test fizickih proizvoda.\r\nFirmu smo registrovali bas iz ovog razloga kako bi mogli da pokrenemo prodaju i realizujemo proizvod na sto vecem nivou.\r\n\r\nMozete pogledati kod njih kako proizvod funkcionise, a nas sajt je: www.pipni.app', NULL, NULL),
