(466, 63, 202, 'Echoo-moon zvučnici mogu se okarakterisati kao mali korak za čoveka, a veliki za svet dizajna. Elegant, Charming, High-quality i Ornamental zvučnici u motivu mesečevih mena, namenjeni su za promenu standardnog uživanja u muzivi. U svojoj osnovi sadrži tri zvučnika i LED svetla koja obasjavaju vidljivi deo meseca.', NULL, NULL),
(467, 71, 203, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(468, 17, 204, 'Echoo-moon zvučnici mogu se okarakterisati kao mali korak za čoveka, a veliki za svet dizajna. Elegant, Charming, High-quality i Ornamental zvučnici u motivu mesečevih mena, namenjeni su za promenu standardnog uživanja u muzivi. U svojoj osnovi sadrži tri zvučnika i LED svetla koja obasjavaju vidljivi deo meseca.', NULL, NULL),
(469, 22, 204, 'Do sada nismo kao tim saradjivali na zajedničkim projektima.', NULL, NULL),
(470, 23, 204, 'Glavna motivacija za prijavu za ovaj Program bila je želja da našu ideju pretvorimo u realnost.', NULL, NULL),
(471, 24, 204, 'Resonate the bright side of the moon.', NULL, NULL),
(472, 25, 204, 'Echo - moon zvučnici stvoreni su kako  bi pružili razliku od ostalih produkta te kategorije svojim kvalitetom, estetikom i funkcionalnošću. Kako su i svetlost i zvuk zajedno povezani vibracionim talasima,  moćiće da pruže utočište i mir potrošačima koji su razvili strahove u toku trajanja pandemije. Mogu umiriti anksioznost, poboljšati raspoloženje, dati novi život prostoru, i  još mnogo toga.', NULL, NULL),
(473, 26, 204, 'Tržište koje se targetuje je tržište wireless zvučnika koje je procenjeno na 8,93 milijardi dolara. U sledećem linku prilažemo istraživanje obavljeno od strane Fortune Business Insights : https://www.fortunebusinessinsights.com/wireless-speakers-market-102657\r\n\r\nSama ideja Echo moon zvučnika nastala je po uzoru na Beosound shape - zvučnike danske kompanije Bang&Olufsen, moguća saradnja sa ovom kompanijom je u daljem interesu tima.\r\nU početnom stadijumu cilj je da se Echo moon zvučnici prodaju na području cele Evrope. Sledeća faza razvoja kompanije  bila bi geografska ekspanzija u Sjedinjenim Američkim Državama.', NULL, NULL),
(474, 27, 204, '.Echo-moon zvučnicima rešavamo problem inovativnosti tržišta. Preko 10 multimilionskih kompanija širom sveta bave se proizvodnjom Bluetooth zvučnika, ali se samo par proizvoda mogu izdvojiti kao inovativni/revolucionarni. Naša želja je da jedan od njih budi i Echo-moon zvučnici. Teško je odrediti demografiju i starosne grupe potencijalnih kupaca s obzirom da je u pitanju proizvod koji mogu da koriste kako deca tako i odrasli, jednostavnost upotrebe aplikacije preko koje se upravljaju zvučnici, čini je lako dostupnom za sve uzraste. Kako je sama ideja nastla za vreme Covid - 19 pandemije, Echo-moon zvučnici su tu da pomognu svojim vlasnicima da se oslobode stresa, strahova i svega ostalog što dolazi sa mnogobrojnim dešavanjima za vreme pandemije, lockdown-ovi. zdravstvene mere,izuzetno umanjeni socijalni kontakt i td.', NULL, NULL),
(475, 28, 204, 'Echo-moon zvučnici predstavljaju modularni sistem zvučnika namenjenih za slušanje muzike uz estetski doživljaj. Dizajn zvučnika osmišljen je kao stvaranje iluzije mesečevih mena, uz simultan rad zvučnika i osvetljenja. Tehnologija koja se koristi je IoT. Unikatna tačka ovog proizvoda nalazi se u samoj estetici koja još uvek nije prikazana tržištu. Echo-moon zvučnici poseduju moć da samim postojanjem u prostoriji,  probude emocije svakom ko se susretne sa njima. Pravilnom kombinacijom zvuka i svetla, otvaraju vidike nove dimenzije.', NULL, NULL),
(476, 30, 204, 'Kao što je gore već navedeno, kupci Bluetooth zvučnika imaju veliki spektar proizvoda, međutim, svi manje-više izgledaju isto, ili nude iste mogućnosti; taj problem se najčešće rešava kupovinom/ proizvodnjom posebnih custom-made zvučnika koji su uglavnom dosta skuplji i veći od standardnih Bluetooth zvučnika. Direktna konkurencija jeste danska kompanija Bang&Olufsen, (specifično BeoSound shape)  po istraživanju tržišta, jedino su se oni istakli kao High-tech kompanija sa inovacijama u dizajnu, i posvećivanju pažnje istom.', NULL, NULL),
(477, 29, 204, 'Glavni benefit našeg proizvoda u odnosu na druge proizvod te kategorije jeste sama estetika. U cilju nam je da zvučnike dovedemo sa savršenstva, odnosno da zajedno sa mentorima i stučnjacima dublje uđemo u samu srž zvuka, talasa i vibracija. Time bi smo upotpunili proizvod, njegovu tematiku i celokupni doživljaj koji će Echo-moon zvučnici doprineti kupcima.', NULL, NULL),
(478, 32, 204, 'Smatramo da do sada na tržištu nije prikazan proizvod sa ovakvim vizuelnim efektima koji nudi naš produkt.', NULL, NULL),
(479, 37, 204, 'Razmišljali smo o mogućnosti zaštite intelektualne svojine u toku trajanja Raising Starts programa', NULL, NULL),
(480, 40, 204, '. Prodajom samog proizvoda i mogućom saradnjom sa nekim od vodećih kompanija na tom podrčju.', NULL, NULL),
(481, 41, 204, 'Ideja je nastala sredinom 2020. godine. Dizajn je stvoren na samom početku, zajedno sa njim dodeljene su funkcije ozvučenja i osvetljenja. U kasnijem razvoju, tim je okupljen kako bi znanja koja poseduju ostali članovi, upotpunili rad zvučnika do detalja. Razgovarali smo sa stručnjacima u svim neophodnim poljima (eletronika, elektrotehnika, produkcija) koji su nam pomogli da rešimo tadašnje probleme.\r\nNaš projekat je konačnoj u fazi ideje, zbog čega se prijavljujemo na ovaj Program, jer nam je za dalji razvoj neophodna stučna i finansijska podrška.', NULL, NULL),
(482, 44, 204, 'Do sada nismo bili učesnici ni jednog start up programa.', NULL, NULL),
