(602, 63, 262, 'Biznis akademija je nastala kao nastavak dugogodišnje menadžerske, preduzetničke, trenerske i konsultantske karijere dvoje supružnika, sa ciljem da se stečeno znanje i iskustvo prenese na mlađe menadžerske generacije. \r\nPored desetogodišnjeg iskustva u držanju poslovnih treninga u oblastima menadžmenta, marketinga, prodaje, finansija i ljudskih resursa u najvećim kompanijama u regionu, desetogodišnjeg konsultantskog iskustva u već navedenim oblastima, desetogodišnjeg iskustva u vođenju marketinške agencije, desetogodišnjeg menadžerskog iskustva na najvišim iskustvima u internacionalnim kompanijama, ključne razlike u odnosu na slične edukacijske kuće biće:  \r\n1. Veliki broj praktičnih primera iz regionalne poslovne prakse (Case study)\r\n2. Gostovanje u uspešnim regionalnim kompanijama i prezentovanje uspešnih poslovnih modela\r\n3. Kreativna digitalna audio-vizualna produkcija - kreiranje interaktivnih kurseva i radionica\r\n4. Intenzivna saradnja sa velikim brojem vrhunskih stručnjaka i trenera/predavača u raznim poslovnim oblastima (finansije, menadžment, ljudski resursi, logistika, komercijala, marketing)\r\n5. Dugogodišnje iskustvo u obučavanju novih trenera/predavača', NULL, NULL),
(603, 71, 263, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(604, 17, 264, 'Biznis akademija je nastala kao nastavak dugogodišnje menadžerske, preduzetničke, trenerske i konsultantske karijere dvoje supružnika, sa ciljem da se stečeno znanje i iskustvo prenese na mlađe menadžerske generacije. \r\nPored desetogodišnjeg iskustva u držanju poslovnih treninga u oblastima menadžmenta, marketinga, prodaje, finansija i ljudskih resursa u najvećim kompanijama u regionu, desetogodišnjeg konsultantskog iskustva u već navedenim oblastima, desetogodišnjeg iskustva u vođenju marketinške agencije, desetogodišnjeg menadžerskog iskustva na najvišim iskustvima u internacionalnim kompanijama, ključne razlike u odnosu na slične edukacijske kuće biće:  \r\n1. Veliki broj praktičnih primera iz regionalne poslovne prakse (Case study)\r\n2. Gostovanje u uspešnim regionalnim kompanijama i prezentovanje uspešnih poslovnih modela\r\n3. Kreativna digitalna audio-vizualna produkcija - kreiranje interaktivnih kurseva i radionica\r\n4. Intenzivna saradnja sa velikim brojem vrhunskih stručnjaka i trenera/predavača u raznim poslovnim oblastima (finansije, menadžment, ljudski resursi, logistika, komercijala, marketing)\r\n5. Dugogodišnje iskustvo u obučavanju novih trenera/predavača', NULL, NULL),
(605, 22, 264, 'Da, zajedno smo osnovali marketinšku agenciju 2000. i 4 godine zajedno radili. Posle 4 godine Miljan je dobio ponudu da bude generalni direktor kompanije Hemel, a ja sam (Vesna) nastavila  da samostalno vodim agenciju', NULL, NULL),
