(608, 25, 264, 'Rešavamo problem nedovoljnog znanja menadžera\r\nProblem je izražen jer je oslabio sistemski razvoj kadrova unutar preduzeća \r\nIma mnogo ljudi kojima je znanje potrebno, a veliki broj nije ni svestan da ta znanja postoje dostupna i da mogu puno pomoći. Za nas ovaj problem nije težak, imamo puno ličnog iskustva i puno saradnika koji raspolažu ovim znanjima i predavačkim iskustvima', NULL, NULL),
(609, 26, 264, 'Targetirana tržišta su internacionalne kompanije koje posluju na tržištu Srbije i regiona i domaće kompanije u Srbiji i regionu. Ukupan obim tržišta edukacija u Srbiji i regionu je oko 2 miliona eur, na osnovu uvida u prihode ključnih konkurenata (https://www.apr.gov.rs/). Biznis se u naredne 2 godine može raširiti na zemlje u regionu Bosna i Hercegovina, Makedonija i Crna Gora', NULL, NULL),
(610, 27, 264, 'Potencijalni kupci su HR menadžeri, vlasnici i rukovodioci sektora. Poslovni ljudi koji su posvećeni unapređenju rezultata, svesni da se uspeh postiže razvojem podređenih i svesni da u okviru svojih organizacija nemaju dovoljno stručnog znanja i iskustva za sve izazove sa kojima se suočavaju. Sprovedeno je istraživanje tržišta sa navedenim ciljnim grupama, preko 20 ljudi i svi su zainteresovani', NULL, NULL),
(611, 28, 264, 'Nismo opredelili tehnologiju, potrebna nam je stručna pomoć. \r\nNaš proizvod/usluga je jedinstvena po:\r\n- načinu realizacije, svi ostali imaju obuke uživo i online, mi ćemo imati i interaktivne snimljene edukacije koje će se kombinovati  \r\n- kvalitetu, veliki broj primera iz domaće prakse, gostovanje u preduzećima, veliki broj edukatora na raspolaganju, iskustvo u izradi audio i video materijala...', NULL, NULL),
(612, 30, 264, 'Na tržištu postoji skromna ponuda edukacija u nekoliko oblasti ali mnogo manje od toga koliko je tržištu potrebno, zbog čega internacionalne kompanije šalju svoj zaposlene na edukacije u zemlje Zapadne Evrope, dok domaće kompanije nemaju uslova za to', NULL, NULL),
(613, 29, 264, 'Glavni benefiti su teoretska i praktična znanja prezentovana kroz Case study na osnovu kojih polaznici edukacija mogu lakše rešavati sopstvene probleme na poslu. Snimljene audio-vizuelne interaktivne radionice omogućuju polaznicima da se edukuju u terminima kada njima najviše odgovora', NULL, NULL),
(614, 32, 264, 'Proizvod/usluga je poboljšan zato što se dodaju interaktivni audio-vizuelni elementi i simulacije koje će jednostavnije prikazivati suštinu, tj. načine za upravljanje poslovanjem', NULL, NULL),
