(617, 41, 264, 'Ideja je nastala pre 2,5 g, rad na ideji otpočeo je pre 1,5 g, pre 14 m je angažovano više od 20 stručnjaka koji će biti predavači na edukacijama, pre 12 m kreirana je štampana brošura za Program za buduće top menadžere, pre 12 meseci kreiran je početni sajt, pre 12 meseci formirana je prva grupa polaznika (odloženo zbog Covid-19 za proleće 2022.), pre 5 m je registrovano preduzeće (DOO)', NULL, NULL),
