(633, 63, 275, 'Skenit je softver namenjen svim učesnicima u fitnes industriji koji preduzetnicima u fitnesu omogućava upravljanje poslovanjem i organizaciju aktivnosti kako bi unapredili svoje poslovne rezultate, a istovremeno svojim korisnicima pruža mogućnost da prate njihove aktivnosti, napreduju i ostanu u toku sa svojim aktivnim članarinama.', NULL, NULL),
(634, 71, 276, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(635, 17, 277, 'Skenit je softver namenjen svim učesnicima u fitnes industriji koji preduzetnicima u fitnesu omogućava upravljanje poslovanjem i organizaciju aktivnosti kako bi unapredili svoje poslovne rezultate, a istovremeno svojim korisnicima pruža mogućnost da prate njihove aktivnosti, napreduju i ostanu u toku sa svojim aktivnim članarinama.', NULL, NULL),
(636, 22, 277, 'Da. Aleksa i Uroš su zajedno osnivači SPR tima sa kojim već 2 godine uspevaju da budu inovativni u domenu ličnih personalnih trenera. Marko, Nikola, Anja i Ena rade zajedno kao tim već 3 godine na razvoju mobilnih aplikacija. Pored toga aktivno su učestvovali na projektima tokom studija. Marko i Nikola još od srednje škole zajedno realizuju više projekata, učestvuju na takmičenjima i jedan kraći period rade u istoj firmi.', NULL, NULL),
(637, 23, 277, 'Motivisalo nas je to što smo trenutno u takvoj fazi da možemo da se posvetimo razvoju Skenita i da postignemo bržu potvrdu svojih ideja. S obzirom da smo zvanično osnovali privredno društvo i u kratkom roku objavljujemo novu verziju softvera sa brojnim poboljšanjima Raising Starts program nam može pomoći u bržoj realizaciji planova.\r\n\r\nVerujemo da obuke i mentorstva na polju skaliranja poslovanja na globalno tržište mogu da nam pomognu da definišemo preciznije šta je još potrebno da bismo se uspešno skaliraliRazgovorom sa prethodnim učesnicima ovog programa dobili smo preporuku da je sada dobar momenat da se prijavimo.', NULL, NULL),
(638, 24, 277, 'Skenit vas vodi ka boljem poslovanju i organizaciji fitnes aktivnosti, i ka većoj lojalnosti vaših korisnika.', NULL, NULL),
(639, 25, 277, 'Skenit je sistem koji rešava uobičajeni problem sinhronizacije vlasnika sa aktivnostima zaposlenih, trenera sa klijentima (kada su u pitanju rasporedi treninga i deljenje važnih informacija), kao i činjenicu da korisnici retko imaju mogućnost da prate svoje aktivnosti i budu svesni napretka koji su postigli na tom putu. Problem postoji globalno jer je u svetu fitnes industrija dosta razvijena i stalno se poboljšava. Problem može biti izazovan jer postoji dosta učesnika i potrebno je ponuditi svima jedinstveno rešenje. Bez Skenit-a informacije nisu sinhronizovane što otežava posao bez puno benefita. Inicijalno smo saznali za problem od vlasnika teretane čiji smo članovi. Nakon što smo razvili inicijalno rešenje koje im je rešilo problem upravaljanja članarinama i dolascima uvideli smo zajedno sa osnivačima SPR-tima da problem itekako postoji kod personalnih trenera i da kreiranje sistema kao što je Skenit može da im pomogne u širenju poslovanja na više klijenata i većeg tima trenera.', NULL, NULL),
(640, 26, 277, 'Kada je u pitanju lokalno ciljno tržište prema podacima prikupljenim od SRFS i na osnovu konkurenata, govorimo o oko 500 teretana i 5000 ličnih trenera koji su potencijalni korisnici.\r\nA kada je u pitanju globalno ciljno tržište, prema Deloitteovom izveštaju, u 2019. godini bilo je 61.984 fitnes centara (sa rastom od 4,6%) sa sedištem u Evropi. Takođe samo u SAD fitnes industija ima oko 15 milijardi dolara prihoda prema izveštaju IHRSA u 2020.\r\nPrikazani podaci govore da je fitnes industrija u stalnom porastu, a samim tim i naše tržište.\r\n\r\nU prvoj fazi ciljamo na korisnike na lokalnom tržištu– grupe trenera, samostalne trenere, manje fitnes centre do 300 korisnika.\r\n\r\nU drugoj fazi ciljali bismo na prethodno pomenute korisnike, ali ovog puta u okviru globalnog tržišta, Aleksa i Uroš u Dubaiju poznaju više personalnih trenera, pa pored Evrope i Amerike i to tržište smatramo pogodnim za brži rast.', NULL, NULL),
(641, 27, 277, 'Potencijalni kupci: svako ko učestvuje u procesu obuke, vežbanja i organizovanja fitnes aktivnosti, od trenera i vežbača do vlasnika centara u kojima se ove vežbe održavaju.\r\n\r\nIdealan kupac: fitnes preduzetnik koji razume važnost informacionih tehnologija i upotrebe multifunkcionalne aplikacije za olakšanje poslovanja, koji samostalno organizuje fizičke aktivnosti i ne gleda na to kao na jedini izvor prihoda, koji vidi probleme koje ima sa organizacijom i zbog njih treba da vodi opštu evidenciju o svom poslovanju, ali u isto vreme želi da podigne poslovanje na viši nivo.Tokom aprila i maja 2021. smo posetili preko 20 teretana u Novom Sadu u nekim smo dobili feedback od zaposlenih, a u 6 teretana smo vodili detaljan razgovor sa vlasnicima koji su bili zainteresovani da implementiraju softver. Rezultat toga je bio rad na novoj verziji aplikacije i potom dodatno proširivanje sistema na trenere.', NULL, NULL),
(642, 28, 277, 'Koristeći prednosti mobilnih aplikacija (razvijenih u Kotlin - Android, Swift - iOS) omogućavamo da sve aktivnosti mogu da se obavljaju na bilo kom mestu u teretani i van teretane, a ne samo za pultom i računarom.Jedino mobilne telefone svi nosimo uvek sa sobom i najviše podataka čuvamo u njima.\r\n\r\nSkenit vodi trenere ka boljem poslovanju i organizaciji, jer ih rasterećuje pri radu sa klijentima, dok u isto vreme vodi fitnes centre ka većem angažmanu njihovih klijenata. \r\n\r\nPredstavlja kombinaciju kalendarskih, organizacionih i komunikacionih alata koje lični treneri često koriste za upravljanje aktivnostima svojih klijenata.', NULL, NULL),
(643, 30, 277, 'Korisnici koji ne koriste specifičan softver pokušavaju da reše probleme vođenje posla koristeći više različitih alata. Excel tabele, Trello board, Google Calendar, upisivanje u svesku, dopisivanje preko raznih chat aplikacija.\r\n\r\nKonkurencija koja ima za cilj da digitalizuje određeni deo poslovanja trenera i fitnes centara:\r\n\r\nMindBody\r\n\r\nSoftver za upravljanje i zakazivanje termina.Previše zakomplikovan, skupo i teško ga je ugraditi kao manji tim. Pokriva karakteristike Skenita, ali mu nedostaje fokus na trenere i fitnes centre. \r\n\r\nTrainerize\r\n\r\nSoftver za lične trenere koji broji 200.000 trenera, 25.000+ fitnes preduzeća i preko 1 milion klijenata. Fokusiran je samo na online treninge\r\n\r\nGofitness\r\nSoftver za upravljanje teretanom na lokalnom tržištu čiji je glavni fokus na fitnes centrima. Nedostaje mu dobra povezanost između fitnes centara, zaposlenih i upravljanje aktivnostima u teretani. Nije fokusiran na trenere, koliko na fitnes centre', NULL, NULL),
(644, 29, 277, '- Praćenje napretka poslovanja i na osnovu tih informacija donošenje odluka o poboljšanju.\r\n- Povećanje posvećenosti korisnika kroz mobilnu aplikaciju i kvalitet usluge\r\n- Organizacija i pregled dolazaka, članarina i treninga\r\n- Jednostavan sistem koji povezuje trenere, vlasnike teretana (menadžere teretana) i korisnike.', NULL, NULL),
(645, 32, 277, 'Poboljšava postojeće softvere za upravljanje fitnes centrima i trenerima jer objedinjuje njihove aktivnosti i omogućava trenerima da unaprede svoje poslovanje.', NULL, NULL),
(646, 37, 277, 'Ne planiramo', NULL, NULL),
(647, 40, 277, 'Od mesečne i godišnje licence trenerima i fitnes centrima. \r\nOd razvoja dodatnih zahteva kao što su brendiranje ili specifična funkcionalnost za njihove potrebe.', NULL, NULL),
(648, 41, 277, 'U Novembru 2020. Marko uviđa da vlasnici njegove teretane imaju potrebu da se digitalizuje upravljanje članarinama i dolascima. U okviru agencije Crystal Pigeon kreću da se razvijaju aplikacije za korisnike teretane i vlasnike teretane. \r\nU Januaru 2021. kreće da se koristi prva verzija. Nakon dobijenih povratnih informacija više teretana odlučujemo da unapredimo trenutno rešenje.\r\n\r\nU Julu 2021. tim se širi tako što upoznaje Uroša i Aleksu koji su personalni treneri. Pre nego što smo se upoznali oni su neko vreme razvijali mobilnu aplikaciju za njihove potrebe pa smo na taj način brzo pronašli zajednički cilj.\r\n\r\nU Novembru smo implementirali Skenit unutar SPR tima trenera koji ga koriste svakodnevno sa svojim korisnicima gde smo dobili neprocenjivo iskustvo i potvrdu rešenja.\r\n\r\nU tom momentu odlučujemo da odbacimo deo teničkog rešenja koje je rađeno u tehnologiji za brži razvoj (Flutter) i da je razvijemo u tehnologiji sa kojom postižemo  kvalitet, skalabilnost.', NULL, NULL),
(649, 44, 277, 'Nismo', NULL, NULL),
(650, 45, 277, 'Nismo', NULL, NULL),
(651, 48, 277, 'Uspostavljenje i realizacija dobre marketinške strategije.\r\n\r\nPotvrda ideja koje omogućavaju individualnim treneri širom sveta da formiraju timove i budu efikasniji koristeći našu aplikaciju.\r\n\r\nDefinisati bolje prodajne kanale, potvrda idealnog kupca i ideje kako da se smanji vreme potrebno za uključivanje novog korisnika.\r\n\r\nDefinisati skalabilan način naplate individualnih trenera i fitnes centara, kao i nove potencijalne izvore zarade.\r\n\r\nPronaći mentora koji ima iskustva sa skaliranje sličnog softvera (CRM, ERP).\r\n\r\nStvaranje novih poznanstava', NULL, NULL),
(652, 49, 277, '15.000 EUR Cilj ovih ulaganja bi bio da dopremo do što većeg broja korisnika kako bismo brže mogli da potvrdimo nove ideje\r\n\r\n15% - Platićemo osobi za marketing da definiše marketinšku strategiju i vodi kampanju kako bismo mogli da plasiramo proizvod na globalno tržište.\r\n10% - Angažovaćemo konsultanta za prodaju kako bi definisao tokove prodaje i pomogao nam u unapređenju naših prodajnih aktivnosti.\r\n40% - Za troškove razvoja softvera. Ulagaćemo u web i backend razvoj, ovo je manji deo našeg celog softvera za koji je potrebno da zaposlimo dodatnu osobu\r\n\r\n5% - Pravne, računovodstvene i druge naknade\r\n\r\n30% - Iznajmljivanje kancelarije, opreme i promotivnog materijala', NULL, NULL),
(653, 52, 277, 'Lena Miladinović - Outpost chess i Milorad Glavan, član UMPS (Udruženje Mladih Privrednika Srbije)', NULL, NULL),
(654, 66, 280, NULL, NULL, NULL),
(655, 76, 281, NULL, NULL, NULL),
(656, 83, 283, NULL, NULL, NULL),
(657, 71, 284, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(658, 63, 285, 'Jurist Biro -  softversko rešenje za automatizovanu izrada dokumentacije iz radnog odnosa, obaveznih dokumenata iz poslovanja privrednih subjekata i svih evidencija iz oblasti ljudskih resursa.', NULL, NULL),
(659, 71, 286, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(660, 17, 287, 'Jurist Biro -  softversko rešenje za automatizovanu izrada dokumentacije iz radnog odnosa, obaveznih dokumenata iz poslovanja privrednih subjekata i svih evidencija iz oblasti ljudskih resursa.', NULL, NULL),
(661, 22, 287, 'Kao dugogodišnji prijatelji koji imaju veliki krug zajedničkih prijatelja, imali smo priliku da sarađujemo u okviru projekata nevladine organizacije GROF iz Niša kao i u okviru studentskih organizacija na Univerzitetu u Nišu. Iza nas je nekoliko uspešnih kampanja i projekata u NVO sektoru.', NULL, NULL),
(662, 23, 287, 'Kao start up kompanija nalazimo se na prelomnoj tački s obzirom da je program u beta fazi  i da je testiranje proizvoda od strane nekoliko potencijalnih korisnika u toku. Smatramo da je neophodna ozbiljna priprema pred nastup  na tržište, utvrđivanje biznis modela kao i ozbiljan marketinški model. Za razliku od drugih programa koji se uglavnom odnose na specifične nivoe razvoja i unapređenja proizvoda, koji favorizuju veštačku inteligenciju, program Raising starts pruža svim start up kompanijama mogućnost podrške, koja je fokusirana na suštinsku i konkretnu pomoć kako kroz ekspertsku pomoć tako i kroz finansijsku podršku koja može ubrzati i olakšati put do natupa na tržiše i održivost. Kvalitetan info dan o programu u NTP Niš je samo potvrdio našu odluku o prijavi.', NULL, NULL),
(663, 24, 287, 'Jurist Biro - pametna izrada obaveznih dokumenata!', NULL, NULL),
(664, 25, 287, 'Sva dokumentacija i akti u skladu sa pozitivnim propisima, koji se jednostavno i automatski izrađuju, što pruža pravnu sigurnost svim korisnicima i zaštitu od velikih kazni i sudskih sporova sa zaposlenima. Prema  rezultatima istraživanja tržišta i informacija od inspektora rada, više od 90% malih i srednjih preduzeća nema ispravnu i kompletnu dokumentaciju.', NULL, NULL),
(665, 26, 287, 'Mikro i mala preduzeća(do 50 zaposlenih) koja uglavnom nemaju upošljene pravnike i kojih u Srbiji ima preko 90.000 prema statistici zavoda. Srednja i velika preduzeća, kojima je od značaja ušteda vremena, sigurnost i evidencije koje program pruža, i kojih ima oko 2.700. (izvor https://publikacije.stat.gov.rs/G2020/pdf/G20206006.pdf). Nakon nastupa na tržište Srbije, namera nam je postepeno širenje i na druga tržišta.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(666, 27, 287, 'Prioritetna grupa jesu MSP koja zbog preokupiranosti svojom delatnošću nemaju vremena ni kapaciteta da brinu o pravnom aspektu poslovanja. Obavili smo anketu i prikupili informacije po uzorku od 50 ispitanika, koje su nam pokazale da velika većina nema zakonom obavezna akta i da postoji strah od kazni koje propisuje Zakon o radu. Sigurni smo da će Jurist biro mnogima rešiti taj problem.', NULL, NULL),
(667, 28, 287, 'Jurist Biro je web aplikacija izrađena u programu Symfony PHP Framework. Postoji više funkcija programa: 1. Automatska izrada akata sa zakonitom sadržinom, uz putokaz obaveznosti u skladu sa zakonom, 2. Evidencija iz oblasti rada, 3. Obaveštavanja o istecima ugovora o radu, odmora, bolovanja. 4. Komunikacija između zaposlenih i poslodavca preko mobilne aplikacije. 5. Zaštita podataka korisnika kroz kriptovanje baze podataka. Prednost programa je u jednostavnosti korišćenja i preglednosti, bez neophodnosti edukacije korisnika, kao i mogućnosti korišćenja sopstvenih šablona kroz program. Program sadrži više funkcija i modula koji se mogu samostalno koristiti.', NULL, NULL),
(668, 30, 287, 'Potencijalni korisnici se uglavnom oslanjaju na knjigovodstvene agencije i po pitanju rešavanja pravnih akata ali samo u oblasti računovodstva i knjigovodstva. Ostale obavezne akte uglavnom ne koriste ili ne koriste u potpunosti. Velika većina redovnu kontrolu inspekcije rada može imati tek u šestoj godini poslovanja, imajući u vidu broj inspektora rada i privrednih subjekata. Situacija se u potpunosti menja kada dođe do nekog problema (povreda na radu, prijava zaposlenog i slično) kada se radi vanredni nadzor i kada se u slučaju utvrđivanja nepravilnosti izlažu velikim kaznama. Na svetskom tržišti postoji nekoliko ozbiljnih programa koji su nedostupni u Srbiji pre svega zbog velikih cena a i složenosti korišćenja.  U Srbiji smo utvrdili postojanje jednog programa koji ima neke slične funkcionalnosti i koji uspešno radi poslednje dve godine, ali smo utvrdili da nije dovoljno fleksibilan i prijemčiv za veći obim korisnika iz više razloga.', NULL, NULL),
(669, 29, 287, '- poslovanje u skladu sa zakonom i pravna zaštita od velikih kazni\r\n- trostruko brža izrada dokumentacije više od  150 modela akata koji imaju zakonsku sadržinu\r\n- automatsko obavešatavanje o istecima ugovora o radu, godišnjeg odmora i slično\r\n- elektronska komunikacija sa zaposlenima preko mobilne aplikacije', NULL, NULL),
(670, 32, 287, '- lak i samostalan pristup i korišćenje programa - korisnik ne mora da se prilagođava programu već se program prilagođava korisniku\r\n- trostruko niža cena licence za korišćenje - besplatno obaveštavanje korisnika o svim zakonskim izmenama - mogućnost podele uloga kod korisnika', NULL, NULL),
(671, 37, 287, 'Izvršili smo preliminarno ispitivanje i nameravamo zaštitu kroz deponovanje autorskog dela i zaštitu žiga, pre svega na teritoriji Republike Srbije. Vlasnik programa bilo bi privredno društvo Jurist Soft, dok bi se kao autor naveo Srdjan Janjić koji je neposredni kreator softverskog rešenja.', NULL, NULL),
(672, 40, 287, 'Od prodaje licence za korišćenje programa. Namera nam je da program bude besplatan sa svojim osnovnim funkcijama za sve start up kompanije do 5 zaposlenih, dok će se za ostale postojati cenovnik u zavisnosti od broja zaposlenih. Pored korišćenja programa korisnici će imati mogućnosti i korišćenja konsultatskih usluga u oblasti prava koji će se posebno naplaćivati kao i besplatan informator o izmeni propisa.', NULL, NULL),
(673, 41, 287, 'Avgusta 2020. godine napravili smo dogovor oko ideje i krenuli sa realizacijom. U Decembru 2020.godine bio je gotov prvi protoptip programa sa dve funkcije i nakon primene u praksi od strane tri korisnika i na osnovu ispitivanja tržišta, shvatili smo da smo na dobrom putu i dogovorili dalje funkcije na osnovu utvrđenih potreba. Takođe smo uključili još dva lica koja se povremeno angažuju za potrebe testiranja i front end programiranja.', NULL, NULL),
(674, 44, 287, 'Ne.', NULL, NULL),
(675, 45, 287, 'Glavni izvor finansiranja bio je od obavljenog posla za potrebe klijenta iz Nemačke čime smo uspeli da pokrijemo troškove poslovanja u 2021.godini. Trenutno ne raspolažemo bilo kakvim sredstvima za finansiranje u 2022.godini.', NULL, NULL),
(676, 48, 287, 'Očekujemo korisne savete u pogledu strategije nastupa na tržištu kao i razvoja biznis plana. U slučaju izbora za Fazu 2, finansijska podrška bi nam umnogome pomogla da profesionalno angažujemo dva lica radi unapredjenja proizvoda, testiranja i podrške korisnika.', NULL, NULL),
(677, 49, 287, 'Finansijska podrška u iznosu od 10.000,00 CHF značila bi nam pre svega za angažovanje dva lica, na poslovima testiranja i podrške korisnika kao i na poslovima front end programiranja. Radi se o licima koje smo povremeno angažovali u skladu sa finansijskim mogućnostima. Takođe, deo finansijskih sredstava iskoristili bi smo na kupovinu sredstava za rad (lap top, štampač),za potrebe dobijanja ISO sertifikata 27001 i zaštite intelektualne svojine.', NULL, NULL),
(678, 52, 287, NULL, NULL, NULL),
(679, 66, 290, NULL, NULL, NULL),
(680, 76, 291, NULL, NULL, NULL),
(681, 83, 293, NULL, NULL, NULL),
(682, 89, 294, 'Univerzitet u Nišu Pravni Fakultet. \r\n15 godina radnog iskustva na pravnim poslovima u oblastima radnog i privrednog prava. Licenca za obavljanje postupaka reorganizacije i stečaja. U periodu od juna 2010. do oktobra 2012. obavljao poslove Izvršnog direktora Regionalne razvojne agencije Jug i učestvovao u više uspešno realizovanih projekata (RSEDP 2). Konstantno praćenje važećih propisa iz oblasti radnog i privrednog prava.', NULL, NULL),
(683, 90, 294, '- delimično posvećen, u proseku 3 sata dnevno.\r\n- kreator inicijalne ideje zbog potrebe svog posla.', NULL, NULL),
(684, 91, 294, '- Pravni savetnik u kopaniji koja posluje na svetskom tržištu,sa punim radnim vremenom', NULL, NULL),
(685, 89, 295, 'Nakon apsolviranja na Medicinskom fakultetu u Nišu, programiranje kao dotadašnji hobi postaje profesionalni poziv. Nakon višegodišnjeg rada i usavršavanja glavne veštine su programi: MySQL, PHP, Magento. Stalno praćenje i edukacija o svim novinama i trendovima u oblasti IT razvoja.', NULL, NULL),
(686, 90, 295, '- u većoj meri posvećen, u proseku 5 sati dnevno\r\n- kreator softverskog rešenja', NULL, NULL),
(687, 91, 295, '- kao freelancer angažovan na projektima, u proseku 5 sati dnevno', NULL, NULL),
(688, 71, 298, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
