(754, 63, 327, 'Mi pravimo aplikaciju na kojoj korisnici mogu da naprave svoju virtuelnu farmu, sade šta žele, održavaju sadnice, gaje stoku a sve to zapravo radi neko u pozadini, u stvarnosti. Na kraju, korisnicima stiže finalni proizvod za koji su se odlučili. Ideja je da nakon određenog perioda, korisnicima ovo postane glavni izvor snadbevanja hranom kao i glavni izvor zabave.', NULL, NULL),
(755, 71, 328, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(756, 17, 329, 'Mi pravimo aplikaciju na kojoj korisnici mogu da naprave svoju virtuelnu farmu, sade šta žele, održavaju sadnice, gaje stoku a sve to zapravo radi neko u pozadini, u stvarnosti. Na kraju, korisnicima stiže finalni proizvod za koji su se odlučili. Ideja je da nakon određenog perioda, korisnicima ovo postane glavni izvor snadbevanja hranom kao i glavni izvor zabave.', NULL, NULL),
(757, 22, 329, 'Lazar i Sava su članovi Case Study Club-a, najveće studentske menadžment konsalting organizacije na Balkanu. Takođe, obojica su članovi Business Developmenta u toj organizaciji. Iz tog razloga, imali su priliku da zajedno rade na raznim projektima. \r\nAleksa i Sava su bili u istom košarkaškom klubu 2 godine.', NULL, NULL),
(758, 23, 329, 'Za ovaj program se prijavljujemo jer želimo da spojimo dve ljubavi. Poljoprivredu i biznis. Želimo da rešimo problem neiskorišćenog poljoprivrednog potencijala i potrebe kupaca koji sve više traže zdraviju alternativu prilikom odabira hrane. Upravo zato želimo da kroz ovaj program dođemo do neophodnih sredstava i stručne pomoći za realizovanje naše ideje. Naša konstantna želja za otkrivanjem, pronalaženjem i unapređenjem postojećih rešenja nas je motivisala da podelimo našu ideju preko ovog programa. \r\n\r\nŽelimo da primenom IT-a u poljoprivredi spojimo poljoprivrednike koji sve više odustaju od rada na selu i krajnje korisnike koji traže kvalitetnu hranu.  \r\n\r\nSmatramo da je ovo jedinstvena prilika za mlade inovatore da svoju ideju sprovedu u realnost i želimo da tu priliku iskoristimo.', NULL, NULL),
(759, 24, 329, 'Bašta koja staje u džep', NULL, NULL),
(760, 25, 329, 'Potrošači širom sveta imaju problem pri pronalasku kvalitetnog povrća. Povrće se sve više prska i prerađuje i poverenje u finalni proizvod je na veoma niskom nivou. Sa druge strane postoji problem propadanja plodne zemlje koju poljoprivrednici ne obrađuju jer postoji veliki rizik da li će imati plasman i prodaju za ono što tu proizvedu. Dodatno, po podacima Američkog ministarstva za poljoprivredu, čak 40% proizvede hrane se na kraju baci( https://www.usda.gov/foodwaste/faqs). Našim rešenjem, plasman je zagarantovan i sve što se proizvede već ima sigurnog kupca. Ovi problemi su prisutni na globalnom nivou.', NULL, NULL),
(761, 26, 329, 'Naš startap počninje sa radom na domaćem tržištu. Kada se svi navedeni kriterijumi(godine, mesto prebivališta, nivo mesešnih primanja, navike pri ishrani i kupovini hrane, slobodno vreme, porodica) uzmu u obzir, veličina naše ciljne grupe u Srbiji je oko 50 hiljada ljudi. Izvor koji je korišćen za prikupljanje podataka i kalkulaciju: https://www.stat.gov.rs. Naša ambicija je da se ovaj model poljoprivrede pre svega proširi na region, tako da su ciljna tržišta za naredne 2 godine Rumunija, Mađarska i Bugarska.', NULL, NULL),
(762, 27, 329, 'Potencijalan kupac je osoba koja zivi u urbanoj sredini, starosti od 25 do 65 godina, visina mesečnih prihoda je preko 800€, vodi računa o ishrani, ima strah od genetski modifikovane hrane, nema vremena da se lično bavi poljoprivredom i spremna je da plati vise ukoliko je kvalitet zagarantovan. Posebno smo identifikovali porodice sa decom, koji posebno vode računa o kvalitetu povrća. Rezultati ankete na kojoj je učestvovalo oko 500 ispitanika, pokazuju da pripadnici identifikovane ciljne grupe u proseku troše 70€ za povrće na mesečnom nivou, a 89% njih je spremno da plati više ukoliko dobiju mogućnost da znaju odakle povrće potiče. Pored ankete, urađeni su intervuji u kojima smo razgovarali sa potencijalnim korisnicima. Svi su iskazali interesovanje i želju da imaju svoju baštu koju ne moraju fizički da održavaju, a dobijaju kvalitetno povrće sa nje.\r\n\r\nSa druge strane, rešavamo problem poljoprivrednicima koji će imati siguran plasman za proizvode sa svoje bašte.', NULL, NULL),
(763, 28, 329, 'Razvijamo aplikaciju koja će korisnicima omogućiti da naprave svoju virtuelnu farmu, dok će istovremeno postojati fizička farma na kojoj se paralelno uzgaja sve što su korisnici izabrali. Kada se uzgoj završi, korisnici dobijaju svež proizvod na kućnu adresu. Koristićemo IoT tehnologiju, koja će nam omogućiti da u real-time vremenu skupljamo podatke i pratimo dešavanja i promene u bašti. Korisnici će na taj način imati uvid u to šta se dešava na njihovoj bašti i kada će njihovo povrće biti spremno za branje.Naš proizvod je jedinstven u poređenju sa ostalim jer je jedan od osnovnih elemenata aplikacije gejmifikacija, koja korisnicima nudi jedinstveno iskustvo zabave dok se bave poljoprivredom', NULL, NULL),
(764, 30, 329, 'Potencijalni kupci na našem tržištu ovaj problem rešavaju kupovinom povrća na pijaci i u organic prodavnicama. U sprovedenoj anketi, ljudi jasno iskazuju manjak poverenja pri nabavci na ovaj način. \r\nVan granica naše zemlje postoji konkurencija kao što su firme koje nude sličnu uslugu, a to su hrvatski PlantOn, austrijski MyAcker i SquareRoots, startUp podržan od strane Elon Musk-a.', NULL, NULL),
(765, 29, 329, 'Naši korisnici dobijaju mogućnost posedovanja sopstvene bašte i dobijanja proizvoda sa nje, bez obaveze da je oni fizički obrađuju. Bašte se sve vreme snimaju i na taj način proces uzgoja njihovih proizvoda je u potpunosti transparentan. U celom procesu ne postoji posrednik, već se proizvodi direktno sa bašte dostavljaju na kućnu adresu što garantuje svežinu i higijenu. \r\nTakođe, ceo koncept je u potpunosti gejmifikovan, tako da se korisnici kroz ceo proces uzgoja na zanimljiv način edukuju o poljoprivredi.\r\n\r\nSa druge strane, poljoprivrednicima nudimo siguran plasman za sve useve koje su održavali. Svaki proizvod ima svog kupca čak i pre nego što je spreman za upotrebu.', NULL, NULL),
(766, 32, 329, 'Naš proizvod je u potpunosti nov na srpskom tržištu. Ne postoji ništa slično. Nudimo u potpunosti novi način za razvoj poljoprivrede. U poređenju sa stranim konkurentima, naš proizvod je unapređen jer korisnicima nudimo iskustvo posedovanja bašte koje je u potpunosti gejmifikovano.', NULL, NULL),
(767, 37, 329, 'Sava Pavlovic bi bio vlasnik intelektualne svojine.', NULL, NULL),
(768, 40, 329, 'Naš startap će zarađivati od mesečnih pretplata od 100€ i jednokratnih uplata od 30€ za zakup bašte koje korisnici plaćaju. Profitna marža na uzorku od 100 korisnika je 45%.', NULL, NULL),
(769, 41, 329, 'Tim je okupljen već 6 meseci i konstantno se radi na razvoju ideje. Nakon mesec dana, uključeni su ekpsperti iz IT-a i poljoprivrede kako bi svojim ekspertizama pomogli razvoju startapa. Od tada zajedno, kao tim radimo na implementaciji projekta. Neprestano smo bili u kontaktu sa potencijalnim korisnicima i u odnosu na to, razvijali inicijalnu ideju. Sprovedena je anketa u kojoj je učestvovalo oko 500 ispitanika. Na taj način smo ispitivali navike, želje i ponašanje pripadnika ciljne grupe. Napravljen je prvi nacrt aplikacije u saradnji sa dizajnerom. Dodatno, dobijene su garancije od potencijalnih investitorau da će pružiti finansijsku podrsku u sledećoj fazi razvoja.', NULL, NULL),
(770, 44, 329, 'Marta: Radila sam na tromesečnom grupnom projekatu za SEAT HQ, u kome su bili uključeni dvojica mentora iz kompanije i šest studenata. Cilj projekta je bilo kreiranje data product-a kroz korišćenje podataka koje generišu povezani automobili da bi poboljšali SEAT-ovu komercijalnu mrežu i korisničko iskustvo (‘Leveraging data generated by connected cars to improve SEAT’s commercial network and user experience’).', NULL, NULL),
(771, 45, 329, 'Dobili smo garancije od potencijalnih investitora, da će pružiti finansijsku podršku u sledećoj fazi razvoja.', NULL, NULL),
(772, 48, 329, 'Od učešća u projektu očekujemo finansijsku i stručnu pomoć koje su nam neophodne da bismo dalje razvili projekat koji je još uvek u ranoj vazi.\r\nU ovom segmentu razvoja, očekujemo finansijsku podršku pri razvoju prve verzije aplikacije i stručnu pomoć eksperata iz poljoprivrede i IT-a.', NULL, NULL),
(773, 49, 329, 'U trenutnoj fazi razvoja potrebno nam je:\r\n\r\n1.	9000 CHF za razvoj prve verzije aplikacije uz pomoć koje će korisnici moći da obavaljaju glavne funkcionalnosti. U toku prve verzije biće omogućen početak generisanja sredstava koji će služiti za razvoj zahtevnijih featurs-a.\r\n\r\n\r\n2.	3000 CHF za plate zaposlenih u marketingu, prodaji, IT- u  i na poljoprivrednom zemljištu\r\n\r\n3.	2000 CHF za promociju i marketing\r\n\r\n4.	1000 CHF za pokretanja procesa za zaštitu inteluktalne svojine(zaštita žiga) i  troškove testiranja zemljišta\r\n\r\nDodatno, dobijene su garancije od potencijalnih investitora, da će pružiti finansijsku podršku u sledećoj fazi razvoja.', NULL, NULL),
