(782, 22, 339, 'Ne, ovo je nas prvi startup ali se jako dobro poznajemo i dobro funkcionisemo bilo sta da radimo zajedno.', NULL, NULL),
(783, 23, 339, 'Smatramo da imamo inovativnu i dobru ideju a da bismo je ostvarili potrebna su nam finansijska sredstva koja program nudi. Takodje nam je zelja da se povezemo i upoznamo sa novim ljudima i da postanemo deo zajednice. Kap koja je prelila casu je ,,info dan\'\' na ntp Beograd youtube kanalu, gde smo shvatili da ispunjavamo sve uslove za ovaj program i odlucili smo da je to to. Prijavljujemo se...', NULL, NULL),
(784, 24, 339, 'Ako odustanes, nikad neces znati.\r\nAko probas, bar se neces kajati.', NULL, NULL),
(785, 25, 339, 'S obzirom da smo iztrazivali globalno trziste( Google app store, app store) zakljucili smo da ne postiji dovoljno kvalitetna igra iz ovog zanra. Na primer ni jedna od igara, direktnih konkurenata nema Multiplayer-competetive mode. Takodje nasa igra nudi bolji gameplay, gamedesign i mnogo inovativnih fuicher-a u samoj igri...', NULL, NULL),
(786, 26, 339, 'Trziste koje targetiramo su sve one igre poput Move the box, Sokoban, push the blocks i ono je cca10.000.000 korisnika . Ovo su nasi direktni konkurenti, dakle uska nisa. Izvor: Google play store, app store\r\nU nase trziste spadaju i igre poput Builder games,Block craft ,worker games i mnoge druge sa slicnim elementima i slicnim mehanikama igre. To trziste je cca 200.000.000 korisnika. Zapadna Evropa, severna Amerika...', NULL, NULL),
(787, 27, 339, 'Deca i tinejdzeri od 7-17 godina uglavnom. Pretezno mladja muska populacija,(od 7-13 god) casual,adventure,(sa elementima akcije) puzzle igraci. Svi oni koji vole competetive mode i da igraju sa prijateljima.\r\nSproveli smo ankete ali samo u krugu prijatelja mladjih clanova rodbine. Reakcije su pozitivne ali to ne mora nista da znaci jer je mali uzorak ispitanika.', NULL, NULL),
(788, 28, 339, 'Super Worker je 3D free to play Singleplayer- multiplayer igra u kojij je cilj da igrac slozi 3,4 ili 5 kutija u nizu i tako sakupi poene(gemove) kako bi imao progresiju u igri. Glavna karakteristika je co-op mod gde igrac moze da se nadmece sa drugim igracimo sirom sveta.(1v1 2v2 3v3).i. Igra se radi u Unity, Photoshop i Blender.', NULL, NULL),
(789, 30, 339, 'Push the box, Move the box, Sokoban, Move the blocks, Push the blocks, Block Craft 3D, Stack Attack, Stack Blocks 3D, Boxy Boy...', NULL, NULL),
(790, 29, 339, 'Ono sto nasu igru cini jedinstvenom je mogucnost da se igra single player kampanja kao i multiplayer, co-op mod. Takodje je i gameplay jedinstven. Unapredjeni VFX efekti, kao i jedinstven game design.', NULL, NULL),
(791, 32, 339, 'Zato sto ima Multiplayer-competetive mode, bolji gameplay, lvl dizajn. Mnogo veci izbor karaktera u samoj igri. Sirok izbor Čekića, koji je nephodan da bi igrac imao progresiju. Generalno(uprkos konkurenciji) igra je drugacija, unikatna na Google play,app store, sto cete i sami zakljuciti iz materijala koji vam budemo dostavili.', NULL, NULL),
(792, 37, 339, 'Planiramo da zastitimo i logo i igru ako je to moguce. Vlasnik intelektualne svojine bi bio Slobodan Pupovac.', NULL, NULL),
(793, 40, 339, 'Planiramo da nasa igra zaradjuje putem in app purchase/kupovina u samoj igri i add ons/placene reklame. To je model koji je opste prihvacen na globalnom trzistu free too play mobilnih igara i pokazao se kao dobar.', NULL, NULL),
(794, 41, 339, 'Manje od godinu dana radimo na ideji, s tim da na realizaciji radimo tek 2 meseca. Ostalo smo potrosili na planiranje, razmisljanje... itd. Ideju koju smo zamislili, poceli smo da sprovodimo u delo(dokaz koncepta) i za sad smo zadovoljni kako to vizuelno izgleda. Povratne informacije imamo samo od prijatelja i mladjih clanova rodbine.', NULL, NULL),
(795, 44, 339, 'Nismo', NULL, NULL),
(796, 45, 339, 'Nismo', NULL, NULL),
(797, 48, 339, 'Ocekujemo da dobijemo finansijska sredstva koja program nudi. A ako ne dobijemo, bar se nadamo da cemo videti kako izgledaju radionice, upoznati mentore, kao i ostale ucesnike programa. Smatramo da nam je sada najpotrebnija podrska da bismo razvili MVP, samim tim ce poceti da  nam se otvaraju neka nova vrata.', NULL, NULL),
(798, 49, 339, 'Najpotrebniji nam je programer i ako racunamo da je njegova plata otp. 1300€x4 meseca=5200€. Bitan je 3d modelar 1000€x2 meseca=2000€.Za ostatak novca(2800€) bismo angazovali VFX artist i sound designer ali oni nisu neophodni. Zelim da napomenem da nama osnivacima startupa ne treba novac za licne potrebe. Sav novac cemo da iskoristimo za sirenje tima i razvoj igre.', NULL, NULL),
