(803, 71, 346, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(804, 89, 347, 'Ekonomski tehnicar\r\nOvo mi je prvi startup tako da tu nemam neko iskustvo ali sam imao nekoliko amaterskih projekata. Pored toga volim gaming i to je nesto cime zelim da se bavim ubuduce. Imam dosta iskustva sa ljudima raznih profila u predhodnom poslu kojim sam se bavio. Bio sam tim lider (poslovodja), dobar sam u organizaciji i komunikaciji sa ljudima.', NULL, NULL),
(805, 90, 347, 'Kreator ideje, Project Manager, Game Designer...\r\nPotpuno posvecen razvoju startapa', NULL, NULL),
(806, 91, 347, 'Nemam', NULL, NULL),
(807, 89, 348, 'Pejzazna arhitektura\r\nOvo mi je prvi startup. U gamingu sam ceo zivot, volim da igram igre, znam sta je dobra igra i mislim da prilicno dobro znam sta danasnji igraci  traze i koje su njihove zelje.', NULL, NULL),
(808, 90, 348, 'lvl Designer, Marketing, support\r\nPotpuno posvecen razvoju startapa', NULL, NULL),
(809, 91, 348, 'Nemam', NULL, NULL),
(810, 63, 351, 'Majstor.app je digitalna platforma koja povezuje majstore i korisnike majstorskih usluga ubezbeđujući:\r\n- pronalazak i rezervaciju slobodnog termina majstora u samo nekoliko klikova\r\n- transparentnost cene i kvaliteta majstorskih usloga (prikazivanjem cene za svaku uslugu i recenzija majstora za prethodno obavljene usluge)\r\n- naplata oglašavanje majstorskih usloga na digitalnoj platformi tek nakon realizovane i naplaćene usluge (majstori ne moraju da izdvajaju novac na oglašavanje unapred kako bi stekli korisnike)', NULL, NULL),
(811, 71, 352, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(812, 17, 353, 'Majstor.app je digitalna platforma koja povezuje majstore i korisnike majstorskih usluga ubezbeđujući:\r\n- pronalazak i rezervaciju slobodnog termina majstora u samo nekoliko klikova\r\n- transparentnost cene i kvaliteta majstorskih usloga (prikazivanjem cene za svaku uslugu i recenzija majstora za prethodno obavljene usluge)\r\n- naplata oglašavanje majstorskih usloga na digitalnoj platformi tek nakon realizovane i naplaćene usluge (majstori ne moraju da izdvajaju novac na oglašavanje unapred kako bi stekli korisnike)', NULL, NULL),
(813, 22, 353, 'Mirko i Nemanja se poznaju još od fakultetskih dana gde su zajedno radili na mnogim projektima. Pored toga Mirko i Nemanja su zajedno radili na razvoju startapa i rešenja za pametno prikupljanje otpada.', NULL, NULL),
(814, 23, 353, 'Naučno tehnološki parkovi u Srbiji predstavljaju mrežu startapa i kolevku znanja kako plasirati proizvod i uslugu na tržištu. Upravo to predstavlja i naš osnovni cilj, da postanemo deo te mreže povežemo se sa preduzetnicima koji su prošli isti put i uspešno plasirali svoje proizvode i usluge.\r\nSam Program pruža seriju treninga koji nam mogu pomoći u našem preduzetničkom putovanju. Na samom kraju potrebne su nam pravni i ekonomski saveti jer trenutno u timu nemamo pravnike i ekonomiste, a ovaj segment je jako bitan prilikom prodaje preko interneta kako bi smo zaštitili sve tri strane (majstore, korisnike i digitalnu platformu) i omogućili sigurno i pouzdano poslovanje.', NULL, NULL),
(815, 24, 353, 'Pronađi majstora u samo nekoliko klikova.', NULL, NULL),
(816, 25, 353, 'Kupivši stan u staroj zgradi bilo je potrebno uraditi kompletnu adaptaciju. Kako pronaći majstore? Pretraživao sam oglase i sajtove u kojima nisam našao ništa više o majstoru osim imena, prezimena i broja telefona. Iz tog razloga bilo je potrebno zvati jednog po jednog i informisati se o ceni i dostupnosti majstora. Na kraju sam se odlučio za najpovoljnijeg. Ali šta je sa kvalitetom usluge?', NULL, NULL),
(817, 26, 353, 'Prema podatcima iz APR-a u Beogradu postoji 26.353 preduzetnika sa majstorskim delatnostima što upravo predstavlja naše ciljano tržište. Sa druge strane prema popisu iz 2011. godine u Beogradu postoji 604.134 domaćinstava što predstavlja potencijalne korisnike majstor.app digitalne platforme. Nakon Beograda cilj nam je da privučemo i majstore iz drugih većih gradova u Srbiji.', NULL, NULL),
(818, 27, 353, 'Korisnici majstor.app platforme su majstori i korisnici majstorskih usluga. Izradom Instagram stranice i bez plaćenih reklama imamo više od 30 registrovanih majstora na platformi. Paralelno pravimo bazu majstora sakupljajući reklamni materijal na terenu na području Beograda, gde smo sakupili preko 200 majstora koji će naknadno biti anketirani i obavešteni o pogodnostima majstor.app platforme.', NULL, NULL),
(819, 28, 353, 'Majstor.app je digitalna platforma koja omogućava korisnicima da izaberu uslugu koja im je potrebna i na osnovu toga pronađu majstora sa najboljom recenzijom i najpovoljnijom cenom. Nakon pronalaska majstora, korisnik može izabrati slobodan termin za izlazak majstora na teren. \r\nPrednosti u odnosu na postojeća rešenja:\r\n1.Pronalazak majstora i zakazivanje izlaska na teren u samo nekoliko klikova,\r\n2.Transparentnost cene i kvaliteta usluge (ispisane cene usluga i recenzije majstora za prethodno obavljene usluge),\r\n3.Naplata usluge oglašavanja majstora tek nakon izvršene usluge kod korisnika.', NULL, NULL),
(820, 30, 353, 'Majstori oglašavaju svoje usluge na više načina: ubacivanjem lataka u poštanske sandučiće, plaćanjem oglasa i reklama. Direktna konkurencija digitalnoj platformi majstor.app su sajtovi za oglašavanje majstorskih usluga ko što su halooglasi.com, kupujemprodajem.com, majstorizasve.rs, svimajstori.rs pa i sam google.com kome majstori plaćaju kako bi se našli na prvoj strani.', NULL, NULL),
(821, 29, 353, 'Majstor.app donosi nove pogodnosti za majstore i korisnike majstorskih usloga kao što su: pronalazak i rezervacija majstora u samo nekoliko klikova bez poziva telefonom, garancija kvaliteta ocenom majstora za prethodno pružene usluge, usluge oglašavanja majstora se naplaćuju tek nakon realizovane usluge i to u vidu provizije pa majstori ne moraju da izdvajaju novac i vreme za marketing.', NULL, NULL),
(822, 32, 353, 'Majstor.app donosi nove pogodnosti za majstore i korisnike majstorskih usloga kao što su: pronalazak i rezervacija majstora u samo nekoliko klikova bez poziva telefonom, garancija kvaliteta ocenom majstora za prethodno pružene usluge, usluge oglašavanja majstora se naplaćuju tek nakon realizovane usluge i to u vidu provizije pa majstori ne moraju da izdvajaju novac i vreme za marketing.', NULL, NULL),
(823, 37, 353, 'U procesu smo zaštite logotipa.', NULL, NULL),
(824, 40, 353, 'Digitalna platforma majstor.app prihode ostvaruje uzimanjem posredničke provizije majstorima za usloge oglašavanja tek nakon pružene i naplaćene majstorske usluge korisnicima. Majstori ne moraju unapred da izdvajaju novac za oglašavanje. Visina posredničke provizije iznosi 5% što na prosečnu cenu majstorske usluge od 20 do 60 evra iznosi između 1 i 3 evra.', NULL, NULL),
(825, 41, 353, 'Digitalna platforma se trenutno nalazi u fazi dokaza o konceptu. Dokaz o konceptu je prikazan u video prezentaciji dok se na adresi sajta majstori mogu registrovati i pisati nam. Na samoj platformi imamo prijavljeno više od 30 majstora. U narednih 6 meseci planiramo da izađemo sa prvim prototipom na tržište.', NULL, NULL),
(826, 44, 353, 'U mentorskom programu Najbolja tehnoloska inovacija smo stigli do polufinala:\r\nhttp://inovacija.org/predstavljamo-polufinaliste-do-majstora-u-nekoliko-klikova/', NULL, NULL),
(827, 45, 353, 'Nismo prikupili finansijska sredstva, za sada se finansiramo iz sopstvenih izvora.', NULL, NULL),
(828, 48, 353, 'S obzirom da platforma posluje preko interneta a sigurnost i garancija kvaliteta usluga nam je na prvom mestu potrebna nam je pravna i ekonomska podrška. Trenutno nemamo članove tima sa ekspertizom iz ovih oblasti.', NULL, NULL),
(829, 49, 353, 'Za ubrzanje razvoja prototipa, marketing, pravnu i ekonomsku podršku, izlazak na tržište potrebno nam je 100.000 evra za prvu godinu.', NULL, NULL),
