(834, 71, 360, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(835, 63, 361, 'TRETMAN RAZLIČITIH VRSTA NEOPASNOG I OPASNOG OTPADA\r\n\r\nSam proces inertizacije otpada uključuje solidifikaciju (zgušnjavanje, očvršćavanje) i stabilizaciju (proces kojim se smanjuje potencijal opasnosti otpada pretvaranjem zagađujućih materija u njihov najmanje topljiv, najmanje pokretan ili najmanje toksičan oblik).  Razvijena je jednostavna metoda inertizacije opasnog industrijskog otpada nastalog u PPT-TMO, Trstenik, tokom procesa galvanizacije, na sobnoj temperaturi upotrebom hemijskih agenasa u oblik pogodan za odlaganje na deponiju neopasnog ili inertnog otpada. Koristi se jedinstvena kombinacija komercijalno dostupnih proizvoda za inertizaciju otpada koji višestruko ubrzavaju proces inertizacije i istovremeno smanjuju cenu tehnološkog procesa inrtizacije. Razvijena metoda predstavlja know-how i potrebna je  verifikacija ove metode i na druge vrste (ne)opasnih otpada. Njena primena bi mogla biti prvi put realizovana u Srbiji.', NULL, NULL),
(836, 71, 362, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(837, 17, 363, 'TRETMAN RAZLIČITIH VRSTA NEOPASNOG I OPASNOG OTPADA\r\n\r\nSam proces inertizacije otpada uključuje solidifikaciju (zgušnjavanje, očvršćavanje) i stabilizaciju (proces kojim se smanjuje potencijal opasnosti otpada pretvaranjem zagađujućih materija u njihov najmanje topljiv, najmanje pokretan ili najmanje toksičan oblik).  Razvijena je jednostavna metoda inertizacije opasnog industrijskog otpada nastalog u PPT-TMO, Trstenik, tokom procesa galvanizacije, na sobnoj temperaturi upotrebom hemijskih agenasa u oblik pogodan za odlaganje na deponiju neopasnog ili inertnog otpada. Koristi se jedinstvena kombinacija komercijalno dostupnih proizvoda za inertizaciju otpada koji višestruko ubrzavaju proces inertizacije i istovremeno smanjuju cenu tehnološkog procesa inrtizacije. Razvijena metoda predstavlja know-how i potrebna je  verifikacija ove metode i na druge vrste (ne)opasnih otpada. Njena primena bi mogla biti prvi put realizovana u Srbiji.', NULL, NULL),
(838, 22, 363, 'Tim SafeWaste-a sačinjavaju 3 člana: dr Ljiljana Matović, dr Radojka Vujasin i dr Yi-nan Wu. Sarađuju od 2019. god. na razvoju novih metoda i materijala koji nalaze primenu u Zaštiti životne sredine. Imaju registrovan patent u Kini i publikovane naučne radove u vrhunskim međunarodnim časopisima čiji impakt faktori nisu manji od 5 a idu i preko 10. Prvi put saradnja teče u pravcu formiranja Startapa.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(839, 23, 363, 'Razvojem materijala, koji se koriste u Zaštiti životne sredine, se članovi tima SafeWaste-a pojedinačno bave više od 10 godina ali pretežno sa naučnog aspekta. Oblast prerade otpada predstavlja izrazito složen problem zbog razlika u agregatnim stanjima, nehomogenom sastavu i mikrostrukturi različitih vrsta otpada. Ovim programom je moguće dobiti jasna uputstva za bolji plasman razvijene tehnologije prerade opasnog otpada kako na domaće, tako i na svetsko tržište. Zatim, ovim programom je omogućeno i dobijanje sredstava za eksperimentalan rad koja su neophodna za verifikaciju ove metode prerade na drugoj vrsti opasnog otpada. Učešćem u ovom Programu moguće je prevazilaženje prepreka uz pomoć mentora koje tim startapa i ne sagledava unapred.', NULL, NULL),
(840, 24, 363, 'Opasan otpad više nije opasan!', NULL, NULL),
(841, 25, 363, 'Teški metali su našli primenu u različitim oblastima života, a posebno u različitim industrijama (hemijska, naftna, drvna, rudnici, topionice metala, gradski čvrsti i tečni otpad...). Preko lanca ishrane i vode za piće dospevaju u ljudski organizam. Neadekvatno tretiran opasan otpad koji sadrži u većoj ili manjoj meri toksične teške metale,  predstavlja pretnju po živi svet. U skladu sa Uredbom o odlaganju otpada na deponije (\"Sl. glasnik RS\", br. 92/2010), opasan otpad mora biti tretiran pre odlaganja na deponiju kako bi se sprečila njegova migracija u životnu sredinu. Pronalaženjem jednostavnog, jeftinog i lako primenjivog načina prevođenja opasnog otpada u neopasan ili čak inertan otpad je naš cilj, čineći ga bezbednim za odlaganje.', NULL, NULL),
(842, 26, 363, 'Specifičnost ovog tima je što je jedan član tima kineski državljanin, profesor na Tongji univerzitetu u Šangaju, a jedan član srpskog dela tima angažovan i na Tongji univerzitetu i na Univerzitetu u Beogradu. S obzirom da je  mogućnost tretmana galvanskog mulja već eksperimentalno potvrđena u Srbiji,  razvijeni tehnološki postupak prerade galvanskog mulja biće prezentovan prvo na srpskom tržištu (u naredne dve godine) a odmah potom i na kineskom. Istovremeno će se raditi i na potvrdi primene ove tehnologije na drugoj vrsti opasnog otpada koji sadrži teške metale, nastalog nakon procesa emajliranja. Razvijena tehnologija zbog svoje jednostavnosti i niske cene ima potencijal da bude primenjena globalno.', NULL, NULL),
(843, 27, 363, 'Veliki broj preduzeća se bavi obradom metala, odnosno procesima galvanizacije, kako u Srbiji tako i šire. Pored velikih firmi potrebe za preradom otpada imaju i mala i srednja preduzeća čija je osnovna delatnost galvanizacija. Ovaj tehnološki postupak je razvijen na galvanskom mulju zaostalom iz postrojenja \"PPT-TMO\" iz Trstenika.  Razvijeni tehnološki postupak će se dalje testirati na opasnom otpadu koji nastaje nakon procesa emajliranja u fabrici posuđa \"Metalac\" iz Gornjeg Milanovca. Takođe, uspostavljen je kontakt (započeti su razgovori) i sa firmom Elixir Energy, koja je dobila dozvole za preradu i deponovanje otpada, kao potencijalnog korisnika ove tehnologije.', NULL, NULL),
(844, 28, 363, 'Osvojeni metod inertizacije opasnog otpada podrazumeva primenu jedinstvene kombinacije hemijskih agenasa,  što istovremeno prati i inovativni tehnološki postupak prerade. Agensi koji se koriste za inertizacije do sada nisu korišćeni za tretman ovog tipa otpada. Oba agensa su relativno jeftini, i njihov odnos će biti prilagođavan specifičnom sastavu otpada u cilju zadovoljenja propisanih vrednosti za njegovo bezbedno odlaganje. Razvijeni tehnološki postupak poseduje i niz drugih prednosti: kraće traje u odnosu na slične metode inertizacije, ne dolazi do povećanja mase i zapremine otpada tokom procesa inertizacije, ne zahteva izgradnju skupih i složenih postrojenja (već upravo suprotno).', NULL, NULL),
(845, 30, 363, 'Prema našim saznanjima, opasan otpad generisan na teritoriji Srbije se do skora ili izvozio ili je netretiran privremeno skladišten na lokalitetu nastanka. Elixir Grupa je dobila dozvole za tretman otpada i skladištenje i dogovoren je sastanak radi započinjanja saradnje na inertizaciji ovog tipa otpada koji su već sakupili na teritoriji Srbije. Potrebe za uslugom prerade galvanskog otpada će imati i brojna druga mala i srednja preduzeća (kako na teritoriji Srbije, tako i šire) koji generišu otpad bogat teškim metalima, kao npr. \"EMCO AD\" iz Vrnjačke Banje ili \"Galvanizacija metala Kaluđerica\" iz Beograda.', NULL, NULL),
(846, 29, 363, 'Osmišljeni tehnološki postupak inertizacije je dizajniran da bude jednostavan i ekonomičan. Sastoji se od optimizovanih procesa mešanja, inkubacije i sušenja na sobnoj temperaturi. Sinergetskim dejstvom primenjenih agenasa se postiže ubrzanje (skraćenje vremena potrebnog za tretman) uz istovremeno pojeftinjenje procesa u odnosu na druge metode inertizacije. Postojeće metode inertizacije su višestruko skuplje i duže traju. Ovako dizajniran proces prerade postaje lakše i šire dostupan, kako industrijama koje proizvode ovakav vid otpada tako i firmama koje se bave preradom i deponovanjem.', NULL, NULL),
(847, 32, 363, 'Ne postoje literaturni (naučni) podaci da je negde primenjena ova kombinacija agenasa u cilju postizanja inertizacije. Slične komercijalno dostupne tehnologije prerade podrazumevaju solidifikaciju upotrebom cementa, kada ne dolazi do potpune inertizacije (javlja se mobilnost određenih teških metala - izluživanje u životnu sredinu) kao i do značajnog povećanja mase otpada pa samim tim i prostora neophodnog za njegovo deponovanje.', NULL, NULL),
(848, 37, 363, 'Na osnovu pregleda naučne literature, ali i još značajnije, patentnih baza Srbije i Kine, imamo osnova da ovaj tehnološki postupak smatramo potpuno inovativnim. U narednom periodu tim SafeWaste-a će razmatrati mogućnost registrovanja patenta ili ćemo ovaj tehnološki postupak tretirati kao know-how.', NULL, NULL),
(849, 40, 363, 'SafeWaste će se prvenstveno baviti primenom tehnologije prerade različitih vrsta opasnog otpada bogatog teškim metalima. Takođe, SafeWaste će pružati i konsultativne usluge o optimalnom načinu prerade drugih vrsta otpada kao i nabavku adekvatnih hemikalija za preradu kako opasnog otpada tako i otpadnih komunalnih i industrijskih voda.', NULL, NULL),
(850, 41, 363, 'Tim SafeWaste-a radi zajedno oko 3 godine. Na razvoju ideje inertizacije opasnog otpada je okupljen oko godinu dana. Do sada smo dobili  rezultati koji potvrđuju mogućnost upotrebe ove tehnologije inertizacije na mulju zaostalom iz procesa galvanizacije. Ostvaren je i kontakt s prvim potencijalnim klijentima, zainteresovanim za ovakav vid tehnologije, medju kojima su PPT-TMO iz Trstenika, Metalac iz Gornjeg Milanovca i Elixir Energy iz Prahova. Elixir Energy radi na prikupljanju opasnog otpada sa teritorije cele Srbije u cilju njegove prerade i deponovanja i zainteresovan je za razvijene postupke prerade otpada.', NULL, NULL),
(851, 44, 363, 'Nemamo iskustva u ovakvom vidu programa,', NULL, NULL),
(852, 45, 363, 'Za ovo istraživanje do sada nije obezbeđen ni jedan izvor finansiranja. Osmišljeni tehnološki postupak je izuzetno jednostavan, odnosno, nije potrebna nikakva skupocena oprema za njegovo izvođenje, pa je izveden samo ličnim zalaganjem.', NULL, NULL),
(853, 48, 363, 'Učešće u ovom programu će nam biti omogućeno priključenje stimulativnoj atmosferi, odnosno pokretačkoj preduzetničkoj energiji Inovacionog parka, da bi od ideje došlo do realizacije. Takođe, ovim programom će nam biti omogućeno pokrivanje troškova većeg broja potrebnih analiza u akreditovanoj laboratoriji u cilju verifikacije metode. Takođe očekujemo da ćemo se lakše snaći na tržištu.', NULL, NULL),
(854, 49, 363, 'Uklopili smo sredstva koja su predviđena ovim programom sa onim što možemo da zaokružimo, odnosno da potvrdimo u zvanično akreditovanoj laboratoriji primenjivost ove tehnologije na galvanskom mulju a potencijalno i na mulj nakon emajliranja. Potrebno je uraditi veći broj ispitivanja materijala tokom optimizacije svih parametara procesa radi postizanja netoksičnosti u skladu sa propisima.', NULL, NULL),
