(860, 90, 370, '1. Kreator ideje. 2. Potpuno posvećena razradi ideje (metodologiji) u smeru razvijanja metode koja će biti široko primenjiva, na više vrsta opasnog otpada koji u sebi sadrži teške metale. 3. Potpuno posvećena pronalaženju  zainteresovanih partnera u industriji koji generišu opasan otpad koji sadrži teške metale ili rade na njegovoj preradi.', NULL, NULL),
(861, 91, 370, 'Naučni savetnik, 1 Laboratorija za materijale, Institut za nuklearne nauke \"Vinča - Institut od nacionalnog značaja - Univerzitet u Beogradu, full time\r\n2 College of Environmental Science and Engineering, State Key Laboratory of Pollution Control and Resource Reuse, Tongji University, Shanghai 200092, China,\r\n3 Shanghai Institute of Pollution Control and Ecological Security, Shanghai 200092, China', NULL, NULL),
