(866, 71, 373, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(867, 63, 374, 'Inovativni proizvod koji razvijamo je Virtuelni Shopping Centar(VSC). Glavna karakteristika VSC-a je da predstavlja inovaciju- njime se prenosi trgovina i poslovanje iz realnog sveta u digitalno okruženje. Krajnji kupci bi imali  pristup jednoj inovativnoj i zanimljivoj platformi, koja do sada nije viđena. VSC sadrži svoje spratove i lokale, dok bi svaki prodavac imao svoj izlog koji bi\r\nbio linkabilan i vodio do kategorija proizvoda ili delove prodavnice, i gde bi se vršila kupovina, odabiralo mesto preuzimanja robe/usluga i način plaćanja.\r\nNaš VSC bi istovremeno slao podatke o aktivnostima kupaca vlasnicima lokala, na osnovu kojih bi se izvlačili zaključci o interesovanjima kupaca i formirali saveti za poboljšanje prodaje.', NULL, NULL),
(868, 71, 375, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(869, 17, 376, 'Inovativni proizvod koji razvijamo je Virtuelni Shopping Centar(VSC). Glavna karakteristika VSC-a je da predstavlja inovaciju- njime se prenosi trgovina i poslovanje iz realnog sveta u digitalno okruženje. Krajnji kupci bi imali  pristup jednoj inovativnoj i zanimljivoj platformi, koja do sada nije viđena. VSC sadrži svoje spratove i lokale, dok bi svaki prodavac imao svoj izlog koji bi\r\nbio linkabilan i vodio do kategorija proizvoda ili delove prodavnice, i gde bi se vršila kupovina, odabiralo mesto preuzimanja robe/usluga i način plaćanja.\r\nNaš VSC bi istovremeno slao podatke o aktivnostima kupaca vlasnicima lokala, na osnovu kojih bi se izvlačili zaključci o interesovanjima kupaca i formirali saveti za poboljšanje prodaje.', NULL, NULL),
(870, 22, 376, 'Do sada  smo kao tim saradjivali na više projeka, negde kao kompletan tim (na 2 projekta), dok smo na nekim odvojenim projektima saradjivali delovi tima. Npr. Sima i Jovana na poslovima marketinga za male biznise; Sima i Boban na poslovima izrade e-commerce rešenja i poslovima marketinga; Nikola i Boban na projektima izrade sajtova, plug-in-ova, poslovno informacionih sistema.', NULL, NULL),
(871, 23, 376, 'Motivacuju za prijavu smo stekli radeći na našoj ideji i delimičnoj realizaciji našeg proizvoda. Mentorska podrška koja se dobija u programu je presudila da se prijavimo. Smatramo da kroz učešće u mentorskom programu možemo dobiti savete o daljim pravcima razvoja našeg digitalnog proizvoda, odnosu sa klijentima i strategijama za plasiranje i promociju našeg Virtuelnog shopping centra. Finansijska sredstva, koja se dobijaju u programu, bi nam pomogla u pogledu promocije našeg proizvodai privodjenju projekta nameni. Naravno, glavni cilj koji nas i najviše motiviše, jeste da napravimo svoju firmu koja ima sopstveni proizvod i koja će se, uz Vašu podrsku, savete i iskustvo, a naš predani rad, probiti na tržiste Evrope, a i šire.', NULL, NULL),
(872, 24, 376, 'Virtuelni Shopping Centar - mesto gde se rađa budunost', NULL, NULL),
(873, 25, 376, 'Usled izrade e-commerc rešenja za male trgovce došli smo do zaključka da na Internetu ne postoji jedinstveno mesto gde kupac ima sveobuhvatan pristup online prodavnicama.  Ako bi prodavac imao mogućnost da predstavi svoj online-shop na nekoj vrsti platforme za trgovinu, mogao bi mnogo brže i lakše da stigne do svog željenog kupca, na način da ne izgube svoj identitet.', NULL, NULL),
(874, 26, 376, 'Ciljano tržište je najpre teritorija Republike Srbije, a kasnije Evrope, pa možda i šire. Generalno gledano tržište je u eksponecijalnom rastu trenutno i predviđa se da će u naredne dve godine tržište ići samo uzlaznom putanjom.', NULL, NULL),
(875, 27, 376, 'Problem se rešava vlasnicima razičitih radnji i biznisa koji budućnost vide u online poslovanju i uviđaju značaj online trgovine, koju u poslednjem periodu karakteriše eksponencijalni rast. Mi smo tu da im pomognemo u kreiranju i razvoju njihovih online prodavnica, ili ako već poseduju iste, da im omogućimo povećanje prometa i prihoda putem ovog kanala prodaje.', NULL, NULL),
(876, 28, 376, 'Inovativni proizvod koji razvijamo je Virtuelni Shopping Centar(VSC). Glavna karakteristika VSC-a je da predstavlja inovaciju- njime se prenosi trgovina i poslovanje iz realnog sveta u digitalno okruženje. Krajnji kupci bi imali  pristup jednoj inovativnoj i zanimljivoj platformi, koja do sada nije viđena.VSC sadrži svoje spratove i lokale, dok bi svaki prodavac imao svoj izlog.', NULL, NULL),
(877, 30, 376, 'Potencijalni kupci trenutno rešavaju problem tako što se \"bore\" za svoje kupce putem društvenih mreža, i ulažu novac u instagram, facebook i google ads u \"malim količinama\", dok bi na jednoj platformi izgledalo mnogo ozbiljnije i svrsishodnije.', NULL, NULL),
(878, 29, 376, 'Benefite koje donosimo našim budući klijentima su najpre povećana trgovina putem interneta, kao i lakše osvajanje tržišta. Benefite nudimo i krajnjim kupcima koji će na jednom mestu imati proizvode različitih kategorija, baš kao i u tržnom centru, što i jeste osnovna ideja poslovanja tržnih centara širom sveta, pa tako i ovog našeg na internetu.', NULL, NULL),
(879, 32, 376, 'Već podtoje platforme koje su nešto slično kao naš proizvod, ali nisu obuhvatile sve sfere poslovanja, odnosno nemaju mogućnost promovisanja uslužnih delatnosti, i niko još nije \"preslikao\" tržni centar u virtuelni svet.', NULL, NULL),
(880, 37, 376, 'Nismo za sada sproveli istraživanje, ali planiramo i vlasnici intelektualne svojine bi bili kao i u firmi Sima Kerešević, Jovana Starović i Boban Mihailov.', NULL, NULL),
(881, 40, 376, 'Naš startup bi imao više izvora prihoda, odnosno više razvijenih tipova saradnje sa klijentima, prvi u vidu fiksnog iznosa na mesečnom nivou (paketi usluga na 12/24 meseca), dok bi drugi vid zarade bio putem affiliate marketinga, gde bi se zarada ogledala u zavisnosti od prometa i affiliate linkova, koji su u našem projektu integrisani.', NULL, NULL),
(882, 41, 376, 'Tim je okupljen oko ideje od avgusta 2020. godine. Do sada smo uspeli da razvijemo osnovnu verziju prototipa, koja je ustvari dokaz da je naša ideja izvodljiva.  Do sada smo anketirali moguće klijente i njihovi utisci su pozitivni, čak su neki pristali da se reklamiraju na našoj platfomi u fazi razvoja i to su klijenti koji su vidljivi na našoj platformi.', NULL, NULL),
(883, 44, 376, 'Do sada samo učestvovali u mentorskim programima na fakultetima, ali nismo imali iskustva u stratup programima.', NULL, NULL),
(884, 45, 376, 'Nismo prikupili izvora finasiranja, nego je sve do sada finansirano iz sopstvenih sredstava članova tima,', NULL, NULL),
(885, 48, 376, 'Od programa Raising Stars očekujemo  da mentorska podrška i saveti  budu “generator” našeg ubrzanog razvoja. Takođe vidimo značaj i potencijal u zajedničkoj saradnji sa ostalim učesnicima projekta.\r\nSmatramo da nam je podrška najpotrebnija u pogledu plasmana našeg digitalnog proizvoda i različitih usluga, koje uz njega nudimo.\r\nImajući u vidu da će osnovna verzija gotova, smatramo da bi učešćem na ovom projektu uspeli da kompletiramo naš proizvod i da, uz savete iskusnijih i kompetentnijih ljudi, Virtuelni shopping centar plasiramo na tržište gde može da ostvari svoj puni potencijal.', NULL, NULL),
(886, 49, 376, 'U trenutnoj fazi razvoja mislimo da bi nam bila dovoljna sredstva iz programa Raising stars kako bi poradili na marketingu i kako bi naš prizvod došao do većeg broja klijenata. Naravno za kompletnu realizaciju ideje koja je definisana idejnim planom potrebo je oko 50.000 e, i mislimo da je projekat trenutno jako blizu faze gde je sposoban da sam sebe izgradi, odnosno da trenutna verzija uz malu doradu zarađuje dovoljno kako bi se projekat izfinansirao do kraja.', NULL, NULL),
