(891, 89, 383, 'VII-1 stepen obrazovanja, Vojna Akademija, studijski program Vojnoelektronsko inženjerstvo, smer Telekomunikacije. \r\n6+ godina rada na menadzerskim pozicijama u oblasti elektrotehnike i računarstva. \r\nObjavio 10 naučnih radova iz oblasti radio frekventnog spektra, digitalne televizije, android aplikacija i učestvovao na mnogobrojnim naučnim skupovima, i kao izlagač i kao slušalac.', NULL, NULL),
