(894, 89, 384, 'Filološka gimnazija- ruski jezik i književnost. Trenutno student na trećoj godini Fakulteta organizacionih nauka, smer Menadžment i organizacija.\r\n\r\nKordinator studentskih organizacija na FON-u, vođa plivačke sekcije za decu. Ima dobro razvijenu sposobnost organizacije i upravljanja, i dobre pregovaračke sposobnosti na više jezika.', NULL, NULL),
(895, 90, 384, 'Uloga u timu: marketing, odnosi sa kupcima, dizajn. \r\nU potpunosti posvećena projektu.\r\nUključila se u projekat nakon kreiranja ideje, ali u velikoj meri doprinela usavršavanju same ideje.', NULL, NULL),
(896, 91, 384, 'Trenutno na trećoj godini studija, ali uz dobru organizaciju u potpunosti posvećena projektu.', NULL, NULL),
(897, 89, 385, 'VII-1 stepen obrazovanja, Vojna Akademija, studijski program Vojnoelektronsko inženjerstvo, smer Informacioni sistemi. \r\nMedior programer sa širokim iskustvom u oblasti razvoja web poslovnih aplikacija i e-commerce rešenja, kao i mobilnih Android aplikacija.\r\nObjavio više naučnih radova iz oblasti informacionih tehniologija, učestovao na naučnim skupovima i kao izlagač i kao slušalac.\r\nUčestvovao na više projekata i ima iskustva u kreiranju ideja, najviše u timu.', NULL, NULL),
(898, 90, 385, 'Uloga u timu:\r\nMedior programer sa širokim iskustvom u oblasti razvoja web poslovnih aplikacija i e-commerce rešenja, kao i razvoja mobilnih Android aplikacija. \r\n\r\nKreator ideje zajedno sa Simom.', NULL, NULL),
