(900, 89, 386, 'VII-1 stepen obrazovanja, Vojna Akademija, studijski program Vojnoelektronsko inženjerstvo, smer Informacioni sistemi. Master informacionih tehnologija na FON-u.\r\nMedior programer sa širokim iskustvom u oblasti razvoja web poslovnih aplikacija i e-commerce rešenja, kao i mobilnih Android aplikacija.\r\nUčestvovao na više projekata kao izvođač radova (programer).', NULL, NULL),
(901, 90, 386, 'Uloga u timu:\r\nMedior programer sa širokim iskustvom u oblasti razvoja web poslovnih aplikacija i e-commerce rešenja, kao i razvoja mobilnih Android aplikacija. \r\n\r\nNije učestvovao u razvoju poslovne ideje, ali je u samom radu na demo verziji doprineo na njenom poboljšanju.', NULL, NULL),
