(1040, 71, 448, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1041, 63, 449, 'Hireama je platforma koja povezuje kompanije koje na njoj postavljaju otvorene pozicije sa jedne strane, i sve recruitere i ostale profesionalce koji imaju priliku da iskoriste svoju mrežu kontakata tako što preporuče svoje poznanike i kontakte za gore pomenute pozicije, i tako zarade novac koji je nominovan kao \"referral fee\" od strane kompanija.', NULL, NULL),
(1042, 71, 450, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1043, 17, 451, 'Hireama je platforma koja povezuje kompanije koje na njoj postavljaju otvorene pozicije sa jedne strane, i sve recruitere i ostale profesionalce koji imaju priliku da iskoriste svoju mrežu kontakata tako što preporuče svoje poznanike i kontakte za gore pomenute pozicije, i tako zarade novac koji je nominovan kao \"referral fee\" od strane kompanija.', NULL, NULL),
(1044, 22, 451, 'Ne', NULL, NULL),
(1045, 23, 451, 'Vera u ideju: Već više od 7 godina radim u oblasti regrutacije i selekcije i primećujem vrlo jasan trend: sve je teže i skuplje doći do odgovarajućih zaposlenih. Ovaj proces je zastareo i neodgovarajući trenutnom stanju na tržištu rada. I pored toga, još uvek ne postoje značajne \"disruptive\" inovacije u ovoj oblasti.\r\nSa jedne strane imamo organizacije koje troše velike resurse na različite kanale za selekciju i regrutaciju, a sa druge strane imamo nezavisne regrutere koji su sa velikim brojem kandidata, i ljude koji se nužno ne bave selekcijom ali imaju veliku mrežu kontakata. Potrebno spojiti ove dve strane na pravi način. Ovo može biti ta \"disruptive\" inovacija koja se čeka u ovoj oblasti. \r\nŽelja za pokretanjem sopstvenog biznisa: Već duže vreme imamo želju da pokrenemo svoj sopstveni biznis i osećamo da smo spremni za to.\r\nLjubav prema Nišu i lokalnoj zajednici: Mogućnost da ovako nešto započnemo u gradu koji volimo i u kome želimo da živimo i radimo, veliki je deo motivacije za prijavu na Raising Starts', NULL, NULL),
(1046, 24, 451, 'Hire easy. Hire good', NULL, NULL),
(1047, 25, 451, 'Globalno izraženi problem je da je sve teže doći do talentovanih zaposlenih sa relevantnim znanjima i iskustvima. Kompanije u većini industrija, bez obzira na veličinu, imaju velike izazove na ovom polju. Sa druge strane, postoji i nedostatak profesionalaca koji imaju iskustva u regrutaciji i selekciji. \r\nJedan od članova našeg tima se svakodnevno u poslu susreće sa ovim problemima.', NULL, NULL),
(1048, 26, 451, 'U prvoj fazi fokus je Srbija i region, a ideja je da Hireama postane glabalna platforma.\r\nTrenutno, u Srbiji je na linkedin-u je aktivno 3272 oglasa za posao od strane 16000 registrovanih kompanija, a na infostudu 3362 oglasa, od strane 1856 kompanija. Većina ovih kompanija je targetirano tržište i većina ovih oglašenih poslova može da se nađe na platformi Hireama\r\n(linkedin.com; poslovi.infostud.com)', NULL, NULL),
(1049, 27, 451, 'Glavni kupci su kompanije koje imaju potrebu za zapošljavanjem. Oni su navikli da koriste tradicionalne kanale za regrutaciju i selekciju, ali imaju veliku potrebu da probaju nešto novo, i spremne su da obazrivo eskperimentišu u ovoj oblasti. Ukoliko eksperiment bude uspešan, vrlo rado će ga uvrstiti u redovne kanale kroz koje dobijaju nove zaposlene.', NULL, NULL),
(1050, 28, 451, 'Hireama je digitalna platforma koja povezuje kompanije koje imaju potrebe za zapošljavanjem i spremne su da plate određeni \"referral fee\" u slučaju uspešnog zapošljavanja, sa jedne strane, i nezavisne regrutere, recruitment agencije i svakog ko želi da iskoristi svoju mrežu kontakata, bilo da se bavi regrutacijom i selekcijom ili ne, sa druge strane. Jedinstvena je jer je otvorena za sve i naplaćuje samo po uspešnom zapošljavanju. Ona omogućava svima da iskoriste potencijal svojih mreža kontakata (bilo a se radi o ljudima koje se profesionalno bave regrutacijom ili ne), za to \"povezivanje\" zarade, a svojim kontaktima omoguće dalji razvoje karijere.', NULL, NULL),
(1051, 30, 451, 'Kompanije ovo uglavnom rešavaju oglašavanjem poslova na \"job board-ovima\" (neefikasno), eksklizivnim angažovanjem recruitment agencija (skupo), pronalaženjem pasivnih kandidata (zahteva stalno zapošljavanje profesionalaca sa specifičnim veštinama i samim tim visoke troškove) ili internim \"referral\" programima (efikasnije, ali rešenje ograničeno na trenutne zaposlene).', NULL, NULL),
(1052, 29, 451, 'Glavni benefit je to što svi imaju mogućnost da rade regrutaciju i selekciju za kompanije koje postavljaju oglase na HIreama platformi. Ovo omogućava vrlo efikasno korišćenje mreža kontakata svih registrovanih Hireama korisnika, sa jedne strane, i niske troškove (niže od ekskluzivnog angažovanja recruitment agencija) i plaćanje samo u slučaju uspešnog zapošljavanja, sa druge strane.', NULL, NULL),
(1053, 32, 451, 'Postoji nekoliko platformi sa drugačijim biznis modelom van Srbije. Trenutno u Srbiji postoji slična platforma koja je usko vezana samo za IT sektor (Hireama bi bila otvorena za sve oblasti i sve nivoe pozicija), i unapred naplaćuje pakete za određeni broj oglasa, dok Hireama naplaćuje samo u slučaju uspešnog zapošljavanja. Hireama je pravi primer crowdsourcinga u oblasti regrutacije i selekcije.', NULL, NULL),
(1054, 37, 451, 'Nismo još uvek zaštitili intelektualnu svojinu, a planiramo da to uradimo. Vlasnici bi podjednako bili članovi tima.', NULL, NULL),
(1055, 40, 451, 'Hireama zarađuje od naplaćivanja procenta od \"referral fee-ja\" svakog uspešnog zapošljavanja.\r\nPrimer: Kompanija X traži Regionalnog Menadžera na platformi Hireama. Nudi \"referral fee\" od 1000 evra. Korisnik platforme preporuči osobu koja bude zaposlena. Kompanija X isplaćuje Hireama platformi 1000 evra plus procenat 20%. Hireama isplaćuje korisnika koji je preporučio 1000 evra i zarađuje 200 evra', NULL, NULL),
(1056, 41, 451, 'Ideja je stara mesec i po dana. Do sada je razvijen koncept i potvrda tehničke izvodljivosti.\r\nObavljeni su neformalni razgovori sa ekspertima iz oblasti/potencijalnim kupcima koji su pozitivno reagovali na ideju.\r\nUrađena je analiza, specifikacija funkcionalnosti i procena troškova za MVP sa timom programera', NULL, NULL),
(1057, 44, 451, 'Nismo učestvovali u sličnim programima do sada.', NULL, NULL),
(1058, 45, 451, 'Nismo', NULL, NULL),
(1059, 48, 451, 'Od programa očekujemo stručnu podršku (mentorstvo, usmeravanje na relevantne institucije, stručnjake) i podršku u validaciji ideje na početku, kao i finansijsku podršku. Očekujemoi  da ćemo mnogo naučiti o pokretanju sopstvenog biznisa.', NULL, NULL),
(1060, 49, 451, 'Najveći troškovi na početku su vezani za razvijanje tehnološkog rešenja (angažovanje programera za razvoj hireama.com sajta).\r\nZa MVP nam je potrebno 8000 evra.', NULL, NULL),
