(1156, 22, 498, 'Poznajemo se više od 30 godina, zajedno smo studirali i nastavili da sarađujemo na različitim projektima:\r\n1.Razvoj startap ideje i pronalaska Stabilizatori Silaže, Farma Inova od 2019\r\n2. Projekti:\r\n2021 Angažovani eksperti  za primenu bio-otpada prehrambene industrije u vidu sporednih proizvoda, na projektu „Upravljanje sporednim proizvodima Frikom-a i ponovna upotreba bio-otpada -Studija izvodljivosti “ kompanija Frikom doo i Agroprotein doo;\r\n2020 Angažovani eksperti  za primenu bio-otpada prehrambene industrije u vidu sporednih proizvoda, na projektu „Primena stočnog krema u ishrani domaćih životinja“ kompanija Frikom doo i Agroprotein doo;\r\n2020 Angažovani eksperti  za primenu bio-otpada prehrambene industrije u vidu sporednih proizvoda, na projektu „Upotreba SPŽP kategorije 3 za ishranu kućnih ljubimaca-Studija izvodljivosti“ kompanija Rafiana doo i Agroprotein doo;', NULL, NULL),
(1157, 23, 498, 'Mi smo se  izuzetno obradovali činjenicom da postoji program za finansiranje inovacija u ranom razvoju. Idejom kojom se rukovodite da pomažete inovacije u ranom razvoju motivisala nas je da se prijavimo za ovaj program. Učešćem na Info danu za vaš program, kao i objašnjenja koja smo dobili dala su nam dodatni podstrek da se prijavimo za Raisings Starts. Ukoliko nam se odobre finansijska sredstva i dobijemo podršku,  našu inovaciju Suvi spasilac možemo razviti i plasirati na tržište.', NULL, NULL),
(1158, 24, 498, 'Farma Inova veruje u napredak i pomaže agrobiznisu\r\nNaš Suvi spasilac spašava vaše vlažno seno', NULL, NULL),
(1159, 25, 498, 'Imamo  kontakte sa velikim brojem farmera koji uvek ukazuju na problem prisustva veće vlage u senu tokom pripreme, kao i da na tržištu ne postoji  adekvatno rešenje ili proizvod. Svi pokvareni delovi sena se moraju baciti.  Prilikom ranijeg košenja biljaka za seno dobijamo nizak prinos i visok sadržaj vlage u hranivu koje je namenjeno za pravljenje sena. Kasno košenje dovodi do smanjenja nutritivnih vrednosti sena, koji se  nalaze u lišću biljaka. U procesu sušenja zelene mase dolazi do značajnog gubitka   karotina a posebno vitamina A. Uz duže izlaganje sunčevoj svetlosti, više od 90% karotina može biti uništeno. Ako se sušenje produži zbog nepovoljnih vremenskih uslova, može doći do promena izazvanih delovanjem bakterija i gljivica. Pored toga  vrlo često takvo seno sadrži aktinomicete, odgovorne za alergijsko stanje kod čoveka poznato kao \"Farmerova pluća\".', NULL, NULL),
(1160, 26, 498, 'Svetska proizvodnja sena lucerke bila je 226,3 miliona metričkih tona u 2018. godini, a očekuje se da će proizvodnja porasti za  7,3% tokom prognoziranog perioda od 2019-2024 godine. Seno lucerke se smatra važnom hranom za krave, goveda, konje, ovce i koze. Kanada, SAD, Španija, Francuska i Italija su glavne zemlje koje proizvode seno lucerke. Pored sena lucerke proizvodi se i  seno od drugih leguminoza, smeše trava, grahorice, ovsa i drugih ratarskih kultura\r\nStočarstvo je glavni faktor odgovoran za rast globalnog tržišta sena.  Stopa rasta tržišta sena je povećana jer je linearno prati povećana proizvodnja stočarskih proizvoda u svetu, zbog sve veće populacije ljudi i povećanih potreba za ishranom životinja.\r\nObzirom  na veličinu tržišta, mogućnosti za implementaciju našeg inovativnog proizvoda su velike. Pored pripreme sena, Suvi spasilac se može koristiti i u drugim granama poljoprivrede. Naše ciljano tržište je Srbija, zemlje u okruženju i EU.', NULL, NULL),
(1161, 27, 498, 'Naši kupci su svi oni koji proizvode poljoprivredne proizvode za tržište i/ili oni koji se bave uzgojem domaćih životinja (konje, krave, ovce, tov junadi, koze, zečevi itd.). Po veličini, naši kupci su: velike poljoprivredne kompanije, velika poljoprivredna gazdinstva koja se bave stočarstvom, kao i mali poljoprivrednici(u ovu grupu ubrajamo poljoprivrednike koji imaju manje od 100 grla krupne stoke).\r\nNašim inovativnim proizvodom bezbedna je proizvodnja i seno je visoke nutritivne vrednosti. Cena našeg proizvoda je samo 10% od ukupnih troškova pripreme sena, a proizvodnja sena je povećana za 40% i više korišćenjem našeg inovativnog proizvoda. Ova razlika ukazuje na opravdanost primene i kupovine Suvog spasioca. Svaki poljoprivrednik koji uzgaja 100 i više grla krupne stoke mora godišnje proizvesti najmanje 30.000 bala sena. Radili smo oglede na 5 farmi na kojima ćemo  nastaviti primenu  i razvijanje  našeg proizvod.', NULL, NULL),
(1162, 28, 498, 'Cilj spremanja sena  vlažnost manje od 20% i  da bi se to postiglo, potrebno je da se na  jedan deo suvog sena  odstrani 3,5 delova vode.Naš inovativni proizvod Suvi spasilac koristi se  tokom pripreme sena u rol i  četvrtastim balama. Novina pronalaska je mešavina organskih komponenti, koja odmah deluje tako što upija vlagu, sprečava razvoj štetnih mikroorganizama i čuva boju i aromu sena. Na ovaj način je početna hranljiva vrednosti sena očuvana sa listovima tokom perioda sušenja. Na tržištu ne postoji proizvod koji efikasno otklanja vlagu u senu. Posledice baliranja vlažnog sena su zagrevanje, pojava buđi i plesni,  promena boje i smanjenje nutritivne vrednosti.', NULL, NULL),
(1163, 30, 498, 'Konzervansi za seno mogu se grupisati u tri opšte kategorije koje uključuju organske kiseline ili njihove soli, proizvode na bazi amonijaka i mikrobiološki  aditivi. Od njih se najčešće koriste različite formulacije organskih (prvenstveno propionskih) kiselina koje imaju negativan uticaj na spoljašnju sredinu i zdravlje ljudi i životinja. Teoretski, ovi proizvodi deluju tako što inhibiraju rast aerobnih mikroba unutar sena, čime se smanjuju mikrobno disanje, akumulacija toplote i ograničavaju gubici DM i smanjenje hranljive vrednosti.\r\nGlavni konkurenti su  :\r\n	AgroChem,Inc\r\n	Harvest Tec.com\r\n	John Deere\r\n	Kemin Industries\r\n	Pestell Minerals＆Ingredients', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(1164, 29, 498, 'Suvi spasilac direktno cilja na problem a to je vlaga a ne prisustvo gljivica koje je posledica. Pomenuti proizvođači imaju proizvode protiv gljivica, a ne na sadržaj vlage; Naš proizvod je ekološki bezbedan za razliku od agresivnih kiselina koje su dostupne na tržištu;  Suvi spasilac absorbuje vlagu, ne dozvoljava razvoj štetnih mikroorganizama i čuva hranljive komponentne, aromu i boju.  Komponente  Suvog spasioca su bezbedne po zdravlje ljudi i životinja.  Glavni nedostaci konzervanasa su troškovi i problemi sa primenom. Ovi aditivi imaju za cilj da otklone posledice, ali ne i uzrok, a to je problem prisustva vlage u senu. Suvi spasilac je pakovana u posebne porozne kese koje se stavljaju u bale sena bez dodatne opreme. Naš proizvod može se posipati direktno na otkos i to postojećim uređajem koji imaju svi farmeri – rasturač mineralnog đubriva. Suvi spasilac omogućava  farmerima da baliraju biljke sa većom vlagom bez brige o zagrevanju ili pojave buđi.', NULL, NULL),
(1165, 32, 498, 'Suvi spasilac omogućava baliranje sena u kratkom vremenskom periodu od košenja. Ključne vrednosti su:\r\n1.	 Absorber vlage, smanjuje  gubitke suve materije sena i štiti  balu od prekomernog zagrevanje i prodiranja vlage nakon baliranja,\r\n2.	 Stoper mikotoksina, ima specifičnu hemijsku strukturu koja zaustavlja razvoj gljivica i plesni,\r\n3.	Ozelenjivač biljke,  čuva aromu i boju sena, sprečava opadanje lišća i čuva hranljive vrednosti sena,\r\n4.	Primena Suvog spasioca je vrlo jednostavna i ne iziskuje dodatna ulaganja farmera u opremu pri primeni proizvoda.\r\nPretražili smo baze patentne dokumentacije ESPACENET, PATENTSCOPE, naučnu literaturui proizvode prisutne u prodaji i ustanovili da je potpuno nov proizvod.', NULL, NULL),
(1166, 37, 498, '4 odobrena patenta, vlasnik  Aleksandra Ivetić:\r\nPostupak i primena aditiva pri konzervisanju stočne hrane\r\nUređaj za dodavanje suvog leda pri siliranju biljaka na farmama \r\nSistem za dodavanje ugljen dioksida u gasovitom stanju tokom siliranja biljaka u rol balama.\r\nUređaj za dodavanje aditiva u čvrstom stanju pri siliranju biljaka u silo rukavu.\r\nPrijava  patenta za „Stabilizatori silaže“', NULL, NULL),
(1167, 40, 498, 'Posle registracije startapa i dok traju istraživanja planiramo da finansijski održimo startap iz svojih sredstava, a delom da pokrijemo troškove od velikih poljoprivrednih preduzeća Delta-Agrar, MK komerc, PD Kamendin, Farmalend doo i dr. Primenu inovativnog proizvoda uradili bi na njihovim poljima  i naplatili tu uslugu.Samo u Srbiji mali farmeri proizvode oko 360.000.000 malih bala sena prosečne težine oko 15 kg. Cena jedne bale sena na tržištu je 1,70 EUR, a cena Suvog spasioca je 0,18 EUR po bali. Gubici tokom pripreme sena su u proseku 40% što znači 0,68 EUR po bali. To znači uštedu od 0,50 EUR po bali. Farma sa 10 muznih krava koristi 3000 bala sena teških 15 kg godišnje. Na nivou Srbije, ako prodamo samo 3% proizvodnje celih bala sena (teških 15 kg) po ceni od 0,18 evra, imaćemo prihod od 1.944.000 evra. Veće bale sena su 500-650kg. Posebnu vrednost naš proizvod ima kada je kišna sezona i farmeri gube ceo otkos biljaka za seno što se desilo 2019 godine.', NULL, NULL),
(1168, 41, 498, 'U Farmi Inova verujemo u napredak. Koristeći naše inovacije  sledeće generacije, pomažemo agrobiznisu da upravlja agilnim tokovima posla. Uspevamo zahvaljujući našem istraživanju i poznavanju tržišta i odličnom timu koji stoji iza naših proizvoda i usluga. Tim Farma Inova je osnovan 2019. godine i pomažemo agrobiznisu da raste organski i negujemo način razmišljanja na prvom mestu potrošača. Imamo 4 odobrena patenta i 1 pronalazak za koga je podneta nacionalna i međunarodna prijava. Suvi spasilac je naš najnoviji pronalazak.', NULL, NULL),
(1169, 44, 498, 'Učestvovali smo na programu Delta Biznis Inkubatora 2020 i pobedili sa inovacijom Stabilizatori silaže\r\nhttps://www.facebook.com/deltabiznisinkubator/posts/pobednik-pitcha-za-investiciju-2020-je-tim-farma-inova-koji-je-za-svoj-proizvod-/728934994364593/\r\n2021 Učestvovali smo u Climate kic acceleratoru sa inovacijom Stabilizatori silaže i bili među prvih 10 u svetu\r\nhttps://www.icthub.rs/playground/\r\n2021-2022 F67 Test Farms project ,  EIT Food Belgija i Test Farms 2021\r\nhttps://www.f6s.com/farma-inova', NULL, NULL),
(1170, 45, 498, 'Ne', NULL, NULL),
(1171, 48, 498, '- Podrška za ubrzani razvoj i napredovanje u tehnološkom i poslovnom razvoju startapa,\r\n- Kontakti sa ekspertima iz oblasti naše inovacije,\r\n-Umrežavanje sa međunarodnim poljoprivrednim kompanijama,\r\n- Pristup investicijama.', NULL, NULL),
(1172, 49, 498, 'U svom dosadašnjem istraživanju došli smo do faze razvijanja drugog prototipa, odnosno  Beta prototipa.  Cilj beta prototipa je, obično, da odgovori na pitanja o performansama i pouzdanosti proizvoda u cilju identifikovanja potrebnih  promena za finalni proizvod. Naredni koraci su ispitivanja u kontrolisanim laboratorijskim uslovima i na farmama gde ispitujemo proizvod u relevantnom okruženju. Za ova istraživanja potrebna su nam sredstva u iznosu od 30.000 evra za kupovinu  reagenasa, troškove rada u laboratoriji, sprovođenje ogleda na farmama, kupovinu opreme za određivanje vlažnosti sena, troškove kupovine hemikalija, troškovi za merne uređaje, ambalaža za pakovanje proizvoda, troškovi štampe i prezentacije na farmama.', NULL, NULL),
