(1203, 63, 516, 'Proizvodi na bazi orgonita po tehnologiji naučnika Vilhema Rajha, koji je dokazao da isti neutrališu negativne energije i zračenja, koja loše utiču na ljudski organizam, prostor ispunjavaju POZITIVNOM ENERGIJOM, ka blagotvorno deluje na ljudsko zdravlje.U PROSTORU U KOJIMA ONI DELUJU, mikroorganizmi VIRUSI, GLJIVICE I BAKTERIJE, nisu aktivni i ne napadaju ljudki organizam.', NULL, NULL),
(1204, 71, 517, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1205, 17, 518, 'Proizvodi na bazi orgonita po tehnologiji naučnika Vilhema Rajha, koji je dokazao da isti neutrališu negativne energije i zračenja, koja loše utiču na ljudski organizam, prostor ispunjavaju POZITIVNOM ENERGIJOM, ka blagotvorno deluje na ljudsko zdravlje.U PROSTORU U KOJIMA ONI DELUJU, mikroorganizmi VIRUSI, GLJIVICE I BAKTERIJE, nisu aktivni i ne napadaju ljudki organizam.', NULL, NULL),
(1206, 22, 518, 'Dr Mihajlo Crnobrnja ija, Mirjana Domonji sarađujemo u okviru udruženja građana  Ekološki pokret opštine Stara Pazova EKO SAN, profesor je član Upravnog odbora a ja predsdnica.', NULL, NULL),
(1207, 23, 518, 'Motivisalo nas je da se prijavimo za ovaj program, to što su orgoniti delo naučnika Vilhema Rajha još iz 1930 godine, gde je on njihovu delotvornost i naučno dokazao, bili su korišćeni u bolnicama i banjama u Nemačkoj ali nisu našli široku primenu.', NULL, NULL),
(1208, 24, 518, 'Kao što su guske spasile Rim od požara, tako će PAZOVAČKI ORGONITI spasiti svet od pandemije izazvane virusima.', NULL, NULL),
(1209, 25, 518, 'Od nagomilane tehnike i elektronike, naši potencijalni kupci su svi stanovnici planeta Zemlje, došlo je do velikog odstupanja frekvencija, koje pozitivno deluju na ljudski organizam a to je frekvencija Šumanove rezonance od 7,83 herca, što za ljudski rod predstavlja NEGATIVNU ENERGIJU i gubitak prirodnog imuniteta na mikroorganizme, VIRUSE; GLJIVICE I BAKTERIJE a oni se upravo u takvom okruženju množe, mutiraju i parazitiraju na ljudima.', NULL, NULL),
(1210, 26, 518, 'Ovo je proizvod koji će koristiti ceo svet od preko 7 milijardi stanovnika. Za početak, to će biti opština Stara Pazova sa 65.792 stanovnika. zatim Srbija sa 6,908 miliona stanovnika pa Evropa sa 746,4 milona stanovnika a kasnije i ceo svet. Podaci korišćeni sa GOOgla.', NULL, NULL),
(1211, 27, 518, 'Mi rešavamo problem svim stanovnicima planete Zemlje, gde tehnološki razvoj nauke i tehnike nije upredo praćen adekvatnom zaštitom zdravlja od štetnih zračenja i vibracija.To znaju svi radiestezisti i osobe koje se bave KVANTNOM FIZIKOM I KVANTNOM MEDICINOM, gde se uveliko primenjuju mere zaštite od štetnih vibracija, kako u preventivne svrhe, tako i kao oblik pomoći pri lečenu klasičnom i alternativnom ili INTEGRATIVNOM MEDICINOM.', NULL, NULL),
(1212, 28, 518, 'Najviše želimo da razvijamo inovativni proizvod PAZOVAČKE BIOPIRAMIDE EKO SAN, po tehnologiji naučnika Vilhema Rajha jer naša biopiramida neutrališe sva štetna zračenja u prostoru i onemogućava aktivnost virusa u poluprečniku od 20m širine i 2,5m visine, a sve druge na tržištu imaju daleko manju snagu.', NULL, NULL),
(1213, 30, 518, 'Najveći deo stanovništva planete Zemlje, nisu ni svesni ovog problema a suočavaju se sa posledicama.Oni koji o tome više znaju i svesni su problema negativnih frekvencija rešavaju na razne načine, nama su poznate Biopiramide od keramike, koje štite prostor maksimalno 300m3, rade na principu Zemljinog magnetizma, moraju se u određeno vreme iznositi na sunce, moraju strogo biti postavljene u odnosu na strane sveta i ako se to ne ispuni, one nisu u funkciji.Postoji još proizvođača orgonita, kao hobisti ali ni jedna nije ovih sposobnosti, kao naša PAZOVAČKA BIOPIRAMIDA EKO SAN:', NULL, NULL),
(1214, 29, 518, 'Glavni benefit naši proizvodi donose kupcima u zaštiti mikro životne sredine, gde se stanuje, živi, radi, uči, leči...putuje... sve negativne frekvencije, svodi na POZITINU ENERGIJU frekvencije Šumanove rezonance od 7,83 hreca, deluje kroz nameštaj i zidove, nije potrebno nikakvo održavanje, nema nikakvih štetnih dejstava, u prostoru možemo imati i više, čak i mnogo orgonita, a da se niko ne predozira, jer svi imaju istu frekvenciju.', NULL, NULL),
(1215, 32, 518, 'Naš proizvod je poboljšan u odnosu na sve koje su nama poznati, jer obuhvata daljeko najveći prostor delovanja, tako da jedna PAZOVAČKA BIOPIRAMIDA EKO SAN ORGONIT, može obezbediti celu prizemnu kuću ili sprat u zgradi ili poslovni prostor.Sa malo ulaganja, mogu da se postignu veliki i zanačajni efekti za unapređenje ljudskog zdravlja, zaštite životne sredine i napretka u svakom pogledu, jer korisnici postaju zdraviji, kreativniji i daleko bolje komuniciraju što se odrazi i na poslovne rezultate kao i efikasnost kod učenja u bilo kojem životnom dobu.', NULL, NULL),
(1216, 37, 518, 'Samo smo dobili informacije.', NULL, NULL),
(1217, 40, 518, 'U ovom momentu ne možemo proceniti', NULL, NULL),
(1218, 41, 518, 'Oko dve godine u okviru Ekološkog pokreta opštine Stara Pazpva EKP SAN, Mirjana Domonji, kao predsednica i Dr Mihajlo Crnobrnja, kao član Upravnog odbora ukazujemo na štetnost negativnih energija i vibracija u životnoj sredini gde ljudi gube zdravlje  a virusi i ostali mikroorganizmi napadaju najosetljivije delove ljudskog organizma i tako nastaje bolest.U zadnjih nekoliko meseci našem timu priključila se i Prim. Dr Jelisaveta Kunosić, doktor medicine tako da smo spojili, zdravlje, ekologiju i ekonomiju.', NULL, NULL),
