(1252, 71, 535, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1253, 63, 536, 'Lako učenje predstavlja digitalni logopedski algoritam koji omogućava roditeljima da samostalno testiraju svoje dete da li je jezičko-govorno prilagođeno svom rastu. Nakon dobijanja rezultata i izveštaja testiranja dobija se stručno video-logpedsko objašnjenje šta i kako dalje, da li je dete u skladu sa uzrastom, da li ima potrebe za dalji rad i korišćenje logopedskih materijala. Materijal koji se dalje nastavlja na algoritam sadrži veliki broj video, grafičkih, zvučnih materijala, opisa, priča, rečenica, reči koji su prilagođeni detetu i roditeljima. U zavisnosti od dijagnostike i rezultata testiranja potrebno je vežbati od 30 do 60 minuta dnevno, na relaciji roditelj-dete u kućnom ambijentu.', NULL, NULL),
(1254, 71, 537, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1255, 17, 538, 'Lako učenje predstavlja digitalni logopedski algoritam koji omogućava roditeljima da samostalno testiraju svoje dete da li je jezičko-govorno prilagođeno svom rastu. Nakon dobijanja rezultata i izveštaja testiranja dobija se stručno video-logpedsko objašnjenje šta i kako dalje, da li je dete u skladu sa uzrastom, da li ima potrebe za dalji rad i korišćenje logopedskih materijala. Materijal koji se dalje nastavlja na algoritam sadrži veliki broj video, grafičkih, zvučnih materijala, opisa, priča, rečenica, reči koji su prilagođeni detetu i roditeljima. U zavisnosti od dijagnostike i rezultata testiranja potrebno je vežbati od 30 do 60 minuta dnevno, na relaciji roditelj-dete u kućnom ambijentu.', NULL, NULL),
(1256, 22, 538, 'Da, rad u zajedničkom logopedskom kabinetu, rad na logopedskim testovima, rad na analitici baze rezultata, rad na android aplikaciji, rad na web sajtu.', NULL, NULL),
(1257, 23, 538, 'Poštovani, \r\nobraćam vam se kao Ivana Mašić, idejni tvorac ovog navedenog algoritma i da na ovaj način predočim moju motivaciju za učešće u programu:\r\n\r\nU papirnom obliku, kao i kod ostalih logopeda algoritam postoji 100%, kao i materijal sa kojim trenutno radim na osnovu rezultata testiranja deteta i razvojne forme kojoj dete pripada, isto 100%.\r\n\r\nMoja najveća prednost je što je algoritam prebačen u digitalni oblik 100%, i pravljen na osnovu iskustva i rada sa preko 2000 dece u prethodnih 14 godina.\r\n\r\nOno što treba da se odradi (80% IT i logopedskog posla), jeste razni materijal u obliku video zapisa, audio zapisa, slika, rečenica, tekstova, koji prate rezultate testiranja.\r\n\r\nSvesna sam da nemam zaposlene ljude koji mogu da rade 100% na projektu, ali sarađujem sa iskusnim ljudima koji rade na projektu part time, i ako prođem vaš konkurs i dobijemo sredstva, sigurna sam da ću uz pomoć njih završiti algoritam sa materijalom koji prati algoritam.\r\n\r\nS poštovanjem,\r\nIvana Mašić', NULL, NULL),
(1258, 24, 538, 'Lako nauči!', NULL, NULL),
(1259, 25, 538, 'Naš proizvod, Lako učenje (la. Lako učenje, en. Easi learning, de. Einfaches Lernen) - digitalni logopedski algoritam rešava problem testiranja jezičko-govornih problema dete od kuće.\r\n\r\nNajveći problem je bio kako napraviti digitalni algoritam, kako ga prebaciti iz papirnog oblika i preko hiljadu testirane dece sa problemima objediniti kao rezultat testiranja.', NULL, NULL),
(1260, 26, 538, 'Tržište je globalno, podeljeno u faze projekta:\r\n1. lokalno i globalno tržište (srpska ćirilica - ekavica)\r\n2. lokalno i globalno tržište (srpska ćirilica - ijekavica)\r\n3. lokalno i globalno tržište (srpska latinica - ijekavica)\r\n4. lokalno i globalno tržište (engleski jezik)\r\n5. lokalno i globalno tržište (nemački jezik)', NULL, NULL),
(1261, 27, 538, 'Naša ciljna grupa su roditelji sa decom u različitoj starosnoj dobi koja se testira na jezičko-govorni razvoj (12 različitih grupa po starosnoj dobi deteta), a idealni korisnici su roditelji koji moraju svakodnevno voditi decu kod logopeda.\r\n\r\nSledeća ciljna grupa su pedijatrijske i defektološke ordinacije, vrtići, škole i ostale logopedske ordinacije.', NULL, NULL),
(1262, 28, 538, 'Lako učenje predstavlja digitalni logopedski algoritam koji omogućava roditeljima da samostalno testiraju svoje dete da li je jezičko-govorno prilagođeno svom rastu. \r\n\r\nTehnologije: logopedski testovi\r\nIT:  HTML, CSS, PHP, MySql, Laravel, JavaScript, VUE, NUXT, NODE\r\n\r\nNaš proizvod, Lako učenje  - digitalni logopedski algoritam nudi jedinstveno rešenje koje ne postoji u ovom obliku na svetu.', NULL, NULL),
(1263, 30, 538, 'Trenutno se problem rešava tako što roditelji decu dovode u logopedske kabinete na testiranje.\r\n\r\nGlavni problem je mali broj logopeda za testiranje, gužve i čekanje na slobodne termine, i na osnovu svega toga dešava se da roditelj kasni u proceni jezičko-govornog stanja njegovog deteta i nakon toga dete ima problem za prilagođavanje u starosnu dob, učenje, savladavanje materijala i gradiva.', NULL, NULL),
(1264, 29, 538, 'Glavni benefit je što roditelj može testirati dete od kuće, snimiti njegovo stanje na osnovu rezultata testiranja i ako je potrebno može samostalno da radi sa detetom pomoću dostupnog materijala.\r\n\r\nNa taj način se rešava intervenisanje na vreme za rad sa logopedom.', NULL, NULL),
(1265, 32, 538, 'Za naš proizvod Lako učenje, treba da se odradi (80% IT i logopedskog posla), jeste razni materijal u obliku video zapisa, audio zapisa, slika, rečenica, tekstova, koji prate rezultate testiranja.', NULL, NULL),
(1266, 37, 538, 'Urađeno inicijalno istarživanje, informativno.', NULL, NULL),
(1267, 40, 538, 'Naša strategija jeste da se algoritam koji imamo u obliku testova na papiru u potpunosti što pre pogodimo na sistem koji trenutno razvijamo, a potom na osnovu testiranja da priložimo materijal za dalji rad roditelja sa decom kod kuće. \r\n\r\nNakon toga krećemo sa marketinškim kampanjama i prodajom. Osim direktne prodaje roditeljima (B2C) cilj je i prodaja ordinacija (B2B2C).', NULL, NULL),
(1268, 41, 538, 'Od ideje do današnjeg dana prošlo je oko 10 meseci.\r\n\r\nTim je okupljen 6 meseci.\r\n\r\nPotpuno su razrađeni i prikupljeni testovi za testiranje i oko 80% materijala za učenje nakon testiranja.\r\n\r\nŠto se tiče IT, algoritam je urađen za svih 12 starosnih dobi dece, ostaje da se za svaki rezultat poveže materijal za učenje.', NULL, NULL),
(1269, 44, 538, 'Ne.', NULL, NULL),
(1270, 45, 538, 'Ne.', NULL, NULL),
(1271, 48, 538, 'Najveća pomoć je potrebna za završetak projekta (IT, logopedski testovi), potom promocija i prodaja.', NULL, NULL),
(1272, 49, 538, 'Do sada je uloženo 9000 eur (priprema i prilagođavanje logopedskih testova za digitalnu formu, plaćanje programera za razvoj).\r\n\r\nNovac bi bio potrošen za završetak našeg proizvoda, a potom za održavanje i promociju i prodaju.\r\nPlate (Logopedske usluge): 4000 eur\r\nPlate (IT usluge): 8000 eur\r\nOdržavanje proizvoda (njeb server, it održavanje): 1000 eur\r\nMarketing kampanja (socijalne mreže, sadržaj, tekstovi, oglasi): 4000 eur\r\nProdaja: 1000 eur', NULL, NULL),
