(1357, 89, 582, 'Završen Elektrotehnički fakultet u Beogradu. Stalno zaposlen već 7 godina sa iskustvom u nekoliko IT kompanija kao što su MikroElektronika, HDL Designe House i Quectel. Radio na razvoju startapa SWM koji se bavio rešenjem za pametno prikupljanje utpada. Učestvovao u programima: SIA Serbia, Trag Fondacija Zelene Ideje, Univerzum, Najbolja tehnološka inovacija.', NULL, NULL),
