(1363, 63, 585, 'Soft Rug je softver za dizajnaranje pirotskih ćilima', NULL, NULL),
(1364, 71, 586, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1365, 17, 587, 'Soft Rug je softver za dizajnaranje pirotskih ćilima', NULL, NULL),
(1366, 22, 587, 'Ne. Zorana i Dušan su deca dva stara drugara, koji se poznaju od rođenja. Kasnije su išli u isto odeljenje Gimnazije Stevan Sremac. Prijatelji i komšije, koji su su došli na zajedničku ideju da zaštite pirotski ćilim od zaborava. Jer, Zorana je unuka i sestričina čuvenih tradicionalnih pirotskih ćilimarki, a Dušan je pirotski zet.', NULL, NULL),
(1367, 23, 587, 'Ja, Dušan Krstić, sam već pokušavao da pokrenem biznis sa sajtom za naručivanje patika i cipela, na kome su korisnici sami kombinovali boje i materijale. Kupovali su i na kućnu adresu su im stizale tako dizajnirane patike i cipele. medjutim, puno je problema bilo u samom startu poslovanja. Kupci su pre svega želeli da probaju obuću pre kupovine ili da je zamene za veći/manji broj, što je bilo nemoguuće jer su sve cipele bile unikatne i ručno proizvedene. Zorani sam predložio da ona svoje znanje o pirotskim ćilimima, koje i sama dizajnira i ručno tka, unese u softver sa bazom podataka o dezenima, bojama, šarama i pravilima vezanim za izradu pirotskog ćilima. Kako bismo, umesto cipela, napravili grafički prikaz pirotskog ćilima, po kome je moguće naručiti izradu ćilima izabranog dezena i izgleda.', NULL, NULL),
(1368, 24, 587, 'Mi budućnost ne vidimo bez prošlosti.', NULL, NULL),
(1369, 25, 587, 'Softver ubrzava proces biranja i donošenja odluke od strane kupca, kao što istovremeno skraćuje i olakšava komunikaciju proizvodjača sa klijentom.\r\nOvaj problem bio je iskra za razvijanje ideje za ovakvim alatom-softverom.\r\nJavila se potreba za ovakvim proizvodom.\r\nPirotski ćilim je skup proizvod. Tako i treba da bude jer nosi veliku vrednost na mnogim nivoima (2 nivoa zaštite + UNESCO)\r\nKupac AVANSIRA izradu gotovog proizvoda.\r\nDa bismo mi proizvodjači služili klijentu na visokom nivou, klijent mora da ima uticaja na svoju kupovinu.', NULL, NULL),
(1370, 26, 587, 'Kreiranje ovog alata-softvera koristiće svim proizvodjačima ćilima (rugs & kilims) da ubrzaju proces primanja porudžbine i unaprede uslugu koju nude, kao i njihovim klijentima kroz korisničko iskustvo. To je veoma široka oblast delatnosti i ciljna grupa korisnika našeg softvera su pored domaćih, takodje i mnogi svetski proizvodjaći delatnosti iz oblasti moderne i narodne radinosti (modern crafts). Pre svega, to su Južna i Severna Amerika, Meksiko, Navaho, Istočna Evropa, Balkan, Bugarska i Turska.', NULL, NULL),
(1371, 27, 587, 'Kreiranje ovog softvera rešava problem istovremeno i proizvodjaču ćilima (kategorija rugs & kilims), kroz unapredjen proces ponude i primanja porudžbine, kao i komunikacije sa klijentom. Dok njihovim klijentima olakšava korisničko iskustvo i proces odlučivanja, kroz jasnu sliku proizvoda koji će dobiti.Ovakav softver služiće kompanijama koje se bave delatnošću unutrašnje dekoracije širom sveta.', NULL, NULL),
(1372, 28, 587, 'Trenutno na tržištu ne možete sami dizajnirati pirotski ćilim i naći nekog ko će takav ćilim da izradi. \r\nNaša ponuda je jedinstvaena, jer kupcima nudi jedinstven alat koji će im omogućiti da sami dizajniraju pirotski ćilim, koji ćemo za njjih rado proizvesti.\r\nUnapredjen proces kupovine.\r\nPoboljšanje korisničkog iskustva.\r\nKonkurentska prednost.\r\nIzvoz.', NULL, NULL),
(1373, 30, 587, 'Ne rešavaju. Potencijalni kupci ne znaju da ovaj problem postoji, niti da postoji rešenje ovakvog problema.\r\nSvaki proizvodjač tepiha i ćilima prodaje \r\nili - gotov izradjen proizvod; \r\nili - izradjuje naručeni proizvod po fizičkom uzorku, gde kupac unapred ne vidi proizvod.', NULL, NULL),
(1374, 29, 587, 'Mi nudimo da: \r\n- proizvodjač prodaje proizvod koji još uvek nije izradjen (po porudžbini), a da je njegov kupac, preko softvera, u potpunosti upoznat sa izgledom i karakteristikama kupljenog proizvoda (sa svim detaljima, dimenzijama, kombinacijama boja, motiva, simbola i značenja).\r\nPrednosti: \r\nProizvodjač prima avans, zatim izradjuje fizički proizvod\r\nKupac je upoznat sa proizvodom koji je kupio, šta je tačno izabrao i šta će dobiti, sve zahvaljujući kompjuterskom softveru.\r\nPirostski ćilim, kao i ćilimi svih svetskih proizvodjača nam ovo omogućavaju, jer su grafički i sistematizovani.\r\nKupcima donosimo radost što i oni mogu da dizajniraju pirotski ćilim! A onda takav ćilim i da kupe.', NULL, NULL),
(1375, 32, 587, 'Samo jedno softversko rešenje je pronadjeno u arhivi da je postojalo pre par godina. Uradio ga je Aleksa Stefanović. Ali ta aplikacija više nije aktivna i softver je više bio pokazna vežba. Dakle, nije sadržao pravila za dizajn pirotskog ćilima, već samo softver za crtanje na kome su mogle da se biraju geometrijske šare. \r\nSoft Rug će biti prvi alat koji funkciniše po pravilima autentičnog pirotskog ćilima.', NULL, NULL),
(1376, 37, 587, 'Planiramo da zaštitimo intelektualnu svojinu. Intelektualna svojina bi bila naša zajednička, po 50%.', NULL, NULL),
(1377, 40, 587, 'Naš startap planira da zaradjuje tako što će posredovati izmedju kupaca i proizvođača pirotskih ćilima. Alat Soft Rug, koncipiran i prilagodjen e-komercu, odnsosno on-line prodaji će omogućiti povećanje proizvodnje, ponude i potražnje za pirotskim ćilimima.\r\nProdaja softvera kompanijama koje se bave proizvodnjom ćilima, tepiha i tekstilne kućne dekoracije.', NULL, NULL),
(1378, 41, 587, 'Tim je oformljen pre mesec dana, iako smo prijatelji čitav život.\r\nUključili smo u saradnju Zoraninu tetku, koja drži obuke za tkanje pirotskog ćilima i predaje tkanje u srednjoj stručnjoj školi u Pirotu.', NULL, NULL),
(1379, 44, 587, 'Ja, Dušan Krstić, kao inovator i suosnivač RoboShepherd projekta, sam učestvovao u programu saradnja nauke i privrede Fonda za inovacione delatnosti Republike Srbije.', NULL, NULL),
(1380, 45, 587, 'Moj projektat RoboShepherd je dobio grant iz Programa saradnje nauke i privrede, nosilac projekta je bio Coming Computer Engineering doo iz Beograda i Mašinski Fakultet iz Niša. Ja lično nisam nikada dobio grant, a projekat Soft Rug nije prihavljivan ni na jednom fondu, grantu ili sl.', NULL, NULL),
(1381, 48, 587, 'Smatramo da ćete nam pomoći da iskristališemo ideju, da istražimo tržište, da osmislimo kvalitetan i održiv biznis plan i da krenemo u osvajanje tržišta.', NULL, NULL),
(1382, 49, 587, 'Za izradu Soft Rug softvera će biti potrebno oko 80.000 evra, a za popunjavanje baze softvera, tj. za naučno istraživački rad i definisanje pravila za izradu pirotskog ćilima još 60.000 evra-\r\nprvih 10.000 CHF koji očekujemo od Raising Starts programa iskoristićemo za istraživanje tržišta, definisanje softverskih zahtevi, podizanje sajta, marketing...', NULL, NULL),
(1383, 52, 587, 'od radnika NTP Niš smo saznali za Raising Starts', NULL, NULL),
