(1393, 71, 598, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1394, 63, 599, 'Namenjena trenerima amaterskog i dečijeg sporta, koja im značajno ubrzava i olakšava sve poslove oko evidencija dolaznosti sportista, rasporeda treninga i takmičenja, prikupljanju povratnih informacija od sportista o njihovom doživljaju posle svakog treninga/takmičenja...\r\n\r\nIdeja je da se omogući trenerima neka vrsta elektronskog dnevnika, koji će olakšati posao u onim pratećim poslovima van samo terena.\r\n\r\nKrenuli smo u rešavanje jednog sitnog problema koji svaki trener ima u svakodnevnom radu. Trener u radu sa decom ili amaterskim sportistima, pre početka svakog treninga gubi određeno vreme oko evidencije dolazaka svojih sportista. Smislili smo način da oslobodimo trenera da ne mora više on to da radi, kako bi mogao da se fokusira na sam trening/takmičenje. Koristeći aplikaciju na jednostavan način će taj deo posla obavljati igrači. Povratna informacija od samih aktera je dragocena, a onda smo otišli i korak dalje- omogućili smo sportistima da ocene svoje izvođenje posle svakog treninga ili utakmice.\r\n\r\nNa taj način dobili smo više benifita u jednoj jednostavnoj radnji: dali smo mogućnost igračima da se njihovo mišljenje iskaže što analizom treneru daje novi uvid u stanje sportista, a ujedno smo oslobodili trenera nepotrebnog dela posla oko evidencije.', NULL, NULL),
(1395, 71, 600, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1396, 17, 601, 'Namenjena trenerima amaterskog i dečijeg sporta, koja im značajno ubrzava i olakšava sve poslove oko evidencija dolaznosti sportista, rasporeda treninga i takmičenja, prikupljanju povratnih informacija od sportista o njihovom doživljaju posle svakog treninga/takmičenja...\r\n\r\nIdeja je da se omogući trenerima neka vrsta elektronskog dnevnika, koji će olakšati posao u onim pratećim poslovima van samo terena.\r\n\r\nKrenuli smo u rešavanje jednog sitnog problema koji svaki trener ima u svakodnevnom radu. Trener u radu sa decom ili amaterskim sportistima, pre početka svakog treninga gubi određeno vreme oko evidencije dolazaka svojih sportista. Smislili smo način da oslobodimo trenera da ne mora više on to da radi, kako bi mogao da se fokusira na sam trening/takmičenje. Koristeći aplikaciju na jednostavan način će taj deo posla obavljati igrači. Povratna informacija od samih aktera je dragocena, a onda smo otišli i korak dalje- omogućili smo sportistima da ocene svoje izvođenje posle svakog treninga ili utakmice.\r\n\r\nNa taj način dobili smo više benifita u jednoj jednostavnoj radnji: dali smo mogućnost igračima da se njihovo mišljenje iskaže što analizom treneru daje novi uvid u stanje sportista, a ujedno smo oslobodili trenera nepotrebnog dela posla oko evidencije.', NULL, NULL),
(1397, 22, 601, 'Radimo zajedno u okviru iste organizacije (Univerzitetski rukometni klub ,,Studentski grad\'\') više od 5 godina. \r\n\r\nUpoznali smo se zahvaljujući rukometu, odnosno kada je Nikola počeo da radi u klubu (Ivan je tada već bio član kluba). Od tada do danas uspešno sarađujemo i što je najvažnije razvili smo međusobno poverenje i iskren odnos u poslovanju.', NULL, NULL),
(1398, 23, 601, 'Kada smo saznali za program doživeli smo onaj momenat kada shvatimo da neke stvari u životu se jednostavno pojave u pravom momentu.\r\nNajveća motivacija da se prijavimo je spoznaja da postoje organizacije kojima je iskreno stalo da stanu iza ideja koje su na svom početku.\r\nMi smo uvideli na našem dosadašnjem iskustvu da je stručna podrška najvažnija. Ma koliko da je neka ideja dobra, svako od nas početnika u biznisu će doći do zida koji usporava ili potpuno koči dalji razvoj.\r\n\r\nMotiviše nas to što ćemo:\r\n# naučiti nova neophodna znanja iz poslovanja, \r\n# dobiti mentore i iskrenu podršku, \r\n# doći do različitih iskustava drugih timova i zajednice,\r\n# i pored svega navedenog, dobijaju se i finansijska sredstva za dalji razvoj svog poslovanja.\r\n\r\nPrvi put se susrećemo sa ovakvim programom pomoći, a smatramo da je Raising Starts program savršen za sve one koji iskreno žele da rade na svojoj ideji i pravilno je razvijaju.', NULL, NULL),
(1399, 24, 601, 'COACH EASY APP- aplikacija koja OZBILJNO OLAKŠAVA posao trenerima !', NULL, NULL),
(1400, 25, 601, 'Našom aplikacijom želimo da pomognemo sportskim trenerima da reše problem nepotrebnog gubljenja vremena oko upisivanja prisutnosti sportista, kao i olakšavanja oko beleženja i analiziranja svih treninga, utakmica, ocena sportista...\r\n\r\nZa ovaj problem znamo zato što smo i sami treneri koji se godinama unazad muče i traže kvalitetno rešenje.', NULL, NULL),
(1401, 26, 601, 'Svi treneri koji rade u školama kolektivnih (fudbal, košarka, odbojka...) i individualnih (borilački sportovi, atletika, gimnastika...) sportova. Samo u Srbiji ima oko 15.000 registrovanih klubova (www.apr.gov.rs/регистри.25.html), a tu su i Balkanske zemlje (Hrvatska, Slovenija, Makedonija...), a kasnije otvaranje i prema inostranom tržištu.', NULL, NULL),
(1402, 27, 601, 'Sportskim trenerima i to onom mnogo većem delu, koji ostaje kada izuzmemo profesionalni sport.\r\nOni koji rade sa decom i amaterima su u najvećem broju entuzijasti, koji ne štede ni energiju, ni vreme, a često ni svoje finansije.\r\nVećina je svesna svoje odgovornosti u radu sa mladima i uprkos teškim uslovima, žele da pruže kvalitetan rad.\r\nVećinu čine mlađi i treneri srednjih godina (do 50 godina starosti).', NULL, NULL),
(1403, 28, 601, 'Cilj je izraditi web aplikaciju u vidu elektronskog evidentera koji će u nekim situacijama potpuno osloboditi trenera, a u nekim znatno olakšati i ubrzati rad.\r\nTrener će moći brzo i lako da pristupa svojim podacima i preko telefona, ali i preko računara i tableta.\r\nOsmislili smo više rešenja koja automatizuju procese unosa i analize, koje nismo pronašli ni u jednoj drugom programu.', NULL, NULL),
(1404, 30, 601, 'Treneri neće više koristiti svesku i olovku, pa kasnije i pravljenja izveštaja oko broja treninga, prisutnosti sportista, mesta i vremena održanih aktivnosti...\r\nSada im je sve to dostupno odmah sa mnogo manje utrošenog vremena.\r\nNačini na koje smo rešavali određene probleme smo sami otkrili i takve ideje ne postoje u sličnim aplikacijama.', NULL, NULL),
(1405, 29, 601, 'Benifiti:\r\n# ne opterećuje se nošenjem sveske i ručnog zapisivanja\r\n# svi podaci oko organizacije treninga i takmičenja su uvek sa njim (internet je danas svuda dostupan)\r\n# trener više ne radi posao evidentiranja prisutnosti sportista\r\n# trener dobija povratnu informaciju od svakog svog sportiste u vezi urađenog treninga/takmičenja.\r\n# svaki sportista poboljšava percepciju svog nastupa', NULL, NULL),
(1406, 32, 601, 'U poređenju sa dosadašnjim sličnim aplikacijama koje smo isprobali:\r\n- nigde nismo našli da je neko rešio problem evidencije sportista, a da to nije mehaničko unošenje ko je prisutan/odsutan.\r\n- u jednoj aplikaciji smo pronašli ideju da se komunicira sa sportistima, ali ne i na ovaj naš način gde se daje mogućnost sportistima da ocene svoj nastup po jednom ili više parametara (motivacija, fizički umor, zadovoljstvo svojom igrom...).\r\n- automatizovali smo procese kod izrade izveštaja dolaznosti i ocena, koji su lako čitljivi i jasni \r\n- svaki sportista ima personifikovanih pristup svojim podacima (urađeno i za android i ios), koji mu služi kao jedna vrsta sportskog dnevnika\r\n- plan je da se urade više vrsta alarma i za trenere i za sportiste, koji će putem notifikacija podsećati na zadatke ili na reakcije trenera.\r\n- odlična mogućnost praćenja više grupa u klubu, od strane rukovodećih (idealno za predsednike ili direktore sportskih klubova koji imaju puno klupskih selekcija).', NULL, NULL),
(1407, 37, 601, 'Vlasnik intelektualne svojine bi bio Ivan Stanković.', NULL, NULL),
(1408, 40, 601, 'Pošto je reč o aplikaciji, plan je da se prodaju godišnje licence, sa mogućnosti obnavljanja po isteku.\r\nIdeja je da se naprave 3 paketa funkcionalnosti koji će se razlikovati po funkcionalnostima i ceni (minimalni, osnovni i maksimalni).', NULL, NULL),
(1409, 41, 601, 'Od početka ideje, pa do ove tačke u kojoj se sada nalazimo prošlo je više od 1,5 godine.\r\n\r\nIvan je pokrenuo glavnu ideju rešavanja tog problema, a vrlo brzo je i Nikola prepoznao značaj i uključio se u razradu detalja samih funkcionalnosti. Brzo smo napravili koncept i skice i pronašli programera koji je pretvorio sve to u jednu radnu verziju web aplikacije, koja nema sve zamišljene funkcionalnosti, ali dovoljna je da se može isprobati njen rad.\r\n\r\nTu verziju smo iskoristili da probamo među sportistima koje treniramo u klubu. Naši utisci su dosta pozitivni iako vidimo da ima dosta prostora za unapređenje cele aplikacije.\r\n\r\nSada smo svesni da nam je potrebno još ljudi u timu, koji bi uzeli učešća pre svega kod poslova širenja prema drugim korisnicima koji bi testirali celu aplikaciju, a kasnije korak po korak išli ka razvoju marketinga i prodaji licenci.', NULL, NULL),
(1410, 44, 601, 'Nismo ni u jednom do sada.', NULL, NULL),
(1411, 45, 601, 'Nismo ni tražili nikakva sredstva.', NULL, NULL),
(1412, 48, 601, 'Shvatili smo da je osnovna ideja jedno, a celokupna realizacija nešto sasvim drugo.\r\nUvereni smo da ćemo kroz ovaj Program naučiti mnogo veština koje su u stvari neophodne da bi pokrenuli biznis.\r\nMislimo da nam je najpotrebnije znanje koje ćemo dobiti oko pravilnog daljeg razvoja po etapama, kako bi ova naša ideja dobila mogućnost da dođe do krajnjeg korisnika.', NULL, NULL),
(1413, 49, 601, 'Mislimo da treba uložiti novac u dalji tehnološki razvoj i marketing oko početka prodaje.\r\n\r\nKoliko je tačno to novca, ne bi znali da odgovorimo. Ali svakako ponuđena novčana pomoć je neophodan korak ka realizaciji ideje.', NULL, NULL),
