(1421, 91, 609, '- aktivan kao rukometni trener u URK ,,Studentski grad\'\', gde je angažovan oko 5 puta nedeljno, 2-3h dnevno.', NULL, NULL),
(1422, 63, 610, 'Naš inovativni i inteligentni uređaj (kontroler) uparen sa bilo kojim komercijalnim klima uređajem,  pretvara svaki termički  izolovan prostor u rashladnu komoru. Time se na jeftin, ali inteligentan i inovativan način način rešava problem velikih investicija u skupe industrijske rashladne komore. Svako domaćinstvo ima deo neiskorišćenog prostora u podrumu, garaži ili u pomoćnoj zgradi koji se može toplotno izolovati, jeftinim i široko dostupnim izolacionim materijalima,  i nakon ugradnje klasičnog klima uređaja, uparenog s našim inovativnim i inteligentnim kontrolerom, dobijamo pravu rashladnu komoru - upravo tamo gde naši vredni ljudi beru jagode ili maline, upravo na mestu gde se prave i sazrevaju naši sirevi i tačno tamo  gde se salamuri naše  meso i pripremaju naše kobasice i kuleni ... Trud i znoj našeg domaćina će biti sačuvan i to u dvorištu gde živi, na imanju koje obrađuje.  I više neće brinuti da li će mu 18°C u decembru ili 25°C u februaru i 40°C u letnjim mesecima upropastiti sve ono zbog čega je vredno radio protekle godine. Našem domaćinu neće biti potrebno 10.000 EUR ili više, koliko koštaju industrijske rashladne komore,  već sa našim rešenjem, svoju sopstvenu rashladnu komoru može imati već od 500 EUR.', NULL, NULL),
(1423, 71, 611, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1424, 17, 612, 'Naš inovativni i inteligentni uređaj (kontroler) uparen sa bilo kojim komercijalnim klima uređajem,  pretvara svaki termički  izolovan prostor u rashladnu komoru. Time se na jeftin, ali inteligentan i inovativan način način rešava problem velikih investicija u skupe industrijske rashladne komore. Svako domaćinstvo ima deo neiskorišćenog prostora u podrumu, garaži ili u pomoćnoj zgradi koji se može toplotno izolovati, jeftinim i široko dostupnim izolacionim materijalima,  i nakon ugradnje klasičnog klima uređaja, uparenog s našim inovativnim i inteligentnim kontrolerom, dobijamo pravu rashladnu komoru - upravo tamo gde naši vredni ljudi beru jagode ili maline, upravo na mestu gde se prave i sazrevaju naši sirevi i tačno tamo  gde se salamuri naše  meso i pripremaju naše kobasice i kuleni ... Trud i znoj našeg domaćina će biti sačuvan i to u dvorištu gde živi, na imanju koje obrađuje.  I više neće brinuti da li će mu 18°C u decembru ili 25°C u februaru i 40°C u letnjim mesecima upropastiti sve ono zbog čega je vredno radio protekle godine. Našem domaćinu neće biti potrebno 10.000 EUR ili više, koliko koštaju industrijske rashladne komore,  već sa našim rešenjem, svoju sopstvenu rashladnu komoru može imati već od 500 EUR.', NULL, NULL),
(1425, 22, 612, 'Veže nas porodično prijateljstvo i deljenje istih vrednosti. Vrednosti koje nas rukovode u životu će nas rukovoditi  i u biznisu. Poslovno sarađujemo u poslednjih godinu ipo dana koliko traje  razvoj i unapređenje uređaja i rešenja CoolirajSačuvaj.', NULL, NULL),
(1426, 23, 612, 'Svesni smo činjenice da veliki broj dobrih ideja i patenata nikada nije ugledalo svetlost dana kao komercijalni proizvod. Mnoge mlade firme nisu uspele da preskoče prve kritične godine poslovanja. Smatramo da ovakvi programi nude sistematizovano znanje koje će pomoći mladim kompanijama da ne prave greške koje mogu ugroziti opstanak   kompanije u prvim, kritičnim godinama.', NULL, NULL),
(1427, 24, 612, 'Cooliraj Sačuvaj', NULL, NULL),
(1428, 25, 612, 'Naše rešenje pomaže  ind. polj. gazdinstvima i porodičnim firmama u oblasti proizvodnje i prerade hrane, da značajno smanje visoka ulaganja u rashladne komore. Konačni cilj, tj. rezultat primene rešenja jeste smanjenje količine hrane koja se baca  i podizanje kvaliteta finalnih proizvoda tako što će hrana biti skladištena i prerađivana u adekvatnim i precizno kontrolisanim temperaturnim režimima.', NULL, NULL),
(1429, 26, 612, 'Tržište od preko 400K registrovanih ind. polj. gazdinstava u RS (www.trezor.gov.rs/files/services/rpg/statistika/Broj%20registrovanih%20poljoprivrednih%20gazdinstava.pdf). Pored ostalog, svi oni se bave i proizvodnjom hrane za sopstvene potrebe i prodaju u lokalnim marketima/pijacama. Ista je ciljna grupa i u regionu (BiH, CRO, MN, MK, AL, RO, BG, HU...).', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(1430, 27, 612, '•	Proizvođači hrane (poljoprivredna gazdinstva, mala i porodična preduzeća):\r\n        -  Voće i povrće \r\n        -   Mleko i mlečni proizvodi \r\n        -  Meso i proizvodi od mesa\r\n        -   Jaja\r\n•	 Seoski turizam\r\n•	 Cvećare\r\n•	 Mali restorani/barovi\r\n•	 Piljarnice/corner šopovi\r\n•	 Lovačka udruženja\r\n•	Pojedinci koji vikende provode u kućama van grada, proizvode (zdravu hranu za svoje potrebe) i potreban im je „walk_in“ frižider', NULL, NULL),
(1431, 28, 612, 'Naš inovativni i inteligentni uređaj (kontroler) uparen sa bilo kojim komercijalnim klima uređajem,  pretvara svaki termički izolovan prostor, u rashladnu komoru. Naše rešenje koristi široko rasprostranjene i jeftine komercijalne klima uređaje za koje postoji široka mreža lokalnih instalatera i servisera, za razliku od industrijskih klima komora koje zahtevaju profesionalne (skupe) ugovore o održavanju. Kontrola procesa, zadavanje i praćenje svih bitnih parametara rashladne komore, dijagnostika i rano otkrivanje kvarova, alarmiranje u slučaju nedozvoljenih stanja komore biće na raspolaganju korisnicima na CoolirajSačuvaj mobilnoj aplikaciji ili veb pretraživaču.', NULL, NULL),
(1432, 30, 612, 'Naša ciljna grupa trenutno nema rešenje  za problem (čuvanje i procesiranje hrane u adekvatnim temperaturnim uslovima) jer njihova ekonomska snaga nije dovoljna za investicije u skupe industrijske klima komore (10.000  EUR i više)', NULL, NULL),
(1433, 29, 612, 'Naše rešenje je inovativno i inteligentno, bazirano na IoT tehnologijama, jednostavno za instalaciju, ne zahteva skupo održavanje, ekonomično je( od 500 EUR), flleksibilno i skalabilno, energetski efikasno i ekološki prihvatljivo.', NULL, NULL),
(1434, 32, 612, 'Na tržištu postoje isključivo skupa industrijska rešenja za rashladne komore.', NULL, NULL),
(1435, 37, 612, 'Trenutno je zaštićen žig CoolirajSačuvaj kod Zavoda za intelektualnu svojinu, br. prijave Ж 2020/1767, registarski broj  80411, od 25.05.2021. Nosilac prava na žig je Slobodan Terzić, podnosilac ove prijave.  U planu je zaštita patenta.', NULL, NULL),
(1436, 40, 612, 'Trržištu će biti ponuđena tri proizvoda:\r\n\r\n1. CoolirajSačuvaj komora  - po sistemu ključ u ruke (prefabrikovana rashladna komora sa instaliranim rashladnim modulom (klima uređaj uparen sa našim kontrolerom))\r\n2. CoolirajSačuvaj  rashladni modul ((klima uređaj uparen sa našim kontrolerom - korisnik obezbeđuje samo termički izolovan prostor)\r\n3. CoolirajSačuvaj kontroler ( za \"uradi sam\" korisnike - korisnik obezbeđuje  termički izolovan prostor i klima uređaj)', NULL, NULL),
(1437, 41, 612, 'Okupljanje tima, razrada rešenja i razvoj uređaja   traje više od godinu ipo dana.\r\nRazvijen prototip (HW + basic kontrolni SW)\r\nRazvijen početni GUI aplikacije za  mobilne telefone\r\nSprovedeno testiranje u testbed-u, potvrđen koncet\r\nPotvrđena osnovna funkcionalnost kontrolnog algoritma, WiFi funkcionalnost, komunikacioni protokol za vezu sa mobilnom aplikacijom', NULL, NULL),
(1438, 44, 612, 'Učestvovali smo u programu \"Rani razvoj\"  Fonda za inovacionu delatnost.', NULL, NULL),
(1439, 45, 612, 'Ne', NULL, NULL),
(1440, 48, 612, 'Potrebna nam je finansijska pomoć i pomoć vezano za tržišnu vidljivost CoolirajSačuvaj startupa. Takođe nam je potrebna pomoć u vezi sa procenom troškova poslovanja u prve dve godine poslovanja startupa.', NULL, NULL),
(1441, 49, 612, 'potrebno je 15000 CHF.\r\n\r\nTroškovi zarada 		        5,000 CHF\r\nTroškovi marketinga		2,250 CHF\r\nTroškovi izrade 		        2,250 CHF\r\nMaterijal i prateće usluge         500 CHF\r\nOprema za potrebe \r\nrazvoja i testiranja		         4,500 CHF\r\nPatent		                            500 CHF', NULL, NULL),
