(1447, 89, 620, 'Slobodan je zaposlen u Telekomu Srbija i ima preko 25 godina radnog iskustva u ICT industriji. Vodio je realizaciju ICT projekata od 100.000 EUR do 3.000.000 EUR. Svoj hobi (programiranje mikrokontrolera) iskoristio je da razvije inovativno rešenje odnosno uređaj CoolirajSačuvaj.', NULL, NULL),
(1448, 90, 620, 'Slobodan je kreator ideje odnosno rešenja CoolirajSačuvaj. Slobodan je konstruisao prvi protip hardwerskog uređaja i napisao prvu verziju softvera. Slobodan će u većoj meri biti posvećen razvoju startupa.', NULL, NULL),
(1449, 91, 620, 'Slobodan je stalno zaposlen u kompaniji Telekom Srbija već 26 godina.', NULL, NULL),
(1450, 89, 621, 'prof. dr Goran Kvaščev je vanredni profesor Elektrotehničkog fakuleta Univerziteta u Beogradu, stručnjak za automatizaciju i implementaciju, sa iskustvom u kompjuterski kontrolisanim sistemima, projektovanje upravljanja industrijskim sistemima na bazi PLC-a, IoT arhitektura i dizajn. Vodio je više međunarodnih i domaćih projekata za Siemens, Henkel i BSS/BELOM - Iugoimport SDPR, a autor je više od 50 naučnih radova.', NULL, NULL),
(1451, 90, 621, 'Prof. Kvaščev je razvojni konsultant zadužen za kontrolni algoritam, automatizaciju i regulaciju parametara komore, veštačku inteligenciju i IoT.Prof.  Kvaščev će biti  delimično posvećen razvoju startupa.', NULL, NULL),
