(1467, 27, 630, 'Svima koji se ne krecu mnogo a previse rade da bi stigli da idu do teretane da se bave svojim zdravljem. Vec godinu i po dana radimo sa Srbijom, Italijom i Austrijom u manjim grupama online i iskustva su pozitivna,', NULL, NULL),
(1468, 28, 630, 'Korisnicku i trenersku aplikaciju gde ce moci da se vidi koliko ljudi ima u grupi, koji je tip treninga na sledecem, raspored treninga, ko je trener...', NULL, NULL),
(1469, 30, 630, 'Ljudi su spremni da treniraju online, ali posto je trziste jos uvek u razvoju oni nisu sigurni sta da rade pa se oslanjaju na snimljene treninge na youtube platformi ili kupuju proizvode koji su sa stranog trzista.', NULL, NULL),
(1470, 29, 630, 'Trener na dodir ekrana. Mi svojim proizvodom čuvamo vreme ljudi tako što im omogućavamo da treniraju kada i gde žele i na taj način čuvamo njihovo zdravlje i postajemo bitan deo svake firme jer zaposleni ne odlaze na bolovanja. Bavimo se ljudima na pravi način, treningom, ishranom i pristupom.', NULL, NULL),
(1471, 32, 630, 'Proizvod je značajno poboljšan jer smo prevazišli sistem kartica koji ostavlja ljude same sebi da treniraju ukoliko znaju. Naš pristup je sledeći: Trener zadužen za svaku grupu. Uživo treninzi i povezanost sa svojom grupom.', NULL, NULL),
