(1474, 41, 630, '19 meseci uspesnog poslovanja. Imamo pozitivne povratne informacije u smeru ljudi koji su nasi redovni klijenti. Imamo interesovanja i upite za rekreaciju zaposlenih u nasim kompanijama.', NULL, NULL),
(1475, 44, 630, 'Jesmo u vašem, ali smo se prijavili kao startap a bili smo vec postavljen sistem. Jako nam je bitno da se uključimo u program sa vama kako bi ubrzali razvoj aplikacije i omogucili vise svojim korisnicima', NULL, NULL),
