(1516, 63, 653, 'UnderScope Map je softwer koji prikuplja i skladisti podatke o podzemnim instalacijama i te podatke prikazuje na Google Mapi. \r\nTakodje preko softvera se vrsi distribucija proizvoda koji su u vezi sa podzemnim instalacijama i softver je takodje alat sa kojim se prate radovi i projekti vezani za podzemne instalacije.', NULL, NULL),
(1517, 71, 654, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1518, 17, 655, 'UnderScope Map je softwer koji prikuplja i skladisti podatke o podzemnim instalacijama i te podatke prikazuje na Google Mapi. \r\nTakodje preko softvera se vrsi distribucija proizvoda koji su u vezi sa podzemnim instalacijama i softver je takodje alat sa kojim se prate radovi i projekti vezani za podzemne instalacije.', NULL, NULL),
(1519, 22, 655, 'Ne', NULL, NULL),
(1520, 23, 655, 'Otvaranje firme koja bi nastavila sa razvojem softvera u Srbiji zahteva velika novcana sredstva. Drzava na osnovu ovakve firme bi dobila mnogo ( kroz zaposlene i takodje mnoge firme bi koristile usluge softvera).', NULL, NULL),
(1521, 24, 655, 'Ne dozvoli neprijatna iznenadjenja kada imas mocan alat.', NULL, NULL),
(1522, 25, 655, 'Mapiranje I odredjivanje lokacije podzemnih instalacija je industrija u razvoju. \r\nKomunalni vodovi su zila  kucavica svake zajednice, najvazniji deo jednog i grada kako bi sve  ispravno funkcionirao.', NULL, NULL),
(1523, 26, 655, 'Svi vlasnici instalacija (snabdevaci elektricnom energijom, telekomunikacione kompanije, vodovodi , toplane ….), kompanije koje rade na detektovanju  podzemnih instalacija, gradske uprave, planeri, arhiktete …', NULL, NULL),
(1524, 27, 655, 'Prvo samom gradu zato sto ke gradu u interesu da ima pouzdane podatke o podzemnim instalacijama. Svi vlasnicima instalacija kao sto je navedeno (snabdevaci elektricnom energijom, telekomunikacione kompanije, vodovodi , toplane ….), planerima… \r\nKomunikacija jeste ostvarena, svi se slazu da je potrebno usavrsiti postojece softvere I poboljsati kolaboraciju izmdju svih .', NULL, NULL),
(1525, 28, 655, 'UnderScope Map je jedini softver ovakvog tipa koji podrzava distribuciju proizvoda I project management. Takodje posle trece faze projekta planirano je da ovo bude jedan od najpreciznijih alata za utvrdjivanje lokacija I upravljanje podacima. Za cetvrtu fazu je planiran Blockchain ali sada je vec mnogo rano o tome pricati. Pored toga polovonim trece faze je moguce da I Google se ukljuci posto se ipak razija njihova mapa.', NULL, NULL),
(1526, 30, 655, 'U Americi i Engleskoj postoje softveri koji se koriste. Postoji dosta nedostataka ali se radi o dobrim alatima. Nedostaci su vezani uglavnom za losu komunikaciju sa radarima, greskama u povezivanju sa radarima, losoj lolaboraciji izmedju vlasnika instalacija.\r\nProstar, Centerline map su neki od softvera.', NULL, NULL),
(1527, 29, 655, 'Korisnici dobijaju mogucnost potpune kolaboracije izmedju servisnih kompanija koje su vlasnici instalacija. Druga faza razvoja softvera ce povezati softver sa radiodetektorima tako da ce softver I u tom domenu biti konkurentan a  vec postoje funkcije koje drugi softveri nemaju tako da su benefiti uodnosu na druge softvere vec sada vidljivi.', NULL, NULL),
(1528, 32, 655, 'Poboljsan je zato sto priza bolju saradnju medju vlasnicima instalacija, bolju tehnicku dokumentaciju o proizvodima i nadam se bolje upravljanje i utvrdjivanje lokacija podzemnih instalacija.', NULL, NULL),
(1529, 37, 655, 'Nije nista radjeno na ovu temu.', NULL, NULL),
(1530, 40, 655, 'Vise od 300 000 evra na godisnjem nivou', NULL, NULL),
(1531, 41, 655, 'Na razvoju softvera poceo sam da radim pocetkom 2020 godine.\r\nAli ideju sam dobio 2016 te. \r\nZavrsio sam prvu fazu softvera. (Faze razvoja sam prilozio u jednom od dokumenata.)\r\nSoftver radi u Cikagu I u jednom delu Istanbula. \r\nU marketing je sada ukljucena Jelena Vidak, ali u promociju ove industrije su ukljuceni ljudi iz inostranstva.', NULL, NULL),
(1532, 44, 655, 'Ucestvovao sam u Ceskoj. Startup se zvao ZettaBox.', NULL, NULL),
(1533, 45, 655, 'Ne', NULL, NULL),
(1534, 48, 655, 'Podrska je najpotrebnija u drugoj polovini druge faze projekta. (Projekat ce imati 4 ili 5 faza)\r\nPotrebno je da se zavrsi jos mali deo softvera da bi se moglo poceti sa punim iznajmljivanjem , a nakon toga ce biti potrebno da se zaposle novi ljudi koji ce iskljuciov raditi u marketing I prodaji. Svi oni ce imati podrsku ljudi koji vec rade dugo u ovoj industriji. Narocito iz Amerike I Engleske.', NULL, NULL),
(1535, 49, 655, 'Za fazu 3 :\r\nZa dalji razvoj softvera je potrebno oko 50 000 evra.\r\nZa marketing u narednoj godini 50 000 evra pa na vise', NULL, NULL),
