(1582, 17, 685, '-Prerade hrane i hranjivih sastojaka u namirnice sa neograničenim rokom trajanja uz pomoć pćela.\r\nSve vrste sokova od voča, povrča,ljekovitih biljaka, čajeva, mleka, vina, piva u hranu u obliku meda(VITAMIZIRANI MED) \r\nSve vrste ostalih hranjivih materija(tzv. pulpe) u čvrstom stanju(meso, jaja,žitarice i slično) u oblik putera ili veće gustine.', NULL, NULL),
(1583, 22, 685, 'Od 2015 godine smo iz hobija i zainteresovanosti koristili smo tzv. eksperimentalnu prehranu pćela.Sve je to bilo kao hobi a 2017 smo preko Najbolje Tehnološke Inovacije PKS pokusali na takmićenju ali smo u smoj završnici odustali zbog problema lićne prirode.', NULL, NULL),
(1584, 23, 685, 'Motiva ima nekoliko, prvi i osnovni motiv je FOOD WASTE, ili bacanje hrane koje je prisutno na globalnom nivou.Ako nista želimo da doprinesemo razvoju ekonomije društva i njegovoj većoj socijalizaciji.\r\nTo nam je jedan od ciljeva i uz pomoc finansija bi smo to mogli približiti i pokrenuti na globalnom nivou.', NULL, NULL),
(1585, 24, 685, 'OD PRIRODE ZA ZDRAVIJU  PRIRODU', NULL, NULL),
(1586, 25, 685, 'Ekologija, smanjenje broja pčela, food waste,.Svi ovi problemi postoje odavno i sve su izražajniji a jedina rešenja koja se daju su u svim slucajevima površna i tiću se samo online i sve se kao može rešiti aplikacijama.Ima nekoliko rešenja na svetu koja se bave i preradom hrane i otpada ali im je CO 2 otisak mnogo veći.', NULL, NULL),
(1587, 26, 685, '-Humanitarne organizacije i udruženja (Posebni  Uslovi Kreditiranja)\r\n-Individualni poljoprivredni proizvođači.\r\n-Trgovinski lanci u prehrambenoj industriji.\r\n-Nezaposleni za samozapošljavanje.(PUK)\r\n-Socijalno ugrožene kategorije društva.( 4 aparata godišnje besplatno preko naše filantropske savesti)\r\n-Ekološki osveštena udruženja i građani.', NULL, NULL),
(1588, 27, 685, '-Korištenje u večim ili industrijskim kapacitetima se može ostvariti večim brojem košnica.Individualni poljoprivredni proizvođaći koji obavezno u procesu proizvodnje imaju proizvode koji su lošijeg kvaliteta mogu svesti gubitke na nulu. -Trgovine hranom od najmanjih pa do velikih trgovačkih lanaca. -Proizvodna i prerade  hrane u većem ili manjem obimu.', NULL, NULL),
(1589, 28, 685, '1. Prerada hranjivih sastojaka u proizvode sa neogranićenim rokom trajanja posebnih nutritivnih vrednosti uz pomoć pćela.\r\n2.Proizvodnja aparata za preradu organskih jedinjenja.Savremeni načini prerade,od dezinfekcije do gotovog proizvoda, sve na jednom mestu.Prilagođen svim uzrastima i kategorijama stanovništva bez potrebe za stručnim usavršavanjem.Međusobna povezanost proizvođača(web)\r\nOvo je sklop od proizvodnje gotovih proizvoda koji ujedno mogu da se koriste i kao poluproizvodi i kao aditivi za skoro sve grane privrede.Tokom koristenja ove tehnologije i pristupa uopšte ne postoji otpad, jer i za otpad imamo resenje jer ga pretvaramo u đubrivo ili za sagorevanje kao pelet.', NULL, NULL),
(1590, 30, 685, 'Od proizvođaća pa do prodavaća.Najćešće rešenje je da hranu koja je prilikom proizvodnje,branja i transporta ili koje po izgledu i velicini ne zadovoljava kriterijume u trgovinama otpisuju i bacaju kao obićan otpad u kontejnere i tu se javlja emisija CO2.Nešto se može iskoristiti za ljudsku ishranu, nešto za namirnice za životinje, a sve ostala bio masa kao đubrivo za polj.proizvodnju.', NULL, NULL),
(1591, 29, 685, 'Rešavanja organskog otpada, rešavanja gubitaka tokom proizvodnje, transporta, prodaje.-Manja kolićina utrošene energije za proizvodnju,transport, skladištenje hrane. Ostali pčelinji proizvodi su:propolis, polen,perga,med,vosak,pčelinji otrov, matićna mlijeć. Auto-industrija,farmacija,kozmetika,prehrambena-industrija( ZDRAVA ORGANSKA HRANA), najprofitabilnije grane i najveći brendovi današnjice.', NULL, NULL),
(1592, 32, 685, 'Gotovi proizvodi iz košnice mogu direktno da se plasiraju na tržište I kao sirovina, nacin prerade jer zahteva veliku strućnost i posebnu tehnologiju i aparate za obradu bio mase svi vrsta.Aparat za predpripremu ili obradu hranjivih sastojaka je poseban uređaj koji bi se mogao proizvoditi ne samo za košnice nego I druge procese u pripremi hrane.', NULL, NULL),
(1593, 37, 685, 'd.o.o. Enerfood', NULL, NULL),
(1594, 40, 685, 'Prodaja i proizvodnja i prerada voća, povrća, ćajeva uz pomoć pčela,(potuno novi proizvodi)  plus ostali pćelinji proizvodi, zatim proširivanje obima i raznolikosti proizvodnje na aparate potrebne za takav naćin prerade ili  na nove prehrambene proizvode.', NULL, NULL),
(1595, 41, 685, 'Preadu hranjivih sastojaka smo usvršavali direktno aplicirajući u košnice,nekoliko godina sa zadivljujućim rezultatima.Potom smo usavršavali i širili proizvodni program.Odradili smo ne samo proizvode nego i njihovu ambalažu i izgled.Od prerade do pakovanja,Ostaje nam pribavljanje sertifikata i prodaja.', NULL, NULL),
