(1611, 63, 696, 'Naša ideja je da kroz kratke e-learning lekcije i tutorijale edukujemo preplatnike o pojmu i benefitima pravne zaštite inovacija, odnosno o prednostima i načinu registracije inovacija pravom patenta kroz različite sisteme zaštite i na različitim teritorijama, kao i predočimo posledice propusta da se inovacija zaštititi. E-learning lekcije i tutorijali nalaziće se na našem sajtu i obuhvataće 6 (šest) tematskih oblasti: 1) Pojam i značaj patenta i patentne zaštite; 2) benefiti pravne zaštite i posledice propuštanja pravne zaštite; 3) postupak zaštite pred Zavodom za intelektualnu svojinu; 4) postupak zaštite pred EPO-om; 5) postupak zaštite pred WIPO-om; 6) najznačajniji primeri iz prakse. Pretplatnici e-learning lekcija i tutorijala imaće pravo i na konsultaciju 1:1 sa našim stručnjacima.', NULL, NULL),
