(1642, 89, 708, 'Formalno obrazovanje: Septembar 2011 - jul 2012 - West London Business College, London\r\nSeptembar 2008. - Pravosudni ispit\r\n2000-2005. - Pravni fakultet, Univerzitet u Novom sadu\r\n1996-2000. - Gimnazija Isidora Sekulić, Novi Sad\r\nStručno usavršavanje:\r\nJul 2009. - Registrovani zastupnik za zaštitu intelektualne svojinepred Zavodom za intelektualnu svojinu Republike Srbije (zastupnik za znake razlikovanje i zastupnik za patente)\r\nDecembar 2015. - Posrednik za mirno rešavanje sporova registrovan pred Ministarstvom pravde, dozvola br.740-09-1055/2015-22 od 14.12.2015. godine,\r\nobnovljena dozvolom br. 740-09-802/2019-22 od 26.08.2019. godine\r\nPROFESIONALNO ISKUSTVO:\r\nAdvokatska kancelarija Branislava Stajić Tanjga, Novi Sad, RS;  Pozicija: Advokat April 2010 –\r\nNovembra 2008 - Mart 2010: Advokatska kancelarija Slobodan dr Beljanski, Pozicija: advokat\r\nApril 2006-Oktobar 2008:Advokatska kancelarija Slobodan dr Beljanski, Pozicija:advokatski pripravnik', NULL, NULL),
