(1645, 89, 709, 'OBRAZOVANJE:\r\n2004/2009 - Departman za geografiju, turizam i hotelijerstvo, Prirodno matemaatički fakultet, Novi Sad\r\n2000/2004 - Gimnazija \"Filip Višnjić\" Bijeljina\r\nRadno iskustvo: \r\njul 2021 -\r\nMaster Tim Consalting doo Novi Sad, \r\nEdukacija klijenata za pisanje sadržaja i izradu vizuelnog sadržaja na internet platformama i društvenim mrežama, digitalni marketing; oglašavanja i reklamiranja na Google-u i Facebook-u; rad u programu Canva; rad na platformama Mailchimp, MailerLite, Sendfox, rad u aplikaciji Trello, Calendly, Linktree\r\nDecembar 2009-Novembar 2020 - Grand Tours doo, Novi Sad\r\nKreiranje programa za turističke aranžmane u zemlji i inostranstvu, izrada kalkulacija turističkih aranžmana, realizacija i organizacija individualnih i grupnih aranžmana, rezervacije svih vrsta prevoza, izrada konkursne dokumentacije za javne nabavke, komunakacija sa klijentima svih nivoa.', NULL, NULL),
