(1651, 22, 712, 'Da, tim je uigran kroz rad na klijentskim projektima.', NULL, NULL),
(1652, 23, 712, 'Celokupan razvoj je samofinansiran tako što prvo zaradimo novac kroz klijentske projekte, a zatim to investiramo u razvoj proizvoda.\r\nOvakav program će nam omogućiti potpuni fokus samo na proizvod.', NULL, NULL),
(1653, 24, 712, 'Oakly. is \r\nEasy. Powerfull.\r\nEnjoyable.', NULL, NULL),
(1654, 25, 712, 'Naš proizvod Oakly je platforma za kreiranje onlajn događaja usmerena pre svega ka industrijama u kojima IT nije jedna od primarnih grana. Višegodišnjim iskustvom i višemesečnim istraživanjem zaključili smo da je glavni problem koji korisnici imaju zapravo preplavljenost tehničkim opcijama. Postavili smo i validirali sledeću pretpostavku:\r\n\r\n10% funkcionalnosti rešavaju 90% potreba koje organizatori imaju.\r\nSa ključnim detaljom da to nikada nisu istih 10%.\r\n\r\nZbog toga je naše rešenje usmereno prevashodno na AI i analizu kojih su to 10% za svakog pojedinačnog korisnika. Na taj način dobijamo prednost u odnosu na konkurenciju i korisnicima nudimo optimizovano rešenje.\r\n\r\nPrimarni razlog usmerenosti na ovu industriju je znanje i iskustvo koje imamo i naravno, rast i potencijal same industrije.', NULL, NULL),
(1655, 26, 712, 'Trenutni fokus je američko tržište, imamo dogovor sa jednom međunarodnom organizacijom da od aprila koristi našu platformu.\r\n\r\nVeličina industrije događaja procenjena je na 1.135,4 mililjarde dolara sa procenom rasta od 11,2% do 2028. godine, dok je tržište virtuelnih platformi za događaje procenjeno na 22,75 mililjardi dolara do 2028.', NULL, NULL),
(1656, 27, 712, 'Primarna ciljna grupa su velike organizacije koje imaju prisustvo u više lokacija (gradova/država).\r\nSproveli smo uspešno testiranje sa nekoliko različitih korisnika.\r\n\r\nSada smo u progovorima za drugu vrstu klijenta, veliku međunarodnu organizaciju.', NULL, NULL),
(1657, 28, 712, 'Od navedenih, koristićemo AI za predikcije potreba korisnika.', NULL, NULL),
(1658, 30, 712, 'Postoji nekoliko slučajeva:\r\n1. Imaju velike resurse. Uglavnom angažuju agencije da im organizuju događaje.\r\n2. Imaju neke resurse. Pokušavaju sami da prilagode neka od postojećih rešenja. Uglavnom imaju problema jer nisu dovoljno upućeni ili im je komplikovano.\r\n3. Sami pokušavaju da naprave. Nismo našli nijedan uspešan slučaj.', NULL, NULL),
(1659, 29, 712, 'Korisnici na osnovu jednostavne analize dobijaju izgenerisanu platformu maksimalno prilagođenu njihovim potrebama.', NULL, NULL),
(1660, 32, 712, 'Postoji veliki broj rešenja u industriji, ali nijedno nije postalo globalno dominantno. \r\nNajbolji od njih su pronašli svoju nišu i tu dominiraju, ali svako od njih ima problem da bude prilagodljiv van svoje niše. \r\nOno što mi radimo jeste baš to, mogućnosti prilagođavanja.', NULL, NULL),
(1661, 37, 712, 'Imali smo razgovore sa advokatom na ovu temu. Može se zaštiti sve oko branding-a i jedan deo oko aplikacije.\r\nKako je u pitanju SAAS aplikacija svakako je kod nedostupan bilo kome.', NULL, NULL),
(1662, 40, 712, 'Klasičan SAAS model. Subscription modeli spram korišćenih resursa.', NULL, NULL),
(1663, 41, 712, 'Kreirali smo beta verziju koja je korišćena na 4 veoma različita događaja.\r\n\r\n1. Veliki broj kontinuiranih dnevnih događaja u periodu od 3 meseca.\r\n2. Višednevna konferencija koja je imala veći broj sponzora, partnera, predavača i učesnika.\r\n3. Organizacija koja je okrenuta ka društvenim događajima na nedeljnom nivou tokom cele godine.\r\n4. Hibridna konferencija (online + offline).\r\n\r\nKroz te događaje smo testirali gore pomenutu premisao i prikupili povratne informacije.', NULL, NULL),
(1664, 44, 712, 'ICT HUB - Entrepreneurship course\r\nICT HUB - Ino Zona\r\nImpact hub - spring cohort', NULL, NULL),
(1665, 45, 712, 'Ne, sve je samostalno finansirano.', NULL, NULL),
