(1667, 49, 712, 'Trenutno je najveći deo resursa potreban za ljudske resurse.\r\nPotrebno nam je 5.000 evra mesečno da bi radili željenim tempom. I sa manje novca možemo da funkcionišemo, ali malo slabijim tempom.', NULL, NULL),
