(1704, 89, 733, 'Master profesor sporta i fizičkog vaspitanja', NULL, NULL),
(1705, 90, 733, 'Prvi saradnik, u većoj meri posvećen.', NULL, NULL),
(1706, 91, 733, '- Glavni posao, zaposlen u školi kao profesor fizičkog.\r\n- dodatni posao aktivan kao rukometni trener, gde je angažovan oko 3 puta nedeljno, 1-1.5h u toku dana.', NULL, NULL),
(1707, 63, 734, 'Aplikacija koja povezuje rekreativne sportiste i pomaže im da nađu partnera za odabranu sportsku aktivnost. Prikaz dostupnih sportista se vrši na osnovu ponuđenih filtera koje korisnik izabere  i raspoloživosti za odabrane filtere. Korisnik se takodje može učiniti dostupnim za određeni sport u određeno vreme kako bi mu se drugi korisnici pridružili. Takođe, aplikacija omogućuje lakše pronalaženje potrebnih saigrača za ekipne sportove u  slučaju izostanka nekog od članova tima. Aplikacija prikazuje turnire i sportske događaje koji se nalaze u korisnikovoj okolini.', NULL, NULL),
(1708, 71, 735, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1709, 17, 736, 'Aplikacija koja povezuje rekreativne sportiste i pomaže im da nađu partnera za odabranu sportsku aktivnost. Prikaz dostupnih sportista se vrši na osnovu ponuđenih filtera koje korisnik izabere  i raspoloživosti za odabrane filtere. Korisnik se takodje može učiniti dostupnim za određeni sport u određeno vreme kako bi mu se drugi korisnici pridružili. Takođe, aplikacija omogućuje lakše pronalaženje potrebnih saigrača za ekipne sportove u  slučaju izostanka nekog od članova tima. Aplikacija prikazuje turnire i sportske događaje koji se nalaze u korisnikovoj okolini.', NULL, NULL),
(1710, 22, 736, 'Sarađivali smo u julu 2021. godine na letnjem studentskom startap kampu ParkUp, u organizaciji Naučno-tehnološkog parka u Beogradu.', NULL, NULL),
(1711, 23, 736, 'Naš tim gaji veliku strast prema preduzetništvu i tehnološkim inovacijama. Preduzetništvo za nas predstavlja izvor beskonačnih mogućnosti i slobodu delovanja. Da možemo da upotrebimo svoje ideje i znanja i da da time pravimo pozitivne društvene promene na globalnom nivou, utičemo na razvoj socijalne zajednice.\r\nSvesni smo da uspeh jednog startapa u velikoj meri zavisi od znanja, iskustva, motivacije i veština upravljanja njegovih suosnivača. I mi verujemo da smo pravi multidisciplinarni tim. Ipak, budući da pokrećemo naš prvi startap, podrška mentora nam je ključna, jer ne znamo previše o putovanju koje nam predstoji. Potrebni su nam mentori da nas lakše sprovedu kroz različite faze našeg startapa, u procesu izgradnje održivog biznis modela, plasiranju našeg proizvoda i širenju na globalno tržište. Upravo to je glavni razlog naše prijave za Raising Starts – rad sa mentorima-ekspertima. Naravno, i finansijska podrška za SportUp predstavlja bitnu stavku, budući da je naš proizvod u ranoj fazi životnog ciklusa.', NULL, NULL),
(1712, 24, 736, 'Povežimo se i zaigrajmo!', NULL, NULL),
(1713, 25, 736, 'Problem nedostatka saigrača za sportsku aktivnost . Za problem smo saznali pre svega iz ličnog iskustva i od ljudi u bliskoj okolini. Nakon toga smo ispitivali problem, putem ličnog razgovora i ankete, i saznali da velika većina ljudi ima isti problem, i na globalnom nivou. Problem je specifičan, Iako je većina ljudi aktivna na društvenim mrežama, to im ne omogućava prolazak saigrača za sport.', NULL, NULL),
(1714, 26, 736, 'Ciljano tržište koje targetiramo na samom početku je država Srbija. Procenjena vrednost ovog tržista je 3 miliona evra, na osnovu zvaničnih podataka o tržištu rekreativnog sporta i broja sportskih centara. U naredne dve godine planiramo širenje na razvijenije zemlje Evrope, Španija, Nemačka i Francuska.', NULL, NULL),
(1715, 27, 736, 'Idealni korisnici su ljudi u rasponu od 22 do 28 godina, koji su aktivni na društvenim mrežama, prate tehnološke trendove, brinu o karijeri i bitna im je fizička aktivnost. Ostvarili smo kontakt sa preko 500 ljudi, putem ankete i ličnih intervjua. Zaključci su da ljudi imaju želju da se više bave sportom i da je jedna od prepreka nedostatak sportskog partnera.', NULL, NULL),
(1716, 28, 736, 'Razvijamo mobilnu aplikaciju za povezivanje rekreativnih sportista i pronalazak saigrača. Nakon što korisnik otvori aplikaciju prikazuje mu se mapa sa korisnicima koji se bave sportom, na određenoj lokaciji u određeno vreme. Korisnik ima opciju da pretraži mapu po filterima,  pregleda profile tagovanih ljudi i da im se pridruži. Takodje korisnik se može tagovati, kako bi ga ljudi videli i pridružili bi mu se. Naš proizvod je jedinstven zbog lake pretrage korisnika, preglednosti aktivnosti i zajednice ljudi. Tehnologija koja se koristi je programski jezik dart (Flutter framework).', NULL, NULL),
(1717, 30, 736, 'Najčešće koriste grupe na društvenim mrežama, Viber i Whatsapp grupe. Takođe, prisutne su i konkurentske aplikacije poput Fali 1, Moja Ekipa, Sportpartner, Strava.', NULL, NULL),
(1718, 29, 736, 'Korisnici će biti u mogućnosti da se povežu sa ljudima koji se bave sportom i tako značajno povećaju svoje fizičke aktivnosti koje će pozitivno uticati na njihovo zdravlje. Proizvod je jedinstven zbog lake pretrage korisnika, preglednosti aktivnosti i pre svega zajednice okupljenih ljudi, koja će učiniti da u svakom trenutku korisnik može da pronađe odgovarajućeg saigrača na povoljnoj lokaciji.', NULL, NULL),
(1719, 32, 736, 'Aplikacije kao što je naša već postoje, međutim ne rešavaju dati problem. Naš tim je detaljno analizirao konkurentske aplikacije i razloge zbog kojih nisu ostvarili pun potencijal. Učeći na njihovim greškama, napravićemo bolju verziju aplikacije koja povezuje rekreativne sportiste i unapredićemo stvari poput korisničkog interfejsa, funkcionalnosti i pre svega okupiti veliku zajednicu ljudi.', NULL, NULL),
(1720, 37, 736, 'Prisustvali smo vebinaru \"Zaštita inovacija pravima intelektualne svojine i poreske olakšice u IT oblasti\" organizovanog u saradnji Naučno-tehnološkog parka Beograd i Zavoda za intelektualnu svojinu.', NULL, NULL),
(1721, 40, 736, 'Primarni biznis model je advertising, naplata od biznis klijenata (sportski centri, organizatori sportskih dogadjaja, brendovi). U kasnijim fazama freemium.', NULL, NULL),
(1722, 41, 736, 'Naš tim se okupio u julu ove godine na kampu ParkUp u ogranizaciji NTP-a Beograd, na kome smo zauzeli prvo mesto. Uz pomoć mentora  nastavili smo da radimo na razvoju ideje. Uspeli smo da potvrdimo zainteresovanost kod korisnika anketiranjem i intervjuima.\r\nTrenutno radimo na razvoju MVP-a i razvijamo strategije za plasiranje proizvoda. Očekujemo da razvijemo prototip krajem marta 2022. godine.', NULL, NULL),
(1723, 44, 736, 'Trenutno učestvujemo u Univerzum akcelerator programu u organizaciji kompanije Mozzart i Beogradskog Univerziteta, koji obuhvata mentorsku i finansijsku podršku, kao i besplatno korišćenje co-working prostora u centru Beograda.', NULL, NULL),
(1724, 45, 736, 'Na Univerzum akceleratoru smo osvojili 5. mesto i obezbedili smo finansijsku podršku u iznosu od 2500 evra. Trenutno smo u procesu otvaranja udruženja građana kako bi pravno ispunili sve potrebne zahteve i bili u mogućnosti da potpišemo ugovor i primimo osvojeni novac.', NULL, NULL),
(1725, 48, 736, 'Od učešća u programu očekujemo da unapredimo znanje iz oblasti preduzetništva i vodjenja poslovanja, kao i da razvijemo prototip proizvoda. Upravo u vođenju biznisa nam je potrebna najveća podrška. Takodje, potrebna su nam finansijska sredstva za marketing i okupljanje zajednice ljudi pre puštanja aplikacije u rad kao i tokom početnog perioda rada aplikacije.', NULL, NULL),
(1726, 49, 736, 'U trenutnoj fazi razvoja nam je potrebno 6000 evra.\r\nOd toga:\r\n- 4000 evra za hardver koji podžava postavljanje aplikacije na različite platforme, apple sertifikate i server/hosting na serveru, preko koga će raditi aplikacija.\r\n- 2000 evra za troškove marketinga putem različitih kanala i u svrhu okupljanja i konstantnog rasta zajednice rekreativnih sportista.', NULL, NULL),
(1727, 52, 736, NULL, NULL, NULL),
(1728, 66, 739, NULL, NULL, NULL),
(1729, 76, 740, NULL, NULL, NULL),
(1730, 83, 742, NULL, NULL, NULL),
(1731, 89, 743, 'Student Fakulteta organizacionih nauka univerziteta u Beogradu, smer Informacioni sistemi i tehnologije. \r\nČlan studentske organizacije FONIS, u kojoj je prošao pozicije programera i project manager-a. Izradio je nekoliko aplikacija za mobilne telefone (Android/IOs) od kojih je jedna imala preko 12 hiljada preuzimanja (podatak sa Google developer tool analytics). Inicijator ideje i tvorac početnog koncepta koji je uz  dragocenu pomoć svih članova tima oblikovao i razvio pobedničku ideju programa ParkUP 2021. Kreativan i analitičan timski igrač koji voli da daje ideje i učestvuje u ostvarivanju istih. Uči o razvoju startapa na fakultetu i u okviru  akceleratora \"Univerzum\".', NULL, NULL),
(1732, 90, 743, 'Potpuno posvećen\r\nTvorac početne ideje sa ParkUP, koji je uz dragocenu pomoć svih članova tima oblikovao ideju. Trenutno radi na pripremi razvoja MVP-a.', NULL, NULL),
(1733, 91, 743, 'Osnovne studije (oko 42 sata nedeljno)\r\nObaveze oko studentske organizacije \r\nFONIS - 1 sat nedeljno\r\nPreostalo slobodno vreme koristi za razvoj i rad na SportUp-u', NULL, NULL),
(1734, 89, 744, 'Mia je studentkinja 4. godine Ekonomskog fakulteta Univerziteta u Beogradu na smeru Marketing. Ova oblast, kao i strategijski menadžment jesu oblasti njene eskpertize i interesovanja, što je u skladu sa ulogom koju nosi u našem startapu. Trenutno je članica EKOF Case Study kluba, gde rešava studije slučaja domaćih i inostranih kompanija iz raznih privrednih grana, takodje je u EKOF Media grupi u sektoru Digitalnog Marketinga. Mentorka je mladjim studentima u okviru projekta \'Studentsko mentorstvo\'. Oblast psihologije i komunikacije obožava da izučava, a sertifikovani je NLP Practitioner. Sloboda, strast i kreativnost - to su njeni pokretači. Trči polumaratone od jednog neočekivanog susreta, koji joj je potvrio značaj podrške i okruženja u kom rastemo kao osobe. Život i školovanje u inostranstvu doprineli su njenom pogledu na svet. Mia smatra da je svet jedno veliko tržište i celina, živi za priče koje ga pokreću i želi baš jednu takvu priču da piše sa SportUp-om!', NULL, NULL),
(1735, 90, 744, 'Trenutno u većoj meri posvećena\r\nNakon završetka studija, na proleće/leto - potpuno posvećena.\r\nKreatorka ideje SportUp aplikacije.', NULL, NULL),
(1736, 91, 744, 'Osnovne studije - oko 40 sati nedeljno.\r\nPeriodične obaveze na pomenutim projektima - na nedeljnom/mesečnom nivou variraju, ali po dogovoru i fleksibilne', NULL, NULL),
(1737, 89, 745, 'Tokom prethodnih godina Stefan je imao prilike da radi na velikom broju studentskih projekata kako timskih, tako i individualnih. Odlikuju ga kritičko razmišljanje, proaktivnost i pragmatičnost, osobine najvažnije za stvaranje i rešavanje problema tokom razvoja softvera. On je timski igrač, sto se jasno vidi u njegovom radu sa SportUp timom, zajedno stvaraju i razvijaju ideju koja beleži uspehe sa ciljem da osvoje tržiste rekreativnog sporta i podstaknu zdrave navike kod korisinika. Tokom rada u SportUp timu radio je na dizajnu aplikacije, istraživanju ciljnih korisnika, osmišljavanju i implementaciji softverskog rešenja. Cilj mu je da podstiče zdrave navike kod ljudi i ima želju da pomoću bioinformatike pomogne pronalazak novih lekova i personalizovane medicine.', NULL, NULL),
(1738, 90, 745, 'Potpuno posvećen\r\nRazvoj softverskog rešenja i dizajniranje korisničkog interfejsa mobilne aplikacije.\r\nKreator ideje.', NULL, NULL),
(1739, 91, 745, 'Spremanje engleskog i nemačkog jezika za master studije u inostranstvu. \r\nSvakog dana po 4h.', NULL, NULL),
(1740, 89, 746, 'Doktor medicine, Medicinski fakultet Univerzitet u Beogradu. Srednja škola: gimnazija ,,Priboj’’. Osnovna škola: OŠ ,,Branko Radičević’’ Priboj. Trenutno: student doktorskih akademskih studija iz medicine, modul – neuronauke: Medicinski fakultet Univerzitet u Beogradu. \r\nStartap razvoj:\r\n-Univerzum accelerator program: Kompanija Mozart, Univerzitet u Beogradu, Hoo Voon Yee, Elena Morozova, Mili Ibrulj. (trenutno) *Nagrađeni tim\r\n-Naučno-tehnološki park Beograd – program mentorske podrške ra razvoj startapa (septembar 2021 –decembar 2021)\r\n-ParkUP: Letnji studentski startap kampNaučno-tehnološki park Beograd 14-20. jul 2021. –Gordana Danilović Grković  *Pobednički tim\r\nIskustvo u kliničkom radu:\r\n-Klinika za neurologiju, Univerzitetski klinički centar Srbije – klinički lekar\r\n-Ambulanta reanimacije -  Urgentni centar \r\nIskustvo u naučno istraživačkom radu', NULL, NULL),
(1741, 90, 746, 'U većoj meri posvećen.\r\nMarketing tim, tim za razvoj zajednice i istraživač.\r\nKreator ideje.', NULL, NULL),
(1742, 91, 746, 'Full time volonter na Klinici za neurologiju, UKCS (35 sati nedeljno – 7 sati dnevno, ili dvanaestočasovno dežurstvo).\r\nStudent doktorksih studija (15 sati nedeljno, 3 sata dnevn).', NULL, NULL),
(1743, 89, 747, 'Mihajlo je osoba koja gaji veliku strast prema programiranju i algoritmima. Kao student Matematičkog fakulteta u Beogradu stekao je znanja iz različitih oblasti programiranja i učestvovao u više studentskih projekata. Trenutno je zaposlen kao programer u beogradskoj Banca Intesi, gde radi na više različitih projekata sa iskusnim mentorima. Pored toga, veoma je zainteresovan za sport i preduzetništvo. Kombinacija te dve stvari je tim SportUp čiji je član. Njegova uloga u timu je razvoj aplikacije.', NULL, NULL),
(1744, 90, 747, 'U većoj meri posvećen.\r\nRazvoj softverskog rešenja i dizajniranje korisničkog interfejsa mobilne aplikacije.\r\nKreator ideje.', NULL, NULL),
