(1772, 63, 765, 'SAVEMA Stik je inovativni proizvod namenjen za gašenje požara Klase F (ulja za prženje i masti) u kuhinji.\r\nGašenje požara uz pomoć SAVEMA Stika nudi siguran i brz način da se ugasi opasna vatra u posudi sa uljem koje gori, u roku od samo 3 sekunde. \r\nSAVEMA Stik je efikasan i jednostavan za upotrebu, ekološki, bezbedan, netoksičan i neotrovan.\r\nNa svetskom tržištu ne postoji sličan proizvod i za razliku od tradicionalnih aparata za gašenje požara, besplatan je za održavanje, ekonomičan, lagan, prenosiv i ima neograničen rok trajanja.', NULL, NULL),
(1773, 71, 766, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1774, 17, 767, 'SAVEMA Stik je inovativni proizvod namenjen za gašenje požara Klase F (ulja za prženje i masti) u kuhinji.\r\nGašenje požara uz pomoć SAVEMA Stika nudi siguran i brz način da se ugasi opasna vatra u posudi sa uljem koje gori, u roku od samo 3 sekunde. \r\nSAVEMA Stik je efikasan i jednostavan za upotrebu, ekološki, bezbedan, netoksičan i neotrovan.\r\nNa svetskom tržištu ne postoji sličan proizvod i za razliku od tradicionalnih aparata za gašenje požara, besplatan je za održavanje, ekonomičan, lagan, prenosiv i ima neograničen rok trajanja.', NULL, NULL),
(1775, 22, 767, 'Naš Start up je bio finalista „PITCCH Open Innovation Challenge 2021“  Brisel\r\nTim FUGA (Sretko Popadić, Milica Zoranović i Vladimir Škundrić) finalista Takmičenja NTI Srbija 2021.\r\nStart up čiji su članovi Sretko Popadić i Sanja Popadić je ušao sa dve inovacije u \"100 Best Industrial Innovations for International Technology Transfer of  2021 ZGC\"  u NR Kina.', NULL, NULL),
(1776, 23, 767, 'Naš tim je sastavljen je od ljudi otvorenog duha i velike energije. Ono što nas povezuje su rešavanje problema, razvoj, primena i komercijalizacija inovacija, patenata i novih tehnologija. Uzdamo se u naše kreativne ideje, znanje, inventivnost i stvaralačku snagu. \r\nOtvoreni smo za saradnju sa novim ljudima – iskusnim stručnjacima i mentorima, nosiocima interesantnih ideja i ljudima koji svoje snove i nemoguće ideje sprovode u delo. \r\nNaročito cenimo timske igrače, dinamične, ambiciozne i vredne osobe željne uspeha, spremne da stalno uče, napreduju i primenjuju nove ideje, znanja i dostignuća u poslu kojim se bave. \r\nKroz seriju obuka uz mentorstvo iskusnih stručnjaka želimo da na pravi način razvijemo i usavršimo naše inovativne proizvode koji štite bezbednost i zdravlje ljudi, materijalna dobra i životnu sredinu.', NULL, NULL),
(1777, 24, 767, 'Učinimo svet sigurnijim mestom za život', NULL, NULL),
(1778, 25, 767, 'Studije pokazuju da 48 % požara u domaćinstvu nastaje u kuhinji. Posebno veliku opasnost predstavlja prženje ulja i masti bez nadzora. \r\nPrilikom pojave požara uzrokovanih samozapaljenjem ulja i masti oslobađa se velika količina toplote. \r\nPožari ulja/masti se ne smeju gasiti vodom a standardna sredstva u vatrogasnim aparatima (PRAH, PENA, UGLJEN-DIOKSID) su neefikasna u borbi protiv ovih požara.', NULL, NULL),
(1779, 26, 767, 'Globalno tržište aparata za gašenje požara iznosi 4,9 milijardi dolara u 2020. i očekuje se porast  6,6 milijardi dolara u 2026. * \r\nU stalnom porastu je tražnja za PP aparatima u domaćinstvu.\r\nPočetno tržište na koje nameravamo izaći sa proizvodom je Srbija, a u naredne dve godine u zemljama Zapadnog Balkana, EU, Rusije kao i na globalnom tržištu.\r\n* https://www.futuremarketinsights.com', NULL, NULL),
(1780, 27, 767, 'Požar u kuhinji je opasnost u kojoj pored materijalne štete dovodi i do gubitka života. Naš proizvod je neophodan u kuhinji u domaćinstvu, objektima brze hrane, restoranima, hotelskoj kuhinji, pržionicama ribe.\r\nUtvrdili smo da postoji jasno iskazana potreba za proizvodom i tehnologijom gašenja ove vrste požara u kuhinji i veliko interesovanje kupaca da na ovaj način zaštite sebe i imovinu.', NULL, NULL),
(1781, 28, 767, 'Inovativni proizvodi su namenjeni za gašenje požara Klase F (požari ulja/masti za prženje). \r\nSpecijalno formulisano ekološko rešenje, u obliku tečnosti, deluje trenutno prekrivanjem površine ulja koje gori. Ulje se brzo hladi, čime se sprečava ponovno paljenje. \r\nSAVEMA BAG i SAVEMA STIK su efikasani i jednostavani za upotrebu, ekološki prihvativi, bezbedni, netoksičani i neotrovni. Gašenje požara ulja uz pomoć SAVEMA STIK nudi siguran i brz način da se ugasi vatra, u roku od 1-3 sekunde. \r\nSAVEMA BAG dolazi u kesici od 45 ml tečnosti koja može ugasiti 1,2 litra ulja.\r\nSAVEMA STIK dolazi u obliku pakovanja od 100 ml tečnosti koja može ugasiti 2 litra ulja.', NULL, NULL),
(1782, 30, 767, 'Početni požar ulja u kuhinji se gasi priručnim materijalima, prekrivanjem posude metalnim poklopcem (nikako staklenim poklopcem ili keramičkim tanjirima), vatrootpornim ćebetom, protivpožarnim platnom.\r\nAparati za gašenje požara prahom ili penom i voda nisu pogodni za gašenje požara ulja jer mogu rasplamsati vatru. \r\nPostoje stabilni sistemi  i namenski aparati za gašenje požara Klase F od 6 litara.', NULL, NULL),
(1783, 29, 767, 'Nema pritiska, lako se skladišti\r\nBez mehaničkih delova\r\nJednostavno i sigurno za upotrebu\r\nNe zahteva održavanje\r\nEkonomično, lagano, prenosivo\r\nIzuzetno efikasno protiv požara klase F \r\nZeleni proizvod, Ekološki, netoksičan\r\nVeoma efikasano - gasi ulje koje gori za nekoliko sekundi \r\nBiorazgradivo\r\nLako čišćenje nakon upotrebe', NULL, NULL),
(1784, 32, 767, 'Pretragom dostupnih informacija o sredstvima, aparatima i metodama gašenje požara u domaćinstvu na lokalnom, regionalnom ili globalnom nivou nismo pronašli sličan način i tehniku gašenja požara.  \r\nMetoda gašenje požara ulja je rezultat našeg znanja i dugogodišnjeg razvoja. \r\nPretragom patentne dokumentacije i stanja tehnike takođe nismo pronašli sličan način gašenja požara ulja u kuhinji.', NULL, NULL),
(1785, 37, 767, 'Uradili smo detaljnu pretragu baze patentne dokumentacije i stanja tehnike po predmetu pronalaska iz ove oblasti lično i uz pomoć patentnih advokata. Pronalazak je nov, ima inventivni nivo i pregledom patentne dokumentacije nije obuhvaćen stanjem tehniike. Autor i nosilac prava intelektualne svojine je vođa tima Sretko Popadić.', NULL, NULL),
(1786, 40, 767, 'Nakon razvoja i testiranja proizvoda izlazimo na tržište sa proizvodom. \r\nIndividualnim kupcima prodaju i distribuciju proizvoda vršićemo preko svoje firme. \r\nProizvod nameravamo ponuditi velikim osiguravajućim kućama i proizvođačima kuhinjskog posuđa. \r\nNovčane prilive očekujemo od prodaje proizvoda, prodaje tehnologije gašenja požara ulja, licenciranje patenta i intelektualne svojine.', NULL, NULL),
(1787, 41, 767, 'Naš tim ima 4 člana i sastavljen je od ljudi sa velikim preduzetničkim iskustvom. \r\nRazvili smo i testirali prototip, probe gašenja različitih biljnih ulja.\r\nIspitali smo potencijalne korisnike i kupce i utvrdili veliko interesovanje za proizvodom.\r\nOdržali smo sastanke sa predstavnicima osiguravajućih kuća koji posluju u Srbiji, prezentovali naš proizvod, njegove karakteristike i prednosti.', NULL, NULL),
(1788, 44, 767, 'Pojedinačno, članovi tima su prošli različite obuke vezane za razvoj startapa inovativnih proizvoda i tehnologija. \r\nPioneers of the Balkans 2015, Catch Pitch Challenge 2016, Delta biznis inkubator 2018, Najbolja tehnološka inovacija NTI 2010, NTI2012, NTI 2015, NTI 2021.', NULL, NULL),
(1789, 45, 767, 'Članovi našeg  tima su bili učesnici takmičenja Najbolja tehnološka inovacija NTI 2021. i dobili smo novčanu nagradu u iznosu  300.000 dinara.', NULL, NULL),
(1790, 48, 767, 'Naš start up se nalazi u ranoj fazi razvoja. Nadamo se unapređenju i ubrzanom razvoju ideje kroz obuku, mentorstvo i finansijsku podršku. Tokom treninga i obuka, očekujemo pomoć u izradi skalabilnog poslovnog modela, identifikaciju dodatnih poslovnih prilika, pomoć u pretrazi konkurencije i potencijalnih tržišta, zaštitu intelektualne svojine.\r\nUbrzanjem razvoja našeg inovativnog proizvoda, dodatnim testiranjem i izradom finalnog dizajna pakovanja stvorićemo uslove za dodatne investicije.\r\nKrajnji cilj je izlazak na tržište i komercijalizacija inovativnog sredstva za gašenje požara u kuhinji.', NULL, NULL),
(1791, 49, 767, 'Tokom ubrzanog razvoja proizvoda u ovoj fazi potrebna su sredstva u iznosu 15.000 CHF.\r\nTroškovi zаrаda i/ili troškovi naknada fizičkim licima koji rade na razvoju poslovne ideje po osnovu ugovora;\r\nTroškovi marketinga koji nastaju u cilju validacije proizvoda;   \r\nTroškovi u vezi sa nabavkom sirovina, opreme i alata za potrebe razvoja;    \r\nUsluge poslovnog razvoja (istraživanje tržišta, istraživanje, prikupljanje i analiza podataka, tehnologija, trendova i rizika, angažovanje stručnih konsultanata, itd.)    \r\nTroškovi razvoja dizajna, probne proizvodnje i pratećih usluga;  \r\nTroškovi u vezi sa izradom i testiranjem;   \r\nTroškovi PDV-a;  \r\nTroškovi u vezi sa zaštitom intelektualne svojine;  \r\nUsluge razvoja proizvoda, uključujući razvoj i testiranje tehnologije, istraživanje i razvoj, itd.', NULL, NULL),
