(1808, 71, 778, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1809, 63, 779, 'Pravimo tunel za mačke u kojem će one same da se četkaju, prolazeći kroz niz posebno dizajniranih četki od plastike i silikona, umesto da na to vlasnici troše znatno vreme i novac. Tunel sprečava da se višak dlaka (prirodno linjanje) konstantno raznosi u domaćinstvu čime se omogućava održavanje higijene i zdravlјa mačaka i čistoću stambenog prostora. Istovremeno to je igračka za mačke, kao i mesto za njihovu ishranu.', NULL, NULL),
(1810, 71, 780, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1811, 17, 781, 'Pravimo tunel za mačke u kojem će one same da se četkaju, prolazeći kroz niz posebno dizajniranih četki od plastike i silikona, umesto da na to vlasnici troše znatno vreme i novac. Tunel sprečava da se višak dlaka (prirodno linjanje) konstantno raznosi u domaćinstvu čime se omogućava održavanje higijene i zdravlјa mačaka i čistoću stambenog prostora. Istovremeno to je igračka za mačke, kao i mesto za njihovu ishranu.', NULL, NULL),
(1812, 22, 781, 'Dragan Krsnik i Marko Petković su zajedno radili u Novinskoj agenciji TANJUG.', NULL, NULL),
(1813, 23, 781, 'Želimo da završimo razvoj proizvoda i formiramo startap preduzeće, naučimo i primenimo znanje o startap poslovanju. Veliki i značajan deo motivacije dobili smo iz dosadašnjih rezultata ispitivanja tržišta i upitnika koji smo uradili, kao i od članova i mentora NTP Beograd tokom prethodnog programa.', NULL, NULL),
(1814, 24, 781, 'Neka se same četkaju, nemam 9 života!', NULL, NULL),
(1815, 25, 781, 'Višak mačijih dlaka nastaje prirodnim linjanjem te je neophodno stalno četkanje mačaka, što iziskuje vreme i novac, dok Tunel za samočetkanje mačaka kroz koji same prolaze životinje, specijalno dizajniranim četkama uklanja višak dlaka čime se održava higijena životinje, stambenog prostora, nameštaja, obuće i odeće vlasnika mačaka. Svi vlasnici mačaka imaju isti problem bilo gde u svetu. U pitanju je potencijalno ozbiljan zdravstveni problem za vlasnike i goste zbog prekomerne koncentracije dlaka u vazduhu u stambenom prostoru. Konstantno se troše sredstva za čišćenje. Estetski problem, dlake se vidno zadržavaju na odeći i obući. Kreator ideje, Dragan Krsnik, je dugogodišnji vlasnik mačaka.', NULL, NULL),
(1816, 26, 781, 'Cilјna izvozna tržišta su Nemačka i Francuska, SAD i Kanada.U svetu je 2018. god. bilo 370+ miliona mačaka u domovima, od toga 75 miliona u Nemačkoj. Američka industrija kućnih lјubimaca dostigla je 99 milijardi dolara 2020. Tržište pribora za kućne lјubimce će porasti za 9,20 milijardi USD tokom 2021-2025. Pojava dodatne pametne opreme za kućne lјubimce biće glavni trend. Izvor: Technavio. Severna Amerika dominirala je ukupnim globalnim tržištem sa 35% udela 2020. Predviđa se da će globalno tržište pribora za kućne lјubimce, procenjeno na 29,4 milijardi USD 2020. godine, dostići revidiranu veličinu od 42,3 milijardi USD do 2026., povećavajući se 6,3% u tom periodu. Za Japan i Kanadu se očekuje da će u periodu 2020-2027. rasti po 5,3%, odnosno 5,6%. U Evropi se predviđa rast Nemačke od približno 5,7%. Za 2021. godinu procenjeno je da će 109,6 milijardi dolara biti potrošeno na kućne lјubimce u SAD -u. Od ukupnih troškova na kućne lјubimce, 45,3 odsto su troškovi za potrebe mačaka.', NULL, NULL),
(1817, 27, 781, 'Direktna cilјna grupa: zaposlena ženska osoba vlasnica mačke, između 30 i 55 godina, srednjih i visokih primanja, bez mnogo slobodnog vremena, živi u gradu u stanu, ima izraženu brigu o životnoj sredini, zdravlјu, intenzivno koristi savremene tehnologije... Od 149 onlajn anketiranih u 4 države do sada, više od 93 odsto anketiranih pronalazi dlake na obući, odeći, nameštaju, polovinu njih to konstantno opterećuje, 75 odsto četka mačku svakodnevno a oko 60 minuta nedeljno troše na četkanje. Potvrđuju da redovno kupuju sredstva kojima uklanjaju dlake, aksesoare za mačke, i da postoji prostor za dodatni uređaj, ali da on mora da bude dosta efikasan, više od 50% efikasnosti, uklonjenog viška dlaka. Vlasnicima kojima zaista dlake smetaju, spremni su da plate veću količinu novca za novi aparat. Potencijalni kupci su pet-šopovi, vlasnici kućnih lјubimaca, distributeri opreme za kućne lјubimce...', NULL, NULL),
(1818, 28, 781, 'Tunel za samočetkanje mačaka je proizvod napravljen od plastike, sastoji se od nekoliko komora i hranilice u sredini. Moguće ga je produžiti, sklopiti i rasklopiti, lako održavati. U tunelu su postavljene posebno dizajnirane plastične i četke od silikonskog materijala koje skupljaju i zadržavaju dlake dok se mačka provlači da dođe do hrane. Analiza konkurencije pokazuje da proizvodi čiji je promovisani cilj da služe za grooming - četkanje i uklanjanja viška dlaka koje nastaju linjanjem, ne ispunjavaju namenu koju promovišu.', NULL, NULL),
(1819, 30, 781, 'Kupci trenutno rešavaju posledicu, a ne uzrok. Uklanjaju dlake usisivačima iz prostora, lepljivim rolerima sa obuće i odeće, silikonskim skupljačima dlaka koji se postavljaju u veš mašine, a ni jedno od ponuđenih rešenja na tržištu, poput grumera kompanije Fukumaru, ne uklanja adekvatno višak dlaka direktno sa mačke, što je pokazala naša Analiza konkurencije.', NULL, NULL),
(1820, 29, 781, 'Smanjujemo najmanje 70 odsto prisutnih dlaka u životnom prostoru. Naš proizvod ispunjava osnovnu namenu, uklanja dlake direktno sa mačke, lako je dostupan potrošačima, jednostavan za održavanje, pogodan za različite dimenzije životinje, spada u kategoriju srednje skupih dodataka (aksesoara) za mačke. Pored osnovne funkcije, to je mesto za ishranu, igru i odmor mačaka. Savremeno dizajniran tunel, različitih boja, moguće ga je skratiti ili produžiti.', NULL, NULL),
(1821, 32, 781, 'Proizvodi koji se nalaze na tržištu imaju samo ideju o funkciji koju treba da obave, ali je ne obavljaju. Neprilagođeni su životinji, različitim tipovima dlaka, ponašanju mačaka, i drugo. Naš proizvod zaista uklanja višak dlaka jer da bi životinja došla do hrane mora da se provlači kroz uzak krug savitljivih plastičnih i silikonskih četki. Četkanje se višestruko ponavlja kako dozer hranilice ispušta hranu u posudu. Lak za održavanje, bezbedan za životinju, ne oštećuje životni prostor vlasnika mačaka, modernog dizajna, dugog životnog veka.', NULL, NULL),
(1822, 37, 781, 'Vlasnik intelektualne svojine je Dragan Krsnik', NULL, NULL),
(1823, 40, 781, 'Prodaja proizvoda/ koncepta.', NULL, NULL),
(1824, 41, 781, 'Od marta 2021. godine, kada su Dragan Krsnik i Marko Petković prvi put razgovarali o izradi Tunela za samočetkanje mačaka i pokretanju startapa, u međuvremenu je angažovan Darko Stevanović koji je izradio tehničke crteže i dizajnirao 3D model. Dragan i Marko su izradili \"home made\" prototip koji su koristile 3 mačke tokom 3 meseca. Do kraja tekuće 2021. tim je ušao u proces predinkubacije u NTP Beograd, prošao deo mentorskog programa izrade plana razvoja projekta koji je predstavljen na Air table. Urađen je Market research, online upitnik i offline upitnik (i dalje se radi na dostizanju najmanje 500 anketiranih), sumirani su dosadašnji rezultati upitnika koji ukazuju da na tržištu postoji potreba za ovim proizvodom, završena je Analiza konkurencije, rade se izmene tehničkih crteža, inženjer Darko Stevanović prošao je obuku za korišćenje 3D štampača u NTP Beograd. U toku je nabavka materijala za 3D štampu za izradu prvog prototipa, učimo o Lean metodologiji,...', NULL, NULL),
(1825, 44, 781, 'Program predinkubacije NTP Beograd.', NULL, NULL),
(1826, 45, 781, 'Ne', NULL, NULL),
(1827, 48, 781, 'Očekujemo sadržajan Program koji će nam omogućiti da kroz mentorske sesije uvidimo mogućnosti i ograničenja u vezi razvoja našeg projekta i da li on odgovara konceptu startapa. Podrška nam je najpotrebnija u izradi prototipa i lean web stranice.', NULL, NULL),
(1828, 49, 781, 'Potrebno nam je oko 4.000 evra za izradu nekoliko verzija prototipa, 3D štampu, profesionalno snimanje funkcionisanja tunela sa mačkama, izradu lean web stranice sa ponudom našeg proizvoda, nabavku silikonskih materijala za segment četki na tunelu, promociju na društvenim mrežama.', NULL, NULL),
