(1833, 89, 788, 'Filozofski fakultet, Novi Sad, Katedra za srpsku književnost i jezik. \r\nOsnivač i direktor Phoenician arts d.o.o., u Srbiji, kompanije sa sedištem u Libanu za industrijsku proizvodnju mozaika.', NULL, NULL),
(1834, 90, 788, 'Kreator ideje, potpuno posvećen, zadužen za organizaciju dela dnevnih aktivnosti koje se tiču projekta, strateške ciljeve, komunikaciju sa Naučno-tehnološkim parkom Beograd, potencijalnim saradnicima partnerima, rešavanju administrativnih procedura, sufinansiranje iz sopstvenih sredstava tekućih troškova...', NULL, NULL),
