(1837, 63, 790, 'Često smo se susretali sa problemo da nameštaj koji je na tržištu ne odgovara našim potrebama. Ikea, Lesnina, polovni oglasi i drugi nude velik izbor, ali ograničene varijacije pojedinačnih proizvoda (jedna ili nekoliko dimenzija, boja/materijala...), što nas tera na kompromise u organizaciji prostora. S druge strane nameštaj po meri je skup ili lošeg kvaliteta i neretko se na njegovu izradu čeka nekoliko meseci.\r\nMi želimo da rešimo taj problem i dokažemo da je sa savremenim mašinama za fabrikaciju moguće napraviti proizvodnju po meri korisnika koja je pristupačna širokoj potrošačkoj grupi. Rešenje bi se sastojalo iz jednostavne web platforme na kojoj korisnik može da prilagodi određeni proizvod svojim potrebama i specijalizovane radionice sa svim alatima koji omogućavaju brzu izradu elemenata.', NULL, NULL),
(1838, 71, 791, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1839, 17, 792, 'Često smo se susretali sa problemo da nameštaj koji je na tržištu ne odgovara našim potrebama. Ikea, Lesnina, polovni oglasi i drugi nude velik izbor, ali ograničene varijacije pojedinačnih proizvoda (jedna ili nekoliko dimenzija, boja/materijala...), što nas tera na kompromise u organizaciji prostora. S druge strane nameštaj po meri je skup ili lošeg kvaliteta i neretko se na njegovu izradu čeka nekoliko meseci.\r\nMi želimo da rešimo taj problem i dokažemo da je sa savremenim mašinama za fabrikaciju moguće napraviti proizvodnju po meri korisnika koja je pristupačna širokoj potrošačkoj grupi. Rešenje bi se sastojalo iz jednostavne web platforme na kojoj korisnik može da prilagodi određeni proizvod svojim potrebama i specijalizovane radionice sa svim alatima koji omogućavaju brzu izradu elemenata.', NULL, NULL),
(1840, 22, 792, 'Do sada smo radili zajedno na nekoliko studentskih projekata i honorarnih poslova na kojima smo zajednički izrađivali arhitektonske makete.', NULL, NULL),
(1841, 23, 792, 'Pre svega preporuka od Phobos tima koji je učestvovao u prošlogodišnjem izdanju Raising Starts-a, a potom i želja da uz finansijsku i mentorsku podršku konkretizujemo ideju i pretvorimo je u funkcionalan proizvod.', NULL, NULL),
(1842, 24, 792, 'Gradimo svet po Vašoj meri (Building a world to your needs)', NULL, NULL),
(1843, 25, 792, 'Pre tri godine Branko Kolarević i Jose Pinto Duarte su objavili zbornik radova pod naslovom \"Mass Customization and Design Democratization\" u kojem su autori radova odgovarali na neke od problema prelaska sa masovne proizvodnje na proizvodnju po meri i potrebi potrošača. Želimo ove principe, uz pomoć parametarskog projektovanja, da primenimo na izradu nameštaja i drugih predmeta i time pružimo budućim kupcima veću fleksibilnost u oblikovanju svog životnog i radnog prostora, smanjimo stvaranje zaliha proizvoda koji možda nikad ne dođu do potrošača i decentralizujemo proizvodnju u manje standardizovane centre za fabrikaciju.', NULL, NULL),
(1844, 26, 792, 'Domaće tržište nam je primarno za uspostavljanje biznis plana i celog sistema (od web aplikacije, preko proizvodnje do dostave). S obzirom da ne postoji ni jedan globalno poznat sistem koji funkcioniše na ovaj način (postoje neki manji lokalni primeri), smatramo da postoji globalna potreba za ovakvim vidom usluge.', NULL, NULL),
(1845, 27, 792, 'Tehnološki pismeni pojedinci ili parovi, sa poverenjem u online kupovinu, koji uređuju ili preuređuju svoj životni ili radni prostor. Sekundarna ciljna grupa su arhitektonski biroi koji se bave projektovanjem i uređenjem enterijera.', NULL, NULL),
(1846, 28, 792, 'Tradicionalni dizajn podrazumeva kreiranje dizajna po određenim definisanim parametrima (određene dimenzije, materijali...) i svaka naknadna izmena je komplikovana ili nemoguća. Svi naši proizvodi će biti definisani kroz promenjive parametre, prilagođeni procesu proizvodnje.', NULL, NULL),
(1847, 30, 792, 'Prilagođavanjem svojih potreba postojećim proizvodima (Ikea, Lesnina, Vitorog, buvljaci...) ili naručivanjem proizvoda po meri od majstora ili firmi koje se time bave uslužno (Enterijer Janković) što uglavnom podrazumeva od njih da imaju neki vid tehničkog crteža.', NULL, NULL),
(1848, 29, 792, 'Laka prilagodljivost potrebama (nema potrebe za tehničkim crtežim, web aplikacija omogućava laku izmenu proizvoda po potrebama), brzu izradu (veći deo procesa je automatizovan - nacrti za izradu se generišu na osnovu upita, skoro svi elementi se izrađuju pomoću CNC mašina i robota), brzu dostavu (proizvodnja je decentralizovana i standardizovana, pa se i narudžbina izvršava u najbližem centru).', NULL, NULL),
(1849, 32, 792, 'Nudimo najbolje od onoga što je već postojeće na tržištu - nudimo \"Ikeu po meri\".', NULL, NULL),
(1850, 37, 792, 'Još uvek nismo sproveli nikakvo istraživanje na temu intelektualne svojine.', NULL, NULL),
(1851, 40, 792, 'Prodajom proizvoda, franšiziranjem centara za proizvodnju, procentom prodaje drugih pravnih lica sa kojima sklopimo dogovor o saradnji (npr proizvođač kuhinja čije smo proizvode parametrizovali i postavili u našu prodavnicu)', NULL, NULL),
(1852, 41, 792, 'Naš startup je zvanično osnovan pre 10 dana (neformalno smo se okupili početkom ove godine) i za sada smo definisali nekoliko potencijalnih projekata koje planiramo da razvijamo (jedan od kojih je ovaj) i prihvaćeni smo kao jedan od prvih članova Naučno Tehnološkog Parka Novi Sad.', NULL, NULL),
(1853, 44, 792, 'Od decembra ove godine smo članovi NTP Novi Sad, ali još uvek nismo imali prilike da učestvujemo u nekim programima.', NULL, NULL),
(1854, 45, 792, 'Još uvek nismo prikupili druge izvore finansija', NULL, NULL),
(1855, 48, 792, 'Očekujemo da kroz mentorsku podršku i radionice jasno definišemo biznis plan i plan razvoja proizvoda u čemu nam je ujedno i najpotrebnija podrška.', NULL, NULL),
(1856, 49, 792, 'Treba nam oko 25.000e za implementaciju web aplikacije (aplikacija je razvijena i plaća se u zavisnosti od potreba od 0, 500 ili 5000e godišnje, potrebno ju je implementirati na naš website), web hosting, plate, usluge, materijal za prototipe', NULL, NULL),
(1857, 52, 792, NULL, NULL, NULL),
(1858, 66, 795, NULL, NULL, NULL),
(1859, 76, 796, NULL, NULL, NULL),
(1860, 83, 798, NULL, NULL, NULL),
(1861, 89, 799, 'Završio je osnovne studije arhitekture i urbanizma na Univerzitetu u Novom Sadu i trenutno je apsolvent na master studijama za Digitalni dizajn i fabrikaciju u arhitekturi.\r\nU toku studija je osnovao i aktivno učestvovao u razvoju nezavisnog društvenog centra \"Dom B612\" na pozicijama od šankera, preko koordinatora programa do zakonskog zastupnika. U okviru ovog centra je sa još jednim kolegom pokrenuo festival arhitekture, dizajna i umetnosti \"Oktobarh\" koji je održavan svakog oktobra od 2016. do 2019.\r\nVećina poslovnog iskustva se zasniva na honorarnim poslovima u oblastima grafičkog dizajna, video montaže, animacije, uslužne 3d štampe, fotografije, vođenja društvenih mreža, izvođenja live strem-a isl. Bio je redovno angažovan u markentiškoj agenciji Words and Angles i po projektu u Nezavisnom društvu novinara Vojvodine.\r\nTrenutno je posvećen razvoju startup-a, a u slobodno vreme se bavi animacijom i radom na razvoju online magazina Iz Off-a.', NULL, NULL),
(1862, 90, 799, 'Potpuno posvećen (kreator ideje)', NULL, NULL),
(1863, 91, 799, 'apsolvent na master studijama', NULL, NULL),
(1864, 89, 800, 'Obrazovanje: Srednja škola, Elektrotehnička i Građevinska škola Nikola Tesla; Inženjer arhitekture i Master digitalnog dizajna i fabrikacije, arhitektura, Fakultet Tehničkih Nauka \r\nPraksa i poslovi: Na drugoj godini studija projektovao enterijer Studentskog Infocentra Univerziteta u Novom Sadu, koji je uz pomoć profesorke bio izveden iste godine; Dizajn enterijera i nameštaja za stan Hadži Ruvimova 43; Maketa kompleksa Sremskog fronta za izložbu \"Nagrada za arhitekturu \"Đorđe Tabaković\" dvadeset pet godina kontinuiteta 1995-2020.\" u Muzeju savremene umetnosti Vojvodine; Mnogobrojne odrađene makete studentskih i profesionalnih radova; Pet uzastopnih godina radio kao demonstrator na predmetu Maketarstvo i godinu dana na predmetu Geometrije i vizualizacije slobodnih formi na departmanu za Arhitekturu na Fakultetu Tehničkih Nauka u Novom Sadu; Radio intervjue i reportažu sa konferencije „Dani Orisa“ 2019 za časopis DANS; Četiri meseca radio praksu u arhitektonskom birou ModelArt arhitekti.', NULL, NULL),
