(1868, 89, 807, 'Fakultet političkih nauka, Beograd, Katedra za novinarstvo i komunikologiju.\r\nOsnivač Atomic agencije za odnose sa javnošću.', NULL, NULL),
(1869, 90, 807, 'Drugi član tima je zadužen za komunikaciju sa preduzećima i institucijama od kojih dobijamo podatke značajne za razumevanje prednosti i nedostataka, poput komunikacije sa Evropskim zavodom za statistiku od kojih smo dobili podatke koji nam govore o tržištu, učestvuje na sastancima i radi na rešavanju problemskih zadataka, potpuno posvećen projektu, planira strategiju testiranja projekta na društvenim mrežama...', NULL, NULL),
(1870, 91, 807, 'Televizija TANJUG, stalno zaposlen, puno radno vreme.', NULL, NULL),
(1871, 89, 808, 'Mašinski fakultet, Niš, Katedra za mehatroniku i upravljanje', NULL, NULL),
(1872, 90, 808, 'Treći član tima, zadužen za kreiranje potrebnih promena tehničkih crteža prototipa, potpuno posvećen projektovanju novih 3D varijanti prototipa, novih modela proizvoda, zadužen za učestvovanje u izradi alata i prilagođavanje procesa do konačnog proizvoda. Izrada radnih uputstava u proizvodnji i uputstava za njeno održavanja.', NULL, NULL),
(1873, 91, 808, 'Kompanija \"Star Jela\", stalno zaposlen, puno radno vreme.', NULL, NULL),
(1874, 63, 809, 'Pametna kućica za čuvanje pasa u javnom prostoru sa jedinstvenim skupom funkcionalnosti (UV lampa, grejanje, bešumni ventilator, displej, IP kamera) i pratećom aplikacijom za mapiranje najbliže slobodne kućice, automatsko zaključavanje vrata, povezivanje sa kamerom, uz mogućnosti integracije sa postojećim lojaliti aplikacijama zakupca (tržni centri, restorani, banke).', NULL, NULL),
(1875, 71, 810, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1876, 17, 811, 'Pametna kućica za čuvanje pasa u javnom prostoru sa jedinstvenim skupom funkcionalnosti (UV lampa, grejanje, bešumni ventilator, displej, IP kamera) i pratećom aplikacijom za mapiranje najbliže slobodne kućice, automatsko zaključavanje vrata, povezivanje sa kamerom, uz mogućnosti integracije sa postojećim lojaliti aplikacijama zakupca (tržni centri, restorani, banke).', NULL, NULL),
(1877, 22, 811, 'Da, povezani smo kroz kompaniju VisHealth i sarađujemo na projektima, iako smo u različitim ulogama. Poslednji zajednički projekat je bio osmišljavanje, brendiranje, razvoj, inicijalna prodaja i distribucija nove serije suplemenata u ishrani pod brendom GET1.', NULL, NULL),
(1878, 23, 811, 'Mi smo ekipa sa posla koja je tokom pandemije sve manje odlazila na večernja druženja, a sve više ostajala na večernjim video sastancima i razmatrala osnivanje nove kompanije. Kompanija u kojoj smo se i upoznali je pred investicijom i verovatnim seljenjem van Srbije, a mi sebe svakako želimo da vidimo u svom novom start up-u. Nakon niza brainstorming sastanaka, razrade biznis rešenja, nebrojanih diskusija sa potencijalnim kupcima i malog online survey-a došli do prve verzije funkcionalnog prototipa, ali i do uverenja da smo na tragu opipljivog biznisa. U ovom trenutku želimo da se sretnemo sa dobrim mentorima i drugim startapima i da validiramo naše rešenje kako bismo što pre napravili važan korak od prototipa do MVP-a, i bili spremni za Seed Funding u drugoj polovini 2022. godine.', NULL, NULL),
(1879, 24, 811, 'A safe place for your dog.', NULL, NULL),
(1880, 25, 811, 'Tokom pandemije došlo je do skoka u broju kućnih pasa za oko 10.000.000 (što čini novih oko 10% trenutne populacije pasa u Evropi i SAD). Ljudi su postali veoma vezani za svoje ljubimce i od njih se odvajaju samo kada je nužno. Veliki broj vlasnika samoposluga, tržnih centara i prodavnica u svetu primetio je problem kroz povećan broj vezanih pasa ispred radnji, kao i kroz otvorenu brigu njihovih kupaca o tome gde će ostaviti svoje ljubimce dok su u radnji. Problemi krađe, pogrešnog hranjenja (trovanja), mogućnosti svih vrsta povreda pasa (međusobno ili od strane prolaznika), infekcija, neželjenog parenja, toplotnog udara ili prehlade su realni i veliki problemi koji moraju da se reše drugačije jer su vlasnici sve češće u situaciji da biraju između bezbednosti svog psa i odlaska u kupovinu. U razgovoru sa ljudima zaduženim za zadovoljstvo kupaca jednog od naših najvećih lanaca u našoj zemlji došli smo na ideju da napravimo Smartsy, pametnu kućicu za pse.', NULL, NULL),
(1881, 26, 811, 'U Evropi postoji oko 10.000 tržnih centara (https://www.statista.com/topics/3390/european-shopping-centers/#dossierKeyfigures), preko 40.000 prodavnica koje pripadaju velikim lancima kao što su Lidl, Metro, ili Tesco i oko 160.000 filajala banaka. Naše primarno tržište u Evropi predstavljaju sve zemlje sa značajnim brojem pasa po glavi stanovnika (kao što su Češka, Rumunija i Mađarska, koje prednjače po ovoj metrici i u svetskim okvirima) (https://www.statista.com/statistics/515475/dog-ownership-european-union-eu-by-country/). Ako posmatramo samo velike lance prodavnica u Evropi, naša procena je da u prve dve godine možemo da budemo prisutni na svakih 500 prodavnica sa po četiri Smartsy kućice (što je i optimium po jednom većem objektu). Pored toga očekujemo promet od bar deset Smartsy kućica na svakih 100 tržnih centara ili na svakih 1.000 filijala banaka. Potencijal postoji i kod restorana i lokalnih samouprava.', NULL, NULL),
(1882, 27, 811, 'Smartsy nudi jedinstveno rešenje za opravdane strahove vlasnika pasa da se veliki broj neželjenih situacija u kojima mogu da se nađu njihovi ljubimci kada su bez nadzora. Našim pametnim kućicama za pse koje se postavljaju na javnim površinama u blizini mesta koja su važna vlasnicima, stvaraju se zone bezbednosti kako za vlasnike, tako i za njihove ljubimce. \r\n\r\nU septembru smo sproveli online istraživanje na uzorku od 200 vlasnika pasa starijih od 25 godina, kroz različite društvene mreže, Facebook oglase i mejling liste vlasnika pasa. Rezultati pokazuju da:\r\n\r\n- 60% vlasnika ima male pse (mase ispod 10 kg),\r\n- prvenstveno kupuju proizvode kroz online kanale,\r\n- 90% njih misli da bi njihovi ljubimci prihvatili da čekaju vlasnika u kućici u periodu od 60 do 90 minuta,\r\n- skoro 40% njih bi bilo spremno da plati uslugu čuvanja psa u iznosu ekvivalentnom parkingu za automobil.', NULL, NULL),
(1883, 28, 811, 'Prilikom izbora materilaja vodili smo računa o ponašanju i potrebama pasa, kao i o zaštiti životne sredine i čuvanju energije.\r\nOsnovne funkcije našeg prozivoda su:\r\nAutomatska vrata  \r\nUV lampa koja omogućava dezinfekciju\r\nGrejanje - sadrži termostat \r\nBešumni ventilator \r\nDisplej koji pokazuje: temperaturu, da li je uključen ventilator i/ili grejač. odbrojava koliko još sekundi je potrebno UV lampi da završi proces dezinfekcije i ponovo se otključa za novog korisnika.\r\nMultifunkcionalnu aplikaciju - Komunikacija vlasnika i psa (IP kamera i zvučnik), edukativni i komercijalni sadržaj\r\nSuper-app - adaptibilna aplikacija koja može postati deo postojeće npr. Loyalty aplikacije našeg kupca.', NULL, NULL),
(1884, 30, 811, 'Najčešće rešenje za vlasnike prodavnica i drugih objekata je šipka za vezivanje pasa ispred ulaza u objekat, ali ova šipka je daleko od zadovoljavajućeg rešenja kako za vlasnike pasa, tako i za ostale kupce koji prolaze pored prodavnica. \r\nU Evropi nismo naišli ni na jedan sličan primer, ali znamo da na teritoriji SAD postoje kućice slične našoj (DogSpot) koje posluju po B2C poslovnom modelu (naplaćuju oko $12 po satu). U međunarodnoj patentnoj bazi ne postoji informacija o tome da je ovakvo rešenja u bilo kom obliku zaštićeno', NULL, NULL),
(1885, 29, 811, 'Naš proizvod je pametna i sigurna kućica koja doprinosi brendu, ali i konkurentnosti naših primarnih kupaca (TC-a, prodavnica, restorana, banaka, lokalnih samouprava). Na tržištu Evrope do sada nije postojao proizvod koji rešava ove izazove. Naši kupci imaju mogućnost obezbeđenja dodatnog prihoda/benefita:\r\n- naplatom/korišćenjem reklamnog prostora (brendiranjem kućice),\r\n- naplatom/korišćenjem reklamnog prostora kroz svoju i/ili našu aplikaciju,\r\n- naplatom usluge čuvanja psa u Smartsy kućici.\r\nNaši kupci su i ekskluzivni distributeri za određenu teritoriju. Njihov benefit osim dobre zarade koja je na prvom mestu je i to što će biti u prilici produbiti odnos sa svojim kupcima proširenjem asortimana sa inovatinim i atraktivnim proizvodom. Oprimizaciom logističke podrške za distributere npr. vending mašina ovaj proizvod je potpuni pogodak.', NULL, NULL),
(1886, 32, 811, 'Trenutno na svetskom tržištu postoji samo jedno slično rešenje. Kompanija specijalizovana za američko tržište i koja nije imala pretenzija za širenje u Evropu. Njihovo rešenje je od plastike, skupo, aplikacija ograničava razvoj. Poslednjih godina imali su problema sa modelom, pa su vlasti New York-a zabranili njihovu upotrebu na javnim površinama.  \r\nMi nudimo savremene materijale koji su prepoznati u svetu kao najbolja opcija za ovu namenu. Mi nudimo prihvatljivu cenu koja uz garanciju daje osecaj sigurnosti kupcu. Mu nudimo aplikaciju koja je i infromativna i edukativna (po polu, rasi i uzrastu psa), ali i adaptibilna. Ona nudi i sama mogućnost za dodatne prihode. Mi imamo momenat izuzetnog zaleta PET industrije u svetu i želimo da ga iskoristimo.', NULL, NULL),
(1887, 37, 811, 'Planiramo prvo da zaštitimo Smartsy žig, a zatim i jedinstven dizajn kućice. Sva ekonomska prava koja mogu da prositeknu iz zaštite autorskih prava biće regulisana ugovorom sa kompanijom koju planiramo da osnujemo.', NULL, NULL),
(1888, 40, 811, 'Cena proizvodnje i svih operativnih troškova iznose do 1100CHF po kućici.\r\nProdaju delimo na direktnu (prodajna cena je 2600CHF) i preko distributera (prodajna cena 1800CHF).\r\nDirektnom prodajom u prvoj godini planirana zarada je 450.000CHF (oko 300 kućica, profit 1500CHF po kućici). Svaki objekat će u proseku kupiti 3 kućice, tako da planiramo 100 objekata koji će u prvoj godini kupiti ovaj proizvod. \r\nPlaniramo da razvijamo mrežu distributera sa ekskluzivnim pravom za određenu teritoriju. U prvoj godini prodaja po ovoj osnovi prema našem planu treba da nam donese profit od 168.000CHF (240 kućica, profit 700CHF po kućici).\r\nU toku prodaje radićemo na daljem razvoju proizvoda i dodatne opreme čime ćemo održavati stabilan rast kompanije. Postoji mogućnost dodatnog prihoda od brendiranja kućice, kao i prodaje prostora na samoj aplikaciji – veterinar, pet shop i sl.\r\nNaredne dve godine očekujemo rast po svakoj godini od po 300%.\r\nI – 618.000 CHF \r\nII – 1.854.000 CHF\r\nIII – 5.562.000 CHF', NULL, NULL),
(1889, 41, 811, 'Smartsy je rezultat prva dva meseca provedenih na istraživanju tržišta, anketiranju vlasnika pasa, razgovoru sa potencijalnim kupcima, a pre svega distributerima. Kada nas je reakcija ohrabrila posvetili smo se:\r\n\r\n-        Okupljanju šireg tima (definisanju odnosa, zadataka i rokova)\r\n-        Pripremi tehničke dokumentacije i izradi alata za prototip (urađeno u saradnji sa kragujevačkom kompanijom Pand d.o.o. Kragujevac)\r\n-        Izradi prototipa (posedujemo za sada prvi prototip)\r\n-        Testiranju prototipa (testirali ispred beogradskog supermatketa)\r\n-        Izradi marketinskih materijala (sajt, izbor imena, brenda…)\r\n-        Izradi ponuda i inicijalni razvoj distributerske mreže (dobili smo pisma o namerama potencijalnih distributera sa kojima smo već imali poslovno iskustvo i izgrađeno međusobno poverenje).', NULL, NULL),
(1890, 44, 811, 'Nismo', NULL, NULL),
(1891, 45, 811, 'Nismo', NULL, NULL),
(1892, 48, 811, 'Očekujemo mentrosku podršku i pripremu za sledeće faze razvoja. Prioritizovanje i postavljanje pravih ciljeva je nešto što još uvek vagamo i verujemo u kvalitetan razgovor na tu temu. Iz iskustva znamo koliko to može da pravilno usmeri tim.\r\n\r\nPristup laboratorijama Naučno-tehnološkog parka.\r\n\r\nNovac koji je predviđen vašim programom je stavka koja nam je bitna zbog ubrzavanja procesa, ali i reference.', NULL, NULL),
(1893, 49, 811, 'Neophodna su nam sredstva za:\r\n\r\n-        nabavku elektronike i repro materijala;\r\n-        završetak MVP-a;\r\n-        izradu alata za serijsku proizvodnju;\r\n-        izradu aplikacije i pripremu adaptibilne verzije za super app;\r\n-        izradu marketinških materijala (brandbook-a, komunikacione strategije…);\r\n-        sertifikovanje Smartsy kućice (CE znak);\r\n-        zaštitu žiga i intelektualne svojine;\r\n-        inicijalni troškovi prodajnog tima.\r\n\r\nDo sada smo investirali oko 10.000 CHF, a do izlaska na tržište neophodna su nam sredstva od bar 40.000 CHF. Dobijanjem novca iz vašeg programa u maksimalnom iznosu od 15.000 CHF, mi prilazimo željenom cilju da u 2022. godini krenemo sa serijskom proizvodnjom.', NULL, NULL),
