(1898, 71, 818, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1899, 89, 819, 'Radno iskustvo: Senior Strategy Leader u kompaniji Philip Morris International, Marketing Associate u kompaniji Polaris Industries, saradnik u nastavi na Univerzitetu Bocconi.\r\n\r\nObrazovanje: master iz tehnologije i inovacija na Faculty of Business and Economics Univerziteta u Lozani, i  BIEMF na Univerzitetu Bocconi.\r\n\r\nKompanije: suvlasnik u dva startapa u Srbiji VisHealth i Vitactic.', NULL, NULL),
(1900, 90, 819, 'Delimično posvećen', NULL, NULL),
(1901, 91, 819, 'Full-time (spreman da se posveti part-time Smartsy-u)', NULL, NULL),
(1902, 89, 820, 'Radno iskustvo: Gradska poreska uprava - Grad Kragujevac referent, Gradska agencija za saobraćaj d.o.o. Kragujevac samostalni stručni saradnik, Vis Health d.o.o. Beograd direktor finansija i logistike. (učestvovao u svim fazama podizanja VisHealtha / start up-a)\r\n\r\nObrazovanje: \r\nOsnovne studije \r\nUniverzitet „Megatrend” u Beogradu, smer Menadžment\r\n\r\nMaster studije\r\nFakultet inženjerskih nauka Univerziteta u Kragujevcu, smer inženjerski menadžment.', NULL, NULL),
(1903, 90, 820, 'U većoj meri posvećen, kreator ideje', NULL, NULL),
(1904, 91, 820, 'Full-time (spreman da se posveti full-time Smartsy-u)', NULL, NULL),
(1905, 89, 821, 'Radno iskustvo: CMO u kompaniji VisHealth, Head of development department u kompaniji Beosport System doo, direktor prodaje u kompaniji Aura, Marketing Manager u kompaniji Interchem-Him, savetnik malih i srednjih preduzeća u Alco Banka AD.\r\n\r\nObrazovanje: osnovne studije industrijskog menadžmenta n Tehničkom fakultetu u Beogradu.', NULL, NULL),
(1906, 90, 821, 'U većoj meri posvećena', NULL, NULL),
(1907, 91, 821, 'Full-time (spremna da se posveti full-time Smartsy-u)', NULL, NULL),
(1908, 63, 828, 'Alat koji spaja sve delove trkacke zajednice u srbiji. Kalendar trka, prijava trka, nalazene personalnog trenera', NULL, NULL),
(1909, 71, 829, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1910, 17, 830, 'Alat koji spaja sve delove trkacke zajednice u srbiji. Kalendar trka, prijava trka, nalazene personalnog trenera', NULL, NULL),
(1911, 22, 830, 'Radili u istom timu oko 6 meseci, U istoj firmi oko 1.5 god', NULL, NULL),
(1912, 23, 830, 'Mesto i prilika za pomoc u vidu definisanje i fokusiranja na MVP kao I na izbor sta uraditi, kojim redosledom, koliki opseg. Kako da budemo siguran da smo nasli product-market-fit uz ljude iskusnije od nas. Takodje pravni saveti kako osnovati firmu, autorska prava i kad je vreme za to, kako  integrisati sistem za placanje kao jedan vid inovacije u odnosnu na konkurenciju.\r\nKako je zamisljeno da alat bude \"two side marketplace\" pomoc oko privlacenja ponude na sajt. Kako pribaviti prvih 1000 korisnika. \r\nSam novac nam znaci kao pomoc za finansiranje kvalitetnijeg domena (aber.sport) na period od 2-3 godine kao I razvoj alata, marketing.\r\nOvo je samo deo problema koji mozemo resiti uz strucne ljude i mrezu koju pruza NTP', NULL, NULL),
(1913, 24, 830, 'Nadji najbolju trku i najbolju verziju sebe', NULL, NULL),
(1914, 25, 830, 'Prvi korak je pravljenje jedinstvenog kalendara za sve trke u srbiji, veliki deo bice i ostavljanje utisaka korisnika radi lakseg izbora trka. Kasnije dolazi integracija personalnih trenera kao i prijava za trke sa strane ogranizatora.\r\n\r\nKako je period kada se ide na trke(maraton, polumarton, sumske trke) ogranicen na \"lepo vreme\" od proleca do kraja jeseni tesko je isplanirati, izabrati, prijaviti i platiti sve trke bez preklapanja. Cesto su prijave trka skuplje kako se blizi datum starta. Trenutno svaki grad u srbiji ima svoju trku ovo je poteskoca za aktivne trkace \r\n\r\nProblem je vidljiv i u regionu gde popularne trke imaju samo 7-15 dana razmaka u jeku sezone, sto je tesko za postici \r\nProblem postoji globalno u vidu preklapanja trka kao i nalazenja pouzdanih i sigurnih trail trka.\r\n\r\nLicno sam  iskusio ovo svake godine vise puta kad planiram koje trke trcati, za koje trenirati, platiti unapred i sta raditi ako se odustane/otkaze trka.', NULL, NULL),
(1915, 26, 830, 'Trenutno trziste trkaca srbije ima izmedju 10000-20000. Na primeru Bg martaona se vidi da  iz godine u godinu ima aktivan rast od perko 500 novih finisera trke jasno govori da je sport u ekspanziji i trenutno je na preko 6000 finisera maratona. Ne racunajuci broj ucesnika na trci zadovoljstva kojih je minimum 10000.\r\n Najpopularnija trail trka u srbiji je trka na staroj planini koja ima oko 800 ucesnika I veliki broj lokalnih liga poput PSS, Skyrunning liga itd\r\n\r\nPotencijalno sirenje su drzave poput hrvatske, slovenije, madjarske kao drzave se velikim brojem planinskih trka i kvalitetnim trkacima.\r\n\r\nhttps://www.trcanje.rs/blog/dnevne-opservacije/prikaz-jedanaestogodisnjeg-rasta-broja-trkaca-u-srbiji-kroz-perspektivu-beogradskog-maratonu-trend-razvoja-beogradskog-maratona/\r\n\r\nhttps://ultrakleka.com/en/services/rezultati/', NULL, NULL),
(1916, 27, 830, 'Kupci - trkaci pretezno 20-50god. oba pola. Ljudi koji treniraju 3 puta nedeljno do profesionalnih trenera koji se takmice u okviru liga I jos teze tempiraju formu I treniraju svaki dan\r\nStrah -  od propustene trke za koju se spremamo pola godine u toku zime samo da bude otkazana ili prekopljena sa jos nekom zeljenom trkom.\r\nNavike - odlazak na 2-4 trke mesecno leti. Turisticki odlasci na trke u regionu ili manjim mestima u Srbiji', NULL, NULL),
(1917, 28, 830, 'Usluga pravljena personalnog kalendara trka, placanje trka online, laka razmena paketa ili otkazivanje trke. Jedinstvano mesto za prijavu trke. Ostavljanje utisaka za trke.\r\nTreneri dobijaju bazu trkaca kojima treba plan i program za bolju formu.\r\nSa druge strane ogranizatori dobijaju alat za jednostavno organizovanje trka, prijava i smanjenje obima posla kod logistickih problema prijave trka.\r\nAlat koji spaja trkacku zajednicu', NULL, NULL),
(1918, 30, 830, 'Problem se resava tako sto zapises na papiru 5 svojih trka ili pratis kalendare trka na sajtovima liga, facebook, licni kontakti.\r\nPrijava ide preko 2 sajta trka.rs i runtrace.rs koji nemaju online placanje, i lose interfejse, nema spiska prijavljenih trka, nema opcije pravljenja licnog kalendara , nema baze svih trka koje sam istrcao a ima ih preko 50', NULL, NULL),
(1919, 29, 830, 'Za trkace - Jedno mesto za prijavu trke, otkazivanje trke, ostavljanje utiska o trci, planiranje godisnjeg plana trcanja. Veca transparentnost za trke koje ce dovesti do povecanja kvaliteta\r\nZa organizatore - Olaksan i automatski proces prijave, odjave, i placanje trka.\r\nZa trenere - Baza trkaca i zelja trkaca kojima treba nacin da se poboljsa forma I prilika za prodaju planova, ishrane, saveti, treninzi', NULL, NULL),
(1920, 32, 830, 'Trenutne opcije u srbiji ne nude najosnovnije stvari za nekog poput mene \r\n1. placanje se vrsi u banci a ne online\r\n2. nema lakog nacina da se refundira novac u slucaju otkazivanja nego se salju mejlovi\r\n3. nema licnog kalendara niti istcanih trka sa rezultaitma\r\n4. nema jedinstvenog kalendara niti nacina da se lako planiraju trke\r\n5. nema lakog nacina trazenja personalnih fitnes trenera za trcanje', NULL, NULL),
(1921, 37, 830, NULL, NULL, NULL),
(1922, 40, 830, 'Udeo od zarade personalnih trenera\r\nUdeo od svake prijave za trke organizatora\r\nReklame\r\nKasnije moze doci i preuzimanje dela orgranizacije za trke', NULL, NULL),
(1923, 41, 830, 'Oko godinu dana, sa povremenim pauzama, se razvijala ideja. Do sada smo Nikola i ja kroz proces ucenja radili na bazi + devops + backend strani i to je u stabilnoj verziji. Sve je uradjeno od MVP do buducih verzija 2.0/3.0/4.0 sa mnogo naprednijim funkcijama od onog sto ce imati MVP. \r\nU decembru je zavrsen figma dizajn i pocet je rad na frontendu.\r\nUkljuceno je 1 povremeni clan FE tima (10h nedeljno)\r\nUkljuceno je 2 povremena clana FE tima ( 2x20h nedeljno je plan da se izdvoji)\r\nUklucen je dizajner kroz ceo proces od ideje do realizacije MVP dizajna.\r\n\r\nJos uvek nemamo povratne info od velikog broja kupaca. To je plan da se radi u narednih mesec dana', NULL, NULL),
(1924, 44, 830, NULL, NULL, NULL),
(1925, 45, 830, NULL, NULL, NULL);
