(1926, 48, 830, 'Ocekujemo pomoc u suzavanju izbora funkcionalnosti I redosleda funkcionalnosti koje bi korisnici hteli. Balans izmedju sta daje najvecu vrednost korisnicima ali istovremeno trazi nacin za finansijski odrziv model poslovanja tj prodaja preko sajta.\r\nNajveca podrska bi nam trebala u izbacivanju beta-verzije', NULL, NULL),
(1927, 49, 830, 'Troskovi servera su na minimalni I u to se moze uloziti kad krenu posete na sajtu. Nasi testovi pokazuju da bi izdrzao oko 2000 aktivnih korisnika ali bi nam znacilo da kupimo bolji/zvucniji domen. Trenutni deluje neozbiljno I tesko razumljiv(abersports.com). Aber.sport je nas cilj ali je cena oko 500e godisnje.\r\nOko 2000e na razvoj MVP ili 5000e na razvoj veceg obima proizvoda . \r\nOstatak bi bio utrosen na uvodjenje sistema za placanje kao I povezivanje ogranizatora/trenera da preko nas ide prijava I samim tim dovodi vise poseta sajtu. Ove dve stvari idu u paketu jer je to veliki deo inovacije koji nedostaje trkackoj zajednici. \r\nTakodje marketing uvek moze da uzme veci deo sredstava', NULL, NULL),
