(1939, 63, 842, 'Onlajn platforma za sve manje, male  i tek napravljene brendove koji prave: odeću, obuću i odevni aksesoar (poput nakita, bedževa i sličnog).', NULL, NULL),
(1940, 71, 843, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1941, 17, 844, 'Onlajn platforma za sve manje, male  i tek napravljene brendove koji prave: odeću, obuću i odevni aksesoar (poput nakita, bedževa i sličnog).', NULL, NULL),
(1942, 22, 844, 'Sarađivali su Miloš i Dušan na startup-u \"Stanlio\" više meseci. Posle nekoliko meseci od kako se završio prethodni startup se nastavila saradnja zajedno sa Lukom i od tada je prošlo više od godinu ipo dana. Tokom kojih smo radili na više projekata zajedno. Na početku je to bila mobilna aplikacija koju smo objavili na Google Play prodavnici kao i iOS app prodavnici i razvili više iteracija dok smo razvijali YouTube kanal i instagram stranicu kao marketing i takodje napravili dva vebsajta. Dalje smo razvili mobilnu aplikaciju za eTrgovinu. Razvili vebsajt glavnog uvoznika Zhidou električnih vozila. Posle toga smo radili na jos jednoj veb aplikaciji. Miloš i Luka se poznaju još iz osnovne škole, a Miloš i Dušan od trećeg razreda srednje škole.', NULL, NULL),
(1943, 23, 844, 'Glavna motivacija nam je bila pokretanje nečega našeg i stvaranje nečega što će pomoći drugima. Kada smo se sastali imali smo želju da stvorimo nešto, a kasnije kroz saradnju smo shvatili koliko dobro sarađujemo i želeli smo da ostane tako. Brainstormovali smo i istraživali. Bavili smo se različitim stvarima i nismo želeli da ostavimo neki kamen neprevrnutim. \r\nStigli smo do različitih ideja i bavili se njima dok nismo shvatili mnogo stvari i došli do trenutne usled viđenih problema sa ljudima oko nas kao i nas samih. Mnogo smo naučili u tom putu kroz iskustvo koje smo stekli kao i veliki broj kurseva koji smo pohađali i primenjivali. Takođe nam se mnogo dopao NTP i sve što radi, a imali smo i tu mogućnost da budemo u njemu više puta pomagajući Nikoli Krstiću. Dok smo bili u NTP-u upoznali smo par ljudi i svidela nam se atmosvera i naravno menza. Nikola nam je pričao kako je njemu bilo i istraživali smo. Sve je bilo toliko pozitivno da nismo mogli da zamislimo bolje mesto za razvoj startup-a kao i bolju šansu od Raising Stars-a.', NULL, NULL),
(1944, 24, 844, 'Posebno za sve.\r\nNismo se još fokusirali na slogan, samim time nije siguran.', NULL, NULL),
(1945, 25, 844, 'Rešavamo problem brendovima koji nemaju svoju ili dobru veb prodavnicu.Takođe brendovi koji nemaju svoju Instagram prodavnicu.\r\nVeb prodavnica im rešava mnogo problema, a glavni je skalabilnost i niža prodaja. Prodaja im je preko Instagram poruka, ili Facebook poruka.\r\nRešavamo problem kupcima koji nisu čuli za brendove usled teškog pronalaženja brendova i pozicioniramo ih na jednu platformu, uz najbolje moguće korisničko iskustvo koje je trenutno retko na veb prodavnicama. Kupci sve više žele neuobičaeno i unikatno, čega manje ima u običnim prodavnicama.\r\nZaključili smo da je globalni problem razgovorom sa prijateljima (SAD, Španija, Holandija), kao i blagim istraživanjem usled fokusa na domaća tržišta.\r\nProblem sprečava ljude, usled visokih troškova da počnu ili skaliraju, a jeftiniji početak im povećava operativu i odvraća pažnju od bitnih stvari poput daljeg razvoja i marketinga.\r\nSaznali smo za problem razvijajući softver i kupovinom od tih brendova, skupa je dobra veb prodavnica.', NULL, NULL),
(1946, 26, 844, 'Ciljano tržište je eTrgovinska modna/odećna globalna industrija, sa fokusom na Evropu i Severnu Ameriku.\r\nProcenjuje se da je eTrgovinska modna industrija 750 milijardi $, sa očekivanim rastom od preko 9% godišnje. U Ujedinjenom Kraljevstvu je najveći udeo tržišta eTrgovinske modne industrije kod ljudi između 25 i 34 godine od 23.7%, a naša glavna ciljna grupa je od 13-26, za koju je ukupno sličan udeo tržišta kao za ljude od 25 do 34 god.\r\nPotrošnjom koja je prikazivala da EU i SAD troše približno i da SAD troši 21% globalne modne eTrgovinske potrošnje, možemo reći da je to približno 40%.\r\nUzimanjem 10% od 10% ciljne grupe (20%) na datim kontinentima (40% od 750 milijardi $) dobijamo približno 600 miliona $.\r\nTakođe će rasti tržišni udeo manjih brendova usled rasta želje za personalizovanim i unikatnim.\r\n\r\nhttps://www.statista.com/\r\nhttps://ecommercedb.com/en/markets/us/fashion', NULL, NULL),
(1947, 27, 844, 'Manjim brendovima koji tek započinju, kao i svi brendovi koji nemaju dobru ili nemaju uopšte veb prodavnicu.\r\nVećinski kupci su mlađi od 13 do 26 godina, usled velikog raspona različitih brendova.\r\nKupci su ljudi koji žele da budu unikatniji, da kupe neuobičaeno, kao i domaće iz njihove države ili prosto ne žele da kupuju od velike korporacije. Takođe ljudi koji su se zasitili mainstream brendova, žele da kupe nešto drugačije ili žele da obraduju nekoga sa poklonom koji nije običan duks, već ima priču iza sebe i dušu.\r\nKomunicirali smo sa preko 20 naših prijatelja i poznanika preko poruka kao i razgovora uživo.\r\nVećina ljudi sa kojima smo razgovarali su imali želju da kupuju ili su kupovali od manjih brendova. Takođe većina koji su želeli nisu znali za te brendove. Oni koji nisu imali veliku želju za kupovinom od manjih brendova bi kupovali simbolično kao poklone dragim osobama.', NULL, NULL),
(1948, 28, 844, 'Razvijamo veb, a planiramo i mobilnu platformu sa najboljim mogućim korisničkim iskustvom za korisnike i brendove, visoku intuitivnost gde će imati benefit kupci (jednostavan pristup velikom izboru) i brendovi (porast prodaje..).\r\nU pitanju je IoT, koristimo html, vue js., css i firebase, a za mobilnu aplikaciju ćemo koristiti flutter (dart) i firebase.\r\nNašu platformu čini jedinstvenom to što pruža kupcima jednostavniji način dolaska do brendova kao i kupovinu njihovih proizvoda, a za brendove odlično rešenje veb prodavnice kao i pristup platformi na kojoj je njihova glavna ciljna grupa.\r\nPostojeća rešenja ne zadovoljavaju iste potrebe dovoljno zbog toga što postoji neinformisanost ljudi.', NULL, NULL),
(1949, 30, 844, 'Potencijalni kupci trenutno rešavaju problem kupovine od manjeg broja brendova usled neinformisanosti ili kupovinom od uobičaenih brendova koji im nisu preferirani ili jednostavno žele personalizovan poklon do koga ne dolaze usled neinformisanosti.\r\nDirektna konkurencija su multibrend prodavnice i uobičaeni brendovi.', NULL, NULL),
(1950, 29, 844, 'Glavni benefiti koje pružamo brendovima su: smanjenje operative, prestiž odlične veb prodavnice,  veću izloženost potencijalnim kupcima, povećanje prodaje kao i povećanje prodaje usled instagram prodavnice, organizovane edukacije o osnovama marketinga i korišćenja statistike za veću prodaju, profesionalne fotografije proizvoda ukoliko ih nemaju.\r\nPostojeća rešenja su: skupe ili loše veb prodavnica, direktne poruke preko društvenih platforma i samim time gubljenje vremena na operativu, gubitak ozbiljnosti i prestiža posedovanja odlične veb prodavnice, veći rashodi sa fizičkim prodavnicama ili multibrend prodavnicama.\r\nGlavni benefiti koje pružamo kupcima su: odlično korisničko iskustvo, lak pristup velikom broju brendova, lako obaveštavanje o novim proizvodima kao i personalizovanu ponudu (što više koriste platformu).\r\nPostojeća rešenja su: pretraga brendova na koju se potroši previše vremena, multibrend prodavnice koje imaju ograničen broj brendova usled fizičkih prodavnica.', NULL, NULL),
(1951, 32, 844, 'Naš proizvod je poboljšanje trenutnih rešenja usled problema na tržištu koja su globalno rasprostranjena.\r\nProblemi koje naš proizvod rešava su: lošije korisničko iskustvo, nedostatak mogućnosti i  funkcionalnosti veb prodavnica, kao i teži dolazak do brendova i njihovih proizvoda.', NULL, NULL),
(1952, 37, 844, 'Istraživali smo po internetu, konsultovali se kratko sa advokatom i odgledali predavanja koje ste nedavno držali na tu temu. Nismo se još konsultovali sa Zavodom za intelektualnu svojinu RS.', NULL, NULL),
(1953, 40, 844, 'Zarađivaćemo od prodaje proizvoda brendova.\r\nSmislili smo način naplaćivanja za najbolju retenciju brendova kao i najbolju pristupačnost.\r\nSastojao bi se od početnog besplatnog korišćenja sa ograničenjem u prodajama (prihod), a posle toga procentualno, sledece bi bilo fiksno i procentualno u različitim razmerama po veličini prihoda.\r\nKasnije bi smo uveli naplaćivanje rangiranja na platformi radi bolje vidljivosti proizvoda brendova.\r\nTrenutno želimo kada bude bila objavljena platforma da što duže odlažemo naplaćivanje. Taktika kao što su imale platforme poput donesi, car go, glovo i ostali.', NULL, NULL),
(1954, 41, 844, 'Na ovoj ideji smo radili oko 5 meseci. Učili smo potrebne kao i usavršavali postojeće veštine.\r\nRazvili smo beta verziju veb prodavnice i admin panela koje konstantno poboljšavamo i naravno testirali sa preko 15 ljudi. Profesor FON-a sa kojim smo razgovarali i pokazali platformu, rekao nam je da je već uveliko spremna za objavljivanje, vodeći se lean metodologijom. Takođe smo pričali o i pokazali platformu još dva profesora Ekonomskog i jednim profesorom ETF-a od kojih smo dobili veoma pozitivne povratne informacije kao i  Komunicirali sa prijateljima i poznanicima (preko 20) o brendovima i dobili veliku većinu pozitivnih odgovora. Razgovarali smo sa jednim vlasnikom brenda koji nam je dao pozitivne povratne informacije. Takođe smo razgovarali sa brendovima o njihovim problemima i platformi od kojih smo imali nekoliko pozitivnih odgovora kao i interesovanja. Nismo još kontaktirali sve domaće brendove koje smo pronašli.', NULL, NULL),
(1955, 44, 844, 'Učestvovao je Dušan u Startup centru na Ekonomskom fakultetu, program koji je trajao tri meseca i imao dva do tri predavanja/radionice nedeljno.\r\nTakođe smo se sva troica edukovali kroz različite kurseve i predavanja, koja su većinski bila online, al takođe i uživo konferencije.', NULL, NULL),
(1956, 45, 844, 'Nismo.', NULL, NULL),
(1957, 48, 844, 'Nova poznanstva sa ljudima koji tek počinju kao i mi i naravno već iskusnih ljudi u startup svetu i mentora. Da budemo okruženi ljudima koji imaju goreću želju za razvojem kao mi. Obuke, radionice i mentorstva koja će nas naučiti više o pravima intelektualne svojine i kako da ih primenimo, finansijama i popunjavanju rupa koje imamo oko vođenja firme, specijalizovane obuke za dizajn ukoliko su moguće, marketing, kao i organizacija razvoja i planiranje daljeg poboljšavanja prototipa. Takođe i prezentacione veštine i otkrivanju grešaka koje možda nismo primetili na prvu ruku. Razvoja finansijskog plana i biznis plana (ukoliko biznis model kanvas nije dovoljan). Sticanjem svih poslovnih veština koje nam nedostaju. I na kraju naravno finansijsku podršku.', NULL, NULL),
(1958, 49, 844, 'Potrebno nam je 10.000 CHF i više, radi što bolje validacije i ubrzanja razvoja, prelaženja svih prepreka i dolaska do daljih investicija/grantova. \r\nPotrebna su nam sredstva za dalje istraživanje tržista korisnika kao i tržišta biznisa (brendova) koji će sarađivati snama. Takođe daljeg testiranja našeg \"prototipa\" i poboljšavanje dizajna istog. Da zaštitimo intelektualnu svojinu kao i pravna pomoć oko pisanja ugovora sa brendovima, politike privatnosti, uslova korišćenja i politike vraćanja proizvoda (return policy).\r\nTakođe će nam biti potrebna finansijska sredstva za pokriće troškova plata, marketinga radi validacije, troškova za osnovnu opremu poput stolova i neke racunarske opreme, licence za potrebne softverske alate kao i za pokriće bankarske provizije.', NULL, NULL),
(1959, 52, 844, NULL, NULL, NULL),
(1960, 66, 847, NULL, NULL, NULL),
(1961, 76, 848, NULL, NULL, NULL),
(1962, 83, 850, NULL, NULL, NULL),
(1963, 71, 851, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1964, 63, 852, 'Robolution je projekat koji podrazumeva razvoj i proizvodnju komercijalnih robota sa funkcijama praćenja zdravstvenih parametara, bezbednosti i zaštite, u prvoj fazi, dok bi se dalje ta paleta širila zahvaljujući fleksibilnom konceptu i konstrukciji. Sama platforma i koncept omogućavaju široku multifunkcionalnu primenu na bazi modularnog hardware-a i open source software-a. Sve je ispraćeno web store aplikacijom koja omogućava nadogradnju i prilagođavanje sopstvenim potrebama. Centralni hub je koncipiran kao specijalizovana internet prodavnica posvećena kupoprodaji proizvoda i usluga iz ove oblasti kao i mogućnost naručivanja programskih rešenja i aplikacija po sopstvenim potrebama.', NULL, NULL),
(1965, 71, 853, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1966, 17, 854, 'Robolution je projekat koji podrazumeva razvoj i proizvodnju komercijalnih robota sa funkcijama praćenja zdravstvenih parametara, bezbednosti i zaštite, u prvoj fazi, dok bi se dalje ta paleta širila zahvaljujući fleksibilnom konceptu i konstrukciji. Sama platforma i koncept omogućavaju široku multifunkcionalnu primenu na bazi modularnog hardware-a i open source software-a. Sve je ispraćeno web store aplikacijom koja omogućava nadogradnju i prilagođavanje sopstvenim potrebama. Centralni hub je koncipiran kao specijalizovana internet prodavnica posvećena kupoprodaji proizvoda i usluga iz ove oblasti kao i mogućnost naručivanja programskih rešenja i aplikacija po sopstvenim potrebama.', NULL, NULL),
(1967, 22, 854, 'Ne', NULL, NULL),
(1968, 23, 854, 'Lični autonomni robot se nameće kao potreba pojedinca u savremenom društvu, odnosno kao mogućnost zdravstvene, bezbednosne i druge pomoći. Robotizacija u svim sferama ljudskog života je neizbežna i smatramo da joj je potrebno pristupiti uz poštovanje interesa i potreba korisnika robota, a ne kroz korporativni interes. Konkretna motivacija za prijavu za ovaj program je Vaša profilisanost u ovoj branši i, pre svega, mogućnost pomoći kroz mentorstvo i iskustvo.', NULL, NULL),
(1969, 24, 854, 'We were promised robots', NULL, NULL),
(1970, 25, 854, 'Čitavo čovečanstvo ima potrebu za pristupačnim kućnim pomoćnicima koji pomažu: starijim osobama, osobama sa hroničnim zdravstvenim problemima, kao i osobama koje, jednostavno, provode previše vremema na poslu. Ovakvi problemi su očigledni, česti i široko rasprostanjeni.Samo u EU živi preko 70 miliona a u SAD oko 61 milion osoba sa nekom vrstom invaliditeta. Pored toga robot ima i edukativnu funkciju u obrazovanju dece i bezbednosnu funkciju lica i objekata.', NULL, NULL),
(1971, 26, 854, 'Ovakav proizvod ima sposobnost pristupa globalnom tržištu, a s obzirom da je svetski razvoj u ovoj grani u povoju, ne možemo sa bilo kakvom preciznošću govoriti o procenjenoj veličini tržišta. Dovoljan pokazatelj potencijala je broj potecijalnih korisnika u visoko razvijenim zemljama uz projektovanu cenu konkurencije od 1000 do 2000 EUR/kom. U naredne dve godine naročito bismo bili usmereni na tržišta EU, EAES i Bliskog i Srednjeg istoka.', NULL, NULL),
(1972, 27, 854, 'Samo u EU živi preko 70 miliona a u SAD oko 61 milion osoba sa nekom vrstom invaliditeta. Pored toga robot ima i edukativnu funkciju u obrazovanju dece i bezbednosnu funkciju lica i objekata.', NULL, NULL),
(1973, 28, 854, 'Komercijalni robot sa funkcijama praćenja zdravstvenih parametara, bezbednosti i zaštite uz mogućnost proširivanja funkcije kroz update-ove i dodatne aplikacije. Platforma omogućava široku multifunkcionalnu primenu na bazi modularnog hardware-a, open source AI software-a i Blockchain tehnologije za definisanje jedinstvene ličnosti robota. Web store omogućava nadogradnju i prilagođavanje prema sopstvenim potrebama. Veliki deo konkurencije još uvek traga za baznim proizvodom na osnovu kog bi krenuo u dalji razvoj programa u okviru svog brenda. Naš koncept ostavlja različite nove mogućnosti bez potrebe za izmenom konceptom i ponovnim pozicioniranjem na tržištu.', NULL, NULL),
(1974, 30, 854, 'Trenutno ne postoji proizvod koji omogućava i objedinjuje ovako širok spektar funkcija. Mi ne limitiramo tehnologiju i platformu sopstvenim ograničenjima već korisnicima ostavljamo mogućnost poboljšanja prema njihovim potrebama.', NULL, NULL),
(1975, 29, 854, 'Konstantno praćenje zdravstvenog stanja i po potrebi obaveštavanje nadležnih službi i/ili osoba sa liste kontakata. Mogućnost pristupa sredstvima komunikacije i različitim sadržajima bez korišćenja dodatnih uređaja. Aktivna zaštitna osoba i prostora. Sam robot uči korisnika na koji način može da iskoristi sve njegove potencijale.', NULL, NULL),
(1976, 32, 854, 'Uvidom u proizvode svetskih kompanija u oblasti robotike utvrdili smo da nema sličnih proizvoda.', NULL, NULL),
(1977, 37, 854, 'Ne', NULL, NULL),
(1978, 40, 854, 'Prodaja proizvoda (Robot De Si) i posredovanje u prodaji proizvoda i usluga iz oblasti robotike, AI, 3D štampa i kripto opremo preko web platvorme Robolution.', NULL, NULL),
(1979, 41, 854, 'Razvoj ideje i koncepta traje dve godine uz učešće navedin članova tima kao i uz saradnju sa saradnicima-specijalistima uz potvrdu brze izrade PCB-a i osnovnog korisničkog software-a dok je izrade web platforme u toku.', NULL, NULL),
(1980, 44, 854, 'Ne', NULL, NULL),
(1981, 45, 854, 'Ne', NULL, NULL),
(1982, 48, 854, 'Uz izuzetno bitnu pomoć kroz mentorstvo, planiramo da web platforma bude završena, puštena u rad i da počne da generiše prihode i da se završe pripremni radovi za kompletiranje prototipa kućnog robota.', NULL, NULL),
(1983, 49, 854, '15.000 CHF za kompletiranje gore navedenih radnji.', NULL, NULL),
