(1992, 90, 862, 'U većoj meri posvećen', NULL, NULL),
(1993, 91, 862, 'HI Župa doo Kruševac, direktor, full-time', NULL, NULL),
(1994, 71, 864, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(1995, 71, 865, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(1996, 63, 866, 'Razvoj softvera za automatsko kreiranje videa. Specificnost ovog videa je da on treba da bude fotorealistican i vidi se osoba koja govori (eng. talking head). Primer moze da bude voditelj TV programa ili profesor koji drzi online lekciju preko snimka. Za nas program nece biti potrebno vrsiti samo snimanje! Program zasnovan na najnovijim rezultatima iz Vestacke inteligencije / kompjuterske vizije generisace ovaj video putem tekstualnog ulaza. Dakle, na osnovu napisanog govora, generisace se video osobe koja govori i prezentuje.', NULL, NULL),
(1997, 71, 867, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(1998, 17, 868, 'Razvoj softvera za automatsko kreiranje videa. Specificnost ovog videa je da on treba da bude fotorealistican i vidi se osoba koja govori (eng. talking head). Primer moze da bude voditelj TV programa ili profesor koji drzi online lekciju preko snimka. Za nas program nece biti potrebno vrsiti samo snimanje! Program zasnovan na najnovijim rezultatima iz Vestacke inteligencije / kompjuterske vizije generisace ovaj video putem tekstualnog ulaza. Dakle, na osnovu napisanog govora, generisace se video osobe koja govori i prezentuje.', NULL, NULL),
(1999, 22, 868, 'Da. Vladimir Matic i Strahinja Zivkovic u prethodne tri godine rade zajedno na razvoju bloga https://datahacker.rs. Od razvoja bloga razvila se i ideja za kreiranje software-a za automatsko kreiranje videa na osnovu otkucanog teksta. Vladimir Matic je zaduzen za teorijski deo i pisanje koda. Strahinja Zivkovic je radio na promovisanju postova na drustvenim mrezama, kao i prodaji 4 napisana udzbenika, reklamiranju i organizovanju komercijalnih kurseva koje smo odrzali.\r\n\r\nOd jula, 2020. Rachit Narang saradjuje sa nama na razvoju bloga. U pocetku njegov doprinos u editovanju teksta kompenzovan je honorarom, ali sve vise postaje aktivni clan tima.', NULL, NULL),
(2000, 23, 868, 'Blog koji smo zapoceli za nas je predstavljao hobi, druzenje i aktivno ucenje. Od pocetka smo znali da je ovo samo prvi korak kojim usavrsavamo sopstvena znanja i profesionalne vestine. Dalje, plan nam je bio da skripte za ucenje, vremenom usmerimo i fokusiramo ka jednoj oblasti i da one postepeno prerastu u delove naseg programa. To je proceisranje i analiza slika i videa ljudskog lica. Dodatno, nasa profesionalna eksperiza u kompaniji EyeSee je razvoj sistema za automatsko prepoznavanje emocija kao i automatsko pracenje pogleda ociju. \r\nStoga, od prakticnih problema koje smo uocili da se jedan blog pretvori u video kurs, kao i kombinovanjem profesionalne ekspertize javila se ideja da prvo nama resimo problem snimanja videa, a da onda to ponudimo i ostalima kojima je ovaj servis potreban.\r\nDa uspemo u ovome potrebna nam je Vasa pomocu u vidu mentorstva najvise u oblasti biznisa kao i finansijska podrska kako bismo angazovali dodatne saradnike i ubrzali proces kreiranja naseg software-a.', NULL, NULL),
(2001, 24, 868, 'Attention is all you need. \r\nAttention Getter je program sa kojim mozete reci zbogom mikrofonima, kamerama i glumcima! \r\nVideo snimci holivudskog kvaliteta direktno iz vaseg laptopa.', NULL, NULL),
(2002, 25, 868, 'Tokom rada na blogu dosli smo na ideju da nase blog postove prevedemo u video materijal i da ih u takvoj formi prodajemo kao kurseve. Tu se zapravo i rodila nasa ideja sa kojom konkurišemo. Iz zelje da napravimo interesantan i edukativan video sadrzaj koji privlaci paznju publike naisli smo na problem. Za pretvaranje pisanog teksta u video potrebno uloziti puno vremena, truda i energije. Naime, da bi video bio visokog kvaliteta neophodno je snimanje ponavljati mnostvo puta a greske se najcesce uoce tek u finalnoj fazi procesiranja videa. Ipak, shvatili smo da nase programerske vestine mogu da nam pomognu da resimo problem koji je globalno veoma rasprostranjen. Cilj nam je dakle da automatizujemo editovanje videa i na taj nacin potencijalim korisnicima ustedimo ogromno vreme i energiju.', NULL, NULL),
(2003, 26, 868, 'Snimanje videa “talking-heads”(u glavnom kadru je osoba koja prica i gleda u kameru.) je sveprisutan na drustvenim mrezama, kao i na svim online platformama za ucenje. Nasi potencijalni kupci bi bili svi profesori i predavaci koji kreiraju online video sadrzaj sa ciljem edukacije i promovisanja ideja. Pored toga nas softver moze se koristiti za snimanje TV emisija. Takodje, tu spadaju i chat botovi sa ljudskim likom, kreatori edukativnih i zabavnih sadrzaja sa Tik-Tok-a, Instagram-a, Twitch-a (najpopularniji video sadrzaji na Twitch-u su prenosi igranja video igrica uzivo https://en.wikipedia.org/wiki/List_of_most-followed_Twitch_channels).\r\nNasa ekspanzija od pocetka ce biti globalna. Trenutno imamo preko 10,000 korisnika na blogu. Tu su na prvom mestu posetioci iz SAD, Indije, Velike Britanije, Nemacke. Ekspanziju bismo vrsili kao program za editovanje videa za edukaciju, koje bi vremenom prosirili i na druge segmente u kojima se koristi format “talking-head” videa.', NULL, NULL),
(2004, 27, 868, 'Uradili smo analize startup-a koje su pocele da resavaju slicne probleme. Konkretno, startup Synthesia je zbog eksponencijlnog rasta svojih korisnika u decembru 2021. dobio rundu C investiranja u vrednosti od 50 miliona USD. Takodje, kompanija rephrase.ai (Indija) je dobila investiciju od 1.6 miliona USD u 2021. Dodatno, komapnija Wonder Dynamics, koja ima kancelariju i u Novom Sadu, a fokusirana je na holivudske filmove, zaokruzila je nedavno investiciju od ukupno 9 miliona USD. Ove investicije ukazuju da se radi o veoma perspektivnoj i trazenoj tehnologiji.', NULL, NULL),
(2005, 28, 868, 'Nas softver kreira virualni digitalni avatar ljudskog lica, gde se govor i gestikulacija avatara kontrolisu putem:\r\n1. Video i audio signala snimka nove osobe koja govori i upravlja avatarom\r\n2. Audio signala snimka osobe koja govori\r\n3. Otkucanog teksta \r\n\r\nNa primer, program moze da digitalizuje lice i govorni signal V. Matica. Koristeci jednu od prethodno navedene tri metode, S. Zivkovic moze kreirati video lekciju u kojoj predaje V. Matic.  \r\nOvakva vrsta softvera prvi put se pojavila u nauci 2019. godine, a kao komrecijalni proizvod 2021. godine (Rephrase.ai, Synthesia). Samim tim proizvod koji razvijamo bio bi jedinstven u poredjenju sa bilo kojim drugim softverom za video editovanje.', NULL, NULL),
(2006, 30, 868, 'Kreiranje video sadrzaja trenutno je moguce iskljucivo uz pomoc standardnih programa za editovanje videa. Trenutno su najpopularniji programi Adobe Premiere Pro, CyberLink PowerDirector 365, Pinnacle Studio, Final Cut Pro, Corel VideoStudio. Usluge koje ovi programi pruzaju korisnicima manje-vise su identicne: rad sa vise video trekova, mogucnost razdvajanja slike i zvuka, dodavanje jednostavnijih efekata, mogucnost rada sa mnostvom popularnih formata (AVI, MP4, WMV, MP3, WAV, ) i slicno. Ipak program za editovanje videa uz pomoc vestacke inteligencije za sada na trzistu nije prisutan.', NULL, NULL),
(2007, 29, 868, 'Benefit koji kupci dobijaju koriscenjem naseg softvera je usteda vremena i novca koji bi inace bili utroseni ukoliko se editovanje videa vrsi na standardan nacin. Inovacijom koju softver unosi u oblast editovanja videa omogucicemo kupcima da isprave greske koje su se dogodile tokom snimanja za samo nekoliko minuta. Takve greske se cesto ne mogu resiti koricenjem standardnog programa za editovanje. Recimo, TV reporter koji izvestava sa nekog dogadjaja je napravio gresku tokom snimanja. Da bi se ta greska ispravila, reporter bi morao da se vrati na mesto dogadjaja i ponovo snimi video sadrzaj. Medjutim, uz nas softver greska moze biti ispravljena u samom studiju, bez potrebe za ponovnim snimanjem.', NULL, NULL),
(2008, 32, 868, 'Komercijalni prozvodi ovog tipa zasnivaju se na oblastima vestacke inteligencije: Generative Adversarial Networks(GAN), Deepfake, Face reenactment. Tek od 2019. godine, rezultati vestackog generisanja lica koje govori (\"talking heads\") postali su verodostojni i realisticni. Dva vodeca startapa koji razvijaju ovaj program tek su u 2021. godini dobili prve investivije: Rephrase AI - 1.6M $, Synthesia - 50M $.', NULL, NULL),
(2009, 37, 868, 'Vladimir Matic i Strahinja Zivkovic ce biti vlasnici intelektualne svojine.', NULL, NULL),
(2010, 40, 868, 'S obzirom da je u pitanju softver planiramo da zaradjujemo po modelu \"Software as a service\". Sam program moze se postaviti na nas veb stranicu gde korisnici mogu kreirati svoje videe. Ovo je praksa i trenutnih softverskih resenja koji pruzaju slicne usluge.', NULL, NULL),
(2011, 41, 868, 'V. Matic i S. Zivkovic rade na blogu u domenu vestacke inteligencije u poslednje tri godine. U poslednjih godinu ipo dana sa nama saradjuje i Rachit Narang. Zajedno smo kreirali jedan od svetski prepoznatljivih blogova ciji se postovi prikazuju na prvoj stranici Google-a. Napisali smo cetiri knjige koje prodajemo preko bloga i mesecno imamo oko 15,000 korisnika iz celog sveta. U Srbiji smo organizovali komercijalne kurseve iz oblasti Data Science-a. \r\nEkspertiza koju smo dopunili radom na prepoznavanju emocija omogucila nam je da napravimo nas prvi prototip za automatsko procesiranje ljudskog lica. Na ovaj nacin mozemo da detektujemo lice, 68 karakteristicnih tacaka na licu, da pratimo pogled oka, prepoznajemo 7 osnovnih emocija, detektujemo poziciju glave, da segmentiramo delove lica. Nas program neophodno je jos razvijati da bismo dosli do MVP resenja. Tada cemo uraditi i prve razgovore sa kupcima. Od ekspertize nasem timu najvise ce biti neophodno pojacanje u domenu biznisa.', NULL, NULL),
(2012, 44, 868, 'Vladimir Matic je u periodu od 2014.-2016. radio na razvoju spin-off kompanije. Bio je dobitnik industrijske postdoktorske stipendije flandrijske vlade “IWT Innovation mandate” (225 000 EURa) gde je imao svog industrijskog mentora (Herman Verrelst, https://www.linkedin.com/in/hermanverrelst/?originalSubdomain=be , vodeci serijski preduzetnik u Belgiji). Takodje, ucestvovao je na brojnim seminarima i biznis inkubatorima (iMinds, Belgium).', NULL, NULL),
(2013, 45, 868, 'Uz pomoc prodatih kurseva/bootcamp-ova i prodatih knjiga i reklama uspeli smo da generisemo prihod koji je ispod 10,000 CHF.\r\nSvakako ovo se ne odnosi na novi proizvod sa kojim sada konkurisemo. \r\nSa idejom, Attention Getter sada prvi put konkurisemo. \r\nps. Vladimir Matic dobio je grant od flandrijske vlade za prethodni projekat \"NeoGuard\" u iznosu od 225.000 EURa 2014. godine, ali se to ne odnosi na trenutni projekat sa kojim konkurisemo.', NULL, NULL),
(2014, 48, 868, 'Najveca podrska potrebna nam je u mentorstvu u domenu biznisa, vodjenju finansija i detaljnom kreiranju biznis plana. Znacila bi nam i podrska u domenu softverske ekspertize iz cloud computing-a i programa koji se izvrsavaju na serverima.', NULL, NULL),
(2015, 49, 868, 'TIM:: Za razvoj naseg MVP resenja potreban nam je intenzivan rad od 4-6 meseci. Idealno bi bilo kada bismo mogli da dodatno angazujemo 2 programera sa ekspertizom iz kompjuterske vizije (junior i medior). Dalje, bice nam potrebno da angazujemo i osobu koja je vesta u prodaji (sales/business developer). Gruba procena: 60,000 EURa za period od narednih 6-12 meseci. \r\nOPREMA:: Sam proces razvoja naseg sistema zahteva koriscenje naprednih grafickih kartica (Graphical Processing Unit) za procesiranje video podataka. 4,000 EURa. Dodatno, 2 kamere i 2 mikrofona visokog kvaliteta bi nam bile potrebne za snimanje i pravljenje digitalnih avatara. 2,000 EURa', NULL, NULL),
(2016, 52, 868, 'Instagram', NULL, NULL),
(2017, 66, 871, NULL, NULL, NULL),
(2018, 76, 872, NULL, NULL, NULL),
(2019, 83, 874, NULL, NULL, NULL),
(2020, 71, 875, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2021, 89, 876, 'Vladimir Matic zavrsio je osnovne akademske studije (9.64) i master studije (9.71) na Elektrotehnickom fakultetu u Beogradu. Doktorirao je u Belgiji na univerzitetu KU Leuven.\r\nVladimir Matic je aktivno radio na pravljenju startup-a/spin-off kompanije u period od 2014-2016. Bio je dobitnik postdoktorske stipendije flandrijske vlade \"IWT-Innovation mandate\" (225 000 EUR).\r\nRezultat ovog poduhvata bio je razvijeni eksperimentalni prototip za koriscenje u bolnicama u neonatalnoj nezi u vodecim bolnicama u Belgiji I Holandiji.\r\n \r\nVladimir Matic osnovao je prve osnovne akademske i prve specijalisticke akademske \"Data Science\" studijske programe u Srbiji (2016.) u okviru privatnog Univerziteta Singidunum gde je radio kao docent/vanredni profesor i prodekan za nastavu (2016.-2019).\r\n \r\nOd 2019. radi aktivno na razvoju bloga datahacker.rs koji se bavi programerskim temama iz oblasti vestacke inteligencije, kompjuterske vizije i neuronskih mreza.\r\nRadi u kompaniji EyeSee na sistemima za automatsko prepoznavanje emocija i pracenja pogleda.', NULL, NULL),
(2022, 90, 876, 'Kreator ideje\r\nU vecoj meri posvecen razvoju startapa', NULL, NULL),
(2023, 91, 876, 'Computer Vision Research Scientist, EyeSee kompanija (2020. mart - trenutno). Full-time angazovanje', NULL, NULL),
(2024, 89, 877, 'Strahinja Zivkovic je u zadnje 3 godine radio na nasoj ideji uvek part-time, a u periodu od marta 2020. do januara 2021. Radio je full-time na kreiranju bloga i video zapisa iz oblasti kompjuterske vizije.\r\n \r\nOd jula 2021, radi u kompaniji EyeSee kao programer.', NULL, NULL),
(2025, 90, 877, 'U vecoj meri posvecen razvoju startapa\r\nU toku cele 2020. bio je u potpunosti posvecen razvoju startup-a (bloga), radeci sa full-time angazovanjem.', NULL, NULL),
(2026, 91, 877, 'Computer Vision junior developer, EyeSee kompanija (2021. juli - trenutno). Full-time angazovanje', NULL, NULL),
(2027, 89, 878, 'Kreator tekstualnog sadrzaja najvise u cilju kreiranja marketinskih kampanja. Ekspert u editovanju tehnickih tekstova i pisanju blog postova.', NULL, NULL),
(2028, 90, 878, 'Od jula 2020. Rachit je angazovan u razvoju bloga.', NULL, NULL),
(2029, 91, 878, 'Samostalni prevodilac. \r\nU okviru bloga datahacker.rs angazovan je dinamikom od pisanja jednog blog posta nedeljno, kao i nedeljnih vesti za redovne citaoce naseg bloga.', NULL, NULL),
(2030, 89, 881, 'U Elektrotehničkoj školi \"Nikola Tesla\" sam naučio osnove programiranja i razvio znanje o MS Office paketu, upoznao Miloša i u poslednjoj godini se takmičio sa timom koji sam okupio na \"High School Case Study\" koji je organizovao Case Study klub studenata Fakulteta organizacionih nauka. Osvojili smo 3. mesto i tako vežbali svoje prezentacione i istraživačke sposobnosti pod pritiskom. Upisao sam Ekonomski Fakultet i prijavio na sve studentske vannastavne aktivnosti koje sam pronašao, jedna od njih je bila Startup centar. Verujem da su me mnogobrojna predavanja u Startup centru pogurala da vidim svoju želju za startup svetom i stvaralaštvom. Dok je još trajao Startup počeo sam sa radom na channel manager-u koji spaja OTA (Booking,..), sa Milošem i još jednim prijateljem. Kasnije me je Miloš pozvao da se pridružim Luki i njemu. Od tada smo radili na mnogo projekata zajedno i trenutno smo na ovom. Nedavno sam takođe vodio konferenciju od 100 ljudi na zlatiboru sa studentskom organizacijom u kojoj sam dvogodišnji član.', NULL, NULL),
(2031, 90, 881, 'Potpuno posvećen, zajedno smo došli do ideje brainstormovanjem i diskusijama.', NULL, NULL),
(2032, 91, 881, 'Student osnovnih studija na Ekonomskom fakultetu u Beogradu. Varira, najviše tokom rokova, do 5 sati dnevno, inače u proseku 2.', NULL, NULL),
(2033, 89, 882, 'Student Elektrotehničkog fakulteta u Beogradu, smer softversko inženjerstvo. Stekao sam iskustvo u razvoju i održavanju distribuiranih informacionih sistema kroz mnogobrojne projekte (vozim na struju, minicakes, inovatra shop, stanlio). Formalno obrazovan programer orijentisan na dugoročne planove. Uključen i osvajao nagrade na takmičenjima iz oblasti sajber bezbednosti, razvoja aplikacija, robotike i drugim hakatonima. Okružen kolegama i prijateljima sa bliskim i komplementarnim karijernim planovima.', NULL, NULL),
(2034, 90, 882, 'Potpuno posvećen', NULL, NULL),
(2035, 91, 882, 'Student osnovnih studija na Elektrotehničkom fakultetu u Beogradu. U proseku 3, tokom rokova 4 sata dnevno.', NULL, NULL),
(2036, 89, 883, 'Pohađajući Prvu beogradsku gimnaziju imao sam prilike da se upoznam sa raznim naukama i privrednim oblastima. Još tada sam znao da ću se baviti izradom i projektovanjem softverskih rešenja. Učestvovao sam u nekim takmičenjima za srednjoškolce gde mi je cilj bio da se upoznam što više sa IT svetom. Nakon što sam upisao Fakultet organizacionih nauka, počeo sam saradnju sa mojim dobrim prijateljima Milošem i Dušanom. Zajedno smo se oprobali u izradi mobilnih i veb aplikacija, a naše raznovrsno poreklo i interosvanja su nam omogućili da pokrijemo sve oblasti razvijanja jednog startap projekta. Na preporuku svojih profesora sam odlučio da se prijavim za \"Data Science Conference\", gde sam se upoznao sa najvećim domaćim i svetskim ekspertima iz raznih oblasti poput analitike podataka, projektovanje organizaconih struktura, optimizacije uspešnosti poslovanja, finansija i projektovanja softvera. Cilj mi je da nastavim da učim i usavršavam svoje znanje postojećih i novih tehnologija kao i da se ostvarim u preduzetništvu.', NULL, NULL),
(2037, 90, 883, 'Potpuno posvećen', NULL, NULL),
(2038, 91, 883, 'Student osnovnih studija na Fakultetu Organizacionih nauka. Van roka do 2 sata, tokom kolokvijuma 3 do 4, a u rokovima koliko god treba.', NULL, NULL),
(2039, 63, 887, 'Aplikacija za zapošljavanje', NULL, NULL),
(2040, 71, 888, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2041, 17, 889, 'Aplikacija', NULL, NULL),
(2042, 22, 889, 'David i Jovan su zajedno osmislili koncept i osnovali agenciju za zapošljavanje Friendly Human Resources. Već više od dve godine zajednički rade na razvoju i unapređenju procesa i usluga u agenciji. Pored toga, treću godinu zajedno rade i na projektu Virtuelni sajam obrazovanja - \"Na koji ćeš faks?\". \r\n\r\nMarko i Igor su sa Davidom i Jovanom sarađivali kao konsultanti u procesima zapošljavanja u IT sektoru u više navrata počev od druge polovine 2020. godine.', NULL, NULL),
(2043, 23, 889, 'Glavna motivacija za prijavljivanje na ovaj Program jeste mogućnost da kroz mentoring programe saznamo više o razvoju i skaliranju ovakve vrste projekata kroz umrežavanje sa ljudima koji poznaju biznis bolje od nas. Takođe, umrežavanje i razmenjivanje znanja sa drugim start up-ovima. Očekujemo da nam okruženje u NTP-u može pomoći da nakon razvoja aplikacije privučemo inostrane investitore za plasiranje aplikacije na inostrana tržišta.', NULL, NULL),
(2044, 24, 889, 'Nemojte da koristite Linkedin kao Tinder, koristite Tinder kao Linkedin.', NULL, NULL),
(2045, 25, 889, 'Mnoge kompanije troše velike resurse na kontaktiranje velikog broja kandidata za otvorene pozicije u svojoj organizaciji, a najveći broj kandidata ne želi da dobija nekoliko poruka/ponuda dnevno, jer većina ponuda ne odgovara onome što oni traže. Postojeće platforme i sistemi za oglašavanje i spajanje kandidata i kompanija zahtevaju mnogo utrošenog vremena, sa jedne strane za kontaktiranje kandidata, oglašavanje pozicija i prikupljanje CV-jeva, a sa druge za pregledanje oglasa, prilagođavanje CV-ja i apliciranje na pozicije. Našim rešenjem želimo da skratimo procese, uštedimo vreme i povećamo kvalitet spojeva između kandidata i kompanija.', NULL, NULL),
(2046, 26, 889, 'Na osnovu analize popularnih sajtova za oglašavanje poslova (www.joberty.rs, www.helloworld.rs, https://startit.rs/) utvrdili smo da samo u Srbiji postoji više od 2000 IT firmi koje se oglašavaju u cilju pronanaženja zaposlenih. Dugoročno nam je cilj izlazak na globalno tržište. Analize globalnog trzista zaposljavanja u IT-u pokazuju trend rasta i procenjen je na 3 milijardi dolara za ovu godinu (https://www.fortunebusinessinsights.com/industry-reports/recruitment-software-market-100081).\r\nSistem je napravljen tako da može jednostavno da se konfiguriše i primeni na druge delatnosti pored IT-a.', NULL, NULL),
(2047, 27, 889, 'Naše rešenje, sa jedne strane, kompanijama nudi jednostavan pregled veština, znanja, usmerenja i aspiracija koje kandidati poseduju. Sa druge strane kandidatima nudi najbitnije informacije o oglašenoj poziciji, traženim kvalifikacijama, ponuđenim uslovima rada i finansijama. Do komunikacije sa kandidatima se dolazi samo u slučaju međusobnog uparivanja.\r\n\r\nKao konsultanti i zaposleni u IT oblasti smo razgovarali sa predstavnicima 11 kompanija. Jednoglasno su podržali inicijativu i izrazili interesovanje za upotrebu iste. Takođe, članovi našeg tima predstavljaju obe strane korisnika aplikacije, i regrutere i programere.', NULL, NULL),
(2048, 28, 889, 'Glavne karakteristike našeg proizvoda jesu razvoj jedinstvenog algoritma za uparivanje kandidata i kompanija, koji će uz veliku uštedu vremena i resursa povećati kvalitet procesa selekcije svim korisnicima. Razvojem jedinstvenog AI sistema ćemo moći da predvidimo trendove u budućnosti, na osnovu kojih ćemo menjati same funkcionalnosti i povećati kvalitet usluga.', NULL, NULL),
(2049, 30, 889, 'Trenutno, korisnici koriste:\r\n- Klasične platforme za oglašavanje, na kojima kompanije mogu da objavljuju tipske i netipske oglase, a da ih kandidati čitaju klikom na svaki ponaosob (Joberty, Helloworld)\r\n- Kompanije kontaktiraju kandidate direktno putem raznih platformi društvenih mreža, dok u najvećem broju slučajeva nemaju potpuni uvid u iskustva i preference kandidata (LinkedIn)', NULL, NULL),
(2050, 29, 889, 'Benefiti: \r\n- Interfejs koji je vrlo jednostavan za korišćenje i koji minute potrebne za pregledanje kandidata ili kompanija pretvara u sekunde\r\n- Interaktivne funkcionalnosti poput svajpova koji smanjuju broj klikova. Studije pokazuju da smanjenje klikova mnogostruko povećava aktivnost korisnika aplikacija\r\n- Automatsko predlaganje odgovarajućih profila kandidata i poslova koje omogućavaju napredni algoritmi sistema', NULL, NULL),
(2051, 32, 889, 'Na tržištu ne postoji veb ili mobilna aplikacija koja funkcioniše po principu koji smo osmislili. Sva postojeća rešenja su varijacije platformi za oglašavanje i pretragu oglašenih pozicija prema filterima, na osnovu kojih je moguće videti listu pozicija kojima se pristupa isključivo ponaosob. \r\n\r\nNaše rešenje je prilagodilo osnovne principe globalno popularnih \"social networking\" aplikacija, koji su upotpunjeni našim naprednim algoritmima i poznavanjem specifičnih potreba kompanija i kandidata.', NULL, NULL),
(2052, 37, 889, 'Kontaktirali smo Zavod za zaštitu intelektualne svojine i čekamo detaljne instrukcije u vezi sa mogućnostima zaštite prava na softver.', NULL, NULL),
(2053, 40, 889, 'Pored osnovnih naplata oglašavanja za kompanije, postojaće i sistem pretplata i doplata koje kompanije i kandidati mogu iskoristiti da \"otključaju\" dodatne funkcionalnosti ili dobiju veću prepoznatljivost. Osovne funkcionalnosti aplikacije će za kandidate biti potpuno besplatne, dok će imati priliku da uz doplatu zatraže različit spektar konsultacija u oblasti karijernog razvoja. Takođe, postojaće mogućnost doplate od strane kompanija i kandidata za opciju uvida u to ko ih je \"svajpovao\".', NULL, NULL),
(2054, 41, 889, 'Naš tim se povodom ove ideje inicijalno okupio u avgustu 2021. godine. Tada smo podelili uloge i krenuli u istraživanje postojećih rešenja, potreba klijenata, kao i kandidata. \r\nNaši klijenti i partneri su odmah iskazali želju da budu korisnici aplikacije, pre nego što smo imali konačnu viziju, jer nisu zadovoljni postojećim rešenjima na tržištu. Kandidatima sa kojima smo razgovarali se najviše svidela jednostavnost korišćenja i smanjenje koraka u samoj selekciji i komunikaciji. \r\n\r\nTokom razrade biznis plana, kao i dizajniranja tehničkog rešenja smo ustanovili da nam je potrebno još minimum 2 saradnika i to na pozicijama Senior UI/UX dizajner i Senior Mobile Developer. Taj problem smo rešili angažovanjem dugogodišnjih saradnika.\r\n\r\nTrenutno radimo na definisanju jasne dugoročne strategije i razvoju MVP-a.', NULL, NULL),
(2055, 44, 889, 'Nismo do sada učestovavli u programima podrške.', NULL, NULL),
(2056, 45, 889, 'Do sada imamo ukupno 5.000,00 EUR vlasničkog kapitala, ravnomerno prikupljenih od strane osnivača.', NULL, NULL),
(2057, 48, 889, 'Podrška/mentorstvo nam je najpotrebnije u segmentima razvoja biznisa i izlaska na tržište. Pored toga nam je potrebna pomoć oko pravnog savetovanja pri razvoju apliakcije i samog biznisa.', NULL, NULL),
(2058, 49, 889, 'Za razvoj aplikacije, eksterne konsultante i inicijalni izlazak na tržište nam je potrebno okvirno 13.500 EUR.', NULL, NULL),
(2059, 52, 889, 'Za program sam čuo prethodne godine od kolegnice sa fakulteta, a sada zaposlene u NTP-u, Nevene Janković. Kroz studiranje na Ekonomskom fakultetu sam ostvario prve kontakte sa NTP-om i radio na realizaciji zajedničkih poduhvata sa NTP-om i Dostignućima mladih na Ekonomskom fakultetu. Nakon toga sam pratio rad NTP-a putem društvenih mreža i objava poznanika koji tu rade. Juče sam video na LinkedIn-u objavu Nevene Janković da je opet akutelan konkurs i da su prijave do danas u ponoć. Nakon toga sam se konsultovao sa timom i rešili smo da podnesemo prijavu.', NULL, NULL),
(2060, 66, 892, NULL, NULL, NULL),
(2061, 76, 893, NULL, NULL, NULL),
(2062, 83, 895, NULL, NULL, NULL),
(2063, 71, 896, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2064, 63, 897, 'Aplikacija za HR službu koja prikuplja i agregira javno dostupnih podataka o zaposlenima, radi analizu odliva i priliva zaposlenih i ponalazenje ljudi koji bi promenili kompaniju kao i povecavanje retencije zaposlenih.', NULL, NULL),
(2065, 71, 898, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2066, 17, 899, 'Aplikacija za HR službu koja prikuplja i agregira javno dostupnih podataka o zaposlenima, radi analizu odliva i priliva zaposlenih i ponalazenje ljudi koji bi promenili kompaniju kao i povecavanje retencije zaposlenih.', NULL, NULL),
(2067, 22, 899, 'Saša Kovačević i Matija Stefanović > Kolege u HTEC grupi  \r\nMaja Bratović i Matija Stefanović > Saradnja na master tezi\r\n\r\nSvi smo prethodno, kao tim, radili na razvoju ove startup ideje.', NULL, NULL),
