(2070, 25, 899, 'Lakše nalaženje potencijalnih zaposlenih , povećanje retencije trenutnih zaposlenih, posmatranje prelaska zaposlenih iz firme u firmu (migracije).  Ovo nije problem koliko je normalna pojava i kao takva neminovonost  je u celom svetu.', NULL, NULL),
(2071, 26, 899, 'Prema sajtu jobery.rs trenutno u srbiji postoji 70000 zaposlenih u ITju. Ne znamo šta će se desiti u budućnosti na lokalnom tržištu ali trendovi u svetu pokazuju da će broj ljudi u ovoj industriji rasti. Trenutno smo locirani', NULL, NULL),
(2072, 27, 899, 'HR timovima u kompanijama. Njihvoi motivi su 1. nalaženje potrebnih novih zaposlenih i 2. smanjivanje odliva zaposlenih. \r\n\r\nSproveli smo ankete sa rekruterskom kompanijom FindIT (https://www.findit-recruitment.com/) kao i sa HR timovima različitih IT kompanija.', NULL, NULL),
(2073, 28, 899, 'Aplikaciju za  brzo  pronalazenje potrebnih IT inzenjera (potencijalno zainteresovanih za promenu kompanije) i za efikasno zadrzavanje postojecih zaposlenih (potencijalno zainteresovanih za promenu kompanije).\r\nTehnlogije: Data Analytics, ML', NULL, NULL),
(2074, 30, 899, 'Dugotrajnim i cesto neefikasnim manuelnim trazenjem ovakvih kandidata na Internetu.', NULL, NULL),
(2075, 29, 899, 'Direktni benefit je brz dolazak do zeljenih inzenjera odnosno zadrzavanje kvalitetnih inzenjera u kompaniji.', NULL, NULL),
(2076, 32, 899, 'Konsultujući različite agencije za zapošljavanje stekli smo uvid u njihove alate i propoznali potrebu za ovakvim alatom/uslugom.', NULL, NULL),
