(2079, 41, 899, 'Alat za prikupljanje informacija  - dizajn faza završena, faza izrade završena, faza testiranja u toku.\r\nAlati za analitiku -  dizajn faza završena, faza izrade započeta, u saradnji sa agencijom za zapošljavanje (konsultant).\r\nBaza podataka - u dizajn fazi', NULL, NULL),
