(2099, 89, 914, 'Prvo mento na takmičenju FELIX u organizaciji Prirodno matematičkog fakulteta-Univerziteta u Kragujevcu.\r\nPrvo mento na takmičenju Prof Star u sklopu festivala robotike u organizaciji Visoke poslovne škole Lomonosov Univerziteta u Moskvi.\r\nPrvo mesto na takmičenju za \"Najbolju tehnološku inovaciju\" u organizaciji Ministarstva Prosvete nauke i tehnološkog razvoja u kategoriji srednjoškolaca.\r\nU slobodno vreme se bavi odbojkom.\r\nTreći razred ETŠ \"Nikola Tesla\" u Beograd', NULL, NULL),
(2100, 90, 914, 'Član tima zadužen za istraživanje i unapređivanje uređaja po pitanju tehničkih rešenja za povećanje efikasnosti rada.', NULL, NULL),
(2101, 91, 914, 'Odličan učenik 3 razreda ETŠ \"Nikola Tesla\" u Beograd. Svakodnevne obaveze oko školovanja.', NULL, NULL),
(2102, 89, 915, 'Završen Elektrotehnički fakultet u Beogradu. Stalno zaposlen već 7 godina sa iskustvom u nekoliko IT kompanija. Radio na razvoju startapa SWM koji se bavio rešenjem za pametno prikupljanje utpada.', NULL, NULL),
