(2108, 71, 917, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2109, 63, 918, 'INOVACIJA BR.1: \r\nLAZAREVA KOCKICA\r\n\r\nLazareva kockica je igracka za decu uzrasta od 1-5 god. koja poboljsava i unapredjuje senzomotorni razvoj sake. Kockica je napravljena od drveta koje je izuzetno lagano i dolazi u nekoliko boja. Didakticki materijal koji se nalazi na kockici pospesuje i promovise zdrav razvoj dece u digitalnom dobu. \r\nLazareva kockica utice na razvoj mozga to jest inteligencije i maste kod dece. Koriste je i defektolozi u terapeutske svrhe, a pokazala se korisnom i kod slepe dece. \r\n\r\nINOVACIJA BR.2:\r\nLAZAREV SENZOMOTORNI PANEL \r\n\r\nLazarev senzomotormni panel je napravljen od oplemenjene iverice i medijapana. Dolazi u nekoliko boja i 2 dimenzije. Panel se od kockice istice po tome sto sadrzi svetlosne i muzicke elemente.', NULL, NULL),
(2110, 71, 919, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2111, 17, 920, 'INOVACIJA BR.1: \r\nLAZAREVA KOCKICA\r\n\r\nLazareva kockica je igracka za decu uzrasta od 1-5 god. koja poboljsava i unapredjuje senzomotorni razvoj sake. Kockica je napravljena od drveta koje je izuzetno lagano i dolazi u nekoliko boja. Didakticki materijal koji se nalazi na kockici pospesuje i promovise zdrav razvoj dece u digitalnom dobu. \r\nLazareva kockica utice na razvoj mozga to jest inteligencije i maste kod dece. Koriste je i defektolozi u terapeutske svrhe, a pokazala se korisnom i kod slepe dece. \r\n\r\nINOVACIJA BR.2:\r\nLAZAREV SENZOMOTORNI PANEL \r\n\r\nLazarev senzomotormni panel je napravljen od oplemenjene iverice i medijapana. Dolazi u nekoliko boja i 2 dimenzije. Panel se od kockice istice po tome sto sadrzi svetlosne i muzicke elemente.', NULL, NULL),
(2112, 22, 920, 'Ne.', NULL, NULL),
(2113, 23, 920, 'Motivisala nas je sansa da prosirimo, unapredimo paletu proizvoda, a konacni cilj je zvanicni kizlazak na trziste u Srbiji i sire.', NULL, NULL),
(2114, 24, 920, 'Kockicom do radosti.', NULL, NULL),
(2115, 25, 920, 'Nedovoljna zastupljenost igracaka pravljenih od prirodnog materijala, igracaka koje drze paznju a nalaze se u svakodnevnom okruzenju i prakticne su prirode. \r\nPokretac ove ideje zapravo je bio nas sin Lazar. Kao roditelji sedmomesecnog decaka, bili smo u situaciji da nismo mogli da odrzimo detetovu paznju plasticnim igrackama iz prodavnice i samim tim direktno uticemo na njegov senzomotorni razvoj koji je u tom periodu bio u pocetnoj fazi a od velike vaznosti. Nakon visecasovnog istrazivanja, saznali smo da u svetu postoje namenske igracke za razvoj motorike, ali da nisu dovoljno zastupljene kod nas ili su izuzetno visokih cena, samim tim nepristupacne. S\' obzirom na to da je suprug po struci inzenjer drveta, odlucili smo da napravimo prototip kockice. Elementi koji su cinili kockicu bili su iz Lazareve okoline koji su ga zanimali i samim tim mu drzali paznju.', NULL, NULL),
(2116, 26, 920, 'Osnovna ciljna grupa su roditelji, potom bake i deke, rodjaci i prijatelji. \r\nProstor za inicijalno sirenje trzista je definitivno Srbija, jer na osnovu nasih saznanja u Srbiji ne postoji nista slicno Lazarevoj kockici. Sto se tice inostranog trzista, ono je ogromno s\' obzirom na ciljnu grupu, ukljucivalo bi Evropu kao sekundarno trziste.', NULL, NULL),
(2117, 27, 920, 'Nasi kupci su roditelji koji aktivno zele da ucestvuju u zdrav razvoj deteta u ovom digitalnom dobu. Zivimo u vremenu prezastupljenosti elektronskih uredjaja, dugackih radnih sati i smena gde je skoro nemoguce provesti kvalitetno vreme u igri sa detetom a da to ne ukljucuje televizor, telefon, tablet. Nakon ankete koju smo sproveli dosli smo do zakljucka da su roditelji, a i predskolske ustanove u velikoj potrazi za ovakvim igrackama kako bi se deci omogucilo da sto zdravije rastu i razvijaju se uprkos vremenu u kome zivimo.', NULL, NULL),
(2118, 28, 920, 'Glavna karakteristika naseg proizvoda jeste senzomotorni razvoj dece starosti od 1-5 god. Sluzimo se savremenom tehnologijom obrade drveta. \r\nLazareva kockica je jedinstvena zato sto smo prvi u Srbiji dosli na ovu ideju.', NULL, NULL),
(2119, 30, 920, 'Nasi kupci aktivno ucestvuju i promovisu zdrav razvoj dece. \r\n\r\nSto se tice konkurencije, Lazareva kockica je jedinstvena po svojim obelezjima u ovom trenutku, ali postoji jedna kompanija koja pravi proizvode namenjene razvoju motornih sposobnosti, za koju je sveobuhvatni utisak da su proizvodi koji oni nude preskupi i skoro totalno nepristupacni \"obicnim\" roditeljima.', NULL, NULL),
(2120, 29, 920, 'Nasi proizvodi pre svega imaju dobru i istinsku pricu. Kad god nas pitaju kako smo dosli na ideju za naziv ili same kockice, mi ispricamo da je ideja proistekla iz potrebe da se nasem sinu obezbedi pravilan i srecan razvoj. Takva emotivna karika spaja proizvod sa ciljnom grupom. I to jeste cela poenta  osobenog marketinga i prodaje, povezanost kupca i onoga koji prodaje proizvod to jest pruza uslugu.  \r\nMi stojimo iza toga da Lazareva kockica i Lazarevi senzomotorni paneli daju ogromnu vrednost kada je u pitanju srecan i pravilan razvoj dece kroz igru kroz razlicite didakticke materijale koji su od velike vaznostu u dobu od 1-5. god.', NULL, NULL),
(2121, 32, 920, 'Trenutno na trzistu ne postoji proizvod ovog tipa.', NULL, NULL),
(2122, 37, 920, 'Izvrsili smo inicijalno istrazivanje i dobili povratnu informaciju koje se tice procedure zastite patenta i intelektualne svojine. \r\nVlasnici bi bili mi sami, osnivaci ove ideje, Dusica i Bojan Ristc.', NULL, NULL),
(2123, 40, 920, 'Od direktne prodaje prozivoda.', NULL, NULL),
(2124, 41, 920, 'Suprug Bojan i ja smo u procesu razvijanja ideje i proizvoda godinu i po dana. Inicijalni cilj je bio kreiranje kockice kao takve, a kasnije i ukljucivanje novih proizvoda i sirenje ideja i trzista. \r\nDefektolozi, vaspitaci, tiflolozi, kao i roditelji su nam dali najvisu ocenu kada je u pitanju inovacija, pogotovo sto se tu radi i o deci sa smetnjama u razvoju a kojima je senzomotorni razvoj od kljucne vaznosti za ozdravljenje.', NULL, NULL),
(2125, 44, 920, 'Nismo ucestvovali u mentorskim programima nikada.', NULL, NULL),
(2126, 45, 920, 'Nismo bili finansirani i nismo finansirali nista tog tipa do sada.', NULL, NULL),
(2127, 48, 920, 'Ocekujemo maksimalnu podrsku u okviru mentorstva, nabavke masina za obradu drveta, kupovinu materijala kao i izdavanje sertifikata i analiza za dalji razvoj i izlazak na trziste.', NULL, NULL),
(2128, 49, 920, 'Nabavka masina i alata za dalji razvoj bi ukljucivala sumu od 10 hiljada evra kao i finansijska sredstva za dobijanje sertifikata i sprovodjenje analiza o bezbednosti i upotrebi proizvoda.', NULL, NULL),
