(2140, 63, 930, 'Modularni zeleni panel dimenzija 40x60 cm može se staviti na fasadu bilo kog objekta. Prednosti ovog proizvoda su laka montaža, ekonomična izrada, izolacioni materijal i savremeni izgled fasade objekta.', NULL, NULL),
(2141, 71, 931, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2142, 17, 932, 'Modularni zeleni panel dimenzija 40x60 cm može se staviti na fasadu bilo kog objekta. Prednosti ovog proizvoda su laka montaža, ekonomična izrada, izolacioni materijal i savremeni izgled fasade objekta.', NULL, NULL),
(2143, 22, 932, 'Sarađivali smo tokom studiranja na različitim predmetima/projektima. Trenutno radimo zajedno na projektima iz oblasti 3d arhitektonskog modelovanja i vizuelizacije i objavljujemo ih na Instagram stranici: https://www.instagram.com/joinstudio.official/ .', NULL, NULL),
(2144, 23, 932, 'Kao arhitekte uvek obraćamo pažnju na prostor u kome se nalazimo i brojnim analizama formiramo mišljenje o njemu. Ipak prvi utisak o nekom prostoru stičemo na osnovu njegovih fizičkih karakteristika. Samim tim, mišljenje o nekom gradu/naseljenom mestu stvaramo na bazi postojećeg stanja zgrada koje se u njemu nalaze, tačnije izgleda fasada objekata. U svim gradovima u Srbiji dominiraju zgrade sa oronulim i neodržavanim fasadama, a glavni razlog tome jeste veliki iznos finansijskih sredstava koji je potrebno izdvojiti kao stambena zajednica. Želja za promenom i poboljšanjem izgleda jednog grada/naseljenog mesta motivisala nas je da osmislimo fasadni element po pristupačnoj ceni. U svetu se danas uveliko primenjuje koncept zelene gradnje, koji se pokazao efikasnim sa više aspekata. Uzimajući u obzir da su to skupi sistemi i slabo primenjivi kod nas, izazov je bio napraviti isti/slični sistem po manjoj ceni.', NULL, NULL),
(2145, 24, 932, 'Za zdravu zgradu- zelena fasada.', NULL, NULL),
(2146, 25, 932, 'Pokušavamo da rešimo više problema potencijalnim kupcima:\r\n1. Prvi problem koji, sem potencijalnih kupaca, dotiče i svakog od nas jeste smanjenje zelenih površina u gradovima.\r\n2. Drugi problem je uglavnom loša energetska efikasnost postojećih objekata. \r\n3. Treći problem su dotrajale fasade zgrada koje narušavaju izgled grada/naseljenog mesta.\r\n Navedeni problemi postoje globalno, a za njih smo saznali jednostavnom šetnjom kroz grad i kritičkim razmišljanjem uopšteno o arhitekturi i zaštiti životne sredine. Problemi jesu teški, ali ne i nerešivi. Ubeđeni smo da naš modularni zeleni panel može rešiti te probleme.', NULL, NULL),
(2147, 26, 932, 'Za početak ciljano tržište je Srbija. Potencijalno zemlje u okruženju u naredne dve godine.', NULL, NULL),
(2148, 27, 932, 'Potencijalni kupci na koje bi se mi usredsredili su stambene zajednice unutar starijih stambenih zgrada. Na tim zgradama fasade su usled neodržavanja ruinirane i energetski neefikasne, tako da bi korišćenjem našeg panela imali višestruke koristi. Takođe potencijalni kupci su i investitori novih objekata.', NULL, NULL),
(2149, 28, 932, 'Zelena arhitektura/ zeleni zidovi već postoje. Naš proizvod se razlikuje od postojećih na tržištu po montažnoj i modularnoj konstrukciji, koje će doprineti pristupačnoj ceni proizvoda za potencijalne kupce u Srbiji.', NULL, NULL),
(2150, 30, 932, '1. Prvi problem skoro da ne rešavaju. Postavljaju samoinicijativno zelenilo na terasama.\r\n2. Drugi problem rešavaju većim računima za grejanje.\r\n3. Treći problem trenutno ne rešavaju.', NULL, NULL),
(2151, 29, 932, 'Obogaćujemo neposrednu okolinu zelenilom, koje povoljno utiče na mikroklimu lokacije. Termički izolujemo objekat i oboljšavamo toplotni komfor objekta. Činimo spoljašni izgled objekta atraktivnijim i na taj način mu podižemo tržišnu vrednost.', NULL, NULL),
(2152, 32, 932, 'Slični proizvodi postoje u svetu, ali se u Srbiji ne primenjuju  zbog velike investicije.', NULL, NULL),
(2153, 37, 932, '/', NULL, NULL),
(2154, 40, 932, 'Prodajom proizvoda.', NULL, NULL),
(2155, 41, 932, 'Oko ove ideje smo okupljeni nešto više od godinu dana. Saznanjem za program \"Rising Starts\" ubrzali smo razvoj prototipa.', NULL, NULL),
(2156, 44, 932, '/', NULL, NULL),
(2157, 45, 932, 'Ne.', NULL, NULL),
(2158, 48, 932, 'Od programa prvenstveno očekujemo upoznavanje kolega inovatora i razmene mišljenja, koje je od velikog značaja, preko sticanja znanja o razvoju jedne start-up ideje do pokretanje sopstvenog biznisa. Najpotrebnija podrška nam je u fazi ispitivanja konstrukcije panela i serijske proizvodnje, a kasnije promociji gotovog proizvoda, a sve u cilju dolaska do krajnjeg kupca.', NULL, NULL),
(2159, 49, 932, 'Materijal neophodan za proizvodnju jednog panela je oko 10e/m2, bez ugradnje. Finansijska sredstva su nam neophodna za prozvodnju zelenih panela u površini jedne stambene zgrade, od 20x20m u osnovi i visine 15m, što je oko 1200m2 fasade, odnosno 12000e. Dodatna sredstva (koja nam trenutno nisu poznata) su nam potrebna za ispitivanje ponašanja konstrukcije na realnoj fasadi objekta.', NULL, NULL),
(2160, 52, 932, '/', NULL, NULL),
(2161, 66, 935, NULL, NULL, NULL),
(2162, 76, 936, NULL, NULL, NULL),
(2163, 83, 938, NULL, NULL, NULL),
(2164, 71, 939, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2165, 63, 940, 'Digitalna garancija ekološko-tehnološka platforma koja ima za cilj da smanji upotrebu drveta i plastike koja se koristi za štampanje garancija i računa i lojaliti kartica i poveća svest o važnosti reciklaže. Aplikacija za mobilne i desktop uređaje ima za cilj da u digitalnoj formi čuva i sortira podatke vezane za kupljeni proizvod ili uslugu i lojaliti kartice prodavaca i distributera. Kroz user-friendly interfejs korisnik putem aplikacije slikanjem beleži svaki papirni račun i garanciju, sliku i ostale podatke vezane proizvod ili uslugu, odnosno plastičnu lojaliti karticu pretvara u digitalnu karticu za popuste prilikom kupovine. Aplikacija obaveštava korisnika o isticanju garancije i daje mogućnost da se ista produži na dodatnih 1-2 godine. Takođe prikazuje potrošnju po univerzalnim i ličnim kategorijama.', NULL, NULL),
(2166, 71, 941, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2167, 17, 942, 'Digitalna garancija ekološko-tehnološka platforma koja ima za cilj da smanji upotrebu drveta i plastike koja se koristi za štampanje garancija i računa i lojaliti kartica i poveća svest o važnosti reciklaže. Aplikacija za mobilne i desktop uređaje ima za cilj da u digitalnoj formi čuva i sortira podatke vezane za kupljeni proizvod ili uslugu i lojaliti kartice prodavaca i distributera. Kroz user-friendly interfejs korisnik putem aplikacije slikanjem beleži svaki papirni račun i garanciju, sliku i ostale podatke vezane proizvod ili uslugu, odnosno plastičnu lojaliti karticu pretvara u digitalnu karticu za popuste prilikom kupovine. Aplikacija obaveštava korisnika o isticanju garancije i daje mogućnost da se ista produži na dodatnih 1-2 godine. Takođe prikazuje potrošnju po univerzalnim i ličnim kategorijama.', NULL, NULL),
(2168, 22, 942, 'Uzimajući u obzir da smo braća, sarađivali smo od ranog detinjstva na projektu DJ Brothers, puštali smo muziku za žurke, kasnije zajedno radili honorarne poslove, a posle zavrsetka studija honorarno smo radili na razvoju online nastupa za klijente advokate, sindikate, konsultante za putovanja, izrada nameštaja, fabriku sunđera... (advokatigotovac.com, nezavisnost-vs.rs, davyjoneslocker.asia, serbiantravelers.com, artiko.co.rs)', NULL, NULL),
(2169, 23, 942, 'Glavna motivacija je znanje mentora i predavača i networking. \r\n“Kradite” znanje\" kad god možete, sada i ovde, tada i onda, sam govorio svojim studentima. Radujemo se novim poznanstvima, sa ljudima i timovima, koji će nam otvoriti put ka novim idejama, možda ćemo sa nekima da udružimo snage, sigurno će neko da nas dovede do potecijalnih partnera.\r\nTakođe ovo je jedini program koji nudi investiciju u ranoj fazi timovima, bez osnivanja firme u našoj zemlji. \r\nDobiti početna sredstva i “know-how” u jednom programu je zaista retkost.\r\nŽelimo da postavimo na pravilne noge naš startup i da mu omogućimo da se od početka razvija u skladu sa pisanim i nepisanim pravilima kako bi opstao duže i bio jak da iznese našu viziju.', NULL, NULL),
(2170, 24, 942, 'Digitalizujmo garanciju, sačuvajmo prirodu.', NULL, NULL),
(2171, 25, 942, 'Mi rešavamo 5 problema: \r\n1.	Zagađenje životne sredine.\r\nSve učestaliji problem zagađenja životne sredine koji je globalni problem. \r\nPo istraživanjima koja su rađena dolazimo do podatka da “Jedno domaćinstvo godišnje potroši količinu papira dobijenu od 6 stabala.”  \r\n2. Čuvanje i obaveštavanje o isteku garancija.\r\nGde stoje garancije u Vašoj kući, možda u zadnjoj fioci radnog stola, ili imate fasciklu u kojoj to čuvate. A da li su tu sve garancije, skoro nikad nisu.\r\n3. Produžetak garancije.\r\nOdređene kompanije na određenu robu nude i dodatne garancije pod određenim uslovima koje propisuju. \r\n4. Skladištenje i nošenje lojaliti kartica.\r\nSvima su nam novčanici puni plastike, lojaliti kartica za ovo ili bonus kartica za ono. Sve ovo su razlozi da sve bude na jednom mestu, brzo i lako. \r\n5. Evidencija potrošnje.\r\nU ovom vremenu ljudi žele da im troškovi budu na jedan klik ažurirani i da imaju pregled izvršenih kupovina.', NULL, NULL),
(2172, 26, 942, 'Platforma Digitalna garancija je namenjena za tržište Srbije u početnoj fazi, sa mogućnošću širenja ili franšizinga na zemlje u regionu u narednih 2 godine, a u slučaju uspešnosti MVP Srbija + Balkan išli bismo na globalni razvoj.\r\nPrema Republičkom zavodu za statistiku trenutno Srbija ima 8,1 milliona korisnika mobilnih telefona u Srbiji, a procenat zastupljenosti mobilnih u Srbiji je kod 94,6% stanovništva.\r\nTakođe prema RZS kada uzmemo da je broj stanovnika muškog pola 2,23 miliona i ženskog pola takođe 2,23 miliona starosne grupe 15-64 godine, dobijamo ukupno potencijalno tržište od 4,46 miliona korisnika.\r\nZemlje širenja za sledeće dve godine su: Crna Gora, Makedonija, BiH, Republika Srpska, Bugarska.', NULL, NULL),
(2173, 27, 942, 'Pre početka rada na aplikaciji uradili smo Facebook ebook kampanju: “Kako da produžite garanciju sa 2 na do čak 11 godina?” koja nam je donela zaključak da je za ebook zainteresovano  76% muškaraca u odnosu na 23% žena. Imali smo reach oko 20 000 ljudi, od toga smo dobili 82 email adrese. Njih 43 je zaokružilo sva tri odgovora i oni su naši potencijalni Early adopteri.\r\nNajveći strahovi koji se mogu javiti su vezani za GDPR, koji svakako planiramo da pravno uredimo kroz uslove korišćenja.\r\nNaš korisnik:\r\n-	zanima je/ga ekologija, reciklira papir i plastiku, sakuplja “Čep za hendikep”, član je planinarskog društva,\r\n-	finansijski samostalna/an, ali vodi računa o svojim troškovima,\r\n-	kupuje na rate i popuste u prodavnicama, voli kupone i kodove,\r\n-	bitna mu je garancija prilikom kupovine uređaja, nije presudna, ali voli sigurnost,\r\n-	vozi porodičan auto, sanja da ima motor i čamac,\r\n-	ide na more, ponekad na planinu ili neki grad, tada koristi zdravstveno osiguranje.', NULL, NULL),
(2174, 28, 942, 'U fazi 1 razvoj aplikacije Digitalna garancija u Google frameworku Flutter-u koja daje mogućnost razvoja aplikacije za Android, iOS i web platformu. Pravljenje sistema produžene garancije i marketinške platforme za promociju proizvoda partnera. \r\nAplikacija\r\n-	čuva, organizuje, produžava vreme i obaveštava o isteku garancije\r\n-	čuva lojaliti kartice\r\n-	evidentira potrošnju.\r\nSlične aplikacije nemaju razvijene module za lojaliti, mogućnost produžavanja garancije i web platformu aplikacije.', NULL, NULL),
(2175, 30, 942, 'Na osnovu ankete koje smo sproveli među prijateljima i poznanicima došli smo do informacije da čak 98% korisnika čuva račune u kutiji, fascikli ili fioci. Ostali su  tehnološko napredniji korisnici i garancije čuvaju na internoj memoriji, google drive, one drive i slične platforme u zavisnosti koju od spomenutih platformi preferiraju.\r\n\r\nNa našem tržištu nismo primetili ni jednu aplikaciju da se ovim problemom. Niko od ispitanika nije znao da navede nijednu aplikaciju za to. Što se tiče ostalih modula ni za lojaliti kartice retko ko koristi aplikaciju za smeštaj svih kartica. Za lojaliti kartice ima nekoliko lokalizovanih aplikacija, koji je više modul za privlačenje korisnika.\r\n\r\nNa stranom tržištu postoje aplikacije sa kojom bi mogao da se reši ovaj problem, ali su oni više skoncetrisani na evidenciju celokupne potrošnje. Primeri aplikacija konkurencije na stranom tržištu, a imaju više korisnika su MrReceipt, Keep Warranty, BillsBox, My Items.', NULL, NULL),
(2176, 29, 942, 'Glavni benefiti:\r\n-	kad ti treba garancija, ona je tu, lepo smeštena, uredno sortirana, ne može da izbledi.\r\n-	ne može da ti istekne garancija za neki uređaj za jedan dan, jer prethodnih četiri dana si tražio gde se ona nalazi i nisi stigao da reklamiraš na vreme, obaveštava te aplikacija o tome,\r\n-	možeš da produžiš garanciju sa 2 na 3 ili 4 godine,\r\n-	ne tražiš lojaliti kartice po novčaniku, rancu dok je iza tebe red ljudi koji čeka, ona je tu na dohvat ruke,\r\n-	možeš da vidiš koliko si i gde novca potrošio,\r\n-	partneri mogu da komuniciraju sa svojim kupcima kao i sa konkurentskim kupcima preko naše aplikacije.', NULL, NULL),
(2177, 32, 942, 'Mislimo da bi na našem tržištu bio kao potpuno nov proizvod jer ljudi nisu svesni da takvo rešenje postoji kao aplikacija. Korisćenje aplikacija se u našoj zemlji najviše svodi na komunikaciju i zabavu. U poslednje dve godine je došlo do naglog porasta korišćenja i u drugim oblastima kao što su prodaje i usluge(dostava hrane, online kupovina). Pandemija je značajno uticala na internet pismenost našeg stanovništva i smanjila odbojnosti prema internet uslugama usled nedovoljnog poznavanja i straha od nepoznatog. Verujemo da će se korišćenje usluga preko aplikacija prebaciti i u drugim oblastima usluga kao što je naša.', NULL, NULL),
(2178, 37, 942, 'Nismo, ali planiramo da zaštitimo sve što budemo mogli. Vlasnik startupa Digitalna garancija bi bio ujedno i vlasnik intelektualne svojine.', NULL, NULL),
(2179, 40, 942, 'Monetizacija:\r\n-	Premium model aplikacije za business korisnike.\r\n-	Procenat od produženja garancija kada sklopimo ugovor sa osiguravajućim kućama ili uvoznicima.\r\n-	Oglasi u aplikaciji.\r\n-	Plaćena promotivna oglašavanja notifikacijama.\r\n-	Izrađivanje digitalnih lojaliti kartica preko naše aplikacije.', NULL, NULL),
(2180, 41, 942, 'Inicijalna ideja se javila još 2018. godine u dosta skromnijem obimu, ali sa razvojem ideje se krenulo 2021. godine u maju istraživanjem potencijalne konkurencije, u junu su rađena preliminarna istraživanja i pronađen je tim koji će eksterno da sprovodi naše ideje u delo. \r\nPostigli smo nekoliko ključnih ciljeva:\r\n1.	Validacija ideje: Sama ideja je validirana od strane dva eksperta Aleksandra Jovičića (linkedin.com/in/aleksandar-sasha-jovicic/) i Andreja Kravčuka (linkedin.com/in/andrejkravcuk/) koji smatraju da ideja ima potencijala.\r\n2.	Istraživanje potencijalnog tržišta (Facebook ebook kampanja: “Kako da produžite garanciju sa 2 na do čak 11 godina?”) i dobili povratne informacije od potencijalnih korisnika – early adopter-a.\r\n3.	Razvili smo aplikaciju do nivoa alfa verzije.', NULL, NULL),
(2181, 44, 942, 'Nažalost nismo ranije učestvovali u nekom mentorskom ili startap programu.', NULL, NULL),
