(2183, 48, 942, 'Očekujemo nadogradnju znanja iz oblasti koje nam nedostaju. Očekujemo dobar networking, jer znamo koliko je on bitan. Očekujemo da opravdamo očekivanja i poverenje koje nam je dato od strane NTP Beograd i samih mentora. Podrška nam je definitivno potrebna u delu poslovnog razvoja, ali ne isključujemo pomoć oko poboljšanja tehnološkog aspekta aplikacije.', NULL, NULL),
(2184, 49, 942, 'Potrebno nam je 15 000 EUR za razvoj startup-a do dostizanja nivoa tehnološkog razvoja proizvoda/usluge TRL6 i dostizanja nivoa poslovnog razvoja CRL7.', NULL, NULL),
