(2190, 89, 950, 'Osnovne akademske studije na Građevinsko-arhitektonskom fakultetu u Nišu (GAF), smer Arhitektura, upisao je 2012. godine, a završio 2016. godine. Potom je na istom fakultetu upisao master akademske studije i završio ih 2018. godine.\r\nOd aprila 2018. godine do dana današnjeg radi kao projektant u arhitektonskom birou „INKOPROJEKT PLANIRANJE“ u Leskovcu (full-time). Takođe od decembra 2018. godine radi kao arhitekta na platformi Upwork (part-time) (profil - https://www.upwork.com/freelancers/nikolatomic9).', NULL, NULL),
