(2193, 89, 951, 'Osnovne akademske studije na Građevinsko-arhitektonskom fakultetu u Nišu (GAF), smer Arhitektura, upisala je 2013. godine, a završila 2017. godine. Potom je na istom fakultetu upisala master akademske studije i završila ih 2018. godine. Zbog želje za daljim usavršavanjem i obrazovanjem, na istom fakuletu 2018. godine upisala je doktorske akademske studije i trenutno je student treće godine.\r\nOd aprila do juna 2018. godine angažovana je kao saradnik u nastavi iz predmeta Nacrtna geometrija II u II semestru sa fondom 0+4 u prolećnom semestru šk. 2017/2018. godine na GAF-u u Nišu. U periodu od juna do jula 2018. godine volontirala je u Gradskoj upravi grada Leskovca - Odeljenje za urbanizam na poslovima iz oblasti izrade lokacijskih uslova. Od oktobra 2018. godine do dana današnjeg angažovana je u nastavi kao stipendista Ministarstva prosvete, nauke i tehnološkog razvoja na GAF-u u Nišu na predmetima Nacrtna geometrija I, II i III i Geometrijske površi u arhitekturi na Katedri za Vizuelne komunikacije.', NULL, NULL),
