(2203, 25, 957, 'U proseku, 40% stanovništva bilo koje zemlje ima bar jedno hronično oboljenje.\r\nMeđu osobama sa hroničnim bolestima, prosečna stopa nepridržavanja prepisanoj terapiji je 50%. To dovodi do neuspešnosti terapije, hospitalizacije i povećanja troškova lečenja.', NULL, NULL),
(2204, 26, 957, 'Prema podacima sajta statista.com, tržište mobilnih zdravstvenih aplikacija koje se bave adherencom (Medication Adherence) projektovano je da dostigne $300 milijardi do 2027. godine.', NULL, NULL),
(2205, 27, 957, 'osobe koje se bore sa hroničnim bolestima, kao i osobe koje se brinu o osobama sa hroničnim bolestima', NULL, NULL),
(2206, 28, 957, 'AI - analiza zdravstvenih pokazatelja pacijenata, terapija i simptoma', NULL, NULL),
(2207, 30, 957, 'Potencijalni korisnici, trenutno, koriste ili papir i olovku za evidentiranje svojih zdravstvenih parametara i terapija, ili se oslanjaju na sećanje. Takođe postoji par konkurentnih aplikacija kao što su Walmart Welness, Medisafe no ili su kompleksnije za upotrebu ili nemaju sve što je neophodno korisnicima a HealthLy to pokriva.', NULL, NULL),
