(2211, 40, 957, 'Putem pretplata korisnika (mesečne i godišnje)\r\nPutem saradnji sa bolnicama, farmacijama, farmaceutskim kućama', NULL, NULL),
(2212, 41, 957, 'Tim se okupio pre skoro dve godine nakon što smo se upoznali i sagledali mogućnost saradnje zbog potencijala ideje, kao i uklopivosti ličnih profesionalnih ekspertiza. Nakon toga je pripremljen koncept i urađen MVP. Nakon potvrde validnosti MVPa, okupili smo programere za Android i iOS platforme, kao i savetnika za lekove koji je zaposlen u jednoj od vodećih farmaceutskih kuća. Započet je razvoj proizvoda uz konstantnu konsultaciju sa korisnicima, da bi pre 5 meseci lansirali aplikaciju na obe platforme. HealthLy je baziran na Freemeium modelu sa ciljem da privučemo što veći broj korisnika. Sa ograničenim ličnim finansijskim sredstvima uloženim u marketing, HealthLy je do sad privukao preko 3.000 korisnika.\r\n\r\nTrenutno radimo na razvoju dodatnih funkcionalnosti, kao i na promociji.', NULL, NULL),
