(2225, 63, 966, 'Систем „Смог елиминатор“ омогућава грејање на чисту енергију и потпуну електромобилност, што елиминише аерозагађење од саобраћаја и усред сагоревања фосилних горива. \r\nПо потреби, систем омогућава снабдевање ел. енергијом у критичним ситуацијама, ради спречавања искакања система, попут недавних (ТЕНТ), по 20 пута нижој цени од прoузроковане штете.', NULL, NULL),
(2226, 71, 967, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2227, 17, 968, 'Систем „Смог елиминатор“ омогућава грејање на чисту енергију и потпуну електромобилност, што елиминише аерозагађење од саобраћаја и усред сагоревања фосилних горива. \r\nПо потреби, систем омогућава снабдевање ел. енергијом у критичним ситуацијама, ради спречавања искакања система, попут недавних (ТЕНТ), по 20 пута нижој цени од прoузроковане штете.', NULL, NULL),
(2228, 22, 968, 'Учествовали смо на 500 конкурса/80 врста такмичења, освојили 300+ награда из 36 области. Уврштени смо у све базе добрих пракси (ГИЗ, МЕНСА, ЗУОВ, МПНТР), освaјали највиша државна, регионална и светска признања (за ментора, и студенте). Били консултанти у доношењу националних стратегија, сарађивали са НВО, привредом (КПМГ, ЕY, Росатом)... Имамо више награђених иновација и стотине уметничких дела. У тиму ће бити ментор и најуспешнији студент, из практичних разлога - јер имамо највише времена да се потпуно посветимо овом такмичењу.', NULL, NULL),
(2229, 23, 968, 'Добитник сам Светосавске награде МПНТР, најбољи наставник региона, номинован за најбољег наставника Света. У тиму су моји ученици, из ТОП 50 најбољих студената Света, практиканти „ЕY“, саветници државних органа, чланови ОЕБС (некима од њих сам ментор још од 1. разреда основне школе). \r\nПошто се залажем за дечије право да имају посао достојан човека кад одрасту, одлучио сам да својим ученицима створим успешну фирму: почели смо са писањем песмица, решавали студије случаја, били консултанти за доношење закона и националних стратегија (са иновацијама смо кренули као консултанти за НАП зародну равноправност, из жеље да зарадимо за хидрауличне столове за гинекологију за девојке инвалиде), учествовали на иновативним такмичењима; да би, после15 година, креирали мехатронички систем за паметне градове... Недавно смо освојили средства на конкурсу МОС, регистровали предузетничку делатност и наручили делове...  \r\nДа би започели серијску производњу, потребна су нам додатна средства, обука и помоћ проверених, пословних људи, у које имамо поверења.', NULL, NULL),
(2230, 24, 968, '\"Више акције него у филмовима\"', NULL, NULL),
(2231, 25, 968, 'Решавамо проблем аерозагађења. При садашњој емисији СО2, за 8 векова удео СО2 ће, глобално, достићи смртоносних 33%. Смртоносни ниво ће бити, најпре, достигнут у најмногољуднијим земљама, које се, уз то, и интезивно наоружавају (Индија је и нуклеарна сила, и највећи светски купац оружја. Има енормну загађеност, огромну полулацију и велики број оболелих од КОВИД 19). Дакле, проблем је ургентан, а један од највећих загађивача је саобраћај. Иако постоји наивно мишљење да ће тај проблем бити решен електричним возилима (и развијене земље планирају кратак рок до потпуног преласка на електровозила), превиђа се немогућност застарелих електромрежа да приме велик број великих потрошача (пуњача). И да се прво мора комплетно обновити инфраструктрура, за шта треба, само у СР Немачкој, више од 20 година, и преко 20 милијарди евра улагања! Што је, очигледно, неоствариво у наредних пар деценија. Ми нудимо решење које ради оптимално и на садашњим електромрежама.', NULL, NULL),
(2232, 26, 968, 'СЕ систем може продати умрежен и као два одвојена производа: \r\n1. Сејвер (који штеди ел. енергију, при раду грејача) – домаће тржиште. Величина тржишта = број домаћинстава у Србији (2.487.886, попис из 2011.): \r\nhttps://data.stat.gov.rs/Metadata/31_Popis/Html/S018150_ESMS_G10_2011_2.html\r\nСејвер је јефтин (90 еур), потребан најширој циљној групи. \r\n2. Пуњач – немачко тржиште. Величина тржишта је милион пуњача:\r\n https://made-in-germany.rs/nemacka-planira-da-postavi-jos-milion-elektro-punjaca/\r\nИнсталација милион пуњача је неостварива у наредне 2 деценије са постојећом технологијом, због огромне потрошње и застарелих електромрежа. Али наш пуњач се може инсталирати одмах без додатних улагања, 5 пута јефтиније.     \r\n3. СЕ систем – 1 промо систем у Хановеру током „ЦеБИТ“, 500.000 посетилаца.\r\n\r\nУ разговорима са делегацијама Индонезије, Пакистана и „Росатом“ (РФ) смо закључили да постоји могућност експанзије на ова тржишта (која насељава 10% светске популације).', NULL, NULL),
(2233, 27, 968, 'Потенцијални купци:\r\n1. мала домаћинства у Србији (за део система „сејвер“). Они су неповерљиви, сиромашни и тешко мењају навике. Остварили смо комуникацију и прве продаје (10 пробних сејвера).  \r\n2. градови и велике корпорације (за део система „пуњач“). 3.9.2018. смо постигли начелан договор о сарадњи са „ТВЭЛ“ (Росатом, РФ) у ПКС. \r\n3. град Хановер – систем ћемо промовисати на сајму у Хановеру (највећи изложбени центар на свету, 496.000 м2 у 27 хала) и ИТ центар Света током одржавања „ЦеБИТ“ (500.000 туриста). \r\nСтупили смо у контак са представницима Хановера (пријем у градској кући). Градоначелник нам је рекао: „Уколико постоји неки нови тренд у индустрији и техници, он ће се најпре појавити у Хановеру! Ми смо отворени за нове технологије, и снажно подржавамо младе иноваторе“. Очекујемо реализацију начелног договора, по завршетку тестирања.\r\nРазговарали смо са 7 светских делегација, и закључили да постоји обострани интерес (поготово у Индонезији и Пакистану).', NULL, NULL),
(2234, 28, 968, 'СЕ систем је нова технологија, најближа IoT технологији. Аерозагађење се елиминише: \r\n1. грејањем на чисту енергију \r\n2. електромобилношћу \r\n3. посредно – јефтино грејање на струју смањује потражњу/сечу огревног дрвета.\r\nСистем омогућава и рекуперацију ускладиштене ел. енергије на мрежу до 1 mW – што трајно спречава штету, попут недавне, настале искакањем ТЕНТ. \r\nЈеднственост нашег иновативног решења је у двоструком појачању АЦ ДЦ конверзије унутар пуњача (новина у односу на постојеће стање технике) уз 40% додатне уштеде акумулиране ел. енергије коришћењем сејвера. \r\nНАПОМЕНА: 1. Постоји могућност софтверске надоградње.\r\n2. умрежавање конкурентских производа није могуће због прегревања.', NULL, NULL),
(2235, 30, 968, 'На домаћем и глобалном тржишту не постојe системскa решењa, попут нашег, већ само појединачна, углавном пунионице и класични грејни системи. ПУНИОНИЦЕ: Осим нашег, у РС постоји још једно решење за пунионицу електромобила МП/2019/0015 од 22 kW, промовисано 3. 4. 2019. године на „Сајму аутомобила“ у Београду. Уређај већ има уграђену батерију МП/2019/0011 исте компаније (ИЕЕГ). Ово решење омогућава једно брзо пуњење за дневне потребе, после чега ради као спора пунионица.\r\nУ Свету, велики играчи производе пунионице огромне потрошње, само за сопствену аутоиндустрију (ниска скалабилност). Системи за грејање су класични, са мало иновативних решења, док мултифункционалних система, попут нашег, нема јер су јаке пунионице небезбедне за ту намену, а велики играчи немају интерес за овакве пројекте: пуњачи им служе за маркетнг – чији пуњач је \"најбржи\" и \"најјачи\" (као у време WW, када је идеал био \"најбржи револвераш\" и \"најјачи трапер\". Само што су данас револвераше и трапере замениле машине).', NULL, NULL),
(2236, 29, 968, 'Главни бенефит је елиминација аерозагађења два велика загађивача. Уз то, врло значајан бенефит за тржиште РС је сигурност електромреже – уколико дође до испадања система, попут недавног у ТЕНТ, постоје спремне велике количине ускладиштене ел. енергије за критичне ситуације (1 систем може да снабдева до 500 домаћинстава до 4 недеље). СЕ систем је оптималан хибрид Телине и Едисонове концепције, повезаних преко наших иновативних решења.\r\nПОЈЕДИНАЧНО (само пуњач): за тржиште развијених земаља је бенефит електромобилност у пуном обиму. Наш систем се може одмах инсталирати било где у Свету, без улагања у инфраструктуру (која су неопходна код конкурентских решења, и то до 20 година великих улагања, на пример, један WV пуњач од 250 кW је срушио мрежу целе области). \r\n(само сејвер): уштеда око 40% у раду кућих уређаја са грејачима (та пећи, бојлера, грејалица)...   \r\n \r\nЈединственост: много већи учинак при много мањој потрошњи; мултифункционалност.', NULL, NULL),
(2237, 32, 968, 'Зато што се остварује много већи учинак са много мањом потрошњом (што смо доказали и експериментално, и у реалним условима), уз додатне могућности грејања на чисту енергију и рекуперације акумулиране електричне енергије на мрежу, по потреби.', NULL, NULL),
(2238, 37, 968, 'Спровели смо више истражививања у вези са патентним правима у Србији, ЕУ и УСА. \r\nЗа сад, СЕ систем није патентно заштићен, као ни његови делови. Планирамо пред почетак серијске производње поднети 3 пријаве за мали патент. Разлог – пошто се патент развија и унапређује, зашитићемо га када буде готов (још има могућности за унапређење). Будући носиоци патентних права су: Милош Јефтић и Игор Јовановић.', NULL, NULL),
(2239, 40, 968, 'У почетаку ћемо продавати компоненте одвојено. Јер је сејвер за уштеду при раду грејача јефтин,  једноставан за произвести и тестиран на тржишту и има велику циљну групу: јер свако домаћинство у Србији (2.4 милиона) има више уређаја, на које се лако надогради наш поуздани уређај, који штеди до 44% (за две године, на 10 уређаја није било квара). Користићемо канале дистрибуције партнера \"Мајнд парк\", а имамо велико интересовање медија за наш рад (само ове године преко 100 чланака у више држава – чланци на званичном сајту Председника Србије, СПЦ, Владе, уз једног од најпопуларнијих инфлуенсера на Балкану, што је добар маркетинг и довољно за старт. Потребан је додатан новац за делове, и серијску производњу.  \r\n2. Пуњач и систем – Влада Немачке планира милион нових пуњача, за шта треба 20 година улагања у електромреже, а наш пуњач може одмах да се инсталира, без додатних улагања, а ценовно је конкурентнији. И ту нам је је потребан само старт, који смо договорили са градоначелником Хановера.', NULL, NULL),
(2240, 41, 968, 'Инвестирали смо освојену награду са „Такмичења за најбољу технолошку иновацију 2019.“ у пројекат „Систем Смог елиминатор“ (два основна дела система су наше ауторство)\r\n2. експериментално доказали функционалност, остварили прве продаје сејвера \r\n3. тестирали позданост сејвера при раду у реалним условима (без кварова за 2 године рада)\r\n4. експериментално доказали функционалност пуњача на малом прототипу, и извршили мерења\r\n7. испитали тржиште (разговори са амбасадама Немачке и Индонезије, привредним делегацијама УАЕ и Русије, делегацијом парламента Пакистана, градоначелником Хановера и констатовали да наш производ има значајан тржишни потенцијал на тим тржиштима.\r\n8. Стекли стратешког партнера „Мајд парк“ (пројекат од националног интереса“)\r\n9. Освојили средства за покретање предузетничког бизниса (конкурс МОС), регистровали фирму, наручили делове за почетак производње сејвера\r\n10. Добили повратне информације од клијената и експерата (више награда за патент, и пар критика).', NULL, NULL),
(2241, 44, 968, '1. „Најбоља технолошка иновација 2019.“ МПНТР и ПКС\r\n2. „Можеш и ти бити предузетник града Крагујевца“ 2021. МОС и град Крагујевац\r\n3. „Universum 2021.“, БУ и компанија „Моzzart“…', NULL, NULL),
(2242, 45, 968, 'Освајали смо новчане награде на неколико такмичења у Србији и ЕУ, и све уложили у даљи развој патента:\r\n1. 200 000 дин. на „НТИ 2019“ (МПНТР, ПКС), \r\n2. 500 еур на „МАЈНД хакатону“, 2021. (МАЈНД парк), \r\n3. 200 000 дин. на конкурсу за предузетнике 2021. (МОС и град Крагујевац). \r\n4. 500 еур, „Slovenia case challange“ 2018. Република Словенијa.', NULL, NULL),
(2243, 48, 968, 'Менторинг, консалтинг и средства за започињање серијске производње. Искрено, најважнија су нам средства за почетак серијске производње.', NULL, NULL),
(2244, 49, 968, 'До 12000 еур за завршно тестирање прототипа, заштиту интелектуалне својине и почетак серијске производње.', NULL, NULL),
