(2250, 89, 976, 'Дипломирао на Богословском факултету СПЦ. Композитор, члан СОКОЈ.\r\nДобитик Светосавске награде 2021. Најбољи наставник региона, и ментор студента из топ 50 студената Света. Награђен за све аспекте рада у просвети (рад са даровитим (Влада Војводине), рад са децом са посебним потребама, сарадња са привредим (ГИЗ), уметност (УНЕСЦО), иновације (Влада Србије), иновативне наставне методе (МЕНСА), најуспешније ваннаставне активности (ЗУОВ).   \r\nМентор ученицима на преко 80 различитих врста такмичења, из 40 области. Освојено преко 300 награда са 20 награђених генерација.', NULL, NULL),
