(2253, 89, 977, 'ТОП 50 студената Света, награђивани иноватор, истраживач, писац, сниматељ и спортиста.\r\nСениор ОЕБС, учесник преко 120 пројеката у Свету.\r\n\r\nРадио водитељ на радију Златоусти, оснивач Еко села „Жежељ“ и Луткарског позоришта\" (Bremen-Osterholz, SR Nemacka).\r\nПрви међународни прoфесионални уговор потписао у основној школи.  Дипломирао на ИТ Академији, БУ.', NULL, NULL),
