(2262, 63, 982, 'Razvijamo platformu koja će omogućiti pre svega malim i srednjim preuzećima da efikasnije upravljaju svojim resursima (npr. mašinama i opremom) i to pogotovu sa onima koji nisu maksimalno iskorišćeni pa će tako iste preko naše platforme moći da iznajmljuju i/ili dele sa drugima koji su u potražnji za istim tim resursima.', NULL, NULL),
(2263, 71, 983, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2264, 17, 984, 'Razvijamo platformu koja će omogućiti pre svega malim i srednjim preuzećima da efikasnije upravljaju svojim resursima (npr. mašinama i opremom) i to pogotovu sa onima koji nisu maksimalno iskorišćeni pa će tako iste preko naše platforme moći da iznajmljuju i/ili dele sa drugima koji su u potražnji za istim tim resursima.', NULL, NULL),
(2265, 22, 984, 'Ne, nismo do sada imali priliku da sarađujemo niti smo se poznavali dok nismo krenuli da radimo na ovoj ideji. No, i pored toga odlično se uklapamo i sarađujemo.', NULL, NULL),
(2266, 23, 984, 'Mogućnost da steknemo dodatna znanja i veštine neophodne za dalji razvoj naše ideje (npr. u oblasti intelektualne svojine, Lean Startup-a) kao i da dodatno validiramo našu ideju i unapredimo proizvod sa minimalnim funkcionalnostima (MVP) koji je u razvoju kroz  učešće na radionicama i rad sa mentorima i ekspertima programa. Pored svega toga finansijska podrška od 10,000 CHF bi predstavljala za nas značajnu pomoć i skratila period neophodan za završetak razvoja našeg novog proizvoda sa minimalnim funkcionalnostima.', NULL, NULL),
(2267, 24, 984, 'Optimizujete svoje resurse i uštedite vreme kao najvredniji od njih.', NULL, NULL),
(2268, 25, 984, 'Želimo obezbediti efikasnije upravljanje i bolje iskorišćenje resursa preduzetnika, mikro i malih preduzeća i to tako što ćemo im omogućiti da svoje usluge i slobodne resurse/kapacitete oglase na internetu i sa svojim korisnicma podele njihovu (ne)dostupnost i omoguće im rezervaciju istih preko interneta što će im značajno uštedeti vreme. Daćemo i dva primera za tako nešto. \r\nDa, problem je prisutan globalno, ali se rešava uglavnom lokalno obzirom da su i pružaoci i korisnici usluga u većini slučajeva u istom mestu ili regionu. \r\nDa, problem je prilično izazovan i dosta teži za rešiti od recimo stanova i kuća, imajući u vidu raznolikost pružaoca usluga kao i specifičnost samih usluga.\r\nZa problem smo saznali nakon višegodišnjeg rada i razgovora sa preduzetnicima, mikro i malim preduzećima, analize njihovog poslovanja i izazova sa kojima se susreću pogotovu u današnje vreme kada je upotreba interneta i digitalnih tehnologija sve veća i veća.', NULL, NULL),
(2269, 26, 984, 'Naše primarno tržište jesu fizička lica kao korisnici raznih vrsta usluga, preduzetnici, mikro, mala i srednja preduzeća kao i korisnici i pružaoci tih usluga. Oni su ti koji će nuditi i/ili koristiti usluge, deliti ili iznajmljivati svoja vozila/mašine, i to najčešće lokalno jedni od drugih imajući u vidu vrste usluga koje će biti dostupne i sve to bez obzira na mesto/region u svetu gde se nalazili. Svako ko koristi internet bilo na svom računaru ili telefonu, a takvih je preko 3.75 miliona dnevno samo u Srbiji (https://www.danas.rs/vesti/drustvo/u-srbiji-internet-dnevno-koristi-375-miliona-ljudi/), je potencijalni korisnik naših usluga obzirom da gotovo sigurno s vremena na vreme treba i neku od usluga koju će moći lako pronaći i rezervisati preko naše platforme. U prve dve godine planiramo razvijati i usavršavati platformu i testirati je na lokalnom tržištu, odnosno tržištu Srbije. Nakon toga u planu nam je proširenje na zemlje regiona kao i druge evropske zemlje.', NULL, NULL),
(2270, 27, 984, 'Naši potencijalni korisnici/kupci su pre svega preduzetnici, mikro i mala preduzeća koja pružaju razne vrste usluga (npr. usluge tehničkog pregleda, frizera, automehaničara, pranja automobila, električara, vodoinstalatera) ili koja pak žele deliti/iznajmiti svoje slobodne kapacitete/mašine sa drugima kojima je tako nešto neophodno i isplativo a nemaju potrebu niti baš uvek toliko posla sa nijima da bi ih kupili. \r\nDa već smo ostvarili komunikaciju sa oko stotinak potencijalnih korisnika/kupaca, i preduzeća i fizičkih lica, koju su vrlo zadovoljni našom poslovnom idejom kao i dobrom identifikacijom njihovih potreba i izazova sa kojima se suočavaju u današnje vreme sve veće upotrebe interneta i spremni su da budu prvi korisnici naše platforme.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(2271, 28, 984, 'Kreiramo internet platformu za oglašavanje, proveru slobodnih termina/zauzeća/dostupnosti, rezervaciju, deljenje/iznajmljivanje i praćenje rada mašina (npr. građevinskih, proizvodnih, poljoprivrednih), vozila (npr. automobila, kamiona), kao i raznih drugih vrsta usluga (npr. usluge tehničkog pregleda, frizera, automehaničara, pranja automobila, električara, vodoinstalatera) što će omogućiti efikasnije upravljanje i bolje iskorišćenje ograničenih resursa, uključujući i vreme kao jedno od najznačajnijih i najvrednijih od njih.', NULL, NULL),
(2272, 30, 984, 'Takva preduzeća uglavnom nisu vidljiva na internetu ili pak i ako jesu radi se samo o njihovim osnovnim registracionim i kontakt podacima. Mogućnost uvida u i rezervaciju njihovih slobodnih kapaciteta ili mašina koje trenutno ne koriste, uvida u slobodne termine i rezervaciju njihovih usluga nije moguća dok sa druge strane potreba njihovih korisnika/kupaca da sve to vide i rade preko interneta postaje sve veća i veća. Takva preduzeća rezervacije obavljaju još uvek ili preko telefona ili uopšte nemaju mogućnost rezervacije već kupci treba da dođu i sačekaju svoj red i to vrlo često po nekoliko njih što se zna prilično odužiti. Naša platforma ima za cilj da taj informativni jaz ako ne u potpunosti ukine onda bar značajno smanji.', NULL, NULL),
(2273, 29, 984, 'Korisnici naše internet platforme će lakše i brže pronalaziti i rezervisati neophodne usluge i resurse kao i pratiti njihovu dostupnost, i to sve online preko interneta odnosno svog pametnog telefona ili računara. Dakle, nema više gubljenja vremena na dugotrajne pretrage preko interneta i telefonske pozive koji vrlo često ne daju želejni rezultat. \r\nPrema tome istom internet platformom pored efikasnijeg upravljanja i boljeg iskorišćenja resursa samih preduzeća pomažemo i potencijalnim korisnicima njihovih usluga da lakše i brže pronađu i rezervišu iste i na taj način štedimo i čuvamo njihovo vreme i novac (ali i zdravlje u vreme epidemije/pandemije kakvu smo upravo imali) pogotovu u slučajevima kada se na neke usluge čeka i preko sat vremena na lice mesta, kao na primer kod nekih frizera ili automehaničara.', NULL, NULL),
(2274, 32, 984, 'Globalne internet platforme za oglašavanje, proveru slobodnih termina, rezervaciju, deljenje i/ili iznajmljivanje određenih vrsta resursa postoje kao na primer www.airbnb.com za stanove i kuće ili www.getaround.com za automobile. Međutim takve platforme za usluge i mašine ne postoje, ili ako pak i postoje ograničene su samo na oglašavanje dok provera slobodnih termina/zauzeća/dostupnosti, rezervacija i praćenje rada u slučaju deljenja i/ili iznajmljivanja mašina nije uopšte moguća. Sa našom platformom biće i to moguće.', NULL, NULL),
(2275, 37, 984, 'Za početak planiramo zaštititi svoj logotip. Vlasnik intelektualne svojine će biti predduzeće Jakako d.o.o.', NULL, NULL),
(2276, 40, 984, 'Planiramo naplaćivati svoje usluge bilo po oglasu (npr. KupujemProdajem) ili po rezervaciji (npr. AirBnB) što će zavisiti od vrste resursa i usluga kao i želje korisnika. Takođe, postojaće i promotivni paketi za više oglasa i korisnika.', NULL, NULL),
(2277, 41, 984, 'Tim je okupljen pre oko 10 meseci i intezivno radi na razvoju ideje. Trenutno se radi na razvoju proizvoda sa minimalnim funkcionalnostima (MVP) koji bi trebao da bude gotov za 3-4 meseca. Da, ideja je prezentovana manjem broju eksperata i potencijalnih korisnika koji su prilično zadovoljni sa idejom i od kojih su dobijene povratne informacije i preporuke koje će biti integirsane u MVP.\r\nU internet platformu sa minimalnim funkcionalnostima koja je trenutno u fazi razvoja neće biti implementirane napredne tehnologije tipa Blockchain, AI, IoT ili ML. Međutim, u planu je da u naredne verzije platforme bude implementirano većina tih tehnologija, kao na primer Blockchain i AI za identifikaciju korisnika, IoT i ML za praćenje rada mašina i vozila.', NULL, NULL),
(2278, 44, 984, 'Ne, nismo do sada učestvovali u nekom mentorskom ili startap programu u ulozi startapa.', NULL, NULL),
(2279, 45, 984, 'Do sada smo razvoj finansirali samo iz svojih sredstava, odnosno sredstava preduzeća i osnivača. Uloženo je oko 15,000 EUR.', NULL, NULL),
(2280, 48, 984, 'Očekujemo sticanje dodatnih znanja i veština neophodnih za dalji razvoj našeg poslovanja i proizvoda sa minimalnim funkcionalnostima, pre svega u oblastima sa kojima nismo baš toliko familijarni a kao na primer zaštita intelektualne svojine, Lean Startup, i sl. Takođe, kroz zajednički rad sa mentorima i ekspertima Programa očekujemo dalje unapređenje naše poslovne ideje ali i samog proizvoda sa minimalnim funkcionalnostima koji se trenutno razvija i koji bi trebao da bude završen pre očekivanog roka u slučaju Vaše finansijske podrške. Mnogo će nam značiti i povezivanje i razmena iskustava sa drugim startapovima i investicionim fondovima kao i promocija našeg startapa i proizvoda na kom radimo kroz samo učešće u Programu.', NULL, NULL),
(2281, 49, 984, 'Potrebno nam je oko dodatnih 10,000 EUR za finaliziranje proizvoda sa minimalnim funkcionalnostima kao i 10,000 EUR za marketing i puštanje na tržište.', NULL, NULL),
