(2286, 89, 991, 'Doktor nauka elektrotehnike i računarstva; \r\n13+ godina međunarodnog i multidisciplinarnog iskustva u radu na projektima u raznim industrijama širom Evrope;   \r\n6+ godina iskustva u oblasti istraživanja i razvoja novih proizvoda u oblasti razvoja softvera, veštačke inteligencije i optimizacije resursa;\r\n4+ godine iskustva u radu na razvoju i implementaciji programa za podršku inovacijama i tehnološkom transferu.', NULL, NULL),
(2287, 90, 991, 'Kreator ideje i u većoj meri posvećen. Zadužen za upravljanje preduzećem i razvoj njegovog poslovanja, saradnju sa eksternim partnerima, korisnicima/kupcima, dobavljačima i potencijalnim investitorima.', NULL, NULL),
(2288, 91, 991, 'Povremeno pruža tehničku podršku preduzećima koja posluju u oblasti mašinske obrade, proizvodnje delova od plastike, gume i metala kao i montaže elektronskih komponenata. Upravo u radu sa njima identifikovana je i njihova potreba za što efikasnijim upravljanjem i većim iskorišćenjem svojih resursa, vremena, opreme, kapaciteta, npr. mašina koje vrlo često nisu 100% zauzete.', NULL, NULL),
(2289, 89, 992, 'Diplomirani inženjer računarske tehnike - maser; \r\n8+ godina iskustva u razvoju web dizajna za razne tipove projekata; \r\n6+ godina iskustva u internet marketingu, kreiranju i vođenju kampanja na Google, Facebook, Instagram; \r\n5+ godina iskustva u samostalnom vođenju i izradi raznih tipova projekata.', NULL, NULL),
(2290, 90, 992, 'Delimično posvećen i zadužen za softverski razvoj platforme, budući internet marketing i saradnju sa eksternim programerima.', NULL, NULL),
