(2300, 63, 999, 'Inovacija je u sferi razvoja ponude domaćeg turizma kroz tematski turizam kojim bi se promovisala i čuvala nematerijalna kulturna baština našeg naroda.', NULL, NULL),
(2301, 71, 1000, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2302, 17, 1001, 'Inovacija je u sferi razvoja ponude domaćeg turizma kroz tematski turizam kojim bi se promovisala i čuvala nematerijalna kulturna baština našeg naroda.', NULL, NULL),
(2303, 22, 1001, 'Kao tim, odnosno deo tima smo sarađivali kao mentori učeničkih kompanija, kao i takmičarskih timova u sferi učeničkog preduzetništva.', NULL, NULL),
(2304, 23, 1001, 'Želja da se odgovori na nepovoljne uslove poslovanja u sferi turizma tokom pandemijske  krize i da se etno selima i subjektima seoskog turizma, lokalnim samoupravama, turističkim organizacijama, destinacijskim menadžment organizacijama, turističkim agencijama i posrednicima optimalnim strategijama i obukama, osigura kontinuirano povećanje prihoda kroz nove koncepte tematskog turizma. Uz to i da se sačuva, obnovi i proširi značaj nematerijalnih dobara naše kulture i tradicije, iskoristi potencijal Srbije u sferi turizma kroz oblasti koje nisu do sada razmatrane kao prostor unapređenja i proširenja ponude; da se da podsticaj za revitalizovanje starih zanata i pokretanje novih startapova, za razvijanje turističkih kapaciteta, kao i da se stvore šanse za poboljšanje života u devastiranim sredinama, uz rad na podizanju ekološke svesti i svesti o bogatstvu nacionalne kulturne baštrine.', NULL, NULL),
(2305, 24, 1001, 'Riznica - čuvar blaga', NULL, NULL),
(2306, 25, 1001, 'Problem koji bismo primarno rešavali na tržištu jesu nepovoljna klima i uslovi poslovanja u sferi turizma nastali tokom pandemijske  krize u 2020/21. godini. Kroz osnivanje specijalizovane  agencije za konsalting i menadžment u turizmu koja bi ponudila etno selima i subjektima seoskog turizma, lokalnim samoupravama, lokalnim i regionalnim turističkim organizacijama, destinacijskim menadžment organizacijama, turističkim agencijama - organizatorima putovanja i posrednicima optimalne strategije, taktike i obuke i osigurali kontinuirano povećanje prihoda u ovoj sferi privrede kroz konkretne projekate i nove koncepte tematskog turizma. Razvijali bismo ideje za brzo i fleksibilno prilagođavanje krupnim promenama na turističkom tržištu i unapređenje kvaliteta usluga kroz strategiju predviđanja i planiranje unapred.\r\n\r\nIideja je namenjena subjektima turizma Srbije, a kroz realizaciju koncepta bila bi deo turističke ponude namenjene globalnom sveskom tržištu.', NULL, NULL),
(2307, 26, 1001, 'Iideja je namenjena subjektima turizma Srbije, a kroz realizaciju koncepta bila bi deo turističke ponude namenjene globalnom sveskom tržištu.\r\nSvima zainteresovanom za nove vidove aktivnog i edukativnog odmora i upoznavanje Srbije na autentičan način, ali i turistima Srbije koji bi kroz pakete usluga obnavljali ili sticali znanja o našem narodu, kulturi i tradiciji na nov način i uživali u sopstvenom napretku kroz učenje, kao i kroz otvaranje vidika za koncepte zdravog života i navika. Takođe bi se koncept mogao uvrstiti i u sferu edukativnog turizma namenjenog deci i mladima.', NULL, NULL),
(2308, 27, 1001, 'Naši kupci  bi bili etno sela i subjekti seoskog turizma, lokalne samouprave, lokalne i regionalne turističke organizacije, destinacijske menadžment organizacije, turističke agencije - organizatori putovanja. \r\nZa sada smo istražujući etno sela i subjekti seoskog turizma učili kao ključno u njihovim predstavljanjima da se u njima tradicija i priroda spajaju, ali istini za volju nema sadržaja koji bi zaista bili koncepti za saznavanje i upoznavanje narodne kulture i običaja kroz aktivno učešće u njima. U ponudama se pominju mir, svež vazduh i ukusna domaća hrana, ali ne i učešće u spravljanju domaće hrane, posebno one u vezi sa određenim praznicima, običajima i obredima, a to bi bio naš koncept.', NULL, NULL),
(2309, 28, 1001, 'Usluge koje razvijamo jesu konkretni koncepti tematskih turističkih ponuda, strategije, taktike i obuke koje bi im osigurale povećanje prihoda. Ponudili bismo  ideje za brzo i fleksibilno prilagođavanje krupnim promenama na turističkom tržištu i unapređenje kvaliteta usluga kroz strategiju predviđanja i planiranje unapred.\r\nPrimer: proslava Božića bi počinjala Tucindanom, preko Badnjeg dana, odlaska po badnjak, unošenja badnjaka uz sve običaje, loženje badnjaka, pripremanja hrane i obrednih hlebova... i tri dana gošćenja, upoznavanje koledarskih pesama i učešće u koledarskim povorkama. \r\nKoncept bi bio razvijen za brojne praznike i običaje tokom godine, a turizam bi bio podsticaj zanata.', NULL, NULL),
(2310, 30, 1001, 'Savremeni turista je željan novog i drugačijeg, dinamičnog odmora, saznavanja i iskustava tako da bi ovaj koncept bio primeren onima koji žele upoznati Srbiju na nov način, ali i onima koji misle da je poznaju da je vide i dožive iz drugačijeg ugla, pri čemu saznaju mnoge stvari i sagledaju kroz epohe kao u nekoj vrsti vremeplova.\r\nPostoje brojni formati tematskog turizma, ali ovakav koncept  nije u ponudi. Kulturni turizam je u postojećim ponudama vezan najpre za spomenike kulture, a verski za svetilišta i mesta isceljenja, gastro turizam takođe postoji, ali nijedan od koncepata nije usmeren na nematerijalnu kulturu. Tako da bi naša ideja našla sebi veliki prostor, a doprinela bi i unapređenju ruralnih i devastiranih sredina koje do sada nisu pronalazile uporšta za razvoj turističke ponude jer se svuda u srbiji čuva nematerijalna kulturna baština i neguju običaji koje na treba ukazati i oživeti ih.', NULL, NULL),
(2311, 29, 1001, 'Naši direktni kupci dobijaju konkretne projekate i koncepte tematskog turizma, optimalne strategije, taktike i obuke i osiguravaju povećanje prihoda. Stiču mogućnosti za brzo i efikasno prilagođavanje dinamičnom tržištu, unapređenje kvaliteta usluga i opciju predviđanja i planiranje unapred. A indirektni kupci – turisti zadovoljavaju globalni turistički trend povratka prirodi jer temelj našeg koncepta. Kroz aktivnosti na suncu, u prirodi imaju i efekat zdravstvenog turizma, a zapravo su u sferi kulturnog turizma.\r\nDobitak koji iz našeg koncepta proističe jeste u širem kontekstu afirmacija srpskog naroda i njegovih znanja, verovanja, gastronomskog identiteta. Dobitak je i spoznavanje kulture, običaja i tradicije Srbije kroz učenje, aktivan odmor, uživanje u sopstvenim rukotvorinama i gastronomskim specijalitetima; osećaj zadovoljstva zbog novih saznaja razvijanje socijalne i ekološke svesti i emocionalne inteligencije.', NULL, NULL),
(2312, 32, 1001, 'Ovakvu uslugu nemaju subjekti turizma u našoj zemlji iako postoje forme tematskog turizma koje su bliske našem konceptu (kulturni, ekoturizam, klimatski ili zdravstveni,  verski,  edukativni, seoski, gastronomski, manifestacioni...). Naime naš koncept je u potpunosti inovativan iako u sebi sublimira segmente mnogih postojećih koncepata. Naš koncept je autentičan, a što je najvažnije podstiče razvoj postojećih subjekata turizma, ali i stvaranje novih jer i tamo gde se činilo da nema turistički atraktivnih sadržaja otvara mogućnosti za raskošnu ponudu, a još važnije je to što podstčie razvoj i stvaranje preduzetništva kada su u pitanju umetnički i stari zanati, a sve to je podsticaj za razvoj i poboljšanje ekonomskih prilika u čitavoj državi.', NULL, NULL),
(2313, 37, 1001, 'Samo smo informativno konsultovali pravne norme o mogućnostima zaštite intelektualne svojine.', NULL, NULL),
(2314, 40, 1001, 'Naš startap planira da zarađuje od  prodaje inovativnih ideja i koncepata koje će plasirati etno selima i subjektima seoskog turizma, lokalnim samoupravama, lokalnim i regionalnim turističkim organizacijama, destinacijskim menadžment organizacijama, turističkim agencijama - organizatorima putovanja i posrednicima, kojima će takođe ponuditi i obuke za razvijanje koncepata tematskog turizma, a kroz angažovanje eksperata iz ove oblasti i kroz mnoge druge usluge poput treninga I marketinga.', NULL, NULL),
(2315, 41, 1001, 'Tim je relativno kratko okupljen oko ideje, nepun mesec dana. Ključni cilj nam je bio analiza tržišta u sferi tematskog turizma i koncipiranje ideje koja bi bila inovativna, primenjiva i isplativa. Za sada smo koncipirali nekolike konkretne ideje u toj oblasti i namera nam je da ih autorski zaštitimo, predstavimo  i ponudimo na tržištu.', NULL, NULL),
(2316, 44, 1001, 'Do sada smo samo u više navrata učestvovali u razvijanju startapova učeničkog preduzetništva i biznis ideja učenika budući da radimo u Ekonomskoj školi iz Niša, koja je razvila i koncept Regionalnog centra za preduzetništvo mladih jugoistočne Srbije. Naše ideje su nagrađivane u celosti na nacionalnim i međunarodnim takmičenjima, ali i u različitim segmentima kao npr. u sferi marketinga. Stekli smo iskustva u okviru  obrazovnog  programa Dostignuća mladih, a svoj rad smo predstavljali i na Svetskoj nedelji obrazovanja oktobra 2020. kao primer dobre prakse gde smo bili  jedna od 100 najboljih praksi sveta.\r\nPredstavljali smo svoje ideje u Privrednoj komori Srbije, na panelima ženskog preduzetništva i izazvali interesovanje nekih investitora.\r\nNajčešće su naše ideje i bile u sferi turizma.', NULL, NULL),
(2317, 45, 1001, 'Za sada nismo.', NULL, NULL),
(2318, 48, 1001, 'Očekujemo obuke za razvoj biznisa, edukacije i mentorstvo, finansijsku podršku  za razvoj biznis modela, istraživanje tržišta,\r\ntestiranje prvih kupaca, zaštitu intelektualne svojine i razvoj novih proizvoda ili usluga.', NULL, NULL),
(2319, 49, 1001, 'Potrebna su nam sredstva za iznajmljivanje prostora, opremu, kreiranje veb stranice, troškove struje, grejanja, komunalne troškove, zaštitu intelektualne svojine, angažovanje eksperta... 200 - 300 hiljada dinara.', NULL, NULL),
