(2326, 90, 1009, '1. Delimično posvećen razradi ideje (metodologiji) u smeru razvijanja metode koja će biti široko primenjiva, na više vrsta opasnog otpada koji u sebi sadrži teške metale. 2. Nakon verifikacije tehnol. procesa u Srbiji, odgovoran za nalaženje partnera u Kini.', NULL, NULL),
