(2330, 71, 1013, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2331, 17, 1014, NULL, NULL, NULL),
(2332, 22, 1014, 'Prijateljstvo i saradnja Nikole i Vladimir traje preko 8 godina, a kreće još na Matematičkom fakultetu koji su zajedno studirali. Na samom fakultetu ih je spojila strast prema algoritmima, teškim problemima u računarstvu, modernim tehnologijama i veštačkoj inteligenciji. Po završetku fakulteta umesto korporativnog puta odabiraju put preduzetnistva, gde na osnovu istraživačkog rada na problemu pakovanja u prostoru (eng. Bin Packing Problem) kreću u proces razvoja proizvoda i biznisa koji za cilj ima da pomogne logističkim i transportnim kompanijama u procesu pakovanja tovara na optimalan način u kontejnerski prostor (morski, kamionski i avio kontejneri). Posle stavljanja tacke na razvoj startupa prihvataju posao u Darwin Digital-u i rad na velikom evropskom inovacionom projektu gde saradjuju sa najrenomiranijim evropskim univerzitetima i kompanijama u toj oblasti (Horizon 2020) u domenu AI-a sa ciljem da napravi AI prodavnicu i alate za lakši razvoj AI rešenja.', NULL, NULL),
(2333, 23, 1014, 'Glavna motivacija za prijavu je priključivanje i vidljivost u startup zajednici, mogućnost uvezivanja i saradnje sa članicama kao i povezivanje sa mentorima, investitorima, ljudima i kompanijama koji bi mogli da nam pomognu na ovom putu. Takodje verujemo da svojim znanjem i iskustvom u oblasti vestačke inteligencije možemo da pomognemo drugim članicama zajednice.', NULL, NULL),
(2334, 24, 1014, '”Create a production ready AI Applications without a line of code and PhD”', NULL, NULL),
(2335, 25, 1014, 'Razvoj AI Aplikacija i AI Sistema je kompleksan, dugačak i skup proces i vrlo često većina rešenja ostane samo na nivou prototipa.  Mogućnost kreiranja AI aplikacija je rezervisana za velike kompanije koje mogu da priušte timove domenskih ekspertata i infrastrukturu za kontinualno učenje i poboljšavanje modela. Sam razvoj zahteva vise specijalizacija kako bi se razvili AI Modeli, a potom ti modeli pripremili za produkciju na platformi. Prikupljanje podataka, procesiranje podataka,odabir adekvatnog AI modela, njegovo treniranje kao i njegova optimizacija i priprema za produkciju zahtevaju čitav tim eksperata. Naša platforma upravo omogućuje i demokratizuje proces kreiranja AI aplikacija, smanjenjem kompleksnosti, troškova izrade i troškova izvršavanja. Ovaj problem smo uočili u razvoju AI aplikacija, radom sa akademskim institucijama i malim i srednjim preduzećima. Razvojem alata koji pomažu u razvoju AI aplikacija problem se može u velikoj meri automatizovati i olakšati.', NULL, NULL),
(2336, 26, 1014, 'Na osnovu Gartner analize, predviđa se da će prihod od softvera za vestačku inteligenciju (AI) širom sveta iznositi 62,5 milijardi dolara u 2022. godini, što je povećanje od 21,3% u odnosu na 2021.\r\nNaše ciljano tržiste predstavlja tržiste kreirano potrebom za implementacijom i korišćenjem AI rešenja. Deo tog tržista na koji se mi fokusiramo je zasnovan na potrebi primene AI rešenja kompjuterske vizije i obrade prirodnog jezika. No-code AI platforme sticu sve vecu popularnost i trakciju, nezavisno da li su platforme startapa ili velikih kompanija. Gartner procenjuje vrednost trzista No-code AI platformi na 13.8 milijardi dolara u 2021. godini i predvidja da ce do kraja 2025. godine 50% od skupa svih klijenata  biti organizacije koje nisu u IT domenu.\r\nhttps://www.gartner.com/en/newsroom/press-releases/2021-11-22-gartner-forecasts-worldwide-artificial-intelligence-software-market-to-reach-62-billion-in-2022', NULL, NULL),
(2337, 27, 1014, '“AI is set to be the key source of transformation, disruption and competitive advantage in today’s fast changing economy.” (PwC, AI Study)\r\nPotencijalni kupci su sve male i srednje kompanije koje neguju inovativnu kulturu i zele da svoje proizvode ili procese unaprede data-driven AI resenjima. Kompanije koje primene AI bice u prednosti u odnosu na kompanije koje ne primene. Glavne karakteristike potenijalnog kupca su: Mala ili srednja kompanija koja se nalazi u Evropi ili USA, koje mogu da unaprede postojece ili kreiraju novo resenje primenom AI-a; Kompanije teze inovaciji, imaju otvoren pristup i razumeju vaznost primene AI-a u svom poslovanju; Kako podaci trenutno predstavljaju najvredniji resurs na svetu, shvataju da neiskoriscavanjem tih pogodnosti mogu da izgube trenutnu pozivciju;Nemaju mogucnost da kreiraju interne kapacitete za razvoj AI Aplikacijama. U neformalnim razgovorima smo vec anketirali potencijalne ciljne kompanije i vec prethodno uocene probleme potvrdili.', NULL, NULL),
(2338, 28, 1014, 'Proizvod koji razvijamo spada u kategoriju No-code AI platformi koje za cilj imaju da olakšaju, ubrzaju i pruže mogućnost kreiranja AI rešenja korisnicima koji nemaju specijalizaciju u oblasti AI-a. Sama platforma je dizajnirana tako da omogućuje korisnicima vođeni razvoj AI rešenja, u prvom koraku omogucuje prikupljanje, anotiranje i procesiranje podataka, u drugom koraku automatski vrsi selekciju i treniranje najadekvatnijeg modela na osnovu uslova koje je definisao korisnik, a potom model optimizuje kako bi redukovao velicinu i brzinu izvrsavanja. Kao finalni korak, platforma u odnosu na odabranu produkcionu platformu generiše AI paket.', NULL, NULL),
(2339, 30, 1014, 'Potencijalni kupci u većini slučajeva problem rešavaju angažovanjem kompanije stručne u oblasti mašinskog učenja (data science, deep learning), gde posle skupog i dugotrajnog procesa mali broj AI rešenja završi u produkciji. Na tržištu trenutno postoje rešenja kojima nedostaje kvalitet ili u fazi odabira najoptimalnijeg modela za korišćenje na platformi gde je predviđena produkcija i deployment ili nedovoljno optimizovanje i performantno izvršavanje modela koristeći maksimalne procesorske resurse na platformi (CPU, GPU, TPU). Neke od platformi su desktop rešenja čiji je limitirajuci faktor skalabilnost računarskih resursa, što je česta potreba prilikom razvoja AI modela u oblasti dubokog ušenja. Neki od konkrenata su platforme: Lobe.ai, Edge Impulse, Make ML, Teachable Machines.', NULL, NULL),
(2340, 29, 1014, 'Neural Factory kao glavne benefite izdvaja, smanjenje cene, vremena potrebnog za razvoj i uštedu resursa za izvršavanje AI rešenja zasnovanih na dubokom učenju, kao što su kompjuterska vizija i obrada prirodnih jezika. Korisnici će imati priliku da uz pomoć platforme prikupe podatke, anotiraju ih i pripreme za proces treniranja modela. Uz pomoć NF AutoML alata korisnici će odabirati najoptimalniju arhitekturu i varijaciju modela za datu platformu, a potom će moči da automatski treniraju modele. Posle treniranja uz pomoc NF Optimizer alata, korisnici će moći da svoj model optimizuju, evaluiraju i pripreme za izvršavanje na platformi. Platforma takođe omogućuje praćenje performansi modela u produkciji kao i mogućnost da se modeli unaprede prikupljanjem još podataka i re-treniranjem. Pružajući Edge SDK-a korisnici ima mogucnost da izvršava svoju AI aplikaciju na embedded uređajima, na mobilnim uređajima uz pomoć Mobile SDK-a ili na serverima u cloud-u uz pomoć kontejnera.', NULL, NULL),
(2341, 32, 1014, 'Nas proizvod u odnosu na postojeća rešenja na tržištu nudi značajnu prednost u dve vertikale: odabiru optimalnog modela za planiranu platformu gde će se AI aplikacija izvršavati i optimizaciju i deployment modela, gde optimizovani modeli zahtevaju manje resursa u poređenju sa neoptimizovanim.', NULL, NULL),
(2342, 37, 1014, 'Vlasnici intelektualne svojine bi bili Co-Founderi, Nikola i Vladimir.', NULL, NULL),
(2343, 40, 1014, 'Naš startap planira da zaradjuje kroz:\r\n- Fiksnu mesečnu naknadu u vidu Basic i Pro paketa,\r\n- Naplatnu mesečne licence za svaku kreiranu AI aplikaciju koja izlazi iz broja definisanog u paketu,\r\n- Naknada za iznajmljivanje resursa za treniranje modela,\r\n- Naknada za iznajmljivanje dodatnih resursa za skladištenje podataka,\r\n- Ekspertsko savetovanje u procesu kreiranja i dizajniranja AI rešenja,\r\n- Custom enterprise rešenja.', NULL, NULL),
(2344, 41, 1014, '- Dva meseca rada na analizi tržišta i kreiranju koncepta,\r\n- Detaljna analiza postojećih rešenja,\r\n- Rad na projekntom definisanju i planiranju (Roadmap),\r\n- Razgovor sa kolegama koji se bave istrazivačkim radom u AI oblasti i potencijalnim novim članovima tima,\r\n- Rad na dokazu koncepta,\r\n- Razgovor sa malim biznisima i potencijalnim korišćenjem platforme i dobijene prve povratne informacije,\r\n- Uspostavljanje komunikacije sa domenskim ekspertima.', NULL, NULL),
(2345, 44, 1014, 'U toku 2017-2018 smo učestvovali na Startit Akademiji sa svojim startapom “Vidra Packer” (https://startit.rs/demo-day-seste-startap-akademije/).', NULL, NULL),
(2346, 45, 1014, 'Prilikom razvoja startupa “Vidra Packer” prikupili smo 80.000e iz FFF izvora. U procesu razvoja startupa imali smo partnerstvo sa DSV logističkom kompanijom u Srbiji, gde smo svoj proizvod validirali i testirali i od kojih smo dobijalni značajne informacije iz domena. Svoj proizvod i ideju smo predstavili kompaniji Milsped od koje smo dobili ponudu za finansiranje daljeg razvoj, testiranje i pomoć u procesu dizajniranja proizvoda u zamenu za equity kompanije (kao potvrdu posedujemo predugovor).\r\nU toku razvoja startapa smo bili u procesu pregovora sa ICT Hub Ventures i SC Ventures fondovima.', NULL, NULL),
(2347, 48, 1014, 'Prilikom učešća u programu očekujemo da unapredimo postojeća biznis znanja, dobijemo konstruktivne savete od mentora i kolega na programu, ostvarimo kontakt sa potencijalnim partnerima i investitorima, dobijemo pomoć i savetovanje za apliciranje na dostupne grant programe i dobijemo pomoć u serverskoj infrastrukturi.', NULL, NULL),
(2348, 49, 1014, 'Okviran inicijalni budžet za razvoj prototipa i MVP-a iznosi izmedju 30.000-50.000e. A potrebni su nam za:\r\n- Proširenje inženjerskog tima,\r\n- Brending i dizajn aplikacije,\r\n- Uspostavljanje inicijalnih marketing i sales kanala,\r\n- Za infrastrukturu platforme (cloud servere),\r\n- Pravne i operativne troskove kompanije.\r\nDeo budzeta planiramo da finansiramo iz sopstvenih sredstava.', NULL, NULL),
(2349, 52, 1014, 'Za Rising Starts program smo čuli od svojih partnera B2Bee kompanije, clanice NTP-a, sa kojima sarđujemo.', NULL, NULL),
