(2354, 63, 1022, 'Platforma omogućava pretragu i analizu tržišta nekretnina, automatizovanje procesa analize i evaluacije isplativosti nekretnine koji inače obavljaju finansijski analitičari i eksperti za nekretnine.', NULL, NULL),
