(2356, 17, 1024, 'Platforma omogućava pretragu i analizu tržišta nekretnina, automatizovanje procesa analize i evaluacije isplativosti nekretnine koji inače obavljaju finansijski analitičari i eksperti za nekretnine.', NULL, NULL),
(2357, 22, 1024, 'Zajedno radili na startapu Yamba', NULL, NULL),
(2358, 23, 1024, 'Potrebno znanje i inicijalne investicije.', NULL, NULL),
(2359, 24, 1024, 'Real estate investment solutions made easy.\r\nJednostavna rešenja za ulaganja u nekretnine.', NULL, NULL),
(2360, 25, 1024, 'Pitanja na koja naša platforma daje odgovore su:\r\n \r\nDa li je cena nekretnine realna?\r\nKoliko odredjena nekretnina može da zaradi izdavanjem na godišnjem nivou?\r\nKolika je procena godišnje zauzetosti odredjene nekretnine?\r\nKolika je zarada od izdavanja na Airbnb-u u datom regionu?\r\nKoliki su godišnji troškovi za datu nekretninu?\r\nKolika je rata za kredit za datu nekretninu?\r\nKolika je godišnja stopa rasta cena za datu nekretninu?\r\nKako se poredi investiranje u odredjenu nekretninu u odnosu na neke druge vrste ulaganja?\r\nDa li mi se više isplati da kupim ili iznajmljujem nekretninu?\r\n \r\nOvo su veoma česta pitanja kod svake osobe koja planira da uloži u kupovinu nekretnine, i odgovoriti na ova pitanja podrazumeva duboku analizu tržišta (sa više izvora/sajtova) i kompleksnu finansijsku kalkulaciju. Naša platforma pruža kompletno rešenje za ove probleme.', NULL, NULL),
(2361, 26, 1024, 'Incijalno ciljano tržište su kupci nekretnina u Srbiji, gde godišnje u proseku bude oko 100.000 kupoprodaja (https://katastar.rgz.gov.rs/RegistarCenaNepokretnosti/), i oko million mesečnih poseta sajtovima za prodaju nekretnina (https://www.similarweb.com/website/nekretnine.rs, https://www.similarweb.com/website/4zida.rs/). Imajući u vidu da postoji samo jedna platforma slična našoj, a ona je koncentrisana isključivo na Američko tržište, prostor za širenje je ogroman. Nakon lansiranja u Srbiji, planirana je ekspanzija na teritoriju Balkana u naredne dve godine (Crna Gora, Hrvatska, Bosna i Hercegovina, Madjarska, Bugarska, Slovenija, Makedonija).', NULL, NULL),
(2362, 27, 1024, 'Problem rešavamo osobama koje su u potrazi za nekretninom, bilo da su to kupci ili agenti za nekretnine, i bilo da traže dom ili planiraju da investiraju u biznis izdavanja nekretnina. Potencijalni klijenti su punoletne osobe koje su u mogućnosti da kupe nekretninu sa motivom da svoj novac pametno ulože. Potencijalni strahovi klijenta su:\r\nDa li je cena nekretnine realna?\r\nDa li je uložen novac pametno investiran? \r\nDa li će zauzetost nekretnine biti zadvoljavajuća?\r\nKoji su troškovi održavanja i iznajmljivanja nekretnine?\r\nKoliki je mesečni prihod koja nekretnina može da ostvari?\r\nDa li je cena izdavanja u skladu sa tržišnom cenom?\r\nKolika je isplativost investicije?', NULL, NULL),
(2363, 28, 1024, 'Web aplikacija koju smo razvili vrši agregaciju oglasa nekretnina na jednom mestu i pruža jednostavan način filtriranja i pretrage, analizu tržišta kupoprodaje i rentanja nekretnina, kao i finansijsku analizu i projekciju investicije. Postoji samo jedan sličan proizvod našem, i on je koncentrisan isključivo na tržište SAD-a (mashvisor.com) i našim proizvodom želimo da pokrijemo ostatak tržišta.', NULL, NULL),
(2364, 30, 1024, 'Proces kupovine nekretnine se u najmanju ruku svodi na posetu 3 ili više sajtova za nekretnine (halooglasi.com, nekretnine.rs, 4zida.rs). Naša platforma vrši agregaciju ponuda sa ovih sajtova i omogućava istovremenu pretragu svih. Trenutno neki od tih sajtova pružaju osnovnu analizu tržišta cena, dok se detaljnija analiza može izvući iz Republičkog zavoda za statistiku i Republičkog geodetskog zavoda. Naša platforma kombinuje sve ove statistike na jednom mestu i daje jednostavan prikaz analize. Finansijski plan otplate se može dobiti na nekim od ovih sajtova, kao i na kredium.rs. S druge strane, analiza cena izdavanja može se izvući samo preko Airdna.com (koja trenutno nije dovoljno detaljna). Detaljna analiza investicija moguća je samo na mashvisor.com (koja je koncentrisana samo na SAD). Trenutno, ono što naša platforma pruža, može da se reši samo uz dosta mukotrpne manualne pretrage i komplikovane kalkulacije.', NULL, NULL),
(2365, 29, 1024, 'Naša platforma potencijalnim kupcima štedi vreme potrebno za prikupljanje podataka, analizu i kreiranje finansijskog plana. Pomaže klijentima da donesu bolju finansijsku odluku i samim tim im štedi novac / pravi potencijalno veću zaradu. Ovakav proizvod trenutno nije prisutan u našem regionu.', NULL, NULL),
(2366, 32, 1024, 'Trenutno ne postoji plataforma koja daje kopletno rešenje za investiranje u nekretnine. Delove je moguće realizovati na drugim sajtovima ali ne postoji načina za lako povezivanje svih elemenata u jednu celinu - pretraga, statistička analiza tržišta i konkurencije, finansijsko planiranje i projekcija.', NULL, NULL),
(2367, 37, 1024, 'Nismo razmišljali o ovome', NULL, NULL),
(2368, 40, 1024, 'Inicijalno, planiramo da naplaćujemo korišćenje platforme. \r\nNakon ostvarenog značajnog broja poseta sajtu planiramo da naplaćujemo prikupljanje potencijalnih klijenata (lead generation) partnerskim servisima (banke, agenti za nekretnine, advokati, agencije za izgradnju i renoviranje, urbanisti, agencije za upravljanje iznajmljivanjem). \r\nRazmatramo o mogućnosti razvijanja servisa za upravljanje nekretninama za iznajmljivanje, i ukoliko platforma dostigne dovoljnu posećenost u inostranstvu, i servis za posredovanje u medjunarodnoj kupovini nekretnina.', NULL, NULL),
(2369, 41, 1024, 'Kroz proteklih godinu i po dana razvili smo osnovnu funkcionalnost proizvoda i postavili plan za lansiranje, rast i dalji razvoj, izdvojili glavne KPI-eve i način za njihovo praćenje i evaluaciju.', NULL, NULL),
(2370, 44, 1024, '2012 (mislim) edukacija u okviru takmičenja za najbolju tehnološku inovaciju', NULL, NULL),
(2371, 45, 1024, 'Do sada nismo prikupili nikakav izvor finansiranja', NULL, NULL),
(2372, 48, 1024, 'Očekujemo podršku u razovju i praćenju biznisa, edukacija u polju investiranja, akcija i poveznaih pravnih pitanja.', NULL, NULL),
(2373, 49, 1024, 'U trenutnoj fazi potrebne su nam investicije za:\r\nOdržavanje sistema\r\nMarketing\r\nZapošljavanje radnika za podršku, marketing i prodaju\r\nPravne i računovodstvene troškove\r\n\r\nSmatramo da bi nam 15.000 EUR znatno pomoglo', NULL, NULL),
