(2422, 22, 1054, 'Nisam, ali imam iskustva u simulacijama startup kompanije, timskog rada, sastavljanje Business Plana i slično.', NULL, NULL),
(2423, 23, 1054, 'Imam poverenje u moju ideju i planirao sam da stupim u kontakt sa osobama i organizacijama koje mogu da mi pomognu da je ostvarim, pa sam naleteo na Raising Stars projekat i shvatio to kao priliku.', NULL, NULL),
(2424, 24, 1054, 'Food & Share.', NULL, NULL),
(2425, 25, 1054, 'Kao student koji je iz Jagodine, imam jako lošu ishranu u Beogradu. Menze su udaljene i zbog COVID 19 pandemije oslabljene, restorani su skupi, brza hrana je u redu ali jako nezdrava, često udaljena i skupa, a spremanje kod kuće je onemogućenl zbog loših uslova stana kog iznajmljujem i često u ovim situacijama se oslanjam, ja kao i drugi u mojoj poziciji na aplikacije poput Wolt-a i Glovoa. Fooder bi omogućio veći izbor hrane, jeftinije cene, direktno povezivanje mušterije i kuvara, ojačanje osećaja zajednice kao i prilike za zapošljavanje Nezaposlenim kuvarima amaterima. Ovo je ideja sa potencijalno globalnom primenom i zbog toga smatram da je izuzetno visok potencijal foodera.', NULL, NULL),
(2426, 26, 1054, 'Aplikacija Glovo je preuzeta 10+ miliona osoba, aplikaciju Wolt 5+ miliona, ovo ukazuje na veliki tržišni potencijal a mi bi ciljali, sa strane kupovine hrane ljude od 18-50 a sa strane zapošljavanja ta granica se još više povećava jer omogućava da stariji, koji imaju mnogo više godina iskustva u kuvanju, i koji se dosta teže zapošljavaju da budu sami svoj šef, da sami sebi određuju radno vreme i da pretvore svoju strast i hobi u posao i samim tim nahrane i sebe i druge.', NULL, NULL),
(2427, 27, 1054, 'Studentima, ljudi koji ne spremaju kod kuće, nezaposlenim ljudima koji znaju da kuvaju, ljudi koji kuvaju u slobodnom vremenu, zaposleni koji nemaju vreme da spremaju ručak. Ideja se jako svidela mojoj porodici i prijateljima, brojni su se oglasili kao potencijalni potrošači kao i potencijalni kuvari.', NULL, NULL),
(2428, 28, 1054, 'Aplikacija za android i iOS, omogućava potencijalno neograničen izvor obroka i direktno povezuje kuvare sa mušterijama.', NULL, NULL),
(2429, 30, 1054, 'Glovo, Wolt, brza hrana, spremanje kod kuće, restorani.', NULL, NULL),
(2430, 29, 1054, 'Direktno povezivanje, veći izbor, zdraviji izbor, pristupačnije cene, zapošljavanje, stvaranje zajednice.', NULL, NULL),
(2431, 32, 1054, 'Ukratko, ideja je kombinacija Uber modela sa Glovom, što stvara skroz novu uslugu koja je dovoljno poznata da bude prihvaćena ali dovoljno drugačija da bude svoja stvar.', NULL, NULL),
(2432, 37, 1054, 'Nismo', NULL, NULL),
(2433, 40, 1054, 'Reklame na aplikaciji, procenat od kuvara, procenat od mušterija.', NULL, NULL),
(2434, 41, 1054, 'Potpuno sam fokusiran na studije ali ovo je ideja koja je nastala još pre par godina i sada kad sam pri kraju studija, veća mi je želja da se potpuno posvetim ovome kao moj sledeći cilj.', NULL, NULL),
(2435, 44, 1054, 'Nisam', NULL, NULL),
(2436, 45, 1054, 'Nisam', NULL, NULL),
(2437, 48, 1054, 'Želeo bih da dobijem konkretnu pomoć, nekog ko može da me usmeri šta je sledeće i neko ko može da pruži praktične savete dok se ne naviknem na novu sredinu i dok ne nađem poslovnog partnera. Najviše mi je potrebna pomoć programerskog tima koji može da realizuje ideju, a nakon toga mentor u samom preduzetništvu jer su uvek dve glave pametnije od jedne.', NULL, NULL),
(2438, 49, 1054, 'Za realizaciju aplikacije, dizajn i slično samo troškovi zaposlenih, to bi bili fiksni troškovi koji verujem da nisu preveliki, ne mogu pretpostaviti tačno koliko trenutno.', NULL, NULL),
