(2441, 76, 1058, NULL, NULL, NULL),
(2442, 83, 1060, NULL, NULL, NULL),
(2443, 89, 1061, 'Završio srednju školu Gimnaziju Svetozar Marković u Jagodini, trenutno student četvrte godine Ekonomskog fakulteta u Beogradu, sve četiri godine na budžetu, rekreativno iskustvo kao muzičar sa nastupima na festivalima EXIT i Lovefest', NULL, NULL),
(2444, 90, 1061, 'Kreator ideje, u većoj meri posvećen, verujem u ideju ali u jako ranoj fazi je.', NULL, NULL),
(2445, 91, 1061, 'Završavam poslednju godinu studija tako da je to trenutno prvi prioritet ali spreman sam da se posvetim ovoj ideji jer verujem u njen uspeh.', NULL, NULL),
(2446, 71, 1063, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2447, 71, 1064, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
