(2450, 91, 1065, NULL, NULL, NULL),
(2451, 71, 1066, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2452, 63, 1067, 'Ice biotic je funkcionalni sladoledni dezert od kozjeg mleka obogaćen inulinom i probiotskim kulturama. Inovativni aspekt Ice biotic-a  je prisustvo probiotika koji pozitivno utiču na organizam, kao i inulina – prebiotika koji dovodi do povećanja efikasnosti imunog sistema i drugih benefita i vlakana koja podstiču varenje.', NULL, NULL),
(2453, 71, 1068, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2454, 17, 1069, 'Ice biotic je funkcionalni sladoledni dezert od kozjeg mleka obogaćen inulinom i probiotskim kulturama. Inovativni aspekt Ice biotic-a  je prisustvo probiotika koji pozitivno utiču na organizam, kao i inulina – prebiotika koji dovodi do povećanja efikasnosti imunog sistema i drugih benefita i vlakana koja podstiču varenje.', NULL, NULL),
(2455, 22, 1069, 'Kreiranje novog funkcionalnog proizvoda predstavlja prvi zajednički projekat gde su Jelena i Nikola doprineli definisanju tehnoloških svojstava i senzornih karakteristika, dok je Ksenija doprinela razvoju marketinških strategija, definisanju finansijskog plana, kao i biznis plana.', NULL, NULL),
(2456, 23, 1069, 'Ice biotic je nastao kao ideja promovisanja inovativnog i funkcionalnog proizvoda, do sada nepoznatog na našem tržištu. Koncept zdravog i u isto vreme ukusnog sladoleda dobio je mnoštvo pozitivnih kritika na nacionalnom takmičenju Ecotrophelia od strane stručnjaka, kako iz sveta tehnologije hrane, tako i iz sveta biznisa. Osvajanjem prvog mesta na pomenutom takmičenju prepoznat je potencijal koji ovaj proizvod može da pruži tržištu. Glavna motivacija prijave na ovaj program je želja za daljim razvojem ovog funkcionalnog sladolednog dezerta.', NULL, NULL),
(2457, 24, 1069, 'Ice Biotic, vaš sladoled superheroj!', NULL, NULL),
(2458, 25, 1069, 'Prehrambeni proizvodi sa probiotskim bakterijama zauzimaju važno mesto na tržištu, kako zbog pozitivnog uticaja na ljudsko zdravlje, tako i zbog odgovarajućeg senzornog kvaliteta proizvoda. Uzimajući u obzir količinu šećera, masti i kalorijske vrednosti, sladoled se ne smatra preterano zdravom namirnicom. Proizvodnjom Ice Biotic-a, dodatak gore pomenutih nutrijenata sveden je na minimum.', NULL, NULL),
(2459, 26, 1069, 'Jedna od ciljnih grupa kojoj bismo plasirali naš proizvod bi obuhvatila roditelje sa njihovom decom s obzirom na pozitivne aspekte koje kozje mleko ima na imuni sistem kako dece, tako i odraslih. Konzumiranje kozjeg mleka kod dece automatski utiče na povećanje fizičke aktivnosti, poboljšanje metabilizma.', NULL, NULL),
(2460, 27, 1069, 'Anketa je sprovedena s ciljem prikupljanja informacija o tržištu, potražnji za našim proizvodom, kao i spremnosti potrošača da kupe naš proizvod. Anketom je obuhvaćeno 427 ispitanika. Pokazalo se da je kod 71% ispitanika starosti između 25-40 godina prilikom kupovine prehrambenih proizvoda bitniji kvalitet od cene proizvoda. Rezultati su takođe pokazali da bi 76% ljudi koji se zdravo hrane i bave nekim vidom fizičke aktivnosti bili spremni da kupe naš proizvod.Anketa je takođe pokazala da je 70% ispitanika iskazalo preferenciju ka kozjem mleku nasuprot kravljem mleku.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(2461, 28, 1069, 'Postoje dve varijante Ice biotic-a: od kozjeg mleka, sa inulinom i ukusom vanile i od kozjeg mleka, sa inulinom i vlaknima uz dodatak suvih šljiva. U poređenju sa kravljim, kozje mleko ima viši nivo esencijalnih aminokiselina, nema teško svarljivih masti, pa je varenje lakše. Inulin i jabučna vlakna sadrže osobine prebiotika, selektivno stimulišući aktivnosti probiotskih bakterija u organizmu. Jabučna vlakna su nosilac ekoinovativnosti proizvoda jer se dobijaju od jabučnog tropa pri proizvodnji soka. Suve šljive kao dodatak jednoj verziji proizvodu daju zanimljiv izgled i voćnu aromu.Funkcionalnost proizvoda opravdana je ​dodatkom probiotske bakterije Lactoplantibacillus plantarum 299v.', NULL, NULL),
(2462, 30, 1069, 'Širi koncept konkurencije obuhvata sve proizvode na tržištu koji potrošačima zadovoljavaju slične potrebe kao naš proizvod. Među njima spadaju sokovi koji pomažu da se ljudi rashlade kada je vruće, razni slatkiši koji zadovoljavaju potrebu za unosom šećera, kao i svi sladoledi koji već postoje na tržištu. Osim već poznatih proizvođača kao što su Frikom, Froneri Adriatic, Swisslion i Ice Planet d.o.o., u konkurenciju sladoleda spadaju i zanatske poslastičarnice.\r\nSužavanjem konkurencije na proizvode koje imaju barem jednu od karakteristika koje ističemo u našem proizvodu, uža konkurenciju se svela na lepezu raznovrsnih sladoleda. Daljim sužavanjem dolazimo do najuže konkurencija koja predstava Frikom-ov proizvod Highlife.', NULL, NULL),
(2463, 29, 1069, 'Glavne prednosti Ice biotic-a u odnosu na ostale proizvode sličnih kategorija na tržištu je prisustvo probiotika koji pozitivno utiču na organizam, kao i inulina – prebiotika koji dovodi do povećanja efikasnosti imunog sistema i drugih benefita i vlakana koja podstiču varenje. Ekološka opravdanost ambalaže ogleda se u kartonskim čašicama u kojima bi se gotov proizvod služio i drvenim kašičicama kojim bi se konzumirao. Ovim načinom proizvodnje izbegava se upotreba plastičnih materijala koji utiču škodljivo po okolinu.', NULL, NULL),
(2464, 32, 1069, 'Sladoled je oduvek bio osvežavajuća poslastica koja rashlađuje i zadovoljava sva čula. Uzimajući u obzir količinu šećera, masti i kalorijske vrednosti, ovaj proizvod se ne smatra preterano zdravom namirnicom. Dodatkom probiotika i prebiotika, kao i smanjenjem sadržaja šećera, dobija se potpuno nov proizvod na našem tržištu, sa značajno poboljšanim karakteristikama u odnosu na konkurenciju.', NULL, NULL),
(2465, 37, 1069, 'Do sada se nismo bavili istraživanjima na temu zaštite intelektualne svojine, jer nismo dovoljno stručni u toj oblasti. Od ovog programa očekujemo stručnu podršku i pomoć.', NULL, NULL),
(2466, 40, 1069, 'Pametnim izborom lokacija postavljanja automata za proizvodnju, proizvod bi lakše privukao pažnju ciljnoj grupi potrošača.', NULL, NULL),
(2467, 41, 1069, 'Ideja o projektu nastala je u aprilu 2021. na Poljoprivrednom fakultetu u Beogradu, kada smo počeli ozbiljnije da se bavimo pojmom funkcionalne hrane. \r\nNaš cilj je bio da osmislimo proizvod koji će senzorno „oduvati“ potrošače, pri čemu će pružiti pozitivan uticaj na zdravlje. Sladoled je oduvek nosio etiketu „omiljenog slatkiša u toplim danima“, prilagođen je svim uzrastima i nikoga ne ostavlja ravnodušnim. Kroz rad u laboratoriji na fakultetu došli smo do saznanja da ovaj proizvod takođe strukturno predstavlja sjajan nosač probiotika i prebotika, čime je opravdana i njegova funkcionalnost. Na osnovu rezultata sprovedenih anketa, opredelili smo se za dve finalne verzije proizvoda: \r\nIce biotic od kozjeg mleka, sa inulinom i ukusom vanile \r\nIce biotic od kozjeg mleka, sa inulinom i vlaknima uz dodatak suvih šljiva\r\nNa takmičenju Ecotrophelia u junu ovaj proizvod osvaja prvo mesto i plasira se na evropsko takmičenje.', NULL, NULL),
(2468, 44, 1069, 'Nismo imali prilike.', NULL, NULL),
(2469, 45, 1069, 'Do sada nismo prikupili izvore finansiranja.', NULL, NULL),
(2470, 48, 1069, 'Od Raising Starts programa očekujemo pre svega stručnu podršku i pomoć u vidu  istraživanja tržišta, testiranja prvih kupaca, zaštite intelektualne svojine, oblasti sa kojima se do sada nismo susretali.', NULL, NULL),
(2471, 49, 1069, 'Trenutna faza razvoja proizvoda je na nivou ideje i nemamo realnu predstavu o finansijskim ulaganjima.', NULL, NULL),
