(2475, 83, 1075, NULL, NULL, NULL),
(2476, 89, 1076, 'Završio osnovne i master akademske studije na Poljoprivrednom fakultetu Univerziteta u Beogradu sa prosekom 9,20. Trenutno je na doktorskim studijama na istom fakultetu, a fokus doktorskog rada će biti ispitivanje probiotskih karakteristika bakterija izolovanih iz različitih vrsta tradicionalnih sireva. Ove godine je učestvovao na takmičenju Ecotrofelia, gde je sa svojim timom osvojio prvo mesto na nacionalnom takmičenju i predstavljao Srbiju na evropskom takmičenju Ecotrofelia.', NULL, NULL),
(2477, 90, 1076, 'Vođa tima. Uloga u razvoju startapa je definisanje tehnoloških i senzornih karakteristika proizvoda. Kreatori ideje su svi članovi tima. Tokom razvoja startapa bio je potpuno posvećen.', NULL, NULL),
(2478, 91, 1076, 'Doktorske studije, angažman zavisi od faze u kojoj se eksperiment nalazi.', NULL, NULL),
(2479, 89, 1077, 'Zavrsila osnovne akademske studije na Poljoprivrednom fakultetu Univerziteta u Beogradu. Trenutno je student master akademskih studija na istom fakultetu, smer mikrobiologija hrane i životne sredine. Ove godine je učestvovala na takmičenju Ecotrofelia, gde je sa svojim timom osvojila prvo mesto na nacionalnom takmičenju i predstavljala Srbiju na evropskom takmičenju Ecotrofelia.', NULL, NULL),
(2480, 90, 1077, 'Uloga u razvoju startapa je definisanje tehnoloških i senzornih karakteristika proizvoda. Tokom razvoja startapa bila je potpuno posvećena.', NULL, NULL),
(2481, 91, 1077, 'Student master studija.', NULL, NULL),
(2482, 89, 1078, 'Student četvrte godine na Ekonomskom fakultetu Univerziteta u Beogradu, na smeru Statistika. Ove godine je učestvovala na takmičenju Ecotrofelia, gde je sa svojim timom osvojila prvo mesto na nacionalnom takmičenju i predstavljala Srbiju na evropskom takmičenju Ecotrofelia.', NULL, NULL),
(2483, 90, 1078, 'Uloga u razvoju startapa je definisanje marketing, finansijskog i biznis plana. Tokom razvoja startapa bila je potpuno posvećena.', NULL, NULL),
