(2485, 71, 1079, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2486, 63, 1080, 'Softver unapređenja autopilota automobila sa hardverskim komponentama, odnosno senzorima za detektovanje opasnih situacija u saobraćaju i sistema za sprečavanje nezgode.', NULL, NULL),
(2487, 71, 1081, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2488, 17, 1082, 'Softver unapređenja autopilota automobila sa hardverskim komponentama, odnosno senzorima za detektovanje opasnih situacija u saobraćaju i sistema za sprečavanje nezgode.', NULL, NULL),
(2489, 22, 1082, 'Do sada smo radili zajedno na prethodnoj ideji u okviru Naučno Tehnološkog parka u Čačku koja nije uspela zbog prevelike konkurencije na tržištu. Tokom razvoja te ideje, došli smo do zajedničkog zaključka da je konkurencija na tržištu prevelika, i da je naš problem bio nedovoljno istraživanje tržišta na šta smo dosatno obratili pažnju razvijajući trenutnu ideju. Prethodna ideja nam je bila društvena mreža koja koristi NFC čipove koja bi poslovnim ljudima znatno olakšala ostvarivanje kontakta sa ljudima u okolini.', NULL, NULL),
(2490, 23, 1082, 'Analizirajući postojeće sigurnosne sisteme u automobilima, došli smo do zaključka da nijedan ne rešava problem ljudske greške u vožnji, koju bi idealno naš program ispravio u 98% slučajeva. Takođe nas je motivisao i zabrinjavajuća statistika da u 42% nezgoda sa fatalnim ishodom nastrada osoba koja nije bila kriva za situaciju koja se desila.', NULL, NULL),
(2491, 24, 1082, '\"The new era of safety\"', NULL, NULL),
(2492, 25, 1082, 'Problem koji mi rešavamo jesu situacije u saobraćaju gde ljudska greška izaziva 99% saobraćajnih nezgoda od kojih je 4.9% sa fatalnim ishodom (izvor: Republički zavod za statistiku Srbije). Drugi problem se javlja kod proizvođača koji nemaju resursa da bi dovoljno razvili ovu tehnologiju.', NULL, NULL),
(2493, 26, 1082, 'Izlazak na tržište smo podelili u dve faze.\r\nU okviru prve faze, ciljna grupa su nam startap kompanije i globalne kompanije koje se bave proizvodnjom automobila sa tehnologijom veštačke inteligencije kojih je danas sve više.\r\nDruga faza predstavlja razvijanje harverskog i softverskog rešenja za sve automobile koji nemaju uslova za ugradnju tog softvera, kao i ugradnja sistema na zahtev fizičkih lica.\r\n\r\nGlobalno tržište autopilot sistema je procenjeno na oko 5,2 milijardi dolara u 2020. godini, dok je predviđanje koje donosi MarketDataForcast.com dostizanje od oko 9,1 milijardu dolara u 2026. godini.\r\n\r\nNajveći udeo na ovo tržištu pripada Severnoj Americi i Evropi, a najbrže rastuće je u Aziji. Predviđa se da će do periodu do 2026. godine rasti po stopi od 8,4%.*\r\n\r\n*Preciznije ovo je Compound Annual Growth Rate (CAGR).\r\n\r\nTakođe, procenjeno je da će prednjačiti tržište autopilota za avione, dok će ga pratiti tržište razvoja autopilota za automobile koje je tek u povoju.', NULL, NULL),
(2494, 27, 1082, 'Problem rešavamo svim vozačima koji žele da se osećaju bezbedno u svakom trenutku vožnje. Jedna od stereotipa sigurnih vozača jeste da izbegavaju vožnju noću jer ne žele da dovedu sebe u opasnost od drugih vozača, čime sebe uskraćuju za određene aktivnosti ili događaje koje su mogli da posete. Takođe podstičemo startapove koji se bave proizvodnjom pametnih automobila da svoj fokus okrenu ka drugim delatnostima i tako za kraće vreme razviju kvalitetniji proizvod.', NULL, NULL),
(2495, 28, 1082, 'Naš proizvod predstavlja hardversko rešenje u vidu pametnih senzora koji u pozadini analiziraju okruženje automobila u dometu do čak 100 metara što skraćuje vreme reakcije za do 2 sekunde i čini ga efikasnim na brzinama preko 120 km/h u odnosu na posojeće sisteme koji su efikasni na samo 70 km/h. Takođe ovaj projekat sadrži i softver baziran na tehnologiji veštačke inteligencije i prikuplja i obrađuje podatke iz hardvera i izdaje mu komande. Njegove najznačajnije karakteristike su brzina reakcije odnosno efikasnost, cena i kvalitet.', NULL, NULL),
(2496, 30, 1082, 'Trenutni proizvodi na tržištu su nedostupni za 99% vozača jer automobili koji ih imaju koštaju više od 100.000 evra, a za ugradnju sličnog proizvoda moraju izdvojiti sredstva u visini cene automobila koji poseduju.', NULL, NULL),
(2497, 29, 1082, 'Kompanije kojima bismo prodavali licencu za proizvod mogu usmeriti svoj fokus na ostale aspekte proizvodnje automobila, a krajnjim kupcima odnosno vozačima bi doneo sigurnost u toku vožnje. Još jedan proizvod koji bi nastao iz primarnog proizvoda jesu obrađeni podaci koje bismo prodavali pravnim licima koji su trenutno ogroman problem kako automobilskim kompanijama, tako i kompanijama za statistiku i analizu u saobraćaju. Ovaj manji deo projekta može činiti čak četvrtinu predviđenih prihoda Startapa.', NULL, NULL),
(2498, 32, 1082, 'Naš tim svoju prednost vidi u uskoj specijalizaciji u razvoju autopilota zasnovanog na veštačkoj inteligenciji.  Tim će svoje resurse usmeriti na razvoj ove komponente automobila budućnosti, što bi proizvod učinio daleko jeftinijim nego da ga firme same razvijaju. Očekujemo da dođe do vertikalne integracije u proizvodnji, tj. da startap firme koje proizvode moderne automobile kooptiraju Ares Development.', NULL, NULL),
(2499, 37, 1082, 'Što se tiče zaštite intelektualne svojine, imamo u planu da zaštitimo tehnologiju koju koristimo za razvoj ovog softvera i hardvera jer ona još uvek nije korišćena u ove svrhe.', NULL, NULL),
(2500, 40, 1082, 'Zarada startapa se deli na B2B i B2C prodaju. B2B prodaja obuhvata izdavanje licence za korišćenje softvera i ugradnja hardverskih uređaja, kao i planiranu prodaju podataka čija je potražnja na tržištu znatno veća nego ponuda. Primer zarade od podataka možemo uzeti od grupe kompanija FANG (Facebook, Amazon, Netflix i Google) koje jedan sat podataka plaćaju u proseku $50. B2C prodaja će se vršiti tokom druge faze razvoja gde će naš prozivod moći da kupe i fizička lica.', NULL, NULL),
(2501, 41, 1082, 'Nikolina i Anđelijina startap priča zvanično počinje decembra 2020. godine kada smo počeli da razvijamo prvi projekat proizvodnje NFC čipova koji predstavljaju digitalnu vizit kartu u okviru Naučno tehnološkog parka u Čačku. Nakon 9 meseci razvoja, projekat je zaustavljen zbog prevelike konkurencije i veličine tog tržišta. Avgusta 2021. godine startap tim počinje da radi na trenutnoj ideji. Tokom istraživanja ideje imali smo podršku instituta za tehnologiju \"CalTech\" koji nam je obezbedio sve potrebne podatke u vezi projekta, a početkom decembra smo počeli saradnju sa eksternim konsultantom, Nenadom Jevtovićem, u polju finansija i preduzetništva.', NULL, NULL),
(2502, 44, 1082, 'Ovo nam je prvi program podrške startapovima na koji se prijavljujemo.', NULL, NULL),
(2503, 45, 1082, 'Nismo, sve dosadašnje troškove (izrada web sajta, domen, hosting, licence) smo nansirali lično.', NULL, NULL),
(2504, 48, 1082, 'Od ovog programa očekujemo dobijanje podrške u oblastima finansija, b2b poslovanja i standardizacije.', NULL, NULL),
(2505, 49, 1082, 'Trenutna faza razvoja zahteva nabavku hardverskih komponenti i plaćanje licenci za softvere koji ćemo koristiti u toku razvoja.', NULL, NULL),
