(2509, 83, 1088, NULL, NULL, NULL),
(2510, 89, 1089, 'Student druge godine fakulteta tehničkih nauka u Čačku, softverski inženjer sa dve godine iskustva. Ova ideja mu je treća ideja po redu. Iz prva dva neuspeha stekao je iskustva za koje je siguran da će mu pomoći na daljim projektima, ali i veštine koje su mu potrebne kako bi radio na ovom projektu. Takođe je i član startap ekosistema Naučno tehnološkog parka u Čačku dve godine gde je stekao znanja u oblasti Startap kompanija i razvoja startap ideja.', NULL, NULL),
(2511, 90, 1089, 'Kreator ideje, član koji će biti posvećen u potpunosti. Uloga u timu je CEO odnosno koordinisanje razvoja projekta, upravljanje resursima, ali i uloga CTO-a u vidu softverskog inženjera koji će raditi na razvoju projekta.', NULL, NULL),
(2512, 91, 1089, 'Part-time software developer u Lufthansa avio kompaniji i student Fakulteta tehničkih nauka u Čačku.', NULL, NULL),
(2513, 89, 1090, 'Završna godina studija na Fakultetu tehničkih nauka u Čačku na smeru informacione tehnologije, aktivna članica studentske organizacije AIESEC i bitan član studentskog parlamenta fakulteta. Član startap tima od druge ideje na kojoj je radila sa Nikolom, gde su zajedno stekli iskustva i veštine na osnovu neuspeha koji je doživeo njihov projekat.', NULL, NULL),
(2514, 90, 1090, 'U velikoj meri posvećena, uloga ovog člana će biti CDO, odnosno osoba odgovorna za menadžment razvoja projekta, testiranje kvaliteta proizvoda i koordinisanje budućim članovima tima.', NULL, NULL),
(2515, 91, 1090, 'Student završne godine Fakulteta tehničkih nauka u Čačku.', NULL, NULL),
(2516, 71, 1093, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2517, 71, 1094, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2518, 71, 1096, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2519, 89, 1097, 'Softverski inženjer sa 8+ godina iskustva. Fleksibilan za korišćenje širokog spektra programskih jezika (Кotlin, Java, Svift, Objective-C, C, C#) i različitih platformi i okvira. Poslednje tri godine fokusiran na razvoj tima i strategije razvoja kompanije. Pored toga, aktivno angažovan sa menadžerskim timom na definisanju procedura kao što su onboarding, offboarding, definisanje kriterijuma za pozicioniranje u samoj kompaniji, beneficije zaposlenih, platni razredi i organizacija prakse.\r\nApsolvent Visoke Škole Elektrotehnike i Računarstva.\r\nUčestvovao u razvoju aplikacije Insta car quiz i kompanije Justicija DOO.', NULL, NULL),
