(2522, 89, 1098, 'Obrazovanje: \r\nOsnovne i master studije:\r\ninzenjer elektrotehnike i racunarstva\r\nElektrotehnicki fakultet, Beograd\r\nSrednja skola:\r\nMatematicka gimnazija, Beograd\r\nRadno iskustvo:\r\nMaxeler, Beograd\r\nGoogle, Cirih\r\nTomTom, Beograd\r\nRho Business Banking, Beograd (trenutno zaposlenje)', NULL, NULL),
