(2525, 89, 1099, 'Apsolvent demografije na geografskom fakultetu. Regrutacijom, selekcijom i razvojem ljudskih resursa u oblasti se bavi od 2015. godine. Prethodno radio u na Prointer ITSS, Energosoft ITSS kao i marketinškoj agenciji Evoke, kao specijalista za regrutaciju i razvoj zaposlenih. Osnivač Friendly HR agencije za zapošljavanje.', NULL, NULL),
