(2528, 89, 1100, 'Diplomirani ekonomista (Ekonomski fakultet u Beogradu)\r\nPrethodno radio u Japan Tobacco International (Finansijsko planiranje i kontrola za region Adriatice - centrala Beograd, a potom implementacija SAP Hane u Madridu na globalnom nivou).\r\nOsnivač Friendly HR agencije za zapošljavanje.', NULL, NULL),
(2529, 90, 1100, 'Potpuno posvećen - sva četri člana tima su kreatori ideje', NULL, NULL),
(2530, 91, 1100, 'Drugi posao - Friendly HR (full time)', NULL, NULL),
(2531, 63, 1105, 'Naša inovativna ideja zasniva se na objedinjavanju više funkcija u jedinstvenu celinu - multifunkcionalnu nadstrešnicu. Ova celina sastavljena je od više različitih segmenata. Neposredno ispod nadstrećnice bi se nalazili elementi za odlaganje reciklažnog otpada u čijoj neposrednoj blizini bi se nalazile bicikle za čije bi korišćenje bilo neophodno da korisnik prvo odloži određenu količinu reciklažnog otpada u predviđene prostore za odlaganje. Tako bi se građani  podstakli da je zdravije i ekonomičnije voziti bicikl koji za sobom ne ostavlja izduvne gasove i ne zagađuje vazduh i životnu sredinu, a ujedno je i odličan vid rekreacije koja se preporučuje za očuvanje kondicije i zdravog načina života. Sama nadstrešnica bi na jednom delu sadržala integrisani solarni panel koja bi sunčevu energiju upotrebljavao za napajanje rasvete koja se nalazi na donjoj površini nadtrešnice. Takođe, sadržala bi i integrisan sistem za prikupljanje i usmeravanje kišnice u predviđeni podzemni horizontalni rezervoar za vodu. Ta sakupljena voda bi kasnije, u toku sušnijeg perioda, mogla da se koristi za navodnjavanje već postojećeg zelenila.', NULL, NULL),
(2532, 71, 1106, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2533, 17, 1107, 'Naša inovativna ideja zasniva se na objedinjavanju više funkcija u jedinstvenu celinu - multifunkcionalnu nadstrešnicu. Ova celina sastavljena je od više različitih segmenata. Neposredno ispod nadstrećnice bi se nalazili elementi za odlaganje reciklažnog otpada u čijoj neposrednoj blizini bi se nalazile bicikle za čije bi korišćenje bilo neophodno da korisnik prvo odloži određenu količinu reciklažnog otpada u predviđene prostore za odlaganje. Tako bi se građani  podstakli da je zdravije i ekonomičnije voziti bicikl koji za sobom ne ostavlja izduvne gasove i ne zagađuje vazduh i životnu sredinu, a ujedno je i odličan vid rekreacije koja se preporučuje za očuvanje kondicije i zdravog načina života. Sama nadstrešnica bi na jednom delu sadržala integrisani solarni panel koja bi sunčevu energiju upotrebljavao za napajanje rasvete koja se nalazi na donjoj površini nadtrešnice. Takođe, sadržala bi i integrisan sistem za prikupljanje i usmeravanje kišnice u predviđeni podzemni horizontalni rezervoar za vodu. Ta sakupljena voda bi kasnije, u toku sušnijeg perioda, mogla da se koristi za navodnjavanje već postojećeg zelenila.', NULL, NULL),
(2534, 22, 1107, 'Pet godina radimo kao tim na fakultetu i svakodnevno rešavamo sve probleme i zadatke koji su pred nama. Takođe, članovi tima RMR PRO BONO na Hakatonu \"Napredne tehnologije u službi ekologije\"', NULL, NULL),
(2535, 23, 1107, 'Pre svega ideja da damo doprinos za očuvanje životne sredine, da naše okruženje stvorimo boljim i zdravijim za život. Ovogodišnje učešće na Hakatonu \"Napredne tehnologije u službi ekologije\" dalo nam je još veći podstrek za nastavak razvitka naše ideje i želju za realizacijom iste.', NULL, NULL),
(2536, 24, 1107, 'Recikliraj i kreni dalje ka svom cilju!', NULL, NULL),
(2537, 25, 1107, 'Sve smo više svesni problema globalnog zagađenja vazduha i decenijskog stagniranja po pitanju rešavanja istog, iz ličnih istustava kao i svakodnevno od strane medija. Razumemo da je teško doći do potpunog rešenja problema jer su navike i potrebe ljudi teško promenljive ali smatramo da postoji mogućnost za doprinos u rešavanju ovog problema. Osim toga, prepoznati problem čini i nezainteresovanost građana za učešće u rešavanju globalnog problema  te se naša ideja, između ostalog, zasniva na buđenju svesti kod građana da svako može i treba da pruži svoj doprinos i da tako zajedno dođemo do zacrtanog, željenog cilja za opšte dobro svih nas.', NULL, NULL),
(2538, 26, 1107, 'Ciljano tržište može biti kako lokalno i regionalno, tako i međunarodno i svetsko. Proizvod bi bio pre svega plasiran lokalnim i regionalnim vlastima, a imao bi i potencijala da se plasira na međunarodnom tržištu. U naredne dve godine vidi se potencijal geografskog širenja biznisa na tržište zemalja regiona (zemlje Balkana).', NULL, NULL),
(2539, 27, 1107, 'Realnizacijom ovog projekta doprinosi rešenju globalnog problema čijom upotrebom svaki građanin ima benefit nezavisno od činjenice da li lično koristi proizvod ili ne. Potencijalne kupce bi činile gradske opštine koje bi u okviru programa za očuvanje životne sredine mogle da implementiraju ovaj proizvod u svoju urbanu strukturu. Osim toga, proizvod bi se plasirao i velikim razvijenim kompanijama koje bi u okviru svog kompleksa implementirale proizvod namenjen korišćenju zaposlenih. Potencijalni korisnici bi bili građani, fizičko-aktivno stanovništvo, a pre svega mladi koji će se učiti da na pravi način odlažu otpad, a zauzvrat dobiju mogućnost za korišćenje bicikala koje se nalaze u sklopu sistema. Vršile smo istraživanje i intervju sa ciljem saznanja o potrebama stanovnika i nedostataka u njihovom životnom okruženju. Ono je naglasilo je da su glavni problemi nedostatak prostora za odlaganje otpada, nepostojanje sistema za regulisanje kišnice i nedovoljno sadržaja za rekreaciju.', NULL, NULL),
(2540, 28, 1107, 'Nadstrešnica  je sastavljena od više različitih segmenata. Ispod nje bi se nalazili elementi za odlaganje reciklažnog otpada pored  kojih bi se nalazile bicikle za čije bi korišćenje bilo neophodno da korisnik odloži određenu količinu otpada u predviđene prostore. Nadstrešnica bi na jednom delu sadržala solarni panel koja bi sunčevu energiju upotrebljavao za napajanje rasvete. Sadržala bi i  sistem za prikupljanje i usmeravanje kišnice u podzemni rezervoar za vodu. Ona bi mogla da se koristi za navodnjavanje postojećeg zelenila. Koristile bismo IoT tehnologiju koja bi podrazumevala  senzore putem kojih se prati odlaganje otpada kao i sistem za lociranje pozajmljenih bicikala.', NULL, NULL),
(2541, 30, 1107, 'Potencijalnim korisnicima su ovakvi slični sadržaji već dostupni ali ne na ovaj način kako bi funkcionisao naš inovativni sistem. U gradovima se ovakvi elementi koriste parcijalno ali neretko ne na adekvatan način za kakav su namenjeni ili nisu dovoljno zastupljeni u urbanim strukturama pa samim tim ne podstiču građane za masovnu upotrebu.', NULL, NULL),
(2542, 29, 1107, 'Inovativnost našeg proizvoda ogleda se u celokuplom objedinjavanju različitih funkcija u jedinstvenu celinu koja pruža mnogobrojne benefite a bila bi jednostavna za korišćenje i lako dostupna svima širom gradova. Proizvod bi imao ulogu u rešavanju problema nedovoljnog kapaciteta za odlaganje otpada, doprineo bi smanjenju CO2 kao i drugih štetnih izduvnih gasova, redukovao bi upotrebu automobila i sanirao problem nepostojanja adekvatnih sistema za odvođenje kišnice na mestima gde se proizvod implementira.', NULL, NULL),
(2543, 32, 1107, 'Poboljšanje postojećeg proizvoda ogleda se u postojanju jedinstene celine koju predstavlja multifunkcionalna nadstrešnica koja objedinjuje različite funkcije značajne za napredak u rešavanju već postojećih problema koji se javljaju u gradovima. Smatramo da bi naš inovativni proizvod podstakao građane da u što većem broju na pravilan način odlažu otpad, utiču na redukovanje vožnje automobila i ostalih motornih vozila i tako ujedno smanjuju ispuštanje štetnih gasova i zagađivanje okoline. Takođe, naš proizvod bi, uz pomoć solarnih panela smanjio potrošnju električne energije i tako ujedno smanjio iznos računa u gradovima. Ujedno, vožnja bicikala bi pozitivno uticala i na zdravlje korisnika, poboljšala njihovu kondiciju i želju za zdravijim i ekonomičnijim načinom života.', NULL, NULL),
(2544, 37, 1107, NULL, NULL, NULL),
(2545, 40, 1107, 'Naš startap planira da pre svega zarađuje prodajom ovog proizvoda gradskim opštinama i lokalnim samoupravama koje bi sistem implementirale u svoju urbanu strukturu u okviru programa za očuvanje životne sredine.', NULL, NULL),
(2546, 41, 1107, 'Naš tim nastao je spontano, pre pet godina, a uz svakodnevni rad i konsultacije razvijale smo mnogobrojne ideje. Konkretno, ova ideja postojala je već duži vremenski period ali se u poslednjih par meseci iskristalisala i dobila svoj oblik za dalju i detaljniju razradu. Našu ideju prikazale smo po prvi put na ovogodišnjem Hakatonu naprednih tehnologija u službi ekologije i imala je pozitivne kritike. Miloš Stojiljković, arhitekta i preduzetnik (Selling ideas) izrazio je svoj stav rekavši da ideja ima potencijal za razvoj startapa i da bi njena realizacija imala višestruko korisno dejstvo.', NULL, NULL),
(2547, 44, 1107, 'Učešće na ovogodišnjem Hakatonu napredne tehnologije u službi ekologije na Naučno-tehnološkom parku u Nišu. \r\nRad sa mentorima: Miloš Stojiljković (arhitekta i preduzetnik, Selling Ideas), Vesela Tanasković Gasner (arhizekta, ekološki aktivista, preduzetnik), Jelena Rudić (udruženje Fabrike umetnika)', NULL, NULL),
(2548, 45, 1107, NULL, NULL, NULL),
(2549, 48, 1107, 'Pre svega očekujemo pomoć i podršku stručnog kadra u razradi ideje, usmeravanje ka pravom putu u realizaciji projekta. Smatramo da nam je najpotrebnija podršta u fazi tehničke razrade kao i pomoć u pogledu finansiranja i plasiranje proizvoda na tržište.', NULL, NULL),
(2550, 49, 1107, 'Smatramo da je za trenutnu fazu potrebno prikupiti između 2000 i 4000 evra za angažovanje inženjera Elektrotehnike koji bi pomogli u razradi programa koji bi kontrolisao funkcionisanje proizvoda kao i angažovanje inženjera Građevine koji bi proverio statičku stabilnost same nadstrešnice i mogućnost izvođenja iste. Takođe, novčana sredstva bi bila neophodna za marketing i plasiranje proizvoda do ciljnih grupa.', NULL, NULL),
(2551, 52, 1107, NULL, NULL, NULL),
(2552, 66, 1110, NULL, NULL, NULL),
(2553, 76, 1111, NULL, NULL, NULL),
(2554, 83, 1113, NULL, NULL, NULL),
(2555, 89, 1114, 'Student završne, pete godine integrisanih studija na Građevinsko-arhitektonskom fakultetu u Nišu, odsek Arhitektura. Učesnik Hakatona 2021.', NULL, NULL),
(2556, 90, 1114, 'Kreator ideje - potpuno posvećena razvoju startapa, osnivač', NULL, NULL),
(2557, 91, 1114, 'Integrisane akademske studije, peta, završna godina - potpuno posvećena studijama', NULL, NULL),
(2558, 89, 1115, 'Student završne, pete godine integrisanih studija na Građevinsko-arhitektonskom fakultetu u Nišu, odsek Arhitektura. Završena praksa u UnitDesign studiju u trajanju od dva meseca. Učesnik Hakatona 2021.', NULL, NULL),
