(2581, 49, 1119, 'Smatramo da je za trenutnu fazu potrebno prikupiti između 2000 i 4000 evra za angažovanje inženjera Elektrotehnike koji bi pomogli u razradi programa koji bi kontrolisao funkcionisanje proizvoda kao i angažovanje inženjera Građevine koji bi proverio statičku stabilnost same nadstrešnice i mogućnost izvođenja iste. Takođe, novčana sredstva bi bila neophodna za marketing i plasiranje proizvoda do ciljnih grupa.', NULL, NULL),
