(2593, 63, 1129, 'Virtualancer je prva domaća online platforma frilens poslova u Srbiji. Želimo da ujedinimo sve internet radnike sa teritorije Srbije na jednoj radnoj platformi i omogućimo im zakonski status, bolje ekonomske uslove i pristup velikoj bazi frilens poslova domaćih partnerskih firmi kao i kompanija iz Srpske dijaspore.', NULL, NULL),
(2594, 71, 1130, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2595, 17, 1131, 'Virtualancer je prva domaća online platforma frilens poslova u Srbiji. Želimo da ujedinimo sve internet radnike sa teritorije Srbije na jednoj radnoj platformi i omogućimo im zakonski status, bolje ekonomske uslove i pristup velikoj bazi frilens poslova domaćih partnerskih firmi kao i kompanija iz Srpske dijaspore.', NULL, NULL),
(2596, 22, 1131, 'Ne', NULL, NULL),
(2597, 23, 1131, 'Želja za novim iskustvima i kontaktima iz startap ekosistema Srbije kao i želja za stalnim unapređenjem veština i validacijom poslovnog koncepta.', NULL, NULL),
(2598, 24, 1131, 'za novu/digitalnu Srbiju', NULL, NULL),
(2599, 25, 1131, 'Želimo da rešimo pravni i poreski status frilens radnika u Srbiji  stvaranjem nacionalne platforme frilens poslova i stavljanjem njihovih zarada u legalne tokove. Ovaj problem postoji globalno zato što Američki Upwork koji zapošljava najveći broj frilens radnika ne podleže lokalnim zakonima samim tim dolazi do propusta u poreskoj administraciji velikog broja država. Sa ovim problemom smo upoznati skoro jednu deceniju obzirom da je jedan od osnivača platforme u svetu frilensinga od 2012 a protesti internet radnika i formiranje udruženja su doveli do medijske izloženosti ovog problema.', NULL, NULL),
(2600, 26, 1131, 'Srbija\r\n74.000 frilensera prema analizi Centra za istraživanje javnih politika (https://publicpolicy.rs/publikacije/bac4e207bba2e8a9fa84e063c954710e02b375ce.pdf)\r\n424.040 aktivnih firmi prema registru APR-a (https://www.apr.gov.rs/%d0%bf%d0%be%d1%87%d0%b5%d1%82%d0%bd%d0%b0.3.html)\r\nPlan ekspanzije: Bosna, Crna Gora', NULL, NULL),
(2601, 27, 1131, 'Muškarac, starosti od 30 do 40 godina, fakultetskog obrazovanja, nezoposlen. Angažovan u radu putem globalnih platformi duže od 5 godina najčešće pružajući IT usluge. Aktivan na platformi usled nemogućnosti stalnog zaposlenja i fleksibilnosti radnog vremena. Zaposlen 12 meseci u godini, radi u proseku od 30 do 40 sati nedeljno, uglavnom putem Upwork platforme i to mu predstavlja osnovni izvor prihoda. Za potrebe istraživanja NALED-a korišćen je polustrukturirani upitnik sa ukupno 50 pitanja. Upitnik je distribuiran putem društvenih mreža u saradnji sa Paušal.rs, Upwork, Payoneer i Digitalnom Zajednicom. Uzorak od 837 ispitanika, 608 ispitanika radi putem virtualnih platformi, veliki broj ispitanika je predao prazan upitnik, njihovim isklkjučivanjem dobijamo uzorak od 480 ispitanika čiji odgovori ulaze u uzorak ankete. \r\nIzvor: https://www.naled.rs/htdocs/Files/06136/Nalazi-online-ankete-sa-frilenserima.pdf', NULL, NULL),
(2602, 28, 1131, 'Web platforma za friles poslove (PHP, Laravel). Ključna diferencijacija u odnosu na globalne platforme je što bismo edukovali, lokalizovali i legalizovali frilens tržište Srbije, ponudili podršku personalnih agenata prilikom odabira kandidata i omogućili bolje ekonomske uslove korišćenjem platforme.', NULL, NULL),
(2603, 30, 1131, 'Srpski frilenseri trenutno nemaju rešenje ovog problema, zaposleni su putem Upwork platforme kao fizička lica, pretežno za strane poslodavce, nemaju regulisan status u Srbiji, novac podižu putem Pay Pal-a i Payoneer-a, plaćaju visoke provizije na odrađene poslove ali i za konverziju novca i u 99,7% slučaja ne plaćaju porez državi Srbiji.', NULL, NULL),
(2604, 29, 1131, 'Benefiti za frilensere:\r\n\r\n•	Najveća baza freelance poslova, informacija o freelance industriji i poslodavcima u Srbiji i dijaspori\r\n•	Pristup mreži saradnika, klijenata i otvoranje novih poslovnih prilika\r\n•	Edukacija (Besplatni kursevi, Paneli, Webinari, Seminari, Radionice, Praksa)\r\n•	Lako do prvih poslova\r\n•	Niže provizije na odrađene poslove\r\n•	Transparentnost prilikom plaćanja poreza\r\n•	Isplata zarade na dinarski račun\r\n•	Virtualancer loyalty club\r\n\r\nBenefiti za poslodavce:\r\n\r\n•	Niže provizije na oglašavanje\r\n•       Otklanjanje jezičke barijere (Srpski frilenseri i Srpski poslodavci)\r\n•	Podrška u izboru kandidata kroz sistem dodele personalnog agenta\r\n•	Saradnja sa državnim institucijama\r\n•	Baneri na platformi\r\n•	Newsletter marketing', NULL, NULL),
(2605, 32, 1131, 'Postoje platforme koje su globalno jako uspešne. Tehničke prednosti Virtualancer platforme su:\r\n\r\n•	Dinarski platni promet\r\n•	Automatizovan sistem naplate poreza (uvezivanje računa poreske uprave sa automatizovanim  sistemom naplate poreza putem Virtualancer platforme) \r\n•	Podrška personalnih agenata prilikom odabira kandidata\r\n•	Baneri', NULL, NULL),
(2606, 37, 1131, 'Virtualancer je slobodno ime. Platforma ne može biti patentirana. Možemo pristupiti zaštiti logotipa.', NULL, NULL),
(2607, 40, 1131, '•	Paketi za oglašavanje poslodavaca\r\n•	Provizija na odrađene poslove frilensera\r\n•	Baneri/Newsletter marketing\r\n•	Članarine', NULL, NULL),
(2608, 41, 1131, 'Ideja Virtualancer platforme je nastala iz ličnog iskustva Tomislava koji je radeći kao frilenser za različite\r\ninostrane kompanije primetio nagli porast Srpskih frilensera na globalnim platformama. Prekretnice:\r\n\r\n2019\' Analiza poslovnog okruženja\r\n2019\' Pravna osnova\r\n2019\' IT Consulting\r\n2020\' Kreiranje alfa verzije produkta\r\n2020\' Kreiranje beta verzije produkta\r\n2020\' Testiranje platforme\r\n2020\' Stvaranje zajednice od 1000 frilensera\r\n2021\' Onboarding Stefan Gajić (partner/project manager)\r\n2021\' Business plan, pitch deck', NULL, NULL),
(2609, 44, 1131, 'Ne', NULL, NULL),
(2610, 45, 1131, 'Ne', NULL, NULL),
(2611, 48, 1131, 'Pravno savetovanje, MVP produkt, Onboarding novih članova iz NTP mreže, Strane investitore\r\n\r\nPolja podrške:\r\n\r\n•	Mentorstvo\r\n•	Pomoć u revidiranju poslovne dokumentacije i uspostavljanju kontakta sa investitorima\r\n•	Pomoć pri uspostavljanju kontakta sa Ministarstvom Privrede i Razvojnim agencijama u cilju pronalaska sponzora/investitora/bespovratnih sredstava kojim bi podržali projekat prve frilens platforme u Srbiji\r\n•	Pomoć pri uspostavljanju kontakta sa Ministarstvom Finansija u cilju kreiranja protokola legalizacije poreskih davanja od frilens poslova u Srbiji kroz platformu Virtualancer\r\n•	Pomoć pri uspostavljanju kontakta sa Narodnom Bankom Srbije u cilju savetovanja na temu plaćanja putem platforme (Dinarsko, Devizno, PayPal, Payoneer)\r\n•	Pomoć pri uspostavljanju kontakta sa Srpskim firmama u dijaspori koje bi se oglašavale na platformi\r\n•	Medijska izloženost', NULL, NULL),
(2612, 49, 1131, '15.000e\r\n•	Pravni poslovi (Osnivanje kompanije, Zaštita intelektualne svojine)\r\n•	IT konsultacije (Uvezivanje novih metoda plaćanja, Redizajn platforme, Otklanjanje grešaka)\r\n•	Nabavka opreme\r\n•	Zapošljavanje\r\n•	Marketing', NULL, NULL),
