(2617, 89, 1138, 'IV stepen (SSS), direktor i osnivač brenda I Scream Rolls,\r\nAktivno se bavim preduzetništvom šest godina kao osnivač i izvršni direktor kompanije u čijem se vlasništvu nalazi domaći fun food brend I Scream Rolls koji u svom portfoliu broji tri reatail lokacije u Beogradu (TC Ušće, TC Delta City, Terazije) i tri nacionalne retail franšize (Čačak, Kraljevo, Valjevo). Radio sam na poslovima uspostavljanja i implementacije franšiznog modela u Srbiji i Norveškoj kroz kreiranje poslovne dokumentacije (biznis plan, operativni priručnik, priručnik za trening osoblja) preko pravnih poslova i regrutacije osoblja pa sve do poslova kreiranja međunarodnih marketing kampanja i kontrole mreže saradnika. U sklopu matične kompanije u Srbiji sam se bavio i poslovima uvoza, prodaje, posredovanja i rentiranja aparata za potrebe domaćeg tržišta.', NULL, NULL),
(2618, 90, 1138, 'Osnivač\r\nIzvršni direktor\r\nPotpuno posvećen', NULL, NULL),
(2619, 91, 1138, 'Student, Visoka turistička škola, Apsolvent (zaključno sa 01.02.2022 prestaju moje obaveze na fakultetu)', NULL, NULL),
(2620, 89, 1139, 'III stepen (NSS), (SEO , Web administrator, Administrator društvenih mreža, Internet marketing)\r\nPosedujem devetogodišnje međunarodno iskustvo u digitalnom marketingu, SEO optimizaciji, Web administraciji i Internet oglašavanju. Održavanje optimizovanosti sajta, konstantna pretraga najvažnijih ključnih reči, posete sajta, novi korisnici, reporting u Google Analytics su samo neki od svakodnevnih aktivnosti u pređašnjim kompanijama. Kao administrator društvenih mreža sam radio na postavci I održavanju profila, kreiranju kampanja, sadržaja I oglašavanju. Poslove Web administratora sam pretežno obavljao na e-commerce platformama uz svakodnevno ažuriranje tekstova, proizvoda, cena, banera kao i pravljenja SKU kodova proizvoda.', NULL, NULL),
(2621, 90, 1139, 'Osnivač\r\nMarketing direktor\r\nPotpuno posvećen', NULL, NULL),
