(2623, 71, 1142, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2624, 63, 1143, 'Turistička aplikacija za pametne telefone uz pomoć koje bi korisnik na zanimjiv alternativni način istraživao grad/turističku destincaiju prateći istinitu istorijsku/kulturnu/ljubavnu/mitsku... priču i uz definisanu putanju rešavao niz zadataka/zagonetki koje bi mu omogućavale da prođe kroz celu priču. Ovakvim pristupom korisnicima aplikacije bi bilo zanimljivo da se šetaju gradom rešavajući mini probleme, a saznali bi mnogo više o kulturnim i istorijskim sadržajem grada.', NULL, NULL),
(2625, 71, 1144, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2626, 17, 1145, 'Turistička aplikacija za pametne telefone uz pomoć koje bi korisnik na zanimjiv alternativni način istraživao grad/turističku destincaiju prateći istinitu istorijsku/kulturnu/ljubavnu/mitsku... priču i uz definisanu putanju rešavao niz zadataka/zagonetki koje bi mu omogućavale da prođe kroz celu priču. Ovakvim pristupom korisnicima aplikacije bi bilo zanimljivo da se šetaju gradom rešavajući mini probleme, a saznali bi mnogo više o kulturnim i istorijskim sadržajem grada.', NULL, NULL),
(2627, 22, 1145, 'Kao tim nismo sarađivali ni na jednom zajedničkom projektu do sada. Predrag i Maja su sarađivali prilikom izrade Web sajtova.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(2628, 23, 1145, 'Kao početnici sa preduzetničikm duhom smatramo da nam pored sredstava za uspešan projektak treba i znanje od ljudi koji su stručni u tome i koji svojim iskustvom mogu da nam pomognu da imamo pravi smer kretanja tokom razvoja, testiranja i plasiranja proizvoda na tržište.', NULL, NULL),
(2629, 24, 1145, 'Uđi u priču', NULL, NULL),
(2630, 25, 1145, 'Mladi ljudi koji putuju retko stižu da se dublje upoznaju sa gradom koji posećuju, informacije dobijaju direktno od svog hosta ili putem interneta pretražujući razne sajtove sa često jako sličnim uopštenim informacijama. Neki od njih odlaze na uglavnom dobro organizovane Free Walking ture, ali koje su u tačno zakazano vreme i izvan sezone nisu svakog dana. \r\nNašom aplikacijom bismo omogućili turistima da izabare svoju walking turu kroz grad kada god požele.', NULL, NULL),
(2631, 26, 1145, 'Ciljana grupa su svi turisti koji posećuju Beograd, ali i ljudi koji u njemu žive i rade, a žele da ga upoznaju na alternativan način.\r\nVeličina tržišta prelazi 200.000 osoba godišnje. Zvanični statistički podaci pokazuju konstantan rast poseta Beogradu od ljudi iz inostranstva unazad 20 godina, sa jednim pikom 2008.godine kada se u Beogradu održavalo takmičenje \"Eurovision Song Contest\" i padom s pojavom Korona virusa.', NULL, NULL),
(2632, 27, 1145, 'Problem rešavamo ljudima koji žele da upoznaju Beograd na svoj način, svojim ritmom i svojim senzibilitetom. Uglavno to bi bili ljudi koji znaju da rukuju aplikacijama na pametnim telefonima, koji su upoznati sa terminom EscapeRoom, a koji ujedno vole da budu istraživači. Pogotovu u doba pandemije, ljudi žele da samostalno istražuju grad, ako je moguće da izbegnu veće grupe i veća okupljanja. \r\nRukovodeći hostelom 4 godine i još 2 godine se baveći izdavanje apartmana po sistemu \"stan-na-dan\" upoznao sam mnoštvo turista sa kojima sam pred mapom grada sedeo i objašnjavao im šta i gde mogu da vide i na koji način da se prošetaju i vide ono što im je intresantno, neki od njih su odlazili na besplatne walking ture dok su drugi uz \"moju\" iscrtanu mapu krenuli u samostalnu šetnju.\r\nGotovo svaka osoba kada dođe u nepoznato mesto želi da sazna nešto zanimljivo o tom mestu i da istraži njegovu okolinu.', NULL, NULL),
(2633, 28, 1145, 'Za izradu aplikacije planirano je da koristimo platformu Flutter koja radi sa Dart programskim jezikom, platforma koja podjednako podržava i Android i Apple uređaje.\r\nGlavna karakteristika je što istovremeno korisnik dobija kulturno-istorijske podatke o gradu, a sve to uz igru/priču čija je najbliža paralela Escape Room.', NULL, NULL),
(2634, 30, 1145, 'Potencijalni korisnici trenutno zarad dobijanja informacija o gradu kroz obilazak najčešće koriste plaćene ili besplatne walking ture, kao i direktnom pretragom interneta o potrebnim informacijama. Dobijaju razne ineresantne detalje o gradu od raznih ljudi koje usput upoznaju.', NULL, NULL),
(2635, 29, 1145, 'Korisnici se uz zabavu i igru, uz specijalno osmišljenu priču, \"uvlače\" da samostalno ili u grupi istražuju grad. Šetnju gradom mogu prilagoditi kad god njima odgovara tokom dana, ista tako tokom bilo kog perioda u godini.', NULL, NULL),
(2636, 32, 1145, 'Na tržištu postoje razne vrste audio-video turističkih vodiča, kao i walking ture. Ono što je veliki minus kod takvih aplikacija je to što su suvoparne i daju informacije o trenutnom mestu (chekpoint-u) gde se nalazite i ništa više. Naša ideja je da se kroz neku vrstu dramske priče korisnik \"uvuče\" da istražuje rešavajući niz sitnih problema koji mu omogućavaju da sazna dalje šta se dešavalo u priči a ujedno da na svakom novom mestu sazna nešto novo o gradu u kojem se nalazi.', NULL, NULL),
(2637, 37, 1145, 'Nismo sprovodili nikakavo istraživanje u pravcu intelektualne svojine. Vlasnici bi bili Predrag Stanić, Vladimir Kureljušić i Maja Stojanović.', NULL, NULL),
(2638, 40, 1145, 'Prilikom instaliranja aplikacije na pametnom telefonu osoba bi imala jednu kratku besplatnu priču (tizer). Kupovinom neke od drugih priča, koje bi bile duže i atraktivnije, naš startap bi zarađivao u budućnosti. Iskoristili bismo mrežu Hostela, Hotela i privatnih apartmana za promociju proizvoda, kao i društvene mreže.', NULL, NULL),
(2639, 41, 1145, 'Za sada je ceo projekta u idejnoj fazi i pravljenju nekih osnovnih postavki i potreba, započeto je pisanje biznis plana. Odlučeno je, barem za sada, da bi ukupan tim ljudi koji bi radili na projektu trebali da budu: Vođa projekta, Programer aplikacije, UX/UI dizajner, 3D dizajner, Dramatrurg, Turistički vodič. Svaka od uloga u timu bi imala veći značajni ili manji ali neophodan udeo u izradi projekta.', NULL, NULL),
(2640, 44, 1145, 'Nismo', NULL, NULL),
(2641, 45, 1145, 'Nismo', NULL, NULL),
(2642, 48, 1145, 'Podrška za ovaj startap nam je potrebna, pored finansijske, u organizovanju i konkretizovanju faza razvoja aplikacije. Takođe, nam je bitan know-how na kakve prepreke i izazove možemo naići kao i na koji način možemo najlakše da ih savladamo.', NULL, NULL),
(2643, 49, 1145, 'Procena je da nam trebaju finansijska sredstva od oko 20.000 EUR da bismo uspešno realizovali projekat.  Najveći deo sredstava nam treba zarad pokrivanja ličnih životnih troškova tokom rada na projektu, pravljenja web sajta, kao i pokrivanja troškova marketinga na samom kraju a da bi proizvod bio prepoznat na tržištu. Pored osnovnog tima od troje ljudi uključili bismo još minimum dvoje, od kojih bi jedna osoba bila dramaturg, a druga istoričar.\r\nKako svi imamo svoje poslove na kojima radimo, rad na ovom projektu bi nas odvojio od osnovnih prihoda, pa je normalno da budemo materijalno zadovoljni tokom realizacije koja će trajati nekoliko meseci.', NULL, NULL),
