(2695, 22, 1173, 'Oba člana tima saradjivala su u 3 firme do sada . Prva firma bila je NS potrčko doo ,osnovana 2010.  koja se bavila dostavom robe u Novom sadu. FIrma je prodata za profit 2012. \r\n\r\nOdmah nakon toga otvorena je firma AIrworx u kojoj su članovi tima partneri. AIrworx je firma koja se prva na teritoriji Republike Srbije bavila implementacijom bespilotnih leteilca za potrebe tržišta snimanja iz vazduha, sklapanje dronova i mapiranja terena. \r\n\r\n2017. svako od članova otvara svoje poljoprivredno gazdinstvo i osniva zadrugu sa ciljem uzgoja lavande i plasiranja proizvoda od lavande na domaće i strano tržište.', NULL, NULL),
(2696, 23, 1173, 'Čvrsto verovanje u validnost poslovne ideje. Tim Farmbot smatra da je naša poslovna ideja  jedan od načina da se ubrza proces automatizacije odredjenih poljoprivrednnih radnji i time doprinese razvoju zelene agende i održivom razvoju poljoprivrede.', NULL, NULL),
(2697, 24, 1173, 'We free humans from repetitive outdoor labor', NULL, NULL),
(2698, 25, 1173, 'Nedostatak radne snage i velik rizik prisutan u  održavanju voćnjaka, vinograda i ostalih plantaža, kao i efikasnost i bezbednost u domenu komunalnih poslova.', NULL, NULL),
(2699, 26, 1173, 'Voćari i vinogradari. -trziste robotskih kosilica ima stopu rasta od 13% godisnje i velicine je oko 1.2 milijarde dolara. https://www.marketsandmarkets.com/Market-Reports/robotic-lawn-mower-market-52805135.html?gclid=Cj0KCQiA5aWOBhDMARIsAIXLlkdKRVXnxuEL9eKOn9H6E_fiMtbBpQxNmMzbXcKVBV7s4rDVgRNB3MYaAhlqEALw_wcB  \r\nObzirom da su nam ciljne grupe vinogradari i voćari, planiramo da se u prvoj godini forkusiramo na lokalne vinarije i voćare, dok kasnije svakako planiramo da ponudimo nase proizvode u Italiji , Francuskoj i Spaniji gde je izrazena proizvodnja vina i voca.', NULL, NULL),
(2700, 27, 1173, 'Poljoprivrednici (voćari i vinogradari)koji iz godine u godinu imaju sve veći problem sa pronalaženjem načina da efikasno, bezbedno i jeftino održavaju svoje zasade, usled nedostatka pomoci u vidu ljudske radne sange i korišćenjem zastarele agrotehnike', NULL, NULL),
(2701, 28, 1173, 'Robotska platforma sa pogonom na sva 4 točka koja koristi hibridni pogon. Efikasan i snažan benzinski motor služi za generisanje elektricne energije neophodne za navigaciju i kretanje platforme kroz prostor. Pogon na sva 4 točka joj omogućava da se krece po zahtevnim terenima, gde konvencionalni voćarski vinogradarski traktori ne mogu da dodju usled postojanja rizika od prevrtanja. Platforma ima kardanski izlaz tipican za motokultivatore, sto joj omogucava jedinstvenu multifunkcionalnost koristeci vec postojeće mnogobrojne priključke za motokultivatore na tržištu. ( kosilica, atomizer tarup za krcenje, cistac snega itd). Platforma ima mogucnost autonomnog kretanja uz pomoc RTK GPS-a', NULL, NULL),
(2702, 30, 1173, 'Pripadnici naše ciljne grupe trenutno koriste tradicionalnu agrotehniku za košenje, prskanje i oranje vinograda i voćnjaka. To su motokultivatori , rideon kosilice i voćarski traktori koji su zbog svog visokog težišta  vrlo prevrtljivi na strmim terenima i dovode operatera u neposrednu opasnost. Takodje prilikom prskanja , u oba slučaja, operater je u neposrednoj blizini prskanja, time dovedeći sebe u veliku pasnost od trovanja. Godišnje se od udisanja pesticida prilikom prskanja otruje 385 miliona ljudi . Od toga 11.000 rezultira smrtnim ishodom.', NULL, NULL),
(2703, 29, 1173, 'Bezbednost - Operater se nalazi na bezbednoj distanci od neposredne opasnosti i precizno upravlja robotom putem joysticka ili autopilota gde se robot krece upotpunosti samostalno bez inputa operatera\r\nMultifunkcionalnost -  Robotska platforma koristi preko 25 različitih priključaka za motokultivatore koji se već nalaze na tržištu\r\nCena- Zbog pragmatičnog dizajna i  vec postojeceg opensource hardvera,', NULL, NULL),
(2704, 32, 1173, 'Poljoprivredni roboti vec postoje, ali mnogi vrše samo jednu funkciju. Oni koji vrše fiše funkcija ne zadovoljavaju potrebe trzista vinogradarstva i vocarstva po pitanju kompaktnosti, cene i pouzdanosti.', NULL, NULL),
(2705, 37, 1173, 'Deponovan je projekat, u kome stoji konstrukciona šema našeg proizvoda uz opis kako su komponente medjusobno vezane . Vlasnik te vrste intelektualne svojine je Nikola Lukičić.  Planirali smo da apliciramo za mali patent.', NULL, NULL),
(2706, 40, 1173, 'Prodajom robotske platforme i vršenjem usluge upotrebom robotske platforme', NULL, NULL),
(2707, 41, 1173, 'Na projektu smo počeli da radimo u januaru 2020 godine iz čiste potrebe da rešimo sopstveni problem održavanja zasada lavande koji mora da se održava ručno. NAša inovacija nam je omogućila da automatizujemo procese održavanja medjurednog prostora i time uštedimo ogromnu količinu vremena i fizičkog napora pri košenju i prskanju zasada. Kada je napravljen prvi prototip  intenzivno je  testiran u toku sezone 2020. U toku testitranja smo imali jasan uvid u mehaničke i ostale nedostatke koje su uklonjeni pri intenzivnom koriscenju platforme u teskim uslovima . 2021 počinjemo sa razvojem beta prototipa koji takodje testiran cele sezone koji je dodatno unapredjen. Trenutno smo u fazi testiranja 3. iteracije proizvoda koji bi trebalo da bude i nulta serija.  U celokupnom procesu testiranja dobili smo bitne informacije od ciljne grupe na koju smo se fokusirali . Testiranje je uglavnom bilo organizovano u vinogradima i vocnjacima potencijalnih kupaca.', NULL, NULL),
