(2724, 71, 1187, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2725, 63, 1188, 'Zgrade se mogu posmatrati kao kompleksni ekosistemi koji se sastoje od raznih dogadjaja, kao i  elemenata i operacija koje se izvrsavaju zarad neometanog funkcionisanja i boravka u njima, a koje je moguce digitalizovati i kreirati njihove digitalne automatizovane kopije - digitalne blizance.\r\n\r\nMeeliana je softverska platforma pametnih zgrada (digitalnih blizanaca), a ciji je osnovni cilj unapredjenje kvaliteta zivota i boravka u njima. Ona omogucava digitalizaciju procesa i automatizaciu operacija, analizu postojecih i zakljucivanje novih informacija, smanjuje rizike svih priorda, povecava transparentnost i olaksava odrzavanje i neometano funkcionisanje. Takodje, verodostojne kopije omogucavaju izvrsenje raznih simulacija kojima se mogu dobiti informacije od izuzetnog znacaja. Na primer, moguce je vrsiti simulacije kretanja kupaca u shopping centrima i na osnovu toga bolje dizajnirati novi objekat i pre njegove izgradnje.\r\n\r\nOvakva resenja se sastoje od mnogo razlicitih celina a nakon analize segmenata trzista kao prvi korak i inicijalno trziste su odabrani profesionalni upravnici zgrada, gde je fokus na digitalizaciji i automatizaciji celokupnog procesa. Direktni benefiti bi bili olaksano skaliranje njihovog poslovanja, jer bi mogli da upravljaju sa vise zgrada a sa istom kolicinom truda, operativni troskovi bi bili manji, kontrola veca, rizici poslovanja smanjeni, a kvalitet usluge veci.', NULL, NULL),
(2726, 71, 1189, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2727, 17, 1190, 'Zgrade se mogu posmatrati kao kompleksni ekosistemi koji se sastoje od raznih dogadjaja, kao i  elemenata i operacija koje se izvrsavaju zarad neometanog funkcionisanja i boravka u njima, a koje je moguce digitalizovati i kreirati njihove digitalne automatizovane kopije - digitalne blizance.\r\n\r\nMeeliana je softverska platforma pametnih zgrada (digitalnih blizanaca), a ciji je osnovni cilj unapredjenje kvaliteta zivota i boravka u njima. Ona omogucava digitalizaciju procesa i automatizaciu operacija, analizu postojecih i zakljucivanje novih informacija, smanjuje rizike svih priorda, povecava transparentnost i olaksava odrzavanje i neometano funkcionisanje. Takodje, verodostojne kopije omogucavaju izvrsenje raznih simulacija kojima se mogu dobiti informacije od izuzetnog znacaja. Na primer, moguce je vrsiti simulacije kretanja kupaca u shopping centrima i na osnovu toga bolje dizajnirati novi objekat i pre njegove izgradnje.\r\n\r\nOvakva resenja se sastoje od mnogo razlicitih celina a nakon analize segmenata trzista kao prvi korak i inicijalno trziste su odabrani profesionalni upravnici zgrada, gde je fokus na digitalizaciji i automatizaciji celokupnog procesa. Direktni benefiti bi bili olaksano skaliranje njihovog poslovanja, jer bi mogli da upravljaju sa vise zgrada a sa istom kolicinom truda, operativni troskovi bi bili manji, kontrola veca, rizici poslovanja smanjeni, a kvalitet usluge veci.', NULL, NULL),
(2728, 22, 1190, 'Milos i Aleksandar se poznaju od 2016. godine kada su bili deo “Deli” zajednice, a prvi put su saradjivali na Open Innovation Challenge-u organizovanog 2020. godine od strane Nemacke ambasade u Srbiji, KfW-a, GIZ-a i StartIT-a, povodom 20 godina saradnje Srbije i Nemacke. Tom prilikom su stigli do finala sa svojim resenjem i osvojili drugo mesto.', NULL, NULL),
(2729, 23, 1190, 'Smatramo da su ovakvi programi odlicna sansa da se stvore kontakti koji mogu otvoriti vrata ka potencijalnim saradnjama i novim mogucnostima, kao i da se mnogo toga nauci od osoba koje poseduju vise iskustva u domenu razvoja poslovanja i proizvoda.', NULL, NULL),
(2730, 24, 1190, 'Nasa misija je da ljude ucinimo ponosnim na svoje nekretnine, da spokojno i radosno provode vreme znajuci da mogu da se oslone na nasa tehnoloska resenja koja brinu o njima.', NULL, NULL),
(2731, 25, 1190, 'Upravnici su izlozeni stresu zbog kolicine administrativnih, repetativnih, birokratskih poslova i problema, visokih troskova i nedostatka softverska. Cesto su odgovorni za 20 zgrada, a cesto i vise od 30. Zbog toga se u potpunosti ne posvecuju radu, ulogu nadzornog organa i koordinatora su zamenili ulogom terenskog radnika i call centra, rokovi se probijaju, a stanari zbog manjka transparentnosti vrse pritiske. Zbog svega toga upravnici cesto i ne stizu da se posvete unapredjenju i skaliranju svog poslovanja.\r\n\r\nIdeja je nastala jer je clan tima u savetu zgrade te prolazi kroz slicne probleme. Ideja je validirana kroz intervjue sa agencijama, sto u Srbiji, sto kroz ankete na medjunarodnom nivou.\r\n\r\nEU ima 215 miliona stanova, 35% zgrada je starije od 50 godina, a 75% njih su energetski neefikasne, te skoro 13% stanovnistva ima neki od osnovnih problema. Do 2050. godine 80% populacije u EU ce ziveti u urbanim podrucjima, cime raste i potreba za pametnim gradovima i odrzivim resenjima.', NULL, NULL),
(2732, 26, 1190, 'Trziste digitalnih blizanaca jedno je od najbrze rastucih sa CAGR od 58% za koje se ocekuje da ce vredeti 48.2 milijardi $ do 2026. Razvoj digitalnih blizanaca zahteva digitalizaciju raznih apsekata i dugorocan je proces. Neophodno je pronaci potencijalne klijente pa je “beachhead” segment identifikovan i to su agencije za profesionalno upravljanje. One imaju najvecu potrebu za ovakvim resenjima a sa ciljem poboljsanja poslovanja i skaliranja. Globalni market size upravljanja nekretninama se procenjuje na 15.1 milijardu $, sa CAGR od 9.3%, gde se ocekuje da ce do 2028. godine dosegnuti vrednost od 28.1 milijarde $ a rast je uslovljen potrebom za softverskim resenjima. U Srbiji postoji 1110 upravnika i 50000 zgrada. Po pitanju geografske ekspanzije, cilj je da se uspostavi saradnja sa upravnicima na teritoriji Srbije, a u cetvrtom kvartalu prve godine da se zapocne medjunarodno sirenje\r\n\r\nhttps://docs.google.com/document/d/1K-wzqW3AtUhtbbk4HtJJ18h44-DAzM5-Kr35mCuuvY4/edit?usp=sharing', NULL, NULL),
(2733, 27, 1190, 'Profesionalni upravnici zgrada su ciljna grupa kojoj se pruzaju resenja. Trud je ulozen sa ciljem da se sprovedu intervjui sa 5 razlicitih agencija za profesionalno upravljanje, od kojih su 4 pristale. U intervjuima je ucestvovalo ukupno 10 razlicitih upravnika. Sprovedena je i anketa na medjunarodnom nivou kako bi se upoznali sa upravljanjem zgrada u drugim zemljama Evrope.\r\n\r\nMedju upravnicima se prepoznaju dve razlicite grupacije kojima se resavaju razliciti probleme, vlasnici agencija za upravljanje koji donose odluke i sami upravnici koji u tim agencijma rade. Najcesce su komunikativne i asertivne osobe, i najveci strah im je da ce softver da im stvori dodatnu obavezu.\r\n\r\nDalja segmentacija je moguca na osnovu velicine agencije, jer su benefiti veci kada agencije uposljavaju vise upravnika. Takodje, geografska lokacija je jedan od nacina segmentacije, gde je 47% svih upravnika u Srbiji registrovano na teritoriji Beograda, 18.5% u Novom Sadu i 7.5% u Nisu.', NULL, NULL),
(2734, 28, 1190, 'Meeliana je platforma, sa web i mobilnim aplikacijama, koja ce biti izuzetno laka i pouzdana za koriscenje. Njena inovativnost se ogleda u pruzanju novih informacija uz primenu algoriatama i integracije sa drugim servisima i koriscenjem otvorenih podataka. Primenom AI i ML, omogucava se obrada, validacija i zakljucivanje novih informacija te servis ne bi sluzio kao najobicnija baza podataka gde se informacije pamte u digitalnom obliku. U kasnijoj fazi, planirano je da se integrisu i razni IoT senzori koji bi u realnom vremenu generisali podatke o realnoj situaciji, a primenom postojecih resenja bi otvorili vrata za neka kompleksnija trzista.', NULL, NULL),
(2735, 30, 1190, 'Usled nedostatka softverskih resenja, upravnici su primorani da osmisle nacine koji njima najbolje odgovaraju i uglavnom manuelno obavljaju sve obaveze. U Srbiji postoje Troskovi.com i E-upravnik.rs servisi koji podrzavaju neke najosnovnije funkcije vezane za skladistenje informacija i knjigovodstvene usluge, kao i generisanje resursa (slanje mesecnih racuna na email stanara, citanje PDF izvoda banaka itd). Nazalost, ti softveri ne pruzaju nikakvu integraciu sa drugim servisima poput Katastra, EPS-a, pa ni privatnih koji odrzavaju zgrade, a veoma su dostupni za saradnju. Upravnici su primorani da ogroman deo informacija zapravo cuvaju na papiru, ili pak formiraju neke vidove excel tabela. Van Srbije postoji par drugih resenja, poput Matera.eu i Apsiyon.com. Matera je fokusirana na pruzanje usluge stanarima kako bi izbegli troskove upravnika dok im oni pruzaju legalne i tehnicke konsultacije. Apsiyon je softver namenjen upravnicima, ali je usko specijalizovan za trziste Turske.', NULL, NULL),
(2736, 29, 1190, 'Vlasnici agencija dobijaju resenja koja im pomazu u razvoju poslovanja. Brze i lakse skaliranje je omoguceno kroz smanjen broj obaveza te je moguce da upravnici preuzmu dodatne zgrade. Povecava se kontrola i efikasnost organizacije jer se standardizuju operacije i procesi. Smanjuju se operativni troskovi, ubrzava onboarding-a novih zaposlenih itd. Zadovoljstvo klijenata i CLV ce se povecati jer ce se resiti problem transparentnosti jer ce sve informacije biti dostupne na jednostavn i brz nacin. Upravnicima bi se automatizovali razni aspekti svakodnevnih obaveza, skupljanje i generisanje racuna, vodjenje evidencija, sinhronizacija finansijskih aspekata, digitalizacija dokumenata, kao i moguce otvaranje call centara, obavljanja administrativnih i birokratskih poslova u njihovo ime. Moguce je poboljsti efikasnost upravnika za 50% tako sto ce se eliminisati potreba za pozivima, interakcija sa raznim institucijama i trosenje vremena na razne manuelne aktivnosti poput skupljanja racuna.', NULL, NULL),
(2737, 32, 1190, 'Trenutno postoje resenja koja su zasla u domen profesionalnog upravljanja. Medjutim, trziste je dosta mlado i ima velikog mesta za razvoj novih inovativnih resenja. Poredeci se sa ostalima, smatramo da je nas proizvod znacajno poboljsan zbog kombinacije jednostavnog koriscenja i kvalitetnih funkcionalnosti koje se pruzaju. Mnoga resenja koja postoje, poput IoT resenja pametnih objekata koje pruza Schneider Electric-a, zahtevaju izuzetno visok stepen strucnosti. Druga, pak, nemaju dovoljno funkcionalnosti (poput Matere), a jedinstvenost im se ogleda u samoj ceni koja ne mora da bude presudna ukoliko nudite znacajno kvalitetniju uslugu. Krajnji cilj Meeliana platforme je da podatke koji se skupljaju na kreativan nacin obradi i pruzi nove informacije ali i da proaktivno deluje i spreci nezeljene scenarije.', NULL, NULL),
(2738, 37, 1190, 'Izvrsili smo najosnovije istrazivanje poput razlika izmedju copyright-a, trademark-a, najosnovnije smernice za zastitu intelektualne svojine u Srbiji i na medjunarodnom nivou, konsultacije sa advokatima o ugovoru o autorskim pravima, pogledali cenovnike sa sajta Zavoda za zastitu intelektualne svojine  itd.', NULL, NULL),
(2739, 40, 1190, 'Zavisno od stepena razvoja i market segmenta planeirane su razlicitive vrste monetizacije. Za pocetni segment trzista (profesionalni upravnici) planiran je Subscription model naplate, na mesecnom i godisnjem nivou, za koriscenje servisa, a visina nadoknade zavisi od ukupnog broja stambenih jedinica koji je u opticaju. Predvideli smo i pruzanje dodatnih opcionih usluga u vidu Call centra, pribavljanja dokumenata i podataka, kao i konsultastkih usluga, koje bi bile ponudjene kao upgrade osnovnog paketa, gde bi bilo moguće odabrati usluge koje su im potrebne a sa ciljem da ubrzaju i skaliraju svoje poslovanje. Uz segment upravnika prirodno se nadovezuje segment stanara koji takodje ima potencijala za pružanje usluga i naplatu. Stanari, nezavisno od uprave, mogu koristiti usluge i vidu pretplate koriscenje senzora u zgradama, samoupravljanje zgradom itd. Takodje, postoje i razni drugi modeli naplate u kasnijim fazama.', NULL, NULL),
(2740, 41, 1190, 'U ovom trenu smo odradili nekoliko rundi razgovora sa 10 profesionalnih upravnika, identifikovali neke od problema i bolje se upoznali sa celokupnom oblasti.\r\n\r\nUspeli smo da implementiramo neke najosnovnije funkcionalnosti serverskog resenja, poput, kreiranja profila i pravnog lica za upranvike, dodavanje, editovanje i brisanje zgrada, stanara itd. U ovom trenu zavrsavamo i sam sajt koji bi korisnicima omogucio koriscenje tih funkcionalnosti i u narednih mesec dana bi trebalo da imamo funkcionalan prototip i da pocnemo da trazimo prve korisnike. Takodje, imamo spremne dizajn fajlove novih funkcionalnosti koje planiramo da dodamo u buducnosti.\r\n\r\nUcestvovali smo i na EIT Jumpstarter programu sa ciljem prikupljanja dodatnih sredstava, prihvaceni smo da prezentujemo projekat na World Expo u Dubaiu od 07.01 - 14.01.2022. godine u saradnji sa PKS-om i planiramo da se prijavimo za bespovratna sredstva inovacionog fonda Srbije na prolece 2022.', NULL, NULL),
(2741, 44, 1190, 'Kao tim smo sa ovim projektom ucestvovali na EIT Jumpstarter programu 2021. godine, u okviru EIT Urban Mobility sekcije, gde smo stigli do polufinala.\r\n\r\nKao pojedinci, Aleksandar je saradjivao sa raznim startup firmama od kojih su najznacajnije Circle Medical, Plickers i MyDietCoach. Kao lead mobile inzenjer je imao prilike da pomogne Plickers-u da dosegne vise od milion korisnika kao i nekoliko desetina miliona korisnika MyDietCoach-u. Septembra 2015. godine se prikljucio Circle Medical startupu koji je dobio 3 miliona dolara seed investicije od strane Y Combinator, Collaborative Fund, i Tencent-a. Od tada je angazovan na razvoju produkta i uspeli su da prikupe vise od 26 miliona dolara investicija, krajem 2020. godine kupljeni od strane Well Health Technologies za 15 miliona dolara, a sa trenutnim godisnjim prometom od preko 36 miliona dolara i YoY rastom od preko 190%.', NULL, NULL),
(2742, 45, 1190, 'Od strane EIT Jumpstartera smo dobili finansiranje u iznosu do 2000 eura kao ucesnici polufinala.', NULL, NULL),
(2743, 48, 1190, 'Ocekujemo da unapredimo nasa saznanja i steknemo nova iz oblasti razvoja biznisa, marketinga i strategija prodaje. Da podrobnije istrazimo opcije za pribavljanje novih klijenata, troskova tog pribavljanja, zadrzavanja klijenata i stepena nihovog zadovoljstva nasim proizvodom i uslugama. Takodje kreiranje i sirenje mreze kontakata je jedan od motiva nase prijave.', NULL, NULL),
(2744, 49, 1190, '10000 CHF, 50% plate, 20% intelektualna svojina, 15% marketing, 15% za opremu i alata za razvoj', NULL, NULL),
(2745, 52, 1190, NULL, NULL, NULL),
(2746, 66, 1193, NULL, NULL, NULL),
(2747, 76, 1194, NULL, NULL, NULL),
(2748, 83, 1196, NULL, NULL, NULL),
(2749, 89, 1197, 'Zavrsio Elektronski fakultet u Nisu, a takodje je i dobitnik Erasmus Mundus EM2STEM stipendije gde je proveo godinu dana studirajuci u Politechnika Wroclawska, u Poljskoj.\r\n\r\nAleksandar ima vise od 10 godina radnog iskustva, specijalizovan u izradi mobilnih aplikacija u medicini, i najveci deo tog vremena je proveo samostalno trazeci klijente i saradjujuci sa njima, uz kracu pauzu 2013. godine kada je bio zaposlen u Microsoft Development centru. Nakon toga je pokrenuo outsourcing kompaniju “Singularity Software” a koja je brojala 14 saradnika. Nakon toga je postao deo Toptala, koji uposljava najboljih 3% kandidata. Do danas je radio na vise od 40 projekata a jedan od najznacajnijih mu je startup Circle Medical, sa kojima saradjuje vise od 5 godina i sa kojima je imao prilike da prodje kroz gotovo sve cikluse razvoja startupa kao i da aktivno ucestvuje u tom procesu.', NULL, NULL),
(2750, 90, 1197, 'Primarno zaduzen za tehnicka resenja, odabir tehnologija, implementaciju projekta, mentorisanje ostalih inzenjera. Odgovoran za bitne aspekte razvoja poslovanja, marketinga, komunikacije sa klijentima, investitorima, istrazivanje trzista itd.\r\n\r\nVreme posveceno: U vecoj meri posvecen, oko 20h nedeljno,\r\n\r\nJedan od kreatora same ideje Meeliana platforme.', NULL, NULL),
(2751, 91, 1197, 'Senior inzenjer mobilnih aplikacija i clan produktnog tima u Circle Medical.', NULL, NULL),
(2752, 89, 1198, 'Radio je na vise kapitalnih projekata od drustvenog znacaja i ostvario saradnju i partnerstva sa startupovima i biroima sirom sveta. \r\n\r\nMilos je vlasnik kreativne agencije Arcezio koja se bavi multidisciplinarnom produkcijom digitalnog sadrzaja za potrebe arhitekata, grafickih i industrijskih dizajnera, sa misijom da poveže kreativne industrije svojim delovanjem. Glavni deo produkcije orijentisan je ka vizuelnoj komunikaciji i digitalnom marketingu, gde su glavni klijenti kompanije koje imaju potrebe za ilustrovanjem svojih projekata i ideja kroz digitalne rendere, interaktive prezentacije ili print materijal.\r\n\r\nDelio je svoje znanje iz oblasti dizajna i 3D-a sa studentima grafickog dizajna, kao vanredni profesor na fakultetu Metropolitan. Dobitnik je nagrade za najboljeg mladog preduzetnika iz oblasti primene naprednih tehnologija.\r\n\r\nMilos je jedan od kreatora same ideje Meeliana platforme, i ucestvuje u kreiranju vizuelnog identiteta, grafickog interfejsa kao i razvoja samog biznisa.', NULL, NULL),
(2753, 90, 1198, 'Primarno zaduzen za vizuelni identitet, UI/UX dizajn i marketing resenja. Odgovoran za bitne aspekte razvoja poslovanja, marketinga, komunikacije sa klijentima, investitorima, istrazivanje trzista itd.\r\n\r\nVreme posveceno: U vecoj meri posvecen, oko 20h nedeljno.\r\n\r\nJedan od kreatora same ideje Meeliana platforme.', NULL, NULL),
(2754, 91, 1198, 'Milos je vlasnik kreativne agencije Arcezio i bavi se produkcijom digitalnog sadrzaja, vizulenim komunikacijama i digitalnim marketingom u oblasti kreativnih industrija', NULL, NULL),
(2755, 89, 1199, 'Marko je sticajem okolnosti bio prinudjen da zamrzne svoje studiranje na zadnjoj godini Ekonomskog fakultetu. Nakon toga je radio u prodaji i ugostiteljstvu, a tokom tog perioda je posvetio veliki deo vremena ucenju programiranja. Od kraja 2019. godine je stalno zaposlen u IT kompaniji kao junior full stack developer koristeci razne web tehnologije.', NULL, NULL),
(2756, 90, 1199, 'Uloga softverskog inzenjera, implementacija backend platforme i rad na samom web sajtu. Posvecenost: Potpuno posvecen, oko 40h nedeljno', NULL, NULL),
(2757, 91, 1199, 'Nema', NULL, NULL),
(2758, 71, 1202, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2759, 63, 1203, 'Naša kompanija želi da pravi i prodaje edukativne video igre za decu i odrasle.', NULL, NULL),
(2760, 71, 1204, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2761, 17, 1205, 'Naša kompanija želi da pravi i prodaje edukativne video igre za decu i odrasle.', NULL, NULL),
(2762, 22, 1205, 'Kao tim smo se okupiliu pre šest meseci sa namerom da napravimo firmu koja će praviti edukativne video igre. Od tada smo učestvovali na dva hakatona (BIZ Hakaton u Novom Sadu, Mosh! u Osijeku) gde smo dobili treće i prvo mesto. Pored toga učestvovali smo u internacionalnom katalizator program koji je organizovao Virtuo i Starter.ba iz BiH. Tokom svih navedenih programa slušali smo predavanja vezana za organizaciju posla u startapu, procenu tržišta i razvoja biznis modela.', NULL, NULL),
(2763, 23, 1205, 'Želimo da razvijemo Minerva Studio i spremni smo da uložimo sopstveno vreme i novac u ovaj projekat, kao što smo i do sada ulagali. Smatramo da bi nam ovaj program omogućio da bolje testiramo sopstvenu ideju, ali i da dobijemo validaciju za koncpet od stručnjaka koji operišu u startup ekosistemu Srbije i šireg regiona. Ovaj program bi nam omogućio da se bolje upoznamo sa budućim korisnicima ali i da ispitamo naše pretpostavke u vezi sa edukativnim igrama. Takođe bismo imali sredstva za razvoj marketing strategije kao i za razvoj strategije za stvaranje comunity-a oko našeg koncepta i firme.', NULL, NULL),
(2764, 24, 1205, 'Play to learn, and learn to play.', NULL, NULL),
(2765, 25, 1205, 'Želimo da učinimo učenje kompleksnih i obilnih tema interesantnim. Odnosno želimo da otvorimo medijum video igara ka edukativnom sadržaju i da time učinimo učenje pristupačnim i zabavnim. Međutim, većina ovakvih igara namenjena je za decu do srednjoškolskog uzrasta. Naše ispitivanje gejmera ukazuje da i odrasli vole da igraju video igrice ali i da koriste edukativan sadržaj. Zbog toga smatramo da bi gemifikacija edukativnog sadržaja bila široko prihvaćena, ali i da je očekivani i potrebni alat u savremom svetu.', NULL, NULL),
(2766, 26, 1205, 'Sa našim vido igrama želimo da ciljamo i muške i ženske igrače u uzrastu između 17 i 34 godine. Oni trenutno predstavljaju 38% igrača u SAD. Pored toga, oni su generacija koja se i dalje aktivno edukuje i nemaju u potpunosti oformljene karijere, zbog čega bi im dodatni edukativni sadržaj bio interesantan. Želimo da targetiramo i ženske igrače, zbog čega smo posvetili pažnju i njihovom intervjuisanju tokom razvoja koncepta. One trenutno predstavljaju 48% igrača na celom svetu, međutim uglavnom igraju video igre na android uređajima. Tržište edukativnih igara se trenutno procenjuje na 9.2 milijarde i očekuje se da će narasti na 88.2 milijarde do 2027. Takođe, neke procene spekulišu da je celo tržište video igara preraslo i filmski i muzičku industriju. Naš proizvod bi spadao u kategoriju edukativnih igara, ali nam je namera da ga plasiramo kao igru koja je zabavna ali i edukativna, čime ona ne bi bila samo alat za edukaciju već i sredstvo zabave.', NULL, NULL),
(2767, 27, 1205, 'Naš idealni kupac je muškog ili ženskog pola, između 17 i 34 godine, koristi više javnih mreža, ima visok stepen obrazovanja i radi preko kompjutera ili u IT sektoru ili kao umetnik, pisac, menager. Odrasli su uz video igre i vole da igraju različite tipove video igara, ali najviše preferiraju naslove koji se bave sa nekim istorijskim periodom. Osoba je zainteresovana za sociajalne probleme i identifikuje se sa liberalnim vrednostima. U slobodno vreme voli da se edukuje preko podkasta, youtube videa, online kurseva i sličnog edukativnog sadržaja. Osim toga, obožava istoriju i voli u slobodno vreme da istražuje ličnosti i događaje na koje naiđe dok igra svoje omiljene video igre. Naši proizvodi bi omogućili ovim ljudima da se zabave i edukuju, a pored toga Minerva Studio bi pravio i dodatni edukativni sadržaj za javne mreže, jer su nam istraživanja pokazala da je ovo važan deo samoobrazovanja koji praktikuju naši ispitanici i budući klijenti.', NULL, NULL),
(2768, 28, 1205, 'Radimo na razvoju point-and-click video igre koja bi učila o kritičkom mišljenju u odnosu na istoriju tako što bi obradila francusku revoluciju. Igra bi bila bazirana na detektivskim narativima ali bi glavni akter u igri bio novinar. Igrač pokušava da rekonstruiše događaje koji su doveli do ubistva Marata, a u tom procesu će se upoznati sa ekonomskom i socijalnom podlogom društva koja je dovela do javljanja revolucije. Dakle, igra ima tri dimenzije. Prvo, razvijamo mehaniku igranja koja treba da bude stimulativna i zabavna. Drugo, struktuiramo edukativni sadržaj tako da može da se uklopi u narativ detektivske priče. Treće, kreiramo 3D okruženje koje je istorijski autentično i edukativno.', NULL, NULL),
(2769, 30, 1205, 'Trenutno naši budući kupci igraju vdeo igre koje imaju istorijsku tematiku, ali nisu istorijski autentične ili tačne. Zbog čega oni moraju da dopune svoje znanje sa dodatnim sadržajem i da provere događaje kojima su naučeni u igri. Pored toga naša igra ne želi samo da uči o istorijskom događaju, u ovom slučaju o francuskoj revoluciji. Mi želimo da naučimo igrača veštini koju može da implementira i kasnije u životu. Zbog čega igra primarno uči o tome kako da se implementira kritičko mišljenje u odnosu na istoriju. Odnosno, igrač će učiti o tome kako se podaci manipulišu u službi ideologije i kako da se razazna istina kada postoji više različitih izvora o istom događaju. Time je naš proizvod bolji od postojećih, jer daje uvid u istorijski period ali u isto vreme podučava o kritičkom mišljenju i implementaciji istog u različitim situacijama.', NULL, NULL),
(2770, 29, 1205, 'Učenje o kritičkom išljenju u odnosu na istoriju, zabavna video igra zbog koje ne mora da vas grize savest, vizuelno zadovoljavajući sadržaj, učenje o razvoju jednakosti i demokratije u Evropi ali i o borbi za ženska prava.', NULL, NULL),
(2771, 32, 1205, 'Postoje edukativne igre ali nisu napravljene za stariju publiku. Sa druge strane, postoje igre sa istorijskom tematikom ali one nisu istorijski autentične i činjenice predočene u njima često nisu tačne. Naša igra bi ponudila poboljšanje u obe sfere.', NULL, NULL),
(2772, 37, 1205, 'Planiramo da zaštitimo logo firme, video igru i scenario. Sva intelektualna svojina pripadala bi firmi a ne pojedincima.', NULL, NULL),
(2773, 40, 1205, 'Naš primarni izvor zarade bila bi prodaja video igra. Vremenom planiramo da razvijemo platformu sa našim video igrama, gde bismo zarađivali od pretplate. Osim toga, pravićemo i druge oblike edukativnog sadržaja za platforme na javnim mrežama, ali u tom domenu ne očekujemo direktnu zaradu.', NULL, NULL),
(2774, 41, 1205, 'Okupili smo se pre šest meseci u Novom Sadu. Tea, Nebojša i Dejan se znaju već dugi niz godina. Filip se pridružio timu nakon hakatona u Osijeku. Osim njega u kontaktu smo sa još jednim programerom iz Osijeka (Adrian), ali će on biti part-time posvećen projektu prvih godinu dana. Tokom šest meseci pratili smo sve programe koji startapima u razvoju nude pomoć - prijavili smo se na mnoge. Biz hakaton u Novom Sadu nam je značio zbog metoda koje smo implementirali u razvoj našeg koncpeta. Hakaton u Osijeku nam pomogao da se bolje upoznamo sa regionom i da vdimo kako se industrija video igra razvija u istom, ali još važnije da steknemo dragocena poznanstva za razvoj ideje. Katalizator nam je omogućio da svo znanje sistematično integrišemo i da se još bolje upoznamo sa našim budućim potrošačima. Pored toga u kontaktu smo sa Business Angels of Slovenia, Phil Rouge i sa zavodom za Inovaciju R Srbije. Svi su zainteresovani za našu ideju i očekuju izveštaj u narednih 6 meseci.', NULL, NULL),
(2775, 44, 1205, 'Učestvovali smo u Katalizator programu koji su organizovali https://starter.ba/ i https://www.virtuo.global/. Tokom dvanaest nedelja programa radili smo sa 7 mentorki i menotra ali smo imali i priliku da prezentujemo ideju pred panelom investitora i da dobijemo feedback od njih za proizvod i firmu koju želimo da razvijemo.', NULL, NULL),
(2776, 45, 1205, 'Do sada smo uložili lična sredstva ali i nagradu od 10 000 HRK koje smo dobili u Osijeku na hakatonu.', NULL, NULL),
(2777, 48, 1205, 'Smatramo da ćemo sa ovim programom dobiti novo iskustvo, neophodno znanje i kontakte. Želimo da proširimo istraživanje tržišta i da finalizriramo zaključke pre nego što se poptuno posvetimo razvoju proizvoda. Pored toga želimo da razvijemo bolju strategiju za stvaranje comnuity-a ali i za prodaju i da regrutujemo odgovarajuće članove da sprovedu te strategije u delo.', NULL, NULL),
(2778, 49, 1205, 'Potrebno nam je oko 10 000 evra za razvoj MVP, a to uključuje mehanike igranja, scenario i deo pejzaža. Pare bi smo potršili na naše plate, zaštitu loga firme i implementaciju prvih faza community outreach. Takođe, ova sredstva bi pkazala fondu za inovaciju da naš projekat dobija neophodnu pažnju za dalji razvoj.', NULL, NULL),
(2779, 52, 1205, 'Business Incubator Novi Sad', NULL, NULL),
(2780, 66, 1208, NULL, NULL, NULL),
(2781, 76, 1209, NULL, NULL, NULL),
(2782, 83, 1211, NULL, NULL, NULL),
(2783, 71, 1212, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2784, 71, 1213, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2785, 63, 1214, 'Ideja je da se napravi HR platforma preko koje ce ljudi moci da se prijavljuju na oglase za posao i ono sto je najbitnije da sigurno (suština) dobijaju odgovor od poslodavca. Kompanije koje objavljuju oglase bi imale premium naloge pomoću kojih prate prijave svih kandidata pa i sam proces kandidata, dok bi osobe koje se prijavljuju na konkurs imale besplatan nalog ili bi se prijavljivalje popunjavanjem osnovnih informacija koje poslodavac zahteva.', NULL, NULL),
(2786, 71, 1215, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2787, 17, 1216, 'Ideja je da se napravi HR platforma preko koje ce ljudi moci da se prijavljuju na oglase za posao i ono sto je najbitnije da sigurno (suština) dobijaju odgovor od poslodavca. Kompanije koje objavljuju oglase bi imale premium naloge pomoću kojih prate prijave svih kandidata pa i sam proces kandidata, dok bi osobe koje se prijavljuju na konkurs imale besplatan nalog ili bi se prijavljivalje popunjavanjem osnovnih informacija koje poslodavac zahteva.', NULL, NULL),
(2788, 22, 1216, 'Nismo imali prilike da radimo na zajedničkim projektima niti da radimo u istim firmama. Svakako imamo redovne brainstorming-e pa nam zajedničko deljenje ideja nije strano.', NULL, NULL),
(2789, 23, 1216, 'Primetili smo da je ova naša ideja nešto što fali na tržištu rada. Ono što nama fali je podrška u vidu mentorstva, detaljnije ispitivanje tržišta, razgovor sa ljudima iz HR sveta, i dodatna inicijalna ulaganja koja bi nam dosta značila, a to je ono što ovaj program upravo nudi.', NULL, NULL),
(2790, 24, 1216, 'Budi fer, biću fer', NULL, NULL),
(2791, 25, 1216, 'Dosta često se dešava da kada ljudi traže posao ostanu bez ikakvog odgovora od strane poslodavca, a neretko se dešava da i posle nekoliko krugova potencijalni zaposleni čeka i po nekoliko nedelja na odgovor. Naša platforma bi kao mediator između poslodavca i potencijalnog zaposlenog omogucila transparentan prikaz procesa zaposlenja. U praksi bi to znacilo sledece:\r\n\r\n+ Potencijalni zaposleni uvek dobija odgovor od poslodavca. Ovo bi bio ključan aspket.\r\n+ HR ili osoba koja se bavi zapošljavanjem kadrova ima mogućnost tačnog definisanja procesa intervjua kandidata, i samim tim kontrolu celog toka intervjua za sve kandidate\r\n\r\nMi verujemo da je krajnje neophodno izvršiti nivelaciju u pogledu transparentnosti odnosa između poslodavca i potencijalnog zaposlenog.', NULL, NULL),
(2792, 26, 1216, 'Za početak bi to bila zemlja Srbija. Prema statistikama Svetske banke, Republika Srbija je u 2020. godini imala 3.167.119 ljudi koji su radno sposobni. Naša ciljna grupa bi bili radno sposobni ljudi koji žele da pronađu posao, što je u svakoj zemlji prilično veliki pool kandidata.\r\n\r\n\r\nPotencijalne zemlje za širenje biznisa u prve dve godine: \r\n\r\n+ Hrvatska - 1.775.337 radno sposobnih ljudi\r\n+ Bosna i Hercegovina - 1.297.577 radno sposobnih ljudi\r\n+ Severna Makedonija - 892.399 radno sposobnih ljudi\r\n\r\n\r\nUbuduće bi se platforma proširila i na celu Evropu pa i na svet nadamo se, ali ne možemo reći tačan spisak, jer je to dugačak proces i iziskuje provere zakonskih regulativa svake zemlje pojedinačno.\r\n\r\nPodaci su skupljeni sa sajta Svetske banke (https://data.worldbank.org/indicator/SL.TLF.TOTL.IN)', NULL, NULL),
(2793, 27, 1216, 'Potencijalni kupci bi bili kompanije koje objavljuju oglase za posao. Sa druge strane imamo korisnike koji koriste besplatnu verziju i to su ljudi koji se prijavljuju na oglas za posao, pa ovom kombinacijom imamo dobro angažovanje korisnika i dobar prihod od strane kompanija.', NULL, NULL),
(2794, 28, 1216, 'Napravili bi web platformu centralizovanog tipa. Sama integracija Mašinskog učenja bi došla u kasnijim fazama implementaciju jer u početku nije planirano da se dodaje u softver jer bi glavni feature-i platforme ne zahtevaju ML.', NULL, NULL),
(2795, 30, 1216, 'Očigledno ne tako dobro jer dosta ljudi ostane vrlo nezadovoljno nakon samih razgovora. Neke kompanije verovatno koriste već postojeće HR softvere, ali svi oni zapostavljaju faktor ljudi koji apliciraju za posao. U današnjoj digitalnoj eri, čak i jedan negativan komentar za proces zapošljavanja može biti indikator da firma nema dobru proceduru zapošljavanja. Mi ćemo kupcima rešiti taj problem.', NULL, NULL),
(2796, 29, 1216, '+ Svaki kandidat dobija feedback, pa ima utisak da je cenjen i poštovan\r\n+ Bolji ugled kompanije\r\n+ Lakše praćenje statusa svih kandidata', NULL, NULL),
(2797, 32, 1216, 'Značajno poboljšan jer u obzir uzima i drugu stranu, a to su ljudi koji se prijavljuju na oglas. Ovo bi bila platforma koja bi direktno uticala i na ugled kompanije medju korisnicima.', NULL, NULL),
(2798, 37, 1216, 'Vlasnici intelektualne svojine bi bili Aleksandra i Nenad Milošević.', NULL, NULL),
(2799, 40, 1216, 'Na osnovu mesečnih / godišnjih pretplata', NULL, NULL),
(2800, 41, 1216, 'Ova ideja se razvija već neka tri meseca, a na samoj implementaciji radimo oko mesec i po dana. Konkretno u paraleli razvijamo front-end i back-end deo rešenja, pa smo tako na dobrom putu da napravimo određeni workflow koji bi u prvoj iteraciji aplikacije bio dovoljan.', NULL, NULL),
(2801, 44, 1216, 'Nismo učestvovali.', NULL, NULL),
(2802, 45, 1216, 'Nismo prikupili do sada nijedan izvor finansiranja.', NULL, NULL);
