(2815, 71, 1226, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2816, 63, 1227, 'Proizvodnja iskljucivo drvenih igracaka za decu, akcenat stavljamo na edukativne igracke a takodje nam\r\nje jedan od aduta i kvalitet i dugovecnost proizvoda.', NULL, NULL),
(2817, 71, 1228, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2818, 17, 1229, 'Proizvodnja iskljucivo drvenih igracaka za decu, akcenat stavljamo na edukativne igracke a takodje nam\r\nje jedan od aduta i kvalitet i dugovecnost proizvoda.', NULL, NULL),
(2819, 22, 1229, 'Svakodnevno saradjujemo, radimo u istoj firmi trenutno a radili smo i ranije u predhodnoj firmi. Radimo\r\nna istim projektima, ja (Stefan) sa inzenjerske strane a Marko sa strane kontrole kvaliteta, posle ovoliko godina koliko saradjujemo mogu slobodno da kazem da je nasa saradnja besprekorna (obojica smo eksperti u svojim oblastima). Sobzirom da\r\nje autmobilska industrija u kojoj radimo jedna od najslozenijih sa najvisim standardim kvaliteta i usluge, smatramo da\r\nsteceno iskustvo mozemo jako dobro da prenesemo i na sopstveni biznis.', NULL, NULL),
(2820, 23, 1229, 'Motiv nase prijave je zelja da krenemo sa privatnom biznisom jer smatramo da imamo dovoljno\r\niskustva u proizvodnom procesu a sa druge strane dobro znamo sta hocemo i zelimo.  \r\nIskustvo koje imamo kao tim oduvek savrseno funkcionise, i zelja nam je da tim iskustvom i voljom doprinesmo nasem buducem poslu.', NULL, NULL),
(2821, 24, 1229, 'Igrom kroz zivot', NULL, NULL),
(2822, 25, 1229, 'Problem kupovine nekvalitetnih plasticnih igracaka, koje ne vrede i ne traju i sumnjivog su porekla ( a\r\nkupovina moze da bude svakodnevna). Uzaludno trosenje novca, pre svega mislim na roditelje a zatim\r\nna sve ostale. Saznali smo tako sto smo kroz to prosli, a trenutno prolaze i nasi prijatelji, poznanici, rodbina i svi roditelji koje srecemo.\r\nKada smo razmenjivali misljenja sa njima svi su se slozili da su drvene igracke jako kvalitetne a sa druge strane malo i skupe, a sto se tice starijih generacija svi oni imaju neku igracku koja im je ostala iz detinjstva i u velikom broju slucajeva ta igracka je napravljena od drveta.', NULL, NULL),
(2823, 26, 1229, 'Za pocetak ciljano trziste bila bi Srbija a kasnije i sve zemlje evrope. Po nasem misljenju i iztrazivanju ovaj vid proizvoda nema\r\ngranice, mozda treba i razmisliti da se odmah krene sa stranim trzistem ( tu nam trebaju vasi saveti).', NULL, NULL),
(2824, 27, 1229, 'Nasi potencijalni kupci su roditelji, bake, deke, tetke, strine, ujaci.....\r\nVec skoro godinu dana istrazujemo ovu temu sa ljudima koji nas okruzuju, i sa 90% ljudi smo se slozili da kvalitet danasnjih igracaka je jako nizak, a isto tako da je ponuda kvalitetnih drvenih igracaka jako slaba. Mi zelimo da promenimo to, da dokazemo da kvalitet i pristupacna cena mogu da idu zajedno', NULL, NULL),
(2825, 28, 1229, 'Jedan od proizvoda koji planiramo da razvijemo je visenamenski, tacnije kupovinom jednog proizvoda korisnik (dete) moze da ima jako puno varijanti za igru, uzmimo na primer kocke za igru, kucica od drveta, decija kuhinja, granice nema... \r\nA pored svega toga besprekoran kvalitet i pristupacna cena.', NULL, NULL),
(2826, 30, 1229, 'Vecina ljudi resava problem tako sto detetu kupi jeftinu igracku jer zna da ce dete brzo da se zasiti iste ili ce brzo da se polomi, ali je problem sto je kupovina vrlo cesta i roditelj veoma kasno shvati koliko je para potrosio na jeftine i nekvalitetne igracke.\r\nKonkurencija postoji ali je u vecini slucajeva nedostupna, nema je bas svugde a takodje i vrlo skupa (velikim delom zbog velike marze prodajnih objekata).', NULL, NULL),
(2827, 29, 1229, 'Dobijaju proizvod koji kvalitetan, dugovecan, pristupacan svima, nestetan po okolinu. Proizvod koji ce da traje. \r\nPo potrebi proizvod moze biti i jedinstven ( gravura na igrackama sa detetovim imenom je jedan od primera).', NULL, NULL),
(2828, 32, 1229, 'Obojica znamo sta deca u odredjenom uzrastu zele i sta im najvise privlaci paznju, a sa druge strane je i edukativnog karaktera ( obojica smo ocevi nekoliko godina, tako da imamo primere u kuci).\r\nNas proizvod bice pristupacan po ceni (proizvod za sve), kvalitetan i veoma lako dostupan.', NULL, NULL),
(2829, 37, 1229, 'Nismo zastitili prava intelektualne svojine', NULL, NULL),
(2830, 40, 1229, 'Od prodaje.', NULL, NULL),
(2831, 41, 1229, 'Ova ideja traje vec nekoliko godina, ali smo u zadnjih godinu dana poceli jako intezivno da razmisljamo o tome i svakodnevno pricamo o tome i razmenjujemo misljenja, ispitujemo trziste oko nas itd...\r\nNas zajednicki cilj je zadovoljsto kupaca i korisnika, zelimo da nas proizvod bude prepoznatljiv, da bude pristupacan svima i da na licima dece mozemo da vidimo osmeh kada na poklon dobiju igracku nase proizvodnje. A kao sto svi znamo deca su najiskrenija bica i ponekad je vrlo tesko ispuniti njihova ocekivanja. E bas to zelimo mi!\r\nPored komercijalne strane naseg biznisa takodje zelimo da se posvetimo i humanitarnom radu, drugim recima donirali bi nase igracke raznim ustanovama decijag tipa i isto tako podsticali druge ljude (firme) da se ukljuce u donacije. I tako jos jednom dokazali da su nase igracke dostupne bas svima.', NULL, NULL),
(2832, 44, 1229, 'Kao sto mozete da vidite po nasim biografijama svakodnevno smo ukljuceni u nove projekte, i ucestvijemo u njihovoj realizaciji. Naravno ovo je vezano za firme u kojima smo zaposleni a sada zelimo da to preslikamo u privatni biznis. Iza sebe imamo dosta uspesnih projekata i znamo kako se stize do unapred zadatog cilja (nas moto je Plan-Do-Check-Act).', NULL, NULL),
(2833, 45, 1229, 'Za sada imamo na raspolaganju sopstvena sredstva koja mozda nisu velika, to je i jedan od razloga zasto se prijavljujemo na vas konkurs, pored finansijske pomoci od vas ocekujemo i da nas podrzite savetima kako do zdrave privatne firme.', NULL, NULL),
(2834, 48, 1229, 'Ocekujemo poziv za drugi krug, gde bi mogli uzivo porazgovarati o ideji i cuti vasa misljenja.\r\nNajpotrebnija podrska nam je potrebna bas sada, kako strucna tako i finanansijska .', NULL, NULL),
(2835, 49, 1229, 'Po nasim proracunima potrebno nam je izmedju 15k i 20k evra ( veliki deo je za nabavku masina i opreme)', NULL, NULL),
(2836, 52, 1229, NULL, NULL, NULL),
(2837, 66, 1232, NULL, NULL, NULL),
(2838, 76, 1233, NULL, NULL, NULL),
(2839, 83, 1235, NULL, NULL, NULL),
(2840, 89, 1236, 'Zavrsene studije za industrijski menadzment, trenutno radim na poziciji inzenjera za projekte, u firmi\r\nkoja se bavi proizvodnjom stampanih ploca. Visegodisnje iskusto u automobilskoj industriji, izmedju\r\nostalog pokretanje novih i vodjenje projekata je moja svakodnevnica.', NULL, NULL),
(2841, 90, 1236, 'Potpuno posvecen, kreator ideje', NULL, NULL),
(2842, 91, 1236, 'Full time posao, 40 sati nedeljno', NULL, NULL),
(2843, 89, 1237, 'Master studije za industrijski menadzment, moja trenutna pozicija je menadzer kvaliteta.\r\nVisegodisnje iskustvo u proizvodnji, upravljanje kvalitetom na nivou cele fabrike, kako i kvalitetom procesa tako i kvalitetom proizvoda', NULL, NULL),
(2844, 90, 1237, 'U vecoj meri posvecen, jedan od kreatora ideje', NULL, NULL),
(2845, 91, 1237, 'Full time posao, 40 sati nedeljno', NULL, NULL),
(2846, 71, 1238, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2847, 71, 1241, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2848, 63, 1242, 'Umreženi sistem uređaja koji olakšava kretanje, orijentaciju i identifikaciju prostora osobama bez vida, ili sa oštećenim vidom. Primarna namena je da određena insitucija postavi niz radio predajnika u blizini ključnih tačaka u okviru zgrade, a da se na ulazu posetiocu da na korišćenje prijemnik koji bi ga zvučnom porukom obavestio kada se nađe u blizini tih predajnika.', NULL, NULL),
(2849, 71, 1243, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2850, 17, 1244, 'Umreženi sistem uređaja koji olakšava kretanje, orijentaciju i identifikaciju prostora osobama bez vida, ili sa oštećenim vidom. Primarna namena je da određena insitucija postavi niz radio predajnika u blizini ključnih tačaka u okviru zgrade, a da se na ulazu posetiocu da na korišćenje prijemnik koji bi ga zvučnom porukom obavestio kada se nađe u blizini tih predajnika.', NULL, NULL),
(2851, 22, 1244, 'Već 2 godine sarađujemo na ZONA-LARP projektu koji je interaktivna igra čiji smo organizatori i osnivači. Takodje proizvodimo svu potrebnu opremu za ostvarivanje jedne igre.', NULL, NULL),
(2852, 23, 1244, 'Želimo da započnemom sopstveni biznis, a da pritom imamo pozitivni uticaj na svet. Za ovaj izum smo se odlučili zato što smatramo da je to nešto što je za nas tehnički izvodljivo a pritom obuhvata problem koji trenutno nije rešen. Kolege koje su ranije aplicirale za ovaj program su nam ga preporučile kao dobar način da razvijemo svoj proizvod i steknemo poslovne veštine.', NULL, NULL),
(2853, 24, 1244, 'Trenutno nismo osmislili slogan', NULL, NULL),
(2854, 25, 1244, 'Slepe osobe imaju veoma ograničene mogućnosti identifikacije okoline i snalaženja u nepoznatom prostoru. Postoje brojna pomagala koja poboljšavaju orijentaciju kroz prostor i izbegavanje prepreka, ali ne i lociranje željenih tačaka. Za snalaženje u nepoznatom prostoru slepi ljudi moraju da se oslanjaju na prolaznike/vodiče, ili na neretko izostavljene putokaze napisane Brajevom azbukom.', NULL, NULL),
(2855, 26, 1244, 'Javne i privatne institucije prvenstvenstveno bolnice, pošte i banke jer su one nešto što je često u svakodnevici prosečnog čoveka.', NULL, NULL),
(2856, 27, 1244, 'Naša ciljna grupa su ljudi sa oštećenim čulom vida i slepi. Ovi ljudi imaju generalnu težnju da ostvare veći nivo samostalnosti, pogotovu u obavljanju poslovan van svog doma(odlazak u bolnicu, poštu...) gde inače zavise od pomoći pratnje, zaposlenih, i prolaznika.', NULL, NULL),
(2857, 28, 1244, 'Naš tim bi razvio sistem uređaja zasnovan na tehnologiji prepoznavanja radio predajnika kratkog dometa koji bi pomagao nosiocu džepnog prijemnika da se orjentišu u prostoru. Sistem bi korisnika glasovno obaveštavao gde se trenutno nalazi u zgradi sa instaliranim sistemom putem unapred snimljenih glasovnih poruka koje bi se emitovale na zvučniku prijemnika. Taj uređaj bi prepoznao da li se nalazi u blizini unapred postavljenog radio predajnika podesivog dometa(1 do 10 metara) i u zavisnosti od programirane poruke na zvučniku pustio glasovno saopštenje da se u blizini nalazi tačka od interesa, na primer određena kancelarija, lift, fontana za vodu, toalet i slično.', NULL, NULL),
(2858, 30, 1244, 'Sistemi koji su trenutdno dostupni pomažu slepim ljudima da izbegnu prepreke na putu ali ne i da pomognu u lociranju u celokupnom prostoru, što znači da se pri ulasku na nepoznata mesta slepi oslanjaju na pomoć drugih lica.', NULL, NULL),
(2859, 29, 1244, 'Korišćenje našeg uređaja bi slepim osobama omogućilo znatno veću dozu samostalnosti prilikom kretanja kroz zgrade ustanova koje posećuju. Entitet koji je u vlasništvu te zgrade bi time omogućio znatno lakše kretanje posetiocima i smanjenu potrebu za dežurnim pratiocima.', NULL, NULL),
(2860, 32, 1244, 'Među elektronskim pomagalima za osobe oštećenog vida izdvajaju se grupa proizvoda koji putem ultrazvuka pronalaze prepreke ispred korisnika i upozoravaju ga o tome, zatim grupa zasnovana na veštačkoj inteligenciji, najčešće u obliku naočara koja imaju mogućnost da korisniku čitaju znakove, prepoznaju lica i slično. Međutim naš sistem bi identifikovao ključne lokacije unutar institucija koje bi naš sistem i ugradile, pritom po znatno pristupačnijoj ceni u poređenju sa ostalim pomagalima.', NULL, NULL),
(2861, 37, 1244, 'Nismo', NULL, NULL),
(2862, 40, 1244, 'Prodaja ovog sistema javnim i privatnim institucijama koje prepoznaju važnost integracije ljudi sa oštećenim vidom i slepih bi bila glavni izvor zarade. Takođe postoji mogućnost prilagođavanja ovog koncepta radi stvaranja mogućnosti da se on koristi i u kućnim uslovima što bi najviše olakšalo orijentaciju slepim ljudima koji su nedavno ostali bez vida, ili onima koji su promenili okruženje i potrebna im je pomoć u privikavanju na novo.', NULL, NULL),
(2863, 41, 1244, 'Trenutno posedujemo dokaz tehnološke izvodljivosti odnosno PoC. Napravili smo prijemnik koji je sposoban da prepozna da se nalazi u blizini predajnika, odnosno lokacije od interesa za osobu koja sa sobom nosi prijemnik. Ovu ideju smo razmatrali poslednjih nekoliko meseci i savetovali se sa kolegama koji se bave razvojem i prodajom hardverskih uređaja od kojih smo dobili preporuke da probamo ovaj koncept da realizujemo.', NULL, NULL),
(2864, 44, 1244, 'Nismo', NULL, NULL),
(2865, 45, 1244, 'Nismo', NULL, NULL),
(2866, 48, 1244, 'Razvijnje veština samostalnog stvaranja uspešne poslovne strukture i razvijanje poslovnog plana kao i finalno definisanje našeg proizvoda. Najveća podrška koju očekujemo da će nam biti potrebna je oko zaštite intelektualne svojine, marketinga, i ispitivanja tržišta.', NULL, NULL),
(2867, 49, 1244, 'Smatramo da bi sa 15000CHF uspeli da pokrijemo celokupne troškove razvoja uređaja, odnosno uspostavljanje funkcionalnog i estetskog dizajna kao i razvoj elektronskog hardvera.', NULL, NULL),
