(2883, 63, 1259, 'Korišćenjem IoT tehnologije bazirane na veštačkoj inteligenciji, razvijamo sistem koji će, na osnovu podataka prikupljenih različitim senzorima, krajnjim korisnicima putem multiplatformske aplikacije (CityScout) kroz dva segmenta (ParkingScout i CrowdScout) obezbeđivati usluge pametnog parkinga (preciznu lokaciju i navigaciju do slobodnih parking mesta, trendove i predviđanje dostupnosti, preporuke i dr.) i informacije o gužvi u nekom objektu (velič. gužve u realnom vremenu, prosečno vreme zadržavanja u objektu, trendovi i predviđanje gužve, preporuke i sl.), dok će naši klijenti zauzvrat, pored zadovljstva *krajnjih korisnika, dobijati informacije relevantne za unapređenje svog poslovanja.', NULL, NULL),
(2884, 71, 1260, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2885, 17, 1261, 'Korišćenjem IoT tehnologije bazirane na veštačkoj inteligenciji, razvijamo sistem koji će, na osnovu podataka prikupljenih različitim senzorima, krajnjim korisnicima putem multiplatformske aplikacije (CityScout) kroz dva segmenta (ParkingScout i CrowdScout) obezbeđivati usluge pametnog parkinga (preciznu lokaciju i navigaciju do slobodnih parking mesta, trendove i predviđanje dostupnosti, preporuke i dr.) i informacije o gužvi u nekom objektu (velič. gužve u realnom vremenu, prosečno vreme zadržavanja u objektu, trendovi i predviđanje gužve, preporuke i sl.), dok će naši klijenti zauzvrat, pored zadovljstva *krajnjih korisnika, dobijati informacije relevantne za unapređenje svog poslovanja.', NULL, NULL),
(2886, 22, 1261, 'Tim, u ovom sastavu (Lazar, Dragutin, Milovan i Mihajlo), već godinu dana radi na razvoju dotičnog IoT rešenja baziranog na Smart City konceptu.\r\n\r\nNeki od članova su i ranije sarađivali na različitim projektima, konkretno:\r\n\r\nLazar i Dragutin: \r\n\r\n- razvoj informacionog sistema za predškolske ustanove.\r\n\r\nLazar i Mihajlo:\r\n\r\n- razvoj edukacione web platforme „Kreatlija“.\r\nLazar, Dragutin i Milovan:\r\n\r\n- demo verzija merača kvaliteta vazduha.\r\n\r\nPored pomenutog, od važnosti je istaći i međusobnu konsultativnu saradnju i stručnu pomoć na projektima u kojima pojedini članovi nisu uzimali formalno učešće, ali su zbog svoji prethodnih profesionalnih iskustava i dobrog poznavanja materije bili u poziciji da pruže pomoć drugim članovima tima.', NULL, NULL),
(2887, 23, 1261, 'S obzirom na to da je koncept softversko-hardverskog rešenja na čijem razvoju radimo dostigao zadovoljavajući nivo zrelosti, a ispitivanje tržišnih potreba potvrdilo pravac u kome se kreće razvoj celokupne poslovne ideje, motivi za prijavu na Raising Starts program zasnivaju se na značaju mentroske podrške eksperata iz oblasti privrede i naučno-tehnološkog sektora, i finansijskih sredstava nephodnih da poslovna ideja koju tim razviija poprimi svoj finalni oblik, a “HAL” započne svoje prve korake kao mlada startap kompanija.', NULL, NULL),
(2888, 24, 1261, 'Opametimo se. (SRB)\r\nLet’s get smart. (ENG)', NULL, NULL),
(2889, 25, 1261, 'Problem koji nastojimo da rešimo tiče se urbane mobilnost tj. gužvi u urbanim sredinama (zagušenja protoka ljudi i vozila), iz čega proizilazi nemogućnosti efikasnog planiranja vremena koje građani imaju na raspolaganju, a koje se javlja kao direktna posledica dotičnog problema. Rešenje koje razvijamo targetira dva ključna segmenta: poteškoće nalaženja slobodnog parking mesta i probleme koji stvaraju gužve u različitim prodajno-uslužnim objektima - tržnim centriima, bankama, poštama, marketima i ustanovama različitih namena (državne institucije, privatni poslovno-industrijski kompleksi i dr.).\r\nNavedeni problemi su globalne prirode, i to u domenu njihovih posledica - bespotrebno gubljenje vremena građana i nemogućnost efikasnog planiranja vremena koje im je na raspolaganju.', NULL, NULL),
(2890, 26, 1261, 'Taržište koje targetira ponuda IoT rešenja koje razvijamo uključuje sledeće potencijlane *klijente:\r\n\r\nPrivatni sektor (primarno):\r\n- Prodajno-uslužni objekti sa pratećim parking kapacitetima: tržni centri, banke, marketi, prodajna mesta/poslovnice kompanija, ugostiteljski objekti (HoReCa) i dr.\r\n\r\nJavni sektor (sekundarno):\r\n\r\n-Javne ustanove\r\n-Javne parking površine (na otvorenom i u zatvorenom prostoru)\r\n\r\nPrecizni podaci u vezi sa procenom tržišne vrednosti za ovaj proizvod nisu dostupne usled nedostataka adekvatnog izvora svih neophodnih informacija iz kojih bi mogle biti izvedene ovakve procene. Procene tima, u konsultaciji sa predstavnicima iz oblasti privrede, jesu da se radi o višemilionskom (EUR) tržištu u domaćim okvirima, što podrazumeva daleko veće vrednosti ukoliko kao target tržište označimo tržište EU. \r\n\r\n*Geografska ekspanzija:\r\n\r\nNaredne 2 godine:\r\n\r\n-Podrazumevano: domaće tržište\r\n-U domenu mogućnosti: regionalno tržište\r\n\r\nDugoročni cilj: Tržište EU', NULL, NULL),
(2891, 27, 1261, '*Klijenti (kupci) su pravna lica po čijoj narudžbini i na čijem posedu kompanija HAL implementira pametne sisteme – npr. banka, tržni centar, javni parking i sl.\r\n\r\n*Krajnji korisnici su građani koji koriste usluge javnog i privatnog sektora – npr. klijenti banaka, kupci tržnog centra, korisnici privatnih/javnih parking usluga i sl.\r\n\r\nRešenje koje razvijamo istovremeno je namenjeno i našim *klijentima i *krajnjim korisnicima (klijentima naših *klijenata). Implementacijom (kupovinom) rešenja koje nudimo, naši *klijenti direktno rešavaju probleme *krajnjih korisnika u vezi sa parkingom i gužvama (a o čijim potrebama su se **ji korisnici već izjasnili – potvrđeno ispitavnjem tržišta), tako unapređujući kvalitet usluge koju im pružaju. Sa druge strane, pored mogućnosti pružanja visoko kvalitetne usluge *krajnjim korisnicima, naši *klijenti dobijaju vredne informacija značajne za unapređenje svih drugih usluga koje pružaju, kao i unapređenje drugih domena svog poslovanja.', NULL, NULL),
(2892, 28, 1261, 'Korišćenjem IoT tehnologije bazirane na veštačkoj inteligenciji, razvijamo sistem koji će, na osnovu podataka prikupljenih različitim senzorima, krajnjim korisnicima putem multiplatformske aplikacije (CityScout) kroz dva segmenta (ParkingScout i CrowdScout) obezbeđivati usluge pametnog parkinga (preciznu lokaciju i navigaciju do slobodnih parking mesta, trendove i predviđanje dostupnosti, preporuke i dr.) i informacije o gužvi u nekom objektu (velič. gužve u realnom vremenu, prosečno vreme zadržavanja u objektu, trendovi i predviđanje gužve, preporuke i sl.), dok će naši klijenti zauzvrat, pored zadovljstva *krajnjih korisnika, dobijati informacije relevantne za unapređenje svog poslovanja.', NULL, NULL),
(2893, 30, 1261, 'U segmentu rešenja koje se tiče parking usluga, potencijalni *klijenti iz privatnog sektora (naša primarna target grupa) u nedovoljnoj meri zadovoljavaju potrebe o kojima su korisnici njihovih usluga izjasnili. Najnaprednija usluga koju naši *klijenti pružaju *krajnjim korisnicima u ovom segmentu jeste digitalna tabla koja prikazuje ukupan broj slobodnih mesta (npr. u garaži tržnog centra), postavljena na samom ulazu u parking prostor.\r\nPotencijalni *klijenti u javnom sektoru u nekim zemljama Zapadne Evrope primenjuju slična rešenja kada su u pitanju parking usluge, ali sa manjim brojem funkcionalnosti (najnaprednije: lokacija slobodnih parking mesta), dok se u većini slučajeva koriste digitalne table na ulazima u parking prostor.\r\n\r\nU segmentu rešenja koje se tiče gužvi u objektima ne postoje rešenja/usluge koje naši potencijalni *klijenti pružaju *krajnjim korisnicima.', NULL, NULL),
(2894, 29, 1261, 'Benefiti za *krajnje korisnike (klijente naših klijenata)\r\n\r\n- Efikasno donošenje odluka.\r\n- Efikasno planiranje vremena koje im je na raspolaganju.\r\n- Ušteda vremena.\r\n- Značajno smanjenje nivoa stresa izazvanog dotičnim problemima.\r\n- Veći nivo opšte bezbednost.\r\n\r\nBenefiti za naše *kljente:\r\n\r\n- Unapoređen kvalitet usluge koju pružaju krajnjim korisnicima: odgovor na njihove relane potrebe.\r\n- Smanjenje gužve na parking/u garaži.\r\n- Bolja organizacija saobraćaja u garaži.\r\n- Izbalansiraniji promet ljudi i vozila.\r\n- Bolja prostorna organizacija objekta.\r\n- Efikasnije sprovođenje antipandemijskih mera.\r\n- Relevantne informacije za unapređenje drugih usluga koje nude.\r\n- Relevantne informacije za unapređenje određenih poslovnih procesa.\r\n\r\n*Odgovor na pitanje o jedinstvenosti proizvoda koji razvijamo i poređenju sa postojećim proizvodima koji zadovoljavaju slične ili iste potrebe sadržan je udogovorima na prethodno i naredno pitanje.', NULL, NULL),
(2895, 32, 1261, 'Naš proizvod, kao elemente inkorporira neke već postojeće proizvode u svom najelementarnijem obliku (parking sensor, sensor za brojanje ljudi), dok novi proizvod oplemenjuju primena veštačke inteligencije, i drugačiji način distribucije proizvoda do *krajnjih korisnika.\r\n\r\nNeki od razloga koji argumentuju odabrani stepen inovativnosti našeg proizvoda:\r\n\r\n- Dodatne vrednosti, pogodnosti i funkcionalnosti\r\n- Sve informacije o parkingu i gužvi objedinjene na jednom mestu - CityScout aplikaciji\r\n- Visokokvalitetne informacije i napredna analitika\r\n- Preciznost podataka i pružanje informaciju u realnom vremenu\r\n- Pouzdane predikcije zasnovane na realnim, a ne proksimativnim podacima\r\n- Modularna arhitektura čitavog sistema\r\n- (De)centralizacija pristupa na strani *klijenta\r\n- Zaštita privatnosti (sistem ne koristi kamere, niti na bilo koji način prikuplja podatke o identitetu *krajnjeg korisnika\r\n- Javna bezbednost (efikasno sprovođenje antipandemijskih mera, efikasna urbana mobilnost)', NULL, NULL),
(2896, 37, 1261, 'Još uvek nismo posvetili toliko pažnje obrađivanju tematike vezane za zaštitu intelektualne svojine i vizuelnog identiteta.', NULL, NULL),
(2897, 40, 1261, 'Biznis model kompanije je prilično jednostavan: kompanija prihoduje od prodaje proizvodno-uslužnog aranžmana svojim *klijentima (kupcima). \r\n\r\nKljučne komponente cenovne strukture proizvodno-uslužnog aranžmana proizilaze iz troškova po osnovu implementacije IoT sistema (jednokratan trošak) i održavanja sistema (periodičan trošak).', NULL, NULL),
(2898, 41, 1261, 'Pre godinu dana smo se prijavili na IoT Hakaton u Kragujevcu čija tema je bila unapređenje mobilnosti i bezbednosti osoba sa invaliditetom u gradovima. Razmišljajući o tome gledali smo širu sliku i došli do ideje koja bi olakšala živote svim ljudima, nezavinso kojoj društvenoj grupi pripadaju. Nakon pobede na hakatonu, tim je doživeo promenu strukture i od tada je u sadašnjem sastavu. Zbog našeg dugogodišnjeg prijateljstva i saradnje nastavili smo sa razvojem ideje, koja je tokom ovih godinu dana konstantno unapređivana i razvijana, da bi konkretizovala svoj oblik u vidu proizvodno-uslužnog aranžmana koji je predstavljen u ovoj prijavi.', NULL, NULL),
(2899, 44, 1261, 'Tim HAL je do sada učestvovao u dva mentorska/startap programa:\r\n\r\nSocial Impact Award\r\nProgram razvoja poslovnih ideja u oblasti socijalnog preduzetništva\r\nJul – oktobar 2021.\r\n\r\nMožeš i ti postati mladi preduzetnik grada Kragujevca', NULL, NULL),
(2900, 45, 1261, 'IoT Hakaton, Kragujevac\r\nTakmičenje za najbolje IoT rešenja na polju urbane mobilnosti. \r\n*Novčana nagrada u iznosu od 90.000 din. za osvojeno I mesto.\r\n\r\nMIND Hackaton, Kragujevac\r\nTakmičenje za najbolje IT rešenje kao odgovor na konkretne potrebe I izazove sa Kojima se sučava industrijsko-tehnološki kompleks MIND Park.\r\n*Robni vaučer za kupovinu kompjuterske opreme u vrednosti od 300e (u dinarskoj protivvrednosti).', NULL, NULL),
(2901, 48, 1261, 'Očekivanja tima, kada je u pitanju Raising Starts program, direktno porizilaze iz gorenavedenih motiva, za prijavu na program. Tim očekuje dobijanje značajne mentroske podrške eksperata iz oblasti privrede i naučno-tehnološkog sektora, kao i finansijske podrške nephodne da poslovna ideja koju tim razviija poprimi svoj finalni oblik, a “HAL” započne svoje prve korake kao mlada startap kompanija.', NULL, NULL),
(2902, 49, 1261, 'Iznos sredstava: 15000 CHF\r\n\r\nNamena:  - Finalni dizajn oba senzora - ParkingScout sensor i CrowdScout sensor.\r\n                  - Izrada prototipa oba senzora.\r\n                  - Razvoj prve verzije CityScout aplikacije.\r\n\r\n*Drugi troškovi poslovanja u vezi sa osnivanjem i periodičnim izdacima, u skladu sa dozvoljenim namena sredstava granta koji su određeni Vodičem ovog programa, su podrazumevajuća stavka.', NULL, NULL),
(2903, 52, 1261, NULL, NULL, NULL),
(2904, 66, 1264, NULL, NULL, NULL),
(2905, 76, 1265, NULL, NULL, NULL),
(2906, 83, 1267, NULL, NULL, NULL),
(2907, 89, 1268, 'Nakon završene gimanazije u Kruševcu, Lazar upisuje studije informatike na Prirodno-matematičkom fakultetu u Kragujevcu, gde kasnije pohađa i master studije u oblasti nauke o podacima i stiče zvanje Master akademski informatičar. Profesionalno iskustvo najpre stiče angažujući se na studentskim projektima i stručnim praksama, da bi već za vreme trajanja osnovnih studija otpočeo sa punovremenim radnim angažovanjem na poslovima softverskog inženjerstva u privatnom sektoru. Uporedo sa studijama i radnim angažovanjem, Lazar svoje stručne kompetencije upotpunjuje i učešćem u različitim vannastavnim akitvnostima koje se tiču njegovih interesovanja u oblasti informaciono-komunikacionih tehnologija (IoT, Data Science & System architechture), uključujući samostalne projekte, takmičenja i sl. Lazar danas ima nekoliko godina radnog iskustva u privredi koje je od neupitnog značaja za realizaciju poslovnih ideja tima „HAL“.\r\n\r\n*Detaljnije informacije o profesionalnom profilu člana dostupne su u radnoj biografiji (CV-u) koja je priložena u ovoj prijavi.', NULL, NULL),
(2908, 90, 1268, 'Oblasti zaduženja člana: Arhitektura sistema, upravljanje podacima i IoT.\r\nStepen posvećenosti razvoju startapa: potpuno posvećen.\r\n\r\n* Koncept poslovne ideje je proizvod sinergije kreativnih misli svih članova tima. U procesu nastajanja je pretrpeo mnoštvo izmena, te se kao takav ne može pripisati jednom kreatoru, niti se u pogledu dodeljivanja zasluga za njegovo kreiranje bilo ko od članova može diskriminisati.', NULL, NULL),
(2909, 91, 1268, 'Zaposlen kao softverski inženjer u  kompaniji Qubitsoft d.o.o.\r\n\r\nRadno angažovan: do 40h nedeljno.', NULL, NULL),
(2910, 89, 1269, 'Nakon završene Prve kragujevačke gimnazije, gde ostvaruje zapažene rezultete na takmičenjima iz oblasti matematike i informatike, Dragutin upisuje osnovne studije informatike na Prirodno-matematičkom fakultetu u Kragujevcu, gde kasnije pohađa i master studije i stiče zvanje Master akademski informatičar. Tokom srednjoškolskog perioda i pohađanja osnovnih studija, Dragutin uzima učešće u brojnim projektima i takmičenjima, biva angažovan kao predavač na različitim radionicama u oblasti matematike i informatik, ali stiče i radno iskustvo u privredi. Za vreme master studija otpočinje svoj radni angažman u redovnoj nastavi, najpre kao predmetni nastavnik specijalno matematičkim i specijalno informatičkim odeljenjima Prve kragujevačke gimnazije, a potom i kao asistent na Prirodno-matematičkom fakltetu u Kragujevcu, gde upisuje i doktorske studije u oblasti informaciono-komnunikacionih tehnologija. Za vreme studija počeo se interesovati za tematiku iz oblasti veštačke inteligencije, a tokom master studija njegov uspeh bavljenja ovom oblašću biva prepoznat od strane šire akademske zajednice, te ubrzo biva angažovan od strane Srpske akademije nauka i umetnosti na naučno-istraživačkom porjektu u ovoj oblasti. Dragutin danas iza sebe ima dragocena profesionalna iskustva i akadmska ostvarenja na kojima počivaju važni intelektualni resursi kojima je popločan razvojni put tima „HAL“.\r\n*Detaljnije informacije o profesionalnom profilu člana dostupne su u radnoj biografiji (CV-u) koja je priložena u ovoj prijavi.', NULL, NULL),
(2911, 90, 1269, 'Oblasti zaduženja člana: Razvoj algoritama i veštačka inteligencija.\r\nStepen posvećenosti razvoju startapa: potpuno posvećen.\r\n\r\n* Koncept poslovne ideje je proizvod sinergije kreativnih misli svih članova tima, i u procesu nastajanja je pretrpeo mnoštvo izmena, te se kao takav ne može pripisati jednom kreatoru, niti se u pogledu dodeljivanja zasluga za njegovo kreiranje bilo ko od članova može diskriminisati.', NULL, NULL),
(2912, 91, 1269, 'Zaposlen kao asistent u nastavi na Prirodno-matematičkom fakultetu u Kragujevcu.\r\nZaposlen kao predmetni nastavnik u Prvoj kragujevačkoj gimnaziji.\r\n\r\nStudent doktorskih studija na Prirodno-matematičkom fakultetu u Kragujevcu\r\nAngažovan na naučno-istraživačko projektu na Matematičkom institutu SANU\r\n\r\nProsečno radno angažovan: 20-40h nedeljno', NULL, NULL),
(2913, 89, 1270, 'Nakon završene Prve kragujevačke gimnazije, Milovan upisuje osnovne studije informatike na Prirodno-matematičkom fakultetu u Kragujevcu. Profesionalno iskustvo najpre stiče angažujući se na različitim studentskim projektima, ističući posebno interesovanje za razvoj aplikativnih softvera, da bi kao apsolvent započeo svoj radni angažman na poslovima asistenta u oblasti istraživanja i razvoja kao softverski inženjer u Centru za računarsko modelovanje i optimizaciju pri Prirodno-matematičkom fakultetu u Kragujevcu. Milovan danas ima značajno iskustvo u oblasti softverskog inženjerstva, naročito u oblasti razvoja mobilnih i multiplaformskih aplikacija, koje predstavlja okosnicu stručnih znanja i veština kojima doprinosi timskom radu.\r\n\r\n*Detaljnije informacije o profesionalnom profilu člana dostupne su u radnoj biografiji (CV-u) koja je priložena u ovoj prijavi.', NULL, NULL),
(2914, 90, 1270, 'Oblasti zaduženja člana: Razvoj softvera i dizajn korisničkog interfejsa.\r\nStepen posvećenosti razvoju startapa: potpuno posvećen.\r\n\r\n* Koncept poslovne ideje je proizvod sinergije kreativnih misli svih članova tima, i u procesu nastajanja je pretrpeo mnoštvo izmena, te se kao takav ne može pripisati jednom kreatoru, niti se u pogledu dodeljivanja zasluga za njegovo kreiranje bilo ko od članova može diskriminisati.', NULL, NULL),
(2915, 91, 1270, 'Zaposlen kao softverski inženjer u Centru za računarsko modelovanje i optimizaciju pri Prirodno-matematičkom fakultetu u Kragujevcu\r\n\r\nApsolvent na osnovnim studijama informatike na Prirodno-matematičkom fakultetu u Kragujevcu.\r\n\r\nProsečno angažovan: 20h nedeljno.', NULL, NULL),
(2916, 89, 1271, 'Završio je ekonomsku školu u Kragujevcu, a 2017. godine upisuje strukovne studije ekonomije na državnoj Akademiji strukovnih studija „Šumadija“. Prva radna iskustva stiče kao frilenser angažovan na poslovima digitalnog marketinga još u srednjoškolskom periodu, uporedo ih upotpunjujući formalnim obrazovanjem i ličnim interesovanjima u oblasti primenjenih ekonomskih disciplina. Kada je reč o profesionalnim kompetencijama, relevantno radno iskustvo stiče na poslovima online marketinga, kreiranja, upravljanja i optimizacije web sadržaja, istraživanja tržišta, poslovima u administraciji i direktnoj prodaij. Mihajlo danas iza sebe ima dugogodišnje i raznovrsno radno iskustvo, koje usmereno formalnim obrazovanjem i prošireno ličnim interesovanjima van okvira tradicionalnih ekonomskih disciplina, čini osnovu profesionalnih veština kojima već godinu dana doprinosi poslovnom razvoju tima „HAL“.\r\n*Detaljnije informacije o profesionalnom profilu člana dostupne su u radnoj biografiji (CV-u) koja je priložena u ovoj prijavi.', NULL, NULL),
(2917, 90, 1271, 'Oblasti zaduženja člana: Poslovno upravljanje i komunikacije.\r\nStepen posvećenosti razvoju startapa: potpuno posvećen.\r\n\r\n* Koncept poslovne ideje je proizvod sinergije kreativnih misli svih članova tima. U procesu nastajanja je pretrpeo mnoštvo izmena, te se kao takav ne može pripisati jednom kreatoru, niti se u pogledu dodeljivanja zasluga za njegovo kreiranje bilo ko od članova može diskriminisati.', NULL, NULL),
(2918, 91, 1271, 'Samostalno angažovan kao onlajn predavač engleskog jezika (frilenser).\r\n\r\nProsečno radno angažovan: 10h nedeljno.', NULL, NULL),
(2919, 71, 1276, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2920, 71, 1277, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2921, 63, 1278, 'Tim BIBO razvija Bibo Bot - portabilni samoupravljani mobilni 3D štampač za brzu izgradnju kuća, zgrada i drugih betonskih konstrukcija. BIBO je jeftiniji nekoliko puta od konkurencije  , portabilan je,  može štampati dužine i do 500 metara i menja 4 do 8 radnika. U odnosu na sve druge je potuno inovativativno rešenje ne vidjeno do sada na tržistu  koje ima slobodnu Ip poziciju na Wipo bazi i može se patentirati', NULL, NULL),
(2922, 71, 1279, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2923, 17, 1280, 'Tim BIBO razvija Bibo Bot - portabilni samoupravljani mobilni 3D štampač za brzu izgradnju kuća, zgrada i drugih betonskih konstrukcija. BIBO je jeftiniji nekoliko puta od konkurencije  , portabilan je,  može štampati dužine i do 500 metara i menja 4 do 8 radnika. U odnosu na sve druge je potuno inovativativno rešenje ne vidjeno do sada na tržistu  koje ima slobodnu Ip poziciju na Wipo bazi i može se patentirati', NULL, NULL),
(2924, 22, 1280, 'Saradjivali smo do sada  na ukupno dva manja projekta, gde će nam iskustvo iz prethodnih projekata jako puno koristi u ostvarenju ciljeva na ovom gde trenutno radimo.Projekti su bili u saradnji univerziteta i privrede  i bili su takodje kombinovane prirode gde je bio potreban razvoj  hardvera  i softwera istovremeno.  Pokazali smo da možemo da funkcionišemo kao tim I celina I da upotpunjujemo jedni druge I da verovatno ne bismo bili toliko uspesni jedni bez drugih.', NULL, NULL),
(2925, 23, 1280, 'Motiv je pretvaranje jako dobre ideje I prototipa u serijski proizvod za kojim postoji ogromna potreba I  potražnja na globalnom tržištu. Uz pomoć NTP Čačak I Raising Starts-a dobićemo mentorsku pomoć, šansu za povezivanje sa akterima iz inovacionog ekosistema kao I mogućim partnerima,  preduzetnicima  I kupcima. Takodje očekujemo i manju podrška u razvoju tima , infrastrukturna podršku u slučaju da bude potrebna  I naposletku I finansijsku pomoć za koju konkurišemo. Sve to će nam omogućiti spinovanje preduzeća ,brzi rast i razvoj kao I sam u uspeh projekta.', NULL, NULL),
(2926, 24, 1280, 'BiBot -  Printer Bot za potpuno automatizovanu izgradnju gradjevina od betona. Smanjuje troškove u gradjevini do 70 posto, košta kao jedan radnik a menja od 4 do 8 radnika I neuporedivo je precizniji I kvalitetniji , portabilan je , samopokretan , potpuno automatizovan i jedinstven na tržištu.', NULL, NULL),
(2927, 25, 1280, 'Gradjevinska industrija trenutno pati od sledecih  problema:\r\n-Statistike građevinske industrije tvrdi da 80% globalnih izvođača ne može ili ima problem da nađe radnike (Plan Grid )\r\n-90% generalnih izvođača je zabrinuto zbog mogućeg nedostatka radne snage (komora SAD)\r\n-66% svih globalnih regiona suočava se sa nedostatkom veština (TaT)\r\n- Očekuje se da će globalni troškovi izgradnje porasti za 4,3% (TAT)\r\n-Zbog svega toga 90% globalnih infrastrukturnih projekata je ili prekoračilo budžet ili kasni (FMI)\r\n - Upotreba Pomocnog materijala odnosi i do 40% troskova (skele , oplate , ankeri i ostalo )\r\n-visoka cena koštanja - radna snaga odnosi 30% ukupnih troskova izgradnje dok na pomoćni materijal ide i do 40%\r\n     Mi resavamo problem  :\r\n-radne snage bot menja od 4-8 radnika,\r\n-visoke cene kostanja pomocni materijal nije potreban i bibo kostra kao jedan radnik a menja do 8 radnika\r\n-rokova znatno je brzi od klasicnog radnika.', NULL, NULL),
(2928, 26, 1280, 'Naše tržište čine \r\n-Gradjevinske kompanije koje se bave tvrdom gradnjom \r\n-Kompanije i radnje  za prodaju   gradjevinske opreme\r\n-Kompanije koje se bave  maltanjem \r\n-Kompanije koje se bave izradom i nivelisanjem estriha, ploča i košuljica \r\nPrimarni market su srednje i velike kompanije.\r\nTargetirano područije je prvenstveno tržište Srbije I zapadne Evrope , u Srbiji posluje oko 16000 gradjevinskih firmi nas cilj je 5% tih preduzeća odnosno oko 800  tih preduzeća , a zatim širenje  na evropskom tržištu na kom posluje oko 400000 preduzeća naš cilj je oko 0,1% odnosno 4000 preduzeća .', NULL, NULL),
(2929, 27, 1280, 'Problem rešavamo za gradjevinske kompanije koje se bave nisko I visoko gradanjom, koje grade zidane objekte I objekte od betona kaoi  imaju problem sa radnom snagom ili žele da smanje operativne troškove rada kao što su koštanje radnika ili ušteda u materijalu I povećaju brzinu gradnje. \r\nKlijenti su firme koje zapošljavaju od 20 radnika pa na gore,sa jačim ekonomskim statusom. Ciljana grupa su klijenti koji grade srednje I veće objekte i  firme koje su na većem stupnju razvoja . Nase rešenje za kupce košta od 15000 do 30000 eu, košta kao jedan radnik u Evropi a isplati se za 3-4 meseca jer je brži 4 puta od radnika a zid je precizniji I tvrdji .\r\nPrepreke su strah od usvajanja tehnologija, strah od novog. \r\n.Razgovarali smo sa oko 50 firmi iz Srbije i oko 15 iz inostranstva i zaključili da bi 15% njih odmah kupilo proizvod i krenulo sa primenom . Našli smo i firmu za beta testiranje,  firma je Ukras AD i zapošljava preko 300 radnika kod nas i u Nemačkoj .', NULL, NULL),
(2930, 28, 1280, 'Inovativno resenje koje smo razvili  je 3d robot- portabilni samo pokretni printer, koji se kreće na sopstvenom pogonu  kontrolisan laserski a upravljan elektronski I na taj način štampa . \r\nMoze stamapati duzine do 500 metara. \r\nResava nedostatak radne snage-menja 4 do 8 radnika \r\nBrzina je 8 puta veca\r\nCena BIBA jednaka ceni  jednog radnika na godišnjem nivou.\r\nUšteda u materijalu \r\nPrednost u odnosu na konkurenciju  je:\r\n portabilan je \r\nlak je i malih dimezija  \r\nnisu mu potrebne vodjice kao kod ostalih 3d printera    \r\nne postoji nigde na svetu trenutni ni slicno rešenje . \r\nnisu mu potrebni veliki kranovi za prenošenje \r\njeftini je \r\npogodan je za serijsku proizvodnju', NULL, NULL),
(2931, 30, 1280, 'Trenutno je sistem gradnje veoma zastareo I u ovoj oblasti se I najmanje napredovalo po pitanju tehnickih inovacija, Tehnologija gradnje je  primitivna , prve zidane gradjevine su radjene pre oko 3000 godine u egiptu slaganjem kamenog bloka na blok ili cigle na ciglu sa slojem betona izmedju , taj sistem se koristi I danas samo su se materijali menjali, Vidimo ogroman potencijal za unapredjenje I jako dobar trenutak za plasiranje takve tehnologije kada je ona I najviše potrebna. \r\nKada su u pitanju zidovi od punog betona onda je to još puno komplikovaniji proces i  dosta skuplji  koji zahteva šalovanje odnosno oplate od drveta ili metala , alat za njihovo pričvršćivanje ankere I podupirače I jako puno vremena I bar 4 radnika dva za šalovanje I dva za nalivanje betona I ritlanje istog . \r\nTrenutno u svetu postoji jos oko par star app –a koji pokušavaju da reše problem ali smo u svakom pogledu daleko ispred konkurencije', NULL, NULL),
(2932, 29, 1280, 'BIBOT\r\n-	rešava nedostak radne snage , menja od 4 do 8 radnika.\r\n-	ušteda u pomoćnom materijalu nisu potrebne oplate ankeri skele I sl, \r\n-	Preciznost od 0,5mm\r\n-	Smanjuje troškove i do 70% \r\n-	Brzi je 4 do 8 puta od radnika \r\n-	Jeftin je - košta kao jedan radnik na godišnjem nivou \r\n-	U odnosu na sve ostale 3d printere { portabilan je )\r\n-	Samopokretan pri printanju -zahvaljujuci inovaciji koja je u postupku patentiranja\r\n-	Mali je - Moze da prodje na standardan otvor vrata \r\n-	Lak je - mogu ga nositi dva čoveka \r\n-	Multifunkcionalan je - 3u1 pored 3dprintinga moze vršiti I maltanje zidova kao I ravnanje estriža I ploča', NULL, NULL),
(2933, 32, 1280, 'Istraživanjem tržišta i konkurencije primetili smo da ne postoji ništa isto na tržištu ,  postoje 3d printeri ali sistem funkcionisanja je totalno  drugačiji I naš proizvod je više bot nego 3d printer . Takodje pretragom u Wipo bazi I bazi patentnog zavoda Srbije dobili smo isti rezultat da je prozivod inovativan i da ga je moguće patentirati.', NULL, NULL),
(2934, 37, 1280, 'Sproveli mo istraživanje na Wipo bazi kao I istraživanje u saradnji sa zavodom za intelektualnu svojinu u Republici Srbiji  I dobili pozitivaan odgovor da je IP pozicija slobodna I da je moguće patentirati proizvod . Zaštita proizvoda je u potupku i očekujemo patentiranje proizvoda za oko 12 do 18meseci . Pravo na intelektualnu svojinu će nositi  vlasnik I osnivač Denis Hamidovic kao fizicko lice .', NULL, NULL),
(2935, 40, 1280, 'U prvoj godini se očekuje minamalan prihod zbog više testiranja I velikih troškova istraživanja, marketinga, sertifikacije, patentiranja I ostali troškova ali nakon prve  godine očekujemo prodaju u drugoj godini od najmanje 30 printera gde bi promet bio oko 300000 eu a zarada 50000eu a zatim očekujemo povećanje prometa od 30 posto na godišnjem nivou .', NULL, NULL),
(2936, 41, 1280, 'Okupljeni smo oko godinu dana kao tim na rešavanju ovog konkretnog problema . Već imamo razvijen proizvod odnosno prototip, potrebna su još naknadna beta testiranja proizvoda koja traju malo duže . Rok za komercijalizaciju proizvoda I serisku proizvodnju će biti godinu dana , tako da bi smo već krajem sledeće godine mogli da počnemo sa prodajom proizvoda. Imamo saradnju sa mašinskim fakultetom iz Kragujevca, angažovali smo I dodatno osoblje koje će radi na daljem usavršavanju I testiranju BIBA . Ostvarili smo kontakte I sa dobavljačima opreme I senzora  I Siku kao dostavljača proverenog  dostavljača 3d materijala za printing. Izvršili smo I istraživanje I dobili jako pozitivne povratne reakcije od potencijalnih kupaca.', NULL, NULL),
(2937, 44, 1280, 'Učestvovali smo u mentorskom programu i programu za otpočinjanje biznisa RAS-a Razvojne Agencije Srbije.', NULL, NULL),
(2938, 45, 1280, 'Ne nismo prikupili  , u procesu smo apliciranja kod inovacionog fonda ali u svakom slucaju cemo uloziti i deo nasih sopstvenih sredstava.', NULL, NULL),
(2939, 48, 1280, 'Očekujemo najpre učlanjenje u tehnološki park Čacak sa kojima imamo dobru komunikaciju,  zatim mentorsku a onda I finansisku podršku . Pomoć nam je najpotrebnija za skaliranje biznisa , plasiranje proizvoda  na tržište. Uz pomoć NTP Čačak I Raising Starts-a dobićemo mentorsku pomoć, šansu za povezivanje sa akterima iz inovacionog ekosistema kao I mogućim partnerima,  preduzetnicima  I kupcima. Takodje očekujemo i manju podrška u razvoju tima , infrastrukturna podršku u slučaju da bude potrebna  I naposletku I finansijsku pomoć za koju konkurišemo.', NULL, NULL),
(2940, 49, 1280, 'Potrebno nam je oko 30000 eu, očekujemo pomoć od Inovacionog fonda gde smo trenutno u fazi kunkurisanja. Mi ćemo uložiti još oko 30 posto ličnih sredstava. \r\nNovac je potreban za beta testiranje proizvoda za patentiranje na Evropskom nivou I nivou Srbije kao I za agresivan marketing kako bi što pre osvojili deo tržišita.', NULL, NULL),
