INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(2955, 63, 1292, 'Naš tim se vodi idejom da domaćem, regionalnom i svetskom tržištu predstavi proizvode koji su napravljeni od sirovine iz domaćeg uzgoja bez korišćenja štetnih supstanci tokom uzgoja i prerade. Ambalaža u koju pakujemo svoje proizvode je od stakla uz etikete koje prate ideju premium proizvoda koji može da se pozicionira na svetskom tržištu. Novine koje donosimo su znatno unapređeni sosevi od sastojaka koji trenutno ne postoje ili su slabo zastupljeni. Najveća inovacija koju želimo da predstavimo su sosevi koji su znatno ljući od postojećih i namenjeni su istinskim zaljubljenicima u ljuto koji postojećim proizvodima ne mogu da zadovolje svoje potrebe kao i onima koji vodeći računa o ishrani na tržištu ne pronalaze soseve i namaze koji im u tom smislu odgovaraju.\r\nNa domaćem tržištu trenutno ne postoji sos od Karolina Riper paprike. Na globalnom tržištu postoje proizvođači koji se bave ovim proizvodom ali naše unapređenje se sastoji u tome što mi naš sos pakujemo u bočice od 30 ml sa pipetom radi lakšeg doziranja i pažljivije upotrebe.\r\nNamaz od ljubičastog luka koji proizvodimo je od 100% prirodnih sastojaka, bez šećera i veštačkih boja i predstavlja značajno poboljšanje na polju namaza kako na domaćem, tako i na globalnom tržištu.\r\nDomaći prirodni Barbecue sos je nešto u čemu vidimo veliki potencijal budući da je većina postojećih soseva slabog kvaliteta, prezasićena šećerom i napravljena od nekvalitetnih sirovina.\r\nNamaz od paprike je nešto što je takođe novo na našem tržištu kojim dominiraju ajvari. Namenjen je konzumaciji uz sireve, sendviče i jela od mesa.\r\nHabanero sos je nešto što postoji na domaćem tržišu ali u dosta manjoj meri od soseva koji se prave od raznih mikseva čili paprika koje se dodaju paradajzu i na taj način proizvode. Kada je naš sos u pitanju akcenat je na paprici i jednostavnosti sastojaka kako bi se na pravi način predstavila aroma i ljutina te sorte. U naš sos ne dodajemo paradajz, boje i arome već se fokusiramo na ono što sama paprika nosi u sebi i po tome smo jedinstveni na tržištu.\r\nHalapenjo sos je nešto što je takođe jako slabo zastupljeno na našem tržištu u konkurenciji soseva koji se prave od ove paprike. Predstavlja savršen izbor za ljubitelje ljutog koji nisu preterani zaljubljenici u isto i vole nešto malo manje intenzivno. U pitanju je sos koji je pored karakteristične halapenjo paprike obogaćen belim lukom i začinima.\r\nBudući da mi lično nemamo iskustva u poljoprivrednom uzgoju planiramo da uz konsultacije sa Poljoprivrednim fakultetom razvijemo Know How koji ćemo predstavljati poljoprivrednicima koji se već bave uzgojem povrća i poseduju adekvatne alate za to. Uz Know how oni bi od nas dobijali semenski materijal, mogućnost konsultacije sa stručnjacima Poljoprivrednog fakulteta i garanciju da ćemo nakon berbe otkupiti ugovorenu količinu po unapred dogovorenim cenama. Tim modelom planiramo da se vodimo prve 3 godine. Nakon toga ćemo u zavisnosti od stepena razvoja na kojem budemo bili razmišljati o tome da li imamo dovoljno iskustva i znanja da sami uzgajamo sirovinu.\r\nDakle, mi pružamo podršku partnerima po pitanju uzgoja sirovine, prerađujemo je uz nadzor angažovanog tehnologa i distribuiramo gotove inovativne ili znatno poboljšane postojeće prehrambene proizvode pod brendom ZINI - Premium natural food.', NULL, NULL),
(2956, 71, 1293, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2957, 17, 1294, 'Naš tim se vodi idejom da domaćem, regionalnom i svetskom tržištu predstavi proizvode koji su napravljeni od sirovine iz domaćeg uzgoja bez korišćenja štetnih supstanci tokom uzgoja i prerade. Ambalaža u koju pakujemo svoje proizvode je od stakla uz etikete koje prate ideju premium proizvoda koji može da se pozicionira na svetskom tržištu. Novine koje donosimo su znatno unapređeni sosevi od sastojaka koji trenutno ne postoje ili su slabo zastupljeni. Najveća inovacija koju želimo da predstavimo su sosevi koji su znatno ljući od postojećih i namenjeni su istinskim zaljubljenicima u ljuto koji postojećim proizvodima ne mogu da zadovolje svoje potrebe kao i onima koji vodeći računa o ishrani na tržištu ne pronalaze soseve i namaze koji im u tom smislu odgovaraju.\r\nNa domaćem tržištu trenutno ne postoji sos od Karolina Riper paprike. Na globalnom tržištu postoje proizvođači koji se bave ovim proizvodom ali naše unapređenje se sastoji u tome što mi naš sos pakujemo u bočice od 30 ml sa pipetom radi lakšeg doziranja i pažljivije upotrebe.\r\nNamaz od ljubičastog luka koji proizvodimo je od 100% prirodnih sastojaka, bez šećera i veštačkih boja i predstavlja značajno poboljšanje na polju namaza kako na domaćem, tako i na globalnom tržištu.\r\nDomaći prirodni Barbecue sos je nešto u čemu vidimo veliki potencijal budući da je većina postojećih soseva slabog kvaliteta, prezasićena šećerom i napravljena od nekvalitetnih sirovina.\r\nNamaz od paprike je nešto što je takođe novo na našem tržištu kojim dominiraju ajvari. Namenjen je konzumaciji uz sireve, sendviče i jela od mesa.\r\nHabanero sos je nešto što postoji na domaćem tržišu ali u dosta manjoj meri od soseva koji se prave od raznih mikseva čili paprika koje se dodaju paradajzu i na taj način proizvode. Kada je naš sos u pitanju akcenat je na paprici i jednostavnosti sastojaka kako bi se na pravi način predstavila aroma i ljutina te sorte. U naš sos ne dodajemo paradajz, boje i arome već se fokusiramo na ono što sama paprika nosi u sebi i po tome smo jedinstveni na tržištu.\r\nHalapenjo sos je nešto što je takođe jako slabo zastupljeno na našem tržištu u konkurenciji soseva koji se prave od ove paprike. Predstavlja savršen izbor za ljubitelje ljutog koji nisu preterani zaljubljenici u isto i vole nešto malo manje intenzivno. U pitanju je sos koji je pored karakteristične halapenjo paprike obogaćen belim lukom i začinima.\r\nBudući da mi lično nemamo iskustva u poljoprivrednom uzgoju planiramo da uz konsultacije sa Poljoprivrednim fakultetom razvijemo Know How koji ćemo predstavljati poljoprivrednicima koji se već bave uzgojem povrća i poseduju adekvatne alate za to. Uz Know how oni bi od nas dobijali semenski materijal, mogućnost konsultacije sa stručnjacima Poljoprivrednog fakulteta i garanciju da ćemo nakon berbe otkupiti ugovorenu količinu po unapred dogovorenim cenama. Tim modelom planiramo da se vodimo prve 3 godine. Nakon toga ćemo u zavisnosti od stepena razvoja na kojem budemo bili razmišljati o tome da li imamo dovoljno iskustva i znanja da sami uzgajamo sirovinu.\r\nDakle, mi pružamo podršku partnerima po pitanju uzgoja sirovine, prerađujemo je uz nadzor angažovanog tehnologa i distribuiramo gotove inovativne ili znatno poboljšane postojeće prehrambene proizvode pod brendom ZINI - Premium natural food.', NULL, NULL),
(2958, 22, 1294, 'U prethodnih godinu ipo dana smo sarađivali na projektima sistematizacije rada i prodajnog sektora kompanije Il Toro Nero DOO u kojem je Anja Čelebić menadžer marketinga i prodaje. Radili smo na definisanju zaduženja i odgovornosti svih zaposlenih, sistematizaciji radnih mesta i organizacione strukture. Mimo toga radili smo na razvoju prodajnih kanala, segmentaciji kupaca i razvoju distributivne mreže.\r\nOvo je prvi put da radimo na razvoju Start Up ideje ali kroz ovih više od godinu dana smo jasno definisali uloge i pokazalo se da kao tim odlično funkcionišemo. \r\nSpremni smo da se full time posvetimo razvoju ove kompanije.', NULL, NULL),
(2959, 23, 1294, 'Ovaj program vidimo kao priliku da dobijemo podršku koja nam je neophodna u ovoj fazi razvoja. Ono što nas, mimo finansijske investicije, dodatno motiviše je program obuke koji bi nam višestruko značio kako bismo potencijalno dobijena sredstva iskoristili na najbolji mogući način. Na ovaj program gledamo kao na priliku koja će nam otvoriti mnoga vrata u budućnosti i kao prvi veliki korak ka razvoju naše ideje i širenja ZINI brenda prvo na region a zatim i globalno.\r\nBudući da je razvoj ideje i njeno konkretizovanje u gotov proizvod vrhunskog kvaliteta jako složen proces svaka podrška nam znači. Smatramo da smo došli u fazu u kojoj nam je neophodan dodatni kapital kako bismo svoje proizvode dodatno usavršili i predstavili ih celom svetu. Kroz proces razvoja ove ideje shvatili smo njen pun potencijal i spremni smo da se u potpunosti posvetimo njenoj daljoj razradi i plasiranju. Svesni smo velikog benefita ovog programa i vidimo ga kao jedinstvenu priliku za nas u ovom trenutku.', NULL, NULL),
(2960, 24, 1294, 'Premium natural food', NULL, NULL),
(2961, 25, 1294, 'Na tržištu ne postoje ljuti sosevi koji akcenat stavljaju na papriku. Namazi i roštilj sosevi koji su zastupljeni u maloprodajama daleko su od prirodnih i po pitanju sastava i načina uzgoja sirovine. Donosimo zdrave i ukusne proizvode čime zadovoljavamo potrebe onih koji vode računa o svojoj ishrani a u proizvodima koji su naša konkurencija ne pronalaze to.\r\nTržište je zasićeno ljutim sosevima čiji primarni sastojci nisu paprike, već paradajz i dodaci. Rezultat su sosevi nedovoljne ljutine za ljude koji upravo to traže kao i proizvodi koji su visoko kalorični i nezdravi. Kako bi se postigao željeni efekat potrebne su velike količine samog proizvoda stoga nastaje problem velike potrošnje u industrijama koje uključuju posluživanje hrane. Nastojimo da rešimo ovaj problem tako što je dovoljna jako mala količina sosa da bi zaljutila velike količine hrane kada je to potrebno a pojedinačnim kupcima pružamo proizvode koji su mnogo kvalitetniji i zdraviji od onih koji trenutno postoje.', NULL, NULL),
(2962, 26, 1294, 'Tržište za naše proizvode su pored ljudi koji konzumiraju ljuto i svi oni koji uživaju u dodacima hrani vodeći računa o njihovom kvalitetu. Istraživanje smo započeli sa proizvodima koji su ljuti a planiramo da svoju ponudu upotpunimo i proizvodima koji to nisu kako bismo proširili bazu konzumenata. Naši kupci su, pored fizičkih lica i restorani, burger barovi i objekti u sklopu čije usluge postoji posluživanje hrane a koji neguju imidž svog objekta kao premium i kvalitetan. Ciljna grupa su nam i objekti koji masovno proizvode hranu kao i kompanije koje se bave i posluživanjem hrane (hoteli, avio kompanije, brodovi)\r\nU prvoj godini fokus je na prodaji u maloprodajama i restoranima u zemlji kao i na planove za regionalno širenje. U drugoj godini poslovanja pored regionalnog plasmana planiramo i ekspanziju na ostale zemlje Evrope i sveta. Svoje proizvode vidimo kao priliku da premium srpski proizvod predstavimo svetu i da ga svet prepozna kao nešto što će ga asocirati na Srbiju.', NULL, NULL),
(2963, 27, 1294, 'Pojedincima koji su ljubitelji kvalitetne domaće hrane koja im je slabo dostupna u maloprodajama.\r\n\r\nLancima maloprodaja i prodavnicama zdrave hrane u čijoj ponudi je ova vrsta proizvoda deficitarna.\r\n\r\nOrganizacijama i biznisima koji u sklopu svoje primarne delatnosti imaju i uslugu posluživanja hrane a koji u trenutnoj ponudi usled prezasićenosti industrijski proizvedene hrane nemaju izbor poput ovog koji mi donosimo.\r\n\r\nOrganizacijama koje se bave proizvodnjom velike količine obroka.\r\n\r\nNa osnovu dosadašnjeg istraživanja i prodaje putem online kanala dobili smo pozitivne utiske i potvrdu da su naši proizvodi novitet na tržištu. Direktnim dodirom sa potrošačima dobili smo potvrdu da postoji potražnja za proizvodima koje nudimo i da su kupci zainteresovani za njih.', NULL, NULL),
(2964, 28, 1294, 'Sos od Carolina Reaper parike trenutno ne postoji u našoj zemlji. Prednost našeg sosa u odnosu na konkurenciju je to što se proizvodi na 100% prirodan način sa fokusom na paprici kao glavnom sastojku a ne paradajzu, uz autentično pakovanje u bočicu sa pipetom što olakšava doziranje.\r\nKarakteristika svih naših proizvoda je to što je fokus na proizvodu koji ne sadrži štetne materije i veštačke dodatke, napravljen je od prirodnih sastojaka i pruža intenzivan ukus. Želimo da pružimo kvalitet jednako dobar ili bolji od lidera u delatnosti kojom se bavimo I da koristeći velike poljoprivredne potencijale Srbije predstavimo proizvod koji je u svakom pogledu zdraviji i prihvatljiviji za kupca.', NULL, NULL),
(2965, 30, 1294, 'Kada je u pitanju ljutina kupci potrebe trenutno zadovoljavaju dodavanjem veće količine manje ljutih soseva koji trenutno postoje na tržištu. Što se tiče ostalih proizvoda smatramo da su, naročito domaći kupci, osuđeni na ono što imaju na raspolaganju. Izbor se svodi na dosta manje ukusne i svakako nezdrave soseve i namaze iz kategorije jeftinijih ili na znatno skuplji Heinz ili Tabasco. Mi možemo da pružimo kvalitet i ukus svoje konkurencije ali na domaći i zdrav način uzgoja i prerade sirovine.', NULL, NULL),
(2966, 29, 1294, 'Prvenstveno naš proizvod je napravljen od prirodnih sastojaka, bez šećera, guma, veštačkih boja i ostalih dodataka. Naša vizija i slogan su da mi predstavljamo kupcu kvalitet koji on ceni i pruža mu zadovoljstvo da bude korisnik proizvoda koji je namenjen baš njegovim potrebama. Pored toga što naši sosevi i namazi nisu štetni po zdravlje oni su ukusni i predstavljaju brend sa vizijom namenjen ljudima koji koristeći ih osećaju pripadnost zbog toga. Naše proizvode karakteriše jednostavnost ukusa i fokus na karakteristike glavne sirovine.\r\nJedinstveni smo po tome što kroz mrežu uzgajivača i akcenat na prirodnoj preradi predstavljamo proizvode koji su novina na tržištu.', NULL, NULL),
(2967, 32, 1294, 'Carolina Reaper sos predstavlja potpunu novinu na našem tržištu. Svi ostali proizvodi iz našeg asortima su značajno poboljšani iz razloga koje smo naveli u odgovorima iz prethodnih sekcija.\r\nTakođe, svi naši proizvodi su pakovani u staklenu ambalažu a sosevi u flašicama od 100ml u grlu imaju regulator koji redukuje grlo kako bi izlazila manja količina sosa čime se sprečava rasipanje.', NULL, NULL),
(2968, 37, 1294, 'Sproveli smo istraživanje na temu zaštite logotipa i slogana. Ovo smatramo bitnim u cilju širenja prepoznatljivosti našeg brenda i sprečavanja kopiranja.\r\nPrilikom registracije i zaštite pomenutih elemenata vlasnik te intelektualne svojine će biti privredno društvo koje planiramo da osnujemo - Premium natural food DOO', NULL, NULL),
(2969, 40, 1294, 'Premium natural food Doo prve godine planira da zarađuje od prodaje na domaćem tržištu prvenstveno kroz B2B aranžmane. Nakon tog iskustva planiramo da angažujemo distributere u okruženju a zatim i ostatku Evrope i sveta i na taj način zarađujemo od prodaje.', NULL, NULL),
(2970, 41, 1294, 'Naša ideja je rođena 2020. godine kada smo napravili namaz od paprike. Dobili smo pozitivne utiske i nastavili smo dalje.\r\nNakon toga smo napravili ljuti sos i namaz od ljubičastog luka. Tada je potvrđena potreba za proizvodima koje razvijamo.\r\nKonsultovali smo tehnologa sa višegodišnjim iskustvom i dogovorili saradnju.\r\nOsoba koja je planirana za menadžera proizvodnje je završila obuku za HACCP aministratora. \r\nOve godine smo nakon istraživanja i testiranja došli do recepture za 2 sosa: Habnero i Carolina Reaper. Napravili smo web sajt i društvene mreže.\r\nImamo u vlasništvu i objekat u Pirotu koji ćemo registrovali za proizvodnju većeg kapaciteta.\r\nKontaktirali smo Kulinarsku asocijaciju Srbije i dobili preporuku kuvara sa višedecenijskim iskustvom koji bi za nas izradio recepturu za proizvode koje imamo u planu za naredni godinu a to su:\r\n1. Habanero sos \r\n2. Halapenjo sos\r\n3. Carolina Reaper sos\r\n4. Namaz od ljubičastog luka sa začinima \r\n5. Namaz od paprika\r\n6. Roštilj sos', NULL, NULL),
(2971, 44, 1294, 'Do sada nismo učestvovali u sličnim programima.', NULL, NULL),
(2972, 45, 1294, 'Ovo je naša prva prijava za finansiranje tako da do sada nismo imali ni jedan izvor finansiranja osim ličnih sredstava.', NULL, NULL),
(2973, 48, 1294, 'Prventveno su nam potrebna finansijska sredstva kako bismo pribavili sve ono što je neophodno kako  bismo uspeli da proizvedemo prvu seriju gore navedenih proizvoda u količinama koje mogu da zadovolje domaće tržište i izlazak na njega.\r\nPored toga potrebni su nam mentorski program i obuke koje su uključene u program kako bismo se dodatno edukovali i na najefikasniji način upotrebili dobijena sredstva radi maksimizacije efekta.', NULL, NULL),
(2974, 49, 1294, 'U trenutnoj fazi nam je okvirno potrebno 30.000 EUR za sledeću namenu:\r\n\r\nKonsultacije sa kuvarom i izrada konačne recepture\r\nKonsultacije sa poljoprivrednim fakultetom u vezi nabavke semena za ključnu sirovinu, konsultacija oko načina uzgoja i  očekivanog prinosa.\r\nAnalize proizvoda i dobijanje dozvola\r\nUvođenje HACCP standarda\r\nUvođenje ISO standarda\r\nKupovina online alata \r\nAngažovanje tehnologa\r\nNabavka opreme za proizvodnju\r\nUzgoj i nabavka sirovine\r\nNabavka ambalaže i etiketa\r\nTroškovi plasmana i marketinga \r\nZaštita žiga\r\n\r\nZa ostatak sredstava za investicije koje nisu predviđene ovim programom bismo aplicirali kod Erste banke kroz program Start up kredita od 10.000 EUR, kao i za programe Fonda za razvoj. Ta sredstva su nam prvenstveno potrebna za adaptaciju objekta koja nije pokrivena ovim programom. Mimo toga za sve što je neophodno a nije pokriveno navedenim programima uložili bismo i lična sredstva.', NULL, NULL),
