(2978, 83, 1300, NULL, NULL, NULL),
(2979, 89, 1301, 'U toku studija na Fakultetu likovnih umetnosti u Beogradu Anja je uz slikarske angažmane radila i na promociji i marketingu kompanija Road Rail Company DOO i Il Toro Nero DOO. Radila je na kreiranju promotivnog materijala i strategiji marketinških kampanja i razvoju prodajnih kanala. Kreativnost i slikarsko umeće stavila je u službu marketinga i prodaje čime se uspešno bavi kao full time menadžer marketinga i prodaje u kompaniji Il Toro Nero DOO od jula 2020. godine.', NULL, NULL),
(2980, 90, 1301, '- Potpuno posvećen\r\n- Menadžer marketinga i prodaje', NULL, NULL),
(2981, 91, 1301, 'Full time menadžer marketinga i prodaje - Il Toro Nero DOO', NULL, NULL),
(2982, 89, 1302, 'Tokom studija na Pravnom fakultetu Nikola je aktivno učestvovao u aktivnostima nevladinih organizacija a koosnivač je studentske organizacije Šansa za sve. Kroz brojne projekte, što kao učesnik, što kao organizator se susreo sa velikim brojem privrednika i start upova aktivno radeći na stalnom usavršavanju iz oblasti preduzetništva. Više puta je bio na vodećim pozicjama u organizacijama a trenutno obavlja funkciju direktora.', NULL, NULL),
(2983, 90, 1302, '- Kreator ideje\r\n- Direktor i menadžer razvoija', NULL, NULL),
(2984, 91, 1302, 'Full time direktor - Saruna Skyline System DOO', NULL, NULL),
(2985, 71, 1304, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(2986, 71, 1305, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2987, 71, 1306, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(2988, 63, 1309, 'Softer je namnjen za kompanije koje se bave transportom na teritoriji USA. Olakšava posao vođenja firme i pomaže u praćenju zakonskih pravila i dostupnosti dokumenata i fajlova.', NULL, NULL),
(2989, 71, 1310, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(2990, 17, 1311, 'Softer je namnjen za kompanije koje se bave transportom na teritoriji USA. Olakšava posao vođenja firme i pomaže u praćenju zakonskih pravila i dostupnosti dokumenata i fajlova.', NULL, NULL),
(2991, 22, 1311, 'Nismo', NULL, NULL),
(2992, 23, 1311, 'Mogućnost da sarađujemo sa stranim kompanijama i doprinesemo njihovom lakšem radu.', NULL, NULL),
(2993, 24, 1311, 'Via Safer - track your truckin', NULL, NULL),
(2994, 25, 1311, 'Problem pribavljanja, arhiviranja dokumentacije i komunikacije unutar kompanije. Softver je zamišljen da uvek ostavlja trag ko je uneo ili obrisao dokument iz programa.', NULL, NULL),
(2995, 26, 1311, 'Isključivo tržište Severne Amerike ( Amerika i Kanada), procenjujemo da ima preko 10.000 kompanija.', NULL, NULL),
(2996, 27, 1311, 'Kupci su sve kompanije koje se bave transportom na teritoriji Severne Amerike. Već 4 godine sarađujemop sa 3 kompanije stalno i imali smo 6 kompanija sa kojima smo radili povremeno i uvek je bio isti problem loše organizacije i komunikacije vezano za dokumentaciju i istek važenja pojedinih dokumenata(registracije, tehnički pregledi, osiguranja), tako da iz tih parametara možemo da zaključimo da im je potreban program koji čuva sve promene i ne ograničava broj korisnika.', NULL, NULL),
(2997, 28, 1311, 'Proizvod nije možda inovativan, ali svakako može da ima veliku primenu jer je bi bio doveden do nivoa proste upotrebe, i bez neke dugotrajne obuke, bi mogao svako da ga koristi. Program sam prikazuje koji dokument ide u koji folder i beleži ko user ga je uneo,pa vlasnik može da prati tok unosa i brisanja dokumenata važnih za poslovanje.', NULL, NULL),
(2998, 30, 1311, 'Uglavnom koriste google drive, ali je primećeno da se dokumenti imenuju različito, svi korisnici su ulogovani na isti email, pa se ne zna ko je ubacio ili obrisao dokument i tako nastaju problemi. Ovako, uvek imaju uvid ko je kad ubacio ili obrisao dokument i podeljeno je po korisnicima ko ima pristup kojim tipovima dokumenta.', NULL, NULL),
(2999, 29, 1311, 'Proizvod smanjije mogućnost greške i usmerava korisnike koji dokument ide u koji folder, vlasnik kompanije uvek ima uvid ko je i kada dodao dokumente, može da zadaje zadatke članovima tima, da prati iznose i cene tura koje je prevezao, a da se ne boji da će neko ko nije ovlašćen videti neki podatak koji se njega ne tiče.', NULL, NULL),
(3000, 32, 1311, 'Proizvod je u odnosu na konkurenciju dosta uprošćen i ima sve neophodne stavke koje su potrebne da kompanije može da isprati sve što joj je neophodno za poslovanje. Naravno uz pomoć, program treba poboljšavati ali do nivoa da ne predstavlja komplikaciju za korisnike.', NULL, NULL),
(3001, 37, 1311, 'Nismo sproveli nikakvo konkretno istraživanje osim što smo razgovarali sa klijentima i odradili evaluaciju njihovih potreba.', NULL, NULL),
