(3003, 41, 1311, 'Na ovoj ideji radimo više od 3 godine, prvo smo napravili program za obračunavanje miljaže i goriva po državi, i uz jednu pauzu usled korone, nastavili smo pre 6 meseci da proširujemo program. Do danas, uspešno unapređujemo i nadograđujemo program, ali nam treba podrška kao bismo projekat doveli u fazu široke primene.', NULL, NULL),
