(3007, 49, 1311, 'Potrebno nam je CHF 10.000,00 kako bismo uložili u dodatnu radnu snagu i marketing(online facebook,instagram,baneri na websajtovima koji Američki vozači i kompanije koriste za vesti i informisanje). To bi bila druga i najvažnija vaza razvoja, u kojoj bismo se pripremili za treću fazu, a to je potpisivanje ugovora sa klijentima i osiguravanje poslovnog prihoda.', NULL, NULL),
