(3039, 63, 1336, 'U pitanju je aplikacija sa pričama za decu. Život je sve ubrzaniji i haotičniji, a lagodnost sve važnija: ne morate kupovati na desetine knjiga sa dečjim pričama, držati ih sve uz krevet ili ustajati da nađete onu knjigu sa basnama, ili baš onu knjižicu sa mitom o Tezeju koja se nalazi u Mitovima br. 2, kao ni gomilati knjige za decu koje vam za koju godinu neće ni trebati. Koliko god mi voleli miris nove knjige i iskustvo listanja, budimo iskreni, lagodnosti je teško odoleti -  a to se naročito odnosi na roditelje milenijalce. Sve najlepše priče su sada nadohvat ruke, u aplikaciji koja je intuitivna, sa odgovarajućim brojem kvalitetnih ilustracija, današnjoj deci prilagođenim jezikom. U glavnom meniju će se naći kategorije priča (bajke, basne, priče, mitovi). Ciljna grupa su roditelji milenijalci koji čitaju deci priče.', NULL, NULL),
(3040, 71, 1337, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3041, 17, 1338, 'U pitanju je aplikacija sa pričama za decu. Život je sve ubrzaniji i haotičniji, a lagodnost sve važnija: ne morate kupovati na desetine knjiga sa dečjim pričama, držati ih sve uz krevet ili ustajati da nađete onu knjigu sa basnama, ili baš onu knjižicu sa mitom o Tezeju koja se nalazi u Mitovima br. 2, kao ni gomilati knjige za decu koje vam za koju godinu neće ni trebati. Koliko god mi voleli miris nove knjige i iskustvo listanja, budimo iskreni, lagodnosti je teško odoleti -  a to se naročito odnosi na roditelje milenijalce. Sve najlepše priče su sada nadohvat ruke, u aplikaciji koja je intuitivna, sa odgovarajućim brojem kvalitetnih ilustracija, današnjoj deci prilagođenim jezikom. U glavnom meniju će se naći kategorije priča (bajke, basne, priče, mitovi). Ciljna grupa su roditelji milenijalci koji čitaju deci priče.', NULL, NULL),
(3042, 22, 1338, 'Jovana i ja smo dugogodišnji prijatelji - još iz Filološke gimnazije. Kao đaci imale smo puno prilika da zajednički radimo na projektima, a nakon gimnazije smo strukovno otišle u različitim pravcima (Jovana na književnost, a ja na Antropologiju i kasnije Novinarstvo podataka. Aleksandra smo upoznale pre tri godine i postao je deo našeg društva. U te tri godine imali smo priliku da sa njim radimo jedan projekat koji je bio poklon zajedničkoj drugarici - gde je Aleksandar pokazao svoje dizajnerske veštine, a Jovana spisateljske i uređivačke. Sada sve troje imamo priliku da kao ilustrator, književnik i antropolog spojimo svoje ekspertize u inspirativnoj biznis ideji kao što je Storyteller aplikacija za decu.', NULL, NULL),
(3043, 23, 1338, 'Smatramo da smo pogodni kandidati iz tri razloga: 1. Dovoljno smo različitih ekspertiza da bismo bili komplementarni, svako doprinoseći na svom polju, zahvaljujući čemu pokrivamo veliki deo posla koji je neophodan za ovakav startap, te su zahtevi za drugim ekspertizama minimalni (Jovana se bavi uređivanjem, lektorisanjem, pisanjem i prevođenjem tekstova, Aleksandar dizajnom ilustracija i marketinškog materijala, a Vanja marketingom, analizom podataka i razvojem aplikacije. 2. Povezuje nas dugogodišnje poznanstvo i poverenje neophodno za zajednički rad na poslovnoj ideji. 3. Motivisani smo željom da i roditeljima i deci današnjice omogućimo kvalitetno zajednicko vreme, uz pomoć savremene tehnologije koja se u našem projektu stavlja u službu razvijanja dečjih kognitivnih veština, imaginativnosti (suprotno današnjim tendencijama), emocionalne inteligencije, kao i učvršćivanja autenticnog odnosa između dece i roditelja u zajednički provedenom vremenu. Upravo ta želja je i ujedinila ovaj tim.', NULL, NULL),
(3044, 24, 1338, 'Najlepše priče, uvek pri ruci.', NULL, NULL),
(3045, 25, 1338, 'Ono što je Netflix za filmove i serije, mi želimo da budemo za priče za decu. Ne morate gomilati knjige s kojima ne znate šta ćete za koju godinu, ustajati iz kreveta da promenite knjigu, nositi knjige na putovanja. Ne morate tokom čitanja priče adaptirati jezik jer je neprilagođen deci, sa previše kitnjastim/arhaičnim rečnikom. Ne morate ići na Google Images kako biste, pokazali detetu predmet iz priče koji mu je nepoznat. Problem postoji i globalno. Svest o problemu dolazi iz lične frustracije, svakodnevne (svakovečernje). Problem i potreba za aplikacijom su potvrđeni intervjuima obavljenim sa roditeljima vrtića Korak po korak i vrtica Izvrnuta torta, koji su sa entuzijazmom dočekali i podržali ideju razvoja ovakve aplikacije. Problem nije težak: IT kompanija je tu da razvije aplikaciju i da je održava, književnik/lektor da uredi tekstove, illustrator da ilustruje i analitičar podataka da informiše dalje biznis odluke koje se tiču optimizacije proizvoda i marketinških napora.', NULL, NULL),
(3046, 26, 1338, 'Naše ciljano tržište su pre svega roditelji milenijalci, dece od 3 do 7 godina, koji žive na području srpskog govornog područja (Srbija, Hrvatska, Bosna i Hercegovina i Crna Gora). Procenjena veličina tržišta je 161.000 majki ili očeva dece od 3 do 7 godina koji imaju jedno, dvoje ili troje dece. ***Izvori: Republički zavod za statistiku Srbije, Državni zavod za statistiku R. Hrvatske, Federalni zavod za statistiku BiH, Gapminder, https://www.statista.com/. Priče kao simulakrumi realnosti ne poznaju nacionalne granice - prevodilaštvo, umerena adaptacija sadržaja (uključivanjem priča lokalnog porekla) i dobar marketing plan bi lako učinili da aplikacija dobije globalni značaj. Naredna tržišta bi bila englesko, špansko i rusko govorno područje.', NULL, NULL),
(3047, 27, 1338, 'Naši kupci su roditelji milenijalci, dece od 3 do 7 godina. To su roditelji koji brzo žive, saživljeni sa tehnološkim uređajima. Njihov strah (ili painpoint) jeste nedostatak kvalitetno provedenog vremena sa decom, sumnja i najverovatnije činjenica da nisu dovoljno prisutni, bar ne onoliko koliko bi želeli, u determinišućem razvojnom periodu svoje dece, njihovom detinjstvu. Sproveli smo fokus grupe sa roditeljima vrtića Korak po korak i Izvrnuta torta, koji su sa entuzijazmom dočekali i podržali ideju razvoja ovakve aplikacije. Intervjuisani roditelji su visokoobrazovani i svojoj deci čitaju priče svaki ili svaki drugi dan, i ono što je važno za nas, nisu upoznati sa postojanjem nijedne aplikacije koja nudi sličnu lagodnost.', NULL, NULL),
(3048, 28, 1338, 'Planiramo da razvijemo hibridnu aplikaciju (za Android i iOS) koja će sadržati veliku bazu priča za decu, u glavnom meniju izdeljenih na kategorije, koja će biti user-friendly i intuitivna, sa odgovarajućim brojem ilustracija, opcijom markiranja omiljenih priča, kao i opcijom download-a. Ono što naš proizvod čini jedinstvenim jeste kastomizacija - želimo da se prilagodimo, kako jeziku roditelja, tako i jeziku dece, kao i da odgovarajućim brojem kvalitetnih ilustracija ispratimo tekstualni sadržaj.', NULL, NULL),
(3049, 30, 1338, 'Mnogi od intervjuisanih roditelja rešavaju ovaj problem pristupom sajtovima koji sadrže priče, često neprilagođenih mobilnim telefonima ili punih reklama, sa dosta zumiranja i gašenja banera. Oni koji ne rešavaju problem, gomilaju knjige i primorani su da ih nose sa sobom na zimovanja i letovanja, još uvek nesvesni lagodnosti koju bi ovakva aplikacija pružila.', NULL, NULL),
(3050, 29, 1338, 'Dva glavna benefita Storyteller aplikacije su lagodnost i kastomizacija. Lagodnost - najlepše priče, uvek pri ruci. Kastomizacija - na svom jeziku, jezikom prilagođenim deci (bez arhaizama i kitnjastog rečnika, ali opet dovoljno bogatog koji omogućava rast fonda reči deteta), sa odgovarajućim brojem ilustracija kako bi iskustvo čitanja priče bilo bogatije. Vrednosti koje okružuju Storyteller aplikaciju su sledeće: 1) Edukacija - priče su simulakrumi realnosti (ili kako ih Jonathan Gottshall naziva, simulatori letenja za buduće pilote) kroz koje sva deca sveta, bez obzira na rasu, lako uče o životnim situacijama, stičući životna iskustva kroz priču. 2) Kvalitetno zajedničko vreme, zajedničko iskustvo u imaginarnom svetu priče. 3) Eco Friendly: korišćenje aplikacija za čitanje priča smanjuje pritisak na štampu/papir. 4) Deljenje (jedan Premium nalog se može koristiti na do 5 uređaja).', NULL, NULL),
(3051, 32, 1338, 'Proizvod je značajno poboljšan u odnosu na druge aplikacije slične namene budući da bi bio jedini na našem tržištu koji je potpuno prilagođen dečijem jeziku (bez arhaizama i kitnjastog rečnika, a opet sa dovoljno bogatim jezikom kako bi deca širila svoj fond reči), kao i da je jedini koji sadrži dovoljan broj kvalitetnih ilustracija, istog autora za sve priče, čime se gradi jasan identitet, pa samim tim i jasna prepoznatljivost proizvoda. Procenjeno vreme čitanja, opcija za download, siže priče (kako bi roditelji i deca lakše birali željenu priču), kao i mogućnost markiranja omiljenih priča se ni u jednoj dostupnoj aplikaciji zajedno ne mogu naći, bilo stranih ili domaćih.', NULL, NULL),
(3052, 37, 1338, 'Storyteller aplikacija bi bila vlasnik naziva startapa, logotipa, ilustracija, koda. Uvrštene priče ne bi podlegle Zakonu o zaštiti autorskog i srodnih prava, budući da su u pitanju autori od čije smrti je prošlo više od 70 godina. Prava vezana za naziv, logotip, ilustracije i kod bismo regulisali sa advokatom, po sistemu copyright i privacy policy.', NULL, NULL),
(3053, 40, 1338, 'Deo sadržaja aplikacije će biti svim korisnicima dostupan, a za otključavanje celokupnog sadržaja će biti potrebna godišnja pretplata u iznosu od 10 evra. Pored sadržaja, pretplatom se otključava i mogućnost skidanja priča (što za roditelje koji ne vole da im u blizini deteta telefon bude konektovan na internet predstavlja dodatnu vrednost, kao i za prilike kao što su putovanja, kada je internet konekcija upitna). Jedan pretplaćeni profil će moći da se koristi na 5 različitih uređaja, što je još jedan additional value proizvoda (pretplaćeni korisnici će moći sa porodicom/prijateljima da podele svoj nalog) - korak kojim se pritom podstiče i WOM marketing. Na kraju, ali nikako i najmanje važno, u skladu sa integritetom kao jednom od naših vrednosti, aplikacija će biti ad-free, u potpunosti bez reklama.', NULL, NULL),
(3054, 41, 1338, 'Oko ideje smo okupljeni od leta 2021, od kada budno motrimo na programe kao što je RaisingStarts. Ključni ciljevi postignuti do sada jesu utvrđivanje potrebe koncepta u okviru ciljne grupe, informisanje o tehnološkoj izvodljivosti proizvoda sa indijskom IT kompanijom Dollop, kao i manama i prednostima različitih rešenja (modeli supskripcije, nativna vs. hibridna aplikacija) i okvirnom budžetu potrebnom za razvoj biznis ideje. Naš tim je neizmerno obogaćen skorašnjim partnerstvom sa karakter dizajnerom Aleksandrom Obradovićem, koji će doprineti proizvodu dizajnom i ilustracijom tekstova. Zatim, obavljeno je istraživanje sličnih proizvoda, kako domaćeg, tako stranog porekla u cilju utvrđivanja potreba korisnika, kao i prilagođavanja stepena inovativnosti potrebama na tržistu.', NULL, NULL),
