(3075, 63, 1354, 'Inovacija se odnosi na kreiranje rezervacionog softvera, koji bi olakšao pronalazak adekvatnih turističkih sadržaja u Srbiji za kupce raznih profila, a koji bi imao jasno definisane oblasti: seoski turizam, hotelski, banjski, kampovi za decu, ponude agencija i slično... Cilj je okupiti sve informacije na jednom mestu i tako skratiti vreme provedeno u pretraživanju aranžmana.', NULL, NULL),
(3076, 71, 1355, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3077, 17, 1356, 'Inovacija se odnosi na kreiranje rezervacionog softvera, koji bi olakšao pronalazak adekvatnih turističkih sadržaja u Srbiji za kupce raznih profila, a koji bi imao jasno definisane oblasti: seoski turizam, hotelski, banjski, kampovi za decu, ponude agencija i slično... Cilj je okupiti sve informacije na jednom mestu i tako skratiti vreme provedeno u pretraživanju aranžmana.', NULL, NULL),
(3078, 22, 1356, 'Mi smo tim koji je proveo više od 5 godina u okviru iste grupe na Geografskom fakultetu, zajednički radili na projektu Zaštitijada, koji se bavio organizacijom putovanja studenata našeg fakulteta na godišnje druženje studenata zaštite životne sredine, kao i na raznim drugim manje značajnim projekrima i istraživanjima.', NULL, NULL),
(3079, 23, 1356, 'Motiviše nas potreba da se ostvarimo u stvaranju i realizaciji jedne dobre ideje, koja će građanima omogućiti lakši pronalazak zanimljivih smeštaja u okviru našeg rezervacionog sistema. Takođe, želimo da pratimo svetske trendove, i ostvarimo napredak na ličnom planu, oprobamo se u vođenju sopstvenog biznisa.', NULL, NULL),
(3080, 24, 1356, 'Smesti se, opusti se i odmori se', NULL, NULL),
(3081, 25, 1356, 'Ljudi se sve više orjentišu na on line prodaju, radije nego ličnu posetu prodavnicama, i različitim ponuđačima proizvoda i usluga. Za ovaj problem smo saznali neposrednim kontaktom sa prijateljima, kao i ličnim iskustvom, zbog nepostojanja jedinstvenog servisa koji bi objedinio celokupnu turističku ponudu. Npr, postoji booking.com na kome se predstavljaju registrovani smeštaji, ali ne postoje ponude agencija. Takođe, pretraga se vrši na osnovu konkretnog mesta u koje bi se putovalo, a ne na osnovu vrste putovanja. Recimo ukoliko neko želi da provede vikend u nekoj banji, ali ne zna koja bi to banja bila, on mora da pretražuje prvo koje sve banje postoje, zatim da traži pojedinačne hotele koji su u tim banjama, ili pojedinačno da pretražuje sajtove agencija kako bi našao ono što mu je privlačno. Na našem sajtu bi u jednoj sekciji imao celokupnu ponudu u banjama, i pregledom svih ponuđenih smeštaja, hotela, apartmana, ili agencijskih ponuda mogao bi da odabere ono što mu odgovara.', NULL, NULL),
(3082, 26, 1356, 'Ovim proizvodom target je na 1820021 domaćem i stranom turisti koji su ostvarili noćenja u svim smestajnim jedinicama u Republici Srbiji u 2020. godini,a po podacima Republičkog zavoda za statistiku, Republike Srbije, objavljenom u izdanju \"Opštine i regioni u Republici Srbiji\", izdatom u Beogradu 24.12.2021.godine, strana 284.  Takođe trendovi za tekuću 2021.godinu pokazuju da je ostvaren rast noćenja u prva 3 kvartala od 27,9% u odnosu na isti period u prethodnoj godini, izdanje Trendovi 3 kvartal, 2021 godine, strana 45. Pravljenje ovakvog sistema rezervacija moglo bi da se primeni na bilo koju državu, koja možda nema sličan sistem celokupne turističke ponude, a mi se nadamo da bi naš proizvod bio interesantan i za početak omogućio širenje u državama regiona, a vremenom i da osvaja svet.', NULL, NULL),
(3083, 27, 1356, 'Ovim sistemom najviše rešavamo problem srednjoj populaciji, porodicama sa decom, koja zbog sve užurbanijeg načina života, predugačkog radnog vremena, nema vremena za obilaske turističkih agencija, ili nema mogućnost planiranja odmora mnogo vremena unapred. Oni, takođe, zbog nemogućnosti godišnjeg odmora u nekim mesecima, moraju naći neki aranžman za decu koja su na raspustu i nema ko da ih čuva, a na našoj platformi bi imali mogućnost odabira raznih kampova za decu, po sopstvenim afinitetima. Na osnovu iskustva u radu u Turističkoj agenciji, našeg člana tima, gde je prodaja vršena direktno korisnicima, imamo saznanja da roditelji (naročito van Beograda), nisu upućeni u mogućnosti koje im mogu biti na raspolaganju. Pošto nam tek predstoji razrada naše ideje, sigurni smo da bismo obavili nekoliko istraživanja i anketa koje bi se odnosile na potencijalne kupce. Takođe, naši kupci bi bili i svi oni koji se bave nekom vrstom turizma, koji bi kupovali svoje mesto na našoj platformi.', NULL, NULL),
(3084, 28, 1356, 'Aplikacija sa bazom na Sql serveru, povezana Microservisima sa frontendom u React-u. \r\nVeoma fleksibilna, brza i lako se menja i dodaju nove funkcionalnosti. Jednostavan korisnički interfejs prilagođen različitim veličina ekrana i pretraživača.', NULL, NULL),
(3085, 30, 1356, 'Naši potencijalni kupci trenutno gube mnogo vremena u pretragama (što lično idući od agencije do agencije, što preko web-a, pretraživajući mnogobrojne sajtove, facebook i instagram profile). Najčešće koriste booking.com sajt za direktno rezervisanje smeštaja, ili pojedinačne sajtove raznih agencija preko kojih se uglavnom informišu o aranžmanima, dok za rezervaciju moraju uglavnom pozvati ili slati upite mejlom agencijama, što iziskuje mnogo više vremena od našeg rešenja, a složićemo se da u današnje vreme poslovica \"Vreme je novac.\" ima itekako smisla.', NULL, NULL),
(3086, 29, 1356, 'Brzo, jednostavno, lako, sve na jednom mestu, povezivanje kupaca sa turističkim sadržajima Srbije, kao i povezivanje manjih smeštajnih objekata sa većim brojem kupaca.', NULL, NULL),
(3087, 32, 1356, 'Zato što na tržištu ne postoji proizvod koji objedinjuje sve vrste celokupne turističke ponude, koji bi mogao kupcima da pruži sve relevantne informacije, cene, rezervaciju u sistemu i plaćanje na jednom mestu. Široke su mogućnosti za pravljenje dobre platforme, koja bi kupcu dala realne i prave informacije. Npr. smeštaj bi mogao da ima video zapis, preko koga bi turista mogao da stekne pravi utisak o smeštajnim jedinicama, tako bi se izbegle neprijatne situacije prilikom dolaska na destinaciju. Ubacivanje google mapa, kako bi mogao da ima informaciju kako doći do smeštaja, koliko vremena je potrebno i slično.', NULL, NULL),
(3088, 37, 1356, 'Želja nam je da u budućem periodu zaštitimo našu ideju, a vlasnici bi bili Bojana Minić, kao tvorac ideje ovog start up-a, i Ivan Jovičić, kao neko ko će biti tvorac softvera za rezervacije.', NULL, NULL),
(3089, 40, 1356, 'Naš startap će imati više mogućnosti za zarađivanje. Procenat od prodaje aranžmana će biti osnovni način, znači nešto poput on line sub agenta. Zatim moguće bi bilo uvesti godišnju pretplatu za održavanje softvera kao i mesto na našoj platformi, koja bi bila određena prema veličini privrednog subjekta (turistička agencija, hotel, registrovano seosko domaćinstvo za ruralni turizam i sl.). Mogućnost reklame na platformi...', NULL, NULL),
(3090, 41, 1356, 'Naš tim čine ljudi koji se poznaju 15 godina, koji su zajedno delili i dele mnogo rada, truda i želje za stvaranjem nekog boljeg društva. Ova konkretna ideja postoji veoma kratko, javila se kada pre manje od 24h, kada je jedan od nas video reklamu za Raising starts, i proveo celu noć razmišljajući šta bi to moglo biti inovativno da bi se priključilo ovom programu, a da obuhvata Key words geografija, turizam, prodaja, softver, inovacija. Nadamo se da bi naša ideja mogla biti prihvaćena kao nešto što zaslužuje priliku da se razvija, jer kada su razne prodajne platforme dosta uspešne. Spremni smo da joj se maksimalno posvetimo. Lepo bi bilo da ovakvu ideju sprovedemo uz pomoć profesionalnih mentora i novčane pomoći koja je itekako značajna za pokretanje bilo kog projekta, i postavimo dobar temelj na bazi koga će se ovaj startap razvijati. Spremni smo i da ulažemo sopstvena sredstva, kako bi ovaj biznis imao uspešan start.', NULL, NULL),
(3091, 44, 1356, 'Ne, prvi put se prijavljujemo za Startap program.', NULL, NULL),
(3092, 45, 1356, 'Ne', NULL, NULL),
(3093, 48, 1356, 'Upravo smatramo da nam je najveća pomoć i podrška potrebna u samom početku. Neko ko će da potvrdi da naša ideja ima perspektivu i pomogne nam oko postavljanja biznisa na \"zdrave noge\".', NULL, NULL),
(3094, 49, 1356, 'U trenutnoj fazi bi nam bilo potrebno bar 2000eur, za izradu primera platforme koja bi se kasnije nadograđivala i poboljšavala.', NULL, NULL),
(3095, 52, 1356, NULL, NULL, NULL),
