(3099, 71, 1363, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3100, 89, 1364, '* Završene Master studije na Geografskom fakultetu, Univerziteta u Beogradu. \r\n*Menadžer prodaje u Turističkoj agenciji Super tours doo,\r\n*Prodavac u Bašta doo Zrenjanin i Dexy co,\r\n*Knjigovođa i analitičar u Agenciji za knjigovodstvo i poresko savetovanje Dmt accounting, Saradnik u finansijama u Gorenje doo. Konsultant za životnu sredinu i GIS u UG GM EKOBALANS. iskustvo u online prodaji, i vođenju stranica na društvenim mrežama.', NULL, NULL);
