(3109, 71, 1368, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3110, 63, 1369, 'Cloud platforma za procesiranje transakcija i real-time notifikaciju korisnika, jednostavna za korišćenje i veoma skalabilna, sa potencijalom da postane baza i backend većine budućih (crypto) berzi, MMOs, banaka, loyalty programa, online programa za računovodstvo i sl. Za sada nešto ovako ne postiji i najbliže ovom konceptu su Google Firebase i Amazon AppSync koji imaju dosta ograničenja i zahtevaju mnogo više znanja backend programiranja, vremena i novca.', NULL, NULL),
(3111, 71, 1370, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3112, 17, 1371, 'Cloud platforma za procesiranje transakcija i real-time notifikaciju korisnika, jednostavna za korišćenje i veoma skalabilna, sa potencijalom da postane baza i backend većine budućih (crypto) berzi, MMOs, banaka, loyalty programa, online programa za računovodstvo i sl. Za sada nešto ovako ne postiji i najbliže ovom konceptu su Google Firebase i Amazon AppSync koji imaju dosta ograničenja i zahtevaju mnogo više znanja backend programiranja, vremena i novca.', NULL, NULL),
(3113, 22, 1371, 'Nismo poslovno sarađivali ali privatno sa idejama i dizajnom jesmo, a to uključuje i dizajn i kreiranje web stranica.', NULL, NULL),
(3114, 23, 1371, 'Povezivanje sa budućim saradnicima (a možda i novim suosnivačima), mentorstvo i pravna pomoć za vođenje doo i patetiranje ideje, i novčana pomoć za iznajmljivanje servera na AWS i patentiranje ideje koja unapredjuje sistem distributivnih transakcija.', NULL, NULL),
(3115, 24, 1371, 'Don\'t wonder what the future holds. Ask what holds the future.', NULL, NULL),
(3116, 25, 1371, 'Kompanije mogu da se skoncentrisu na izgled njihovih aplikacija i igara a backend mogu da prepuste nama. Trenutno svaka nova poker online platforma ili crypto berza mora iznova da pravi svoj backend engine za procesiranje transakcija jer ne postoji skalabilna online platforma koja to omogućava, a među prvim koracima bi bilo patentiranje naše ideje.', NULL, NULL),
(3117, 26, 1371, 'Tržište predstavljaju berze, MMO igre, softver za fiskalizaciju, računovodstvo (npr. Xero), online poker, banke i svi ostali kojima treba skalabilan backend koji omogućava da se na njega povežu milioni korisnika u isto vreme i razmenjuju digitalne podatke (points, game items, etc). Samo tržiste je ogromno i kompanija ima veliki potencijal da postane novi unicorn.', NULL, NULL),
(3118, 27, 1371, 'Demografija: global! \r\nKomunikacija: svi front-end programeri sa kojima smo pričali koji bi morali da zaposle dodatne backend inženjere i administratore da im naprave sistem koji čuva stanje njihovih korisnika i procesira promenu tog stanja.', NULL, NULL),
(3119, 28, 1371, 'Tehnologija: IoT\r\nInovativna ideja je da se korisnici povežu na naš IoT sistem i sve transakcije i razmene poruka obavljaju preko nas, dok nasi klijenti mogu da se fokusiraju na izgled tih aplikacija, umesto da razmišljaju o serverima, backendu, skalabilnosti i dr. \r\nInovacija je i način na koji mi mozemo da postignemo takvu skalabilnost da procesiramo vise transakcija nego Visa i Mastercard zajedno, i taj nacin ćemo da patentiramo.', NULL, NULL),
(3120, 30, 1371, 'Trenutno svako pravi iznova backend. Ima mnoštvo framework-a za front-end i igre, ali nema za backend pa onda recimo svaki proizvođač softvera za fiskalizaciju, za online poker ili kripto berze moraju sami da pravi svoj engine za procesiranje transakcija. Svaka igra pravi svoj backend da cuva poene, ranking i stanje igrača u nekoj bazi koja često ima problema ako dobiju odjednom veliki broj korisnika.', NULL, NULL),
(3121, 29, 1371, 'Ušteda novca i vremena. Brz izlazak na tržište će da pomogne ekonomiji i drugim startapovima.', NULL, NULL),
(3122, 32, 1371, 'Godine iskustva u radu i istraživanju me je uverilo da tako nešto ne postoji. Čak i dok sam radio u Amazonu u timu koji je bio zadužen za procesiranje miliona transakcija svakog dana, nije bilo nečega što smo mogli da iskoristimo za to.', NULL, NULL),
(3123, 37, 1371, 'Vlasnici intelektualne svojine bi bila doo kompanija koju bismo kreirali (DigiArch Solutions).', NULL, NULL),
(3124, 40, 1371, 'Barem nekoliko miliona godisnje (naravno ne od prve godine). Posle imamo ideje za druge projekte i izlazak na finansijska tržišta.', NULL, NULL),
(3125, 41, 1371, 'Ideja se pojavila pre nekoliko godina ali tek u poslednjih godinu i po dana, dok smo zbog pandemije i vanrednog stanja bili po kućama, se našlo dovoljno vremena da se u potpunosti napravi dizajn i testira koncept.', NULL, NULL),
(3126, 44, 1371, 'Nismo', NULL, NULL),
(3127, 45, 1371, 'Nismo, finansiramo se iz licne ušteđevine.', NULL, NULL),
(3128, 48, 1371, 'Treba nam pravna pomoć oko registracije (da li da se bude u PDV sistemu ili ne), i oko zaštite ideje.', NULL, NULL),
(3129, 49, 1371, 'Mislim da bi 20k bilo dovoljno da se zakupe server, plate programeri i dizajneri koji bi napravili example front-end aplikacije koje bi koristile naš patentirani back-end, i trebalo bi platiti advokate koji bi pomogli u nabavljanju patenta.', NULL, NULL),
