(3132, 76, 1375, NULL, NULL, NULL),
(3133, 83, 1377, NULL, NULL, NULL),
(3134, 89, 1378, 'Bivši suosnivač startapa na Novom Zelandu pre 13 godina. Ekspertiza u projektovanju veoma skalabilnih distributivnih sistema sa iskustvom od preko 15 godina u tome.', NULL, NULL),
(3135, 90, 1378, 'Potpuno posvećen', NULL, NULL),
(3136, 91, 1378, 'Nemam drugi posao. Dao sam otkaz da bih se potpuno posvetio ovoj ideji.', NULL, NULL),
(3137, 89, 1379, 'Fotografija, grafički dizajn i prototyping (Adobe XD, Figma)', NULL, NULL),
(3138, 90, 1379, 'U manjoj meri posvećena (zbog full-time posla), a kasnije kada se napravi profit bi bila u većoj meri ili potpuno posvećena u dizajniranju front-enda, mobilnih aplikacija i reklamnog materijala', NULL, NULL),
(3139, 91, 1379, 'Full-time zaposlena u NCR', NULL, NULL),
(3140, 71, 1382, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3141, 63, 1383, 'Aplikacija umrli.co.rs je predstavlja elektronsko objavljivanja umrlica, čitulja i pomena, gde korisnik koristi internet radi bržeg informisanja.\r\n\r\nTrenutno niste u Srbiji ili živite u inostranstvu, može se desiti da informacija o smrti Vama dragih osoba ne dođe na vreme. Portal umrli.co.rs Vam olakšava da porodicama, prijateljima i drugim dragim ljudima date infomaciju o smrti, pomenu ili da uputite poslednji pozdrav.\r\n\r\nTakođe na našem portalu možete potražiti najbliža pogrebna preduzeća, kamenorezačke radnje, fotografske radnje, radnje za izrade okvira i ramova za slike, cvećare, prevoz pokojnika, graviranje mermera, orkestar za sahrane i ketering.', NULL, NULL),
(3142, 71, 1384, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3143, 17, 1385, 'Aplikacija umrli.co.rs je predstavlja elektronsko objavljivanja umrlica, čitulja i pomena, gde korisnik koristi internet radi bržeg informisanja.\r\n\r\nTrenutno niste u Srbiji ili živite u inostranstvu, može se desiti da informacija o smrti Vama dragih osoba ne dođe na vreme. Portal umrli.co.rs Vam olakšava da porodicama, prijateljima i drugim dragim ljudima date infomaciju o smrti, pomenu ili da uputite poslednji pozdrav.\r\n\r\nTakođe na našem portalu možete potražiti najbliža pogrebna preduzeća, kamenorezačke radnje, fotografske radnje, radnje za izrade okvira i ramova za slike, cvećare, prevoz pokojnika, graviranje mermera, orkestar za sahrane i ketering.', NULL, NULL),
(3144, 22, 1385, 'Svi članovi su zaposleni full time ili imaju svoj privatan biznis. Imali smo prilike da radimo zajedno i imamo odličnu komunikaciju u timskom radu. Obzirom da je tim sastavljen od ljudi koji dolaze iz različitih branši, u svakom trenutku znamo ko ima kakav zadatak.', NULL, NULL),
(3145, 23, 1385, 'Iako smatramo da je ideja dobra, samo predstavljanje kod potencijalnih kupaca \"online umrlice\" zvuči morbidno. Kako se danas sve digitalizuje, mi na ovaj način želimo da podignemo svest ljudima, kako bi lakše došli do bitnih informacija, i na taj način pomogli sebi, a i svojim najbližima. \r\nVerujemo da nam bespovratna sredstva i rad sa mentorima mogu pomoći da ostvarimo ciljeve i tako doći do potencijalnih kupaca na teritoriji cele Srbije, a kasnije i širom.', NULL, NULL),
(3146, 24, 1385, '\"Na kraju smo svi na onaj svet, a sada i na internet\"', NULL, NULL),
(3147, 25, 1385, 'Nakon smrti naših najbližih, osetiili smo da je neki vid ovakvog servisa potreban. U tako teškim momentima ne možete racionalno ni da razmišljate, a treba da organizujete dostojanstven ispraćaj voljene osobe. Jedan od najtežih momenata jeste obavestiti rodbinu i prijatelje o smrtnom slučaju. Zato smo pokrenuli potpuno jedinstven sajt u Srbiji, koji će pre svega mnogo olakšati građanima, a biće dostupan svakome. Radi bržeg informisanja javnosti odlučili smo da pređemo sa fizičkog načina objavljivanja umrlica, pomena i čitulja na elektronski.', NULL, NULL),
(3148, 26, 1385, 'Kako je ceo svet pogođen epidemiološkom situacijom izazvan virusom Covid-19, na dnevnom nivou umiru veliki broj ljudi na različitim mestima. Aplikacijom \"online umrlice\" želimo da tržite najpre podelimo po regijama i na taj način pokrijemo čitavu naciju. Dakle uzeli smo u obzir sve pogrebne radnje, fotografske radnje, cvećare, prevoznike pokojnika, orkestre i ostala privredna lica koja učestvuju u organizaciji sahrane/oproštaja. Ukoliko se aplikacija ispostavi uspešnom, verujemo da se može širiti na Balkanu (Bosna, Hrvatska, Slovenija, Makedonija), a kasnije i šire.', NULL, NULL),
(3149, 27, 1385, 'Naša aplikacija je sveobuhvatna, dakle rešavamo problem svim fizičkim licima koji žele da dobiju informacije o umrlima u Srbiji, a takođe i promovišemo privredne subjekte koje organizuju ovakve vrste događaja. Na našem sajtu već postoje veliki broj umrlica, čitulja i pomena, ali i sva privredna lica sa kojima smo ostvarili saradnju.', NULL, NULL),
(3150, 28, 1385, 'Od trenutka prijave, čitulja, pomen ili umrlica na našem sajtu bude vidljiva za samo nekoliko minuta, za razliku od novina koje izlaze jednom dnevno ili sedmično. Takođe postoji opcija za šerovanje samih čitulja i umrlica putem društvenih mreža, a biće data i tačna lokacija na kojoj se sahrana organizuje. Dodatna pogodnost je što ulaskom na aplikaciji mogu pronaći pogrebnu opremu, kamenoresca i zakazati ketering, orkestar itd. \r\nKoristimo web aplikaciju na internetu i nešto slično već postoji, ali takva platforma nije sveobuhvatna kao naša, već na njima možete videti samo ime i prezime umrlih.', NULL, NULL),
(3151, 30, 1385, 'Umiranje ljudi je svakodnevnica, a rešavanje ovakvih problema ne bira vremenske, a ni bilo koje druge uslove. Kako je ovde konkretno problem informacija, informisanje se trenutno vrši putem časopisa odnosno novina (koja izlaze jednom dnevno ili sedmično), kačenjem umrlica na banderama i prenošenjem od usta do usta.', NULL, NULL),
(3152, 29, 1385, 'Glavni benefiti koji potencijalni kupci dobijaju su \"informacije iz fotelje\" i marketing, putem telefona ili nekog drugog uređaja. Platforma je dostupna svim ljudima, a samom prijavom na aplikaciji možete sve organizovati kroz par klikova iz fotelje.', NULL, NULL),
(3153, 32, 1385, 'Na nekim sajtovima koji već postoje, možete pronaći osobe koje su nas napustile. Platforma koju razvijamo se razlikuje od drugih jer su obuhvaćeni svi ostali problemi koju nastaju usled gubljenje drage osobe. Na jednom mestu ćete pronaći umrlice, čitulje, pomene, poslednje pozdrave, a isto tako i sve potrebne informacije oko organizacije oproštaja/sahrane.', NULL, NULL),
(3154, 37, 1385, 'Vlasnici intelektualne svojine bili bi: Predrag Marinović i Andrija Simeunović', NULL, NULL),
(3155, 40, 1385, 'Pre same izrade aplikacije, formirali smo cenovnik usluga. Usluge se odnose na postavljanja umrlica, čitulja i pomena i usluge promocije privrednih lica. Dakle naplaćuju se postavljanje malih, srednjih i velikih umrlica, čitulja i pomena. Isto tako moguće je postavljanje reklame privrednih subjekata uz posebnu nadoknadu.', NULL, NULL),
(3156, 41, 1385, 'Naš startap tim postoji od aprila meseca ove godine. Kako je u prvom planu bio razvoj aplikacije samo za prikazivanje umrlica, čitulja i poslednjih pozdrava, kroz razgovore sa privrednim licima koja učestvuju u organizovanje oproštaja (sahrane) najbližih, dobili smo veliki broj informacija i na taj način odlučili da proširimo platformu. Dakle osim prikazivanje online umrlica, na aplikaciji su dostupne reklame privrednih lica koja učestvuju u organizaciji sahrana (pogrebne radnje, ketering, fotografske radnje, prevoznici itd). Povratne informacije su pozitivne i ovde ne želimo da se zaustavimo, već da širimo platformu i na taj način olakšamo dostupnost informacijama.', NULL, NULL),
(3157, 44, 1385, 'Član Mirko Pavlović je jedno vreme bio koordinator Startap centra u Čačku i radio je sa formiranim startap timovima na razvoju ideje.', NULL, NULL),
(3158, 45, 1385, 'Nismo imali izvore finansiranja.', NULL, NULL),
(3159, 48, 1385, 'Očekujemo sredstva i mentorski rad. Smatramo da je sama ideja dobra i već smo dokazali da je izvodljiva. Kroz taj mentorski rad želimo da utrošimo sredstva na pametan način i samu aplikaciju dovedemo do maximalnog nivoa, a sutra je i lansirati po celom svetu.', NULL, NULL),
(3160, 49, 1385, 'Smatramo da su nam sredstva potrebna u celosti. Obzirom da nismo imali nikakav izvor finansiranja, a već smo napravili model, novac nam je potreban da bi najpre pokrili plate, a ostalo uložili kroz marketing, konsultantske usluge i dodatne programerske usluge.', NULL, NULL),
(3161, 52, 1385, NULL, NULL, NULL),
(3162, 66, 1388, NULL, NULL, NULL),
(3163, 76, 1389, NULL, NULL, NULL),
(3164, 71, 1390, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3165, 83, 1392, NULL, NULL, NULL),
(3166, 71, 1393, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3167, 63, 1394, 'Poluatomatizovana proizvodnja keramičkog posuđa sa završnom hend-mejd obradom uz pomoć inovativnih kalupa proizvedenih 3d-printing i CNC tehnologijom.', NULL, NULL),
(3168, 71, 1395, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3169, 17, 1396, 'Poluatomatizovana proizvodnja keramičkog posuđa sa završnom hend-mejd obradom uz pomoć inovativnih kalupa proizvedenih 3d-printing i CNC tehnologijom.', NULL, NULL),
(3170, 22, 1396, 'Deo tima, kog čine Ognjen i Aleksandar Vukić, imaju prethodnog iskustva sa startapom, jer su prethodno sarađivali na osnivanju “Park n Fly” usluge, koja je ujedno i začetnik ovog vida poslovanja u Srbiji (www.aerodromparking.com).\r\nFirma je i dalje na liderskoj poziciji u poslovanju, uprkos ogromnoj konkurenciji koju je do sada imala. Kroz unapređenje usluga i novih radnih mesta na menadžerskim pozicijama u firmi, uvođenjem softvera prilagođenim poslu kojim se firma bavi, rasterećen je rad firme. Aleksandar je ostao na poziciji direktora firme, dok je Ognjen trenutno van radnog odnosa kako bi usmerio fokus na razvoju novog startapa pod nazivom \"VUKICH CERAMICS\"', NULL, NULL),
(3171, 23, 1396, 'Prvi kontakt sa uspešnim startapovima u Srbiji je bio putem televizijskih medija. U tom trenutku nas startapovi nisu toliko zainteresovali jer nismo poznavali nikog ko je imao dodira sa ovom oblašću, bili smo i malo skeptični povodom činjenice da neko želi da vam pomogne. Na tehnološkim fakultetima nije bilo dovoljne informisanosti o ovakvim programima, te nam je naredni kontakt bio prošle godine putem društvenih mreža, zainteresovali smo se i sticajem okolnosti smo upoznali par članova NTP, koji su bili veoma prijatni i od pomoći oko pitanja koje smo postavljali. Bili smo pod utiskom oko same organizacije i energije koja je bila prisutna u parku. Ubrzo zatim, pojavila se ogromna želja i motivacija da postanemo deo programa i komjunitija i sprovedemo poslovnu ideju u delo poput drugih članova parka.', NULL, NULL),
(3172, 24, 1396, 'Hand-crafted ceramics, designed for chefs.', NULL, NULL),
(3173, 25, 1396, '1) Kvalitet i uniformnost \r\nUmetnici nisu u mogucnosti da izrade proizvod konstantnog kvaliteta koji je sofisticiran za masovnu upotrebu i skladištenje i da je pritom ručne izrade. \r\n2) Reprodukcija \r\nBez obzira na sposobnosti i veštine umetnika, nije izvodljivo da se zahtevi restorana zadovolje i da se proizvedu velike serije posuđa za kratko vreme. \r\n3) Porudžbine sa specijalnim zahtevima naručioca\r\nRenomirani restorani i hoteli, kako bi istakli svoju kuhinju i posebnost, nailaze na velike probleme prilikom poručivanja custom-made posuđa kod lokalnih umetnika jer su im oni trenutno jedina opcija na tržištu.', NULL, NULL),
(3174, 26, 1396, 'Tendencija kompanije je da što pre omogući “world wide” saradnju i špediciju jer se keramički proizvodi koriste u svim kulturama i potencijal je ogroman. Primarno tržište koje je fokusu su restorani i ugostiteljski objekti, sekundarno, fizička lica koja žele sebi da priušte profesionalno posuđe. Na lokalnom nivou smo sproveli istraživanja u saradnji sa šefovima kuhinja jednih od najuglednijih restorana, kako u Beogradu, tako i u primorskim gradovima Crne Gore i Hrvatske. Plan je da se proizvodi lansiraju prvo na pomenutom lokalnom nivou, zatim da se tržište širi ka Evropskom tržištu čije analize i statistike tražnje smo radili uz Google keyword planner, Google trends i Ahrefs. Pre svega veliki potencijal leži u srednjoj i severnoj Evropi, gde je trenutno započet trend de-industrijalizovane proizvodnje. Poseban paragraf ostavljamo za Srednju i Severnu Ameriku, koja prednjači da svoja vrata potrošačkog društva otvori pred inovativnim i kvalitetnim proizvođačima iz celog sveta.', NULL, NULL),
(3175, 27, 1396, 'Probleme rešavamo, pre svega, renomiranim ugostiteljskim objektima.\r\nAkcenat stavljamo na restorane i hotele, koju su u većini slučajeva prinuđeni da koriste industrijsko posuđe, jer nije moguće da za kratak vremenski period dobiju seriju hendmejd proizvoda koji bi ispunjavali njihove kriterijume za sofisticiranu upotrebu i ujedno imali specifikacije industijskog proizvoda konstantnog kvaliteta. Današnji perspektivni objekti i brendovi zahtevaju personalizaciju opreme jer ona direktno utiče na njihovu reputaciju. Dakle idealna situacija bi bila kada bi šefovi kuhinja mogli da dobiju \'\'custom made\'\' posuđe, sa njihovim dimenzijama i željenim oblicima, za kratko vreme, u suprotnom su osuđeni na postojeće modele industrijskih proizvođača ili na duge rokove izrade hendmejd umetnika.\r\nOvaj zakljucak je donešen nakon sprovedene ankete i intervjua sa jednim od najvrsnijih šefova kuhinja u regionu, od kojih su četiri iz Beogradskih restorana, dvoje sa Hrvatskog i dvoje sa Crnogorskog primorja.', NULL, NULL),
(3176, 28, 1396, 'Inovativnost u našoj proizvodnji bi bila poluautomatizovana proizvodnja, sa završnom hend-mejd obradom proizvoda, koja bi omogućila da se proizvodi izrađuju po specijalnim zahtevima kupaca i ujedno budu u potpunosti funkcionalni prilikom upotrebe i skladištenja za razliku od ručno proizvedenih predmeta koji su dostupni na tržištu.\r\nKljučni elementi koji bi omogućili ovakav vid proizvodnje su inovativni kalupi koji bi se proizvodili uz pomoć tehnologije 3D-štampe i CNC obrade kao i razvojem, odnosno unapređenjem postojećih mašina na našem tržištu. Kalupi u kombinaciji sa pomenutim tehnologijama i mašinama nam omogućavaju neograničen opseg proizvoda i njihovih varijacija.', NULL, NULL),
(3177, 30, 1396, 'Potencijalni Kupci se trenutno oslanjaju na postojeće industrijske proizvođače i modele koji oni nude, dakle nije moguće da dobiju proizvode koji su posebno izrađuju po njihovim kriterijumima. Druga opcija je ručna izrada lokalnih/regionalnih umetnika za koju se većina uglednih restorana odlučuje kako bi isticali svoj kvalitet i posebnost. Oni mogu da zadovolje potrebe po pitanju dizajna i dimenzija ali je rok isporuke jako dug, kvalitet nije konstantan i korisnici u kuhinji nailaze na probleme prilikom skladištenja zbog varijacija u dimenzijama oslonca. Lokalni umetnici sa našeg područja, u većini slučajeva nemaju sertifikovane proizvode i ne ispunjavaju norme potrebne za saradnju sa većim klijentima.', NULL, NULL),
(3178, 29, 1396, 'Vrste posuđa i keramičkih predmeta variraju u odnosu na lokalitet i kuhinju, a u nekim slučajevima predstavljaju stvar prestiža. Renomirani restorani i hoteli, sve češće žele svoju posebnost da istaknu kroz predmete specijalno dizajnirane i izrađene samo za sebi svojevrsnu upotrebu. Ovakve porudžbine, pored ogromnog vremena potrebnog za dizajniranje i izradu modela, iziskuje i ispitivanje i sertifikaciju kako bi sam proizvod ispunjavao međunarodne standarde i bio upotreban. \r\nNašom inovacijom, klijentima bismo omogućili sledeće benefite:\r\n-Zadovoljili bismo kriterijume i zahteve custom-made porudžbina\r\n-Omogućili bismo kratak period izrade velikih porudžbina\r\n-Posuđe bi imalo industrijske specifikacije, bilo sertifikovano i sigurno za upotrebu i ujedno bi bilo u marginama ručne proizvodnje', NULL, NULL),
(3179, 32, 1396, 'Naši proizvodi su značajno poboljšani u odnosu na konkuretne jer sȃm način izrade parira industrijsoj proizvodnji, a u isto vreme ostaje u marginama ručne proizvodnje. Rešavamo problem specijalnih zahteva kupaca i omogućavamo im bezgranične mogućnosti po pitanju dizajna i dimenzija.', NULL, NULL),
(3180, 37, 1396, 'Informisali smo se u ZIS-u i zaključili da je najbolje zaštiti žig u Srbiji, jer bi zaštita komunitarnog ili međunarodnog žiga bila finansijski neisplativa.\r\nZaštita patenta vezana za kalupe i proizvodni proces nije moguća ako je princip proizvodnje sličan našem i takođe troškovi i složenost patentiranja bi predstavljali prepreku.', NULL, NULL),
(3181, 40, 1396, 'Naš startap bi svoje proizvode direktno prodavao restoranima i hotelima i takođe bi fokus bio na B2C poslovnom modelu.', NULL, NULL),
(3182, 41, 1396, 'Naš trenutni tim se ovom idejom intenzivno bavi već godinu ipo dana. Tokom ovog perioda izvršene su ankete i konsultacije u saradnji sa par izvrsnih šefova kuhinja iz regiona koji su nas srdačno savetovali i podržali tokom našeg istraživanja.  Istražena je dostupnost mašina i tehnologije u Srbiji i u svetu. Ostvarili smo jako bitne kontakte sa profesorima FPU i TMF koji su nam ujedno bili i vetar u leđa i konstantna podrška prilikom izrade prototipa proizvoda, nakon čije izrade smo uvideli potencijalne prepreke prilikom izrade budućih kalupa.\r\nPrilikom izlaganja prototipa (slike dostupne u dokumentu o tehn. izvodljivosti) zadobili smo ogromna interesovanja od strane restorana i šefova kuhinja, koji su kao potencijalni kupci zatražili da ih obaveštavamo o napretku startapa. Iste povratne informacije smo dobili i od potrošača koji su bili spremni da plate više kako bi imali posuđe posebno dizajnirano za njih sa pečatom ili posvetom koja bi ukazivala na određen datum ili slova.', NULL, NULL),
(3183, 44, 1396, 'Nismo ranije učestvovali u mentorskom ili startap programu.', NULL, NULL),
(3184, 45, 1396, 'Nismo do sada prikupili ni jedan izvor finansiranja.', NULL, NULL),
(3185, 48, 1396, 'Od učešća u ovom programu očekujemo pre svega da steknemo nove poznanike i da steknemo novo iskustvo u okviru rada jedne organizacije kao što je NTP. Svako novo iskustvo nam je veoma dragoceno i smatramo da je i sam pokušaj da se konkuriše za jedan ovakav program odlična stvar za sticanje novih znanja o raznim temama. Takođe smatramo da bi nam rad sa mentorima otvorio oči za razna pitanja poput trgovine van granica naše zemlje, o načinu testiranja proizvoda na tržištu, oko razvoja poslovanja, umrežavanja i drugih. Podrška nam je najpotrebnija upravo kod mentorstva jer su rizici kod startapova veliki i iziskuju mnogo više vremena i novca ako se startap realizuje pogrešnim putem ili teži ka pogrešnim idealima. Uz dobra usmerenja i stručni nadzor, olakšao bi nam se dobar deo projekta i uštedeo novac koji je veoma bitan faktor u ovom modelu poslovanja.', NULL, NULL),
(3186, 49, 1396, 'Mehanizacija u ovom poslu zahteva mnogo novca, počev od mašina koje koriste ose kretanja pa sve do visokotemperaturalnih peći koje su neophodne za proizvodnju, ne bi bilo realno pominjati cifre nabavke svih mašina za izradu kalupa i keramičkih proizvoda. Smatramo da je ovo idealna prilika gde bismo mogli naše kalupe da usavršavamo uz pomoć već dostupnog invertara i mehanizacije NTParka. Iako bismo zadovoljili potrebe dela mehanizacije jedan deo bi morao da bude investiran u  mehanizaciju koji je specifično namenjens za keramiku, odnosno onu koja nije dostupna u parku. Dobar deo novca bi nam trebao za materijale koji se troše prilikom izrade proizvoda i razvoja kalupa. Po slobodnoj proceni za trenutnu fazu razvoja u pitanju je oko 45% fonda za hardverska rešenja.', NULL, NULL),
