(3193, 63, 1405, 'Novi proizvodi u preradi kozijeg mleka, izrada sireva, jogurta, surutke od kozijeg mleka. Pakovanje i distribucija na tržište.', NULL, NULL),
(3194, 71, 1406, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3195, 17, 1407, 'Novi proizvodi u preradi kozijeg mleka, izrada sireva, jogurta, surutke od kozijeg mleka. Pakovanje i distribucija na tržište.', NULL, NULL),
(3196, 22, 1407, 'Da, sa Razvojnom agencijom Srbije, NALED, SWEDA', NULL, NULL),
(3197, 23, 1407, 'Motivisalo me je to što na ovaj način mogu da zaokružim ceo proces od proizvodnje, prerade i plasmana gotovog proizvoda.Na ovaj način bi se aktivirali ljudi iz seoskih domaćinstava u ruralnom delu naše opštine , a i šire, što bi imalo za cilj razvoja poljoprivrednih proizvoda u jednom zdravom okruženju koji bi se na nov način predstavio tzržištu i obezbedili ekonomsku egzistenciju proizvođaču.', NULL, NULL),
(3198, 24, 1407, 'NIKAD NE ODUSTAJ', NULL, NULL),
(3199, 25, 1407, 'Rešava se problem nedostatka proizvoda od kozjeg mleka i raznih poljoprivrednih proizvoda u okviru organske proizvodnje, svedoci smo raznih proizvoda koji imaju katasrofalne posledice , u dugoročnom smislu, na stanovništvo koje se odmah ne vidi nego dugoročnijem konzumiranjem takvih proizvoda dolazi do raznih  sistemskih oboljenja.Problem je globalnog karaktera i ubrzanog tempa života izgubili smo osnovne parametre životnog standarda u ishrani čoveka, namirnice koje se koriste u ishrani nisu ganetski  spremne za naš organizam, pa se usled nedostatka koriste razni suplementi koji na mogu da nadoknade izgubljeno.Čak i deci zbog nepravilne ishrane i usled biohemijskog disbalansa mislimo da sve možemo da nadoknadimo suplimentima u vidu tableta, koncetrata koji su isto takvog sadržaja.Kada je moje dete počelo da koristi lekove za nadoknađivanjem vitaminskih nedostatka zbog anemičnosti a to su isto radila i ostala deca raznih uzrasta.', NULL, NULL),
(3200, 26, 1407, 'Na prvom mestu deca , sportisti, rekovalescenti i starija populacija.Na porodičnom gazdinstvu koje se bavi proizvodnjom kozjeg mleka pomenuti korisnici su dolazili da bi deca dok čekaju sveže pomuzeno mleko videla i upoznala se sa životinjama na farmi i shvatila da mleko daje koza pa se onda pakuje.Usled biološke progresije životinja javlja se dovoljno mleka da bi se zadovoljila potreba lokalno i šire, u drugim gradovima u okruženju.Da bi se dalje distribuiralo moralo bi de se upakuje ,BEZ KONZERVIRANJA, da bi se kao dnevni proizvod dostavili udaljenijim kupcima.U našim prodavnicama, hipermarketima videla sam samo nekoliko proizvoda od kozjeg mleka i to od proizvođača iz uvoza, tako da mislim da je tržište ogromno i zahteva veliku količinu proizvoda.', NULL, NULL),
(3201, 27, 1407, 'Kao što sam napomenula na prvom mestu deca u razvoju, sportisti, rekovalescenti , starije osobe i mledi ljudi koji vode računa o ishrani.Usled biloške revolucije i industrijske proizvodnje izgubili smo zdav proizvod na koji nas je podsetila KORONA i vratila biološkoj primarnoj proizvodnji.Za vreme izolacije tražilo se kozje mleko i sirutka, bez upita za cenu jer lek nema cenu, tražila se čak veza da bi se proizvodi kupili, jer nikakvi biološki suplimenti nisu mogli da nadoknade vitaminski disbalans organizma.Mnogi su se tada i upoznali sa ovim proizvodima jer nikada pre toga nisu koristili ove proizvode.U početku je postojala doza obazrivosti od nepoznatog pa se kasnije sa upoznavanjem proizvoda stekla i određena navika u konzumiranju.To se isto odnosi i na povrtarske i voćarske proizvode koji u obliku starih sorti imaju UKUS I MIRIS .', NULL, NULL),
(3202, 28, 1407, 'Proizvod od tradicionalnih rasa i sorti koje su genetski vekovima prilagođavanja nama i mi njima dobijaju potrebu da se ponovo proizvode. NOVI PROIZVODI U NOVOM PAKOVANJU podrazumeva proizvode organskog karaktera i dnevno konzumiranje u svežem stanju, na taj način bi u svežem stanju dolazilo do kupca i trebovanje - nabavka bi se vršila putem bukinga preko društvenih mreža ili klubskog članstva sa dnevnim potrebama i svežeg proizvoda direktno sa farme i njive do kupca.', NULL, NULL),
(3203, 30, 1407, 'Trenutno se kupuju proizvodi u prodavnicam ukoliko ih ima ili direktno sa farme, usled nedostatka proizvoda kupuje se sirevi od palminog ulja i kazeina koji u sebi ne sadrže mleko a u Evropi su čak i zabranjeni za upotrebu, kupuju se povrtarski i voćarski proizvodi u zamrznutom obliku sa sumnjivim rokom proizvodnje i ti proizvodi kao što sam rekla namaju ni miso ni ukus ne mogu sve jabuke i sve kruške da imaju isti oblik od prve do poslednje, zamislite samo koliko je tu raznih hemiskih sredstava upotrebljeno.I nije tačno da takvi proizvodi nemaju karencu ...', NULL, NULL),
(3204, 29, 1407, 'Dobija sveže upakovan zdrav proizvod sa garancijm kvaliteta koji može da naruči danas za sutra i da dogovori način isporuke putem bukunga proizvoda i naručivanjem koristeći savremena sredstva komunikacije, putem mobilnih aplikacija.', NULL, NULL),
(3205, 32, 1407, 'Pre svega treba nešto da se proizvede a do sada toga nije bilo ili u veoma malim količinama.Garancija proizvođaća o kvalitetu proizvoda sa poštovanjem svih organskih pravila proizvodnje o čemu bi se vremenom  obezbedili sertifikati proizoda.I najvažnije način isporuke proizvoda koji imao za cilj da se u direktnoj komunikaciji sa kupcem distribuira traženi proizvod.', NULL, NULL),
(3206, 37, 1407, 'nismo', NULL, NULL),
(3207, 40, 1407, 'Postoje određeni resursi na poljprivrednom gazdinstvu od 91 koze rase francuska Alpina u procesu konverzije organske proizvodnje i određeno poljoprivredno zemljište na kome se planira organska proizvodnja voćarskih i povrtarskih kultura.', NULL, NULL),
(3208, 41, 1407, 'Zadnjih 9 godina se bavimo proizvodnjom kozjeg mleka.Do sada su nam sve analize proizvoda dale vrhunske rezultate proizvoda, kupci su prezadovoljni proizvodom i najviše ga koriste deca i starije osobe.Svi gledamo da deci damo najbolje deca nakon prvih proba prihvataju ukus proizvoda i rado ga koriste na opšte zadovoljstvo, a starije osobe sa ogromnim iskustvom i opreznošću prihvataju proizvode i preporučuju drugim korisnicima.', NULL, NULL),
(3209, 44, 1407, 'Projekat Razvojne agencije Srbije, Fondacija Ane i Vlede Divac, SWEDA.NALED međugranična saradnja sa Severnom Makedonijom, NLB banka projekat organske proizvodnje', NULL, NULL),
(3210, 45, 1407, 'Na žalost u principu su većina donacija otišle privilegovanim ili većim proizvođečima ... a mi smo dobijali moralne sertifikacije i razna usmena priznanja o kvaltetu proizvoda i ideje.', NULL, NULL),
(3211, 48, 1407, 'Očekujemo puno u smislu da će da se propozna ideja kao dobra i realno oceni  kao neka koja  ima budućnost daljeg razvoja od šireg društvenog značaja, da se prepozna jedan dug i težak razvojni put na kome smo skoro uvek bili prvi i istrajali do sada.U izradi pakovanja, reklame , tehničkog opremanja i formiranje lanca ditribucije.', NULL, NULL),
(3212, 49, 1407, '20- 30.000 chf zavisno od faze razvoja. Nabavka u delu proizvodno procesne opreme i registracije proizvodnje, nabavka elektonski sofisticirane opreme, izrada modela ambalaže, etikete, loga i reklame, nabavka distributivnog vozila .', NULL, NULL),
