(3221, 89, 1416, 'radno iskustvo na porodičnom gazdinstvu od 9 godina u proizvodnji, držanju koza i prerade kozjeg mleka.\r\nIskustvo u izradi raznih projekata lokalnog i međunarodnog karaktera', NULL, NULL),
