(3223, 91, 1416, NULL, NULL, NULL),
(3224, 63, 1418, 'Naša ideja je da kroz e-learning program (lekcije i tutorijale) edukujemo potencijalne kupce o pojmu i benefitima pravne zaštite inovacija, odnosno o prednostima i načinu registracije inovacija pravom patenta kroz različite sisteme zaštite i na različitim teritorijama, kao i predočimo rizike propusta da se inovacija zaštititi. \r\nE-learning lekcije i tutorijali imaju za cilj da na jednom mestu sadrže sve neophodne informacije o patentima, posle završenih lekcija biće im približen pojam, benefiti i rizici propuštanja zaštite pravom patenta, primenom naučenog potencijalni kupci / preplatnici biće u mogućnosti da sami podnesu zahtev za zaštitu patenta, takođe pretpatnici će imati pravo i na konsultaciju 1:1 sa našim stručnjacima.', NULL, NULL),
(3225, 71, 1419, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3226, 17, 1420, 'Naša ideja je da kroz e-learning program (lekcije i tutorijale) edukujemo potencijalne kupce o pojmu i benefitima pravne zaštite inovacija, odnosno o prednostima i načinu registracije inovacija pravom patenta kroz različite sisteme zaštite i na različitim teritorijama, kao i predočimo rizike propusta da se inovacija zaštititi. \r\nE-learning lekcije i tutorijali imaju za cilj da na jednom mestu sadrže sve neophodne informacije o patentima, posle završenih lekcija biće im približen pojam, benefiti i rizici propuštanja zaštite pravom patenta, primenom naučenog potencijalni kupci / preplatnici biće u mogućnosti da sami podnesu zahtev za zaštitu patenta, takođe pretpatnici će imati pravo i na konsultaciju 1:1 sa našim stručnjacima.', NULL, NULL),
(3227, 22, 1420, 'Članovi tima su do sada uspešno sarađivali na različitim projektima u privatnoj organizaciji, nadalje intezivno sarađuju u poslednjih godinu dana na informisanju javnosti i edukaciji o značaju zaštite intelektualne svojine. Članovi tima imaju sve potrebne sposobnosti i osobine da rade zajedno kao tim, potrebnu multidisciplinarnost i pokrivaju sve tačke za razvoj jednog biznisa, a što se dobro pokazalo na prethodnim projektima.', NULL, NULL),
(3228, 23, 1420, 'Osnovni motiv za prijavljivanja za startap program Raising Starts je prevashodno primenjivost naših znanja u oblasti inovacija. Blisko povezane i gotovo neodvojive celine, inovacije i intelektualna svojina, kao i nov način edukacije koji je posebno eskalirao tokom Covid-19 - online učenje. \r\n\r\nŽelimo da putem e-learning programa u vidu online lekcija i tutorijala pomognemo sve većem broju inovatora, kao i inovativnim kompanijama da zaštitite svoje inovacije, odnosno tehnička rešenja, zatim da obezbede svoje ekonomske interese i povećaju konkurentnost na tržištu. \r\n\r\nS druge strane, ekonomski rast i razvoj u zemljama EU zasnovan je na znanju i komercijalizaciji znanja kroz raspolaganje pravima intelektualne svojine. Želimo da naše znanje učimo dostupnim širem krugu potencijalnih korisnika i pretpatnika, a to bi postigli putem online učenja, tj. e-learning programa, koji u današnje vreme predstavljaju veoma prigodan način obrazovanja i edukacije, koji svojim korisnicima pruža fleksibilnost i komoditet po pitanju vremena i mesta.', NULL, NULL),
(3229, 24, 1420, '4 Innovation 2 Protection', NULL, NULL),
(3230, 25, 1420, 'Prema navodima iz publikacije NALED-a: Analize Stanje inovacija i procesa digitalne transformacije u Republici Srbiji,  koja je objavljena na sajtu https://www.startech.org.rs/analize-i-istrazivanja može se videti da je svega 2% inovatora u Republici Srbiji apliciralo za patent-\r\nPrema statistici Zavoda za intelektualnu svojinu Republike Srbije (https://www.zis.gov.rs/prava-is/patenti/%D1%81%D1%82%D0%B0%D1%82%D0%B8%D1%81%D1%82%D0%B8%D0%BA%D0%B0.7.html)  se prosečno godišnje podnese približno 200 prijava za registraciju patenta, a oko 50 prijava godišnje uspešno izvrši proceduru i registruje svoj patent, skoro pet puta je manji od proseka EU (230). \r\n \r\nPrema gore navedenim izvorima u Republici Srbiji svega 2% inovatora podnese zahtev za registaraciju patenta, dok prosečno godišnje oko 50 prijava uspešno registruje svoj patent.\r\nNa osnovu navedenih podataka naše potencijalno tržište u Republici Srbiji iznosi 2.500 inovatora i/ili inovativnih kompanija, tj, klijenata godišnje.', NULL, NULL),
(3231, 26, 1420, 'Naše ciljano tržište su zajednice Start up –ova, mala i srednja preduzeća, preduzetnici i inovativni pojedinci na teritoriji Republike Srbije, koji se bave tehnološkim inovacijama. Naknadno se tržište može proširiti i van granica Republike Srbije.\r\nBiznis se, po dobijanju sredstava, može odmah da se proširi na teritorije zemalja ex Jugoslavije koje imaju isti ili slični jezik koji se koristu u e-programu.  \r\nU narednom period, po dobijanju sredstava, planirano je širenje biznisa na sve korisnike koji se služe engeskim jezikom, tako što planiramo da e-learning program, sve lekcije i tutorijale pripremimo na engleskom jeziku. \r\nU narednom periodu od dve godine planiramo da e-program program, a koji se odnosi na tutorijale za postupak zaštite inovacija pravom patenta pred EPO-om i postupak zaštite inovacija pravom patenta pred WIPO-om pripemimo i na ostalim jezicima.', NULL, NULL),
(3232, 27, 1420, 'Potencijalni kupci su start up-ovi, inovativni pojedinci, preduzetnici, mikro, malim i srednjim preduzeća, koji se bave proizvodnim biznisom u svim delatnostima, a posebno u oblasti proizvodnje elektrotehnike, mašinstva, robotike, medicine, kao I u poljoprivredi.\r\nU pitanju su pretežno visoko obrazovane osobe prosečne starosti od 35 do 44 godina, zaposlene u privatnom sektoru, a skoncentriane u većim gradovima (Beograd, Novi Sad, Niš, Čačak, Kragujevac)\r\n\r\nNajveći strah im predstavlja preuzimanje zasluge za njihovu inovaciju od strane trećih lica. Takođe, strah od komplikovane i duge procedure pred državnim institucijama, birokratije i činjenja proceduralnih grešaka koje ih mogu dovesti do gubitka prava. \r\nIz dosadašnje petnaestgodišnje prakse kao zastupnik za intelektualnu svojinu pred Zavodom za intelektualnu svoju Republike Srbije upoznata sam sa većinom problema koje muče podnosioce zahteva za zaštitu patentom. Glavni problem je nedovoljna informisanost i finansijska sredstva.', NULL, NULL),
(3233, 28, 1420, 'Inovativna usluga u vidu e-learning programa koji će obuhvatati lekcije i tutorijale na temu zaštite inovacija pravom patenta, a koje se sastoje od 7 (sedam) tematskih oblasti, tj modula: 1) Pojam i značaj patenta i patentne zaštite; 2) benefiti pravne zaštite i posledice propuštanja pravne zaštite inovacija pravom patenta; 3) postupak zaštite inovacija pravom pateneta pred Zavodom za intelektualnu svojinu; 4) postupak zaštite inovacija pravom pateneta pred EPO-om; 5) postupak zaštite inovacija pravom pateneta pred WIPO-om; 6) vlasništvo nad patentom; 7) najznačajniji primeri iz prakse.\r\nNaša usluga je jedinstvena, jer ova usluga ne postoji na našem tržištu i mi smo prvi koji je nudimo.', NULL, NULL),
(3234, 30, 1420, 'Potencijalni kupci nisu bili u mogućnosi da rešavaju ovaj problem preventivno kroz edukaciju.\r\nVećina inovativnih pojedinaca i inovativnih kompanija obraća se stručnjacima iz oblasti intelektualne svojine po saznanju da imaju problem. \r\nU tom momentu, ne mogu za sebe i za svoje poslovanje da obezbede maksimalni vid zaštite inovacija, kao što mi to bio slučaj korišćenjem našeg e-learning programa.', NULL, NULL),
(3235, 29, 1420, 'Najveća benefit koju će potencijalnu kupci imati od našeg e-learning program je da će na lak i veoma jednostavan način moći da obezbede sebe i svoje poslovanje, kao i da će korišćenjem našeg programa povećati dobit svoje kompanije kroz komercijalizaciju prava intelektualne svojine i poboljšaju konkurentnost na tržištu. \r\nZaštitom inovacija pravom patenta otklanja se rizik da neće naći investitora, koji se spreman da uloži u razvoj poslovanja, kao i rizik da će investitor neovlašćeno prisvojiti i/ili zloupotrebi informacije o inovaciji.\r\nGlavna prednost korišćenja našeg e-learning programa je to što će potencijalni kupci imati sve potrebne informacije na jednom mestu. Zatim, biće edukovani kako se prema zakonu određuje ko je vlasnik inovacija zaštićenim pravom patenta.\r\nTakođe, potencijalni kupci imaće svu potrebnu pomoć pri procesu registracije inovacije pravom patenta, korak po korak, što će sam postupak registarcije maksimalno pojednostaviti i učiniti dostupan širem krugu korisnika.', NULL, NULL),
(3236, 32, 1420, 'Poznata, ali nedovoljno primenjena usluga\r\nPotencijalni  kupci nisu dovoljno upoznati sa sistemom patentne zaštite. Fokus je na vrsti sadržaja koji se pruža.\r\nNašim e-learning programom, u kome su obrađene najznačajnije oblasti iz sfere patentne zaštite, kao i sam postupak registracije inovacija patentom na različitim teritorijama, doprinosi edukaciji i obrazovanju potencijalnih kupaca.\r\nNa ovaj način podižemo nivo svesti o značaju zaštite inovacija i doprinosimo unapređenju ekonomije zasnovane na znanju kroz edukaciju putem digitalnih platformi.', NULL, NULL),
(3237, 37, 1420, 'Tim je sprovo istraživanje domaćih i međunarodnih baza podataka žigova i utvrđeno je da je naziv e-leradning programa “4 Innovation 2 Protection” slobodno za upotrebu, odnosno da ni na jednoj teritoriji nije registrovan ili predat zahtev za registraciju podistim nazivom.\r\nTakođe, Tim je registrovao domen: 4innovation2protection.rs u Registru domena Republike Srbije.', NULL, NULL),
(3238, 40, 1420, 'E-learning program ima 7 (sedam) tematskih oblasti-modula, od toga prva 4 (četiri) modula, u vidu video lekcija, predstavljaju osnovna znanja iz ove obastli i pojedinačna cena za svaku lekciju iznosi 40 (četrdeset) eura. Poslednja 3 (tri) modula, u vidu video tutorijala, predstavljaju napredne lekcije i pojedinačna cena za svaki tutorijal iznosi 70 (sedamdeset) eura. Zbir svih lekcija iznosi 370 (tristasedamdeset) eura.\r\n\r\nMi smo se opredeli da naša cena za ceo set od 7 modula iznosi 300 (tristotine) eura, a prema interesovanju korisnika, moguće je kupovati i pojedinačne module, tj. lekcije ili tutorijale. Konsulatcije 1:1 sa stručnjakom predstavljaju bonus uz kupovinu svih modula.\r\nMi predviđamo da ćemo uz adekvatnu promociju mesečno osvojiti 5% od ukupno 2.500 inovatora i/ili inovativnih kompanija, što iznosi 125 potencijalnih kupaca, a po prosečnoj ceni od 300 eura, naš poslovni prihod bio bi oko 37.500 eura mesečno, što na godišnjem nivou iznosi 450.000 eura prihoda.', NULL, NULL),
(3239, 41, 1420, 'Kao advokat i registrovani zastupnik za prava intelektualne svojine želim da proširim polje svoga delovanja mimo uobičajene advokatske prakse. Želim da potencijalnim kupcima i/ili korisnicima pružim više od usluge koje sam do sada pružala. \r\nSmatram da bi edukacijom i obrazovanjem potencijanih korisnika o značaju zaštite intelektualne svojine, kao i o pravima intelektualne svojine koja im stoje na raspolaganju doprinela povećanju svesti o ovoj temi, kao i da bi kroz edukaciju na lak i jednostavan način objasnila kako da samostalno sprovedu postupak zaštite.\r\nDigitalizacija je prisutna u svakoj oblasti poslovanje, kao podrška pojednostavljivanju I ubrzavanju procedura.\r\nNa osnovu svega navedenog, zajedno sa svojim timom želim da ponudim edukativni sadržaj koji predstavlja moju zonu genijalnosti, a sa druge strane veoma je potreban tržištu.\r\nTakođe, smaram da bi ova vrsta edukacije znatno doprinela unapređenju ekonomije zasnovane na znanju kroz edukaciju putem digitalnih platformi.', NULL, NULL),
(3240, 44, 1420, 'Tim nije ranije učestvovao u nekom mentorskom ili startap programu.', NULL, NULL),
(3241, 45, 1420, 'Tim do sada nije prikupio bilo koji drugi izvor finansiranja.', NULL, NULL),
(3242, 48, 1420, 'Podrška nam je najpotrebnija u završnoj fazi realizacije projekta u vidu finansijske podrške za obradu video material i produkciju, izradu i podizanje video material na websajta i održavanje istog, honorar našim stručnjacima, naknada za reklamu, kao i u prezentovanju naše usluge ciljnoj grupi, odnosno potencijalnim kupcima. \r\nOd programa očekujemo da postojeći i budući aplikanti kod Naučno tehnoloških parkova u Republici Srbiji budu upoznati i da koriste naše usluge 4 Innovation 2 Protection – E-learning program.', NULL, NULL),
(3243, 49, 1420, 'Radi realizacije predmetne usluge i obezbeđenja najboljeg mogućeh kvaliteta video, montaže i postavljanja video sadržaja na websajt i izradu websaja, kao i za honorare stračnjaka potrebna su nam sva finansiska sredsva koja su na raspolaganju u okviru ovog programa, odnosno 15.000 CHF. Mi kao osnivači startupa-a bismo sufinsansirali ostatak potrebnih sredstava ukoliko se za tim pojavi potreba.', NULL, NULL),
