(3248, 71, 1427, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3249, 71, 1428, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3250, 63, 1429, 'Inovacija CyberTrapper se zasniva na izgradnji „imuniteta grupe” na spoljašne sajber napade (uključujući i nepoznate, nikada ranije viđene napade), na osnovu preventivne reakcije u realnom vremenu. Koncept je baziran na obmani napadača, koji će tokom pretrage naći lažne ranjive servise i aktivirati automatizovane ili ručne napade. Tokom samog istraživanja ili pokušaja napada, naš sistem skuplja informacije o napadaču i vektoru napada (upotrebom veštačke inteligencije i matematičkog statističkog modela), i te informacije šalje u realnom vremenu svim našim korisnicma kako bi preventivno blokirali i konkretnog napadača ali i konkretan vektor napada. Na ovaj način se  postiže kolektivni, preventivi imunitet, po principu da nakon prvog pokušaja napada na bilo kog člana grupe, svi članovi zajednice postaju imuni.', NULL, NULL),
(3251, 71, 1430, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3252, 17, 1431, 'Inovacija CyberTrapper se zasniva na izgradnji „imuniteta grupe” na spoljašne sajber napade (uključujući i nepoznate, nikada ranije viđene napade), na osnovu preventivne reakcije u realnom vremenu. Koncept je baziran na obmani napadača, koji će tokom pretrage naći lažne ranjive servise i aktivirati automatizovane ili ručne napade. Tokom samog istraživanja ili pokušaja napada, naš sistem skuplja informacije o napadaču i vektoru napada (upotrebom veštačke inteligencije i matematičkog statističkog modela), i te informacije šalje u realnom vremenu svim našim korisnicma kako bi preventivno blokirali i konkretnog napadača ali i konkretan vektor napada. Na ovaj način se  postiže kolektivni, preventivi imunitet, po principu da nakon prvog pokušaja napada na bilo kog člana grupe, svi članovi zajednice postaju imuni.', NULL, NULL),
(3253, 22, 1431, 'Vladan i prof. Branimir su radili zajedno na naučnom radu na temu prepoznavanja sajber napada na osnovu primene mašinskog učenja (veštačke inteligencije) nad podacima prikupljenih sa zamki respoređenih po celom svetu. Taj rad je prihvaćen nakon revizije eminentnih svetskih profesora časopisa Springer, čime je potvrđena i osnovna ideja i izuzetna tačnost od čak 99.5%, kako nad osnovnim setom podataka, tako i nad trećim, nezavisnim setom podataka. \r\nNedeljko i Vladan su se upoznali tokom razvoja jednog startapa pre 3 godine. Nedeljko je suosnivač (manjinski), dok je Vladan savetnik u okviru tog startapa. Od tada su u stalnom kontaktu i zajedno učestvuju na različitim mentorskim i ekspertskim programima.', NULL, NULL),
(3254, 23, 1431, 'Raising Starts je namenjen ubrzanju razvoja startapova u ranoj fazi. CyberTrapper se nalazi u ranoj fazi razvoja, tako da očekujemo da dobijemo dodatna znanja kroz seriju obuka, mentorskih sesija prilagođenih specifičnim potrebama CyberTrappera kao i finansijsku podršku za pisanje i podnošenje međunarodne patentne prijave (PCT). Takođe, bitno nam je da budemo deo zajednice i okruženja koje nude naučno-tehnološki parkovi u Srbiji gde možemo da dobijemo svu neophodnu pomoć za dalji rast našeg budućeg startapa.', NULL, NULL),
(3255, 24, 1431, ',,Force your enemy to take your strength for weakness and weaknesses for strength. This will turn his strengths into weaknesses.\'\', kineski filozof ratovanja i vojni strateg Sun Tzu', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(3256, 25, 1431, 'Broj i raznovrsnost napada na sajber bezbednost raste eksponencijalnim brzinom, a tradicionalna rešenja ne mogu to da isprate. Uz IPv6, svi IoT uređaji će biti dostupni sa Interneta. Najčešći problemi su:\r\n1.       Napadači sve vreme menjaju svoje adrese, alate i tehnike koje koriste. Napade nultog dana i nepoznate napade je nemoguće otkriti tradicionalnim sistemima\r\n2.       Testovi penetracije su veoma skupi i spori posebno za ,,low cost’’ uređaje, kao što je IoT\r\n3.       Rešenja za sajber bezbednost su reaktivna tj. mogu da prepoznaju samo već viđene napade. Sistemi za bezbedonosnt i monitoring su previše složeni da bi ih koristili ljudi koji nisu stručnjaci, i preskupi za MSP\r\n4.       Prosečan životni vek bilo kog malvera, pre nego što ga BILO KOJI antivirus otkrije je 1-3 meseca\r\nKoristeći objavljene izveštaje i sopstvenu mrežu zamki, otkrili smo da postoji približno 13.000 napada dnevno, gde oko 5% malvera nije detektovan od strane nijednog antivirusa.', NULL, NULL),
(3257, 26, 1431, 'Potrošnja u industriji sajber bezbednosti u 2019. dostigla je oko 40,8 milijardi američkih dolara, a predviđanja sugerišu da će tržište preći 60 milijardi američkih dolara do 2021. Ova prognoza uzima u obzir uticaj pandemije koronavirusa (COVID-19). Od izbijanja pandemije COVID-19, organizacije širom sveta šalju svoje zaposlene na rad od kuće. Ovakva decentralizacija organizacija stvorila je nove mogućnosti za eksploataciju od strane zlonamernih aktera, što se poklapa sa zapažanjem IT stručnjaka da postoji porast sajber napada nakon pandemije COVID-19. Kao rezultat toga, sajber sigurnost ostaje prioritet kako bi se osigurala operativnost kompanija i sigurnost podataka https://bit.ly/3Fzwutr\r\nCyber Trapper će svoj plasman započeti sa tržišta u Srbiji, a krajem 2022 planirano je da se krene sa otvaranjem tržista u CEE regionu (Rumunija, Mađarska, Poljska, Češka, Bugarska, Ukrajina, Balkan). Takođe, inicijalna zainteresovanoist je pokazana od strane kompanija iz UK kao i iz SAD.', NULL, NULL),
(3258, 27, 1431, 'Cyber Trapper će targetirati tri segmenta kupaca:\r\n\r\n1. Mala i srednja preduzeća (MSP) koja integrišu IoT/IIoT tehnologije, ali nemaju timove posvećene sajber bezbednosti i iskustvo u sprovođnju sajber bezbednosti (MSP koja pružaju usluge koje se oslanjaju na IoT, itd.)\r\n\r\n2. Proizvođačke kompanije koje implementiraju koncept industrijalizacije 4.0 \r\n\r\n3. Provajderi kritičnih usluga kao i kratkoročni događaji visoke vidljivosti (Expo, olimpijske igre, itd.)\r\n\r\nKontakte i prve povratne informacije od potencijalnih kupaca iz segmenta 1 i 3 su dobijeni. Za Segment 2 smo već postigli dogovor o potencijalnom targetiranju IIoT tržišta sa kompanijom koja posluje u UK i SAD. \r\n\r\nŠto se tiče segmenta 3, uspostavili smo vezu sa kompanijom iz Kine koja pruža usluge telekonferencije za Olimpijadu u Pekingu i koja je zainteresovana za dalju saradnju. Na osnovu Vladanovog prethodnog iskustva u segmentu „Major Events Service“, naš prodor na tržište će biti mnogo lakši.', NULL, NULL),
(3259, 28, 1431, 'Cyber Trapper je “embedded technology” uređaj baziran na AI i ML koji može štiti vas od napada sa Interneta - vašu celu mrežu ili vaš pojedinačni uređaj. Uz Cyber Trapper nema potrebe za profesionalnim timom koji će da se baviti sajber bezbednoscu, on radi sav taj posao. Plasiranjem obmanjujuće ranjivosti, vi čekate da vidite ko će pokušati da pristupi i kako će pokusati da upadne. Ova metoda je nešto poput postavljanja vrata na zgradu banke, bez prostorije iza, i čekanja da se vidi ko će doći da pokuša da otvori ta vrata, i kojim metodama. Ovakvim metodom bez rizika učite o najnovijim vrstama napada i napadačima, kako biste poboljšali zaštitu stvarnih vrata i sprečili stvarne napade.', NULL, NULL),
(3260, 30, 1431, 'Prema našem najboljem znanju, trenutno ne postoji konkurent koji pravi baš ono što mi radimo – Zamke u obliku ranjivih IoT uređaja zasnovanih na digitalnom kloniranju i veštačkoj inteligenciji, sa mogućnošću automatske prevencije napada. Ipak, postoje potencijalne grupe konkurenata koje pružaju slične usluge i postoji rizik da postanu naši konkurenti. Najpoznatiji konkurenti izlistani po kategorijama su:\r\n1.     Obmana napadača (engl. Deception): TrapX, Canary Tools, TopSpin Security, Attivo networks\r\n2.     IoT bezbednost: Senrio, ForeScout, Armis\r\n3.     Usluge automatske prevencije (engl. Threat Feeds): Falcon X, ThreatConnect, Kaspersky Labs,', NULL, NULL),
(3261, 29, 1431, 'Ključne razlike su:\r\n1.              Naše vreme detekcije je manje od 10 ms. Podržavamo korelaciju u realnom vremenu i bar smo 10.000 brži od bilo kog rešenja za big data\r\n2.              Postavljamo spoljne zamke i koristimo ih da u realnom vremenu učimo o novim, nepoznatim napadačkim IP adresama i novim metodama napada, kako bismo bili proaktivni u podataka čak i od nepoznatih vrsta napada.\r\n3.              Vršimo automatsku sanaciju napada\r\n4.              Kontrolišemo primenu različitih tipova IIoT klonova širom naše mreže\r\n5.              Postigli smo tehničku izvrsnost:\r\n                    a.       Arhitektura zasnovana na mikroservisima, potpuno skalabilna\r\n                    b.       Obrada logova u realnom vremenu.\r\n                    c.       Mogućnost obrade više od 50.000 događaja u sekundi na jednom serveru\r\n                    d.       Neograničeno i pristupačno skladište logova.\r\n6.              Neograničena retrospektivna analiza događaja', NULL, NULL),
(3262, 32, 1431, 'Na osnovu pretrage i analize tržišta putem Googla, ali i putem specijalizovanih analize Gartnera, Forrestera i drugih relevatnih izvora, pokazano je da trenutno ne postoje prozivodi bazirani na kloniranju uređaja za ranu prevenciju napada. Činjenica da smo mi fokusirani pre svega na IIoT segment dodatno smanjuje verovatnoću da postoji konkurencija. Takođe, naš potencijalni partner iz UK/USA koji je direktno u cyber security biznisu za IIoT nam je potvrdio kako do sada nisu sreli ni jedno rešenje bazirano na ovakvom konceptu.', NULL, NULL),
(3263, 37, 1431, 'Stanje tehnike, kao i Freedom to operate je urađeno internim resursima pretragom kroz EPO-vu bazu Espacenet. Takođe smo obavili inicijalne razgovore sa patentnim advokatima iz UK i SAD koji su nam potvrdili da imamo dobru poziciju za podnošenje međunarodne patentne prijave. Pored patenta planiramo da zaštitimo i žig. Vlasnik identifikovane intelektualne svojine (patent i žig) bi bila novoosnovana kompanija CyberTrapper doo.', NULL, NULL),
(3264, 40, 1431, 'U zavisnosti od segmenta tržišta, imaćemo nekoliko različitih modela ostvarivanja zarade:\r\n1. Za segment MSP to će biti mesečni najam servisa, zajedno sa hardverom, sa minimalnom cenom (na osnovu analize svakog tržišta) i bez kustomizovanih usluga (osnovni set zamki i blokiranje malicioznog saobraćaja)\r\n2. Kroz strateške partnere (pre svega Telekome, Mobile i Cloud provajdere) gde planiramo da im omogućimo diferencijaciju u odnosu na konkurenciju na njihovom tržištu, a oni nama olakšan deployment kroz centralizovane sisteme. Oni će pružati Layer 1 podršku, dok ćemo mi pružati naprednu layer 2 podršku.\r\n3. Za industrijske klijente, pored usluge rane prevencije napada, dodatni prihodi će biti ostvareni kroz mogućnost kloniranja njihovih industrijskih IIoT komponenti i izlaganje istih spoljnim napadima u cilju učenja mogućih ali i novih, nikad viđenih napada za svaku IIoT komponentu ponaosob.', NULL, NULL),
(3265, 41, 1431, 'Napredak\r\n1.              Edge uređaj\r\n                      a.       klonirana zamka je razvijena i omogućava izvršavanje na uređajima male CPU snage \r\n                      b.       razvijen je interfejs za krajnjeg korisnika\r\n                      c.       razvijena je mikro arhitektura, zasnovana na docker-u.\r\n2.              Veštačka inteligencija\r\n                     a.       sprovedena su naučna istraživanja koja procenjuju različite modele veštačke inteligencije. \r\n                     b.       započeli smo sledeću fazu istraživanja za omogućavanje brze detekcije zasnovane na veštačkoj inteligenciji koja ne zahteva GPU, uz brzo re-treniranje  za manje od 3 minuta\r\n3.              Istraživanje tržišta IIoT-a\r\n4.              Uspostavljanje strateških partnerstava\r\n                    a.       tri kompanije zainteresovane za strateško partnerstvo', NULL, NULL),
(3266, 44, 1431, 'Do sada se nismo prijavljivali ni na jedan mentorski/startap program sa ovim proizvodom', NULL, NULL),
(3267, 45, 1431, 'Istraživanje i razvoj CyberTrappera je u potpunosti finansiran spostvenim sredstvima (FFF runda).', NULL, NULL),
(3268, 48, 1431, 'Očekujemo da dobijemo dodatna znanja kroz obuke i  mentorske sesije. Takođe očekujemo da se povežemo sa potencijalnim investitorima kako iz pool-a mentora tako i kroz mrežu naučno-tehnoloških parkova i da se umrežimo sa postojećim startapovima u okviru naučno-tehnoloških parkova. Finansijska pomoć će nam omogućiti da napišemo i podnesemo nacionalnu i međunarodnu patentnu prijavu i na taj način osiguramo svoju poziciju pred budućim investitorima. Takođe, bitmo nam je da budemo deo zajednice i okruženja koje nude naučno-tehnološki parkovi u Srbiji gde možemo da dobijemo svu neophodnu pomoć prilagođenu specifičnim potrebama CyberTrappera', NULL, NULL),
(3269, 49, 1431, 'U ovoj fazi razvoja potrebno nam je 15.000 švajcarskih franaka za pisanje i podnošenje nacionalne i međunarodne patentne prijave, koja bi nam dalje osigurala bolju poziciju u razgovoru sa potencijalnim investitorima.', NULL, NULL),
(3270, 52, 1431, NULL, NULL, NULL),
(3271, 66, 1434, NULL, NULL, NULL),
(3272, 76, 1435, NULL, NULL, NULL),
(3273, 83, 1437, NULL, NULL, NULL),
(3274, 89, 1438, 'Vladan je osnivač Advanced Security Technologies, kompanije koja razvija inovativna rešenja u oblasti sajber bezbednosti i pruža usluge na međunarodnom nivou.\r\n\r\nPre osnivanja AST-a, bio je direktor operacija sajber bezbednosti Siemensa, odgovoran za bezbednost 40.000 servera u 90 zemalja. Takodje je bio direktor za sajber bezbednost na nekoliko Olimpijskih igara.\r\n\r\nVladan je magistar računarskih nauka, sa nizom specijalizovanih poslovnih i IT diploma. Izabran je za program za razvoj talenata Univerziteta u Kembridžu kao jedan od 30 najboljih stručnjaka od 80.000 zaposlenih u Atosu. U Hong Kongu, 2018. godine, dobio jedno od najvećih svetskih priznanja – proglašen je liderom “bezbenosnih IT sistema” od strane (ISC)2, najveće svetske organizacije stručnjaka sajber bezbednosti.', NULL, NULL),
(3275, 90, 1438, 'Vladan je u potpunosti posvećen ovom projektu, budućem spinofu matične AST kompanije na bazi čijih iskustava i mreže se zaniva ova inovacija. On je  i većinski vlasnik, kreator osnovne ideje i ekspert u oblasti sajber bezbednosti.', NULL, NULL),
(3276, 91, 1438, 'Vladan je direktor i 100% vlasnik AST kompanije, suosnivač budućeg startupa Cyber Trapper. \r\nPovremeno, drži predavanja na tehničkim fakultetima iz oblasti sajber bezbednosti i mentor je na diplomskim i master radovima iz te oblasti, pre svega na univerzitetima u Nišu i Beogradu.', NULL, NULL),
(3277, 89, 1439, 'Branimir je svoju kompletnu akademsku i poslovnu karijeru posvetio oblasti veštačke inteligencije, tj mašinskog učenja. Diplomirao je 1991 godine na Elektronskom fakultetu u Nišu, magistrirao 2001 na istom fakultetu i doktorirao 2005 na Elektrotehničkom fakultetu u Beogradu, nakon čega je nastavio svoju akademsku karijeru na Prirodno-matematičkom fakultetu u Nišu. Objavio je preko pedeset radova iz oblasti veštačkih neuronskih mreža, mašinskog učenja i veštačke inteligencije u medjunarodnim časopisima i na naučnim konferencijama. Autor je jedne monografije nacionalnog značaja i dva poglavlja u inostranim monografijama.  Od 2005 godine učestvuje u privrednim projektima vezanim za mašinsko učenje i veštačku inteligenciju. Kroz novosnovanu kompaniju AIMS, sa specijalizovanim timom za razvoj AI rešenja, radi na primenama mašinskog učenja i veštačke inteligencije u raznim oblastima.', NULL, NULL),
(3278, 90, 1439, 'Branimir je u većoj meri posvećen ovoj inovaciji, i suosnivač je budućeg startapa Cyber Trapper. Njegova primarna odgovornost u timu je:\r\n- razvoj AI rešenja za detekciju sajber napada na osnovu učenja iz zamki,\r\n- mogućnost učenja na malim, “edge” sistemima\r\n- mogucnost kontinuiranog ML učenja najnovijih vrsta napada\r\nOn je ko-kreator ideje i ekspert u oblasti veštačke inteligencije.', NULL, NULL),
(3279, 91, 1439, 'Vanredni profesor na Prirodno-matematičkom fakultetu u Nišu', NULL, NULL),
(3280, 89, 1440, 'Doktor tehničkih nauka- oblast hemija i hemijska tehnologija. Nedeljko se bavi inovacijama i  transferom tehnologije zadnjih 11 godina na Univerzitetu u Beogradu. U okviru svog posla bavi se identifikacijom, zaštitom i komercijalizacijom naučnoistraživačkog rada. Osnivač je konsultatske agencije WIUWE i suosnivač dva startapa. Takodje učestvuje kao mentor u različitim akceleratorskim programima, kao i recenzent za EIC accelerator Evropske komisije.', NULL, NULL),
(3281, 90, 1440, 'Nedeljko učestvuje u oblasti zaštite intelektualne svojine, kreiranja strategije intelektualne svojine,  biznis developmenta i privlačenju investicija/grantova iz privatnih i javnih fondova. Nedeljko je u u većoj meri posvećen razvoju ove poslovne prilike', NULL, NULL),
(3282, 91, 1440, 'Nedeljko je direktor Centra za transfer tehnologije Univerziteta u Beogradu sa punim radnim vremenom', NULL, NULL),
(3283, 89, 1441, 'Dijana je direktor kompanije Loopia d.o.o., jedne od najvećih kompanija u Srbiji u domenu web hostinga, sa matičnom firmom Loopia AB koja je jedna od najvećih hosting kompanija u Nordijskom i Centralnom regionu Evrope. Dijana je diplomirani inženjer, Elektronski fakultet u Nišu, sa bogatim poslovnim iskustvom od preko šesnaest godina, pre svega sa SMB sektorom.', NULL, NULL),
(3284, 90, 1441, 'Dijana je delimično posvećena ovom startapu, pre svega kao ekspert u hosting servisima za SMB segmente trzišta, i sa svojim jakim poslovnim kontaktima u Evropi.', NULL, NULL),
(3285, 91, 1441, 'Dijana je direktor kompanije Loopia d.o.o. sa punim radnim vremenom i fokusom primarno na menadžmentu.', NULL, NULL),
(3286, 71, 1447, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3287, 63, 1448, 'Linija prirodne organske kozmetike sa originalnim recepturama koja sadrži sve što je potrebno za negu kože, lica i tela, za različite tipove kože.', NULL, NULL),
(3288, 71, 1449, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3289, 17, 1450, 'Linija prirodne organske kozmetike sa originalnim recepturama koja sadrži sve što je potrebno za negu kože, lica i tela, za različite tipove kože.', NULL, NULL),
(3290, 22, 1450, 'Nismo radili formalno na zajedničkim projektima, ali smo neformalno već razrađivali ideju vezanu za organsku aroma kozmetiku, Ljiljana dukić oko receptura a Vladimir Perić i Đorđe Malešević okko načina plasiranja na tržište.', NULL, NULL),
(3291, 23, 1450, 'Želimo da pokrenemo ozbiljnu proizvodnju organske kozmetike, da je brendiramo i da bude dostupna širokoj populaciji, i mislimo da ovaj program može da nam pomogne u tome.', NULL, NULL),
(3292, 24, 1450, 'U ljubavi sa prirodom - In Love with Nature', NULL, NULL),
(3293, 25, 1450, 'Rešava problem ljudima koji su osetljivi na očuvanje životne sredine i koji žele da koriste organske biljne proizvode, koji imaju visoko razvijenu svest o organskim preparatima, kao i veganima i vegetarijancima. Linije organske kozmetike već postoje, ali ih nema dovoljno i nisu dovoljno zastupljene.', NULL, NULL),
(3294, 26, 1450, 'Svi dobrostojeći ljudi koji brinu o svom zdravlju. Zemlje širenja tržišta u naredne dve godine - Hrvatska, Slovenija, Austrija, mada i sve ostale evropske zemlje dolaze u obzir. Prehrambena i neprehrambena organska industrija je u 2020. zaradila 61,9 milijardi u prodaji (12,4%) što je drastično povećanje u odnosu na 2019.  kada je imala stopu rasta od samo 5%. (izvor: https://app.swapcard.com/event/natural-products-expo-virtual/planning/UGxhbm5pbmdfNjQxNDA5)', NULL, NULL),
(3295, 27, 1450, 'Svi ljudi sa razvijenom ekološkom svešću, vegani, ljudi sa osetljivom kožom, svi koji teže zdravijem načinu života.', NULL, NULL),
(3296, 28, 1450, 'Kozmetička linija je inovacija zbog samog pristupa - nudi kompletan asortiman proizvoda i celokupne pakete koji odgovaraju potrebama kupaca za negu tela ili lica za sve tipove kože (suva, problematična, amsna, sklona ekcemima...)\r\nProizvodi su tehnoloska inovacija, jer tim priprema sopstvene recepture koje se baziraju na opste dostupnom znanju i iniciativi/inovativnosti projektnog tima - recepti ce biti zastićeni kao autorska dela.\r\nTim ce isto tako uspostaviti sopstveni brend, koji ce izražavati prirodu proizvoda i potrebe klijenata.\r\nTim već radi probnu proizvodnju, odnosno istraživanja na osnovi eksperimentalne beta verzije preparata.', NULL, NULL),
(3297, 30, 1450, 'Postoje mali proizvođači od kojih kupuju ovu vrstu kozmetike onlajn, ali ne postoji ništa dovoljno razvijeno. Nekad je postojao \"Lush\" i u Srbiji, sada postoji samo u par zemalja, ali ne nudi kompletan asortiman za negu kože lica i tela.', NULL, NULL),
(3298, 29, 1450, 'Koža je naš najveći organ i ono što se namaže na nju je za jako kratko vreme u krvotoku, dakle, ono što stavljamo na kožu je važno kao i ono što jedemo, možda čak i važnije, jer se od unete hrane ponešto i izluči, dok se ono što je namazano na kožu jako brzo apsorbuje. Mi nudimo kozmetikčku liniju koja je potpuno prirodna, zdrava i jestiva - jer ono što ne biste smeli da pojedete ni vaša koža ne bi smela da upije.', NULL, NULL),
(3299, 32, 1450, 'Ljudi su čuli za organsku kozmetiku ali je nedovoljno zastupljena na tržištu, prosto spada u proizvode čije vreme tek dolazi.', NULL, NULL),
(3300, 37, 1450, 'Nismo, ali imamo nameru da kada krenemo u proizvodnju većih količina da zaštitimo recepture.', NULL, NULL),
(3301, 40, 1450, 'Od prodaje svojih proizvoda.', NULL, NULL),
(3302, 41, 1450, 'Oko 3 godine radimo na razvoju novih receptiura, tj, konkretno Ljiljana Dukić radi na razvoju i proizvodnji, Đorđe Malešević radi na marketingu, dok je Vladimir Perić IT podrška, pošto planiramo da se orijentišemo na prodaju preko interneta - web shopa i platformi društvenih mreža.', NULL, NULL),
(3303, 44, 1450, 'Nismo.', NULL, NULL),
(3304, 45, 1450, 'Nismo ni pokušavali, ovo je prvi put dan konkurišemo s namerom da prikupimo sredsva.', NULL, NULL),
(3305, 48, 1450, 'Najpotrebnija nam je podrška u brendiranju i marketingu.', NULL, NULL),
(3306, 49, 1450, 'Potrebna su sredstva za sirovine (3.500e), sredstva za kupovinu ambalaže (500e) za kupovinu i postavljanje web shopa (100e mesečno, na godišnjem nivou 1200e), sredstva za zakup prostora u kom će se obavljati proizvodnja (150e mesečno) i potrebno je uraditi dizajn ambalaže i logo (1000 evra).', NULL, NULL),
