(3312, 89, 1458, 'Formalno obrazovanje: Septembar 2011 - jul 2012 - West London Business College, London\r\nSeptembar 2008. - Pravosudni ispit\r\n2000-2005. - Pravni fakultet, Univerzitet u Novom sadu\r\n1996-2000. - Gimnazija Isidora Sekulić, Novi Sad\r\nStručno usavršavanje:\r\nJul 2009. - Registrovani zastupnik za zaštitu intelektualne svojinepred Zavodom za intelektualnu svojinu Republike Srbije (zastupnik za znake razlikovanje i zastupnik za patente)\r\nDecembar 2015. - Posrednik za mirno rešavanje sporova registrovan pred Ministarstvom pravde, dozvola br.740-09-1055/2015-22 od 14.12.2015. godine,\r\nobnovljena dozvolom br. 740-09-802/2019-22 od 26.08.2019. godine\r\nPROFESIONALNO ISKUSTVO:\r\nAdvokatska kancelarija Branislava Stajić Tanjga, Novi Sad, RS;  Pozicija: Advokat April 2010 –\r\nNovembra 2008 - Mart 2010: Advokatska kancelarija Slobodan dr Beljanski, Pozicija: advokat\r\nApril 2006-Oktobar 2008:Advokatska kancelarija Slobodan dr Beljanski, Pozicija:advokatski pripravnik', NULL, NULL),
(3313, 90, 1458, 'Osnivač, kreator idejnog rešenja, potpuno posvećen', NULL, NULL),
(3314, 91, 1458, 'Advokat u advokatskoj kancelariji Stajić Tanjga (full time)', NULL, NULL),
(3315, 89, 1459, 'OBRAZOVANJE:\r\n2004/2009 - Departman za geografiju, turizam i hotelijerstvo, Prirodno matemaatički fakultet, Novi Sad\r\n2000/2004 - Gimnazija \"Filip Višnjić\" Bijeljina\r\nRadno iskustvo: \r\njul 2021 -\r\nMaster Tim Consalting doo Novi Sad, \r\nEdukacija klijenata za pisanje sadržaja i izradu vizuelnog sadržaja na internet platformama i društvenim mrežama, digitalni marketing; oglašavanja i reklamiranja na Google-u i Facebook-u; rad u programu Canva; rad na platformama Mailchimp, MailerLite, Sendfox, rad u aplikaciji Trello, Calendly, Linktree\r\nDecembar 2009-Novembar 2020 - Grand Tours doo, Novi Sad\r\nKreiranje programa za turističke aranžmane u zemlji i inostranstvu, izrada kalkulacija turističkih aranžmana, realizacija i organizacija individualnih i grupnih aranžmana, rezervacije svih vrsta prevoza, izrada konkursne dokumentacije za javne nabavke, komunakacija sa klijentima svih nivoa.', NULL, NULL),
