(3321, 89, 1462, 'Prvi put želim da pokrenem startap, dosadašnje radno iskustvo je uglavnom u struci. Imala sam iskustava u organizaciji događaja (hiking, biciklizam, izleti) i kuvanja na tim istim događajima mimo svoje struke', NULL, NULL),
