(3330, 71, 1468, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3331, 63, 1469, NULL, NULL, NULL),
(3332, 71, 1470, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3333, 17, 1471, NULL, NULL, NULL),
(3334, 22, 1471, 'Startap ideja sa kojom se prijavljujemo za ovaj program je naše prvo iskustvo ove vrste, pre ove ideje nismo imale prilike da radimo na razvoju startapa ni kao tim, ni pojedinačno. Međutim, s obzirom na to da smo zajedno pohađale srednju školu i da smo trenutno koleginice na fakultetu, često smo timski radile na različitim školskim i studentskim projektima i prezentacijama. Naš zajednički rad na ovoj stratap ideji počeo je upravo u okviru jednog studentskog projekta, potom smo samostalno nastavile sa razvojem ideje, da bismo se, u septembru 2021. godine prijavile za program RISE - Regionalni inkubator za socijalno preduzetništvo. Od oktobra 2021. godine učestvujemo kao jedan od sedam timova u prvoj fazi RISE programa - Programu Ideacije, pod imenom Ski Easy. Program nudi samo nefinansijsku, odnosno stručnu podršku u razvoju ideje i biznis modela.', NULL, NULL),
(3335, 23, 1471, 'Odlučne smo u nameri da damo sve od sebe kako bismo ostvarile svoju ideju, te smo u stalnoj potrazi za prilikama koje će nam omogućiti da je podignemo na viši nivo i budemo korak bliže realizaciji. Preporuku za ovaj program dobile smo od docenta FON-a Milana Okanovića koji je bio jedan od učesnika i prošao put od ideje do realizacije. Njegova startap priča za nas je veoma inspirativna - ukazala nam je na brojne mogućnosti koje Raising Stars nudi i time nas motivisala da se i same prijavimo. Evidentno je da verujemo u svoju ideju, a dodatni vetar u leđa dali su nam pozitivni komentari i sugestije naših poznanika ali i profesora i predstavnika privrede koji su imali priliku da čuju našu prezentaciju tokom Nedelje studentskih ideja. Preduzetnički put je pun uspona i padova, te je mreža podrške koju čine mentori i drugi startapi i koja olakšava razmenu znanja od ključne važnosti za naš dalji napredak. Imajući u vidu kompleksnost ideje koju razvijamo, ne treba zanemariti ni značaj pristupa investicionim fondovima i finansijske podrške.', NULL, NULL),
(3336, 24, 1471, 'Planina na dlanu - bez straha uživajte u čarima prirode!\r\nGet informed, be safe, rest and let the mountain offer you the best!', NULL, NULL),
(3337, 25, 1471, 'Pokušavamo da rešimo probleme posetilaca planina koji se odnose na: orijentisanje u prostoru i lociranje bliskih osoba, pronalaženje znamenitosti, ustanova, lokala i događaja koje žele da posete, dugo čekanje u redu za žičaru, kontaktiranje i informisanje Gorske službe o lokaciji osobe kojoj je potrebna pomoć. Ovi problemi su prisutni na svim planinama gde je razvijen turizam. Njihova kompleksnost zavisi od geografskih odlika lokacije, njene veličine i posećenosti, kao i od dostupnosti, ažurnosti i obuhvatnosti postojećih izvora informisanja. Procena težine problema zavisi od potreba i percepcije pojedinca. Skijam od detinjstva i već dugo sam svesna ovih problema, ali sam tek skoro, zahvaljujući znanju i načinu razmišljanja koje sam usvojila tokom studija, počela da razmišljam o mogućim rešenjima. Podelila sam svoja zapažanja sa članicama tima, koje su se složile i iznele svoje viđenje. Razgovarale smo sa svojim poznanicima i došle do saznanja da se svi susrećemo sa istim problemima.', NULL, NULL),
(3338, 26, 1471, 'U prvim godinama postojanja planiramo da se fokusiramo na Kopaonik, s obzirom na to da je najposećenija planina u Srbiji i da ima veliki broj skijaških, pešačkih i bicklističkih staza i drugih sadržaja. Potom, planiramo širenje na druge planine na teritoriji Srbije, a tek u daljoj budućnosti razmatraćemo dalje širenje tržišta i to najpre na region. \r\nTokom 2019. godine Kopaonik je posetilo 135 613 turista. (izvor: raskaturizam.rs) U toku 2020. godine, usled epidemije virusa COVID-19, došlo je do pada turističke delatnosti, međutim, sa popuštanjem epidemioloških mera tokom 2021. beleži se rast broja posetilaca planina u Srbiji. \r\nU prvim godinama našeg poslovanja, kada planiramo da se fokusiramo na Kopaonik, ovu planinu posetiće oko 150 000 ljudi. Od toga, oko 70% ljudi čini naše ciljno tržište (preostalih 30% ne uzimamo u obzir jer boravak na planini provode isključivo npr. u hotelu, izričiti su protivnici tehnologije i sl.), dakle veličina našeg ciljnog tržišta je oko 100 000 ljudi.', NULL, NULL),
(3339, 27, 1471, 'Naši potencijalni kupci su posetioci planina. Njihove ključne karakteristike su: fizički su aktivni, digitalno pismeni i vole prirodu, a ključne potrebe: orijentisanost u prostoru, informisanost i brza reakcija Gorske službe.\r\nU decembru smo započele sprovođenje ankete (https://forms.gle/gWtAgKC56Q5vLoGG8). \r\nAnketu je do 23.12. popunilo 240 ispitanika različitih uzrasta. Rezultati ankete potvrdili su naše pretpostavke - najveći broj ispitanika su skijaši, hajking i planinski biciklizam se tek razvijaju u Srbiji, najposećenije planine su Zlatibor i Kopaonik, a ispitanici najčešće na planinu idu sa prijateljima. Dobro smo prepoznale i potrebu za izbegavanjem gužvi na žičarama, a iznanadilo nas je što je samo 37% ispitanika kao jednu od tri najvažnije stavke izabralo brzo kontaktiranje Gorske službe. Kao što smo pretpostavile, većina ispitanika nema problem da koristi aplikacije koje imaju pristup njihovim podacima/lokaciji, a mali broj ispitanika koristi plaćene verzije aplikacija.', NULL, NULL),
(3340, 28, 1471, 'Glavne karakteristike aplikacije: pomaže posetiocima planina prilikom orijentisanja u prostoru, pruža informacije o lokalnim sadržajima i manifestacijama i omogućava direktno kontaktiranje Gorske službe. Prema našim istraživanjima, za razvoj aplikacije može da se korisi Flutter (tehnologija prilagođena za Android i IOS). Jedinstvenom je čine: interaktivna  mapa sa sadržajima za sve posetioce planina, usmeravanje putem glasovnih komandi i praćenje lokacije drugih korisnika; sveobuhvatna i ažurna baza informacija o lokalnim sadržajima i događajima i informacije o popunjenosti kapaciteta žičara; direktno kontaktiranje i slanje lokacije Gorskoj službi; učešće korisnika u humanitarnim akcijama.', NULL, NULL),
(3341, 30, 1471, NULL, NULL, NULL),
(3342, 29, 1471, NULL, NULL, NULL),
(3343, 32, 1471, NULL, NULL, NULL),
(3344, 37, 1471, 'Pošto je naš proizvod na nivou ideje, trenutno ne postoji način da sprovedemo zaštitu (izuzev poslovnom tajnom, što za sada ne smatramo neophodnim). Kada se ideja konkretizuje ponovo ćemo razmotriti mogućnosti. U slučaju zaštite, vlasnik intelektualne svojine bio bi tvorac ideje (Jelena Stišović). Zaštitu logotipa planiramo da izvršimo čim budemo imale konačnu verziju.', NULL, NULL),
(3345, 40, 1471, 'Još uvek razmatramo koji model monentizacije, odnosno koja kombinacija modela monetizacije, bi bila najpogodnija za našu aplikaciju (kao što smo već pomenuli, jedan od ciljeva naše ankete je upravo da nam ukaže na to koje funkcionalnosti su naši korisnici spremni da plate). Imajući u vidu informacije koje smo do sada prikupili, smatramo da bi preuzimanje naše aplikacije trebalo da bude besplatno. Verujemo da bi znatan deo prihoda svakako poticao od mobilnog oglašavanja i to prvenstveno od reklamiranja hotela, prodavnica, restorana i drugih lokala koji se nalaze na konkretnoj planini i u okruženju. Smatramo da bi korišćenje određenih funkcionalnosti naše aplikacije trebalo da se naplaćuje, te razmatramo tzv. freemium model, ali i model pretplate koji podrazumeva da korisnici našu aplikaciju instaliraju besplatno, ali je potom potrebno da, u zavisnosti od funkcionalnosti koje žele da koriste, izvrše uplatu.', NULL, NULL),
(3346, 41, 1471, 'Ideja je nastala u aprilu 2021. kada sam na skijanju počela da razmišljam o rešavanju problema sa kojima se susreću posetioci planina. Za potrebe projekta iz predmeta Menadžment tehnologije i razvoja na fakultetu razvile smo ideju i prezentovale kroz Lean Canvas metodologiju. U septembru smo primljene u RISE program - Program Ideacije. \r\nU novembru smo u okviru projekta Preduzmi ideju, tokom Nedelje studentskih ideja predstavile aplikaciju profesorima FON-a i predstavnicima privrede i dobile pozitivne komentare vezane za prepoznavanje problema, razrađenost Businsess modela, ekološke i humanitarne aspekte. Profesor zaposlen u Gorskoj službi ukazao nam je i na značaj koji bi aplikacija imala za rad spasilaca i prikupljanje statističkih podataka o broju i ozbiljnosti povreda, a CEO Digitalne Srbije pohvalio je što smo prepoznale značaj koji saradnja sa lokalima ima za komercijalizaciju. U decembru smo sprovele i istraživanje tržišta u vidu ankete. Planiran je sastanak sa Gorskom službom.', NULL, NULL),
(3347, 44, 1471, 'U septembru 2021. godine, saznala sam za program RISE - Regionalni inkubator za socijalno preduzetništvo i okupila svoj tim kako bismo razmotrili učešće u jednom takvom projektu. Svi članovi tima su se složili i poslali smo prijavu, da bismo mesec dana kasnije saznali da smo jedan od sedam timova koji su primljeni u prvu fazu RISE programa - Program Ideacije. Do sada smo u okviru RISE programa definisale problem, misiju i rešenje, radile na razvoju Social Business Canvasa, odredile ciljeve, probleme i koristi korisnika, definisale Proto Personu, proširile svoja znanja o istraživanju tržišta, brendingu i marketingu i imale priliku da čujemo iskustva i stupimo u kontakt sa ostvarenim preduzetnicima. Zahvaljujući RISE-u imamo mogućnost da ostvarimo direktan kontakt sa PR-om Gorske službe spasavanja i planiran je prvi sastanak sa predstvanicima službe. Naše učešće u Programu Ideacije u okviru RISE programa završava se sredinom februara 2022. godine.', NULL, NULL),
(3348, 45, 1471, 'Do sada nismo prikupile ni jedan izvor finansiranja.', NULL, NULL),
(3349, 48, 1471, 'Očekujemo da od mentora i eksperata koji imaju iskustva u ovakvim poduhvatima, steknemo nova znanja i veštine kako bismo unapredile ideju, da ostvarimo kontakte koji će nas podržati i olakšati nam realizaciju i da upoznamo druge timove i njihove startape i na taj način budemo deo mreže podrške, učestvujemo u razmeni znanja sa kolegama preduzetnicima i damo svoj doprinos u kreiranju pozitivne preduzetničke klime u Srbiji. \r\nS obzirom da studiramo Menadžment, nemamo dovoljno znanja iz IT-a koje nam je potrebno da bismo detaljno sagledale performanse aplikacije i pristupile njenom razvoju. Najpotrebnija nam je upravo podrška u oblasti IT-a, što podrazumeva angažovanje osobe koja ima znanje i iskustvo u razvoju mobilnih aplikacija i koja je spremna da se priključi našem timu. Pored toga, imajući u vidu da naša ideja podrazumeva razvoj kompleksne mobilne aplikacije, od velikog značaja nam je i ostvarivanje kontakata koji su spremni da nam pruže svoju stručnu ali i finansijsku podršku.', NULL, NULL),
(3350, 49, 1471, 'Kakao bi naša procena bila što precizinija, pored samostalnog isztraživanja konsultovali smo i relevantne stručnjake i zaključili:\r\n-	 za izradu MVP-a potrebno je oko 25 000eur\r\n-	za izradu logoa i osnovnog web-sajta oko 350eur\r\n-	za aktivnosti marketinga i promocije, koje podrazumevaju izradu reklamnih materijala u vidu flajera i plakata, vođenje naloga i reklamiranje na društvenim mrežama, kao i oglašavanje putem Google Ads-a: oko 600eur na mesečnom nivou\r\n-	za plasiranje aplikacije na Google Play Store, Apple App Store: plasiranje aplikacije na Google Play Store košta oko 22eur (plaća se samo jednom), plasiranje na Apple App Store iziskuje oko 88eur godišnje', NULL, NULL),
(3351, 52, 1471, 'Na učešće u programu Raising Stars uputili su nas profesori sa fakulteta, kao i predavači koje smo imali priliku da slušamo u okviru Nedelje studentskih ideja, koja je bila deo projekta Preduzmi ideju.', NULL, NULL),
