(3380, 71, 1489, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3381, 89, 1490, 'Student 3. godine Fakulteta organizacionih nauka, na smeru Menadžment, članica Tima za akademske odnose u Savezu studenata Fakulteta organizacionih nauka i članica organizacionog tima na projektu “Dani Prakse\".\r\nIskustvo u podučavanju engleskog jezika. \r\nŠto se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao lider tima Ski Easy.', NULL, NULL),
(3382, 90, 1490, 'Tvorac ideje i lider tima, radi na razvoju ideje i uvođenju novih funkcionalnosti, zadužena za fundraising - priprema prezentacije i vodi komunikaciju sa zainteresovanim stranama. \r\nPotpuno posvećena radu na ovoj ideji i pored redovnog prisustvovanja radionicama i izradi domaćih zadataka u okviru RISE programa - što na nedeljnom nivou zahteva angažovanje od 3-6 sati, dodatno izdvaja još prosečno 2-4 sata nedeljno za rad na razvoju ideje i novih funkcionalnosti, komunikaciju sa zainteresovanim stranama, pripremu prezentacija, sastanke tima, istraživanje tržišta i konkurencije i ostale aktivnosti.', NULL, NULL),
(3383, 91, 1490, 'Studije u proseku podrazumevaju angažovanje od 25-30 sati nedeljno (kada nije ispitni rok), a rad u Timu za akademske odnose u Savezu studenata Fakulteta organizacionih nauka, u proseku iziskuje 2-4 sata rada na nedeljnom nivou (kada nisu u toku projekti organizacije).', NULL, NULL),
(3384, 89, 1491, 'Student 3. godine Fakulteta organizacionih nauka na smeru Menadžment. \r\nTokom 2019. i 2020. godine radila kao promoterka za kompaniju Zlatiborac. Što se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao članica tima Ski Easy.', NULL, NULL),
(3385, 90, 1491, 'Članica tima primarno zadužena za marketing i prodaju, pomaže u razvoju ideje, učestvuje u pripremi prezentacija i komunikaciji sa zainteresovanim stranama.\r\nU većoj meri posvećena radu na ovoj ideji i pored redovnog prisustvovanja radionicama i izradi domaćih zadataka u okviru RISE programa - što na nedeljnom nivou zahteva angažovanje od 3-6 sati, dodatno izdvaja još prosečno 1-2 sata nedeljno za aktivnosti koje se tiču marketinga i istraživanja tržišta, rad na razvoju ideje, komunikaciju sa zainteresovanim stranama, učestvovanje u pripremi prezentacija, sastanke tima i ostale aktivnosti.', NULL, NULL),
(3386, 91, 1491, 'Studije u proseku podrazumevaju angažovanje od 25-30 sati nedeljno (kada nije ispitni rok), a pokretanje sopstvenog preduzetničkog poduhvata zahteva rad od 4-6 sati nedeljno.', NULL, NULL),
(3387, 89, 1492, 'Student 3. godine Fakulteta organizacionih nauka, na smeru Menadžment, članica HR tima u Savezu studenata Fakulteta organizacionih nauka, a trenutno i lider HR tima za potrebe projekta “Dani Prakse”.\r\nOd nedaredsednica organizacija Mladi lideri Srbije. \r\nŠto se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao članica tima Ski Easy.', NULL, NULL),
(3388, 90, 1492, 'Članica tima, pomaže u razvoju ideje, učestvuje u pripremi prezentacija i komunikaciji sa zainteresovanim stranama.\r\nDelimično posvećena radu na ovoj ideji i pored povremenog prisustvovanja radionicama i izrade domaćih zadataka u okviru RISE programa, dodatno izdvaja još do 1 sata nedeljno za rad na razvoju ideje, komunikaciju sa zainteresovanim stranama, učestvovanje u pripremi prezentacija, sastanke tima i ostale aktivnosti.', NULL, NULL),
(3389, 91, 1492, 'Studije u proseku podrazumevaju angažovanje do 25 sati nedeljno (kada nije ispitni rok), a rad u HR timu Saveza studenata Fakulteta organizacionih nauka, u proseku iziskuje do 8 sati rada na nedeljnom nivou (trenutno oko 16 sati zbog liderske pozicije). Organizacija Mladi lideri Srbije trenutno ne zahteva značajno angažovanje imajući u vidu da je tek nedavno osnovana.', NULL, NULL),
(3390, 71, 1496, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3391, 71, 1497, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3392, 63, 1498, 'Moja Berba je spoj IT tehnologije i proizvodnje hrane na tradicionalan način. Moja Berba inovativna onlajn platforma koja ima za cilj da direktno poveže krajnje kupce zdrave hrane sa malim proizvođačima. Na ovaj način cilj je ostvariti obostranu dobit. Kupac saučestvuje u procesu proizvodnje hrane i upoznaje se direktno sa poreklom proizvoda. Proizvođač hrane ima mogućnost da proda svoje proizvode po unapred dogovorenoj maloprodajnoj ceni izbegavajući posrednike u kupovini.', NULL, NULL),
(3393, 71, 1499, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3394, 17, 1500, 'Moja Berba je spoj IT tehnologije i proizvodnje hrane na tradicionalan način. Moja Berba inovativna onlajn platforma koja ima za cilj da direktno poveže krajnje kupce zdrave hrane sa malim proizvođačima. Na ovaj način cilj je ostvariti obostranu dobit. Kupac saučestvuje u procesu proizvodnje hrane i upoznaje se direktno sa poreklom proizvoda. Proizvođač hrane ima mogućnost da proda svoje proizvode po unapred dogovorenoj maloprodajnoj ceni izbegavajući posrednike u kupovini.', NULL, NULL),
(3395, 22, 1500, 'Ovo je naš prvi, a nadamo se ne i jedini zajednički projekat.', NULL, NULL),
(3396, 23, 1500, 'Ideja za projekat Moja Berba rodila se iz naših razgovora i spoja naših komplementarnih iskustava. Naš projekat je trenutno u fazi koja se poklapa u potpunosti s ciljevima ovog programa. Mi imamo ideju i jasnu viziju proizvoda i usluge koju želimo da stvarimo. Uradili smo preliminarno istraživanje tržišta i identifikovali ciljnu grupu potencijalnih krajnjih korisnika. Identifikovali smo njivove potreba. Vidimo način na koji bi smo mogli da odgvorimo na te potrebe i pri tome ostvarimo profit. Međutim potrebna nam je pomoć da našu ideju pre svega verifikujemo kroz izradu protitipa i MVP rešenja. Rising Stars program je i osmišljen da pruži ušpravo ovakvu vrstu podrške timovima poput našeg. Uz to, iako posedujemo već višegodišnje iskustvo u komplementarnim oblastima, smatramo da bi nam iskustvo u radu s mentorima Rising Stars programa bilo neprocenljivo.', NULL, NULL),
(3397, 24, 1500, 'Znam šta jedem, znam šta kupujem.', NULL, NULL),
(3398, 25, 1500, 'Borba za blagostanje ličnosti je okosnica modernog načina života! Savremen čovek je otuđen od prirode. Udaljen je od izvora hrane koju jede! On oseća silovitu potrebu da bude emotivno uključen u proces proizvodnje hrane koju konzumira. Čovek je u najintimnijoj vezi sa hranom koju jede! Hrana je osnova blagostanja tela i duha.  Kpobediti emocionalnu disonancu? Kako omogućiti savremenom čoveku kontakt s poljoprivredom iz urbane udobnosti?\r\nOvaj problem smo identifikovali budući da smo i sami pripadnici populacije koja ovaj problem svakodnevno oseća. Takođe problem smo identifikovali na najdirektniji način, korz svakodnevne razgovore s potencijalnim krajnjim korisnicima, prateći njihove navike i ponašanje.', NULL, NULL),
(3399, 26, 1500, 'U prvoj fazi projekta fokusirani smo pre svega na tržište Republike Srbije. Kao krajnje korisnike naših usluga identifikovali smo sredovečne stanovnike većih gradova kao što su Beograd, Novi Sad i Niš. Tokom preliminarniog istraživanja tržišta stupili smo u kontak s digital marketing agancijom LoboHose iz Niša. Prema njihovoj inicijalnoj proceni u srbiji psotoji negde između 470 000 do 500 000 osoba koje pripadaju užoj demografskoj grupi naših potencijalnih korisnika.', NULL, NULL),
(3400, 27, 1500, 'Primarnu grupa korisnika su osobe koje poseduju sledeće demografske karakterisitike:\r\n1. životna dob: 30 do 45 godina.\r\n2. stručna sprema: viša, fakultetska diploma\r\n3. prosečni mesečni prihodi: više of 80 000rsd\r\n4. mesto stanovanja: Beograd, Niš, Novi Sad\r\nOvo su sobe koje su prevashodno zainteresovane za sovstveno zdravlje i zdravlje članova svoje porodice. Nisu više u ranoj mladosti i polako počinju da osećaju prve efekte godina na svom organizmu. Pred sobom vide starenje svojih roditelja i to doživljavaju kao opomenu. S druge strane dobro su informisani. Umeju da koriste moderne IT tehnologije. Raspolažu iznadprosečnim primanjima. Imaju razvijenu svest o kvalaitetnoj hrani. Pripadaju narodnoj tradiciji koja vrednuje zdravu ishranu. Spremni su da potroše novac da bi bili upoznati s poreklom i kvarliteom hrane koju kupuju. Žele da saučestvuju u procesu proizvodnje hrane ali im njihov urbani način života i dnevne obaveze to ne dopuštaju.', NULL, NULL),
(3401, 28, 1500, 'Onlajn crown farming platforma koja povezije kupce zdrave hrane s individualnim proizvođačima. Na početku ciklusa uzgoja hrane potencijalni kupci se pozivaju da saučestvuju u proizvodnji hrane. Kupac unapred plača fiksnu cenu a za usvrat se proizvođač obavezuje da isporuči određenu količinu konkretnog proizvoda. Putem naše platforme kupac dobija pravormemena obaveštenja o toku uzgoja. Platforma se oslanjala na standardne e-komerc tehnologije: AWS, Apache, WordPress, MySQL, Javascipt, CSS, Facebook Pixel i Google Analytics.', NULL, NULL),
(3402, 30, 1500, 'Na našem tržištu trenutno ne postoji koji puža istovetnu vrstu usluga. Postoje dva načina na koje korisnici trenutno rešavaju navedeni problem. Privi način je neformalan i zastupljen je već decenijama. To su slučajna poznanstva s proizvođačima hrane uspostavljena putem ličnih preporuka, rodbina i poznanici sa sela, komšije i prodavci na pijaci. Drugi način se takođe oslanja na IT rešenja i to je ceo niz websajtova i e-komerc platform malih i individualnih proizvođača. Svi oni su fokusirani na sam čin prodaje kao transakcije i relativno malo pažnje posvećuju subjektivnom korisničkom iskustvu sudelovanja u uzgoju hrane.', NULL, NULL),
(3403, 29, 1500, 'Naš fokus je na  izgradnji dubokog korisničkog iskustva. Naša inovacija je dugotrajno uključivanje krajnjeg kupca u proces proizvodnje hrane. Ono po čemu želimo da izdvojim naš proizvod je jačina emotivne veze, tj. partnerski odnos između proizvođača i potrošača. Izksutvo koje kupca hrane pretvara iz prostog potrošača u nešto mnogo humanije.', NULL, NULL),
(3404, 32, 1500, 'Kao što smo već napomenuli naš akcenat je na korisničkog iskustva. Naš plan prevazilazi puku onlajn prodaju prehrambenih proizvoda. Putem naše platforme krajnji korisnik će moći da oseti značajan deo zadovoljstva proizvodnje hrane, da baštini raskoš prirode naše zemlje i njene tradicije, ali bez potrebe za odricanjem od svog urbanog komfora. To planiramo dapostignemo izgradnjom korisničkog puta (user journey) koji će podrazumevati dugotrajnu saradnju između kupca i proizvođača. Krajnji korisnik na emotivnom nivou sudeluje u procesu proizvodnje putem redovnih obaveštenja o napretku uzgoja proizvoda za koji se opredelio.', NULL, NULL),
(3405, 37, 1500, 'Budući da je projekat još uvek u idejnoj fazi razvoja, nismo preduzimali konkretne korake na zaštiti intelektualne svojine. Planiramo da pravovremeno zaštitimo logotip i ostale elemente brendinga naše platforme. Budući da se oslanjamo na postojeće tehnologije za sada nemamo planova da patentiramo nijedan aspekt našeg proizvoda.', NULL, NULL),
(3406, 40, 1500, 'Po podacima prezentovanim u studiji “Motivi kupovine organiskih proizvoda u Srbiji” od strane J. Ćendić, V. Zarić objavljenoj u časopisu Agroekonomika, br. 48, pp. 71. - 78., 32% kupaca zdrave hrane u Srbiji spremno je da plati preko 10% više u odnosu na prosečnu maloprodaju cenu sličnog generoičkog proizvoda. Dodatnih 48% spremno je da plati čak 20% veću cenu. S druge strane poljoprivredni proizvođači u trenutno prinuđeni da prodaju svoje proizvode po znatno manjim velikoprodajnim cenama naš startup planira da sotvari zaradu na ovoj razlici u ceni. U prilpgu dostavljamo i tabelu s prikazom mogućih prihoda na primeru jednog gazdinstva.', NULL, NULL),
(3407, 41, 1500, 'Naša startap priča je relativno kratka i počinje tokom leta 2021. Prilikom naših susreta redovno razmenjujemo ideje i razgovaramo o mogućnostima njihove primene u Srbiji a i šire. Ideja Crowd Farminga nam se učinila kao posebno zanimljivom budući da je u skladu i sa svetskim trendovima i sa tradicijom dobre hrane koju neguje naš narod. Od inicijalne ideje prešli smo na konkretnu razradu koncepta. U prvom redu koristeći Lean Startup filozofiju razvoja. Formirali smo viziju konačnog proizvoda i oformili strategiju razvoja. Budući da niko od nas ne poseduje sva potrebna tehnološka znanja stupili smo u kontakt s agencijama koje specilajizuju digitalni marketing i razvoj sličnih e-komerc platformi. Pre svega mislim na agencije LoboHouse iz Niša. U saradnji snjima uradili smo inicijalnu procenu tržišta. Takođe smo uradili procenu tehnološke izvodljivosti projekta kao i procenu potrebnih finansijskih sredstava za izradu prototipa, MVP platforme i inicijalne marketinške kampanje', NULL, NULL),
(3408, 44, 1500, 'Kao tim do sada nismo učestvovali u drugim mentorskim programa. Stanislav Stanković je učestvovao u više različitih mentorskih program organizovanih od strane kompanija u kojima je radio uključujući Rovio i EA. Trenutno je angažovan i kao mentor u  mentorskom programu Serbian Gaming Association.', NULL, NULL),
(3409, 45, 1500, 'Do sada nismo prikupili nikakva sredstva za razvoj ove ideje.', NULL, NULL),
(3410, 48, 1500, 'Mi trenutno imamo jasno definisanu osnovnu ideju proizvoda. Imamo identifikovanu ciljnu grupu potencijalnih korisnika i nekakvu procenu potencijalnog tržišta.  Takođe imamo definisanu viziju i strategiju razvoja. Međutim mi želimo da ovu našu ideju pre svega verifikujemo kroz kontakt sa realnim korisnicima. Pomoć koju očekujemo je finansijska i savetodavna a odnosi se pre svega na izradu prototipa i kasnije ventualne MVP verzije sajta kao i inicijalnu marketinšku kampanju putem koje bi kontaktirali potencijalne korisnike i uradili preciznu procenu tržišne isplatljivosti našeg koncepta.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(3411, 49, 1500, 'Po našoj inicijalnoj proceni sredstva koja bi nam bila potrebna u ovoj fazi razvoja iznose oko 13500 CHF. Ova sredstva bi bila utrošena u sledeće svrhe:\r\n1. Izrada prototipa, mockup sajta koji će se sastojati od jednog landing pagea koji će imati za cilj prikupljanje kontakata potencijalnih korisnika\r\n2. Branding potreban i za izradu landin pagea i MPV verzije sajta\r\n3. Brand awareness inicijalno marketing kampanju\r\n4. Zakup servera i domena\r\n5. Izradu MVPa e-komerc platforme uključujući front end i back end web sajta zajedno sa bazom podataka.\r\n6. Marketing kampanju koja bi za cilj imala formiranje osnovne grupe korisnika MVP verzije platforme.\r\nU prilogu dostavljamo dokumente koje smo dobili od naših partnera sa detaljnom procenom troškova izraženom u evrima.', NULL, NULL),
(3412, 52, 1500, 'stanislav.stankovic@gmail.com', NULL, NULL),
