(3415, 83, 1506, NULL, NULL, NULL),
(3416, 71, 1507, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3417, 89, 1510, '9 ipo godina iskustva u razvoju video igara i softvera za zabavu. Radno iskustvo u kompanijama Rovio Entertainment Oyj, Electronic Arts Inc. Najveći poslovni uspeh ostvario sa igrom SimCity BuildIt, preko 190 miliona korisnika, godišnji prihod od 70 miliona evra u periodu od 6 ipo godina. Iskustvo u vođenju multidisciplinarnih timova veličine od 3 do 35 članova.', NULL, NULL),
(3418, 90, 1510, 'Jedan od ko-kreatora ideje. Uloga u timu  fokusirana na razvoj IT e-komerc platforme i korisničkog iskustva (UX).', NULL, NULL),
(3419, 91, 1510, 'Kreativni Direktor u kompaniji North Stars/UnitedPixels', NULL, NULL),
(3420, 89, 1511, '20 godina iskustva u komercijali.\r\nRukovodio timom od 16 ljudi s godišnjim obrtom od 650 miliona rsd. \r\nVodi komercijlno poljoprivredno gazdinstvo s godišnjim prihodom od +5 miliona rsd.', NULL, NULL),
(3421, 90, 1511, 'Jedan od ko-kreatora ideje.  Uloga u timu fokusirana na definisanje razvojne strategije, komercijalizaciju, logistiku i organizovanje proizvodnje.', NULL, NULL),
(3422, 91, 1511, 'Regionalni rukovodilac prodaje Bomax Doo Subotica', NULL, NULL),
(3423, 63, 1514, 'Joker ID sistem je kompletno softversko-hardversko rešenje za kontrolu pristupa novčaniku biometrijom, koje korisnicima omogućava da više \r\nne moraju pamtiti šifre za logovanje, već im maksimalno olakšava otključavanje novčanika, a bez mogućnosti za zloupotrebu. Naše rešenje podrazumeva i kameru ugrađenu u sistem, tako da nije potrebno da sam uređaj (kompjuter/telefon) ima odgovarajuću kameru.', NULL, NULL),
(3424, 71, 1515, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3425, 17, 1516, 'Joker ID sistem je kompletno softversko-hardversko rešenje za kontrolu pristupa novčaniku biometrijom, koje korisnicima omogućava da više \r\nne moraju pamtiti šifre za logovanje, već im maksimalno olakšava otključavanje novčanika, a bez mogućnosti za zloupotrebu. Naše rešenje podrazumeva i kameru ugrađenu u sistem, tako da nije potrebno da sam uređaj (kompjuter/telefon) ima odgovarajuću kameru.', NULL, NULL),
(3426, 22, 1516, 'Sarađivali smo kao tim, implementirali smo zajedno aplikaciju ekološkog tipa u programskom jeziku Kotlin. Koristili smo Android Studio. Nismo je još plasirali na tržiste, već smo se oboje  usaglasili da je najbolje da, ukoliko nam se bude pružila mogućnost da uđemo u ovaj program, to bude sa  ovom drugom idejom, i da se njoj sada posvetimo.', NULL, NULL),
(3427, 23, 1516, 'Pre svega nas je motivisala mogućnost za podršku stručnih mentora, a zatim finansijska podrška koja nam je neophodna da bismo ideju realizovali. Sviđa nam se što je organizator Naučno-tehnološki park, u koga imamo puno poverenje.', NULL, NULL),
(3428, 24, 1516, 'Sa Joker ID-em može svako da otvori svoj novčanik lako!', NULL, NULL),
(3429, 25, 1516, '1) Prvenstveno  hoćemo da sprečimo gubitak prevelike količine kriptovaluta, koji se često dešava kada ljudi zaborave šifru ili izgube ključeve. Problem dolazi iz činjenice da šifra novčanika ne može tek tako da se oporavi preko mejla/telefona, ili sličnih metoda, posto su ključevi u rukama vlasnika. Zato vidimo biometriju kao najpraktičniji način otključavanja.\r\n2) Rešavamo problem nasledstva sredstava, za koji u kripto svetu do sada uopšte nije bilo rešenja.\r\n3) Skraćujemo korisnicima vreme koje je potrebno za logovanje, jer niko ne zeli da čuva šifre u brauzeru.\r\n4) Nameravamo da i sva ostala mobilna plaćanja u skorijoj budućnosti pretvorimo u jednostavan, siguran, brz i praktičan nacin plaćanja, obezbeđujući potpunu privatnost korisniku.\r\nSve nabrojano postoji na globalnom nivou i problem je ozbiljnih razmera, uočili smo analizom posmtranja, a zatim smo sproveli anketu.', NULL, NULL),
(3430, 26, 1516, 'Problem koji rešavamo  je globalan, jer se svuda u svetu i dalje koristi otključavanje kripto novčanika pomocu šifri, što prouzrokuje ozbiljne probleme korisnicima. Nameravamo da se prijavljujemo za svaki međunarodni program, čijem konkursu naš startap odgovara i na taj način sklapamo kontakte i potencijalne poslovne saradnje, sa ciljem proširenja tržišta.', NULL, NULL),
(3431, 27, 1516, 'Rešavamo problem svakoj osobi koja finansijske vrednosti drži u kripto valutama. Glavna karakteristika nasih klijenata je osećaj nesigurnosti u sistem zaštite njihovih sredstava. Prvobitno smo sproveli analizu posmatranjem na Telegam grupi  “Belgrade Crypto Community“, sa ciljem da osetimo potrebe zajednice, a zatim smo sproveli medju članovima grupe anketu Google Forms sa pitanjima na kojima je trebalo da odgovore sa da ili ne: a) Da li koristite novčanike koji čuvaju više kriptovaluta?  b) Kakav Vam je stav o zaštiti sredstava u novčaniku, da li ste zadovoljni zaštitom ključeva koji čine novčanik? Šta mislite o biometriji kao faktoru zaštite podataka, da li biste voleli da je imate na svom novčaniku? d) Da li biste u nekom određenom vremenu (mesec dana) koristili besplatnu demo verziju programerskog rešenja koji biometriju koristi u službi otključavanja Vašeg novčanika? Zaključili smo na osnovu njihovih odgovora da na tržistu postoji potreba za našim proizvodom.', NULL, NULL),
(3432, 28, 1516, 'Smatramo da je novi koncept korišćenja biometrije za ove oblasti kojima se bavi naš projekat ono sto nas izdvaja.  Koristimo blockchain tehnologiju. Našu jedinstvenost čini praktičan sistem zaštite kripto sredstava.', NULL, NULL),
(3433, 30, 1516, 'Potencijalni kupci imaju problem sa čuvanjem šifri (Kako da ih zapišu negde, a da bude bezbedno ili kako da ih čuvaju samo u glavi, a da ih ne zaborave?).', NULL, NULL),
(3434, 29, 1516, '1) Dobar balans bezbednosti i praktičnosti. Odnosno, smanjen rizik od gubitka sredstava. 2) Naš proizvod nudi rešeno pitanje nasleđivanja. 3) Nudimo uštedu vremena korisniku. 4) Imamo integrisanu kameru. Odnosno, ne zavisimo od određenih uređaja da imaju odgovarajuću kameru. (Standardna kamera nije dovoljna, jer može da se zavara slikom.) Ova stavka nas čini jedinstvenim i kada su ostala elektronska plaćanja u pitanju.', NULL, NULL),
(3435, 32, 1516, 'Postoji mnogo blockchain novčanika, a sama biometrija kao faktor zaštite podataka je dosta rasprostranjena (npr. Apple Face ID), ali kombinacija ta dva, odnosno primena biometrije za digitalna plaćanja i digitalne novčanike nije dovoljno primenjena.', NULL, NULL),
(3436, 37, 1516, 'U kontatu sa Zavodom za intelektualnu svojinu RS, pretrazili smo kljucne reči koje se odnose naš proizvod, na na sajtu https://worldwide.espacenet.com/ i najsrodnije našem rešenju je objavljeno pod brojem dokumenta: CA3115834A1 datuma: 16.04.2020. A kucali smo i naziv našeg statapa      Joker ID, za njega smo dobili 0 rezultata.', NULL, NULL),
(3437, 40, 1516, 'Razmatramo naplatu takse 1% za transakcije obavljene preko našeg novčanika.', NULL, NULL),
(3438, 41, 1516, 'Trenutno se nalazimo jos u početnoj fazi. Imamo povratne informacije isključivo od potencijalnih kupaca, na osnovu analize tržišta koju smo sproveli.', NULL, NULL),
(3439, 44, 1516, 'Dejan Tomić je učestvovao u nekoliko mentorskih i/ili startap programa:\r\nPrepoznavanje lica (deo TOC Search projekta na Matematičkom fakultetu) 2016\r\nAndroid aplikacija (thin client). www.tocsearch.com/fr\r\nWeb prezentacija Nacionalnog tržišta roba i usluga Srbije 2008 - 2010\r\nRazvoj CMS-a i frontend-a. www.trzistesrbije.com\r\n„Moj broj” - program za nalaženje broja najbližeg zadatom, u igri 2009\r\niz kviza „TV slagalica” - rad objavljen na 8. Petničkoj konferenciji\r\n„Internet leksikon”, Web 2.0 sajt. www.mojleksikon.com\r\nA oba osnivača startapa Joker ID zajedno su implementirali Android aplikaciju, koja je ekoloski orijentisana, ali je za sada nisu plasirali još i zbog toga je neće navoditi.', NULL, NULL),
(3440, 45, 1516, 'Sada je prvi put da konkurišemo za finansiranje kao tim Joker ID. Ana Brdar je ove godine dobila sredstva u iznosu 250000 rsd od NSZ, ali izložila je sasvim drugu ideju (za aplikaciju koju je radila) u biznis plan za konkurisanje, tako da to nije relevantno za ovaj program.', NULL, NULL),
(3441, 48, 1516, 'Očekujemo da nas mentori usmere kako je najbolje razvijati i plasirati naš proizvod. Najpotrebnija podrška nam je upravo za plasiranje proizvoda.', NULL, NULL),
(3442, 49, 1516, 'Nismo tačno sigurni za cifru, ali 30% bi trebalo da pokrije nabavku odgovarajućih čipova, specijalnih kamera i ostalog hardvera koji čine nas proizvod. Takva nabavka nam je najpotrebnija, da bismo uopšte mogli da razvijemo prototip, da vidimo kako bi to sve radilo.', NULL, NULL),
