(3445, 76, 1520, NULL, NULL, NULL),
(3446, 83, 1522, NULL, NULL, NULL),
(3447, 71, 1523, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3448, 71, 1524, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3449, 89, 1525, NULL, NULL, NULL),
(3450, 90, 1525, NULL, NULL, NULL),
(3451, 91, 1525, NULL, NULL, NULL),
(3452, 63, 1526, 'B2C platforma koja spaja restorane i mesta koja prodaju hranu sa mušterijama. Ova platforma prodaje savršeno ispravnu hranu za koju postoji rizik da bi inače bila bačena. Ovim načinom poslovanja dolazi do maksimizacije profita partnera (restorana) i smanjenja otpada od hrane, kao i pružanja mogućnosti potrošačima da pribave jeftiniju hranu.', NULL, NULL),
(3453, 71, 1527, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3454, 17, 1528, 'B2C platforma koja spaja restorane i mesta koja prodaju hranu sa mušterijama. Ova platforma prodaje savršeno ispravnu hranu za koju postoji rizik da bi inače bila bačena. Ovim načinom poslovanja dolazi do maksimizacije profita partnera (restorana) i smanjenja otpada od hrane, kao i pružanja mogućnosti potrošačima da pribave jeftiniju hranu.', NULL, NULL),
(3455, 22, 1528, 'U maju ove godine sa ovom idejom prijavile smo se za takmičenje za razvijanje inovativnih ideja u oblasti ekologije koje je organizovao British American Tobacco. U okviru ovog takmičenja osvojile smo prvo mesto na Regionalnom finalu i time se plasilrale u Globalno finale na kojem smo predstavljale Srbiju. \r\nOd maja do novembra, koliko je trajalo takmičenje, radile smo na razvijanju i konkretizaciji ideje.', NULL, NULL),
(3456, 23, 1528, 'Budući da ideja postoji već godinu dana, a aktivno radimo na njoj već duže od 6 meseci i uspele smo da postignemo nešto, nismo htele da se tu zaustavimo. Smatramo da je naša ideja potrebna i ostvariva, a nas dve smo izuzetno motivisane da je ostvarimo. Iako smo mlade i možda nemamo toliko relevantnog iskustva, smatramo da bi nam ovaj program doneo savetovanje i podršku koja nam je potrebna kako bismo uspele da našu ideju sprovedemo u delo.', NULL, NULL),
(3457, 24, 1528, 'Jedi i uštedi', NULL, NULL),
(3458, 25, 1528, 'Istraživanjem tržišta i ekoloških problema kod nas i u svetu zapazile smo značajan jaz izmedju hrane koja se baci na dnevnom nivou i stope gladi i siromaštva. Budući da nas je ova statistika duboko pogodila, ponajviše zbog rešivosti problema, odlučile smo da uzmemo stvar u svoje ruke i pokušamo da ga rešimo. Problem je čisto logističke prirode i ovim uspostavljanjem platforme bismo omogućili ne samo restoranima da bacaju manje hrane i maksimiziraju svoj profit, ali i kupcima da uživaju u jeftinijoj hrani, što je bitna stavka na našem tržištu.', NULL, NULL),
(3459, 26, 1528, 'Naš fokus je uspostavljanje naše inicijative i preuzimanje market share-a u Srbiji i zemljama okruženja. Smatramo da je bitno ne samo osvestiti stanovništvo o ekološkim problemima, već im i dati priliku da direktno učestvuju u rešavanju istih. U naredne dve godine nam je plan da se proširimo na exYu tržište i uspostavimo partnerstva sa restoranima, hotelima i pekarama širom Srbije kako bi što više ljudi imalo mogućnost štednje i smanjivanja otpada od hrane.', NULL, NULL),
(3460, 27, 1528, 'Foodie ne rešava problem samo kupcima ili samo partnerima; uspostavljanjem ove platforme dolazi do kreiranja situacije u kojoj obe strane dobijaju. Sa jedne strane imamo partnere (pekare, hoteli, restorani) koji, budući da nemaju ustanovljenu i efektivnu politiku o otpadu od hrane, na kraju smena bacaju svoje proizvode. Uvodjenjem naše aplikacije, nudimo im mogućnost da na kraju svake smene postave hranu koja im je ostala, koju će da prodaju na našoj aplikaciji po ceni koja bi bila najviše 70% originalne cene. Ovime oni dobijaju priliku da monetizuju nešto što bi im inače bio otpad. Sa druge strane, imamo kupce, koji imaju mogućnost da dobave savršeno dobru hranu po sniženim cenama. Budući da je naše ciljno tržište zemlje koje nemaju izraženo visoku platežnu moć, naši ciljni kupci su cenovno osetljivi i pripadaju mladjoj populaciji, prema istraživanjima postojala bi velika zainteresovanost medju studentima i mladjom populacijom.', NULL, NULL),
(3461, 28, 1528, 'Naša platforma, koja bi bila dostupna u vidu aplikacije i web sajta, spajala bi restorane sa viškom hrane sa ljudima koji bi to kupili. Radila bi na principu baze podataka i plaćanje bi se vršilo u aplikaciji. Naša aplikacija nema direktne konkurente, budući da slična inicijativa i dalje nije pokrenuta na ovim prostorima.', NULL, NULL),
(3462, 30, 1528, 'Neki od naših potencijalnih partnera (konkretno Skroz dobra pekara) imaju politiku da je u poslednjih sat vremena pred zatvaranje ceo asortiman na 50% popusta. Ovo je efektivno pri smanjivanju otpada i za ovakvim inicijativama postoji izražene tražnja. Medjutim, van trenutnih okolnosti, poslovanje Skroz dobre pekare se bazira na tome da su im poslovnice otvorene 24/7, i da im radno vreme nije skraćeno zbog pandemije, generisali bi mnogo više otpada od hrane. Naša platforma im omogućava da nastave ovu politiku i kada se situacija vrati u normalu.', NULL, NULL),
(3463, 29, 1528, 'Kao glavni benefit i razlog zašto bi kupci trebalo da kupuju hranu preko naše platforme izdvajamo opciju da uštede novac. Imali bi priliku da uživaju u svojoj omiljenoj hrani po jeftinijoj ceni. Pored toga, aktivno učestvuju u smanjenju ekoloških problema kao što su emisija ugljen-dioksida i količine hrane koja završi na deponiji. Ostale B2C platforme koje se bave prodajom hrane ne funkcionišu identično kao mi i njihove cene su više, tako da smatramo da nas niže cene razlikuju u očima kupaca. Takođe, sami proizvodi i način prodaje se razlikuju.', NULL, NULL),
(3464, 32, 1528, 'Iako je na našem tržištu proizvod potpuno nov, u zapadnoj Evropi i Americi postoji slična inicijativa koja se zove TooGoodToGo. Ova aplikacija radi upravo ono što bismo mi radile, i postoji od 2015. Počela je u Danskoj i odatle se proširila na 15 zemalja. Godišnje generiše profit od 134 miliona $, što pokazuje koliko je efikasna. Mi smo prepoznale vrednost ovog biznis modela i cilj nam je da ga implementiramo u Srbiju i okolne zemlje, takodje i zemlje na globalnom tržištu na koje se TGTG još nije proširio.', NULL, NULL),
(3465, 37, 1528, 'Do sada nismo vršile istraživanje na ovu temu, ali smo svesne da je potrebno.', NULL, NULL),
(3466, 40, 1528, 'Prihodi su dualni i jednostavni. Najveći deo prihoda dolazi iz provizije koju bismo naplatili po jelu. Ostatak prihoda čine mesečne pretplate na našu aplikaciju koju plaćaju restorani kako bi mogli da prodaju na samoj platformi.', NULL, NULL),
(3467, 41, 1528, 'Sa konkretnim radom na ideji smo počeli ove godine kada smo čule za takmičenje Battle of Minds. Pre toga je Katarina, koja je i došla do ove ideje, istraživala koliko je moguće implementirati tu ideju na srpsko i balkansko tržište, tako da smo do tad imale samo potrebne informacije, ali ne i formu. Naime, kad smo se prijavile za pomenuto takmičenje, napravile smo prototip ideje. Takmičenje je imalo 3 nivoa i za svaki od njih smo morale da produbljujemo ideju. Osvojile smo prvo mesto na nacionalnom i regionalnom nivou i kvalifikovale se na globalno. Kao najveći uspeh, izdvojile bismo globalno finale Battle of Minds jer, iako nam je ideja mlada, sudije su videle potencijal u njoj.', NULL, NULL),
(3468, 44, 1528, 'Na prethodno pomenutom takmičenju, imale smo priliku da radimo sa mentorima koji su iskusni ljudi iz polja finansija i HRa i da dobijemo njihovu pomoć prilikom uobličavanja ideje. Takođe, čule smo ideje ljudi iz celog sveta i njihova rešenja ekoloških problema i načina na koje bi im poslovao start-up. To nam je pomoglo u radu na našoj ideji jer smo saznale koje stavke moramo promeniti kako bi biznis bio održiviji.', NULL, NULL),
(3469, 45, 1528, 'Budući da je ideja u ranim fazama, i dalje nismo prikupile bilo kakav izvor finansiranja.', NULL, NULL),
(3470, 48, 1528, 'Očekujemo pomoć u razvoju i konketizaciji plana ideje. Imamo volju, motivaciju i kreativni plan, ali nam je potrebna pomoć i podrška kada je reč o finansijskim, biznis i tehničkim stvarima. Najviše nam je potrebno da premostimo jaz izmedju onoga što smo zamislile i kako da to sprovedemo u realnost, korak po korak.', NULL, NULL),
(3471, 49, 1528, 'Budući da je startup u početnoj fazi striktno softverski, bila bi nam potrebna finansijska podrška da izradu kvalitetne aplikacije, što bi iznosilo par hiljada evra.', NULL, NULL),
(3472, 52, 1528, NULL, NULL, NULL),
(3473, 66, 1531, NULL, NULL, NULL),
(3474, 76, 1532, NULL, NULL, NULL),
(3475, 83, 1534, NULL, NULL, NULL),
(3476, 89, 1535, 'Ekonomski fakultet Beograd, smer Medjunarodne finansije \r\nRazvijanje ideje u sklopu takmičenja Battle of Minds', NULL, NULL),
(3477, 90, 1535, 'Iako izuzetno motivisana kao kokreatorka i izrazito želim da ova inicijativa zaživi, trenutno studiram i to mi je glavni fokus. Tako da moram da obeležim ,,u većoj meri posvećena\'\'. Vreme koje sam posvećivala jeste par sati nedeljno u istraživanju tržišta i regulacija vezanih za hranu. Kako bih uradila nešto dalje i konkretnije potrebna mi je pomoć i mentorstvo.', NULL, NULL),
(3478, 91, 1535, 'Osnovne studije i part time posao (1-2 puta nedeljno, puno radno vreme)', NULL, NULL),
(3479, 89, 1536, 'Ekonomski fakultet i London School of Economics - Economics and Finance \r\nRazvijanje ideje u sklopu takmičenja Battle of minds', NULL, NULL),
(3480, 90, 1536, 'Kao kokreatorka posvetila sam dosta vremena razvoju biznis plana. Pošto smo na završnim godinama fakulteta smatram da je savršeno vreme da započnemo startap. Rekla bih da sam veoma posvećena, a prosečno vreme koje posvećujem na nedeljnom nivou ne mogu da odredim, ali podosta vremena sam posvetila radu na ideji.', NULL, NULL),
(3481, 91, 1536, 'Osnovne studije', NULL, NULL),
(3482, 71, 1537, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3483, 71, 1539, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3484, 71, 1540, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3485, 71, 1542, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3486, 63, 1543, 'Kombinovanje IoT i AI u cilju unapređenja rešavanja svakodnevnih problema vezanih za protok saobraćaja na određenim lokacijama uz prikaz izveštaja visoke preciznosti. Obuhvaćeni su svi učesnici u saobraćaju (drumska vozila, pešaci, biciklisti...)', NULL, NULL),
(3487, 71, 1544, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3488, 17, 1545, 'Kombinovanje IoT i AI u cilju unapređenja rešavanja svakodnevnih problema vezanih za protok saobraćaja na određenim lokacijama uz prikaz izveštaja visoke preciznosti. Obuhvaćeni su svi učesnici u saobraćaju (drumska vozila, pešaci, biciklisti...)', NULL, NULL),
(3489, 22, 1545, 'Sarađivali smo u okviru iste organizacije (Brongus doo Čačak).\r\nTrenutno smo deo zajednice Naučno-tehnološkog parka Čačak.', NULL, NULL),
(3490, 23, 1545, 'Glavni motiv prijave za ovaj program je rešavanje lokalnih problema u smislu gustine i kvaliteta saobraćaja.\r\nPoslovna ideja bazira se na rešavanju svakodnevnih problema vezanih za gustinu i protok saobraćaja na određenim gradskim ili prigradskim lokacijama. Softver se može nesmetano koristiti na površinama na kojima je intenzitet saobraćaja jako visok, kao i na površinama gde je niži intenzitet saobraćaja. Jedna od mogućih primena aplikacije je u pronalaženju slobodnih parking mesta na određenim parkiralištima što bi omogućilo vozačima da se unapred opredele kojom će trasom ići kako bi stigli do mesta za parkiranje.', NULL, NULL),
(3491, 24, 1545, '\"Ako isključimo statistiku, onda ono što nam se dešava zovemo sudbinom\"', NULL, NULL),
(3492, 25, 1545, 'Problem zauzetosti parking mesta, statistika zauzetosti ulica, nepropisnog parkiranja, statistika koriscenja bicikala, pešačkih prelaza, kružnih tokova, semafora… Jedan od glavnih razloga implementacije aplikacije je smanjivanje gužve na određenim kritičnim tačkama, kao i povećanje sigurnosti svih učesnika u saobraćaju.', NULL, NULL),
(3493, 26, 1545, 'Rešavanje problema je prvobitno zamišljeno na lokalnom nivou u okviru lokalnih zajednica, a nakon toga je lako primenljiv na bilo koji zahtev regionalnih područja. Osnovna ideja primene je u Republici Srbiji, a nakon toga u svim ostalim zemljama regiona, kao i šire.', NULL, NULL),
(3494, 27, 1545, 'Korisnici:\r\n*Fizička lica (građani) - dobijanje raznih informacija o saobraćaju, parking mestima.\r\n*Subjekti koji imaju potrebu za bilo kakvom analizom saobraćaja na određenom prostoru.\r\nKupci\r\n*Lokalne samouprave - rešavanje problema u saobraćaju.\r\n*Subjekti - kojima je potrebna bilo kakva infomacija vezana za analizu saobraćaja(benzinske stanice, taxi udruženja, privatni parkinzi, agencije za istraživanje...).', NULL, NULL),
(3495, 28, 1545, 'Proizvod - aplikacija analiziranja stanja u saobraćaju uz sam hardware(Konekto Hub - kamera, Raspberry Pi, modul za napajanje)\r\nNeke od karakteristika našeg proizvoda su: rešavanje lokalnih problema u smislu preopterećenosti ulica, broja pešaka, analiza vremenskog perioda najveće gustine i protoka saobraćaja na određenim lokacijama, provera isplativosti pešačkih prelaza, semafora, kružnih tokova...', NULL, NULL),
(3496, 30, 1545, 'Nije nam poznato da se koristi bilo kakvo savremeno rešenje, informacije do kojih smo došli upućuju na to da su svi rezultati dobijeni manulenim metodama.', NULL, NULL),
(3497, 29, 1545, 'Na vrlo jeftin način se dobijaju precizni rezultati, bez angažovanja dodanog osoblja, prikaz u formi izveštaja, koriste se savremen tehnologije koje su lako primenljive u savremenom svetu.', NULL, NULL),
(3498, 32, 1545, 'Proizvod je poznat, obzirom da problem kojim se bavimo je globalan i svakodnevno prisutan, pa smo upravo zato želeli da mu se posvetimo jer smatramo da nije dovoljno obrađen u smislu savremenosti i načina primene samog rešenja.', NULL, NULL),
(3499, 37, 1545, 'Nismo sprovodili istrađivanje na temu intelektualne svojine.', NULL, NULL),
(3500, 40, 1545, 'Analizom tržišta došli smo na ideju da naš proizvod možemo plasirati u prodaju korisnicima kao što su svi koji imaju potrebu za analizom tranzita saobraćaja, kako bi utvrdili isplativost svoje investicije (benzinske stanice, stovarišta raznih namena...), lokalne samouprave tako što mogu doći do rešenja određenih lokalnih problema u smislu zagušenja saobraćaja u određenim intervalima dana, zaštite pešaka, isplativosti određenih saobraćajnih rešenja na osnovu podataka o intenzitetu saobraćaja, zauzetosti parkinga kako bi se proverila njihova isplativost na tržištu.', NULL, NULL),
