(3520, 89, 1557, 'Apsolvent na arhitektonskom fakultetu univerziteta u Beogradu. \r\nIskustvo u realizacija projekta prvog \"Park n Fly\" Startapa u Srbiji 2015. godine. Ognjen Vukić je od osnivanja volonterski radio u sektoru rukovodstva, finansija i marketinga. Kroz unapređenje usluga i novih radnih mesta na menadžerskim pozicijama u firmi, uvođenjem softvera prilagođenim poslu kojim se firma bavi, rasterećen je rad firme, te je Ognjen trenutno van radnog odnosa kako bi usmerio fokus na razvoj novog startapa pod nazivom \"VUKICH CERAMICS\" na čijem je čelu.', NULL, NULL),
(3521, 90, 1557, 'Razvoj tehnologije i proizvodnja.\r\nPotpuno posvećen razvoju startapa, kreator ideje.', NULL, NULL),
