(3523, 89, 1558, 'Apsolvent na građevinskom fakultetu univerziteta u Beogradu. \r\nIskustvo u realizacija projekta prvog \"Park n Fly\" Startapa u Srbiji 2015. godine, projekat nije bio deo mentorskog programa, već je finansiran iz porodičnih resursa, na poziciji direktora firme se od osnivanja pa do danas nalazi Aleksandar Vukić. Firma Aerodrom parking se bavi pružanjem usluga parkiranja vozila i transportovanja putnika u kopnenom saobracaju i trenutno se nalazi na liderskoj poziciji u svom poslovanju.', NULL, NULL),
