(3541, 23, 1568, 'Smatramo da kao tim imamo energiju i motivaciju da napravimo nešto veliko. Slažemo se da je najpametnije krenuti od problema koje najbolje poznajemo. Već duže vreme imamo farmu ovaca, bavimo se uzgojom i prodajom. Dugogodišnje iskustvo dovelo je do ideje koja bi mogla da optimizuje proces kupovine domaćih životinja.', NULL, NULL),
(3542, 24, 1568, 'Kupi ovcu kao televizor.', NULL, NULL),
(3543, 25, 1568, 'Dugi niz godina suočavamo se sa problemima kada želimo da kupimo i prodamo domaće životinje.\r\nUglavnom kreće sa nizom poziva ljudi koji poznaju druge ljude, koji možda trenutno imaju životinje za prodaju.\r\nKasnije, problem je organizovati transport, bezbedno plaćanje i čuvanje svih kontakta koje smo dobili na jednom mestu.', NULL, NULL),
(3544, 26, 1568, 'Ljudi kojima se obraćamo su sve osobe koje se bave uzgojem, kupovinom i prodajom domaćih životinja. Na osnovu podataka koje smo dobili od sajtova koji postoje, procena je da postoji 100 000 ljudi koji bi potencijalno bili naši korisnici.', NULL, NULL),
(3545, 27, 1568, 'Milojko: Ima 63 godine i živi na selu. O dešavanjima informiše se na kanalima nacionalne frekvencije. Bavi se stočarstvom i prodajom ovaca i jagnjadi. Želi da se informiše o cenama i tržištu ostalim delovima zemlje. Ima strah da naručuje životinje od ljudi koje ne poznaje i potrebna mu je neka verifikacija kvaliteta, i papiri koje prodavac poseduje.\r\nNadja: Ima 35 godina, živi u gradu i ima roditelje na selu koji se bave stočarstvom i ne znaju da koriste internet. Roditelji su je zamolili da im pomogne oko slike i postavljanja oglasa. Ona radi, ali vikendom pomaže oko prodaje na farmi. O novim informacijama informiše se na društvenim mrežama, a oglase postavlja na platforme za oglašavanje. \r\nPedja: Ima 30 godina i odlučio je da živi na selu i bavi se poljoprivredom i stočarstvom.  Želi da ima centralizovano mesto na kome može da prodaje i kupuje domaće životnje, tako da taj proces liči na online kupovinu fizičkih predmeta koje vrlo često naručuje.', NULL, NULL),
(3546, 28, 1568, 'Želimo da razvijemo online platformu (sajt) koji če korisnicima omogućiti da na jednom mestu imaju uvid o ponudi domaćih životinja u različitim delovima Srbije:\r\n1. Mogu da pretražuju Srbiju po regijama i imaju filtriranu pretragu ponude.\r\n2. Mogu da provere potvrde o pedigreu koji su dostupni za životinje od svakog prodavca.\r\n3. Mogu da daju ocene prodavcima.\r\n4. Naručivanje se vrši preko sajta bez kontakta sa kupcima.\r\n5. Nakon naručivanja, životinje se dostavljaju na kućnu kupca.\r\n6. Načini plaćanja: Preko računa, pouzećem i kripto valiutama.', NULL, NULL),
(3547, 30, 1568, 'Potoji više načina\r\nSvodi se na:\r\n  1. Pozovemo par brojeva ljudi za koje verujemo da imaju zivotinje na prodaju.\r\n  2. Dogovara se cena.\r\n  3. Dogovara se transport.\r\n  4. Dogovara se način plaćanja.\r\n  5. Dešava se da iz nedostatka informacija mora da se ode i da se na proveri kvalitet zivotinja.\r\nU svakom od međukoraka može da postoji dosta nesuglasica, ponavljanja koraka, nerazumevanja i gubitka vremena.\r\nPored ovog načina, ljudi koriste sajtove za oglašavanje koji omogućavaju veću bazu prodavaca ali ne i samog čina organizacije kupovine.', NULL, NULL),
(3548, 29, 1568, 'Smatramo da je danas najskuplje i najvrednije vreme. Našom idejom pokušaćemo da optimizujemo proces prodaje i nadamo se da će to smanjiti izgubljeno vreme i stres kod kupaca i prodavaca.', NULL, NULL),
(3549, 32, 1568, 'Do sada su samo pojedini delovi procesa prodaje i naručivanja domaćih životinja mogući preko interneta ali ne i centralizovan celokupan proces.', NULL, NULL),
(3550, 37, 1568, '-', NULL, NULL),
(3551, 40, 1568, 'Preko procenta od prodaje svake životinje i oglašavanja na našoj platformi.', NULL, NULL),
(3552, 41, 1568, 'Za sada radimo na istraživanju tržišta i definisanju koncepta platforme (prozivoda), raspodeli posla i razumevanju potreba potencijalnih korisnika.', NULL, NULL),
(3553, 44, 1568, 'Ana je učestovala na programu ParkUp! koji je organizovao Naučno Tehnološki park i na nizu online i offline konferencija posvećenim preduzetništvu i liderstvu.', NULL, NULL),
(3554, 45, 1568, 'Ne', NULL, NULL),
(3555, 48, 1568, 'Od ovog programa očekujemo da pre svega dobijemo mentorsku podršku i smernice za početak rada na startupu, pravljenje detaljnog biznis plana i savete iz prakse od ljudi koji su već imali slična iskustva. Takođe, očekujemo finansisku podršku koja je neophodna za pravljenje sajta i kupovinu sve potrebne opreme.', NULL, NULL),
(3556, 49, 1568, '13 000 CHF :\r\n700 CHF za izradu sajta\r\n7000 CHF dva pick up vozila\r\n800 CHF za oglašavanje preko interneta\r\n4500 CHF Po tri plate za tri meseca', NULL, NULL),
