(3572, 63, 1583, 'Steddy je društvena mreža čiji je cilj povezivanje studenata srodnih fakulteta i smerova, kao i srednjoškolaca, u naučno obrazovnoj razmeni znanja i iskustava onlajn kroz određene mogućnosti:\r\n\r\nDeljenje skripti koje bi bile ocenjivane od strane oformljene zajednice. Ocenjivanje bi se vrsilo uz pomoć bodovnog sistema u više kategorija. Što se više poena ostvari, vrednost (kvalitet, verodostojnost, relevantnost) skripti i samog kreatora sadržaja raste. Učestvovanje na platformi je ilustrovano dobijanjem određenih bedževa koji bi bili vizuelna prepoznatljivost pouzdanog sadržaja i redovnih korisnika platforme.  \r\n\r\nTakođe, studenti, kreatori sadrzaja, bi imali mogućnost naplaćivanja ili deljenja skripti bez ikakve nadoknade u zavisnosti za šta se kreator sadržaja opredeli. \r\nUkoliko student kreator sadrzaja to želi, platforma mu takođe omogućava zakazivanje konsultacija sa korisnicima njegovog sadržaja tako da im materijale bolje približi i objasni za šta bi bio kompenzovan.\r\nCilj našeg projekta je da kreiramo reputabilnu platformu koja bi omogućila studentima koji su puni entuzijazma, želje i volje da jednostavno i uz minimalno uloženog vremena svoje znanje i beleške podele sa svojim kolegama. Takođe, od velikog je značaja za studente koji planiraju da nastave svoju karijeru kao predavači kako bi dobili povratnu informaciju o njihovim veštinama u tom polju.', NULL, NULL),
(3573, 71, 1584, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3574, 17, 1585, 'Steddy je društvena mreža čiji je cilj povezivanje studenata srodnih fakulteta i smerova, kao i srednjoškolaca, u naučno obrazovnoj razmeni znanja i iskustava onlajn kroz određene mogućnosti:\r\n\r\nDeljenje skripti koje bi bile ocenjivane od strane oformljene zajednice. Ocenjivanje bi se vrsilo uz pomoć bodovnog sistema u više kategorija. Što se više poena ostvari, vrednost (kvalitet, verodostojnost, relevantnost) skripti i samog kreatora sadržaja raste. Učestvovanje na platformi je ilustrovano dobijanjem određenih bedževa koji bi bili vizuelna prepoznatljivost pouzdanog sadržaja i redovnih korisnika platforme.  \r\n\r\nTakođe, studenti, kreatori sadrzaja, bi imali mogućnost naplaćivanja ili deljenja skripti bez ikakve nadoknade u zavisnosti za šta se kreator sadržaja opredeli. \r\nUkoliko student kreator sadrzaja to želi, platforma mu takođe omogućava zakazivanje konsultacija sa korisnicima njegovog sadržaja tako da im materijale bolje približi i objasni za šta bi bio kompenzovan.\r\nCilj našeg projekta je da kreiramo reputabilnu platformu koja bi omogućila studentima koji su puni entuzijazma, želje i volje da jednostavno i uz minimalno uloženog vremena svoje znanje i beleške podele sa svojim kolegama. Takođe, od velikog je značaja za studente koji planiraju da nastave svoju karijeru kao predavači kako bi dobili povratnu informaciju o njihovim veštinama u tom polju.', NULL, NULL),
(3575, 22, 1585, 'Ilija Lekić, Mateja Ivančevic, Jovan Šijački - Fylm (Fakultetski projekat – https://github.com/ilijalekic99/2021_fylm),\r\nMateja IvanČevic, Jovan Šijački - basicVisual (Fakultetski projekat),\r\nIlija Lekić, Jovan Šijački - Ilkom (Popravka hardvera i nadogradnja softvera).', NULL, NULL),
(3576, 23, 1585, 'Činjenica je da na našem fakultetu nema dovoljno literature i suočeni sa takvom situacijom smo došli na ideju da napravimo platformu koja bi omogućila lak protok znanja i informacija (peer-to-peer) i koja bi omogućila ljudima da steknu dodatno iskustvo kao predavači. Pojavom korona virusa, učenje se promenilo. Zaključak je da je učenje na daljinu vrlo efikasno i revolucionarno u samoj konzumaciji edukativnog sadržaja, a takođe je i olakšan način rada studentima kao i predavačima.', NULL, NULL),
(3577, 24, 1585, 'The Honeypot of Knowledge', NULL, NULL),
(3578, 25, 1585, 'Pokušavamo da pomognemo studentima da lakse polože ispite, jer će imati veći izbor skripti i pomoći kao sto su privatni časovi preko naše platforme. Ovaj problem smo otkrili prilikom naših studija i shvatili smo da nemamo dovoljnu količinu materijala iz kojih bismo mogli da učimo.', NULL, NULL),
(3579, 26, 1585, 'Nasa ciljana grupa ljudi su studenti i srednjoškolci. Sproveli smo anketu i pokazalo se da je jako veliko trziste i da ljudima zaista potrebna pomoc.\r\nRezultate ankete možete videti ovde: https://drive.google.com/file/d/1aSPZ0ep_fadBPsTSFbX8qw6VnA-p6h4d/view?usp=sharing\r\nA kako je izgledala naša anketa, možete videti na sledećem linku: https://forms.gle/SxQ6BwjrRR7Wuc4y5\r\nMi smatramo da ovakav proizvod mozemo sprovesti na globalnom nivou.\r\nPrvo bismo počeli od Republike Srbije i dalje bismo promovisali naš prozivod na prostoru Balkana. Dalji koraci uključuju proširenje prvo na Evropu i Severnu Ameriku, pa uz naš entuzijazam i na ostatak sveta!', NULL, NULL),
(3580, 27, 1585, 'Problem rešavamo studentima i srednjoškolcima kojima je poprilično teško da polože ispite i potrebna im pomoć.\r\nKada se govori o navikama prosečnog učenika/studenta, pokazalo se da je način učenja najčešće kampanjski i da ljudi nemaju pristup dovoljno velikom broju materijala koji bi im znatno olakšao savladavanje gradiva. Osim toga, pokazala se velika potražnja za privatnim časovima što je takođe jedna od usluga koju nudi naša aplikacija. Nakon analize naše ankete, u kojoj je učestvovalo 286 studenata,zaključili smo da ovakva platforma predstavlja veliki pomak kada je u pitanju obrazovanje u Srbiji, bilo fakultetsko ili srednjoškolsko. Ovime se ‘’briše’’ korak više koji bi studenti morali da naprave, zato što bi im svi materijali bili na jednom mestu, lako dostupni.', NULL, NULL),
(3581, 28, 1585, 'Naš tim pravi veb platformu koja nudi opciju otpremljivanja (upload) materijala na nju samu kao i održavanje privatnih časova u sklopu platforme i davanja recenzija i ocena kako bi pojedinac mogao da stvori reputaciju za samog sebe. Tehnologija za razvoj ove aplikacije je Figma (software), HTML/CSS, JavaScript, NODEjs, MongoDb, AJAX, JQuery, PHP, Python, (Kotlin/Skala). Krajnji cilj nam je da sve  bude open-soruce.', NULL, NULL),
(3582, 30, 1585, 'Trenutno potencijalni kupci pokušavaju da rešavaju ovaj problem tako što se nalaze da uče i dele znanje zajedno. Takođe, kupci pronalaze privatne časove ako uspeju da nađu dobrog profesora. Što se tiče konkurentskih online platformi kao što su: zoom i webex, one bi se koristile kao ispomoć u držanju privatnih časova između profesora i studenta/učenika.  Naša platforma će se vidno razlikovati od navedenih i znaće se njena  funkcionalnost i namena.', NULL, NULL),
(3583, 29, 1585, 'Omogućavamo da studenti/srednjoškolci mogu da pronađu materijal olakšano i da im u velikoj meri  bude od  koristi. Samim tim, studenti/srednjoškolci moći će da nađu kvalitetnog profesora preko naše aplikacije bez mnogo muke i potražnje, zato što će taj profesor imati svoj profil na kojem bi svi koji su pohađali časove mogli da ostavljaju svoje utiske o predavaču i njegovom radu u vidu recenzija, ocena i kvalitativnih utisaka.', NULL, NULL),
(3584, 32, 1585, 'Naš proizvod je značajno poboljšan iz sledećih razloga: \r\n-jednostavan način do materijala za učenje (skripte, beleške, zapisi sa predavanja, instrukcije itd…)\r\n-jednostavniji način do privatnog časa i slične vrste ispomoći\r\n-ekologija (ne iziskuje se upotreba i štampa papira u svrhu učenja, sve je dostupno online u pdf formatima.), \r\n-kvalitetna komunikacija između studenata, \r\n-brz i motivisan razlog za reputacijom', NULL, NULL),
(3585, 37, 1585, 'Sproveli smo istraživanje na datu temu, ali nemamo još uvek dovoljno informacija kako bismo  nastavili rad na tome.', NULL, NULL),
(3586, 40, 1585, 'Zamisao dobitka finansija je na sledeće načine: \r\n-Pri prodaji svake skripte naša firma bi uzimala određeni procenat,\r\n-Svako ko bi želeo da drži privatne časove preko naše aplikacije bi morao da plati da bi bio na oglasnoj tabli i da bi dobio određen broj časova za novac koji je dao preko naše aplikacije (npr. 15e mesečno = 40 casova preko naše platforme),\r\n-Brzo biranje profesora/skripti po algoritmu koji je namenjen za pojedinca,\r\n-Ako je neki profesor previše zauzet dobiće bedž na profilu da je zauzet i imaće izbor ako može još da drži časove da budu skuplji od čega bi mi uzimali procenat,\r\n-Pri kupovini određenih bedževa za profil pojedinca.', NULL, NULL),
(3587, 41, 1585, 'Naš tim (Steddy tim) je formiran 5.11.2021. Od tog perioda do danas mi razvijamo našu ideju u teoriji i na papiru. Uspešno smo istražili tržište i uradili anketu gde smo izvukli korisne informacije koje su nam potrebne za napredak naše ideje. Trenutno nemamo prototip, ali radimo na njemu. Naš tim je sastavljen od izvanrednih ljudi različitih interesovanja (programera, menadžera, marketinga, HR …), uspešno napredujemo i uvek smo otvoreni za proširenje našeg tima. Imamo mockup platforme i veb sajt.', NULL, NULL),
(3588, 44, 1585, 'U trenutnom sastavu, nismo učestvovali kao tim na nekom ranijem startup programu. Co-founder, Ilija Lekić, ima iskustvo zato što je bio tim lider u čak tri srednjoškolska startap programa.', NULL, NULL),
(3589, 45, 1585, 'Ovo je naše prvo apliciranje za dobijanje novčane naknade.', NULL, NULL),
(3590, 48, 1585, 'Očekujemo veliki uspeh naše ideje. Vrlo smo optimistični i smatramo da ideja ima mnogo potencijala. U beta fazi i pri finalnom izbacivanju proizvoda nam je najpotrebnija podrška.', NULL, NULL),
(3591, 49, 1585, 'U trenutnoj fazi razvoja potrebne su nam određene licence i kupovina hardvera. Smatramo da pri napredovanju naše ideje će doći do još nekih finansijskih problema tipa hardwera i softverskih licenci. Samim tim možemo zaključiti da nam treba oko 12000 švajcarskih franaka.', NULL, NULL),
(3592, 52, 1585, '(Ilija Lekić) Za Raising Starts sam čuo jednom prilikom kada sam posetio “Studentsku uniju matematičara” (SUMA) na kom je Naučno tehnološki park bio jedan od predstavnika. U razgovoru me zainteresovao njihov projekat koji bodri i pospešuje inicijativu studenata da ostvare svoje prve poslovne korake kroz inovativne ideje i tako dodatno motivisalo da okupim pravi tim i da im kažem da neka otvorena vrata postoje.', NULL, NULL),
(3593, 66, 1588, NULL, NULL, NULL),
(3594, 76, 1589, NULL, NULL, NULL),
(3595, 83, 1591, NULL, NULL, NULL),
(3596, 89, 1592, 'Student sam treće godine Matematičkog fakulteta, Univerziteta u Beogradu, na smeru za Informatiku. \r\nPrve preduzetničke korake načinio sam pri osnivanju kompanije Ilkom, sa kolegom Jovanom. Kroz rad sa mušterijama smo unapredili naše meke veštine (komunikacija, strpljenje, fleksibilnost), a kroz praktični rad smo poboljšali naše znanje o kompjuterskom hardveru i softveru.\r\nTakođe, sa kolegama Jovanom i Matejom sam radio na projektu Filmder čija funkcija je bila povezivanje ljudi sa istim ukusom po pitanju serija i filmova, kako bi se ta odluka u društvu donosila lakše.\r\nTehnologije koje sam naučio i unapredio su sledeće: Kotlin, FireBase kao i XML.\r\nIako sa bezbroj ideja koje se stalno motaju po mojoj glavi, smatram da Steddy zaslužuje svu moju pažnju i posvećenost. Kako moju, tako i od našeg tima.\r\nU srednjoj školi sam bio tim lider tri startap projekta, te se može zaključiti da imam veliku želju da stvaram i da granice ne postoje!', NULL, NULL),
(3597, 90, 1592, 'Co-founder, developer i jedan od kreatora ideje. Spreman da se u potpunosti posvetim StartUp-u.', NULL, NULL),
(3598, 91, 1592, 'Student osnovnih studija, u većoj meri posvećen.', NULL, NULL),
(3599, 89, 1593, 'Studije na Elektrotehničkom fakultetu, za mene su otvorila vrata za koja nisam ni znala da su tu!\r\nAngaživanje u studentskim organizacijama ISTEK LK Beograd i BEST Beograd, otkrila su u meni želju za večitim napredovanjem i usavršavanjem. \r\nNajviše zainteresovana za organizaciju projekata, ali i odnose sa javnošću, u poslednjih godinu dana sam radila na četiri značajnije pozicije.\r\nSa početkom na BEST design WEEK-u, na kojem sam bila jednako marketing koordinator, kao i publikant, uspela sam da se naučim organizaciji vremena kao i kreativnom razmišljanju. Kao pravi ETF Vodič, osetila sam odgovornost da budućim brucošima na najiskreniji način predstavim studije na Elektrotehničkom fakultetu i na taj način umanjim stigmu da je \'\'studiranje na ETF-u bauk.\'\'\r\nKroz rad na Soft Skills Academy sam najviše napredovala kao osoba. Iako na poziciji koordinatora za odnose sa javnošću, uspela sam na danima projekta da upijem svo znanje, kao i sami participanti. A rad u timu je sada uživanje!\r\nJobFair je priča za sebe, gde Vas pozivam da nam se priključite!', NULL, NULL),
(3600, 90, 1593, 'Co-founder i koordinator za odnose sa javnošću. Takođe spremna da se potpuno posvetim Steddy-u!', NULL, NULL),
(3601, 91, 1593, 'Student osnovnih studija, u većoj meri posvećen.', NULL, NULL),
(3602, 89, 1594, 'Student sam treće godine Matematičkog fakulteta, Univerziteta u Beogradu, na smeru za Informatiku. Jos od malih nogu me zanimaju racunari i uz njih sam naucio da budem precizan,assertivan i problem-solver.\r\nPrve preduzetničke korake načinio sam pri osnivanju kompanije Ilkom, sa kolegom Ilijom. Kroz rad sa mušterijama smo unapredili naše meke veštine (komunikacija, strpljenje, fleksibilnost), a kroz praktični rad smo poboljšali naše znanje o kompjuterskom hardveru i softveru.\r\nTakođe, sa kolegama Ilijom i Matejom sam radio na projektu Filmder čija funkcija je bila povezivanje ljudi sa istim ukusom po pitanju serija i filmova, kako bi se ta odluka u društvu donosila lakše.\r\nTehnologije koje sam naučio i unapredio su sledeće: Kotlin, FireBase kao i XML.', NULL, NULL),
(3603, 90, 1594, 'Developer i drugi kreator ideje, spreman za apsolutnu posvećenost.', NULL, NULL),
(3604, 91, 1594, 'Student osnovnih studija, u većoj meri posvećen.', NULL, NULL),
(3605, 89, 1595, 'Student sam trece godine Matematickog fakulteta, na smeru Informatika.\r\nCeo zivot igram igrice na racunaru i to je bila strast koja mi je otkrila novu, podjednako interesantnu oblast - programiranje.\r\nDosao sam na Matematicki fakultet sa ni malo iskustva, na cemu sam dosta radio prethodne 3 godine.\r\nZajedno sa jos 4 kolege, medju kojima je i Jovan, sam ove godine napravio vizuelni programski jezik kao projekat za jedan kurs.\r\nZajedno sa kolegama Ilijom i Jovanom sam radio tokom leta na aplikaciji za pronalazenje zanimljivih filmova.\r\nKao osoba koja ceo zivot radi u timu neke vrste,  vrednujem komunikaciju, timski rad i prijatnost i trudim se da kod mene licno bude na najvisem nivou. \r\nOno sto uvek pokusavam da postignem kod svake izrade projekta jeste da, iako treba da se odrzava odredjeni nivo ozbiljnosti, da se element zabave izmedju clanova ne izgubi, bez toga nista nema smisla.\r\nNa fakuktetu sam koristio razne alate: bison, flex, CMake,  koristio razne biblioteke: STL, openGL, i uznapredovao u raznim programskim jezicima: C, C++, python, Java.', NULL, NULL),
(3606, 90, 1595, 'Developer, takođe maksimalna posvećenost projektu.', NULL, NULL),
(3607, 91, 1595, 'Student osnovnih studija, u većoj meri posvećen.', NULL, NULL),
(3608, 89, 1596, 'Studentkinja sam na Fakultetu za medije i komunikacije, smer Digitalni marketing. Trenutno se nalazim na poziciji praktikanta u oblasti digitalnog marketinga, pri čemu moja zaduženja podrazumevaju vođenje društvenih mreža i bloga i optimizaciju veb sajta i njegovog sadržaja za Google pretraživač.  \r\nZainteresovana sam za oblasti SEM/SEO i PPC oglašavanja, Content marketinga, Veb analitike, Email marketinga… Poznajem rad na platformama i alatima poput Google Ads, Google Analytics, MailChimp, Screaming Frog, Moz. Takođe, posedujem Google Digital Garage sertifikat, kao i Google Skillshop sertifikate (Search, Display, Video, Measurement).', NULL, NULL);
