(3610, 91, 1596, 'Student osnovnih studija, u većoj meri posvećen.', NULL, NULL),
(3611, 89, 1597, 'Kao student četvrte godine novinarstva i teorije medija stekao sam iskustva iz mnogobrojnih obaveznih praktičnih zadataka koji su se ticali oblasti komunikacija i raznih novinarskih veština. Obogoćen takvim setom znanja, unapredio sam svoje veštine koje su mi potpomogle na raznim pozicijama na kojima sam radio.  Kao što su:\r\n·         Saradnik u izradi prvog rečnika rodne ravnopravnosti na srpskom jeziku uz pokroviteljstvo “Evropskog instituta zar odnu ravnopravnost”(EIGE)\r\n·         Kreator edukativnog sadržaja u vidu online kurseva koji su bili specijalno namenjeni u svrsi usavršavanja zaposlenih u javnim i privatnim preduzećima. Takođe autor tekstova na blogu kompanije Idego.rs kao i pozicija administrator menadžera na mudl platformama Privredne komore Srbije, Unije osiguravača Srbije i Nacionalne službe za zapošljavanje.\r\n·         Praktikansko iskustvo u agenciji za istraživanje tržišta\r\n·         Komunikacija sa izvodjačima i učesnicima događaja kao predstavnik ceremonije dodele muzičkih nagrada MAC-awards u organizaciji Skymusic.', NULL, NULL),
