(3627, 63, 1607, 'Power Flower je proizvod koji služi kao nadstrešnica u toplijim danima i kolektor za sakupljanje vode u kišnom periodu.', NULL, NULL),
(3628, 71, 1608, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3629, 17, 1609, 'Power Flower je proizvod koji služi kao nadstrešnica u toplijim danima i kolektor za sakupljanje vode u kišnom periodu.', NULL, NULL),
(3630, 22, 1609, '1. ceo tim: 17-18. decembar 2021. - Osvojeno drugo mesto na takmičenju ,,Hakaton – Napredne tehnologije u službi ekologije i uređenog životnog prostora.” (Novčana nagrada u vrednosti od 600 eura.)\r\n2. Aleksandra i  Snežana: Avgust – novembar 2018. - UNDP pilot projekat ,,Doznake iz dijaspore zasnovane na blokchain tehnologiji za Grad Niš”\r\n3. Aleksandra i Miljana: Januar 2017. - Osvojeno prvo mesto na konkursu za energetski efikasnu kuću, Konferencija zelene gradnje, organizovana u Nišu od strane Klastera zelene gradnje Srbija\r\n4. Aleksandra, Stefan i Miljana: Mart 2018. - Honorable mention award - \"Muzej jezika u Londonu\", Archasm competitions\r\n5. Aleksandra i Stefan: Mart 2019. - Osvojeno treće mesto na konkursu zs Urbanističko-arhitektonsko rešenje za višenamenski objekat za potrebe kulture u Nišu', NULL, NULL),
(3631, 23, 1609, 'Glavna motivacija jeste želja za kreiranjem boljeg sveta. Ljubav prema čoveku, prirodi, i zaštiti životne sredine nas je spojila i omogućila da znanja iz različitih oblasti povežemo, primenimo i stvorimo proizvod koji može da reši konkretne probleme sa kojima se planeta suočava. Program bi nam pružio korisne alate i sredstva da svoje ideje ostvarimo.', NULL, NULL),
(3632, 24, 1609, 'Inovacije za buduće generacije!', NULL, NULL),
(3633, 25, 1609, 'U ovom trenutku mnogi delovi sveta se suočavaju sa nedostatkom pijaće vode i ubrzanim pregrevanjem koje je svake godine sve veće. Na ovo ukazuju brojne studije i postojeća statistika. Pored ovih naučnih istraživanja, problem sa nedostatkom pitke vode, sve većim brojem poplava i ekstremno vrelim danima je sve očigledniji i običnom čoveku. Iako deluje neverovatno da se čovek u savremenom dobu susreće sa nedostatkom vode, kao osnovne životne potrebe, ovaj problem je svakodnevnica velikog broja ljudi. Sa druge strane, mnoge površine pretrpe i preveliki nanos vode tokom padavina. Ukoliko se sa ovim problemima koje nam donose klimatske promene ne suočimo već danas, čekaju nas sve teži izazovi, potencijalno nerešivi budućim generacijama.', NULL, NULL),
(3634, 26, 1609, 'Na osnovu detaljnog istraživanja putem razgovora sa stanovnicima Niša koji u svojim međublokovskim prostorima, parkovima i saobraćajnicama saznali smo da oni navode probleme vezane za višak vode koja nastane tokom padavina. Analizom naučnoistraživačkih radova pronađenih na https://www.researchgate.net/ i https://www.statista.com/ došlo se do zaključka da je tržište kome bi bio potreban naš inovativni proizvod veliko i svake godine sve više raste. Plan je da se u naredne dve godine krene sa proizvodnjom na lokalnom nivou, i da se zbog potražnje tržište širi, pre svega regionalno, a zatim i na međunarodnom, globalnom nivou.', NULL, NULL),
(3635, 27, 1609, 'Potencijalnih kupaca je mnogo. Od lokalnih samouprava, preko fizičkih lica, kompanija do humanitarnih organizacija. Na lokalnom nivou sprovedena je anketa sa stanarima zgrada koji se žale na preveliku količinu vode u svojim parkovskim površinama nakon kišnog perioda i nedovoljnu količinu hlada u latnjem periodu. Oni ne vole da provode vreme u svojim zajedničkim prostorima jer im to ne predstavlja zadovoljstvo zbog navedenih problema. Sa druge strane postoje ljudi na selu koji tokom letnjih perioda nemaju dovoljno ni vode ni hlada kako bi njihovi usevi opstali. Takođe, tu su i ljudi koji bi voleli da poboljšaju svoje korišćenje vode i potrebna im je nadstrešnica u dvorištu. Velike probleme imaju i ljudi u zemljama gde se redovno dešavaju poplave, ali, možda najveći problem, imaju ljudi u Africi i u drugim suvim područjima, kao i u područjima koja iz nekih drugih razloga imaju problem sa nedostatkom pijaće vode. Njima bi Power Flower bio od najveće koristi.', NULL, NULL),
(3636, 28, 1609, 'Inovativna nadstrešnica PowerFlower inspirisana je cvetom. Ideja je bila stvoriti multifunkcionalnan, lako prenosiv i skalabilan proizvod. PowerFlower ima više varijanti dizajna i funkcija. Osnovne funkcije bile bi prikupljanje kišnice i pravljenje hlada. On se sastoji iz krune i stabla. Na kruni od fotonaponskih panela se nalaze senzori koji pomažu da se ti paneli rašire kada ima padavina i prevelikih temperatura i da se sklope kada to nije slučaj. Iz krune  poput levka se voda sliva u rezervoar koji se nalazi u stablu. Iz rezervoara voda se dalje može filtrirati, odvoditi i koristiti na više načina. PF je poseban zato što se jednim proizvodom rešava više gorućih problema.', NULL, NULL),
(3637, 30, 1609, 'Lokalno ispitani kupci uopšte ne rešavaju ovaj problem. Problemi koje donose klimatske promene na globalnom nivou rešava se na mnogo načina. Slični proizvodi postoje, ali nijedan ne obuhvata rešavanje svih pomenutih problema. Problem nedostatka hlada rešava se običnim nadstrešnicama, sadnjom drveća i biljaka. Problem sakupljanja kišnice rešava se na pojedinačnom nivou ili postojećom infrastrukturom koja nije uvek u mogućnosti da prihvati dovoljnu količinu vode. Problem nepostojanja pitke vode u nekim područjima retko se i nespretno rešava. Ali ne postoji jedinstveno rešenje za sve ove probleme. Tu nastupa PowerFlower.', NULL, NULL),
(3638, 29, 1609, 'Benefiti koje PowerFlower donosi su mnogobrojni. Posebno se izdvaja vrednost obezbeđivanja pitke vode za ljude kojima ona nije dostupna. Ostali benefiti su: rešavanje problema sa viškom vode usled bujičnih naleta, obezbeđivanje hlada danima sa previsokim temperaturama, proizvodnja električne energije, kreiranje mesta za okupljanje zajednice koje je vizuelno privlačno i u skladu sa pravilima biofilije. PowerFlower se izdvaja po tome što je multifunkcionalan, isplativ i dostupan svima.', NULL, NULL),
(3639, 32, 1609, 'Slični proizvodi koji postoje uglavnom rešavaju samo jedan problem (npr. rešavanje hlada, prečišćavanje vode, sakupljanje kišnice, proizvodnja el. energije solarnim panelima), u praksi se ne susreće nešto što objedinjuje funkcije koje rešavaju sve pomenute probleme.', NULL, NULL),
(3640, 37, 1609, 'Nismo sproveli istraživanje niti zaštitili, planiramo i vlasnici bi bili Aleksandra Cvetanović i Miljana Todorović.', NULL, NULL),
(3641, 40, 1609, 'Green Innovations planira da zarađuje prodajom i iznajmljivanjem proizvoda PowerFlower.', NULL, NULL),
(3642, 41, 1609, 'San o poboljšanju sveta i rešavanju problema stvorenih zbog klimatskih promena postoji još od ranih studentskih projekata. Kao tim okupili smo se radi učestvovanja na takmičenju Hakaton. Ideja je bila da stvorimo proizvod koji će da reši nekoliko velikih problema sa kojima se svet susreće sada, a koji mogu dovesti do još većih posledica u budućnosti. Do sada smo kreirali 3d model, tehničke crteže i šeme proizvoda PowerFlower, i to prezentovali na već pomenutom takmičenju sa temom \"Inovativne tehnologije u službi ekologije\", gde smo dobili potvrdu od strane eksperata u žiriju i mentora i osvojili drugu nagradu.', NULL, NULL),
(3643, 44, 1609, 'Kao tim do sada nismo učestvovali u programima te vrste.', NULL, NULL),
(3644, 45, 1609, 'Nismo prikupili bilo kakav izvor finansiranja.', NULL, NULL),
(3645, 48, 1609, 'Očekujemo mentorstvo, potvrdu naše ideje, pomoć u razvoju startapa i finansijsku podršku. S obzirom na to da smo u najranijoj fazi razvoja startapa, veoma bi nam značilo uključivanje i konekcija sa ekspertima. Zato smatramo da nam je potrebno i povezivanje sa već uspešnim primerima u ovoj oblasti na tržištu.', NULL, NULL),
(3646, 49, 1609, 'Prijavili smo se za ovaj program u nadi da će nagradni fond biti dovoljan da pokrije troškove namenjene izradi dokaza koncepta, razvoju biznis modela, istraživanju tržišta, testiranju prvih kupaca i zaštite intelektualne svojine.', NULL, NULL),
(3647, 52, 1609, NULL, NULL, NULL),
(3648, 66, 1612, NULL, NULL, NULL),
(3649, 76, 1613, NULL, NULL, NULL),
(3650, 83, 1615, NULL, NULL, NULL),
(3651, 71, 1616, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3652, 63, 1617, 'Razvoj aplikacije koja će doprineti unapređenju bezbednosti, informisanosti i orijentacije na planinama u toku cele godine. Omogućila bi posetiocima planina brzo kontaktiranje Gorske službe direktnim slanjem lokacije osobe kojoj je potrebna pomoć, doprinela informisanosti o stazama i žičarama, lokalnim sadržajima (znamenitosti, ustanove, lokali i dr.) i manifestacijama i pomogla pri orijentaciji u prostoru. Aplikacija bi nudila mogućnost praćenja performansi korisnika i opciju kreiranja ličnog profila zahvaljujući kome korisnici mogu da čuvaju podatke o svojim prethodnim aktivnostima i povezuju se sa drugim korisnicima i prate njihovu lokaciju. Aplikacija bi bila adaptirana za upotrebu na pametnom satu. \r\nAplikacija bi mogla da se koristi samostalno ili uz uređaj koji služi kao lokator i tzv. “panic button”, i koji bi omogućavao veću preciznost prilikom ocene lokacije korisnika, kao i mogućnost slanja lokacije i pozivanja u pomoć Gorske službe spasavanja.', NULL, NULL),
(3653, 71, 1618, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3654, 17, 1619, 'Razvoj aplikacije koja će doprineti unapređenju bezbednosti, informisanosti i orijentacije na planinama u toku cele godine. Omogućila bi posetiocima planina brzo kontaktiranje Gorske službe direktnim slanjem lokacije osobe kojoj je potrebna pomoć, doprinela informisanosti o stazama i žičarama, lokalnim sadržajima (znamenitosti, ustanove, lokali i dr.) i manifestacijama i pomogla pri orijentaciji u prostoru. Aplikacija bi nudila mogućnost praćenja performansi korisnika i opciju kreiranja ličnog profila zahvaljujući kome korisnici mogu da čuvaju podatke o svojim prethodnim aktivnostima i povezuju se sa drugim korisnicima i prate njihovu lokaciju. Aplikacija bi bila adaptirana za upotrebu na pametnom satu. \r\nAplikacija bi mogla da se koristi samostalno ili uz uređaj koji služi kao lokator i tzv. “panic button”, i koji bi omogućavao veću preciznost prilikom ocene lokacije korisnika, kao i mogućnost slanja lokacije i pozivanja u pomoć Gorske službe spasavanja.', NULL, NULL),
(3655, 22, 1619, 'Startap ideja sa kojom se prijavljujemo za ovaj program je naše prvo iskustvo ove vrste, pre ove ideje nismo imale prilike da radimo na razvoju startapa ni kao tim, ni pojedinačno. Međutim, s obzirom na to da smo zajedno pohađale srednju školu i da smo trenutno koleginice na fakultetu, često smo timski radile na različitim školskim i studentskim projektima i prezentacijama. Naš zajednički rad na ovoj stratap ideji počeo je upravo u okviru jednog studentskog projekta, potom smo samostalno nastavile sa razvojem ideje, da bismo se, u septembru 2021. godine prijavile za program RISE - Regionalni inkubator za socijalno preduzetništvo. Od oktobra 2021. godine učestvujemo kao jedan od sedam timova u prvoj fazi RISE programa - Programu Ideacije, pod imenom Ski Easy. Program nudi samo nefinansijsku, odnosno stručnu podršku u razvoju ideje i biznis modela.', NULL, NULL),
(3656, 23, 1619, 'Odlučne smo u nameri da damo sve od sebe kako bismo ostvarile svoju ideju, te smo u stalnoj potrazi za prilikama koje će nam omogućiti da je podignemo na viši nivo i budemo korak bliže realizaciji. Preporuku za ovaj program dobile smo od docenta FON-a Milana Okanovića koji je bio jedan od učesnika i prošao put od ideje do realizacije. Njegova startap priča za nas je veoma inspirativna - ukazala nam je na brojne mogućnosti koje Raising Stars nudi i time nas motivisala da se i same prijavimo. Evidentno je da verujemo u svoju ideju, a dodatni vetar u leđa dali su nam pozitivni komentari i sugestije naših poznanika ali i profesora i predstavnika privrede koji su imali priliku da čuju našu prezentaciju tokom Nedelje studentskih ideja. Preduzetnički put je pun uspona i padova, te je mreža podrške koju čine mentori i drugi startapi i koja olakšava razmenu znanja od ključne važnosti za naš dalji napredak. Imajući u vidu kompleksnost ideje koju razvijamo, ne treba zanemariti ni značaj pristupa investicionim fondovima i finansijske podrške.', NULL, NULL),
(3657, 24, 1619, 'Planina na dlanu - bez straha uživajte u čarima prirode!\r\nGet informed, be safe, rest and let the mountain offer you the best!', NULL, NULL),
(3658, 25, 1619, 'Pokušavamo da rešimo probleme posetilaca planina koji se odnose na: orijentisanje u prostoru i lociranje bliskih osoba, pronalaženje znamenitosti, ustanova, lokala i događaja koje žele da posete, dugo čekanje u redu za žičaru, kontaktiranje i informisanje Gorske službe o lokaciji osobe kojoj je potrebna pomoć. Ovi problemi su prisutni na svim planinama gde je razvijen turizam. Njihova kompleksnost zavisi od geografskih odlika lokacije, njene veličine i posećenosti, kao i od dostupnosti, ažurnosti i obuhvatnosti postojećih izvora informisanja. Procena težine problema zavisi od potreba i percepcije pojedinca. Skijam od detinjstva i već dugo sam svesna ovih problema, ali sam tek skoro, zahvaljujući znanju i načinu razmišljanja koje sam usvojila tokom studija, počela da razmišljam o mogućim rešenjima. Podelila sam svoja zapažanja sa članicama tima, koje su se složile i iznele svoje viđenje. Razgovarale smo sa svojim poznanicima i došle do saznanja da se svi susrećemo sa istim problemima.', NULL, NULL),
(3659, 26, 1619, 'U prvim godinama postojanja planiramo da se fokusiramo na Kopaonik, s obzirom na to da je najposećenija planina u Srbiji i da ima veliki broj skijaških, pešačkih i bicklističkih staza i drugih sadržaja. Potom, planiramo širenje na druge planine na teritoriji Srbije, a tek u daljoj budućnosti razmatraćemo dalje širenje tržišta i to najpre na region. Tokom 2019. godine Kopaonik je posetilo 135 613 turista. (izvor: raskaturizam.rs) U toku 2020. godine, usled epidemije virusa COVID-19, došlo je do pada turističke delatnosti, međutim, sa popuštanjem epidemioloških mera tokom 2021. beleži se rast broja posetilaca planina u Srbiji. U prvim godinama našeg poslovanja, kada planiramo da se fokusiramo na Kopaonik, ovu planinu posetiće oko 150 000 ljudi. Od toga, oko 70% ljudi čini naše ciljno tržište (preostalih 30% ne uzimamo u obzir jer boravak na planini provode isključivo npr. u hotelu, izričiti su protivnici tehnologije i sl.), dakle veličina našeg ciljnog tržišta je oko 100 000 ljudi.', NULL, NULL),
(3660, 27, 1619, 'Naši potencijalni kupci su posetioci planina. Njihove ključne karakteristike su: fizički su aktivni, digitalno pismeni i vole prirodu, a ključne potrebe: orijentisanost u prostoru, informisanost i brza reakcija Gorske službe. U decembru smo započele sprovođenje ankete (https://forms.gle/gWtAgKC56Q5vLoGG8). Anketu je do 23.12. popunilo 240 ispitanika različitih uzrasta. Rezultati ankete potvrdili su naše pretpostavke - najveći broj ispitanika su skijaši, hajking i planinski biciklizam se tek razvijaju u Srbiji, najposećenije planine su Zlatibor i Kopaonik, a ispitanici najčešće na planinu idu sa prijateljima. Dobro smo prepoznale i potrebu za izbegavanjem gužvi na žičarama, a iznanadilo nas je što je samo 37% ispitanika kao jednu od tri najvažnije stavke izabralo brzo kontaktiranje Gorske službe. Kao što smo pretpostavile, većina ispitanika nema problem da koristi aplikacije koje imaju pristup njihovim podacima/lokaciji, a mali broj ispitanika koristi plaćene verzije aplikacija.', NULL, NULL),
(3661, 28, 1619, 'Glavne karakteristike aplikacije: pomaže posetiocima planina prilikom orijentisanja u prostoru, pruža informacije o lokalnim sadržajima i manifestacijama i omogućava direktno kontaktiranje Gorske službe. Prema našim istraživanjima, za razvoj aplikacije može da se korisi Flutter (tehnologija prilagođena za Android i IOS). Jedinstvenom je čine: interaktivna  mapa sa sadržajima za sve posetioce planina, usmeravanje putem glasovnih komandi i praćenje lokacije drugih korisnika; sveobuhvatna i ažurna baza informacija o lokalnim sadržajima i događajima i informacije o popunjenosti kapaciteta žičara; direktno kontaktiranje i slanje lokacije Gorskoj službi; učešće korisnika u humanitarnim akcijama.', NULL, NULL),
(3662, 30, 1619, 'Potencijalni korisnici orijentišu se na planini prateći putokaze ili vodiča, papirne mape, mape u vidu “slike\" i tekstualna uputstva koja nude konkurenti (infoKOP) ili oslanjajući se na lični osećaj za prostor. Kako bi locirali bliske osobe, koriste neku od aplikacija za tu namenu (Life360, Find My Kids). O lokalnim sadržajima i događajima informišu se putem bilborda, plakata, TV reklama, društvenih mreža, konkurentskih aplikacija/web-sajtova ili neposrednim razgovorom, ali im postojeći izvori informisanja ne nude sve potrebne informacije. Potrebu za informacijom o popunjenosti kapaciteta žičara mogu delimično da zadovolje procenom na licu mesta, konsultovanjem drugih posetilaca ili pomoću snimaka sa ski kamera. Međutim, ovi načini ne nude preciznu ni pravovremenu informaciju. Gorsku službu mogu da kontaktiraju pozivom na broj telefona istaknut na plakatima, sajtu Gorske službe ili na konkurentskim aplikacijama/web-sajtovima, međutim ne postoji mogućnost da proslede svoju lokaciju.', NULL, NULL),
(3663, 29, 1619, 'Aplikacija bi korisnicima pružila pomoć pri orijentisanju (prikaz interaktivne mape, lociranje korisnika, pretraga sadržaja, pregled mogućih ruta i mogućnost izbora rute koja vodi do ciljne lokacije usmeravanje glasovnim komandama), omogućila raspolaganje svim potrebnim informacijama za boravak na planini (informacije su integrisane u mapu i ažurne) i brzo kontaktiranje i slanje lokacije Gorskoj službi. Konkurentske prednosti: interaktivna mapa fokusirana na potrebe posetilaca planina, sve informacije potrebne posetiocu planine na jednom mestu, informacija o mestima za odlaganje otpada, , mogućnost upotrebe aplikacije uz uređaj-lokator, kreiranje profila koji omogućava čuvanje podataka o prethodnim kretanjima i povezivanje sa drugim korisnicima, mogućnost lociranja drugih korisnika, praćenja performansi korisnika, prilika za učešće u humanitarnim akcijama i drugo.', NULL, NULL),
(3664, 32, 1619, 'Većina konkurentskih aplikacija ne funkcioniše dobro, odnosno bagovi su česti, a određeni broj funkcionalnosti ne radi. Uz to, dizajn korisničkog interfejsa je zastareo i aplikacije nisu user-friendly (izuzetak su web-sajtovi infoKOP i Kopaonik Online). Negativni komentari korisnika su brojni (posebno za aplikaciju Ski Serbia) upućujući na nefunkcionisanje i zastarelost i naglašavaju značaj ovakvih aplikacija, što govori o potrebi za unapređenjem. Naša aplikacija obuhvata sve funcionalnosti koje nude konkurenti, a pored toga sadrži i dodatne funkcionalnosti koje trenutno nisu dostupne, te sadrži sve što je što je potrebno posetiocima planine - pomoć pri orijentisanju na planini i pronalaženju lokacija koje žele da posete, sve relevantne i ažurne informacija na jednom izvoru i osećaj bezbednosti zahvaljujući direktnom kontaktiranju i slanju lokacije Gorskoj službi. Kao što smo prethodno elaborirale, ni jedan od konkurenata ne nudi ovako kompletnu i kvalitetnu uslugu.', NULL, NULL),
(3665, 37, 1619, 'Pošto je naš proizvod na nivou ideje, trenutno ne postoji način da sprovedemo zaštitu (izuzev poslovnom tajnom, što za sada ne smatramo neophodnim). Kada se ideja konkretizuje ponovo ćemo razmotriti mogućnosti. U slučaju zaštite, vlasnik intelektualne svojine bio bi tvorac ideje (Jelena Stišović). Zaštitu logotipa planiramo da izvršimo čim budemo imale konačnu verziju.', NULL, NULL),
(3666, 40, 1619, 'Još uvek razmatramo koji model monentizacije, odnosno koja kombinacija modela monetizacije, bi bila najpogodnija za našu aplikaciju (kao što smo već pomenuli, jedan od ciljeva naše ankete je upravo da nam ukaže na to koje funkcionalnosti su naši korisnici spremni da plate). Imajući u vidu informacije koje smo do sada prikupili, smatramo da bi preuzimanje naše aplikacije trebalo da bude besplatno. Verujemo da bi znatan deo prihoda svakako poticao od mobilnog oglašavanja i to prvenstveno od reklamiranja hotela, prodavnica, restorana i drugih lokala koji se nalaze na konkretnoj planini i u okruženju. Smatramo da bi korišćenje određenih funkcionalnosti naše aplikacije trebalo da se naplaćuje, te razmatramo tzv. freemium model, ali i model pretplate koji podrazumeva da korisnici našu aplikaciju instaliraju besplatno, ali je potom potrebno da, u zavisnosti od funkcionalnosti koje žele da koriste, izvrše uplatu.', NULL, NULL),
(3667, 41, 1619, 'Ideja je nastala u aprilu 2021. kada sam na skijanju počela da razmišljam o rešavanju problema sa kojima se susreću posetioci planina. Za potrebe projekta iz predmeta Menadžment tehnologije i razvoja na fakultetu razvile smo ideju i prezentovale kroz Lean Canvas metodologiju. U septembru smo primljene u RISE program - Program Ideacije. U novembru smo u okviru projekta Preduzmi ideju, tokom Nedelje studentskih ideja predstavile aplikaciju profesorima FON-a i predstavnicima privrede i dobile pozitivne komentare vezane za prepoznavanje problema, razrađenost Businsess modela, ekološke i humanitarne aspekte. Profesor zaposlen u Gorskoj službi ukazao nam je i na značaj koji bi aplikacija imala za rad spasilaca i prikupljanje statističkih podataka o broju i ozbiljnosti povreda, a CEO Digitalne Srbije pohvalio je što smo prepoznale značaj koji saradnja sa lokalima ima za komercijalizaciju. U decembru smo sprovele i istraživanje tržišta u vidu ankete. Planiran je sastanak sa Gorskom službom.', NULL, NULL),
(3668, 44, 1619, 'U septembru 2021. godine, saznala sam za program RISE - Regionalni inkubator za socijalno preduzetništvo i okupila svoj tim kako bismo razmotrili učešće u jednom takvom projektu. Svi članovi tima su se složili i poslali smo prijavu, da bismo mesec dana kasnije saznali da smo jedan od sedam timova koji su primljeni u prvu fazu RISE programa - Program Ideacije. Do sada smo u okviru RISE programa definisale problem, misiju i rešenje, radile na razvoju Social Business Canvasa, odredile ciljeve, probleme i koristi korisnika, definisale Proto Personu, proširile svoja znanja o istraživanju tržišta, brendingu i marketingu i imale priliku da čujemo iskustva i stupimo u kontakt sa ostvarenim preduzetnicima. Zahvaljujući RISE-u imamo mogućnost da ostvarimo direktan kontakt sa PR-om Gorske službe spasavanja i planiran je prvi sastanak sa predstvanicima službe. Naše učešće u Programu Ideacije u okviru RISE programa završava se sredinom februara 2022. godine.', NULL, NULL),
(3669, 45, 1619, 'Nismo do sada prikupile ni jedan izvor finansiranja.', NULL, NULL),
(3670, 48, 1619, 'Očekujemo da, od mentora i eksperata koji imaju iskustva u ovakvim poduhvatima, steknemo nova znanja i veštine kako bismo unapredile svoju ideju, da ostvarimo kontakte koji će nas podržati i olakšati nam realizaciju i da upoznamo druge timove i njihove startape i na taj način budemo deo mreže podrške, učestvujemo u razmeni znanja sa kolegama preduzetnicima i damo svoj doprinos u kreiranju pozitivne preduzetničke klime u Srbiji. S obzirom da studiramo Menadžment, nemamo dovoljno znanja iz IT-a koje nam je potrebno da bismo detaljno sagledale performanse aplikacije i pristupile njenom razvoju. Najpotrebnija nam je upravo podrška u oblasti IT-a, što podrazumeva angažovanje osobe koja ima znanje i iskustvo u razvoju mobilnih aplikacija i koja je spremna da se priključi našem timu. Pored toga, imajući u vidu da naša ideja podrazumeva razvoj kompleksne mobilne aplikacije, od velikog značaja nam je i ostvarivanje kontakata koji su spremni da nam pruže svoju stručnu ali i finansijsku podršku.', NULL, NULL),
(3671, 49, 1619, 'Kako bi naša procena bila što precizinija, pored samostalnog isztraživanja konsultovali smo i relevantne stručnjake i zaključili: za izradu MVP-a potrebno je oko 25 000eur; za izradu logoa i osnovnog web-sajta oko 350eur; za aktivnosti marketinga i promocije, koje podrazumevaju izradu reklamnih materijala u vidu flajera i plakata, vođenje naloga i reklamiranje na društvenim mrežama, kao i oglašavanje putem Google Ads-a: oko 600eur na mesečnom nivou;	za plasiranje aplikacije na Google Play Store, Apple App Store: plasiranje aplikacije na Google Play Store košta oko 22eur (plaća se samo jednom), plasiranje na Apple App Store iziskuje oko 88eur godišnje.', NULL, NULL),
(3672, 52, 1619, 'Na učešće u programu Raising Stars uputili su nas profesori sa fakulteta, kao i predavači koje smo imali priliku da slušamo u okviru Nedelje studentskih ideja, koja je bila deo projekta Preduzmi ideju.', NULL, NULL),
(3673, 66, 1622, NULL, NULL, NULL),
(3674, 76, 1623, NULL, NULL, NULL),
(3675, 83, 1625, NULL, NULL, NULL),
(3676, 89, 1626, 'Studentkinja 3. godine Fakulteta organizacionih nauka, na smeru Menadžment, članica Tima za akademske odnose u Savezu studenata Fakulteta organizacionih nauka i članica organizacionog tima na projektu “Dani Prakse\".\r\nIskustvo u podučavanju engleskog jezika. \r\nŠto se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao liderka tima Ski Easy.', NULL, NULL),
(3677, 90, 1626, 'Tvorac ideje i liderka tima, radi na razvoju ideje i uvođenju novih funkcionalnosti, zadužena za fundraising - priprema prezentacije i vodi komunikaciju sa zainteresovanim stranama. \r\nPotpuno posvećena radu na ovoj ideji i pored redovnog prisustvovanja radionicama i izradi domaćih zadataka u okviru RISE programa - što na nedeljnom nivou zahteva angažovanje od 3-6 sati, dodatno izdvaja još prosečno 2-4 sata nedeljno za rad na razvoju ideje i novih funkcionalnosti, komunikaciju sa zainteresovanim stranama, pripremu prezentacija, sastanke tima, istraživanje tržišta i konkurencije i ostale aktivnosti.', NULL, NULL),
(3678, 91, 1626, 'Studije u proseku podrazumevaju angažovanje od 25-30 sati nedeljno (kada nije ispitni rok), a rad u Timu za akademske odnose u Savezu studenata Fakulteta organizacionih nauka, u proseku iziskuje 2-4 sata rada na nedeljnom nivou (kada nisu u toku projekti organizacije).', NULL, NULL),
(3679, 89, 1627, 'Studentkinja 3. godine Fakulteta organizacionih nauka na smeru Menadžment. \r\nTokom 2019. i 2020. godine radila kao promoterka za kompaniju Zlatiborac. \r\nŠto se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao članica tima Ski Easy.', NULL, NULL),
(3680, 90, 1627, 'Članica tima primarno zadužena za marketing i prodaju, pomaže u razvoju ideje, učestvuje u pripremi prezentacija i komunikaciji sa zainteresovanim stranama.\r\nU većoj meri posvećena radu na ovoj ideji i pored redovnog prisustvovanja radionicama i izradi domaćih zadataka u okviru RISE programa - što na nedeljnom nivou zahteva angažovanje od 3-6 sati, dodatno izdvaja još prosečno 1-2 sata nedeljno za aktivnosti koje se tiču marketinga i istraživanja tržišta, rad na razvoju ideje, komunikaciju sa zainteresovanim stranama, učestvovanje u pripremi prezentacija, sastanke tima i ostale aktivnosti.', NULL, NULL),
(3681, 91, 1627, 'Studije u proseku podrazumevaju angažovanje od 25-30 sati nedeljno (kada nije ispitni rok), a pokretanje sopstvenog preduzetničkog poduhvata zahteva rad od 4-6 sati nedeljno.', NULL, NULL),
(3682, 89, 1628, 'Studentkinja 3. godine Fakulteta organizacionih nauka, na smeru Menadžment, članica HR tima u Savezu studenata Fakulteta organizacionih nauka, a trenutno i liderka HR tima za potrebe projekta “Dani Prakse”.\r\nOd nedavno predsednica organizacije Mladi lideri Srbije. \r\nŠto se tiče iskustva u razvoju startap ideje, trenutno učestvuje u Programu Ideacije u okviru RISE programa kao članica tima Ski Easy.', NULL, NULL),
(3683, 90, 1628, 'Članica tima, pomaže u razvoju ideje, učestvuje u pripremi prezentacija i komunikaciji sa zainteresovanim stranama.\r\nDelimično posvećena radu na ovoj ideji i pored povremenog prisustvovanja radionicama i izrade domaćih zadataka u okviru RISE programa, dodatno izdvaja još do 1 sata nedeljno za rad na razvoju ideje, komunikaciju sa zainteresovanim stranama, učestvovanje u pripremi prezentacija, sastanke tima i ostale aktivnosti.', NULL, NULL),
(3684, 91, 1628, 'Studije u proseku podrazumevaju angažovanje do 25 sati nedeljno (kada nije ispitni rok), a rad u HR timu Saveza studenata Fakulteta organizacionih nauka, u proseku iziskuje do 8 sati rada na nedeljnom nivou (trenutno oko 16 sati zbog liderske pozicije). Organizacija Mladi lideri Srbije trenutno ne zahteva značajno angažovanje imajući u vidu da je tek nedavno osnovana.', NULL, NULL),
(3685, 71, 1632, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(3686, 63, 1633, 'Upotreba tehnologije u sportu je u rapidnom porastu. Očekuje se da tržište sportske tehnologije u 2024. godini dostigne vrijednost od 5,2 milijarde US dolara. Tehnologija u sportu danas ima široku primjenu, od praćenja performansi igrača, praćenja kretanja igrača, kreiranja programa treninga prilagođenih svakom igraču, definisanja taktika tokom utakmica itd. Donošenje odluka zasnovanih na podacima mijenja cijelu industriju sporta!\r\nUređaji koje igrači nose danas su u mogućnosti pratiti od broja otkucaja srca, brzine igrača, broja skokova, jačine udarca, pozicije igrača, kretanja na terenu, tehnike igrača itd, a svi prikupljeni podaci osnova su daljeg rada trenera, doktora, skauta, menadžera.  \r\n\r\nHockey Tracker je upravo jedan od takvih uređaja namjenjen praćenju performansi igrača hokeja, njihove brzine, tehnike, brzine kretanja i jačine udarca. Specifičnost, u odnosu na trenutno dostupne proizvode, se ogleda u tome što uređaj nije postavljan na tijelo igrača nego predstavlja sastavni dio hokejaškog štapa. Ključni razlog ovom pristupu jeste minimiziranje povreda igrača. Hokej kao sport karakteriše veliki broj kontakata igrača, u nekim momentima veoma grubih kontakata, i bilo kakav uređaj postavljen na tijelo igrača povećava rizik od povrede u slučaju kontakta. Sa druge strane hokejaški štap je kontinuirano u ruci igrača i omogućava praćenje svih njegovih kretnji.   \r\n\r\nŠto se tiče samog tržišta fokus bi bio na igrače u juniorskim kategorijama klubova iz Sjedninjenih Američkih Država i Kanade. Ovdje govorimo o igračima od 12 do 14 godina koji imaju za cilj, i podršku roditelja, da se aktivno bave hokejom kroz srednju školu, koledž i san da jednog dana zaigraju u profesionalnoj NHL ligi.', NULL, NULL),
(3687, 71, 1634, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3688, 17, 1635, 'Upotreba tehnologije u sportu je u rapidnom porastu. Očekuje se da tržište sportske tehnologije u 2024. godini dostigne vrijednost od 5,2 milijarde US dolara. Tehnologija u sportu danas ima široku primjenu, od praćenja performansi igrača, praćenja kretanja igrača, kreiranja programa treninga prilagođenih svakom igraču, definisanja taktika tokom utakmica itd. Donošenje odluka zasnovanih na podacima mijenja cijelu industriju sporta!\r\nUređaji koje igrači nose danas su u mogućnosti pratiti od broja otkucaja srca, brzine igrača, broja skokova, jačine udarca, pozicije igrača, kretanja na terenu, tehnike igrača itd, a svi prikupljeni podaci osnova su daljeg rada trenera, doktora, skauta, menadžera.  \r\n\r\nHockey Tracker je upravo jedan od takvih uređaja namjenjen praćenju performansi igrača hokeja, njihove brzine, tehnike, brzine kretanja i jačine udarca. Specifičnost, u odnosu na trenutno dostupne proizvode, se ogleda u tome što uređaj nije postavljan na tijelo igrača nego predstavlja sastavni dio hokejaškog štapa. Ključni razlog ovom pristupu jeste minimiziranje povreda igrača. Hokej kao sport karakteriše veliki broj kontakata igrača, u nekim momentima veoma grubih kontakata, i bilo kakav uređaj postavljen na tijelo igrača povećava rizik od povrede u slučaju kontakta. Sa druge strane hokejaški štap je kontinuirano u ruci igrača i omogućava praćenje svih njegovih kretnji.   \r\n\r\nŠto se tiče samog tržišta fokus bi bio na igrače u juniorskim kategorijama klubova iz Sjedninjenih Američkih Država i Kanade. Ovdje govorimo o igračima od 12 do 14 godina koji imaju za cilj, i podršku roditelja, da se aktivno bave hokejom kroz srednju školu, koledž i san da jednog dana zaigraju u profesionalnoj NHL ligi.', NULL, NULL),
(3689, 22, 1635, 'Tim uključen u realizaciju ove ideje čine Nenad Raković, Luka Prišunjak, Nenad Jovičić i Vladimir Ćorda, a kako se ekipa okupila objasnićemo u nastavku. \r\nHokejaš i trener hokeja u Čikagu Nenad Raković je idejni tvorac Hockey Tracker-a.  Imajući u vidu da je ideja u ranoj fazi Nenad se u septembru prijavljuje za KATALIZATOR program. Luka Prišunjak je u okviru KATALIZATOR programa radio sa timovima na Customer Development procesu te je sa Nenadom u periodu od mjesec dana radio na definisanju ciljne grupe, osmišljavanju i sprovođenju intervjua, te je na ovaj način stekao detaljniji uvid u samu ideju i njen potencijal. Takođe, Vladimir Ćorda kao organizator KATALIZATOR programa kontinuirano je pratio razvoj timova tokom programa i pružao im podršku. Uvidjevši potrebu za dodatnom ekspertizom u domenu tehničkog razvoja ideje Vladimir je kroz kontakt sa kompanijom Bitgear uspostavio vezu sa Profesorom Nenadom Jovičićem, koji se uključio u rad tima kao ekspert u razvoju IoT uređaja.', NULL, NULL),
(3690, 23, 1635, 'Raising Starts kao program pruža strukturirani pristup podršci razvoju inovativnih proizvoda. Od znanja, pristupa laboratorijama, sredstava za inicijalni razvoj te mogućnosti uvezivanja sa sličnim kompanijama koje rade u okviru Naučno tehnološkog parka Beograd, a u cilju razmjene znanja. Upravo ovaj strukturirani pristup nas je motivisao da se prijavimo na program imajući u vidu da su u narednom periodu ključne aktivnosti na realizaciji ideje izrada prototipa, njegovo testiranje, finalizacija Customer Development procesa, definisanje finalnog poslovnog modela i go to market strategije, te zaštita intelektualnog vlasništva. Smatramo da kroz ovakav program i podršku Naučno tehnološkog parka Beograd možemo doći do podrške u svim navedenim fazama bilo direktno kroz predavače i mentore na programu bilo indirektno kroz uvezivanje sa drugim kompanijama stanarima NTP-a.', NULL, NULL),
(3691, 24, 1635, 'Data Powered Hockey!', NULL, NULL),
(3692, 25, 1635, 'Prosečan roditelj u Nenadovom hokejaškom klubu potroši od 12 do 15 hiljada dolara godišnje na hokejaške aktivnosti deteta. Zarad jasnije slike o kakvom angažmanu roditelja je riječ bitno je istaći da su roditelji prisutni na svim utakmicama djece, bilo da li je riječ o utakmici na domaćem ili gostujućem terenu. Roditelji su posvećeni napretku svoje djece, a oni strastveniji prate analitiku svoga djeteta koju su prikupili “golim okom” te ubilježili na list papira ili skicu terena. Sve su to indikatori koji pokazuju da postoji velika potreba za uvođenjem praćenja napredka i aktivnosti mladih hokejaša.\r\nSa stanovišta statistike koju roditelji prate tu je riječ o broju udaraca, postignutih golova i grubom pozicijom djeteta na terenu tokom utakmice. Ovaj način praćenja performansi djeteta ne omogućava praćenje analitike u dužem vremenskom periodu, ne omogućava praćenje napretka djeteta i sa druge strane fokus roditelja stavlja samo na tehničke aspekte igre, a ne na uživanje u utakmici.', NULL, NULL),
(3693, 26, 1635, 'Sa navedenim proizvodom ciljamo na tržišta Sjedninjenih Američkih Država i Kanade. \r\nPrema podacima USA Hockey broj prijavljenih igrača hokeja u SAD-u za sezonu 2020-2021 iznosi 456.826 igrača. Prema dobnim skupinama broj igrača je sljedeći 11-12 godina: 59.390; 13-14 godina: 56.571; 15-16 godina: 44.943 igrača. \r\nPrema podacima Međunarodne federacije hokeja na ledu broj registrovanih igrača na svijetu, u sezoni 2019-2020, je iznosio 1.781.781 igrača od čega 969.981 igrač u kategoriji do 20 godina. Od navedenog broja u  SAD-u u sezoni 2019-2020 je iznosio 561.700 igrača od čega 205.018 igrača u kategoriji do 20 godina dok je broj igrača u Kanadi iznosio 607.951 igrač od čega 429.173 igrača do 20 godina. Prema podacima Statista.com u 2021. godini došlo je do određenog pada broja igrača hokeja u SAD i Kanadi i prema navedenom izvoru broj igrača u SAD iznosi 453.826, a u Kanadi 345.481 igrač.', NULL, NULL),
(3694, 27, 1635, 'Ciljna grupa su roditelji djece koja igraju hokej u omladinskim selekcijama. ispitivanje ciljne grupe obavljeno je u Čikagu, u klubu Cube. Intervjuisani su roditelji tri selekcije: 11-12; 13-14; i 15-16 godina. Iz svake selekcije razgovarano je sa deset roditelja.. \r\nKroz intervjue smo identifikovali tri kategorije roditelja:\r\n1.	blago zainteresovani, oni prate dijete, opremu kupuju po preporuci trenera, bez nekih pretjeranih ambicija, od uređaja ne bi imali velika očekivanja\r\n2.	prate trendove, prate sve aktivnosti dijeteta, na umjerenom nivou ulažu u dodatne aktivnosti, od uređaja bi željeli najviše da dobije potrošnju kalorija, broj šuteva, broj dodavanja, oko opreme mnogo više sami istražuju\r\n3.	hokejaški manijaci, prate sve trendove, idu na sve dodatne aktivnosti, prate tržište hokejaške opreme. Najvažnija stavka bi im bila platforma za poređenje učinka djece. Od uređaja očekuju da podigne nivo igre njihovog djeteta.\r\nKao early adoptere vidimo treću grupu rodtelja.', NULL, NULL),
(3695, 28, 1635, 'Hockey Tracker predstavlja IoT sistem za praćenje pokreta jednog ili više hokejaških štapova u toku treninga ili igre. Sistem ce se sastojati od minijaturnih uređaja koji su ugrađeni u štapove i koji se baterijski napajaju i stacionarnih gejtvej uređaja koji se nalaze u blizini i pomoću kojih je moguće u realnom vremenu pratiti dešavanje na terenu. Na bazi pokreta štapa pratiće se ključni pokazatelji kao što su pređena distanca igrača, potrošene kalorije, tehnika, kontakt sa pakom, šutevi. Prikupljeni podaci omogućiće online i offline poređenja rezultata više igrača putem Hockey Tracker platforme što daje podsticajnu i socijalnu dimenziju ovom sportu.', NULL, NULL),
(3696, 30, 1635, 'Trenutno roditelji svoj “problem” rješavaju koristeći papir i olovku, a podatke o igri svog djeteta prikupljaju “golim okom”. Sa stanovišta statistike koju roditelji uprate tu je riječ o broju udaraca, postignutih golova i grubom pozicijom djeteta na terenu tokom utakmice. Ovaj način praćenja performansi djeteta nije precizan, ne omogućava praćenje analitike u dužem vremenskom periodu, ne omogućava praćenje napretka djeteta i sa druge strane fokus roditelja stavlja samo na tehničke aspekte igre, a ne na uživanje u utakmici. Ovdje govorimo o prikupljanju jednog tipa podataka i to tokom utakmice.\r\nPrikupljanje drugog tipa informacija kao što je pređena distanca i potrošene kalorije se prikupljaju korištenjem fitness tracker uređaja. Problem korištenja ovih uređaja jeste povećanje rizika od povrede te iz tog razloga korištenje ovih uređaja nema široku primjenu i ograničeno je na pojedince i to samo tokom treninga. Ovo ne omogućava kontinuitet u praćenju djeteta.', NULL, NULL),
(3697, 29, 1635, 'Tokom intervjua koje smo obavili roditelji su kao benefite isticali praćenje nivoa aktivnosti i produktivnosti djeteta tokom treninga i utakmica. \r\nNivo aktivnosti bi se ogledao u mjerenju potrošnje kalorija i pređene distance tokom treninga ili tokom utakmice.   \r\nMjerenje produktivnosti treba da obuhvati mjerenje koliko je vremena dijete imalo pak na štapu, koliko je imalo dodavanja, koliko šuteva na gol. \r\nGore navedeno ukazuje na podatke koje je potrebno prikupiti i obraditi. Sa druge strane očekivanja roditelja su usmjerena i na kontinuitet praćenja i mogućnost poređenja. To u suštini znači da roditelji očekuju da se podaci o učinku djeteta prikupljaju i tokom treninga i tokom utakmica, na svakodnevnoj osnovi, kako bi se mogao kvalitetno pratiti njihov napredak, uočavati potrebe za poboljšanjima i pravovremeno reagovati. Sa druge strane roditelji očekuju da učinak svog djeteta mogu porediti sa učinkom njegovih vršnjaka kako bi se dobila objektivna procjena kvaliteta igre dijeteta.', NULL, NULL),
(3698, 32, 1635, 'Slični uređaji postoje na tržištu. NHL liga je u sezoni 2021 uvela praćenje performansi igrača koristeći SMT sistem koji kombinuje senzore u pakovima, senzore ušivene u dresove igrača i kamere koje postoje u ledenim dvoranama. Jedan od ponuđača uređaja koji je najsličniji našem jeste Drive Hockey. Trenutno se nalaze u pilot fazi, a njihov sistem kombinuje senzore u štapu i paku.\r\nInovativnost našeg rješenja se ogleda u konceptu tj arhitekturi sistema, tehničkom rješenju i načinu obrade podataka:\r\n1. Koristiće se najnovije tehnologije prenosa po novim BLE 5.0-5.2 standardima, koje omogućavaju prenos podataka u realnom vremenu,\r\n2. Glavni senzori će biti inercijalni senzori a podaci sa tih senzora će se u realnom vremenu prenositi i obrađivati na Cloud instanci.\r\n3. Obrada podataka će biti zasnovana na algoritmima koji se zasnivaju na neuralnim mrežama. \r\n4. Inherentna povezanost svih entiteta će omogućiti trenutno poređenje rezultata i naknadne analize.', NULL, NULL),
(3699, 37, 1635, 'Istraživanje na temu zaštite intelektualne svojine nismo sprovodili. Inicijalni koncept proizvoda ukazuje na moguće postojanje elemenata za zaštitu intelektualnog vlasništva. Ukoliko se kroz razvoj proizvoda potvrdi pretpostavka da je za proizvod moguće izvršiti zaštitu intelektualne svojine ideja je da vlasnik intelektualne svojine bude novo uspostavljeno preduzeće.', NULL, NULL),
(3700, 40, 1635, 'Zarada je predviđena kroz prodaju proizvoda i pretplatu za korištenje platforme putem koje bi se vršilo praćenje performansi igrača. \r\nRoditelj za svoje dijete kupuje uređaj koji se montira na štap za hokej. Uređaj se može prenositi na druge štapove obzirom da je čest slučaj da dođe do lomljenja štapa. Svako dijete/igrač će imati svoj profil na platformi putem koje roditelji mogu vršiti praćenje performansi djeteta, njegovu statistiku, poziciju u odnosu na druge igrače njegovog uzrasta. Korištenje platforme bi bilo zasnovano na Freemium bazi gdje bi osnovni profil bio besplatan i omogućavao bi praćenje performansi djeteta bez poređenja sa drugom djecom, dok bi se premium opcija plaćala na mjesečnoj ili godišnjoj osnovi.', NULL, NULL),
(3701, 41, 1635, 'U prvoj fazi razvoja ideje bilo je potrebno provjeriti da li je moguće prikupljati bilo kakve informacije sa hokejaškog štapa te kroz razgovor sa potencijalnim klijentima utvrditi postojanje potrebe. Minimalna sredstva su uložena u nabavku Fitbit uređaja koji je rastavljen i senzori iz uređaja su zaljepljeni na hokejaški štap. Korištenjem je utvrđeno da se prikupljaju informacije o količini potrošenih kalorija i brzini igrača. Samim tim dokazano je da senzori na štapu mogu da prikupljaju podatke. Takođe, kroz intervjue sa roditeljima igrača u okviru Cube hokejaškog kluba identifikovana je potreba i želja roditelja djece od 11 do 12 godina da prate performanse svoje djece. Sa ovim početnim povratnim informacijama, i po pitanju tehnološke izvodivosti i tržišne potrebe, krećemo dalje u razvoj ideje, a naredna faza razvoja zahtjeva i određeni iznos finansijskih sredstava.', NULL, NULL),
(3702, 44, 1635, 'U periodu od 01. oktobra do 10. decembra Nenad Raković kao nosilac ideje je učestvovao u KATALIZATOR programu. U okviru KATALIZATOR programa Nenad je radio na razvoju poslovnog modela, Customer Development procesu, a rezultate rada kroz program imao je prilike predstaviti predstavnicima regionalnih investicionih fondova. Jedan od bitnih rezultata Nenadovog učešća na KATALIZATOR programu jeste i okupljanje tima koji će zajedno sa njim nastaviti da radi na daljem razvoju ideje.', NULL, NULL),
(3703, 45, 1635, 'Za ideju do sada nisu prikupljena sredstva za razvoj iz eksternih izvora.', NULL, NULL),
(3704, 48, 1635, 'Ključne aktivnosti koje slijede u daljem razvoju proizvoda možemo podjeliti u dvije grupe. Prva grupa aktivnosti vezana je za tehnički razvoj samog proizvoda dok je druga grupa usmjerena na biznis razvoj. Tehnički razvoj će biti fokusiran na razvoj prototipa i definisanje elemenata zaštite intelektualnog vlasništva. U ovom segmentu najveća podrška je potrebna u domenu zaštite IP-a gdje tim ima najmanje znanja, a obzirom da je tržišni fokus na USA i Kanadskom tržištu potrebno je profesionalno pristupiti ovom segmentu. \r\nSa biznis strane aktivnosti će biti usmjerene na finalizaciju Customer Development procesa kako bi se kroz komunikaciju sa ciljnom grupom jasno utvrdila očekivanja od datog proizvoda.  Takođe, radilo bi se na finalizaciji poslovnog modela i razvoju go to market strategije. Više je opcija koje vidimo kao moguće za izlazak na tržište (crowdfunding, partnerstvo, retail itd) te bi nam u ovom segmentu takođe bila potrebna pomoć za definisanje jasne strategije.', NULL, NULL),
(3705, 49, 1635, 'Trenutno nemamo preciznu sliku o potrebnim sredstvima. Ceo tim je spreman da nastavi rad bez nadoknade i da razvija ideju dalje.\r\nVidimo 2 procesa u kojima bi nam finansijska podrška značila:\r\nOprema i dodatna ekspertiza za razvoj i kreiranje samog proizvoda - kako bismo proizvod napravili, biće neophodno kreirati i testirati više različitih prototipa. Prototipi će pored dodatne opreme potencijalno zahtevati i usluge specijalizovanih stručnjaka (kreiranje algoritama, cloud tehnologije, BLE 5.0, …). Procena ovih troškova biće moguća posle kreiranja specifikacije za izradu prototipa.\r\nZaštita eventualne intelektualne svojine - Smatramo da će delove ovog proizvoda biti moguće patentirati i tako obezbediti komparativnu prednost na našem ciljanom tržištu.', NULL, NULL),
(3706, 52, 1635, NULL, NULL, NULL),
(3707, 66, 1638, NULL, NULL, NULL),
(3708, 76, 1639, NULL, NULL, NULL),
(3709, 83, 1641, NULL, NULL, NULL),
(3710, 89, 1642, 'Nenad je profesionalni hokejaš koji je nastupao za Crvenu Zvezdu, Partizan, Maribor, Melbourne kao i nacionalni tim Srbije. Po završetku karijere Nenad je bio generalni direktor hokejaškog kluba Partizan, a potom i direktor hokejaškog kluba Crvena Zvezda. Danas je Direktor Cube razvojnog programa u Čikagu. Nenad je dipomirani ekonomista.', NULL, NULL),
(3711, 90, 1642, 'Kretor ideje \r\nNenad je potpuno posvećen razvoju ideje i obzirom na iskustvo profesionalog hokejaša njegova uloga je ključna u domenu razvoja proizvoda, i kasnije u građenju partnerske mreže sa hokejaškim klubovima.', NULL, NULL),
(3712, 91, 1642, 'Direktor - Cube Development Program, Chicago', NULL, NULL),
(3713, 89, 1643, 'Nenad je Doktor nauka u oblasti elektrotehnike sa naučnim radovima na SCI listi iz domena neuralnih mreža, sonzorskih sistema, embeded sistema itd. Saradnik je Bitgear firme na razvoju različitih komercijalnih IoT projekata.', NULL, NULL),
(3714, 90, 1643, 'Razvoj proizvoda\r\nNenadova uloga se ogleda u tehničkom razvoju proizvoda, i u ovoj prvoj fazi fokus je na razvoju prototipa. \r\nNenad je djelimično posvećen razvoju ove ideje.', NULL, NULL),
(3715, 91, 1643, 'Full-Time\r\nProfesor na Elektrotehničkom fakultetu Univerziteta u Beogradu', NULL, NULL),
(3716, 89, 1644, 'Luka Prišunjak ima dugogodišnje iskustvo u startap svijetu i kao dio tima nekolicine startapa, a i kao mentor i podrška startap timovima. Specijalizovao se za Customer Development te u tom domenu pored rada sa startapima radi i sa nizom korporacija u identifikaciji stvarnih potreba klijenata.', NULL, NULL);
