(3717, 90, 1644, 'Customer Development\r\nU samom timu Lukina uloga se ogleda u daljem sprovođenju Customer Development procesa, definisanju persona, testiranju hipoteza i utvrđivanju potreba potencijalnih klijenata.\r\nTrenutno, Luka je djelimično posvećen razvoju ideje.', NULL, NULL),
(3718, 91, 1644, 'Full-Time\r\nEcosystem Facilitator - Swiss Entrepreneurship Program', NULL, NULL),
(3719, 89, 1645, 'Vladimir ima 15 godina iskustva u kreiranju i realizaciji različitih instrumenata podrške razvoju malih i srednjih preduzeća i startapa. Sedam godina je bio menadžer poslovnog inkubatora u Inovacionom centru Banja Luka. Zadnje četiri godine Vladimir je suvlasnik i direktor preduzeća Virtuo. Pored navedene uloge Vladimir kroz rad na Swiss Entrepreneurship Programu pomaže dalji razvoj startap ekosistema u Bosni i Hercegovini. Vladimir je diplomirani ekonomista.', NULL, NULL),
(3720, 90, 1645, 'Business Development\r\nVladimirova uloga u timu se ogleda u traženju prilika za razvoj proizvoda, partnera za razvoj, kao i identifikaciji potencijalnih investitora koji bi u ranoj fazi omogućili razvoj proizvoda.\r\nTrenutno, Vladimir je djelimično posvećen razvoju ideje.', NULL, NULL),
(3721, 91, 1645, 'Part-time\r\nEcosystem Facilitator - Swiss Entrepreneurship Program\r\nPart-time\r\nDirektor - Virtuo Banja Luka', NULL, NULL),
