(3724, 71, 1650, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3725, 63, 1651, '„Џигзи“ je ekoinovativno rešenje kako podstaći ljude da jedu najnutritivnuju namirnicu na svetu. \r\nNaša vizija „Џигзи“ proteinskog čipsa je da približimo svim generacijama benefite džigerice, u obliku koji svi vole da konzumiraju, bez njenog izrazitog ukusa. \r\nReceptura i senzorna svojstva „Џигзија“ su inovativni.', NULL, NULL),
(3726, 71, 1652, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3727, 17, 1653, '„Џигзи“ je ekoinovativno rešenje kako podstaći ljude da jedu najnutritivnuju namirnicu na svetu. \r\nNaša vizija „Џигзи“ proteinskog čipsa je da približimo svim generacijama benefite džigerice, u obliku koji svi vole da konzumiraju, bez njenog izrazitog ukusa. \r\nReceptura i senzorna svojstva „Џигзија“ su inovativni.', NULL, NULL),
