(3730, 24, 1653, 'Proteinski čips od džigerice - džigerica koji zapravo ima dobar ukus!', NULL, NULL),
(3731, 25, 1653, 'Pokušavamo da rešimo probleme nastale nepravilnom ishranom, anemiju i gojaznost kao i zdravlje kože, noktiju, kose, zglobova i imunološkog sistema.', NULL, NULL),
(3732, 26, 1653, 'Što se tiče geografske segmentacije naš proizvod ćemo lansirati na teritoriji Srbije, gde će nam ciljni kupci biti pivnice, vinarije, fine dining restorani, fitness centri, prodavnice zdrave hrane. Dok bi u naredne dve godine pod pretpostavkom rasta širili našu poslovnu mrežu ka maloprodajnim lancima u zemlji kao i potencijalan izvoz u zemlje regiona.', NULL, NULL),
(3733, 27, 1653, '1. Deca: mlade osobe do 18 godina, muški i ženski, deca u predškolskom uzrastu. Učenici osnovnih i srednjih škola. Žive u gradu sa roditeljima. Odlikuju ih specifična zdravstvena stanja poput anemije, slabog imuniteta, deficita mikro i makro nutrijenata itd. Krajni korisnici proizvoda su deca, a kupci roditelji, koji su ujedno ciljna grupa za komunikaciju. \r\n2. Rekreativni sportisti: Odrasli ljudi, od 18 do 60 godina, muški i ženski, zaposleni su, žve u gradu, samostalno ili sa porodicom. Sastavni deo načina života čine redovni treninzi u fitness centrima ili u otvorenom ambijentu. Vode računa o zdravlju i istražuju karakteristike zdrave ishrane.\r\n3. Osobe sa specifičnim zdravstvenim stanjima: Odrasli punoletni ljudi, muški i ženski, zaposleni su. žive u gradu, samostalno ili sa porodicom. Odlikuju ih specifična zdravstvena stanja poput anemije, slabog imuniteta, deficita mikro i makro nutrijenata, gojaznosti.', NULL, NULL),
(3734, 28, 1653, 'Niko se prilikom izbora hrane koju će konzumirati ne vodi samo njenom nutritivnom vrednošću. Nijedna hrana ne postaje svakodnevna hrana ako nema dobara senzorna svojstva. A jetra ih jednostavno nema. Kao rezultat toga, jetra nije često zastupljena na trpezi. Tu na scenu stupamo mi i pretvaramo juneću jetru u hrskavu i ukusnu za svakodnevnu konzumaciju kao užini, dodatak obroku ili kao kompletan obrok. „Џигзи“ predstavlja odličan spoj sirovina koje ljudi ne koriste u ishrani dovoljno i redovno, kao što su jetra i želatin.  Receptura i senzorna svojstva „Џигзија“ su inovativni.', NULL, NULL),
(3735, 30, 1653, 'Potencijalni kupci pokušavaju da reše probleme kao što su obrok posle treninga, gojaznost, anemija, jačanje imunskog sistema izbegavanjem konditorskih proizvoda, kupovinom niskokaloričnih proizvoda, zdrave hrane, suplemenata kao i proteinskih proizvoda.', NULL, NULL),
(3736, 29, 1653, '„Џигзи“ sadrži  vitamina A, vitamina B12 i bakra u količinama koje su nekoliko puta veće od preporučenog dnevnog unosa. Odličan je izvor riboflavina, folata, cinka i gvožđa. Predstavlja nutritivno bogat proizvod. Ako sudimo po nutrijentima koje sadrži jetra, „Џигзи“ je proizvod koji bi trebalo konzumirati svaki dan. Unos dovoljnih količina kvalitetnijih oblika minerala i vitamina koji se dobro apsorbuju, a kojih u dzigerici ima u izobilju, smanjuje žudnju za nezdravom hranom i podstiču gubitak težine jer će vaše telo bilo zadovoljno i neće mu biti potrebne grickalice. Gvožđe, vitamin B-12 i folna kiselina, kojih goveđa jetra ima u izobilju, neophodni su za izgradnju crvenih krvnih zrnaca i sprečavanju anemije. Goveđa džigerica sadrži prirodno i visoko bioraspoloživo hem gvožđe. Unos dovoljnih količina sastojaka prisutnih u džigerici poboljšava zdravlje vaše kože, noktiju, kose, zglobova i imunološkog sistema.', NULL, NULL),
(3737, 32, 1653, 'Naš proizvod predstavlja \'zdravu grickalicu\'.\r\nU odnosu na postojeća rešenja, upotrebili smo totalno nekonvencionalnu sirovinu - juneću džigericu.\r\nDžigerica i želatin su jestivi by-producti mesne industrije čime bi naš proizvod svrstali u kategoriju ekoinovativnih proizvoda.', NULL, NULL),
(3738, 37, 1653, 'Nalazimo se u saradnji sa advokatskom kancelarijom Božidar S. Kresojević iz Beograda. Potencijalnim prolaskom u fazu 2 pristupićemo sastavljanju prijave za zaštitu pronalaska. Dosadašnje delovanje u oblasti intelektualne svojine odnosilo se na savetovanje sa advokatom kao i upoznavanje celokupnog pravnog tima sa planom i programom “Džigzi” projekta.', NULL, NULL),
(3739, 40, 1653, 'Od prodaje proizvoda', NULL, NULL),
(3740, 41, 1653, 'Okupljeni smo oko razvoja ideje i proizvoda šest meseci. Imamo jasno definisane uloge u timu. Za to vreme uspeli smo da razvijemo MVP i privučemo prvu investiciju. Kompanija Adepto trade prepoznala je naš potencijal i stavila nam na raspolaganje svoj pogon gde ćemo proizvoditi naš proteinski čips. Pored pogona imamo i pomoć njihovih tehnologa u razvoju našeg MVP-ja.  Sa razvitkom MVP-ja uključili smo i advokatsku kancelariju Božidar S. Kresojević koja će nam pomoći u postupku zaštite intelektualne svojine. Takođe, pored proteinskog čipsa od džigerice, razvili smo proteinske čipseve od junećeg srca, možga, bubrega, belih bubrega koje planiramo da lansiramo posle džigzi čipsa.', NULL, NULL),
(3741, 44, 1653, 'Učešćem na takmičenju Ekotrofelija održanom u NTP Beograd, organizator je obezbedio mentorske radionice iz oblasti analize, strategije, implementacije, efekata, prezentovanja i deklarisanja proizvoda.', NULL, NULL),
