(3743, 48, 1653, 'Od programa Raising Starts očekujemo mentorsku i finansijsku podršku, kao i nova poznanstva koja će nam pomoći da bolje plasiramo proizvod.', NULL, NULL),
(3744, 49, 1653, 'Za razvoj prodajne mreže i marketing, operativni troškovi proizvodnje (gorivo, energenti, materijal, ambalaža, režijski troškovi proizvodnje), ulaganje u osnovna sredstva (pakerica za čips, komercijalno vozilo), troškovi zaštite intelektualne svojine (zaštita prava patenta), registrovanja firme u APR-u, kao i drugih potencijalnih pravnih troškova biće nam potrebno 15000 švajcarskih franaka.', NULL, NULL),
