(3797, 71, 1686, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(3798, 63, 1689, 'Inovacija je u  izradi softvera VAH. Zasniva se na algoritmima u programu  juniti (Unity) i služi kao pomoćno nastavno sredstvo u edukativne svrhe. Učenici pomoću softvera u virtuelnoj laboratoriji uče o procesima analitičke hemije. Cilj programa je da se kroz kreativan, interaktivan i zanimljiv način  predstavi hemija, i učenicima i profesorima.', NULL, NULL),
(3799, 71, 1690, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3800, 17, 1691, 'Inovacija je u  izradi softvera VAH. Zasniva se na algoritmima u programu  juniti (Unity) i služi kao pomoćno nastavno sredstvo u edukativne svrhe. Učenici pomoću softvera u virtuelnoj laboratoriji uče o procesima analitičke hemije. Cilj programa je da se kroz kreativan, interaktivan i zanimljiv način  predstavi hemija, i učenicima i profesorima.', NULL, NULL),
(3801, 22, 1691, 'Učestvovali smo na više takmičenja i ostvarili sjajne rezultate na istim. Imamo više godina iskustva u timskom radu i radu na samom projektu.', NULL, NULL),
(3802, 23, 1691, 'Rezultati koje smo ostvarili na takmičenjima su nam pokazatelj da želimo da unapredimo naš projekat i ostvarimo naše ciljeve', NULL, NULL),
(3803, 24, 1691, 'VAH - The new way of chemistry \r\nVAH - Novi put hemije', NULL, NULL),
(3804, 25, 1691, 'Iz bezbednosnih razloga, učenici su pasivni posmatrači hemijskih eksperimenata. Neke škole ne poseduju hemijske laboratorije i odgovarajuću opremu, tako da učenici nemaju priliku ni da posmatraju hemijske eksperimente. Naš softver ovo menja i njegova upotreba je da pomogne ljudima da budu interaktivniji i aktivniji u analitičkoj hemiji.  Kada ljudi razmišljaju o hemiji, prvo što im padne na pamet su eksperimenti i reakcije. Nažalost, većina njih nikada ne doživi te reakcije lično.\r\nNaš softver rešava ove probleme. Štedimo resurse (hemikalije, finansiranje) i omogućavamo učenicima da budu interaktivniji tokom časa. To je realno simulirana hemijska laboratorija koja verno prikazuje hemijske reakcije.  Naš softver je proaktivan – štedi vreme za pripremu eksperimenata, i štedi resurse  do 50-60% u poređenju sa pravom laboratorijom.', NULL, NULL),
(3805, 26, 1691, 'Veličinu tržišta čine osobe starosne dobi od 15-64 godina. Tržišni potencijal čine osobe starosne strukture od 15 do 34 godina što uključuje učenike srednjih škola i studente na teritoriji Srbije. Po našim proračunima  veličina tržišta je 4.827.288  od toga 1.420.193 čini tržišni potencijal, odnosno 33 %. Kapacitet tržišnog potencijala je visok obzirom na sadašnji trenutak i u konstantnom eksponencijalnom rastu. Na osnovu istraživanja koje je sproveo Republički zavod za statistiku Republike Srbije primećuje se porast korišćenja i posedovanja računara i interneta.\r\n\r\n*Izvor- Republički zavod za statistiku', NULL, NULL),
(3806, 27, 1691, 'Naši potencijalni kupci su sve škole na teritoriji Srbije - gimnazije, medicinske i hemijsko-prehrambene struke (198 privatnih i državnih škola ) koje u svom nastavnom planu i programu imaju predmet analitička hemija, 15 centara za promociju nauke, 6 regionalnih centra za talentovane učenike kao  i  medijske kuće na teritoriji Srbije. Na osnovu našeg istraživanja, učenici su izneli mišljenje da nastavni sadržaj iz hemije treba reformisati i približiti današnjim standardima učenja na interaktivan i zanimljiv način. Profesori smatraju da softver VAH može biti višestruko koristan za učenje hemije. Iz toga zaključujemo da naša inovacija ima veliki potencijal da promeni sadašnje standarde učenja analitičke hemije i samim tim doprinese celokupnom kvalitetu učenja.', NULL, NULL),
(3807, 28, 1691, 'Jedinica proizvoda je softver. On je kreiran u pokretaču  pod imenom \"Unity engine\". Unity engine koristi kombinaciju skripta koji su pisani u programskom jeziku C# i implementiraju se sa raznim fizičkim objektima samog pokretača. Ovo nam omogućuje da verodostojno razvijamo softver nalik realnoj hemijskoj laboratoriji. Kroz naš program možete kombinacijom različitih hemijskih reakcija da simulirate najrazličitije eksperimente. On se sastoji od dva seta epruveta sa leve i desne strane, svaka ima svoj broj, kombinacijom dva broja dovodimo do tačne reakcije, odnosno program pokazuje koja reakcija nastane spajanjem dve epruvete.', NULL, NULL),
(3808, 30, 1691, 'Prema našem sprovedenom istraživanju na aktuelnom tržištu postoji mnogo aplikacija koje pomažu učenicima u školskim zadacima, domaćim zadacima, učenju itd... Više od 40% tržišta su aplikacije koje su iz oblasti fizike, matematike i biologije. , i imaju jedinu svrhu zabave ili su zasnovani na kvizu. Na trenutnom tržištu ne postoje aplikacije u hemiji koje su u oblasti kvalitativne analitičke hemije, one su uglavnom u formi hemijskih formula ili prikazivanja periodnog sistema. Neka od sličnih rešenja su: “BEAKER - Mix Chemicals” , “Chemistry” , “Recloak: little chemistry alchemy 2” , itd...', NULL, NULL),
(3809, 29, 1691, 'Hemija je suštinska osnova za mnoge nauke, ali takođe omogućava razumevanje sveta oko nas.\r\nAnalitička hemija je disciplina hemije koja se bavi analizom različitih materijala radi dobijanja podataka o njihovoj strukturi i hemijskom sastavu.\r\nKvalitativna analitička hemija se bavi dokazivanjem katjona i anjona. Došli smo do zaključka da je ova oblast hemije najprilagodljivija za prenošenje u virtuelni svet. Proizvodi reakcija su vizuelno privlačni, a reakcije se lako pamte i autentično rekreiraju u našem softveru. Mi smo uvideli da trenutno ne postoje aplikacije koje se bave ovom oblašću hemije na ovaj način. Na ovaj način smo omogućili da veći broj ljudi ima pristup učenju analitičke hemije.', NULL, NULL),
(3810, 32, 1691, 'Naš je proizvod je prepoznat od strane različitih institucija kao Inovativan i značajan. Do sada nismo imali mogućnosti da ga plasiramo na tržište ali smo ga testirali u lokalnoj sredini (školama na teritoriji grada Niša). Uočili smo veliku potražnju za ovakvu vrstu softvera.', NULL, NULL),
(3811, 37, 1691, 'Razmatrali smo zaštitu inovativne ideje i došli do zaključka da su vlasnici intelektualne svojine Mentor Aleksandra Gošnjić i član tima Stefan Mitrović.', NULL, NULL),
(3812, 40, 1691, 'Godišnja cena našeg softvera za potencijalne kupce je 50.000 RSD (~500 USD, ~425 EUR), na osnovu svih utrošenih resursa i sati utrošenih na razvoj softvera. Softver se naplaćuje anuelno svake godine, po sistemu subskripcije. Cene za različite kategorije ciljnih kupaca mogu da variraju.', NULL, NULL),
(3813, 41, 1691, 'Trenutno stanje softvera, koji je razvijen jos od pocetka 2019. godine, je alpha verzija softvera na kojoj možemo testirati različite oglede i pratiti sam razvitak softvera kao i mogućnosti koje nam on donosi. Na samom početku našeg rada trudili smo se da napravimo softver određenog kvaliteta koji će biti zanimljiv i praktičan u isto vreme. Sa takvim elementima bi privukao kupce, ali nam je bio potreban dobar marketinški pristup. Naš sajt (vahcompany.net) donosi zanimljivu priču sa preciznim uputstvima za korišćenje našeg softvera. Svi koji su zainteresovani za analitičku hemiju moći će da kupe i preuzmu VAH softver. Trenutna faza softvera  je  sklop algoritama koji može da prikaže verodostojnu reakciju nalik realnoj sa dodatnim objašnjenjem i informacijama koji korisnik može koristiti u svom učenju.', NULL, NULL),
(3814, 44, 1691, 'Učešće na takmičenju za najbolju tehnološku inovaciju u Srbiji 2019/2020 godina.\r\nUčešće na medjunarodnom Eusair POPRI Youth takmičenju u inovaciji 2020/21 godina.', NULL, NULL),
(3815, 45, 1691, 'Novčana nagrada mentoru i učesnicima projekta od strane Ministartsva prosvete i tehnološkog razvoja u iznosu od 180.000 RSD. Novac je poslat kao nagrada za soptsvene svrhe na lične tekuće račune.', NULL, NULL),
(3816, 48, 1691, 'Od učešća u programu očekujemo nove smernice, mentorstvo i nova iskustva kao i dodatna sredstva za unapredjenje i realizovanje naše inovacije. Najpotrebnija podrška nam je u oblasti IT-ja i podrške u kanalima prodaje.', NULL, NULL),
(3817, 49, 1691, 'U trenutnoj fazi razvoja naša procena je negde u rangu od 6,000.00 do 8,000.00 EUR. Sva sredstva bi bila iskorišćena u sledećim oblastima: IT Sektor, Marketing, Kancelarijski troškovi, Website, Održavanje projekta, troškovi potrebnih eksperta u oblasti hemije.', NULL, NULL),
