(3844, 89, 1712, 'Diplomirao sam na Građevinskom fakultetu Univerziteta u Beogradu. Prvo radno iskustvo stičem u firmi INVENT 4YOU INŽENJERING d.o.o., gde sa radom počinjem u julu 2016. godine. Glavno poslovanje ove firme bila je izgradnja kuća i vila. Moja uloga u tome bila je izrada predmera i predračuna, pružanje tehničke podrške prilikom izgradnje i nadgledanje gradnje objekata. U decembru iste godine prihvatam priliku da učestvujem na državnom projektu izgradnje mosta Surčin - Obrenovac, koji izvodi kineska kompanija CCCC. Moja glavna zaduženja bila su izrada izvođačkog projekta, upravljanje tehničkom dokumentacijom i praćenje radova na gradilištu. Nakon toga, prelazim u firmu Mašinoprojekt Kopring, koja se bavi projektovanjem stambenih i industrijskih objekata. Učestvovao sam u projektovanju industrijskih objekata Prvog Partizana u Užicu i skladišnih objekata Ling Longa u Zrenjaninu. Što se tiče stambenih objekata, učestvovao sam na projektovanju objekta Voždovih kapija, faze IV od 17 etaža.', NULL, NULL),
