(3847, 89, 1713, 'Moje prvo radno iskustvo 2007. godine je formiranje logističke jedinice i procesa rada u tada novoosnovanoj jedinici Vojske Srbije. Nedugo zatim krećem da radim kao freelancer na projektima za domaće i strane klijente. Paralelno s tim radim i na Vojnoj akademiji kao asistent u nastavi na predmetima operaciona istraživanja i saobraćajni tokovi. Od prošle godine radim kako Head of HR u mojoj brigadi. Radio sam na formiranju online nastupa za preko 20 preduzetnika i firmi.', NULL, NULL),
