(3879, 63, 1728, 'ATU spada u limitiran broj Climatech Startup firmi osnovanih u Srbiji sa ciljem razvoja sistema inteligentnog upravljanja i nadzora termotehničkih instalacija, radi povećanja energetske efikasnosti i smanjenja emisije CO2.\r\nATU je razvio SMART algoritam i hardver koji koristeći najnovije senzore za merenje parametara komfora životne sredine intuitivno pronalazi optimalne operativne tačke celog sistema grejanja i klimatizacije u objektu, koristeći AI (Artificial Intelligence). ATU sistem ima mogućnost povezivanja na postojeće sisteme, putem svih popularnih protokola (Modbus, BacNET, WiFi).\r\nPreliminarni testovi pokazuju uvećanje efikasnosti postojećih sistema za 35%.', NULL, NULL),
(3880, 71, 1729, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3881, 17, 1730, 'ATU spada u limitiran broj Climatech Startup firmi osnovanih u Srbiji sa ciljem razvoja sistema inteligentnog upravljanja i nadzora termotehničkih instalacija, radi povećanja energetske efikasnosti i smanjenja emisije CO2.\r\nATU je razvio SMART algoritam i hardver koji koristeći najnovije senzore za merenje parametara komfora životne sredine intuitivno pronalazi optimalne operativne tačke celog sistema grejanja i klimatizacije u objektu, koristeći AI (Artificial Intelligence). ATU sistem ima mogućnost povezivanja na postojeće sisteme, putem svih popularnih protokola (Modbus, BacNET, WiFi).\r\nPreliminarni testovi pokazuju uvećanje efikasnosti postojećih sistema za 35%.', NULL, NULL),
(3882, 22, 1730, 'Vladimir Petrović i Mihailo Jović su zajedno sarađivali na sledećim projektima (poslovima):\r\n1. Razvoj sistema automatike za rashladne grede. Naručilac posla (projekta) je Dadanco Europe.\r\n2. Razvoj decentralizovanog sistema ventilacije AER. Naručilac je kompanija iz Kanade.', NULL, NULL),
(3883, 23, 1730, 'Želja da unesemo promene u postojeće i buduće trendove projektovanja i izvođenja komercijalnih i javnih objekata, a sa ciljem povećanja energetske efikasnosti i smanjenja emisije CO2.', NULL, NULL),
(3884, 24, 1730, 'Breathing new life into your Building!', NULL, NULL),
(3885, 25, 1730, 'Došli smo do saznanja globalnog problema kroz naše dugogodišnje iskustvo u komercijalnom grejanju i klimatizaciji na svim kontinentima. Ova naša industrija je jedna od najkonzervativnijih industrija i kao takva vapi za rešenjima ovog tipa. Testirali smo naš pristup na nekoliko klijenata koji su nam dali odlično mišljenje. Mi rešavamo problem optimizacije celokupnog sistema termotehničkih instalacija, a ne individualnih komponenti.', NULL, NULL),
(3886, 26, 1730, 'Pošto radimo po celom svetu, cilj nam je da promovišemo naše rešenje na globalnom nivou. Procenjena vrednost je $227 bn. Izvor informacija je dokument \"State of Climate Tech 2021: Scaling breakthroughs for net zero\"\r\n\r\nNaša orjentacija je ka Severnoj Americi.', NULL, NULL),
(3887, 27, 1730, 'Naši potencijalni kupci su vlasnici i korisici velikih zgrada. Mi smo u svakodnevnom kontaktu sa našim potencijalnim klijentima, kroz mnogobrojne projekte i ovaj projekat je rezultat našeg dugogodišnjeg angažovanja na ovom tržištu.', NULL, NULL),
(3888, 28, 1730, 'Mi razvijamo hardver (baziran na IoT) i softver (baziran an AI). Naš proizvod se bazira na Real data i sistem \"uči\" o navikama korisnika kao i karakteristike uređaja i kao takav se prilagođava rad uređaja prema očekivanjima korisnika.', NULL, NULL),
(3889, 30, 1730, 'Trenutno se koriste primitivni termostati, koji uključuju-isključuju rad uređaja i na taj način ne ostvaruju zahtevani komfor u prostoru.', NULL, NULL),
(3890, 29, 1730, 'Glavni benefiti su ušteda energije, smanjenje troškova i povećanje uslova ugodnosti u prostoru.', NULL, NULL),
(3891, 32, 1730, 'Naš uređaj je jedinsatven jer dosada nismo našli uređaj koji ostvaruje željene rezultate, gore navedene.', NULL, NULL),
(3892, 37, 1730, 'Radili smo inicijalni Patent Search i spremili smo se za podnošenje Provisional Patent-a.', NULL, NULL),
