(3919, 63, 1753, 'Производња и увођење великог броја сензора за праћење климатских параметара на великој територији. Коришћење статистичких података (влажност и температура ваздуха и земљишта, барометарски бритисак, UV индекс зрачења, смер и брзина ветра) у паметној пољопривреди, за спречавање шумских пожара, очувању угрожених биљних врста, научним истраживањима и др.', NULL, NULL),
(3920, 71, 1754, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3921, 17, 1755, 'Производња и увођење великог броја сензора за праћење климатских параметара на великој територији. Коришћење статистичких података (влажност и температура ваздуха и земљишта, барометарски бритисак, UV индекс зрачења, смер и брзина ветра) у паметној пољопривреди, за спречавање шумских пожара, очувању угрожених биљних врста, научним истраживањима и др.', NULL, NULL),
(3922, 22, 1755, 'Део тима (Ана и Душан) су заједнички радили у оквиру фирми ОРИОН ТЕЛЕКОМ и ЛУЦИДТЕЦХ ДОО', NULL, NULL),
(3923, 23, 1755, 'Могућност развоја, производње и продаје модерног али  једноставног производа који би имао веома широку примену. \r\nЖеља да се покрене фирма која би могла да донесе корист широј заједници, али и нама самима, као и повратак ИТ стручњака на село.\r\nСуше и пожари који су били претходних година су нас навели да тражимо решења за проблеме изазване глобалним загревањем и климатским променама.', NULL, NULL),
(3924, 24, 1755, 'МАЛЕ СТВАРИ КОЈЕ РЕШАВАЈУ ВЕЛИКЕ ПРОБЛЕМЕ', NULL, NULL),
(3925, 25, 1755, 'Модернизација и дигитализација пољопривредне производње. Решавамо проблем недостатка информација (температура и влажност ваздуха и земље, правац и снага ветра, УВ зрачење, атмосферски притисак)  неопходних у праћењу климатских промена и планирању пољопривредне производње.  Недоступност једноставних система за прикупљање мноштва информација са велике територије. Постоји глобални проблем шумских пожара подстакнут климатским променама.', NULL, NULL),
(3926, 26, 1755, 'Тржиште Паметне пољопривереде (Smart Agriculture) и научно-истраживачка, академска заједница као и општинске управе, институције и удружења ангажована у пројектима заштите животне средине, пољопривреде и метеорологије. За почетак тржиште Србије. У наредне 2 године земље у региону.', NULL, NULL),
(3927, 27, 1755, 'Потенцијални купци: Србија шуме и приватни власници шума. Велики пољопривредни комбинати и индивидуална пољопривредна домаћинства. Општине, комуналне и ватрогасне службе. Научни институти и факултети. Обавили разговоре у локалној средини. Постоји велика заинтересованост.\r\nОпштина Чајетина је увела дигитализацију у доста сегмената свога функционисања и има планове за даљу модернизацију тако да им је овакав пројекат добро дошао.\r\nПреко 70% становништва у општини Чајетина чине индивидуална пољопривредна домаћинства. И околне општине: Прибој, Нoва Варош, Пријепоље, Сјеница и др. имају сличну демографску структуру те представљају потенцијалне клијенте (малинари, боровничари, пчелари, воћари...)', NULL, NULL),
(3928, 28, 1755, 'Систем за предвиђање и дојаву пожара лоциран на неприступачни или тешко приступачним локацијама.\r\n- Систем Low power сензора (IoT) повезаних LoRaWAN протоколом и преко gateway-a са централним сервером и базом података. \r\n- Велики број података, информација представљају вредност саме по себи.\r\n- Апликација за приказ података', NULL, NULL),
(3929, 30, 1755, 'На српском и регионалном тржишту не постоји сличан систем у практичној примени.', NULL, NULL),
(3930, 29, 1755, 'Главни бенефити су прикупљање информација са много веће територије и много детаљнији подаци. Највећа предност је ефикасна заштита од ширења шумских пожара, како на веће шумске површине, тако и ка насељеним местима', NULL, NULL),
(3931, 32, 1755, 'Технологија Low Power, Long Range Radio, LoRaWAN као и разни типови сензора већ постоје на тржишту али нико их још није применио на овакав начин. За израду система за прикупљање микроклиматских информација са велике површине/територије, урмежавањем великог број сензора. Систем омогућава и анализу велике количине података (Big Data) развијањем и коришћењем вештачке интелигенције. Планирамо и да саме \"сензорске кутије\" имају иновативни дизајн и конструкцију.', NULL, NULL),
(3932, 37, 1755, 'Планирамо да заштитмо жиг и индустријски дизајн производа (embedded outdoor уређаја са сензорима). Евентуално и патент уколико се покаже могућим током фазе истраживања и прављења прототипа. Власници интелектуалне својине би били чланови тима или привредно друштво.', NULL, NULL),
(3933, 40, 1755, 'Продаја хардвера (сензора и базних станица/гејтвеја). Продаја и имплементација комплетних система за паметну пољопривреду и прикупљање климатских информација. Продаја прикупљених информација. Моделирање процеса на основу прикупљених података у складу са специфичним потребама купаца.', NULL, NULL),
(3934, 41, 1755, 'Од летошње суше и великих пожара, када смо решили да урадимо нешто по том питању. 4-5 месеци активно развијамо идеју. Завршили смо почетна истраживања. Завршили смо идејни пројекат.', NULL, NULL),
(3935, 44, 1755, 'Нисмо учествовали', NULL, NULL),
(3936, 45, 1755, 'Нисмо', NULL, NULL),
(3937, 48, 1755, 'Очекујемо да материјализујемо један одличан идејни пројекат, да кроз изградњу прототипа омогућимо његову широку примену, као и да учврстимо и евентуално проширимо тим који се показао као комплементаран и функционалан од самог почетка. Помоћ нам је неопходна у раној фази припреме и израде прототипа и његове продаје.', NULL, NULL),
(3938, 49, 1755, 'CHF 14.990,00\r\nЗа: \r\n- трошкове зарада и накнада CHF 5.000,00\r\n- трошкове у вези са истраживањем и прављењем прототипа CHF 6.950,00\r\n- трошкове маркетинга CHF 1.300,00\r\n- трошкове заштите Интелектуалне Својине CHF 800,00\r\n- остале трошкове CHF 940,00', NULL, NULL),
