(3963, 63, 1772, 'Projektni tim je sačinjen četiri osobe različitih obrazovnih profila koji sarađuju na razvoju eCommerca projekata u Srbiji i regionu Jugoistočne Evrope. Ono što karakteriše ovaj tim jeste da predstavljaju sinergiju isksutva i znanja sa jedne strane i mladosti i ideja sa druge strane. Projekat nastaje kao ideja Programskog direktora Igora Vujović Nađa da na globalnom nivou ponudi nova rešenja u turizmu, spajajući travel i ecommerce industriju u “TravelShopFly” projektu. Snagu ovog tima čini to što pored Programskog direktora koji ima ogromno isksutvo u Travel i eCommerce industriji, svaki član tima ima isksutvo i rezultate iza sebe u oblasti za koju je zadužen na projektu.\r\nUsled ekonomske krize uzrokovane COVID 19, turizam je pretrpeo ogromne gubitke. Na osnovu podataka dostupnih na sajtu UNWTO (United Nations World Tourist Organisation), nivo turizma je opao za 70% u odnosu na 2019. Godinu. Samo u USA, na osnovu podataka koje daje US Travel Association, oko 4,5 miliona radnika koji su radili u travel industriji je ostalo bez posla i sada može raditi od kuće.  U isto vreme eCommerce industrija beleži ogroman rast. Samo kroz rad dropshippera (marketinških posrednika u prodaji) oko 1 trilion USD je u 2020. Godini prihodovano u eCommerc industriji.  Karakteristično za obe ove grupe je da rade od kuće, što je tokom COVID 19 velika prednost. Ono što UNWTO navodi je da je jedno od ključnih pitanja za povratak turizma na nivo od 2019. godine, zapravo povratak poveranja putnicima. \r\nTravelShopFly vidi rešenja problema u tome što će svojim koriscnima širom sveta koji se služe engleskim jezikom, ponuditi software sa kojim od kuće mogu raditi i prodavati turističke aranžmane, rezervacije smeštaja, rezervacije avio karata i travel asesoare. Na taj način vidimo da rešavamo problem onih koji su ostali nezaposleni iz travel industrije, a takođe i vraća se poverenje putnicima kroz neposredan kontakt i veću ponudu usluga i proizvoda iz oblasti travel industrije. \r\nTravelShopFly projekat želi da kroz kreiranje b2b (business to business) softvera za ecommerce (SaaS) ponudi korisnicima inovativno i jednostavno rešenje u prodaji usluga turističkih aranžmana, rezervacije smeštaja, rezervacije avio karata i prodaje turističkih asesoara. \r\nTravelShopFly je subscription based ecommerce i kao takva ostvaruje prihode pretplate svojih korisnika. Pored toga, projekat prepoznaje šansu za ostvarivanje Prihoda kroz naplatu procenta od prodaje svojih korisnika. \r\nProjektni tim vidi trenutnu situaciju u travel industriji, uzrokovanu COVID 19 kao idealnu šansu za pokretanje ovog projekta. Vizija celokupnog tima je da ovaj projekat postane globalni travel brend, prepoznatljiv po kvalitetu i jednostavnom korišćenju. Da bi do toga došlo,  Projektni tim želi da predano radi na svom projektu i da najdalje u trećoj godini razvoja projekta kroz investiciju u vidu Venture capital / Equity capital značajno se dodatno približi tome.', NULL, NULL),
(3964, 71, 1773, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(3965, 17, 1774, 'Projektni tim je sačinjen četiri osobe različitih obrazovnih profila koji sarađuju na razvoju eCommerca projekata u Srbiji i regionu Jugoistočne Evrope. Ono što karakteriše ovaj tim jeste da predstavljaju sinergiju isksutva i znanja sa jedne strane i mladosti i ideja sa druge strane. Projekat nastaje kao ideja Programskog direktora Igora Vujović Nađa da na globalnom nivou ponudi nova rešenja u turizmu, spajajući travel i ecommerce industriju u “TravelShopFly” projektu. Snagu ovog tima čini to što pored Programskog direktora koji ima ogromno isksutvo u Travel i eCommerce industriji, svaki član tima ima isksutvo i rezultate iza sebe u oblasti za koju je zadužen na projektu.\r\nUsled ekonomske krize uzrokovane COVID 19, turizam je pretrpeo ogromne gubitke. Na osnovu podataka dostupnih na sajtu UNWTO (United Nations World Tourist Organisation), nivo turizma je opao za 70% u odnosu na 2019. Godinu. Samo u USA, na osnovu podataka koje daje US Travel Association, oko 4,5 miliona radnika koji su radili u travel industriji je ostalo bez posla i sada može raditi od kuće.  U isto vreme eCommerce industrija beleži ogroman rast. Samo kroz rad dropshippera (marketinških posrednika u prodaji) oko 1 trilion USD je u 2020. Godini prihodovano u eCommerc industriji.  Karakteristično za obe ove grupe je da rade od kuće, što je tokom COVID 19 velika prednost. Ono što UNWTO navodi je da je jedno od ključnih pitanja za povratak turizma na nivo od 2019. godine, zapravo povratak poveranja putnicima. \r\nTravelShopFly vidi rešenja problema u tome što će svojim koriscnima širom sveta koji se služe engleskim jezikom, ponuditi software sa kojim od kuće mogu raditi i prodavati turističke aranžmane, rezervacije smeštaja, rezervacije avio karata i travel asesoare. Na taj način vidimo da rešavamo problem onih koji su ostali nezaposleni iz travel industrije, a takođe i vraća se poverenje putnicima kroz neposredan kontakt i veću ponudu usluga i proizvoda iz oblasti travel industrije. \r\nTravelShopFly projekat želi da kroz kreiranje b2b (business to business) softvera za ecommerce (SaaS) ponudi korisnicima inovativno i jednostavno rešenje u prodaji usluga turističkih aranžmana, rezervacije smeštaja, rezervacije avio karata i prodaje turističkih asesoara. \r\nTravelShopFly je subscription based ecommerce i kao takva ostvaruje prihode pretplate svojih korisnika. Pored toga, projekat prepoznaje šansu za ostvarivanje Prihoda kroz naplatu procenta od prodaje svojih korisnika. \r\nProjektni tim vidi trenutnu situaciju u travel industriji, uzrokovanu COVID 19 kao idealnu šansu za pokretanje ovog projekta. Vizija celokupnog tima je da ovaj projekat postane globalni travel brend, prepoznatljiv po kvalitetu i jednostavnom korišćenju. Da bi do toga došlo,  Projektni tim želi da predano radi na svom projektu i da najdalje u trećoj godini razvoja projekta kroz investiciju u vidu Venture capital / Equity capital značajno se dodatno približi tome.', NULL, NULL),
(3966, 22, 1774, 'Projektni tim sarađuje na projektu razvoja eCommerca u Srbiji i regionu. Marko Jevtić, Igor Vujović Nađ i Borivoje Matić kroz kompaniju eCommerce Solutions doo svakodnevno sarađuju. Saradnja je započeta septembra meseca 2020. Godine od kada celokupan biznis beleži ogroman rast kao i širenje u regionu. Web shopovi iz meseca u mesec beleže porast u prodaji. Takođe, otvorena je poslovnica u Crnoj Gori i Severnoj Makedoniji. Prema pripremljenom biznis planu, u drugom kvartalu naredne, 2022. Godine očekuje se otvaranje i poslovnica u susednim zemljama koje su članice EU – pre svega u Rumunii. Saradnja sa Anđelinom Nikolić prisutna je na razvoju još jednog startapa, koji treba početi sa implementacijom tokom naredne godine.', NULL, NULL),
(3967, 23, 1774, 'Motivacija za prijavu za program Raising Starts projektni tim vidi u tome da kroz saradnju sa pomenutim fondom može se dobiti strateška pomoć u edukaciji i obuci tima kao i novčana sredstva za razvoj MVP – a. Strateški pravac kojim se projektni tim vodi jeste da nakon razvoja MVP – a predstavi projekat Venture capital fondovima i da kroz ustupanja dela vlasništva dobije sredstva potrebna za potpuni razvoj aplikacije. Na tom putu, vidimo Raising Starts kao prvu stanicu koja može biti “turning point” u razvoju samog TravelShopFly projekta. Stoga, smatramo da bismo kroz saradnja sa Raising starts projektom pored edukacije i sredstava za razvoj MVP – a dobili i veoma dobru referencu na osnovu koje možemo pregovarati sa budućim investitorima.', NULL, NULL),
(3968, 24, 1774, 'Connecting Tourism & eCommerce (Povezujemo Turizam i eTrgovinu)', NULL, NULL),
(3969, 25, 1774, 'Usled ekonomske krize uzrokovane COVID 19 epidemijom, jedna od grana koja ja najviše ugrožena jeste turizam, kao i ono što prati svaki turizam a to su ugostiteljstvo i saobraćaj. Na osnovu podataka UNWTO (United Nations World Tourist Organisation) podaci su da je u 2020. godini, nivou turizma pao za 70% u odnosu na 2019. Samo u prvih 10 meseci 2020. godine, zabeleženo je 900 miliona manje turista kao i gubitak od 935 milijardi dolara u odnosu na 2019. godinu.  Zaključak je ove organizacije da se celokupan turizam vratio u 2020. na nivo koji je bio u 1990. godini.  Takođe, u 2020. godini usled Covid 19 virusa, samo u USA je 4,5 miliona ljudi zaposlenih u travel sektoru dobilo otkaz, podatak je US Travel Association. \r\nNa osnovu globalnog istraživanja UNWTO i Panela stručnjaka iz oblasti turizma, očekivanja su da će se turizam vratiti na nivou iz 2019. tokom 2023. godine.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(3970, 26, 1774, 'Projekat TravelShopFly od samog starta napada globalno tržište, kroz upotrebu engleskog jezika oslanjajući se na činjenicu (izvor: berlitz.com) da se 1,132 milijardi ljudi služi engleskim jezikom. Tržište eCommerca na osnovu istraživanja prestižnog portala za istraživanje i analize www.statista.com ukupna prodaja u 2021. iznosiće oko 3,89 triliona USD. Od celokupnog iznosa, dropshipperi ostvaruju 27%, odnosno 1 trilion USD. Predviđanja Statista su da će ukupni prihodi od eCommerca rasti tako da dostižu 2022. godine 5,5 triliona USD, 2023. 5,9 triliona USD i 2024. 6,4 triliona USD ukupnog prometa.\r\nTakođe, predviđanja su da će 2023. godine turizam biti na nivou koji je bio 2019. odnosno na nivou od 2.9 triliona USD. Primarno tržište na koje se projekat oslanja jeste turizam i povezivanje turizma i eCommerca i projektni tim iskreno veruje da ovaj projekat ima implikacije da bude spona u korišćenju eCommerca u razvoju i oparavku turizma.', NULL, NULL),
(3971, 27, 1774, 'Primarna ciljna grupa dropshipperi. Ostvaruju 27% prometa od ukupnog prometa eCommerce - a, odnosno 1 trilion USD. To su uglavnom osobe 25 – 34 godina koje karakteriše da sjajno koriste internet i imaju vrhunsko znanje engleskog jezika. Projektni tim je sproveo anonimnu anketu putem Facebook grupa dropshippera (945 učesnika): \r\n1.	87% je odgovorilo da nije razmišljalo do sada o spajanju travel i eCommerce industrije;\r\n2.	98% je odgovorilo da smatraju da će broj dropshippera iz godine u godinu rasti;  \r\n3.	Na pitanja da li bi se bavili dropshippingom u turizmu 89% je odgovorilo sa DA, 5% sa MOŽDA a 6% sa NE. \r\nZaključak ankete jeste da će broj dropshippera rasti iz godinu u godinu kao i da je ova oblast veoma interesantna velikoj većini, te stoga projektni tim smatra ovo istraživanje kao ogroman potencijal za dobijanje krajnjih korisnika. \r\nSekundarna ciljna grupa jesu svi radnici iz oblasti turizma koji su ostali bez posla tokom Covid – 19a tercijalna turističke agencije.', NULL, NULL),
(3972, 28, 1774, 'TravelShopFly kroz kreiranje ecommerce b2b softvera (SaaS, sofwtare as a service) nudi korisnicima jednostavno, inovativno i tržišni povoljno rešenje u prodaji usluga turističkih aranžmana, rezervacije smeštaja, rezervacije avio karata i prodaje turističkih asesoara. \r\nTravelShopFly konkurentne prednosti: \r\n1.	Mogućnost etrgovine i prodaje usluga turističkih aranžmana, rezervacije smeštaja, avio karata kao i prodaje turističkih asesoara. \r\n2.	Širok dijapazon alata i usluga koji pomažu korisnicima da kvalitetnije kreiraju svoj brend. \r\n3.	TravelShopFly omogućava povezanost sa IOS i Android aplikacijom kao i društvenim mrežama (Facebook, Instagram, Twitter, TikTok, Youtube).', NULL, NULL),
(3973, 30, 1774, 'Najveća eCommerce platforma koja se bavi prodajom proizvoda jeste Shopify (www.shopify.com). U prethodnoj godini ostvarila je prihod od oko 2.92 milijarde USD. Zvanična informacija koja se nalazi na sajtu ove kompanije je da ona ima oko 1 milion korisnika. Glavni rival na tržištu je Wix koji je u prethodnoj godini zabeležio prihod od 988.8 miliona USD, međutim beleži oko 4.2 miliona korisnika koji plaćaju usluge.  \r\nTržište eCommerca iznosi oko 4,28 triliona USD, pri tome je udeo dropshippera u tome 27%, pa dolazimo do 1,156 triliona  USD godišnjeg prometa koji su dropshipperi napravili. Udeo Shopify – a u ukupnom prometu je 0.26%, a udeo Wix – a je oko 0.1%. \r\nPrednost TravelShopFly u odnosu na navedeno je to što nudi korisnicima mogućnost prodaje usluga iz oblasti turizma odnosno prodajom turističkih aranžmana, rezervacija smeštaja i avio karata kao i prodajom turističkih asesoara. To je ono što nas razlikuje od platformi koje korisnicima nude samo prodaju robe.', NULL, NULL),
(3974, 29, 1774, 'TravelShopFly software www.travelshopfly.com predstavlja jedinstvenu trgovinsku platformu za etrgovinu  koja omogućava da započnete, rastete i vodite svoj biznis u oblasti turizma. Software omogućava da: \r\n1.	Napravite i prilagodite Internet prodavnicu; \r\n2.	Prodajete na više mesta, uključujući veb, mobilne uređaje, društvene mreže, i drugo;\r\n3.	Odaberete usluge i proizvode koje želite da prodajete; \r\n4.	Upravljate plaćanjima.\r\nJedinstvenost software - a je u tome da pruža mogućnost trgovine uslugama kroz rezervacije: turističkih aranžmana, smeštaja i avio karata i turističkih aksesoara.  Uz pomenuto, predviđa i razvoj shopa, u okviru kojeg se mogu prodavati proizvodi vezani za turizam. Na taj način dajemo mogućnost korisnicima širom sveta da kroz zaradu u vidu affiliate programa, koristeći moderne marketinške instrumente promovišu turističke destinacije, kruzere, avio saobraćaj, ugostiteljske objekte i proizvode vezane za turizam.', NULL, NULL),
(3975, 32, 1774, 'Projektni tim smatra da je projekat TravelShopFly apsolutno nov na tržištu zato što ne postoji niti jedna ecommerce b2b platforma koja nudi mogućnost etrgovine uslugama turističkih aranžmana, rezervacije smeštaja, rezervacije avio karata i prodaje turističkih asesoara. Treba napraviti razliku, Booking i slične platforme za rezervaciju nisu nama konkurenti. TravelShopFly paltforma zamišljena je kao takva da da mogućnost korisniku da napravi svoju platformu, dobije sve alate za trgovinu uslugama turističkih aranžmana, rezervacije avio karata, rezervacije smeštaja kao i trgovinu turističkih aksesoara. Tako da, aplikacija kao što je Booking je samo jedan segment TravelShopFly softvera koji projektni tim razvija.', NULL, NULL),
(3976, 37, 1774, 'Projektni tim napravio je istraživanje povodom zaštite logotipa na globalnom nivou. Tom prilikom pretražen je website WIPO Global Brand database (World intellectual property organization) koja ima oko 50 miliona zaštićenih logotipa i dugoročna strategija je da se logotip zaštiti na globalnom nivou.', NULL, NULL),
(3977, 40, 1774, '1.	Subsckripcija svojih usluga koje pruža \r\nTravelShopFly softver pruža korisnicima mogućnost da koriste cloud SaaS rešenja kroz pretplatu. Svaki korisnik moći će da napravi svoj web shop i besplatno koristi 14 dana. Takođe, projekat planira tri različita nivoa pretplate: Basic (14$ mesečno), TSF (59$ mesečno) i VIP (149$);  \r\n2.	Procenat od svake prodaje bez fiksnog dela\r\nU zavisnosti od paketa koji korisnik odabere obračunava se i procenat od svake prodaje. Konkretno, za paket Basic 2.4%, TSF je 1.9% i Advanced 1%. Takođe, inovacija u ponudi koju TravelShopFly nudi svojim klijentima je da jednokratnom uplatom od 5.999$ mogu u okviru paketa koji imaju mogu biti oslobođeni godinu dana plaćanja procenta od prodaje.', NULL, NULL),
(3978, 41, 1774, 'Projekat “TravelShopFly” do sada je realizovao nekoliko pripremnih faza koje obuhvataju sledeće: \r\n1.	 Formiranje projektnog tima – core menadžmenta\r\nOkupljen tim koji poseduje projektnog menadžera, tehničko lice, programskog direktora i marketinškog direktora. \r\n2.	 Izrada idejnog rešenja i biznis plana\r\nProjektni tim je izradio idejno rešenje samog projekta a pritom krenuo sa mini brendiranjem kroz izradu logoa i zakupa internet domena www.travelshopfly.com; \r\n3.	 Obezbeđivanje sufinansiranja \r\nProjektni ističe da je obezbedio sufinansiranje projekta u iznosu od 5.000 EUR.\r\n4.	Anketiranje krajnjih korisnika – dropshippera\r\nSprovedena anketa među 945 dropshippera putem facebook grupa. Anketa pomogla da se učvrsti stav da postoji ogromna zainteresovanost primarnih krajnjih korisnika za sam projekat.', NULL, NULL),
(3979, 44, 1774, 'Projektni tim je aplicirao za sredstva kod Fonda za inovacionu delatnost ali projekat nije odobren.', NULL, NULL),
(3980, 45, 1774, 'Projektni tim je obezbedio sufinansiranje projekta od strane USA Global Investmenta, kompanije koja želi da sufinansira projekat u iznosu od 5.000 CHF ukoliko projekat bude odobren.', NULL, NULL),
(3981, 48, 1774, 'Očekivanja od učešća u Raising Starts programu jesu da Projektni tim dobije kvalitetnu edukaciju u oblasti razvoj biznisa kao i kasniju edukaciju u pristupu investicijama i održivosti samog biznisa. Takođe, kroz finansijska sredstva želimo da razvijemo MVP samog projekta a smatramo da će nam učešće u Raising Starts program poslužiti kao sjajna referenca za dalje pregovore sa investitorima. Najpotrebnija podrška nam je u segmentu edukacije za privlačenje investitora kao i u finansijskom aspektu za sam razvoj MVP – a.', NULL, NULL),
(3982, 49, 1774, 'Projektni tim aplicira za iznos od 10.000 CHF što smatramo da je minimum neophodno da se dođe do MVP (Minimum Viable Product) a da uz dodatnih 5.000 EUR obezbedimo finansiranje jedne osobe koja bi direktno radila na projektu. Ostali članovi tima, na projektu će raditi volonterski, bez naknade, u ovoj fazi projekta. Najveći deo budžeta, se odnosni na naknadu senior developerima (progamerima), kao i troškove marketinga. Ostatak budžeta iskoristili bismo za nabavku opreme i alata za razvoj (laptopovi, hosting). Smatramo da je MVP ključan u ovom trenutku, da bi se razvojem MVP – a došlo do faze projekta kada se može izaći pred investitore i tražiti “Venture capital”, sredstva za dalji razvoj u zamenu za ustupanje manjinskog procenta vlasničkih udela.', NULL, NULL),
