(3986, 83, 1780, NULL, NULL, NULL),
(3987, 89, 1781, 'Borivoje je preduzetnik koji iako ima 30 godina poseduje više od 10 godina preduzetničkog iskustva. Borivoje je sertifikovani projektni menadžer Univerziteta u kaliforniji. Poseduje iskustvo u vođenju domaćih i međunarodnih timova na različitim projektima. U sferi eCommerca, Borivoje je osnivač internet prodavnice Dabone u Švajcarskoj, kao i direktor razvoja kompanije “eCommerce Solutions doo”, kompanije koja ima 8 internet prodavnica u Srbiji I  egion.', NULL, NULL),
(3988, 90, 1781, 'Borivoje kao CEO projekta je potpuno posvećen razvoju ove ideje od pre seed faze do realizacije same vizije projekta a to je TravelShopFly postane liderska b2b platforma za prodaju usluga turističkih aranžmana, rezervacije smeštaja, rezervacije avio karata i prodaje turističkih aksesoara.', NULL, NULL),
(3989, 91, 1781, 'Preduzetnik, zaposlen u kompaniji “eCommerce Solutions doo” i apsolvent Pravnog fakulteta Univerziteta u Beogradu. Želi da se dodatno angažuje na ovom projektu i maksimalno se fokusira na projekat TravelShopFly zbog ogromne razvojne šanse koju vidu u ovom projektu.', NULL, NULL),
(3990, 89, 1782, 'Anđelina je osnovne studije završila na Ekonomskom fakultetu Univerziteta u Beogradu a potom je stekla zvanje Mastera menadžmenta. Poseduje ogromno iskustvo u oblasti eCommerc – a kroz saradnju sa preko 150 influensera u kompaniji “The Otaku box”', NULL, NULL),
(3991, 90, 1782, 'Anđelina je u većoj meri posvećena razvoja TravelShopFly projekta. Njena uloga, CMO (direktorka marketinga), jeste da iskomunicira poruku koju tim želi da prenese krajnjim korisnicima – dropshipperima i kreira marketing strategiju kako bi se najefikasnije pristupilo krajnjim korisnicima.', NULL, NULL),
(3992, 91, 1782, 'Anđelina je zaposlena u kompaniji “The Otaku box”, želi da stavi svoje vreme na raspolaganje projektu I dugoročno radi na razvoju samog TravelShopFly projekta.', NULL, NULL),
(3993, 89, 1783, 'Najstariji tima sa višedecenijskim preduzetničkim iskustvom. Igor je idejni tvorac i suvlasnik kompanije “Fly Fly Travel” I tokom 2018. Godine dobija nagradu za jednog od 10 najboljih preduzetnika u Republici Srbiji od prestižne kompanije “Ernst & Young”. Pored toga, Igor je partner u kompaniji “eCommerce Solutions doo”, sa kojom razvija nekoliko startap projekata u domenu eCommerca u Srbiji, Crnoj Gori I Makedoniji.', NULL, NULL),
(3994, 90, 1783, 'Igor je potpuno posvećen razvoju ovog projekta. Kroz svoje višedecijsko preduzetničko iskustvo u turizmu i drugim oblastima, Igor je došao na ideju stvaranja softvera TravelShopFly. Želi da svoje iskustvo i znanje iz međunarodnog turizma koje poseduje iz kompanije FlyFly Travel i sadašnje znanje iz eCommerca stavi na raspolaganje timu koji se okupio sa idejom razvoja TravelShopFly softvera.', NULL, NULL),
(3995, 91, 1783, 'Jedan od projekata na kojima Igor radi je eCommerce Solutions, gde kao partner razvija internet prodavnice u zemlji i regionu. Želi da aktivno učestvuje u razvoju startapa TravelShopFly.', NULL, NULL),
(3996, 89, 1784, 'Diplomirani IT inženjer fakulteta za informatiku Univerziteta Singidunum sa prosečnom ocenom 9.5. Stipendista Univerziteta Singidunum. Od juna 2020 godine, Marko je zaposlen u kompaniji “eCommerce Solutions doo” na poziciji tehničkog direktora i na tom mestu unapređuje svoja znanja i veštine iz oblasti eCommerce – a.', NULL, NULL),
(3997, 90, 1784, 'Marko je u većoj meri posvećen, njegova uloga, kao CTO (tehnički direktor) jeste da brine o softverskom aspektu i samom tehničkom razvoju platforme. Takođe, nakon samog razvoja, Marko će brinuti o održavanju i stalno tehničkom  razvoju platforme.', NULL, NULL),
(3998, 91, 1784, 'Marko obavlja funkciju CTO u kompaniji “eCommerce Solutions doo” i želi da svoje znanje i veštine iz oblasti IT – a da na raspolaganje za razvoj projekta TravelShopFly.', NULL, NULL),
