(4009, 91, 1793, 'Student master akademskih studija na Građevinsko-arhitektonskom fakultetu, Univerzitet u Nišu angažovanje nekoliko puta nedeljno, freelence projektant', NULL, NULL),
(4010, 89, 1794, 'Master inženjer elektrotehnike i računarstva za upravljanje sistemima,\r\n2018. Asistent na projektu: Blockchain-based diaspora remittances project\r\nUNDP, Srbija\r\n2018. Polaznik na programu ,,Start Up Academy 1.0.1” održanog u Deli prostoru u Nišu sprovedeno od strane ,,GIZ”,\r\nNemačka saradnja – Deutsche Zusammenarbeit, zajedno sa Nicat cluster-om. Predavač Ivan Vasić.\r\n2017. Tim lider na takmičenju IF4TM 2017 (Institutional framework for development of the third mission of universities in\r\nSerbia), poslovna ideja sa nazivom TRIS (3S) centar. Rezultat: treće mesto u lokalnoj rundi takmičenja. (Ideja je bila da imamo\r\ndostavljače koji biciklama dostavljaju narudžbine klijentima, tada nije bilo sličnih realizovanih kompanija na našem tržištu.)', NULL, NULL),
