(4013, 71, 1799, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4014, 63, 1800, 'The Social Formula je softver i aplikacija koja će napraviti revoluciju u digitalnom marketingu. Trenutno obimna kolicina podataka koja se dobija sa društvenih mreža, onlajn platformi i sajtova, biće procesovane kroz nas softver. Koristeći AI - vestačku inteligenciju, naš app daće korisniku konretne rezultate i savete za sledeće korake, na zahtev, specijalno kreirane za njih i njihov biznis.', NULL, NULL),
(4015, 71, 1801, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4016, 17, 1802, 'The Social Formula je softver i aplikacija koja će napraviti revoluciju u digitalnom marketingu. Trenutno obimna kolicina podataka koja se dobija sa društvenih mreža, onlajn platformi i sajtova, biće procesovane kroz nas softver. Koristeći AI - vestačku inteligenciju, naš app daće korisniku konretne rezultate i savete za sledeće korake, na zahtev, specijalno kreirane za njih i njihov biznis.', NULL, NULL),
(4017, 22, 1802, 'Da, već dve godine saradjujemo svakodnevno. Prvo na projektima za klijente The Social Formula agencije poput www.conversis.de i nouvellune.com\r\nDržanje u okviru rokova, zajednički rad i svakodnevna komunikacija razvili su kod nas međusobno poverenje i poštovanje.', NULL, NULL),
(4018, 23, 1802, 'Kao članovi NTP-a Beograd, upoznati smo i oduševljeni time šta celokupan ekosistem NTP-a, mentori i administracija mogu da pruže kroz program poput Rising Starts. Želimo da budemo maksimalno aktivni i iskoristimo sve resurse koji nam mogu pomoći u ostvarenju naše ideje i lansiranja proizvoda na tržište. Rising Starts vidimo kao podršku i kao odličnu potporu za naše dalje napredovanje, kako kroz dobro osmišljen program i mentorstvo, tako i kroz finansije.\r\nFinansijska pomoć bi nam pomogla u isplati plata i administrativnih troskova, u cilju da završimo do jeseni sledeće godine i ponudimo proizvod Telekomu Srbije, od kojih imamo potpisano “Pismo o namerama”. Takodje sve validacije koje smo dobili za naš proizvod, od klijenata i vodećih investitora nas motivišu da što pre testiramo proizvod.', NULL, NULL),
(4019, 24, 1802, 'The Social Formula to make your life easier.', NULL, NULL),
(4020, 25, 1802, 'Radeći u industriji digitalnog marketinga , susreli smo se sa problemom koji je rastući u našoj industriji: previse podataka u izvestajima i analiza istih. Trenutno firme koriste do 15 platformi. Mesečni izveštaji sa svake platforme se moraju prikupiti, analizirati, uporediti i izvući smisleni zaključci za prezentovanje i predlozi za dalje poslovanje. \r\nCeo process traje, pogotovo sa klijentima koji su vlasnici ili menadžeri  u malim i srednjim preduzećima, oni ulažu značajnu sumu novca ali nemaju mnogo vremena a ni luksuz da imaju svoj tim za marketing I analizu.Digitalni marketing, onlajn komuna i današnje vreme generalno zahteva brzinu u reakcijama, te nije moguće priuštiti odlaganje i zapuštanje podataka koje vam direktno daju reakciju tržišta i kupaca na vaš proizvod ili uslugu. Ovakav način obrade podataka nije održiv i pitanje je vremena kada će biti promenjen. Štaviše, obrada i analiza  podataka su rastući problem u različitim industrijama ne samo u digitalnom marketingu', NULL, NULL),
(4021, 26, 1802, 'App je planirano da prvo izađe u Srbiji, preko MTS-a, njihovim biznis klijentima, u okviru paketa. U isto vreme ćemo proizvod ponuditi svim agencijskim klijentima. Nakon godinu dana, kada budemo sakupili reakcije i usavršili proizvod, možemo ići na strana tržišta takođe preko “teleko provajdera”. Oni su nam idealan partner za izlazak na tržišta, u bilo kojoj zemlji. Što se tiče implementacije na različita tržišta, naš proizvod nema ograničenja poput adaptacije zbog fizičkih granica. \r\nSamo u Evropi kompanije su uložile 69 milijardi u onlajn reklamiranje tokom 2020.godine (UK najviše). U Americi su potrošene 152 milijarde u tom istom periodu. Više od pola su uložila mala i srednja preduzeća koja mi targetiramo. Njih je u USA preko 30mil a u Evropi preko 25mil.(https://www.statista.com/).Najveći deo srpske privrede, 99,5 odsto, čine mikro, mala i srednja preduzeća. Trenutno je u APR-u registrovano 133.494 privrednih društva i 290.635 preduzetnika (www.stat.gov.rs).', NULL, NULL),
(4022, 27, 1802, 'Na primer vlasnik/ca manjeg preduzeća u USA je naš idealan klijent. On želi u svakom momentu da sazna informacije kao što su: koliko je novca potrošeno na poslednju kampanju, koliko ljudi je iskoristilo kupon i slično. Naš app će joj sve ovo omogućiti u par klikova na jednom mestu. Marketing ili generalni menadžeri, vlasnici manjih i srednjih preduzeća koja ulažu u onlajn prisustvo su naši potencijalni korisnici.  \r\nMi smo pitali trenutne klijente agencije, sa kojima upravo na ovakve načine pokušavamo da zakažemo mesečne sastanke i znamo da bi oni rado koristili ovakvu aplikaciju u zamenu za mesečnu naknadu. Takođe smo saznali da i zaposleni u velikim firmama žele da probaju naš app, zbog lakoće i brzine korišćenja kao i AI koja će im dati savet kako najbolje da reaguju u situacijama gde su ograničeni vremenom. Iako oni nisu bile naša ciljna grupa zbog toga što imaju timove i kontakt menadžere u gigantskim kompanijama poput Google-a, dobili smo pozitivnu reakciju i od njih.', NULL, NULL),
(4023, 28, 1802, 'Razvijamo softver i aplikaciju za mobilne telefone koja analizira i upoređuje podatke sa onlajn platformi. Koristeći AI i ML omogućićemo korisnicima da uživo dobiju savete i informacije o tome šta se dešava sa njihovim onlajn prisustvom. U svakom momentu će moći na jednom mestu da pogledaju svoje aktivnosti na različitim platformama u uporede podatke koji ih interesuju. \r\nNaš proizvod se razlikuje od drugih rešenja, time što mu je svrha da pojednostavi prikaz i analizu podataka. Ostale platforme: \r\n1.	ne koriste AI\r\n2.	ulaze detaljnije analize izveštaja\r\n3.	ne koriste se kao app već kao desktop softveri \r\n4.	nisu namenjene laicima već analitičarima', NULL, NULL),
(4024, 30, 1802, 'Trenutno je mnogo “nepoznatog” tipičnom oglašivaču ili vlasniku / menadžeru biznisa što se tiče digitalnog marketinga. Ne samo zato što možda nisu iz te industrije i treba da se posvete svom pozivu, već zbog toga što je do podataka komplikovano i vremenski zahtevno: doći, analizirati ih i doneti zaključke. Zbog toga oni traže “spas” u agencijama, ili savetnicima za digitalni marketing. Timovi, poput naše agencije, ili osoba koja je savetnik za digitalni marketing može da doprinese poslovanju i reši deo problema “pešaka”, kao što smo naveli u opisu problema. To svakako nije dugotrajno rešenje za rastuću količinu podataka koje svakodnevno generišu platforme i čuvaju informacije, koje ako se dobro analiziraju, mogu biti presudne za nečije poslovanje.', NULL, NULL),
(4025, 29, 1802, 'Naš app štedi vreme i novac što su najbitniji resursi. Putem našeg app-a u par klikova klijenti mogu doći do informacija koje bi u suprotnom dobili na sastanku koji često dogovaraju duže vreme. Na ovaj način vreme prolazi, povoljni potezi i se ne preduzimaju i propuštaju se prilike za unapređenje poslovanja. Opšte je poznato da su prodaja i reputacija na internetu trenutno najbitnije kompanijama i ko god može ugrabiće priliku da poboljša te aspekte poslovanja.\r\nTrenutno samo velike kompanije koje troše mnogo na oglašavanje imaju priliku da se obrate svom kontaktu u Facebook-u primer. Te kompanije takođe imaju analitičare koji mogu da posvete svo vreme na analize koje mi plairamo da automatizujemo koristeći AI i ML. Ironično, sistemi koji sada postoje na tržištu (naši konkurenti) su stvoreni upravo da pomognu tim analitičarima.\r\nNaš app je user-friendly, dizajniran za svakodnevne ljude, dostupan na telefonu u jednom dashboard-u i kliku', NULL, NULL),
(4026, 32, 1802, 'Rekli bismo da značajno poboljsava postojeci proizovod, poput Supermetrics-a ali sa karakteristikama koje ga razlikuju je zapravo potpuno originalan i nov na tržištu. Kao sto smo objasnili u prethodnim odgovorima, nijedno rešenje koje nam je konkurent\r\n-	ne koristi AI I ML, \r\n-	ne targetira ljude iz različitih industrija koji nisu eksperti, \r\n-	nema mobilnu aplikaciju koja se lako koristi, a često ni svoj dashboard već rade kao “bridge sistemi” \r\n-	retko ko od konkurenata upoređuje podatke sa sajta sa podacima sa društvenih mreža.', NULL, NULL),
(4027, 37, 1802, 'Zaštitili smo logo, vlasnik je moja agencija “Dasha TSF doo”. Planiramo da podnesemo zahtev početkom 2022 za zaštitu autorskog dela. Na žalost saznali smo da software ne može da bude intelektualna svojina i da se zaštiti u Srbiji te ćemo uraditi sve ostalo što nam je na raspolaganju.', NULL, NULL),
(4028, 40, 1802, 'Za sada suma o kojoj smo pričali sa Telekom Srbija kompanijom je godišnja licenca u iznosu od 189 000.00 evra, za prvu godinu. Verujemo da licenca na većim tržištima (u drugim zemljama) mora biti skuplja. Takođe, naš app će svako moći da skine za početnu cenu od 33.99 evra do 215.00 evra.', NULL, NULL),
(4029, 41, 1802, 'Ideju smo razvili tokom 2019. godine kada smo i počeli sa radom. Na žalost, prošla 2020.godina je zbog pandemije onemogućila značajan napredak start-up-a i bili smo usmereni na druge stvari. \r\nOve godine smo došli do značajnog pomaka uključujući delom razvijenu tehnologiju (do 50%), način rada i arhitekturu softvera. Tokom 2021 godine smo dobili i pismo o namerama od Telekoma Srbije i pregovarali sa investitorima iz Srbije i inostranstva. Imali smo priliku da radimo sa mentorima i savetnicima preko Naučno tehnološkog parka i da prezentujemo svoj proizvod potencijalnim klijentima za koje sada znamo da će naš proizvod koristiti. Uglavnom smo imali pozitivan “feedback”, a značajni komentari su uvaženi i već implementirani na naše rešenje. Najnovije korisne informacije smo saznali na Slush konferenciji na kojoj smo učestvovali ovog meseca i koja nam je omogućila direktan kontakt sa potencijalnim investitorima i reakcije budućeg tržišta.', NULL, NULL),
(4030, 44, 1802, 'Nismo ucestvovali', NULL, NULL),
(4031, 45, 1802, 'Nismo ucestvovali', NULL, NULL),
(4032, 48, 1802, 'Očekujemo podršku kroz kontinuirano savetovanje kako bi naš startup išao u najboljem mogućem smeru što se tiče pregovora sa potencijalnim partnerima I izlaskom na tržišta. To se najviše tiče finansijskog savetovanja, strateškog ali i eksperata iz AI ukoliko je to moguće, dobrodošlo je. Takođe očekujemo da osim finansijske dobiti steknemo znanje i nove kontakte.', NULL, NULL),
(4033, 49, 1802, 'Za završetak proizvoda nam je potrebno angažovanje programera, naših i verovatno ekternih. Za njihove plate, kako bi proizvod bio gotov do jula 2022.godine nam je potrebno minimum 2000 evra mesečno što je 14 000 evra, za ovu fazu. Do sada smo iz agencijskih izvora finansirali sve.', NULL, NULL),
