(4038, 89, 1809, 'Osnivačica kompanije Dasha TSF doo koja vec godinama uspesno posluje u digitalnom marketingu sa preko 100 klijenata u portfoliju, iz celog sveta\r\nObrazovanje:\r\n- Sheffield University, smer marketing, Grčka\r\n- Mansfield Highschool (gimnazija), Dallas, Texas, USA\r\n- OOŠ Vladislav Ribnikar, Beograd', NULL, NULL),
