(4041, 89, 1810, 'Full stack Javascript programer - preko 3 godine samostalno radi na projektima koji podrazumevaju AngularJS, SASS, HTML, Angular jezike kodiranja\r\nObrazovanje:\r\n- Krojačeva skola – Full Stack JavaScript Developer LINK Group – Java & JavaScript developer \r\n- Ekonomski faktultet u Beogradu \r\n- 9.Beogradska Gimnazija', NULL, NULL),
