(4044, 89, 1811, 'Radi u The Social Formula agenciji od 2017. godine a u poslednjih godinu dana na aplikaciji/software-u The Social Formula\r\n\r\nObrazovanje:\r\nCertified web designer, IT Akademija Beograd\r\nSmer: Design, Adobe Illustrator, Drawing, Copyrights, Web design, HTML CSS, JavaScript, Word Press, Search Engine Optimization, Digital Marketing\r\n\r\nInformation systems engineer, Belgrade Business School – Business College of Applied Studies\r\nSubject areas: Computer use, Science and Mathematics, E-business', NULL, NULL),
