(4050, 71, 1815, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4051, 71, 1816, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4052, 63, 1817, 'Produckija naše prve igre LUDO - The Awakening koja će targetirati tržište mobilnih i društvenih igara.', NULL, NULL),
(4053, 71, 1818, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4054, 17, 1819, 'Produckija naše prve igre LUDO - The Awakening koja će targetirati tržište mobilnih i društvenih igara.', NULL, NULL),
(4055, 22, 1819, 'Deo našeg tima je oformljen u okviru jednog projekta na fakultetu, gde smo radili na izradi prototipa igrice u Unity game engine-u. Uz određene promene naš tim sada broji četiri člana i u tom sastavu smo bili deo “Nordeus Booster 3” programa. Tokom booster-a prošli smo kroz veliki broj mentorskih sesija i workshop-ova sa istaknutim članovima srpske gaming zajednice od kojih smo mnogo naučili o izradi video igara kao i vođenju biznisa u tom sektoru. Napravili smo naš prvi prototip i izvršili evaluaciju njegovog tržišnog potencijala. Nakon programa smo nastavili da usavršavamo svoje veštine i da upotpunjujemo svoja znanja u oblastima kao što su programiranje, dizajn, modelovanje kao  i ostalih oblasti vezanih za otvaranje game studia. Postali smo članovi Serbian Gaming Association-a, uz čiju pomoć i dalje usavršavamo naše veštine i radimo na tome da proizvod dođe do svoje beta faze kada će biti izvršeno intezivno testiranje.', NULL, NULL),
(4056, 23, 1819, 'Kroz kontinuirani rad u “Nordeus Booster” programu i konstantno unapređivanje znanja odlučili smo se da projekat koji smo započeli u potpunosti razvijemo i sa njim izađemo na tržište. Program je jedan od retkih koji su dostupni timovima u ranoj fazi izrade i omogućava brz napredak kako projekta tako i članova tima putem mentorskih sesija. Omogućava povezivanje učesnika u jedinstven klaster početnika u poslovanju na tržištu koja nisu u konkurentskom odnosu. Mnoštvo benefita za lična usavršavanja učesnika programa.', NULL, NULL),
(4057, 24, 1819, '“Zalaganjem ćemo napraviti i ono što ne postoji.”', NULL, NULL),
(4058, 25, 1819, 'Kako svet iz dana u dan postaje sve više međusobno povezan sa porastom tehnoloških dostignuća, mi kao vrsta, suprotno intuiciji, postajemo udaljeni jedni od drugih. Konstantno stanje stresa i uznemirenosti zbog nepoznate budućnosti postali su svačija svakodnevnica. Socijalna otuđenost koja je još dodatno produbljena pandemijom u toku, umnogome je doprinela povećanju anksioznosti kod ljudi. Naš tim nastoji da na inovativan način pristupi rešavanju tog psiho-socijalnog problema uz nesvakidašnju upotrebu mogućnosti koje pruža tehnologija unutar industrije igara i srodnih umetničkih grana u međusobnoj kombinaciji.', NULL, NULL),
(4059, 26, 1819, 'Naše osnovno tržište je tržište igara, podeljeno u dve grane, na video i društvene igre.\r\nIndustrija mobilnih igara je jedna od industrija sa najvećim učinkom na globalnom nivou u prethodnim godina i u konstantnoj je ekspanziji.\r\nIndustrija je zabeležila 12% više igrača u 2020. nego u 2019, sa preko 2,5 milijardi igrača. S obzirom na to da je kretanje i dalje ograničeno, a ljudi zatvoreni u svojim domovima, predviđa se da će broj narednih godina biti samo veći.\r\n\r\nGlobalno tržište društvenih igara dostiglo je vrednost od 11 milijardi dolara 2020. godine, a 2021. će industrija preći 12 milijardi dolara, prema istraživanju tržišta od strane Euromonitor International.\r\n \r\nLakoća pristupa globalnom tržištu putem već ustaljenih kanala distribucije za mobilne video igre je mogućnost koju nastojimo da iskoristimo u punom kpacitetu.', NULL, NULL),
(4060, 27, 1819, 'Tokom istraživanja tržišta naišli smo na nedostatak jedinstvenost i inovativnosti u žanru LUDO igara i odlučili se da naš prvi proizvod cilja navedeni žanr. Sve konkurentske igre izgledaju skoro isto i ne daju svojim igračima nešto jedinstveno u njihovoj osnovnoj mehanici. Igrači i tržište su postali prezasićeni skoro potpuno istom igrom sa malo drugačijim vizuelnim identitetom. Naši targetirani korisnici su regularni igrači, starosti između 25 i 40 godina, uglavnom iz razvijenih  zemalja kao što su SAD, Nemačka, Španija, Velika Britanija, Belgija, Francuska, Japan, Južna Koreja. Po završetku “Nordeus Booster 3” programa naš prototip za mobilne uređaje je distribuiran na alpha testiranje. Izvršena anketa je pokazala da su korisnici pozitivno reagovali na mehaniku igre i iskazali zavidno interesovanje za dalji razvoj.', NULL, NULL),
(4061, 28, 1819, 'Inovacija koju razvijamo tiče se poboljšanja korisničkog iskustva u okviru LUDO žanra iz segmenta video i društvenih igara. Tokom analize postojećih proizvoda na navedenom tržištu ustanovili smo nedostatak inovativnosti u samoj mehanici igara, konkurencija nije pronašla poboljšanja koja će plasirati kao nadogradnju. \r\n\r\nTokom produkcije našeg prvog proizvoda biće stvaran modularni produkcioni pipeline.Sastoji se od upotrebe AI i mašinskog učenja korišćenjem TensorFlow tehnologije unutar Unity game engina koje če biti uklopljeno u već postojeće proceduralne alate kao što su Houdini i Substance designer. Microsoft Azure platforma će biti iskorištena i za izradu sistemske infrastrukture.', NULL, NULL),
(4062, 30, 1819, 'Tržište pažnje kao najkompetitivnije tržište modernog doba na kom se takmiči veliki broj igrača iz raznih grana industrije biće prostor koji targetiraju i naši budući proizvodi. \r\n \r\nSegregacijom navedenog tržišta na manje celine koje sve približnije opisuju naš proizvod nailazimo na direktnu konkurenciju na tržištu mobilnih igara. \r\n \r\nTržište mobilnih igara može se segmentirati na osnovu uređaja i operativnog sistema. Na osnovu uređaja, tržište se može podeliti na pametne telefone i tablete. Android, iOS su dve glavne OS platforme na kojima se razvijaju mobilne igre. Iako Android OS čini značajan obim preuzimanja igara, očekuje se da će iOS generisati veći prihod zbog plaćene prirode aplikacija i igara.\r\n \r\nKljučni igrači na tržištu mobilnih igara su Tencent, Electronic Arts, Activision Blizzard, Nintendo, Ubisoft, Zinga i TakeTvo Interactive.', NULL, NULL),
(4063, 29, 1819, 'Umetnost se neminovno prožima kroz sve sfere života i gotovo je nemoguće da se njena prisutnost ne oseti i ne vidi. Ona ne služi samo da impresionira čoveka, iako je neretko taj utisak upravo najintenzivniji. Njena svrha postojanja se odnosi i na nauku, filozofiju, kao i emotivnu i kognitivnu zrelost ličnosti kao konzumenta iste. Implementirana je u svaki segment društva i stimuliše sva ljudska čula i neretko omogućava pospešivanje socijalnih interakcija. Trendovi koji se pojavljuju na tržištu pažnje ukazuju na zasićenost konzumenata na tradicionalne umetničke sadržaje. Tržište igara kao značajan deo navedenog tržišta je u konstantnoj ekspanziji nudeći korisnicima fuziju više tradicionalnih kategorija umetnosti sa visokim nivoom interaktivnosti.  Naš proizvod Ludo - The Awakening će nastojati da poveže navedene elemente u kompetitivan proizvod za igrače koji će ujedno biti i platforma za socijalnu interakciju za korisnike.', NULL, NULL),
(4064, 32, 1819, 'Tokom istraživanja tržišta u okviru Nordeus Booster programa naišli smo na nedostatak jedinstvenost i inovativnosti u žanru LUDO igara i odlučili se da naš prvi proizvod cilja navedeni žanr. Sve konkurentske igre izgledaju skoro isto i ne daju svojim igračima nešto jedinstveno u njihovoj osnovnoj mehanici. Igrači postaju prezasićeni skoro potpuno istom igrom sa drugačijim vizuelnim identitetom. \r\nNakon što smo to uočili došli smo na ideju da unapredimo i inoviramo žanr LUDO igara.\r\nStvari koje su drugačije od postojećih LUDO igara:\r\nPloča za igru je pretvorena u magično leteće ostrvo koje ima četiri različite zone, posebna zona za svakog igrača.\r\n\r\nPijune smo evoluirali u heroje koji imaju posebne sposobnosti, svaki heroj ima jednu posebnu sposobnost koju može iskoristiti jednom po potezu.\r\n\r\nBaza je postla zamak koji evoluira na svakom narednom nivou\r\n\r\nDrugi buffovi i debuffovi', NULL, NULL),
(4065, 37, 1819, 'Koristimo elemente već postojeće osnovne ideje igre koja je zbog svoje hiljadugodišnje istorije deo domena javnog i opšteg dobra.\r\n \r\nVlasništvo nad svim logotipovima, patentima i intelektualnom svojinom koji budu nastali u okviru produkcionog delovanja studia zarad proizvoda LUDO The Awakening biće vlasništvo navedenog pravnog lica.', NULL, NULL),
(4066, 40, 1819, 'Osnovni izvor prihoda biće putem aplikacije za mobile uređaje. Već ustaljena praksa prodavanja reklamnog prostora unutar aplikacije koja će takođe sadržati i prodavnicu in-game asseta za sve zainteresovane kupce koji žele da imaju unikatan sadržaj. \r\nOkvirni plan startapa je što veća diversifikacija pravaca prihoda kako bi se izbegle anomalije presušivanja jednog revenue stream-a koje mogu zadesiti svaku industrijsku granu.', NULL, NULL),
(4067, 41, 1819, 'Naš tim je okupljen oko godinu dana. Ideja je nastala tokom prijave za Nordeus Booster 3 program.\r\nOstvareni ključni ciljevi:\r\n\r\nPrvi cilj je bilo istraživanje i “brainstorming” za igru koju pravimo. \r\nUspešno pristupanje Nordeus Booster 3 programu\r\nPoliranje i unapređivanje postoječih veština uz pomoć mentora iz Nordeusa i njihovih saradnika.\r\nPlaniranje projekta za dalji programski razvoj\r\nIsplanirano kojim redom se ubacuju određene bazne funkcionalnosti.\r\nUrađena detaljna revizija ideja koje ulaze u implementaciju\r\nRazvoj baznih mehanika igre\r\nIzdavanje prototipa za javnost\r\nPrikupljanje povratnih informacija\r\nAnaliza povratne informacije dobijene od strane test grupe\r\nRevizija alpha faze na osnovu feedback-a\r\nPodešavanje Domain kontrolera, mail servera, file servera, backup servera\r\nPovezivanje sa Microsoft Azure platformom\r\nUvezivanje Microsoft Azure Playfaba sa prototipom', NULL, NULL),
(4068, 44, 1819, 'Nordeus Booster 3\r\nSerbian Gaming Association - mentorske radionice', NULL, NULL),
(4069, 45, 1819, 'Još uvek nismo ušli u fazu prikupljenih finansija.', NULL, NULL),
(4070, 48, 1819, 'Naša trenutni nivo razvoja proizvoda je izrada beta faze, tj. povezivanje svih neophodnih funkcionalnosti i servisa u mobilnoj verziji igre. Kao i izrada prvog prototipa društvene igre.', NULL, NULL),
