(4076, 89, 1826, 'Marko je započeo svoju karijeru kao QA tester u kompaniji za pravljenje video igara. Pored testiranja igara stekao je i iskustvo u dizajniranju video igara, izradi prototipa, programiranje u C# programskom jeziku u Unity game engine-u. Stekao je četiri godine iskustva radeći za tu kompaniju. Njegov prvi projekat bilo je pravljenje video igre u mentorskom programu na fakultetu. Nakon toga oformio je tim koji se prijavio u Nodreus Booster 3 program.', NULL, NULL),
(4077, 90, 1826, 'Potpuno posvećen\r\nKreator ideje', NULL, NULL),
(4078, 91, 1826, 'Full-time u kompaniji Centili na poziciji Integration Engineer.', NULL, NULL),
(4079, 89, 1827, 'Veliko dosadašnje radno iskustvo iz oblasti ugostiteljstva, informacionih tehnologija, prožeto angažovanjima u nevladinom sektoru i organizacijom velikog broja kulturno-umetničkih festivala na prostoru Srbije i Crne Gore.\r\n\r\nOsnivanje nekolicine NVO-a, pokretanje sopstvenog biznisa iz oblasti ugostiteljstva, učešće u osnivanju festivala Underhill i Dev9t su neke od značajnijih referenci.', NULL, NULL),
(4080, 90, 1827, 'U većoj meri posvećen\r\nKreator Ideje', NULL, NULL),
(4081, 91, 1827, 'Full-time u kompaniji TLScontact na poziciji Cyber Security Engineer.\r\n\r\nFestivalska organizacija: Dev9t, Exit, Lovefest.', NULL, NULL),
(4082, 89, 1828, 'Vanja je radila kao tim lider za marketinšku firmu. Njena glavna uloga je bila pravljenje i organizacija promocija i događaja. Za tri godine rada je stekla veliko iskustvo u marketingu dok je radila kod njih. Umeđuvremenu je stekla i iskustvo u internet marketingu na društvenim mrežama. Vođenjem instagram stranica, pravljenje planova za promocije na društvenim mrežama, određivanje ciljne grupe postali su njena svakodnevnica.', NULL, NULL),
(4083, 90, 1828, 'U većoj meri posvećena', NULL, NULL),
(4084, 91, 1828, 'Kozmetički tehničar u Studio 93.', NULL, NULL),
(4085, 89, 1829, 'Student industrijskog dizajna sa dosta volenterskog i freelance iskustva u oblastima marketinga i  grafičkog dizajna.\r\nDugogodišnje iskustvo na raznim pozicijama unutar udruženja studenata  ESTIEM.', NULL, NULL),
