(4088, 71, 1832, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4089, 71, 1833, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4090, 71, 1834, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4091, 63, 1835, 'Suština pronalaska ogleda se u generisanju sistema za gajenje pčelinjeg društva i dobijanje pčelinjih proizvoda u kućnim uslovima bez neophodnosti korišćenja specijalizovane pčelarske opreme. Pronalaskom je omogućena široka upotreba i od strane osoba koje nemaju pčelarsko iskustvo. Novost se bazira na sistemu koji je sastavljen od pripadajućih elemenata koji omogućavaju dobijanje meda, polena, propolisa, usluga api-inhalacije i api-punkture uz preduslov da su potpuno bezbedni za korisnika.', NULL, NULL),
(4092, 71, 1836, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4093, 17, 1837, 'Suština pronalaska ogleda se u generisanju sistema za gajenje pčelinjeg društva i dobijanje pčelinjih proizvoda u kućnim uslovima bez neophodnosti korišćenja specijalizovane pčelarske opreme. Pronalaskom je omogućena široka upotreba i od strane osoba koje nemaju pčelarsko iskustvo. Novost se bazira na sistemu koji je sastavljen od pripadajućih elemenata koji omogućavaju dobijanje meda, polena, propolisa, usluga api-inhalacije i api-punkture uz preduslov da su potpuno bezbedni za korisnika.', NULL, NULL),
(4094, 22, 1837, 'Pre rada na inovaciji, nismo imali zajedničke projekte.', NULL, NULL),
(4095, 23, 1837, 'Činjenica da smo kao tim deo organski generisanog startapa, gde smo sve resurse i informacije prikupljali samostalno bez stimulacija i podsticaja, motivisala nas je da pronađemo dodatna znanja i iskustva neophodna za razvoj inovacije. S obzirom da postoje zahtevi za unapređenje inovacije, mogućnost da budemo deo ovakvog projekta, podržanog putem edukacije i finansija,  izgleda kao neizbežna i ključna tačka u koracima koju ne želimo da zaobiđemo. Postoji sijaset podsticajnih programa, ali smatramo da nam Raising Starts pruža mogućnost da ostvarimo sve aspekte uspešnog razvoja inovacionog proizvoda.', NULL, NULL),
(4096, 24, 1837, 'Let\'s reconnect with nature!', NULL, NULL),
(4097, 25, 1837, 'Nedostpunost uzgoja pčelinjeg društva i dobijajanje pčelinjih proizvoda u kućnim uslovima, kao i usluga - api-inhalacije i api-punkture, dok indirektno problem globalne ugroženosti pčelinjih zajednica i smanjeni broj polinatora u urbanim sredinama. Navedeni problemi su od ekološkog i društvenog značaja, kako na lokalnom, tako i na globalnom nivou. Ekološki problemi društva su u direktnoj vezi sa ugroženošću pčelinjih zajednica i informacije o navedenim problemima su javno dostupne.', NULL, NULL),
(4098, 26, 1837, 'Ciljno tržište je globalno, veoma široko targetirano, za ciljne grupe koje imaju određeno predznanje o benefitima uzgoja pčelinjih zajednica i njihovoj ugroženosti na svetskom nivou. Najupoznatiji i najrazvijeniji region u oblasti pčelarstva obuhvata zonu Novog Zelanda i Australije, u Evropi Baltičke zemlje, a u Aziji tržište Indije i Rusije.', NULL, NULL),
(4099, 27, 1837, 'Potencijalni kupci su osobe, muškarci ili žene, zdravih navika ili one koje imaju tendenciju ka takvom stilu života, koje žive u urbanim sredinama i imaju afinitete ka uzgoju pčelinjeg društva, koje ne pokazuju strah od pčela i nemaju alergijske reakcije na pčelinji ubod, koje vole prirodu i pokazuju interesovanje ka održivosti, koje imaju prethodno predznanje o benefitima uzgoja pčelinjeg društva i pokazuju interesovanje za pčelinje proizvode. Detaljnije istraživanje tržišta u formi ankete i sl. nije rađeno.', NULL, NULL),
(4100, 28, 1837, 'Na osnovu pretraživanja stanja tehnike, proizvod koji predstavljamo jedinstven je na globalnom tržištu. U pitanju je sistem za gajenje pčelinjeg društva i dobijanje pčelinjih proizvoda u kućnim uslovima, bez korišćenja specijalizovane zaštitne opreme, u obliku heksagona, izrađen od transparentnih i inertnih materijala za pčelinju zajednicu. Sastavljen je od osnovnog elementa (telo sistema) i pripadajućih dodataka namenjenih dobijanju propolisa, meda i polena, kao i procesu api-inhalacije i api-punkture. U poređenju sa postojećim tipovima košnica za uzgoj pčelinjih društava, ovaj sistem je moguće postaviti unutar stambenih prostorija, poslovnih objekata, medicinskih ustanova i sl.', NULL, NULL),
(4101, 30, 1837, 'Potrebe za organskim pčelinjim proizvodima potencijalni kupci trenutno rešavaju kupovinom gotovih proizvoda od lokalnih pčelara. Druge potrebe poput opservacije i uzgoja pčelinjeg društva u stambenim i poslovnim prostorijama,  kao i dobijanje organskih pčelinjih proizvoda, a bez neophodnosti korišćenja specijalizovane zaštitne opreme, trenutno su potencijalnim kupcima nedostupne.', NULL, NULL),
(4102, 29, 1837, 'Vrednosti koje inovacija pruža potencijalnim kupcima: dobijanje organskih pčelinjih proizvoda u kućnim uslovima bez korišćenja specijalizovane zaštitne opreme; uzgoj i opservacija pčelinjeg društva sa mogućnošću api-inhalacije i api-punkture; polinacija; zdrav način života.', NULL, NULL),
(4103, 32, 1837, 'Na osnovu prethodnog inicijalnog istraživanja o stanju tehnike sprovedenog u procesu zaštite intelektualne svojine uz konsultacije sa Zavodom za intelektualnu svojinu nisu pronađena saznanja o sličnim proizvodima na tržištu.', NULL, NULL),
(4104, 37, 1837, 'Sproveli smo preliminarno istraživanje u sklopu procesa zaštite intelektualne svojine, a uz konsultacije sa Zavodom za intelektualnu svojinu RS. Zahtev za zaštitu patenta je predat u Zavod za intelektualnu svojinu i inovacija je zavedena pripadajućim brojem. Vlasnik intelektualne svojine je Dolašević Slobodan, kreator inovacije i rukovodilac projekta.', NULL, NULL),
(4105, 40, 1837, 'Komercijalizacijom i prodajom proizvoda krajnjim korisnicima.', NULL, NULL),
(4106, 41, 1837, 'Inicijalna ideja o mogućnosti uzgoja pčelinje zajednice u kućnim uslovima je stvorena pre više od 7 godina od strane Dolašević Slobodana. Prototipovi i načini funkcionisanja su menjani kroz iteracije i cikluse inovacija. Iako generisan, sistem za gajenje pčelinje zajednice i dobijanje pčelinjih proizvoda još uvek zahteva određena unapređenja.  Kreator i realizator ideje, Dolašević Slobodan, doktor biotehničkih nauka, uz informatičku i istraživačku podršku Petra Kovačevića, došao je do krajnjeg rešenja nakon mnogobrojnih test faza i ispitivanja. Početni ciljevi su polazili od osnove da se proizvod-inovacija učini dostupnim korisnicima širom sveta, kao proveren i funkcionalan sistem za bezbedan uzgoj pčelinjeg društva i dobijanje pčelinjih proizvoda u kućnim uslovima. Iako je funkcionalnost inovacije ispitana, još uvek se vrše ispitivanja i provere.', NULL, NULL),
(4107, 44, 1837, 'Nismo.', NULL, NULL),
(4108, 45, 1837, 'Izjavljujemo da nismo do sad imali finansijsku podršku.', NULL, NULL),
(4109, 48, 1837, 'Očekujemo edukaciju, prikupljanje potrebnih informacija u vezi sa razvojem inovacije i finansijska sredstva potrebna u procesima unapređenja inovacije, nabavke potrebne opreme i materijala, kao i sredstva za troškove testiranja i izrade proizvoda.', NULL, NULL),
(4110, 49, 1837, 'Smatramo da nam je neophodno između 20 000 - 25 000 eura za realizaciju projekta, za troškove nabavke potrebne opreme i ulaznih materijala, troškove naknada za fizička lica i troškove izrade, testiranja i marketinga u cilju validacije proizvoda. S obzirom da Program nudi podršku za projekte u nižem opsegu, svaka potencijalna stimulacija bila bi od značajne koristi ka krajnjoj realizaciji.', NULL, NULL),
