INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(4122, 63, 1849, 'urgeh.com je platforma koja kombinuje kreativni pristup strukturisanja i prikazivanja koncepata iz različitih oblasti Računarstva, Matematike, Geografije, Istorije, Biologije, Astronomije, Fizike i Hemije s ciljem da koncepte iz ovih naučnih oblasti, od osnovnih do složenih, predstavi na način koji najširoj mogućoj publici dozvoljava jednostavno razumevanje kompleksnih tema. Fokus je na pronalaženju onog dela konktretnog koncepta koji je za razumevanje tog koncepta krucijalan i dizajniranje pratećeg grafičkog iskustva (koje mi nazivamo FLOW-om) takvog da prenošenje suštine koncepta spustimo na nivo na kome koncept može razumeti i dete starosti 8 godina (vođeni sledećim: \"Dr. Hoenikker used to say that any scientist who couldn\'t explain to an eight-year-old what he was doing was a charlatan.\").\r\nJedna verzija platforme je trenutno online, a za sada sadrži samo mapu planiranih oblasti uz neoptimizovane module iz par oblasti i to za sada samo Računarstva i Informatike.', NULL, NULL),
(4123, 71, 1850, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4124, 17, 1851, 'urgeh.com je platforma koja kombinuje kreativni pristup strukturisanja i prikazivanja koncepata iz različitih oblasti Računarstva, Matematike, Geografije, Istorije, Biologije, Astronomije, Fizike i Hemije s ciljem da koncepte iz ovih naučnih oblasti, od osnovnih do složenih, predstavi na način koji najširoj mogućoj publici dozvoljava jednostavno razumevanje kompleksnih tema. Fokus je na pronalaženju onog dela konktretnog koncepta koji je za razumevanje tog koncepta krucijalan i dizajniranje pratećeg grafičkog iskustva (koje mi nazivamo FLOW-om) takvog da prenošenje suštine koncepta spustimo na nivo na kome koncept može razumeti i dete starosti 8 godina (vođeni sledećim: \"Dr. Hoenikker used to say that any scientist who couldn\'t explain to an eight-year-old what he was doing was a charlatan.\").\r\nJedna verzija platforme je trenutno online, a za sada sadrži samo mapu planiranih oblasti uz neoptimizovane module iz par oblasti i to za sada samo Računarstva i Informatike.', NULL, NULL),
(4125, 22, 1851, 'Đorđe Dovedan i Miljan Đorđević zajedno su radili na više prototipa projekata sa namerom da iste dovedu do nivoa Startup ideje;\r\nMara Bolić, Filip Đurđević i Miljan Đorđević zajedno su radili u okviru Google Student Developer Kluba Univerziteta u Beogradu tokom perioda Jul 2019. - Jul 2020.', NULL, NULL),
(4126, 23, 1851, 'Tehničko i dizajnersko znanje neophodno za realizaciju naše ideje posedujemo, i na projektu ćemo nastaviti da radimo na tom nivou bez obzira na to da li budemo primljeni na ovaj konkurs.\r\nMeđutim, niko od nas nije preterano daleko otišao po pitanju oblasti koje ovaj program pokriva - pokretanje biznisa/startupa.\r\nPrijavljivanje na Vaš program imali smo u planu još prošle godine, ali naš prototip u tom trenutku nije bio na zadovoljavajućem nivou za konkurisanje na ovaj program.', NULL, NULL),
(4127, 24, 1851, 'Ako nešto ne možete da objasnite šestogodišnjaku, onda to sami ne razumete.', NULL, NULL),
(4128, 25, 1851, 'Problem kvaliteta edukativnih materijala tipa gejmifikovane edukacije. Problem postoji globalni i od pocetka krecemo sa ciljem da proizvod predstavimo globalno. Problem jeste tezak, a tezina se razlikuje u zavisnosti od posmatranog dela nauke. Za problem smo saznali usput, kroz nase obrazovanje.', NULL, NULL),
(4129, 26, 1851, 'Nas cilj jeste svaka obrazovna institucija koja vidi znacaj u onome sto mi budemo usavrsili - dakle formalno, nase trziste prestavljaju sve osnovne, srednje skole i fakulteti, uz dodatak bilo koje osobe koja ima deciju radoznalost za ucenjem novih stvari. Verujemo da ce velicina trzista koju uspemo da dosegnemo direktno zavisiti od toga koliko kvalitetan i intuitivan proizvod razvijemo, u kombinaciji sa kvalitetom marketing kampanje iza proizvoda i prisustva na drustvenim mrezama.', NULL, NULL),
(4130, 27, 1851, 'Privatne i drzavne obrazovne institucije (cene bi zavisile od konkretne institucije) i pojedinci (platforma ce biti besplatna za decu ispod odredjenog uzrasta, a odrasle osobe delu platforme besplatno pristupaju a ze pristup drugom delu placaju mesecnu subskripciju). Glavne karakteristike potencijalnih kupaca saznajemo kroz rad na platformi; deo tima radi na uspotvanljanju konekcija sa profesionalcima iz razlicitih oblasti koje nas sajt pokriva i dodatno s pedagozima koji se interesuju za bas ovu oblast. Za sada se ispitivanje trzista svelo na intervjue sa 5 vodecih domacih strucnjaka, i predstvaljanje platforme sirem auditorijumu slusalaca u vidu govora pred clanovima SANU i jednog chapter-a Google Developers-a.', NULL, NULL),
(4131, 28, 1851, 'Razvijamo web platformu za učenje kroz igru - gejmifikaciju obrazovanja. \r\nGlavne karakteristike platforme jesu vizualizacije računarskih algoritama, astroloških, fizičkih i geografskih pojava, matematičkih koncepata, hemijskih reakcija, i istorijskih događaja koje dostipnim činimo u web pretraživaču, kroz korišćenje od skoro dostupnih tehnologija za napredniji web development - Webassembly-a.\r\nZa backend platforme odabrali smo Django zbog odličnih besplatnih biblioteka jezika Python, a za frontend Angular zbog njegove skalabilnosti (drugi framework-ovi imaju svojih prednosti, ali za naše potrebe najbolji se ispostavio Angular).', NULL, NULL),
(4132, 30, 1851, 'Youtube. Ideja iza Youtube-a je bila platforma za deljenje video zapisa; danas dosta ljudi koristi mogućnost koju Youtube pruža za najrazličitije namene, jedna koju nas zanima jesu animirana objašnjenja naučnih koncepata koje neki Youtube kanali prave. Naš pogled na te snimke jeste - Zašto se ograniči na nivo video zapisa, kada je moguće korisniku dati pristup samom vizualizatoru, direktno, današnjom tehnologijom već u internet pretraživaču?', NULL, NULL),
(4133, 29, 1851, 'Naš proizvod omogućava pristup kvalitetnim, detaljno struktuiranim i definisanim vizualizatorima i grafičkim iskustvima koji su po našem mišljenju upravo ono što će zameniti klasični udžbenik.', NULL, NULL),
(4134, 32, 1851, 'Iz naših istraživanja i prikupljanja podataka o potencijalnim konkurentima i tržištu, došli smo do zaključka da proizvod sa ciljem poput našeg za sada ne postoji. Postoji dosta pristupa online obrazovanju koje različite kompanije primenjuju, ali proizvod koji za cilj ima gejmifikaciju edukacije za sada ne postoji.', NULL, NULL),
(4135, 37, 1851, '/', NULL, NULL),
(4136, 40, 1851, 'Oslanjamo se na \"Freemium\" model, tako da je deo naše platforme besplatan a pristup drugom delu se naplaćuje na mesečnom nivou.', NULL, NULL),
(4137, 41, 1851, 'Rad na projektu je originalno zapocet u Martu 2019. od strane Miljana Djordjevica, kome su se na projektu pridruzili Mara Bolic i Filip Djurdjevic ubrzo zatim, a u ovom trenutku se radilo na dopunama pocetnog projekta do inicijalne verzije koju smo prijavljivali kao nase resenje za Google-ovo Solution Challenge takmicenje. Posle konsultovanja sa dizajnerima sa Arhitektonskog Fakulteta dosli smo do realizacije o potrebi za promenom dizajna platforme zbog cega smo na projekat doveli Anastasiju Djordjevic (pixelart tema platforme) i Djordjeta Dovedana (minimalisticka tema). Kasnije konsultacije bile su sa studentima Ekonomije koji imaju prethodnog iskustva u razvoju bizinsa, profesora finansija sa 2 nasa fakulteta, a konsultacije sa našim najznačajnijim pedagogom u oblasti predstavljanja matematike deci su u toku. Timu se pridružio i Žarko Cvetić, student Mašinskog fakulteta, pre svega zbog njegovog preduzetničkog duha, i veština upravljanja projektima.', NULL, NULL),
(4138, 44, 1851, '/', NULL, NULL),
(4139, 45, 1851, '/', NULL, NULL),
(4140, 48, 1851, 'Očekujemo pronalaženje partnera/savetnika i sticanje znanja o biznis strani razvoja jednog tehničkog rešenja. Očekujemo da posle programa budemo u stanju da kontaktiramo potencijalne investitore na profesionalniji način i budemo u stanju da bolje uvidimo šta je to što potencijalni investitor traži od nas.', NULL, NULL),
