(4165, 63, 1865, 'Inovacija je usmerena na razvoj vertikalnog ili samostalnog IT rešenja za praćenje i merenje proizvodnog procesa. Zasniva se na aplikaciji koja ima za cilj da isprati kompeletan proizvodni proces od ulaska repromaterijala pa do finalnog sklapanja i pakovanja proizvoda i na kraju zaprimanja u magacin gotovih proizvoda. Napredna analitika koja prati ovo rešenje, zasnovana na Microsoft Power BI aplikaciji, ima za cilj da ponudi optimizaciju proizvodnih procesa i ukaže na propuste u proizvodnji.', NULL, NULL),
(4166, 71, 1866, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4167, 17, 1867, 'Inovacija je usmerena na razvoj vertikalnog ili samostalnog IT rešenja za praćenje i merenje proizvodnog procesa. Zasniva se na aplikaciji koja ima za cilj da isprati kompeletan proizvodni proces od ulaska repromaterijala pa do finalnog sklapanja i pakovanja proizvoda i na kraju zaprimanja u magacin gotovih proizvoda. Napredna analitika koja prati ovo rešenje, zasnovana na Microsoft Power BI aplikaciji, ima za cilj da ponudi optimizaciju proizvodnih procesa i ukaže na propuste u proizvodnji.', NULL, NULL),
(4168, 22, 1867, 'U prethodnih 10 godina sam u više navrata sarađivao i danas sarađajujem sa kolegom Zoranom Sretenovićem. Kao kolege smo zajedno radili u ALTI doo i WinWin doo, a danas zajedno sarađujemo na projektima integracije ERP-a i Microsoft Power BI alata u kompaniji TIS doo.', NULL, NULL),
(4169, 23, 1867, 'Motivisala nas je želja da tržištu ponudimo kompletno rešenje koje će na bazi AI-a sugerisati best practice rešenja za korisnike aplikacije. Prepoznali smo značaj ovog programa po tome što pored finansijskih sredstava obezbeđuje i mentorship koji smatramo izuzetno korisnim i potrebnim u ranoj fazi razvoja ideje.', NULL, NULL),
(4170, 24, 1867, 'Digitalna transformacija na dohvat ruke!', NULL, NULL),
(4171, 25, 1867, 'Postoji opšti problem koji imaju sve proizvodno orijentisane firme, a taj problem se odnosi na praćenje učinkovitosti proizvodnog procesa (ljudi i mašina). Proizvodne firme imaju osnovni problem da precizno izmere učinak ljudi i mašina i da na bazi tih učinaka definišu adekvatne norme. Takođe, merenje učinkovitosti utiče i na sposobnost optimizacije proizvodnih procesa i na kraju na tačan obračun cene koštanja proizvoda.', NULL, NULL),
(4172, 26, 1867, 'Ciljno tržište su proizvodne kompanije u Srbiji, koje se prerađivačkom industrijom. Analizom tržišta smo došli da nam viljni segment može biti oko 700 srednjih i velikih preduzeća sa brojem zaposlenih preko 50. Osnovni izvor podataka koji smo koristili za analizu tržišta su Boniteti.rs (Bisnode- napredna pretraga). Dalje širenje je usmereno na zemlje Ex-Yu regiona i to dominantno Hrvatsku i Sloveniju.', NULL, NULL),
(4173, 27, 1867, 'Naše rešenje je dominantno usmereno na donosioce odluka u procesu proizvodnje ili vlasnike proizvodnih preduzeća. To su vlasnici procesa koji su toliko narasli da njihova ekspanzija nije adekvatno ispraćene postojanjem održivog sistema i softverskih rešenja koji će pomoći u svakodnevnom radu.', NULL, NULL),
(4174, 28, 1867, 'Nastojimo da razvijemo softversko rešenje koje se bavi evidentiranjem i merenjem učinaka u procesu proizvodnje. Rešenje je dizajnirano tako da može raditi u online i offline režimu. Rešenje podrazumeva kompletnu strukruru od izrade baza podataka, preko kreiranja webservisa do samog klijenta. Aplikacija bi bila prilagođena radu na svim uređajima: laptop, mob.tel.,tablet. Ključ aplikacije leži u samom načinu prikupljanja podataka od učeniska u procesu proizvodnje (ljudi i mašina) i prezentovanju tih podataka menadžmentu pomoću Power BI aplikacije.', NULL, NULL),
(4175, 30, 1867, 'Potencijalni kupci trenutno koriste radne liste na kojima zaposleni beleže svoje učinke na dnevnom nivou (br. komada, broj operacija, itd...). Manji broj proizvodnih firmi koristi Barcode ili QR code sistem za beleženje učinaka i merenje performansi učesnika u proizvodnom procesu.', NULL, NULL),
(4176, 29, 1867, 'Osnovni benefit je lako merenje i praćenje učinaka u procesu prizvodnje, kroz evidentiranje ostvarenih rezultata putem mobilne aplikacije, čitanjem QR code-a sa svake komponente u procesu proizvodnje. Svi rezultate se prezentuju u jedan set izveštaja koji predstavlja kontrolnu tablu za menadžment, pomoću koje detektuju uska grla i odstupanja od zadatih normi.', NULL, NULL),
(4177, 32, 1867, 'Smatramo da je naš proizvod značajno poboljšan, pre svega bi što bi pružao slične funkcionalnosti  kao neka konkrentska rešenja (npr SAP ili Nav) ali za značajno manju finansijsku nadoknadu. Takođe, pomenuto rešenje ne zahteva dodatni hardware (dovoljan je mobilni telefon). Intuitivno korisničko iskostvo zasnovano na best practice rešenjima.', NULL, NULL),
(4178, 37, 1867, 'Planiramo da zaštitimo rešenje i vlasnici intelektualne svojine bi bili Vladimir Petrović i Zoran Sretenović. U ovom procesu nam je potrebna stručna pomoć mentora Raising Starts programa.', NULL, NULL),
(4179, 40, 1867, 'Planiramo da nudimo pomenuto rešenje kao SaaS rešenje na tržištu i da ga u manjoj meri prilagođavamo individualnim zahtevima korisnika. Finansijska konstrukcija počiva na dva osnovna stuba: 1. inicijalna vrednost implementacije; 2. trošak mesečnih licenci Ugovor bi se potpisivao sa obavezujućim trajanjem usluge održavanja od godinu dana, a produženje ugovora bi bilo opciono za klijenta. \r\nPlan prodaje, implementacija rešenja min 5.000€ jednokratno po preduzeću + sati implementacije i obuke, kao i 10-30€/mesečno iznajmljivanje licenci po uređaju.\r\nProsečno ciljano preduzeće ima potrebu za 10 do 20 uređaja u svojim poslovnim procesima, što čini mesečni prihod od 100-600€ odnosno oko 5.000€ godišnje. Projekcija je da bi 10 preduzeća otplatilo investiciju.', NULL, NULL),
(4180, 41, 1867, 'Imali smo više sastanaka sa vlasnicima i nosiocima procesa proizvodnih preduzeća. Pokazivali smo konceptna rešenaj i nailazili na izuzetno pozitivne povratne reakcije. \r\nehnološka izvodljivost,\r\nKlijent (android app) komunicira sa Web servisom, Web servis komunicira sa bazom podataka na kojoj se nalazi ERP.\r\nKlijent na sebi ima samo korisnički interfejs, dok se sva pamet nalazi na Web servisu odnosno Bazi podataka.\r\nKlijent je prilagođen poslovnom procesu i konkrentnom radnom mestu/operaciji i zahteva minimalne aktivnosti (skeniranje bar koda, klik na taster i slično) koje dalje prosleđuje WebServisu  odnosno ka Bazi podataka koja dalje obrađuje u skladu sa obrascom poslovnog procesa. Nemamo javno dostupno rešenje ali možemo obezbediti primer rešenja na uvid (po potrebi).', NULL, NULL),
(4181, 44, 1867, 'Bio sam jedan od učesnika i predavača na projektu SMEs Digital u organizaciji NTP Čačak. Ovaj program je ima za cilj propagiranje značaja digitalne transformacije u SME sektoru. U nastavku šaljem nekoliko YouTube linkova sa pomenutih predavanja: https://www.youtube.com/watch?v=HWjKoCKNQ1Q; \r\nhttps://www.youtube.com/watch?v=h6Kx8hgs5Mk;\r\nhttps://www.youtube.com/watch?v=LHmeeBTsxlQ', NULL, NULL),
(4182, 45, 1867, 'Do sada nismo koristili nikakva podsticajna/pozajmljena sredstva.', NULL, NULL),
(4183, 48, 1867, 'Od Raising Starts programa očekujemo prevashodno mentrorsku podršku u domenu skaliranja rešenja. Pored pomenute mentorske podrške značajnu ulogu imaju i finansijska sredsta, pogotovu u ranoj fazi razvoja ideje.', NULL, NULL),
(4184, 49, 1867, 'Procena je da je pored osnovnog tima (2 člana) neophodno dodatno angažovati najmanje 1 do 2 razvojna programera koji bi radili na izradi po projektnim fazama u periodu od najmanje 2 godine.\r\nPrva faza (1.godina) podrazumeva razvoj back-end-a i front-end-a, a druga faza (2.godina) podrazumeva razvoj drajvera za komunikaciju sa izabranim ERP rešenjima.\r\nU trenutnoj fazi je neophodna nabavka softverskih licenci za razvoj(SQL Server ~ 1.400$ jednokratno, VisualStudio 45-250$ mesečno), i angažovanje razvojnih programera (2 * 24 * 1500€ bruto).\r\nPlan prodaje, implementacija rešenja min 5.000€ jednokratno po preduzeću + sati implementacije i obuke, kao i 10-30€/mesečno iznajmljivanje licenci po uređaju.\r\nProsečno ciljano preduzeće ima potrebu za 10 do 20 uređaja u svojim poslovnim procesima, što čini mesečni prihod od 100-600€ odnosno oko 5.000€ godišnje. Projekcija je da 10 preduzeća otplaćuje kompletnu investiciju.', NULL, NULL),
