(4189, 89, 1874, 'Diplomirani ekonomista sa širokim spektrom znanja iz oblasti napredne analize poslovanja, unapređenja prodajnih performansi i širenja prodajne mreže u EMEA regiji . Karijeru je započeo kao Marketing asistent u firmi ALTI doo, koja je prerasla u trgovački lanac WinWIn i u jednom momentu brojala preko 1500 zaposlenih. U pomenutoj firmi je napredovao do mesta Konsultanta za razvoj biznisa, pa nakon toga i do Menadžera sektora kontrolinga. Svoju karijeru nastavlja u multinacionalnoj kompaniji ABL Production, na mestu Direktora Prodaje. U međuvremenu, sa dva svoj a prijatelja, pokreće startap pod nazivom Bizpartner, čiji je cilj bio razvoj IT rešenja prilagođenih zahtevima korisnika iz domena SME-a.', NULL, NULL),
(4190, 90, 1874, 'Uzimajući u obzir trenutne obaveze, posvećenost startapu je u ovom momentu delimična. Značajno veće angažovanje je tokom vikenda, dok su radni dani posvećeni uglavnom radu za kompaniju u kojoj sam zaposlen. U razvoju biznis ideje sam učeo sa aspekta komercijalne primene, analize tržišta, predstavljanja potencijalnog rešenja klijentima i naprednog izveštavanja o ostvarenim prerformansama.', NULL, NULL),
(4191, 91, 1874, 'Pored startap priče, angažovan sam na poziciji Direktora Prodaje u kompaniji ABL Production DOO u trajanju od najmanje 40 radnih sati nedeljno.', NULL, NULL),
(4192, 89, 1875, 'IT Menadžer sa preko 20 godina rada u razvoju i administriranju ERP rešenja u kompanijama ALTI i WinWin Doo. Svoja znanja je pretočio u konsultantsku praksu usmerenu na pomoć srednjim i velikim preduzećima da digitalno transformišu svoje poslovanje. Svoja znanja temelji na best practice veštianam iz domena projektovanja softverskih rešenja i unapređenja poslovnih procesa u organizaciji.', NULL, NULL),
