(4233, 63, 1899, 'Osnova biznis ideje je korišćenje mogućnosti Time Scale Calculusa - TSC u IT. Jedna od ključnih stručnih\r\nideja je softversko razmatranje odnosa konačno-praktično beskonačno (malo ili veliko), opisano u više naučnih radova i konferencija, u oviru CV-ja,\r\nuz razvoj samog TSC. Prva osnova primena u tim radovima, jeste modeliranje Mihaelis-Mentenine kinetike (vremenske skale) sa idejom primene na ljudske tumore  u kliničkim uslovima, i programiranja procesa sinterovanja keramičkih materijala-  odnosa konačno(diskretno)-praktično beskonačno (kontinualno). Za konkretne parametre kinetičkih procesa autori su, kao parametar fitovanja koristili vremenski korak h, za koji se ispostavilo da je nula, odnosno,  vreme kinetike je bilo kontinualno. U slučaju sinterovanja, imaginarno vreme-temperatura je bila diskretna u optimalizovanom procesu. Još dve primene TSC diskretno-kontinualnog pristupa su softverski analizirani. Prva je bila precizno izmeren slobodan pad. Tu je fizičko vreme, u odnosu na tu seriju merenja,  bilo kontinualno. Takođe, za ML (mašinsko učenje), razmatrane su, u slučaju ekstremnog ML i datih podataka razne vremenske skale na više načina. Rezultati nisu jedinstveni. \r\n\r\nhttps://en.wikipedia.org/wiki/Time_scale\r\nhttps://en.wikipedia.org/wiki/Time-scale_calculus\r\nhttp://timescalewiki.org/index.php/Main_Page\r\nhttps://sh.wikipedia.org/wiki/Enzimska_kinetika\r\nhttps://www.researchgate.net/publication/308017805_Multistep_generalized_transformation_method_applied_to_solving_equations_of_discrete_and_continuous_time-fractional_enzyme_kinetics ,\r\nhttps://www.researchgate.net/publication/312486696_Multistep_Transformation_Method_for_Discrete_and_Continuous_Time_Enzyme_Kinetics ,\r\nhttps://www.researchgate.net/publication/323086316_Discrete_temperature_values_in_the_sintering_process_as_a_BaTiO3-ceramics_properties_parameter ,\r\nhttps://www.researchgate.net/project/A-New-Approach-to-TSC-in-Biophysical-Processes ,\r\nhttps://ekonferencije.com/sr1/autor/zoran-vosika/2149 .', NULL, NULL),
