(4260, 89, 1909, 'septembar 2017. – sada Profesor matematike i informatike, OŠ „Milivoj Omorac“, Iđoš; OŠ „Feješ Klara“, Kikinda\r\nGlavni poslovi i odgovornosti: Predmetna nastava iz matematike i informatike; održavanje školskog sajta; administracija e-dnevnika; razredno starešinstvo\r\nseptembar 2016. – avgust 2017. Profesor matematike/ Profesor računarstva i informatike, SSŠ „Tehnička Škola Kikinda“ decembar 2015. – septembar 2016. IT Referent, Banini A.D. Kikinda\r\nGlavni poslovi i odgovornosti: održavanje i unapređenje mrežne infrastrukture; odgovornost za ERP-rešenje-program UPIS; održavanje radnih stanica i poslovnih aplikacija; učešće u održavanju baze podatak (ispravka, arhiva, migracija); praćenje, ažuriranje, održavanje Web portala\r\njun 2015. - sada Prevodilac za Khan Akademiju (sr.khanacademy.org)\r\nGlavni poslovi i odgovornosti: prevođenje matematičkih i programerskih sadržaja sa engleskog jezika na srpski jezik septembar 2009. - februar 2015. Profesor matematike, OŠ „Žarko Zrenjanin“, Kikinda\r\nGlavni poslovi i odgovornosti: predmetna, dodatna, dopunska i pripremna nastava iz matematike; razredno starešinstvo\r\n2012. / 2013. “Rad sa talentovanom decom”, Centar za stručno usavršavanje, Kikinda (www.csu.rs)\r\n-Samostalno stičem praktične veštine primene IT tehnologija. Paralelno se usavršavam za Java programera i Web programera\r\nTehnologije koje sam upoznao: Java, Eclipse, SQL, Swing, HTML, CSS, JavaScript, PHP, Bootstrap, jQuery, JSON, AJAX, React.js\r\nSamostalno urađeni projekti:\r\nWeb: Web-sajt namenjen đacima kojima predajem matematiku i informatiku\r\nJava: -Program sa GUI-om, koji na osnovu unetih tačnosti zadataka određuje ocenu iz pismene provere iz matematike koja se sastojala od pet zadataka različite težine (prvi i drugi su osnovnog, treći i četvrti srednjeg a peti naprednog nivoa postignuća) github link\r\n-Program za izračunavanje postignutog uspeha učenika u školi', NULL, NULL),
