(4275, 25, 1918, 'Rizičnost arhitektnoskih konkursa za arhitektonske biroe i investitore koji bi se za njih odlučili. Problem je globalan i do Arch-a nije napravljeno nijedno sistemsko rešenje. \r\nProblem je uočen iz ličnog iskustva rada kao arhitekte koji učestvuje na konursima, ali i u okviru investitorske koja je bila zainteresovana da organizuje arhitektonski konkurs.', NULL, NULL),
(4276, 26, 1918, 'Tržište je globalno tržište investicija u izgradnju objekata koje u proseku godišnje iznosi oko 650 milijardi dolara investicija.  (www.msci.com)\r\nOsvajanje tržišta EU učlanjenjem top 1000 arhitektonski biroa na ovom prostoru do dve godine od trenutka lansiranja startapa.', NULL, NULL),
(4277, 27, 1918, 'Rešavamo problem arhitektonskim biroima koji mogu biti otkriveni i zapaženi mnogo lakše nego danas kada su sa marketinške strane veoma ograničeni, pa time i sa strane prilika, a dobijanje poslova zavisi skoro isključivo od konekcija i preporuka investitorima. \r\n\r\nRešavamo problem i investitorima koji ne mogu organizovati arhitektonske konkurse zbog komplikovanosti sadašnje procedure, pa angažuje one biroe na koje naiđu ili za koje dobiju preporuku. Globalno tržište je gotovo nedostupno i zahteva velike marketinške troškove koji značajno povećavaju troškove organizacije konkursa. \r\n\r\nIz intervju sa 5 partnera ili vlasnika biroa u Srbiji i 2 u Austriji, kao i tri investitora u Srbiji, potvrdili smo uočene probleme oko organizacije i učestvovanja u konkursu, sve se svodi na rizik. Rizik biroa da će raditi uzalud, a rizik investitora da će se na otvorenom konkursu javiti samo oni koji su spremni da rade bez naknade, što očekivano često nisu najkvalitetniji biroi.', NULL, NULL),
(4278, 28, 1918, 'Proces organizovanja konkursa je sama inovacija, kombinacijom otvorenog i pozivnog konkursa, sa ograničenim brojem učesnika i unapred određenom raspodelom fonda gde svako od učesnika dobija određeni deo ukoliko ispuni propozicije konkursa na koji je pozvan.', NULL, NULL),
(4279, 30, 1918, 'Arhitektonski biroi prate sajtove Udruženja arhitekata svoje države i pažljivo biraju konkurse na kojima će učestvovati, pa zbog toga se i retko odlučuju na takav korak. \r\n\r\nInvestitori koji uspeju da organizuju konkurs obično organizuju u saradnji sa nekom od institucija, poput nadležnog Ministarstva ili opet lokalnog Udruženja Arhitekata.', NULL, NULL),
(4280, 29, 1918, 'Biroi dobijaju lakoću u prezentovanju svog rada i povezivanju sa kolegama, ali i pronalaženju inspirativnih projekatnih zadataka i time mnogo lakše finansijsko izdržavanje bavljenje samo suštinskim kreativnim procesom projektovanja - izradom idejnih projekata. \r\n\r\nInvestitori izborom od većeg broja kvalitetnih rešenja koji mogu doći iz celog sveta dobijaju gotovo sigurno kvalitetnije projekte nego li angažovanjem pojedinačne lokalne firme, i time kompetitivnu prednost na svom tržištu.', NULL, NULL),
(4281, 32, 1918, 'Ne postoji mesto gde se mogu onlajn organizovati arhitektonski konkursi (postoje mesta za organizovanje konkursa vezanih za grafički dizajn poput 99designs), niti prava društvena mreža za arhitektonske biroe, naročito ne ona koja funkcioniše na principu pozivnica (poput Dribbble-a), na kojoj ne može svako napraviti profil.', NULL, NULL),
