(4329, 63, 1943, 'Aplikacija i sajt za poručivanje namirnica „Fabrika dobre hrane“ nudi mogućnost uštede vremena i troškova koji se javljaju u svakom domaćinstvu u procesu pripreme hrane. S druge strane povezuje dobavljače sa kupcima i doprinosi rešavanju mnogih problema koji se javljaju i sa jedne i sa druge strane. Naime, aplikacija i sajt će funkcionisati tako što korisniku omogućava da u skladu sa svojim željama i potrebama izabere obroke koje želi da konzumira u toku nedelje, a sveži i kvalitetni sastojci za pripremu istih će mu stići na kućni prag u zapakovanoj kutiji od recikliranog materijala.\r\nŠta korisnik dobija:\r\n-	recepte sa jasnim informacijama koji se mogu lako slediti\r\n-	kvalitetne sastojke potrebne za pripremu obroka\r\n-	pogodna pakovanja koja se savršeno uklapaju u frižider\r\n-	zabavno iskustvo u kuvanju\r\nS druge strane, namirnice se nabavljaju od strane lokalnih proizvođača i trgovinskih lanaca. Nakon završenog roka za prijavu isporuke namirnica za narednu nedelju, sve porudžbine se grupišu i sortiraju, a zatim šalje zahtev dobavljačima. Dobavljači odgovaraju  na zahtev i šalju proizvode u distributivni centar gde se priprema i pakuje pošiljka za svakog korisnika, a zatim i se vrši i isporuka.\r\nOvaj koncept se primenjuje na drugim tržištima, a najzastupljeniji je u Sjedinjenim Američkim Državama. Uzimajući u obzir trend sve bržeg životnog stila u domaćim okvirima, ali i efekta koji on ima na okolinu, došli smo do potencijalnog rešenja koji će omogućiti ne samo benefite za korisnike, već i na okruženje u pogledu smanjenja otpada koji se svake godine povećava u Srbiji.Korisnici će takođe imati mogućnost da dobiju savete i sugestije od strane nutricioniste po pitanju ishrane što dovodi do pozitivnog efekta na zdravlje korisnika. Pored toga, smanjuje se mogućnost kontakta i potreba za kontinuiranim posetama maloprodajnih objekata i pijaca što predstavlja idealno rešenje za novonastalu situaciju i način života uzrokovan pandemijom virusa COVID-19.', NULL, NULL),
(4330, 71, 1944, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4331, 17, 1945, 'Aplikacija i sajt za poručivanje namirnica „Fabrika dobre hrane“ nudi mogućnost uštede vremena i troškova koji se javljaju u svakom domaćinstvu u procesu pripreme hrane. S druge strane povezuje dobavljače sa kupcima i doprinosi rešavanju mnogih problema koji se javljaju i sa jedne i sa druge strane. Naime, aplikacija i sajt će funkcionisati tako što korisniku omogućava da u skladu sa svojim željama i potrebama izabere obroke koje želi da konzumira u toku nedelje, a sveži i kvalitetni sastojci za pripremu istih će mu stići na kućni prag u zapakovanoj kutiji od recikliranog materijala.\r\nŠta korisnik dobija:\r\n-	recepte sa jasnim informacijama koji se mogu lako slediti\r\n-	kvalitetne sastojke potrebne za pripremu obroka\r\n-	pogodna pakovanja koja se savršeno uklapaju u frižider\r\n-	zabavno iskustvo u kuvanju\r\nS druge strane, namirnice se nabavljaju od strane lokalnih proizvođača i trgovinskih lanaca. Nakon završenog roka za prijavu isporuke namirnica za narednu nedelju, sve porudžbine se grupišu i sortiraju, a zatim šalje zahtev dobavljačima. Dobavljači odgovaraju  na zahtev i šalju proizvode u distributivni centar gde se priprema i pakuje pošiljka za svakog korisnika, a zatim i se vrši i isporuka.\r\nOvaj koncept se primenjuje na drugim tržištima, a najzastupljeniji je u Sjedinjenim Američkim Državama. Uzimajući u obzir trend sve bržeg životnog stila u domaćim okvirima, ali i efekta koji on ima na okolinu, došli smo do potencijalnog rešenja koji će omogućiti ne samo benefite za korisnike, već i na okruženje u pogledu smanjenja otpada koji se svake godine povećava u Srbiji.Korisnici će takođe imati mogućnost da dobiju savete i sugestije od strane nutricioniste po pitanju ishrane što dovodi do pozitivnog efekta na zdravlje korisnika. Pored toga, smanjuje se mogućnost kontakta i potreba za kontinuiranim posetama maloprodajnih objekata i pijaca što predstavlja idealno rešenje za novonastalu situaciju i način života uzrokovan pandemijom virusa COVID-19.', NULL, NULL),
(4332, 22, 1945, 'Milivoje Jovanović i Vladan Risantijević su suosnivači udruženja ENECA koje od 2005. godine je aktivno na polju socio-ekonomskog razvoja. Od osnivanja udruženja uspešno je implementiran veliki broj nacionalnih i internacionalnih projekata. Saradnja sa profesorom gastronomije Momčilom Conićem uspostavljena je 2019. godine prilikom implementacije projekta \"Južnjačka korpa ukusa\" koji je realizovala ENECA, a na kome je profesor bio angažovan kao eksterni ekspert. Saradnja je nastavljena i u godinama koje slede.', NULL, NULL),
(4333, 23, 1945, 'Istraživanjem tržišta, došli smo do podataka da je problem gojaznosti i nedostatak vremena za pripremu kvalitetnog i zdravog obroka jedan od osnovnih problema današnjice koji se može rešiti korigovanom ishranom i predstavlja jedan od izazova koji zahtevaju posebnu pažnju. Iako postoji mnogo preporuka o tome kako se zdravo hraniti, ali oni često koriste sastojke koji nisu dostupni na našem tržištu ili su cenovno nepristupačni većini stanovništva.  Zbog toga je neophodno ponuditi recepte odnosno sastojke koji se mogu naći na domaćem tržištu i koji potiču od domaćih proizvođača hrane. Zato Fabrika dobre hrane daje rešenje u vidu aplikacije koja omogućava korisnicima da kreiraju obroke prema svojim potrebama i dobiju preporuke/recepte za obroke koji se mogu naći i pripremiti od domaćih sastojaka, kao i mogućnost naručivanja već gotovih domaćih proizvoda. Imajući u vitdu novonastalu sitaciju pandemije Covid19, aplikacija će predstavljati idealno rešenje u uslovima izmenjenog načina snabevanja.', NULL, NULL),
(4334, 24, 1945, 'Fabrika dobre hrane unosi u Vaš dom svež i kvalitetan izvor zdravlja iz svih krajeva Srbije', NULL, NULL),
(4335, 25, 1945, 'Gojaznost predstavlja jedan od osnovnih globalnih problema koji se može rešiti korigovanom ishranom i  zahteva posebnu pažnju i efikasno rešenje. Istraživanjem tržišta pokazuje da prevalencija gojaznosti  iznosi 61% što je dosta u poređenju sa prosečnom gojaznošću u svetu (38%). Iako postoji mnogo recepata i preporuka kako se zdravo hraniti, oni često koriste sastojke koje je teško naći na našem tržištu. Pravilna ishrana je osnovni faktor optimalnog rasta i razvoja ljudskog tela i direktno utiče na njegovu radnu sposobnost i očekivani životni vek. Današnju ishranu karakterišu neredovni i neuravnoteženi obroci što predstavlja faktor rizika za razne bolesti. Ishrana je osnova zdravog života, a rešenje koje nudimo je aplikacija koja omogućava korisnicima da kreiraju obroke prema svojim potrebama i dobiju preporuke i recepte za obroke koji se mogu pripremiti od domaćih sastojaka, kao i mogućnost naručivanja već gotovih domaćih proizvoda.', NULL, NULL),
(4336, 26, 1945, 'U početku, primarno tržište obuhvataće teritoriju grada Niša, a kasnije razvojem platforme i uspešnim pilotiranjem planirano je širenje tržišta na ostatak zemlje, pre svega na Beograd, Novi Sad i Kragujevac, kao i na određene turističke centre.', NULL, NULL),
(4337, 27, 1945, '•	Višečlane porodice koje su u radnom odnosu\r\n•	Penzioneri i lica starija od 60 godina\r\n•	Porodice sa malom decom\r\nPilot projekat bi bio usmeren na grad Niš koji sa 260.000 stanovnika predstavlja glavni centar regiona. Takođe je i univerzitetski centar gde postoji 13 fakulteta sa oko 30.000 studenata. U Nišu je u prethodnom periodu otvoren veliki broj fabrika tako da sve to utiče na kvalitet života u gradu, i samim tim predstavlja veliki potencijal za razvoj projekta. Fabrika dobre hrane poseduje prostor (imaće namenu distributivnog centra) koji može da koristi za potrebe implementacije projekta. Ciljano lokalno tržište je idealno za pilotiranje i testiranje apliakcije jer su navike i potrebe ljudi u Nišu poznati i samim tim promotivne aktivnost bi bile prilagođene tome. Sa razvojem aplikacije i uspešnim pilotiranjem plan je da se tržište proširi i na Beograd, Novi Sad i Kragujevac. Dalji razvoj ovog projekta bi obuhvatio internacionalizaciju zemalja CEFTE i EU.', NULL, NULL),
(4338, 28, 1945, 'Aplikacija i sajt omogućiće korisnicima da kreiraju obroke prema svojim potrebama i dobiju  preporuke/recepte za obroke koji se mogu naći/pripremiti od domaćih sastojaka, uključujući i naručivanje već gotovih proizvoda. U Srbiji postoje aplikacije koje se bave naručivanjem hrane koje određuju min. količinu za kupovinu, što rezultuje gomilanjem hrane. Fabrika dobre hrane omogućava korisniku da dobije tačnu količinu namirnica za određeni period, preporuke za pripremu željenih obroka i podatke o nutritivnim vrednostima, što je dodatni benefit u odnosu na već postojeće aplikacije. Tehnologija koja će se koristiti pri izradi aplikacije je  Flutter, a kod izrade sajta WordPress/WooCommerce.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(4339, 30, 1945, 'U Srbiji postoji veliki broj aplikacija koje se bave naručivanjem hrane i svode se na naručivanje gotove hrane iz restorana, za naručivanje direktno od proizvođača ili velikih trgovaca koji direktno dostavljaju robu kupcima. Određivanjem minimalne količine za kupovinu sve ove aplikacije podstiču značajniju potrošnju i utiču na gomilanje zaliha hrane.  Takođe odlaskom u markete kupac je izložen različitim marketinškim trikovima, što rezultuje gomilanjem hrane.\r\nOtpad od hrane postaje problem širom planete. U Srbiji svaki stanovnik godišnje baci oko 350kg hrane. Srbija na godišnjem nivou generiše oko 900.000, a na deponijama završi oko 500.000 tona hrane. Fabrika dobre hrane  bi omogućila racionalnu upotrebu namirnica i smanjenje otpada hrane. Korisnik  bi dobio određenu količinu namirnica koje su mu neophodne za određeni period, preporuke za spremanje željenih obroka i podatke o nutritivnim vrednostima, što predstavlja dodatni benefit u odnosu na već postojeće aplikacije.', NULL, NULL),
(4340, 29, 1945, 'Jednostavnost i fleksibilnost. Nakon kreiranja profila, ne vrši se ponovni unos podataka, već se fokusira samo na odabir jela i namirnica. U meniju će postojati mogućnost odabira jela u skladu sa parametrima koje korisnik unese (režim ishrane, veganski meni) uz preporučene nutritivne vrednosti. Korisnik dobija i karticu sa svim detaljima o obroku koji je poručio (način pripreme, korisne savete, itd.). \r\nSmanjenje i eliminisanje otpada uz smanjenje troškova. Kupovinom namirnica na nedeljnom i/ili mesečnom nivou, potrošači kupe oko 28% više namirnica nego što je potrebno. Upotrebom naše aplikacije/sajta, korisnik dobija upravo onoliko namirnica koliko mu je potrebno za pripremu svih obroka koje je naručio. \r\nInovativno rešenje za trenutnu situaciju. Zbog pandemije Korona virusa ograničeno je kretanje stanovništva. Upotrebom aplikacije/sajta eliminiše se potreba za izlaskom sa ciljem nabavke namirnica za ishranu, a iste se nabavljaju u količini koja je potrebna za ishranu.', NULL, NULL),
(4341, 32, 1945, 'Aplikacija i sajt za poručivanje namirnica „Fabrika dobre hrane“ nudi mogućnost uštede vremena i troškova koji se javljaju u svakom domaćinstvu u procesu pripreme hrane. S druge strane povezuje lokalne dobavljače sa kupcima i doprinosi rešavanju mnogih problema koji se javljaju i sa jedne i sa druge strane. Naime, aplikacija i sajt će funkcionisati tako što korisniku omogućava da u skladu sa svojim željama i potrebama (dijetom, vrstom ishrane i sl.) izabere obroke koje želi da konzumira u toku nedelje, a sveži i kvalitetni sastojci za pripremu istih će mu stići na kućni prag u zapakovanoj kutiji od recikliranog materijala. Trenutno u Srbiji ne postoji aplikacija koja na ovaj način rešava probleme kupaca proizvoda a i samim lokalnim proizvođačima.', NULL, NULL),
(4342, 37, 1945, 'Patent još uvek nije zaštićen ali se planira zaštita nakon izrade aplikacije i veb sajta.', NULL, NULL),
(4343, 40, 1945, 'Preduzeće koje će biti osnovano ostvarivaće prihode prodajom svojih proizvoda, odnosno isporukom proizvoda (meal in the box) potencijalnom kupcu. Isporuka pojedinačnom kupcu isporučuje se jednom nedeljno, dok je prosečna vrednost isporuke uzeta u obzir oko 5.000 dinara. Prilikom projekcije prihoda uzeto je u obzir da će očekivani početak isporuke proizvoda biti drugi kvartal 2022. godine, ali se početak rada, u punom kapacitetu, očekuje početkom 2023. godine.\r\nPreduzeće će se u početku finansirati iz sopstvenih sredstava, dok će se već u 2023. godini veći deo poslovanja finansirati iz tekuće prodaje.', NULL, NULL),
(4344, 41, 1945, 'Istraživanjem došli smo do zaključka da popularni programi zdrave ishrane poput Keto i Hrono ishrane nisu adekvatno i u dovoljnoj meri primenjljivi na našem tržištu usled nepristupačnosti namernicama stranog porekla. Razvojem aplikacije i sajta doprinećemo rešenju problema i omogućiti dostupnost gore pomenutih programa zdrave ishrane u Srbiji uz pomoć domaćih sastojaka. Razvoj aplikacije nalazi se u početnoj fazi. Tim za razvoj ovog poslovnog koncepta trenutno čine pet člana koji su razvili sam model i plan razvoja poslovnog modela. Da bi se stekli uslovi za razvoj prototipa potrebno je uspostaviti kontakt i poslovnu saradnju sa lokalnim proizvođačima od kojih bi se nabavljale namirnice za isporuku korisnicima. Naredni korak je izrada menija kako bi se izvršilo prilagođavanje različitim režimima ishrane i specifičnim dijetetskim potrebama. Nakon izrađenog sledilo bi ugovaranje saradnje sa dobavljačima,  izrada Android aplikacije i unapređenje i prilagođavanje sajta', NULL, NULL),
(4345, 44, 1945, 'Ivan Vesić je učestvovao u programima akceleratora Eleven i TechStars, a po završetku programa postao je mentor za startape iz mlađih generacija, i bio je član investicionog komiteta fonta Eleven. Ivan je, takođe, bio direktor programa i glavni predavač NiCAT Startap Akademije, podržane od strane GiZ-a, u Nišu.', NULL, NULL),
(4346, 45, 1945, 'N/A', NULL, NULL),
(4347, 48, 1945, 'Verujemo u ideju sa kojom konkurišemo i smatramo da  učešće na programu Raising starts može doprineti njenoj realizaciji. Pored finansijske podrške, svakako je od velike, ako ne i podjednake važosti,  dobijanje dodatne podrške odnosno kroz dobijanje specijalizovane obuke i mentorske podrške a sve u cilju razvoja prototipa i razvoja poslovanja.', NULL, NULL),
(4348, 49, 1945, '15.000 CHF, za razvoj aplikacije i marketinga, mentorska podrška, edukacija, povezivanje sa startap ekosistemom i investitorima', NULL, NULL),
