(4352, 83, 1951, NULL, NULL, NULL),
(4353, 89, 1952, 'Milivoje je diplomirao na fakultetu Univerziteta u Sheffieldu u Velikoj Britaniji i postao je izvršni MBA, sa specijalizacijom iz finansija. Od početka karijere ekonomiste, Milivoje Jovanović je svoj rad i obrazovanje usmerio na stručnu podršku razvoju preduzetnika i MSP sektora u Srbiji. Kao jedan od osnivača ENECA-e (udruženja ekonomskih stručnjaka) 2005. godine, specijalizovao se za pružanje konsultantskih usluga i donacije za osnivanje novih preduzeća u poljoprivredi, zanatstvu, proizvodnji i uslugama.', NULL, NULL),
(4354, 90, 1952, 'Potpuno posvećen. Kreatror ideje', NULL, NULL),
(4355, 91, 1952, 'Program manager,  suosnivač ENECAe', NULL, NULL),
(4356, 89, 1953, 'Vladan Risantijević je trenutno predsednik Upravnog odbora organizacije ENECA. Jedan je od osnivača ENECA-e (februar 2005.) i od tada je, kao menadžer projekata, bio uključen u realizaciju brojnih projekata od donatora poput EU, UNDP-a, Climate-KIC-a, Srpske razvojne agencije, Fondacije Erste banke, Fonda braće Rockfeller , Nacionalna alijansa za lokalni ekonomski razvoj (NALED). Vladan je trenutno na master akademskim studijama inženjerstva zaštite životne sredine na Fakultetu zaštite na radu Univerziteta u Nišu. Godine 2001. Vladan je diplomirao na Elektronskom fakultetu Univerziteta u Nišu. Preko mobilnog operatera kombinovao je znanje o IT tehnologijama sa iskustvom iz sektora MSPP u Srbiji.', NULL, NULL),
(4357, 90, 1953, 'Potpuno posvećen. Kreatror ideje', NULL, NULL),
(4358, 91, 1953, 'Predsednik Upravnog odbora, suosnivač ENECAe', NULL, NULL),
(4359, 89, 1954, 'Ivan je osnivač veterinarskog SaaS provajdera VetCloud baziranog u UK, podržanog od strane akceleratora TechStars, i sertifkovani konsultant u oblasti digitalne transformacije sa fokusom na online trgovinu i digitalni marketing. Bio je uključen u realizaciju različitih projekata vezanih za startape i preduzetništvo podržanih od strane GiZ-a i NiCAT klastera. Ivan je takođe vlasnik agencije Lean Collective koja se bavi razvojem web prodavnica, ecommerce aplikacija, marketišnke automatizacije i konsaltingom u oblasti online prodaje, uglavnom za klijente iz SAD, i osnivač EmailBeaver.com koji se bavi email marketingom, kao podizvođač za vodeće američke marketinške agencije. Kao savetnik za fundraising pomogao je brojnim startapima da dođu do investicija, uglavnom od strane akceleratora i VC fondova.', NULL, NULL),
(4360, 90, 1954, 'U većoj meri prosvećen', NULL, NULL),
(4361, 91, 1954, 'Osnivač, VetCloud', NULL, NULL),
(4362, 89, 1955, 'Momčilo Conić je gastronom, profesor Visoke poslovne škole Leskovac, Akademija strukovnih studija Južna Srbija, i gostujući predavač na Fakultetu za turizam i ugostiteljstvo u Ohridu. Imao je prilike da učestvuje na brojnim takmičenjima iz oblasti kulinarstva i gastronomije. Kao mentor osvojio je  brojne medalja na internacionalnim takmičenju. Član je velikog broja internacionalnih  asocijacija. Poseduje značajno iskustvo koje je od velike važnosti za uspešnu implementaciju poslovne ideje.', NULL, NULL),
(4363, 90, 1955, 'U većoj meri prosvećen', NULL, NULL),
(4364, 91, 1955, 'profesor Visoke poslovne škole Leskovac, Akademija strukovnih studija Južna Srbija, i gostujući predavač na Fakultetu za turizam i ugostiteljstvo u Ohridu', NULL, NULL),
(4365, 71, 1958, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4366, 63, 1959, 'Uređaj za uništavanje ambrozije se sastoji od elektronskih komponenata i elektroda, pomoću određene frekvencije i struje, bez hemijskih jedinjenja i pesticida uništava korov u korenu, ekološkim putem, korov ne raste više tokom sezone.', NULL, NULL),
(4367, 71, 1960, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4368, 17, 1961, 'Uređaj za uništavanje ambrozije se sastoji od elektronskih komponenata i elektroda, pomoću određene frekvencije i struje, bez hemijskih jedinjenja i pesticida uništava korov u korenu, ekološkim putem, korov ne raste više tokom sezone.', NULL, NULL),
(4369, 22, 1961, 'Pojedini članovi tima su sarađivali na ravoju inovacije, u tehnuičkom i operativnom delu razvoja, a neki na dokazivanju njene funkcionalnosti i primene u poljoprivredi (praćenje efikasnosti uništavanja korova u poljoprivredi).', NULL, NULL),
(4370, 23, 1961, 'Motivisala nas je želja za osnivanjem nove firme i praktičnom primenom inovacije u privredi – komercijalizacijom, kao i podrška programa prilikom razvoja i plasmana na tržište.', NULL, NULL),
(4371, 24, 1961, 'Ekološki, brzo i efikasno!', NULL, NULL),
(4372, 25, 1961, 'Rešavamo trajni problem uništavanja ambrozije i korova. Odmah na početku sezone uređajem uništavamo ambroziju ili druge korove koji kreću da rastu. Problem je na globalnom novou, jer duži niz godina pokušavaju da unište ambroziju brojnim sredstvima, najviše hemijskim čime se zagađuje životna sredina, a korov je postao veoma otporan na brojne vrste pesticida. Trimerom i kosilicom privremeno uništavaju korov koji ponovo izraste. \r\nAmbrozija je globalni problem u celom svetu. Prema navodima Svetske zdravstvene organizacije u svetu oko 10% populacije pati od polena ambrozije.', NULL, NULL),
(4373, 26, 1961, 'Tržište možemo podeliti u tri segmenta, jedan je za poljoprivredu, drugi za domaćinstva i treći je za javne površine kao što su gradski parkovi, livade, i drugo. Poljoprivrednih gazdinstava u R. Srbiji ima registrovanih preko 600.000. Sve više fizičkih lica, kao i kompanija – gazinstava prelazi na organsku proizvodnju i potrebni su im ekloški uređaji za uništavanje korova. Veliki broj ljudi u Srbiji živi u kućama koje imaju bašte, a jedan deo njih ima vikendice. JKP koja su zadužena za uništavanje ambrozije na javnim površinama po gradovima (Gradova u Srbiji ima 24, a opština 175) ima veliki problem zbog neefikasnog i neekloškog uništavanja.\r\nU drugoj godini se planira širenje poslovanja na zemlje u regionu koje su obuhvaćene sa ambrozijom.', NULL, NULL),
(4374, 27, 1961, 'Potencijalni kupci su poljoprivredna gazdinstva, fokus su organski proizvođači, jer ekološkim proizvodom veoma efikasno uništavju korov na početku sezone. Tokom prethodnih deset godina, vršena su testiranja i atestiranja po njivama, staklenicima, livadama, baštama i parkovima u Srbiji, Sloveniji, Nemačkoj, Ruskoj Federaciji i Švedskoj u saradnji sa Švedskim univerzitetom za poljoprivredu koji je atestirao uređaj na preko 100 vrsta korova.\r\nTakođe, kupci su JKP Gradska zelenila koja trenutno za uništavanje ambrozije koriste pesticide, trimere i kosilice. Zainteresovanst su pokazali zvanicno: JKP Gradsko zelenilo Grada Beograda, Zavod za biocide i medicinsku ekologiju, Sekretarijat za privredu i Sekretarijat za zaštitu životne sredine Grada Beograda.\r\nLjudi koji poseduju svoja gazdinstva i vikendice, imaju bašte i placeve.\r\nRešavamo problem ljudima koji pate od polena ambrozije, kojih je samo u Srbiji preko 1,5 milion.', NULL, NULL),
(4375, 28, 1961, 'Uređaj se sastoji od elektronske kutije i štapa. Uređaj se napaja na bateriju ili iz mreže. Napravljen je veliki stepen zaštite bezbednosti na radu, tako da je uređaj bezbedan za čoveka koji rukuje sa njim. Delovanjem određene struje i frekvencije, fizičkim kontaktom uništava se ambrozija u korenu i ne raste više tokom sezone.  Uređaj je ekološki, ne koriste se hemijska jedinjenja – pesticide. Trenutno postoje trimeri i kosilice koje samo trenutno reše problem koji se ponovo javi, kao i pesticide koji zagađuju životnu sredini. Imamo potpuno novu radikalno ekološku inovaciju na tržištu.', NULL, NULL),
(4376, 30, 1961, 'Na tržištu ne postoji slično rešenje niti proizvod. Trenutno se za uništavanje ambrozije koriste trimeri ili kosačice, ali one nisu efikasne jer samo trenutno uništavaju ambroziju, koja ponovo izraste. Takođe koriste se i pesticide koji zagađuju zemljište, hranu, podzemne pijaće vode i dr.', NULL, NULL),
(4377, 29, 1961, 'Prednost našeg proizvoda u odnosu na trimere i kosilice je ta što naš uređaj odmah uništava ambroziju koja više ne raste u toku sezone, dok košenje mora da se vrši na svake dve nedelje, u zavisnosti od vremenskih uslova, što iziskuje troškove ljudskih resursa i amortizacije troškova goriva za trimere i kosilice. Cene trimera su od 150 – 300 evra. Dok je prosečna cena trimera koji bi nam bio „konkurentan“ na osnovu analize tržišta 220 evra.\r\nPrednost našeg proizvoda u odnosu na pesticide, je ta što mi imamo ekološki proizvod i ne zagađujemo životnu sredinu. Pesticidima mora do tri puta da se tretira zemljište po sezoni, jedan tretman je 50 evra po hektaru, što znači da je 150 evra po sezoni po hektaru, takođe tu su i troškovi ljudskih resursa, goriva za traktore i amortizacija troškova mehanizacije, što je skuplje nego naš uređaj koji ostaje kupcu i narednih sezona.', NULL, NULL),
(4378, 32, 1961, 'Proizvod predstavlja radikalnu inovaciju, skroz drugačiju od kunkurencije, jer ekološkim putem pomoću određene frekvencije, trajno uništava korov u korenu koji ne raste više tokom sezone.  Ne zagađuje životnu sredinu i ekonomičniji je od svoje konkurencije. Uređaj se može postaviti na traktor, voz, kamion, ili ručni uređaj za domaćinstva i u gradskim parkovima.', NULL, NULL),
(4379, 37, 1961, 'Zaštićen i priznat patent u Srbiji br: 55534\r\nZaštićen i priznat patent u Švedskoj br: 540099\r\nPCT Međunarodna prijava patenta u Ženevi broj: WO2015119523A1\r\nPrema izveštaju iz Ženeve o međunarodnoj patentnoj pretrazi, ova inovacija ne postoji nigde u svetu, ima sve nivoe patentabilnosti, industrijske primene, noviteta i inventivnog nivoa.', NULL, NULL),
(4380, 40, 1961, 'Prodajom proizvoda JKPu, poljoprivrednim gazdinstvima – fokus su organski proizvođači, fizičkim licima koji imaju vikendice ili žive u kućama. \r\nCiljne kupce ćemo uslužiti tako što ćemo distribuirati proizvod u Srbiji u velikim lancima trgovine kao što si Yisk, Woby haus, Merkur, Tempo, Uradi sam, kao i u manjim radnjama koje prodaju alate i baštansku opremu (poput trimera i kosačica). Kupci koji su zainteresovani uglavnom posećuju velike lance trgovine ili maloprodajne objekte koje se bave tom delatnošću i moći će da kupe proizvod. Takođe pokrenućemo i on line prodaju putem veb sajta „Sve za kuću“, jer veliki broj fizičkih lica posećuje tu veb stranicu i kupuje baštansku opremu.\r\nDogovrili smo saradnju sa kompanijom Eudora koja je već 10 godina na tržištu, usko specijalizovana za poslove teleprodaje, telemarketinga i direktne prodaje.', NULL, NULL),
(4381, 41, 1961, 'Trenutno se desetak godina razvija inovacioni uređaj za uništavanje ambrozije – korova. Prvo se tehnički razvijala inovacija i konstantno usavršavala kako bi bila efikasnija i ekonomičnija, dok se nije došlo do krajnjeg prototipa, sa kolegama inženjerima. Posle tehničkih korekcija, patentirala se inovacija, nakon toga se testiralo u poljoprivredi sa kolegama biolozima iz pljoprivrede i uključili smo eksperta za ekonomiku poljoprivrde, kako bi dokazali da uređaj nije samo ekološki nego je i ekonomičniji u odnosu na konkurenciju.', NULL, NULL),
(4382, 44, 1961, 'Nismo.', NULL, NULL),
(4383, 45, 1961, 'Učestvovanje na takmičenju za najbolju tehnološku inovaciju 2015 godine u Srbiji, tim Abrozer.\r\nNagrada Grada Beograda za pronalazaštvo za 2017. godinu.', NULL, NULL),
(4384, 48, 1961, 'Potrebna je finansijska podrška u izradi nulte serije ručnog prototipa za proizvodnju i podrška oko plasmana inovacije na tržište.', NULL, NULL),
(4385, 49, 1961, 'Potrebno je do 35.000 eur za tehnički razvoj nove generacije uređaja, nulte serije. Kako bi se kasnije plasirala na tržište.', NULL, NULL),
