(4396, 17, 1972, 'Collabwriting je kolaboraciona platforma sa inovativnom multi-browser ekstenzijom koja korisnicima omogućava da komentarišu sadržaj bilo gde na web-u, delegiraju zadatke i organizuju korisne resurse.', NULL, NULL),
(4397, 22, 1972, 'Poslednje tri godine radili smo zajedno u startapu Teodesk, Ivan kao CTO/CEO i Sandra kao CCO. U tom periodu zajedno smo se susreli sa mnogim organizacionim i poslovnim izazovima koje smo timski rešavali. \r\n\r\nOd gubitka najvećeg klijenta na samom početku korona pandemije, do menjanja poslovnog fokusa i postajanja dela velike domaće grupacije, sve prepreke su nam omogućili da se bolje upoznamo i vidimo da se kroz dobar timski rad svi problemi mogu savladati.', NULL, NULL),
(4398, 23, 1972, 'Kao članovi Teodesk tima već smo imali priliku da budemo deo zajednice Naučno - tehnološkog parka i učestvujemo u mnogom programima koji su unutar njega organizovani. Ovo nam je bilo značajno kako za razvoj poslovanja u tom trenutku, tako i za dugoročno učenje o vođenju stratapa i stvaranje konekcije.\r\n\r\nRaising starts nam se čini kao odlična prilika da se ponovo uključimo u zajednicu i ovoga puta sa novom idejom. Nasuprot Teodesku koji je od samog početka bootstrap-ovan, naša ideja za Collabwriting jeste da prođemo kroz celokupan proces prikupljanja investicije. Ovo je oblast gde vidimo da možemo dodatno da se razvijemo kroz rad sa menotrima, ali i kroz povezivanje sa startapima koji već ostvarili neke od milestone-a koji nas tek čekaju.', NULL, NULL),
(4399, 24, 1972, 'Bringing collaboration closer to content', NULL, NULL),
(4400, 25, 1972, 'Content marketing timovi se svakodnevno suočavaju sa velikim obimom informacija koje se moraju istražiti, organizovati i razmeniti da bi se kreirao odličan sadržaj. Linkovi, zadaci i uputstva se šalju na više kanala i informacije se često gube.\r\n\r\nDodatni pritisak se stvara prilikom rada na daljinu, jer se često dešava da ne rade svi po istom rasporedu, čak ni u istoj vremenskoj zoni.\r\n\r\nSa istim ovim izazovima smo se i mi susreli tokom našeg rada. Nakon neuspešne potrage za rešenjem koje može da pomogne ne samo u distribuciji sadržaja, već i tokom kreiranja, videli smo da je ovo problem sa kojim se mnogi u CM industriji suočavaju.\r\n\r\n\r\nOvo je globalni problem, koji će daljim rastom i razvojem CM industrije dobijati sve više na značaju. Promene vezane za sigurnost podataka (primer: najava Gugla da će eliminisati third party kolačiće iz Chrome-a) će usloviti marketinške stručnjake da veću pažnju i resurse ulažu u content koji se na pravi način obraća njihovoj ciljnoj publici.', NULL, NULL),
(4401, 26, 1972, 'Naše ciljno tržište predstavljaju freelance content pisci, SEO agencije i content marketing agencije. Predviđa se da će veličina tržišta content marketinga porasti za 417,85 milijardi dolara tokom 2021-2025, uz CAGR od 16%. \r\n\r\nTrenutno postoji oko 650.000 in-house content pisaca i oko 1.000.000 frilensera, koje koordinira oko 280.000 marketing menadžera. Ovo će biti naša primarna niša sa izračunatim TAM-om od oko 687,23 miliona dolara.\r\n\r\nU naredne dve godine vidimo prostor da se proširimo na tržište Evropske Unije i SAD-a, što će zbog prirode posla content pisaca samo po sebi povući i korisnike iz Istočne Evrope i Delova Aziije (lokacije mnogih freelance članova tima).\r\n\r\nNeistraženo tržište za sad predstavljaju youtube content kreatori koji značajno vreme ulažu u istraživanje i planiranje.', NULL, NULL),
(4402, 27, 1972, 'Collabwriting rešava problem marketinškim profesionalacima fokusiranim na kreiranje kvalitetnog sadržaja. Trenutno balansiraju između Google Suite alata i nekoliko Trello bordova kako bi organizovali svoje aktivnosti.\r\n\r\nKako tražnja za sadržajem konstantno raste, oni su pod sve većim pritiskom. Umorni su od slanja istih informacija napred-nazad, uz sitne nesporazume koji stvaraju kašnjenja i učestale prepravke već završenog posla.\r\n\r\nNaš idealan kupac je već navikao da koristi softverska rešenja za dizajn, zakazivanje objava i praćenje metrika - samo im je potreban pravi alat koji će im pomoći da organizuju sam proces kreiranja sadržaja.\r\n\r\nDo sada smo imali priliku da komuniciramo sa nekoliko marketing stručnjaka i njihovo iskustvo je bilo slično našem. Iako postoje alati koji olakšavaju proces kreiranja sadržaja, uniformno rešenje koje je prilagođeno potrebama ove industrije bi značajno olakšalo rad.', NULL, NULL),
(4403, 28, 1972, 'Collabwriting je prva platforma koja efikasno spaja diskusije o sadržaju, delegiranje zadataka i upravljanje korisnim resursima.\r\n\r\nU startu će ključni deo Collabwriting aplikacije biti inovativna multi-browser ekstenzija koja omogućava korisnicima da komentarišu sadržaj bilo gde na web-u. Kao što sada možete da ostavite komentar na Google Doc-u, tako ćete pomoću ekstenzije moći da komentarišete bilo koju veb stranicu.\r\n\r\nObzirom da je sve više audio i video sadržaja na internetu, dalji plan razvoja Collabwriting aplikacije je u smeru razvoja ML NLP algoritma koji bi radio transkript videa i podkasta što bi omogućilo našim korisnicima da dele i komentarišu sadržaj kreiran na ovaj način.', NULL, NULL),
(4404, 30, 1972, 'Glavna 3 konkurenta koje trenutno koriste timovi za content marketing su:\r\n- Google drive – softver za skladištenje koji omogućava timovima da čuvaju, dele i pristupaju datotekama i folderima, istovremeno omogućavajući direktnu komunikaciju unutar svakog od njih. Koristi se za čuvanje i upravljanje korisnim linkovima, dokumentima, idejama o sadržaju i timskim diskusijama.\r\n- Trello – alatka za saradnju i produktivnost koja se koristi za upravljanje, praćenje i dodeljivanje zadataka i planova sadržaja.\r\n- Evernote Teams – kolaborativna aplikacija za vođenje beleški, uređenje i organizovanje misli, ideja i lista obaveza. Iako nije nužno ciljano na marketinške stručnjake, pomaže u fazi istraživanja tržišta i ideje stvaranja sadržaja.\r\n\r\nKao najčešće rešenje se izdvaja prvi konkurent koji kroz seriju alata donekle olašava organizaciju i zajednički rad content timova.', NULL, NULL),
(4405, 29, 1972, 'Zamislite da sa timom radite na tekstu “Startap ekosistem Srbije za 2021. godinu”. \r\n\r\nPrelistavate Netokraciju, Startit i ostale veb portale, pronalazite zanimljive činjenice koje možete da uključite u svoj tekst. Zatim ih kopirate u Google Doc, ostavljate link ka tekstu i svoj komentar ne bi li Vaše kolege razumele poentu. Kada vide podatke i link, oni odlaze na sajt, pokušavaju da dođe do konkretnog pasusa, vraćaju se na dokument, ponovo pronalaze pasus, ostavljaju svoj komentar. Ta back-and-forth razmena je problem sa kojim se susreće barem 2 miliona ljudi svakog dana.\r\n\r\nSa collabwriting-om se ovaj problem može zaboraviti. Inovativni web-page based pristup omogućava korisnicima da odu na konkretnu web stranicu, obeleže određeni pasus i direktno na pasusu ostave komentar, taguju članove tima ili prikače pasus za zadatak na kome rade.\r\n\r\nObeleženi pasusi na raznim portalima se kroz radnu površinu nalaze na konkretnom zadatku, laki za pretragu i adekvatno skladišteni za dalji rad.', NULL, NULL),
(4406, 32, 1972, 'Postojeći web-page based komunikacioni alati su usmereni samo na istraživače i ne pružaju dovoljnu podršku u proces planiranja koja je potrebna content marketing timovima. Nasuprot ovome, standardni project management alati i kolaborativne platofrme nisu prilagođene ovoj industriji i potpuno zanemaruju bitnu ulogu koju istraživanje zauzima u procesu kreiranja sadržaja.', NULL, NULL),
(4407, 37, 1972, '/', NULL, NULL),
(4408, 40, 1972, 'Zarađivaćemo kroz prodaju mesečnih i godišnjih licenci za korišćenje Collabwriting softvera. \r\nOpredlili smo se za freemium pricing model. Osnovne funkcionalnosti biće dostupne svim korisnicima, dok će one naprednije, zahtevnije za servere, biti rezervisane za korisnike koji plaćaju licencu.\r\nDo korisnika ćemo dolaziti kombinacijom SEO-a, plaćene promocije, platformi za lansiranje proizvoda i korišćenjem referral sistema.\r\nPočetni fokus će biti na organskom rastu putem SEO-a i sticanju novih korisnika putem preporuka. Na osnovu uvida koje budemo stekli iz ovoga i kada proizvod bude spreman, dalji fokus će biti na platformama za lansiranje proizvoda i plaćeno oglašavanje.', NULL, NULL),
(4409, 41, 1972, 'Na razvoju Collabwriting-a aktivno smo počeli da radimo u oktobru ove godine. \r\nU kratkom periodu od tad, već smo imali priliku da učesvtujemo na internacionalnom trodnevnom programu za startape, Henkel Xathon, koji se održao u Berlinu u novembru. Kao suosnivač, Sandra je prošla kroz intenzivne trodnevne radionice i proces pitchinga koji je doveo do odličnih povratnih informacija i korisnih kontakata za širenje na međunarodno tržište.\r\n\r\nTakođe, napravljeno je plan za dalji razvoj softvera, product video i sajt, dok će MVP biti gotov u narednih mesec dana.', NULL, NULL),
(4410, 44, 1972, 'Kao Collabwriting tim učestvovali smo na Xathon-u u Berlinu, međutim oba osnivača su prethodno imala prilike da učestvuju na više startap programa.\r\n\r\nPored programa Naučno-tehnološkog Parka, Ivan je učestvovao na Google Launch Pad programu kao deo Teodesk tima, dok je kompanija dalje bila deo Microsoft, IBM, EY i AWS stratap programa. Sandra je pored rada u Teodesku, godinu dana bila koordinator projekata namenjenim za razvoj preduzetništva u Srbiji u sklopu tima Privrednog foruma mladih, gde je prisustvovala velikom broju predavanja, radionica i pitch sesija.', NULL, NULL),
(4411, 45, 1972, 'Do sada nismo prikupili kapital iz eksternih izvora finansiranja.', NULL, NULL),
(4412, 48, 1972, 'Smatramo da nam je pomoć najpotrebnija kada su u pitanju pravne prepreke za širnje startapa na inostrana tržišta, kao i dodatni saveti vezani za proces prikupljnja investicije.\r\nPrethodni startap na kom smo radili je u potpunosti bootstrap-ovan, a pošto smo se za Collabwriting opredelili za drugačiji model rasta i razvoja kompanije, verujemo da bi nam značila iskustva preduzetnika koji su prošli kroz proces prikupljanjan sredstava kako od domaćih tako i od inostranih VC fondova.', NULL, NULL),
(4413, 49, 1972, 'Podizanje seed investicije je planirano za Q3 2022.\r\n\r\nDo kraja Q3 je planiran budžet od 36960 evra. Ovaj budžet bi nam pokrio razvoj FREE i PRO verzije aplikacije kao i lansiranje istih na platformama za lansiranje proizvoda (AppSumo i ProductHunt)\r\n\r\nNovac od programa Raising Starts bi bio upotrebljen ponajviše za razvoj i pripremu PRO verzije aplikacije za lansiranje na platformama za lansiranje proizvoda do kraja juna 2022. godine.\r\n\r\nPlanirana struktura troškova sredstava od Raising Starts programa:\r\n700e (7,49%) - Infrastruktura i prateći troskovi\r\n4800e (51,39%) - Razvoj proizvoda (Dodatni programer od aprila 2022)\r\n3840e (41,11%) - Razvoj poslovanja (Marketing/Business Associate od marta 2022)\r\n\r\nOstatak novca do kraja Q3 bismo obezbedili ili kroz druge dostupne programe za pomoć razvoja startapa ili kroz pre-seed rundu investicije.', NULL, NULL),
