(4418, 89, 1979, 'Sandra je po struci ekonomista sa tri ipo godine radnog iskustva u startapu. U Teodesku je bila na poziciji Chief Communications Officer, gde je pored koordinacije marketinškim aktivnostima učestvovala i u pregovorima sa potencijalni investitorima.\r\nPrethodno je radila kao koordinator za marketing i odnose s javnošću na nacionalnim projektima za osnaživanje omladinskog preduzetnišva Privredne komore Srbije, RAS-a i USAID-a, u sklopu nevladine organizacije Privredni formu mladih.', NULL, NULL),
