(4420, 91, 1979, NULL, NULL, NULL),
(4421, 89, 1980, 'Ivan je po struci diplomirani elektro-inženjer elektrotehnike i računarstva. Počeo da programira sa 8 godina, da zarađuje od dizajna i programiranja sa 14 godina. Preko 10 godina u biznisu počevši od frilensinga, preko outsourcing agencije i 3 startapa. Trenutno je generalni direktor Teodeska čiji je suosnivač. Teodesk je 5 godina stara firma koja se bavi isključivo razvojem softverskog rešenja pod istim imenom. Sa 15 članova tima, oko 300k evra godišnjih priliva Teodesk je predhodne godine postao deo Roaming Grupe koja je sad i većinski vlasnik kompanije.', NULL, NULL),
(4422, 90, 1980, 'U većoj meri posvećen', NULL, NULL),
(4423, 91, 1980, 'Part-time - prelazni period u prethodnom startapu', NULL, NULL),
(4424, 71, 1983, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4425, 71, 1984, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4426, 63, 1985, 'SNUFFLE je softver GIS aplikacija koja povezuje ljude i kućne ljubimce. Zasniva se na modernim programskim jezicima kao sto su Kotlin i Swift i modernim platformama kao sto je Digital Ocean. Svi koji imaju, brinu ili planiraju da imaju kućnog ljubimca mogu krenuti na ovo pet-friendly putovanje. Korisnik moze da razmenjuje poruke i raspolozenja sa drugim korisnicima, može poslati obaveštenje o izgubljenom ljubimcu. Počnite sa slučajnim prolazom i na kraju pronađite novog najboljeg prijatelja svog ljubimca gde možete ostaviti svog ljubimca bez brige dok ste van grada. Naši kućni ljubimci su više nego ikada važan deo naših porodica. Sada, SNUFFLE okuplja sve nas sa velikim srcem za naše voljene kućne ljubimce u jednu zajednicu prilagođenu kućnim ljubimcima. Saznajte koji kućni ljubimci žive oko vas u realnom vremenu i stupite u kontakt sa vlasnicima kućnih ljubimaca u vašem komšiluku.', NULL, NULL),
(4427, 71, 1986, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4428, 17, 1987, 'SNUFFLE je softver GIS aplikacija koja povezuje ljude i kućne ljubimce. Zasniva se na modernim programskim jezicima kao sto su Kotlin i Swift i modernim platformama kao sto je Digital Ocean. Svi koji imaju, brinu ili planiraju da imaju kućnog ljubimca mogu krenuti na ovo pet-friendly putovanje. Korisnik moze da razmenjuje poruke i raspolozenja sa drugim korisnicima, može poslati obaveštenje o izgubljenom ljubimcu. Počnite sa slučajnim prolazom i na kraju pronađite novog najboljeg prijatelja svog ljubimca gde možete ostaviti svog ljubimca bez brige dok ste van grada. Naši kućni ljubimci su više nego ikada važan deo naših porodica. Sada, SNUFFLE okuplja sve nas sa velikim srcem za naše voljene kućne ljubimce u jednu zajednicu prilagođenu kućnim ljubimcima. Saznajte koji kućni ljubimci žive oko vas u realnom vremenu i stupite u kontakt sa vlasnicima kućnih ljubimaca u vašem komšiluku.', NULL, NULL),
