(4450, 89, 1994, 'Prvo poslovanje u start-up. \r\nMarko Adamović ima 36 godina i odrastao je u Beogradu. Studirao je i živeo na više mesta u Evropi. Studirao je u Barseloni na Tehničkom univerzitetu u Barseloni dve godine dok je magistrirao Hidroinformatiku. Kasnije je doktorirao hidrologiju i meteorologiju u Francuskoj. Nakon završetka studija, počeo je da radi za međunarodne organizacije kao istraživač koji se bavi ključnim temama kao što su klimatske promene i održivost. Marko ima veštine programiranja i razume interfejse i korisničko iskustvo. Ima veliko interesovanje za prirodu i voli sve vrste životinja. On je istraživač u ovoj oblasti. Živeo je u mnogim gradovima širom sveta i mogao je da otkriva mesta i vidi radost kućnih ljubimaca u životima ljudi.', NULL, NULL),
(4451, 90, 1994, 'Kreator ideje. Potpuno posvećen.', NULL, NULL),
(4452, 91, 1994, 'Part time ugovor ima još godinu dana. Tri dana u nedelji je potpuno posvecen start up-u. Zeli da se vrati u Srbiju i osnuje start up, da zaživi i postane stalan posao i privuce mnogo zaposlenih.', NULL, NULL),
(4453, 89, 1995, 'Jeroen Verrezen ima 32 godine i odrastao je u Belgiji. Radio je u različitim oblastima muzike i zabave. Počevši sa 18 godina, počeo je da radi sa Live Nation gde je bio deo industrije žive muzike. Radio je sa IAAPA, međunarodnom asocijacijom za razvoj tematskih parkova, kao odgovorni za marketing, što mu je omogućilo da vidi tržišta u razvoju širom sveta. Trenutno je član odbora za Evropu i Bliski istok Tematske zabave. Radeći sa ključnim tehnološkim igračem u industriji, on trenutno neguje inovacije i novu tehnologiju u industriji tematskih parkova. On zna važnost inovacija, tehnologije, pripovedanja, korisničkog iskustva i brendiranja. Ima veliko srce za kućne ljubimce, i ceo život je živeo sa psima u kući - Ticom, Nuri i Bili.', NULL, NULL),
(4454, 90, 1995, 'Kreator ideje. Potpuno posvećen.', NULL, NULL),
(4455, 91, 1995, 'Part time posao kao savetnik. Uspešno kombinuje svoj posao sa start up-om. Ideja je da start up zaživi i postane stalan posao i donese takodje nova mesta za zaposlene.', NULL, NULL),
(4456, 71, 1996, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
