(4459, 91, 1999, 'Radim part-time u kompaniji Vis Health na poziciji Sales&Key Account Specialist-a. Takođe, student sam treće godine na fakultetu organizacionih nauka. Na učenje mi odlazi manji deo vremena. Spreman sam da se u potpunosti posvetim razvoju startapa.', NULL, NULL),
(4460, 89, 2000, 'Završila sam osnovne studije iz internacionalne ekonomije I menadžmenta na univerzitetu Bocconi u Milanu a master studije iz poslovne analitike na ESADE fakultetu u Barseloni. Trenutno radim kao Business&Data Analytics Specialist u konsultantskom startupu u Milanu koji se bavi razvijanjem ML modela i in-house sistema.', NULL, NULL),
