(4463, 89, 2001, 'Student sam završne godine osnovnih akademskih studija na Poljoprivrednom fakultetu u Zemunu, modul Agroekonomija. Trenutno sam najbolji student na smeru sa prosekom ocena 9,35.', NULL, NULL),
(4464, 90, 2001, 'potpuno posvećen', NULL, NULL),
(4465, 91, 2001, 'Poslom kojim se trenutno bavim je part-time tj. radim 20h nedeljno (4h dnevno) , tako da bih imao vremena da maksimalno posvetim projektu. Što se fakulteta tiče student sam završne godine osnovnih akademskih studija ali to mi ne oduzima puno vremena.', NULL, NULL),
(4466, 89, 2002, 'Student sam treće godine na fakultetu Organizacionih nauka, smer Informacioni sistemi i tehnologije. Takodje nalazim se na poziciji Bussines Development-a u okviru Case Study Club-a.', NULL, NULL),
