(4469, 63, 2004, 'Ležaljka - ljuljaška za tri osobe sa stolom u sredini. inovacija ovog proizvoda je način sastavljanja savijenih cevi.', NULL, NULL),
(4470, 71, 2005, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
