(4472, 22, 2006, 'Uvek smo podržavali ideje i savetovali jedni druge u rešavanju problema. Zajednička realizacija na inovacionom projektu za otklanjanje aerozagađenja u automobilskoj industriji, filteri za otklanjanje CO2, NOx,  SO2.', NULL, NULL),
(4473, 23, 2006, 'Motivisala nas je pruzena mogućnost da finalizujemo našu ideju i smatramo da je proizvod fantastičan i zaslužuje svoje mesto na tržistu.', NULL, NULL),
(4474, 24, 2006, 'Uživajte sa svojim najmilijima.', NULL, NULL),
(4475, 25, 2006, 'U moru drugih proizvoda koje kupci mogu naći na tržistu, danas se retko pronalaze proizvodi koji traju dugi niz godina. \r\nŠto se tiče baštenskog nameštaja često su to plastični proizvodi koji, osim što nisu baš ekološki prihvatljivi, nakon dve do tri sezone dobijaju razna oštećenja i postaju neupotrebljivi. \r\nSa druge strane mogu se naći proizvodi napravljeni od čelika, koji bez obzira na plastifikaciju i razne premaze mogu rđati i zahtevati dodatna održavanja, kao vreme i prostor za odlaganje tokom zime. \r\nZato smo želeli da se naš proizvod kvalitetom i dugotrajnošću ističe u masi drugih i da na taj način ujedno podržimo ekologiju. \r\nTakođe ovaj proizvod podiže raspoloženje i komunikaciju u društvu i porodici što je dodatni plus.', NULL, NULL),
(4476, 26, 2006, 'Naše ciljno tržište bi za početak bile Srbija, Crna Gora i Hrvatska, a zatim Austrija i Nemačka.', NULL, NULL),
(4477, 27, 2006, 'Naši potencijalni kupci bi bili: \r\n- Privatna lica koja poseduju dvorište, veće terase, \r\n- Vole da provode vreme sa porodicom i prijateljima, \r\n- Mogu biti avanturisti koji vole odmor u prirodi, a mogu biti osobe koje vole da provedu slobodno vreme kod kuće uz knjigu \r\n- Osobe koje žele eleganciju i neobične komade nameštaja \r\n- Osobe koje žele udobnost proizvoda pre svega \r\n- Kamperi, pecaroši\r\n- Vlasnici bazena i sličnih kompleksa na otvorenom \r\n- Vlasnici hotela \r\n- Vlasnici etno kuća \r\n- Vlasnici kuća i hotela na moru \r\n- Restorani i kafići sa baštama \r\n- Organizatori privatnih proslava - rođendana, VIP proslava \r\n- Moguće bi bilo i iznajmljivanje ležaljke za potrebe slikanja i snimanja. \r\nPotencijalni saradnici bi mogli biti arhitekte i pejzažne arhitekte.', NULL, NULL),
(4478, 28, 2006, 'Ljuljaška - ležaljka pruža neprocenjivo uživanje.\r\nLako se rasklapa i može se transportovati putničkim automobilom na izlet.\r\nVeoma je stabilna jer su tačke oslonca van tačke težišta. \r\nSvi materijali su vrhunskog kvaliteta i otporni na vremenske uslove. \r\nKonstrukcija je izrađena od inoksa i ostaje ista dugi niz godina. \r\nVeoma lagana tako da je svako može prevući po travnjaku sa jednog mesta na drugo.\r\nPlatna su periva i laka za održavanje. Poseduju jastuk za veću udobnost i transportnu torbu.\r\nIma još jedan fantastičan dodatak - viseći sto u sredini gde se može odložiti piće, knjiga i dr. \r\nIzrađen je od  HPL materijala. Otporan na vlagu i grebanje. \r\nNa gornjem delu nalazi se senilo.', NULL, NULL),
(4479, 30, 2006, '- Potencijalni kupci trenutno možda koriste ljuljaške - ležaljke samo za jednu osobu jer nemaju drugog izbora na tržištu, a sa druge strane verovatno imaju potrebu da cela porodica uživa zajedno na okupu; \r\n- Neki od njih koriste plastične baštenske setove koji vrlo brzo propadaju i deo te plastike bude (u neznanju) nesavesno odložen i na taj način zagađuje okolinu; \r\n- Poseduju baštenske setove napravljene od rđajućeg čelika i to im zadaje razne probleme i dodatne troškove prilikom održavanja tih proizvoda.', NULL, NULL),
(4480, 29, 2006, 'Potencijalni kupci imaju praktično pet kompletnih proizvoda u jednom - konstrukciju sa tri ležaljke - ljuljaške, sto i senilo. \r\nUmetnički, moderan dizajn i način sklapanja su osobine koje čine ovaj proizvod jedinstvenim i izdvajaju ga od ostalih.', NULL, NULL),
(4481, 32, 2006, 'Već postojeći proizvodi imaju sasvim drugačiji način sklapanja, koji je složeniji i komplikovaniji. Takodje neki od njih nemaju mogućnost rasklapanja ili imaju previše vidljivih i velikih sistema sklapanja. Naš proizvod ima jedinstven i jednostavan sistem sastavljanja savijenih cevnih elemenata.\r\nProizvod je atestiran na Šumarskom fakultetu, Univerziteta u Beogradu, pod brojem: 321.033.20.', NULL, NULL),
(4482, 37, 2006, 'Rade Vranjanin', NULL, NULL),
(4483, 40, 2006, 'Prodajom proizvoda.', NULL, NULL),
(4484, 41, 2006, 'Poslednjih 4 do 5 godina se ovaj projekat razvija od ideje do prototipa. \r\nSvaki krug se sastoji od 3 dela zakrivljene cevi. Ručno smo napravili prototip spojnog elementa koji vrši zabravljivanje klik sistema na sastavu. Ručno smo napravili i kompletan proizvod koji je potpuno funkcionalan. Za veću serijsku proizvodnju su nam potrebne neke mašine i ozbiljnija marketinška podrška. \r\nCiljevi su nam bili: \r\n- Sastavljanje na najjednostavniji način \"klik\" zakrivljene cevi\r\n- Najotporniji i najkvalitetniji materijali na našem tržištu \r\n- Elegancija', NULL, NULL),
(4485, 44, 2006, 'Nismo.', NULL, NULL),
(4486, 45, 2006, 'Nismo.', NULL, NULL),
