(4519, 89, 2024, 'Obrazovanje:  srednja stručna sprema\r\nIskustvo: • srednja stručna sprema \r\n • U metalskoj industriji 30 godina;  \r\n\r\n• Posedujem jedan model zasticen patentom iz masinske oblasti;  \r\n\r\n• Iskustvo u TIG, MIG-MAG zavarivanju;  \r\n\r\n• U radu sa inox-om: \r\n\r\n• Proizvodnja elemenata i ugradnja gotovih proizvoda od inoksa  \r\n\r\n• Konstruisanje tehničkih crteža u SolidWorks-u;  \r\n\r\n• Obrada inoksa (brušenje, poliranje, sečenje, savijanje);  \r\n\r\n• Rad na glodalici, strugu \r\n\r\n• U proizvodnji ograda od inoksa i razne opreme;  \r\n\r\n• Resavanje tehnickih problema. \r\n\r\n    - Montaža ugradne led rasvete;  \r\n\r\n                  - Zavarivanje (CO2, Tig, elektro zavarivanje)', NULL, NULL),
