(4531, 89, 2029, 'Dr Ivana Šarac je nutricionista, trenutno zaposlena u Nacionalnom institutu za medicinska istraživanja u oblasti istraživanja ishrane i metabolizma. Aktivni je učesnik mnogih konfernecija i treninga u svojoj oblasti, gde je između ostalog učestvovala i u obuci koju su organizovali Evropska komisija i Nacionalni i Kapodistrijanski univerzitet u Atini (NKUA): „Inicijativa Data Food Netvorking (DAFNE): Evropska banka podataka o dostupnosti hrane zasnovana na anketama o budžetu domaćinstva“. Održala je i usmena izlaganja u Nacionalnom centru za ishranu i saradnju sa SZO. Poseduje značajno i mnogobrojno iskustvo u implementaciji projekata, kako nacionalnih tako i međunarodnih, koje je od velike važnosti za uspešno sprovođenje poslovne ideje.', NULL, NULL),
(4532, 90, 2029, 'U većoj meri prosvećen', NULL, NULL),
