(4534, 71, 2030, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4535, 71, 2031, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4536, 63, 2034, 'Inovativan proizvod za izgradnju i ispravku pravilne mehanike košarkaškog šuta', NULL, NULL),
(4537, 71, 2035, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4538, 17, 2036, 'Inovativan proizvod za izgradnju i ispravku pravilne mehanike košarkaškog šuta', NULL, NULL),
(4539, 22, 2036, 'Nismo prethodno sarađivali na zajedničkim projektima.', NULL, NULL),
(4540, 23, 2036, 'Glavna motivacija za prijavu su mentori i podrška koju ovaj program pruža. Iako naš tim ima široka i komplementarna znanja, verujemo da ćemo tokom programa popuniti elemente u kojima nemamo znanja koja će nam biti potrebna za uspeh projekta. Takođe, motivacija nam je da razvijemo naše konekcije što sa drugim starapima tako i sa investitorima. Dodatno, cilj nam je da osvojimo grant koja će nam pomoći da izađemo na tržište.', NULL, NULL),
(4541, 24, 2036, 'Unapređenje košarkaške igre kroz poboljšanje šuterskih sposobnosti svih igrača, bez obzira na kom nivou igraju.', NULL, NULL),
(4542, 25, 2036, 'Proizvod pokušava da reši problem građenja i ispravke mehanike košarkaškog šuta u koji spadaju:\r\n1.Pozicija nogu, kukova, ramena i lakta\r\n2.Pozicije šuterske i nešuterske ruke\r\n3.Zglob šake i izbačaj lopte \r\n4.Rotacija lopte.\r\n\r\n*** Zbog problema sa platformom, detaljniji odgvor možete naći u dokumentu Ostala pitanja', NULL, NULL),
(4543, 26, 2036, 'Pro Shot je proizvod sa globalnom primenom i potencijalno tržište je veoma široko i obuhvata sve košarkaške programe na svetu. Zbog verovatnoće uspeha, odlučili smo da je najbolje da se opredelimo za jedno tržište - SAD. Ključni razlozi za našu odluku su:\r\n1. SAD su glavno košarkaško tržište na svetu, gde godišnje košarku igra 24.23 miliona igrača kroz razne programe. Tu spadaju:\r\n- 90k+ osnovnih škola (1-6 razred)\r\n- 30k+ osnovnih škola (7-8 razred)\r\n- 23k+ srednjih škola\r\n- 3k+ koledža\r\n- 100+ profesionalnih timova\r\n\r\n*** Zbog problema sa platformom, detaljniji odgvor možete naći u dokumentu Ostala pitanja', NULL, NULL),
(4544, 27, 2036, 'Mašina može da služi igračima svih nivoa - od dece do profesionalnih igrača. Nije specifična za pol i zbog jednostavnosti mašine i njenih funkcija podesiva je razne košarkaške nivoe. U potencijalne kupce spadaju razni košarkaški programi od osnovnih škola pa do univerziteta; amaterskih klubova i akademija; košarkaških kampova i letnjih liga za srednjoškolce; pa sve do profesionalnih klubova NBA lige i individualnih trenera i fizioterapeuta. Posle petonedeljnog testiranja MVP verzije ostvarena je komunikacija sa 15 košarkaških trenera i 2 fizioterapeuta. Obavljeno je i 7 intervjua sa koledžima u SAD. Fizioterapeuti NBA tima Golden State Warriors i Davidson College-a imali su pozitivne reakcije i smatraju da bi mašina zbog svojih funkcionalnosti mogla biti korišćena za oporavak igrača koji se vraćaju iz povrede (lakta, ramena, zgloba ruke). Saznali smo da pravilan položaj šuta kod igrača rezultira u smanjenoj procentualnoj šansi za povredom.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(4545, 28, 2036, 'U 1.  fazi smo razvili, testirali i patentirali mašinu koja služi za izgradnju tehnike košarkaškog šuta, kroz pozicioniranje svakog dela tela u pravilan položaj. Kroz pravu formu i veliki broj ponavljanja igrači brže koriguju tehniku i dolaze do neophodne memorije mišića. Dodatna prednost mašine je što omogućuje 3-5 puta više ponavljanja nego direktno šutiranje na koš i pomaže treneru da u isto vreme nadgleda više igrača.\r\nU 2. fazi planiramo da unapredimo mašinu kroz softversku podršku da korisniku omogućimo vizualizaciju i statistiku otklanjanja mikro grešaka. Trenutno smo u komunikaciji sa kompanijom SIQ Basketball koja kroz čipovane lopte ima mogućnost da prati više igračkih parametara.', NULL, NULL),
(4546, 30, 2036, 'Treneri svih nivoa, od početnika pa do NBA, trenutno koriste samo mehaničku vežbu formiranja šuta u kojoj je fokus na svaki detalj građenja pravilne tehnike šuta. Pored građenja šuta ova vežba se takođe koristi i za korekciju nepravilnog šuta. Zbog toga je ova vežba jedna od najpopularnijih u svetu košarke i igrači i treneri je izvode na svakodnevnom nivou. \r\n\r\nVežba na prvi pogled izgleda lako i jednostavno, ali je veoma zahtevna jer zahteva pun fokus igrača i trenera. Trener mora da bude skoncentrisan i da obraća pažnju na svako ponavljanje, svaki detalj šuta kako bi korigovao greške. Igrač mora da bude maksimalno skoncentrisan kako bi uspeo da uradi veliki broj korigovanih ponavljanja ispravno. Realnost je da ni igrači ni trener ne mogu da obrate pažnju na svaki detalj, što usporava napredak i korekciju.\r\nPostoje male sprave koje pomažu igračima da poprave deo tehnike šuta, ali ni jedna ne uspeva da se fokusira na svaki detalj i dozvoli ponavljanja koja repliciraju šut na koš.', NULL, NULL),
(4547, 29, 2036, 'Naša mašina omogućava građenje i ispravku šuta uz pravilnu:\r\n○	Poziciju nogu, kukova, ramena i lakta\r\n○	Poziciju šuterkse i nešuterske ruke\r\n○	Poziciju zgloba šake i izbačaj lopte \r\n○	Rotaciju lopte\r\n●	Igrač može sam da vežba bez pomoći trenera\r\n●	Broj ponavljanja je 3-5 puta veći nego direktno šutiranje na koš uz pomoć trenera\r\n●	Mašina je prilagodljiva svakom uzrastu i visini igrača\r\n●	Pored forme, mašina omogućava rehabilitaciju posle povrede', NULL, NULL),
(4548, 32, 2036, 'Trenutno na globalnom košarkaškom tržištu ne postoji ni jedan proizvod koji se fokusira na sve detalje mehanike šuta i ne omogućava igraču da uradi toliki broj ponavljanja kao Pro Shot mašina. Istraživanjem smo uspeli da uvidimo da se rekviziti koji se trenutno mogu pronaći na tržištu koncentrišu na jedan segment mehanike šuta, ali su često nekvalitetni i ne ispunjavaju zahteve potrošača.', NULL, NULL),
(4549, 37, 2036, 'Da, aplicirali smo za patent: PCT/RS2021/000015.\r\nVlasnik patenta: Dušan Kovačević', NULL, NULL),
(4550, 40, 2036, 'Zarađivaćemo kroz:\r\n• Prodaju proizvoda timovima i individualnim trenerima\r\n• Prodaju proizvoda fizio centrima\r\n• Prodaju proizvoda roditeljima\r\n• Pretplatu igrača (korisnika mašine) za korišćenje softvera za statistiku \r\nPosle povratnih informacija na osnovu intervjua sa trenerima i fizioterapeutima, prva cena mašine će biti $1.750. Početna marža nam je 66%(bez isporuke) zbog proizvodnje u manjim količinama, i očekujemo da će nam marža porasti do preko 80% kroz ekonomiju obima. \r\nNa osnovu analize tržišta SAD, mi očekujemo prodaju mašine u narednih pet godina:\r\n• 2022 - 90\r\n• 2023 - 700\r\n• 2024 - 3.000\r\n• 2025 - 13.000\r\n• 2026 - 44.000 \r\nOčekujemo da mesečna pretplata za softversku analitiku preko Sports IQ partnera će biti $6.99 po korisniku i da za svaku prodatu mašinu imamo 10 korisnika koji će uzeti i software, tako da je broj potencijalnih pretplata za narednih pet godina:\r\n• 2022 - 600 \r\n• 2023 - 3.500 \r\n• 2024 - 16.000\r\n• 2025 - 66.000\r\n• 2026 - 215.000', NULL, NULL),
(4551, 41, 2036, 'Za godinu dana došli smo do stabilne i funkcionalne verzije mašine. Oformljen je troclani tim i podnet je zahtev za zaštitu patenta. Uradjeno je petonedeljno testiranje MVP mašine. Pripremljena je anketa za istraživanje tržišta koja se sprovodi u SAD. Do sada je anketirano 2 trenera srednjih škola, 2 fizioterapeuta (iz D1 divizije i NBA lige), i 5 koledž trenera. Na osnovu anketa konstantovano je da programi vide korist i žele da testiraju proizvod. Optimalna cena mašine između $1.500 i $2.000. Mašina može da se koristi i u toku utakmica za zagrevanje igrača na klupi pre ulaska u igru. Sledeće unapređenje mašine treba da se fokusira na mogućnost pozicioniranja lakta igrača koji nemaju fleksibilnost. Postoji beneficiju bržeg oporavka igrača posle povrede, i predloženo je podešavanje pritiska lopte na ruku igračima u ranoj fazi oporavka. Srednjoškolski budžeti od 8-12 hiljada dolara, dok fakultetski budžeti variraju od divizije (D3 - 10k do 30k , a D1 čak i do 100k dolara).', NULL, NULL),
(4552, 44, 2036, 'Milan: Učestvovao sam u dva startup programa - 2015 FIU i 2018 Techstars, i u Techstars Startup Weekend takmičenju sam zauzeo prvo mesto. \r\nDejan: Kao član komisije i mentor učestvovao sam u projektu za startup pod nazivom We startup akcelerator, 2020.', NULL, NULL),
(4553, 45, 2036, 'Dušan i Milan su do sada finansirali projekat sa 7.500e.', NULL, NULL),
(4554, 48, 2036, '- Očekujemo da ćemo uz pomoć mentora i eksperata usavršiti naš biznis plan, gde ćemo moći da testiramo naša očekivanja i strategiju sa onima koji su uspešno prošli kroz ono što nas čeka. Kroz listu mentora, vidimo da ćemo imati pristup mnogima sa tehničkim znanjem kao i onima sa dubokim biznis iskustvom. Najviše pomoći će nam biti potrebno u dizajnu, branding i marketingu, logistici i proizvodnji. \r\n- Očekujemo da ćemo uspostaviti konekciju sa više potencijalnih investitora.\r\n- Takođe se nadamo da ćemo razviti timski duh sa drugim startapima u programu i da kroz razmenu znanja, iskustva, i konekcija jedni drugim pomognemo da dođemo do željenog cilja.', NULL, NULL),
(4555, 49, 2036, 'Pošto smo završili testiranje naše “Beta” mašine, 15,000 Eura nam je potrebno da stignemo do distribucije. U to ulazi:\r\n•    Proizvodnja “Alpha” verzije i izrada 10 mašina koje će biti date prvim korisnicima u SAD na korišćenje\r\n•    Testiranje unapređenja, dodatna podešavanja i usavršavanja\r\n•    Dizajniranje pakovanja i ambalaže\r\n•    Razvijanje web sajta da se omogući pretprodaja\r\n•    Troškovi plate Dušanu koji će se u potpunosti posvetiti projektu', NULL, NULL),
