(4563, 71, 2047, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4564, 63, 2048, 'Inovacija predstavlja desktop i mobilnu aplikaciju koja ima za cilj da poveže sportske objekte (i druge objekte koje izdaju prostor/termine za zabavu) sa korisnicima, kao i korisnike između sebe. U aplikaciji korisnici će moći da pretražuju objekte, da vide njihovu dostupnost, karakteristike, komentare, popuste i ostale pogodnosti. Takođe, moći će da rezervišu i plate termine u bilo kom trenutku u budućnosti. U aplikaciji korisnici će moći da pronalaze partnere, protivnike i/ili timove kako bi upotpunili zabavu. Sa druge strane, vlasnicima objekata biće omogućeno digitalno upravljanje sportskim objektima, kao i prihvatanje rezervacija i plaćanje termina.', NULL, NULL),
(4565, 71, 2049, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4566, 17, 2050, 'Inovacija predstavlja desktop i mobilnu aplikaciju koja ima za cilj da poveže sportske objekte (i druge objekte koje izdaju prostor/termine za zabavu) sa korisnicima, kao i korisnike između sebe. U aplikaciji korisnici će moći da pretražuju objekte, da vide njihovu dostupnost, karakteristike, komentare, popuste i ostale pogodnosti. Takođe, moći će da rezervišu i plate termine u bilo kom trenutku u budućnosti. U aplikaciji korisnici će moći da pronalaze partnere, protivnike i/ili timove kako bi upotpunili zabavu. Sa druge strane, vlasnicima objekata biće omogućeno digitalno upravljanje sportskim objektima, kao i prihvatanje rezervacija i plaćanje termina.', NULL, NULL),
(4567, 22, 2050, 'Tokom zajedničkih studija na Fakultetu organizacionih nauka, Dušan, Nemanja i Milena su radili na svakom timskom projektu u prethodnih 5 godina. Jedan od većih predstavlja razvoj informacionog sistema najveće farme krava u Centralnoj Srbiji, trajanje projekta je pratilo razvoj i digitalizaciju sistema farme u periodu od godinu dana, počev od modelovanja sistema do implementacije.\r\nMilena i Uroš išli su zajedno u gimnaziju i u međuvremenu su zajedno radili na tri vaterpolo takmičenja ( FINA Svetsko prvenstvo za juniore (2017) i juniorke (2018) i FINA Svetska liga (2019)). Na tim takmičenjima oni su zajedno radili na koordinaciji volontera i borilišta. Oni su, takođe, sarađivali sa FINA delegatima i bili su sprega između FINA-e i lokalnog organizaciong komiteta.', NULL, NULL),
(4568, 23, 2050, 'Mi smo grupa mladih inovatora koja ima za cilj da svoj proizvodo plasira na svetskio tržište. Verujemo da će nam radionice i treninzi pod mentroskom palicom stručnjaka iz inostranstva biti krucijanim u daljem razvoju ne samo našeg proizvoda, već i nas kao tima (kako celog tima, tako i nas kao pojedinačnih članova). Smatramo da uz učestvovanje u ovom projektu možemo drastično da napredujemo u oblasitma poput upravljanja projektima, razvojem biznisa i ideja, marketinga, poslovne komunikacije.\r\nOvaj program bi nam pružio fantastične i savremene uslove za rad. Kako u ovom programu učestvuje još startapa, verujemo da će nam razmena iskustava biti značajan preduslov za napredak. Kako nam je cilj da osvojim svetsko tržište neophodna nam je golbalna vidljivost, Ovaj program bio bi nam velika refernca i veliki zalog za budućnost.', NULL, NULL),
(4569, 24, 2050, 'Start your play! Započni svoju igru!', NULL, NULL),
(4570, 25, 2050, 'Problemi korisnika, rekreativnih sportista širom sveta (https://bit.ly/3pDq3QC), koji se ponekad oprobaju u drugom sportu ili aktivnosti, su vezani za organizaciju događaja. Kako ne postoji mesto koje prikazuje sve objekte koji pružaju željenu aktivnost, kao i dostupnost tih objekata, sama organizacije može da preraste u gubljenje vremena i na kraju odustajanje, jer svaki pojedinačni objekat mora da se pozove kako bi se proverila dostupnost. Takođe, s obzirom na česta otkazivanja partnera, protivnika ili saigrača, organizacija postaje još teža.\r\nSa druge strane, objekti (sportski centri, kuglane, igraonice i sl.) suočavaju se sa čestim otkazivanjima i nedolascima, što smanjuje njihovu iskorišćenost kapaciteta, i samim tim prihod, i to oko 12% godišnje (https://bit.ly/3Jrud65). Vlasnici se suočavaju i sa značajnim utroškom vremena zaposlenih da koordiniraju sve rezervacije, naročito kada je objekat ima veći broj terena.', NULL, NULL),
(4571, 26, 2050, 'B2B tržište koje targetiramo su svi objekti koji iznajmljuju prostor za sport i zabavu (venues). Takvih objekata u Velikoj Britaniji ima 151.000 (https://bit.ly/3JrNvrP). Kada se taj broj esktrapolira, zaključijemo da ih globalno postoji 17.750.000. Ako uzmemo u obzir predviđenu cenu od EUR 30 mesečno po klubu, dolazimo do potencijalnog tržišta od EUR 6.4 mld globalno.\r\nB2C tržište koje targetiramo su svi ljudi koji se rekreativno bave sportom ili drugom aktivnošću (kuglanje, escape room, i sl.). Globalno postoji 2.5 mld aktivnih korisnika sportskih objekata. Ukoliko bi korisnik 1 put mesečno zakazao 1 termin sa prosečnom cenom od EUR 20, sa našom planiranom cenom od 10% po zakazivanju, potencijal tržišta iznosi EUR 60 mld globalno.', NULL, NULL),
(4572, 27, 2050, 'Potencijalni korisnici su ljudi koji se rekreativno bave sportom ili drugom aktivnošću (kuglanje, escape room, i sl) i ponekad se oprobaju u nekom drugom sportu ili aktivnosti. \r\nPotencijalni klijenti su svi objekti koji iznajmljuju prostor za sport i zabavu (sportski centri, kuglane, igraonice i sl) koji nisu digitalizovali svoje poslovanje. \r\nIntervjuisali smo 16 korisnika i njih 14 nam je potvrdilo da su bar jednom morali da odustanu od neke aktivnosti zbog otežanog usklađivanja termina sa željama ostalih učesnika ili zbog odustajanja nekog od partnera. Sproveli smo i anketu u kojoj je učestvovalo 183 ispitanika. Rezultati su pokazali da više od 40% ispitanika nailazi na problem pronalaska slobodnih termina i lokacija za igru..\r\nU razgovorima sa vlasnicima klubova i predstavnika organizacija kao što su TK SA&NI I TK WINNER zaključili smo da su se susretali sa otkazivanjima i nedolascima mušterija i svi smatraju da bi vidljivost na internetu poboljšala njihovo poslovanje.', NULL, NULL),
(4573, 28, 2050, 'Prozivod koji razvijamo trenutno ne postoji na domaćem tržištu. Sistem implementiran na backendu opslužuje dva interfejsa.\r\nPrvi je namenjen za internu upotrebu vlasnika klubova. Služi za praćenje rezervacija, omogućava različite manipulacije opštim radom kluba i statistički pregled prikupljenih podataka o poslovanju kluba. \r\nDrugi interfejs je namenjen korisnicima, omogućava pretragu klubova, pregled usluga koje klub pruža kao i tačnu cenu za svaki termin. Korisnici imaju direktan pregled slobodnih termina i mogu da rezervišu termin po svojoj želji.\r\nInterfejs su razvijeni korišćenjem React tehnologije, dok je back-end implementiran u .NET sa SQL bazom i hostovan uz pomoć Azure servisa.', NULL, NULL),
(4574, 30, 2050, 'U Srbiji se potencijalni klijent služe pismenom evidencijom ili upotrebom Excel-a. Korisnici termine zakazuju tako što istražuju mogućnosti putem interneta, a zatim za svaku moraju da proveravaju dostupnost putem telefona, što oduzima vreme.  \r\nGlobalno postoje sledeći konkurenti\r\nPlaytomic - Platforma koja postoji u obliku desktop i mobilne aplikacije. Postoji dominantno na španskom tržištu. U ponudi imaju terene za padel i tenis. \r\nMatchi - Švedska platforma koja postoji u obliku desktop i mobilne aplikacije. Posluju isključivo u Švedskoj i fokusirani su na tenis, padel, skvoš i badminton. \r\nPlayfinder - Britanska platforma koja postoji u obliku mobilne i desktop aplikacije. Posluju na teritorijama Ujedinjenog kraljevstva i Republike Irske. Fokusirani su na fudbal.\r\nGW Sports App - Indijska platforma koja postoji u obliku mobilne i desktop aplikacije i fokusirani su na izdavanje terena za kriket.', NULL, NULL),
(4575, 29, 2050, 'Za razliku od glavnih kokurenata, ključna diferencijacija našeg sistema je u tome što je univerzalan i nije usko vezan za sport, već je primenljiv i na osatale vidove zabave. \r\nVlasnicima objekta omogućićemo vidljivost na internetu čime će biti bliži korisnicima. Sistem će sadržati i statistiku rada što bi trebalo vlasnicima da da precizan uvid u poslovanje. Kako će se sistem ažurirati u realnom vremenu, vlasnici će imati mogućnost povećane kontrole rada zaposlenih.\r\nKorisnicima bi ovaj stistem trebalo da olakša organizaciju događaja. Imali bi sve objekte na jednom mestu, sa svim njihovim karteristikama, kao i dostupnošću. Celokupan proces bi bio digitalizovan. Očekujemo u budućnosti da uvedemo i alat za povezivanje igača koji se ne poznaju.', NULL, NULL),
(4576, 32, 2050, 'Ostali postojeći sistemi fokusirani su isključivo na sportove sa reketom, dok je naš proizvod univerzalan i obuhvata sve objekte rekreativne zabave. Takođe, ni jedan postojeći sistem nema povezivanje igača koji se ne poznaju, što je nama sledeća stavka u razvoju, kada sakupimo dovoljan broj klijenata i korisnika u inicijalnoj fazi.', NULL, NULL),
(4577, 37, 2050, 'Uspešno smo podneli zahtev Zavodu za zaštitu intelektualne svojina za zaštitu žiga. Zaštita samog softvera je moguća autorskim pravom za koje ćemo podneti zahtev kada kompletiramo testiranje i uradimo prvi release softvera. Vlasnik prava na intelektualnu svojinu bi bio Letzplay, odnosno 4 osnivača.', NULL, NULL),
(4578, 40, 2050, 'Startap zarađuje od klubova/objekata. Oni bi imali i fiksni i varijabilni trošak. Visina fiksnog troška zavisisla bi od paketa, ali i od veličine kluba/objekta i bila bi u proseku EUR 30 mesečno. Varijabilni trošak išao bi od svakog izdatog termina i iznosio bi 10% cene termina. Kada na platformi bude bio veliki broj objekata uvešćemo mogućnost izdavanja oglasnog prostora.', NULL, NULL),
(4579, 41, 2050, 'Ekipa Letzplay-a je sa radom započela krajem januara 2021. kad je Milena upoznala Uroša sa Dušanom i Nemanjom. Krajem februara, nakon kreiranja plana razvoja, usvojena je strategija da se prvobitno napravi aplikacija za rezervacije termina (venue booking) koja bi poslužila za prikupljanje korisnika i klubova. i development tim započeo je sa pisanjem programa.\r\nPrva faza razvoja aplikacije je gotova i obuhvata modelovanje i implementaciju kompletne arhitekture i razvoj interfejsa za interno praćenje rezervacija klubova. MVP je trenutno u fazi testiranja. Naredna faza razvoja predsatvlja razvoj interfejsa za krajnje korisnike.\r\nRazgovori sa budućim korisnicima i klubova usmerili su nam pravac razvoja aplikacije i potvrdili neophodnost razvoja ovakvog sistema. Razgovori sa klijentima oko prodaje aplikacije su počeli i idemo ka potpisivanju prvog klijenta - Teniski savez Beograda.', NULL, NULL),
(4580, 44, 2050, 'Nismo', NULL, NULL),
(4581, 45, 2050, 'Do sada se startap finansirao iz ličnih izvora osnivača i uloženo je oko EUR 2000.', NULL, NULL),
(4582, 48, 2050, 'Očekujemo od programa da nam pomogne da napredujemo kao pojedinci, ali i kao ekipa ujedinjena oko startapa i zajedničke ideje. Verujemo da će nam podrška partnera biti krucijalna da naučimo više u oblasti biznis plana, plasiranja proizvoda na tržište, marketinga i poslovne komunikacije. Očekujemo pomoć i u oblasti vođenja firme, regulisanju pravih regulativa, finansijske stabilnosti kao i u širenju na tržišta regiona.', NULL, NULL),
(4583, 49, 2050, 'U trenutnoj fazi razvoja procenjujemo da nam je potrebno oko EUR 9500 kako bismo pokrili troškove zarada, marketinga, licenca za Google Play Store i Apple App Store, angažovanje QA stručnjaka za testiranje gotove aplikacije, zaštita Intelektualne svojine i za nabavku Apple računara koji će nam omogućiti kreiranje softverskog paketa aplikacije koji može da se upload-uje na Apple App Store.', NULL, NULL),
