(4592, 17, 2061, 'Zaštitna maska za lice sa strujnim poljem koje uništava viruse i bakterije naponom. Strujni napon je mali ali dovoljan da ubije bakterije i viruse koji su na masci.', NULL, NULL),
(4593, 22, 2061, 'Da, učestvovali smo u inicijativi \"budi i ti heroj\" povodom krize kovida 19, predložili smo projekat koji je dobro prihvaćen, takodje radimo u istoj firmi, a i braća smo pa se odlično razumemo.', NULL, NULL),
(4594, 23, 2061, 'Od malih nogu konstruišem i realizujem svoje ideje, volim da pomažem i da moje naprave olakšaju neki deo života. Ovaj program omogućava dostupnos velikim narodnim masama, ali što je najbitnije povećalo bi bezbednost medju ljudima.', NULL, NULL),
(4595, 24, 2061, 'Budite sigurni', NULL, NULL),
(4596, 25, 2061, 'Povecanje bezbednosti ugrozene krizom KOVID-19, pandemija koja vec neko vreme ugrozava ceo svet. Problem pandemije je tezak i na psiholoskom i na fizickom nivou, ulazi u sve drustvene slojeve, zarazava ljude razlicitih godina, bukvalno niko nije bezbedan. Prva saznanja dobio sam preko televizije, kada je pocelo u Vuhanu.', NULL, NULL),
(4597, 26, 2061, 'Skoro ceo svet danas je u obavezi da nosi zastitne maske. Npr samo Juzna Koreja je sa pocetkom pandemije povecala proizvodnju na 2156%, februarski izvoz 2020 je bio 154.5 miliona dolara', NULL, NULL),
(4598, 27, 2061, 'Potencijalni kupci i korisnici su sve osobe koje nose bezbednosne maske za lice. Pričao sam sa raznim ljudima u svojoj okolini i svaki odgovor je bio da je ideja dobra.', NULL, NULL),
(4599, 28, 2061, 'Maske za lice su danas obavezne radi bezbednosti u skoro svim delovima sveta. One povećavaju bezbednost ali ne 100%. Moje poboljšanje je da elektro poljem povećamo sigurnost na 100%.', NULL, NULL),
(4600, 30, 2061, 'Nose maske za lice kupljene u apoteci i drze odstojanje  od drugih ljudi.', NULL, NULL),
(4601, 29, 2061, 'Povecanu sigurnost u odnosu na obicne maske, jer malo strujno polje ubija viruse koji se nekim slucajem nadju na maski.', NULL, NULL),
(4602, 32, 2061, 'Koliko znam ne postoji takav proizvod, postoje maske za lice ali bez ikakvog dodatnog sistema sigurnosti.', NULL, NULL),
(4603, 37, 2061, 'Nismo', NULL, NULL),
(4604, 40, 2061, 'Prodajom proizvoda, ili licenciranje ili prodaja patenta kada bude licenciran.', NULL, NULL),
(4605, 41, 2061, 'Ideja je nastala pre godinu, najvazniji trenuci su dokazi za teoriju da virusi i bakterije pod uticajem male struje i malog napona (u mikro amperima) umiru.Razvijen prototip i dobro prihvatanje ideje medju ljudima koji su razlicitih obrazovnih i kulturoloskih profila u mom okruzenju.', NULL, NULL),
