(4637, 63, 2084, 'Quantum je platforma koja povezuje \r\n1. klijente koje nemaju znanja i iskustva u razvijanju digitalnih proizvoda \r\n2. Klijente koji imaju znanja ali trebaju proširenje svog tima u vidu radne snage\r\nsa potrebnim ekspertima kao što su projektni menadžeri, programeri, dizajneri, i sl. Ključna diferencijacija u odnosu na ostale platforme se ogleda u modelu provere eksperata, gde je za projektne menadžere razvijen sistem za proveru i evaluaciju koji obezbeđuje da samo dokazani menadžeri u toj oblasti imaju pristup platformi, dok se eksperti iz ostalih oblasti mogu slobodno priključiti platformi. Na ovaj način klijenti kroz projektnog menadžera dobijaju jednu tačku kontakta sa ekspertima, koja je odgovorna za celokupan razvoj digitalnog proizvoda, od kreiranja specifikacije, preko organizovanja tima do isporuke finalnog proizvoda. S druge strane, klijenti zadržavaju fleksibilnost i smanjuju troškove upotrebom nezavisnih eskpertskih timova u odnosu na stalno zapošljavanje ili angažovanje kompanija koje se bave razvojem digitalnih proizvoda.', NULL, NULL),
(4638, 71, 2085, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4639, 17, 2086, 'Quantum je platforma koja povezuje \r\n1. klijente koje nemaju znanja i iskustva u razvijanju digitalnih proizvoda \r\n2. Klijente koji imaju znanja ali trebaju proširenje svog tima u vidu radne snage\r\nsa potrebnim ekspertima kao što su projektni menadžeri, programeri, dizajneri, i sl. Ključna diferencijacija u odnosu na ostale platforme se ogleda u modelu provere eksperata, gde je za projektne menadžere razvijen sistem za proveru i evaluaciju koji obezbeđuje da samo dokazani menadžeri u toj oblasti imaju pristup platformi, dok se eksperti iz ostalih oblasti mogu slobodno priključiti platformi. Na ovaj način klijenti kroz projektnog menadžera dobijaju jednu tačku kontakta sa ekspertima, koja je odgovorna za celokupan razvoj digitalnog proizvoda, od kreiranja specifikacije, preko organizovanja tima do isporuke finalnog proizvoda. S druge strane, klijenti zadržavaju fleksibilnost i smanjuju troškove upotrebom nezavisnih eskpertskih timova u odnosu na stalno zapošljavanje ili angažovanje kompanija koje se bave razvojem digitalnih proizvoda.', NULL, NULL),
(4640, 22, 2086, 'Mladen i Nermin, ujedno i prva dva osnivača na projektu koji su na poziciji glavnog izvršnog direktora (CEO) i glavnog direktora za proizvod (CPO) su članovi tima koji su uspiješnu saradnju imali i od ranije, učestvujući zajedno na nekoliko nevladinih projekata na nivou grada Bijeljine, kao članovi različitih organizacija koje su sarađivale, gdje je svaki od njih radio u oblasti svojih afiniteta, pretežno organizacije i vođenja projekata, validacije i networkinga, a udruživanje u zajedničkom projektu se desilo nakon prezentacije ideje Quantum projekta pred investitorima na događaju BOLD START u Bijeljini u decembru 2019. godine na kome je projekat prvi put predstavljen u svojoj inicijalnoj verziji a Mladen i Nermin prepoznali zajednička interesovanja i podržani prethodnim saradnjama krenuli u zajedničku misiju.\r\nNikola kao CTO se priključio projektu nakon validiranja tržišta i istraživanja Customer segmenta i Value proposition u fazi planiranja MVP verzije proizvoda u martu 2021.', NULL, NULL),
(4641, 23, 2086, 'Motivisala nas je mogućnost sticanja znanja u programu i kasnija saradnja sa mentorima uz koje verujemo da bismo mogli brže i kvalitetnije da razvijemo MVP i dođemo do prvih testera i korisnika. Takođe, verujemo da bi nam od izuzetnog značaja bilo povezivanje sa drugim startapima u programu i NTP Beograd sa kojima bismo mogli da razmenjujemo iskustva i uspostavljamo saradnje.', NULL, NULL),
(4642, 24, 2086, 'Slogan našeg startupa je ”Inovativan način za kreiranje digitalnih proizvoda” (“An innovative way of developing digital products\")', NULL, NULL),
(4643, 25, 2086, 'Ukoliko bilo ko u svetu želi da razvije digitalni proizvod, a nema znanja, iskustva ili kadrove u svojoj organizaciji, susreće se sa dva polarizovana izbora: \r\n\r\n1. Angažovanje “freelance-ra” koji su eksperti u svojim domenima\r\n2. Angažovanje kompanije specijalizovane za razvoj digitalnih proizvoda\r\n\r\nPrva opcija nosi veliki rizik ukoliko neko nije imao prethodnog iskustva sa angažovanjem freelance eksperata i zahteva sposobnosti vođenja projekta i jasnog komuniciranja funkcionalnosti ka freelance ekspertima. Nedostatak ovog iskustva kod vlasnika projekta zahteva ulaganje dodatnog vremena za organizaciju i kontrolu angažovanih eksperata što u većini slučajeva dovodi do loše komunikacije, organizacije i često probijanja rokova za izradu digitanog proizvoda.\r\n\r\nDruga opcija nosi problem visoke cene koja uglavnom premašuje budžet vlasnika projekta.\r\n\r\nS obzirom da smo bili sa obe strane odnosa “klijent-freelancer” znamo da je ovaj problem izuzetno izražen na globalnom nivou.', NULL, NULL),
(4644, 26, 2086, 'Tržište koje ciljamo je potvrđeno sledećim podacima:\r\nRastućom globalnom vrednošću ugovora u Outsourcing-u informacionih tehnologija (ITO), koji je zabeležio $66,5B u 2019., gde najveći procenat od 64% otpada na delegiranje razvoja softverskih aplikacija po statista.com. https://bit.ly/3mHe4j2\r\n\r\nVeličina tržišta platformi za freelancing od $2.35B u 2018 i $3.39B u 2019. godini i predviđanje kontinualnog rasta od 13.99% i dostizanja $6.7B do kraja 2025.godine koju predviđa Orbis Research. https://bit.ly/3mKghuh\r\n\r\nRastući broj freelancera registrovanih na mikroservisnim platformama kao i predviđanja da će 51% radnika koji koriste svoje znanje kao alat postati “remote” do 2022. godine. https://gtnr.it/31cL5fE\r\n\r\nEkspanziju na globalno tržište planiramo kroz fazu rasta na Balkanu kroz lične konekcije sa lokalnim kompanijama kao što su Symple Edea, MSG group, Leader D.o.o, Studio Kreato, praćenu širenjem preko već postojećih konekcija u Dubaiu, Nemačkoj, Austriji, Njujorku i Kaliforniji.', NULL, NULL),
(4645, 27, 2086, 'Naš rani usvajač klijent je kompanija iz razvijene zemlje koja je otvorena za inovacije u optimizaciji poslovanja i čiji su projekti pogodni za outsource remote timovima. \r\nNakon sprovedenog istraživanja, kroz intervjue sa potencijalnim klijentima uključujući Symple Edea, MSG group, Leader DOO, Studio Kreato zaključak je da su benefiti koje oni očekuju:\r\n1. Stručno i transparentno vođenje projekta\r\n2. Najbolji izbor radne snage u skladu sa budžetom\r\n3. Upućenost u progres delegiranog projekta\r\n\r\nBudući da je naš proizvod dvostrano tržište, analizirali smo i remote IT radnike kao korisnike platforme. Naš rani usvajač korisnik je IT inženjer koji pored svog full time posla želi angažman na projektima uz plaćanje po učinku i želi da iskusi inovativnu platformu za co-working. Kroz 50 sprovedenih intervjua sa potencijalnim korisnicima prepoznati su sledeći problemi: \r\n1. Nestručni klijenti\r\n2. Veliki broj napuštenih projekata na platformama za freelancing\r\n3. Kratkoročni poslovi', NULL, NULL),
(4646, 28, 2086, 'Glavna jedinstvenost Quantum platforme se ogleda u sistemu za proveru kvaliteta projektnih menadžera, gde samo najboljima odobravamo pristup platformi. Na taj način se dobija jedinstvena tačka kontakta između klijenata koji žele da razviju digitalni proizvod i pojedinačnih freelance eksperata, i time se stvara hibridni model koji ima prednosti i angažovanja freelance-ra (cena i fleksibilnost) i angažovanja specijalizovanih kompanija (garancija kvaliteta).\r\n\r\nTrenutno razvijamo MVP koristeći programske jezike Angular i Laravel, dok u narednoj fazi planiramo uvesti Blockchain sloj koji bi validirao učešće eksperta na projektu, i donosio vlasništvo u proizvodu u vidu digitalnih tokena.', NULL, NULL),
(4647, 30, 2086, 'Trenutno korisnici koriste ili freelance platforme kao što su Upwork, Freelancer, Peopleperhour i slične vertikale, ili se oslanjaju na digitalne agencije koje se bave razvojem softvera.\r\nProblem sa freelance platformama je da  zanemaruju i ne unose profesionalnu kontrolu kvaliteta proizvoda i nisu prilagođene projektima većih gabarita.\r\nProblem kod angažovanja digitalnih agencija vidimo u tome jer ne donose potpunu optimizaciju cijene i modularnost.', NULL, NULL),
(4648, 29, 2086, 'Ključna jedinstvenost Quantum-a je ta što se projektni menadžeri detaljno proveravaju i na platformu se odobravaju samo najbolji, koji zatim služe kao srednji sloj između klijenata i freelance eksperata.\r\n\r\nUnosimo benefite na obe strane platforme (ljudi koji trebaju digitalni proizod i remote radnici).\r\n\r\nKlijenti koji trebaju digitalni proizvod dobijaju benefite kao što su:\r\n- Besplatno konsultovanje sa profesionalcem prilikom procene obima i cene projekta\r\n- Posredovanje profesionalca prilikom planiranja i izrade proizvoda\r\n- Raslojeno validiranje kvaliteta pre plaćanja\r\n- Upućenost i izveštaji o progresu projekta\r\n\r\nSa druge strane freelanceri imaju benefite kao što su:\r\n- Povezivanje sa menadžerima kao izvorima projekata (networking)\r\n- Strukturirani način organizacije unutar projekta\r\n- Profesionalnu komunikaciju \r\n- Profesionalnu organizaciju radnih obaveza\r\n- Proverene poslove filtritrane od strane stručnih osoba\r\n- Organizaciju rada koja podržava fleksibilno angažovanje', NULL, NULL),
(4649, 32, 2086, 'Smatramo da smo pristupli rješenju problema analitički i da trenutno ne postoji na tržištu proizvod koji nudi troslojnu organizaciju projekta zasnovanog na freelance tržistu.', NULL, NULL),
(4650, 37, 2086, 'Zahtev za zaštitu žiga smo uspešno podneli ZIS-u. Pored toga, planiramo da podnesemo i zaštitu autorskog dela kako bismo zaštitili kod i način funkcionisanja softvera, ali tek kada budemo lansirali stabilnu verziju platforme, gdje bismo po osnivanju kompanije kao vlasnika intelektualne svojine naznačili samu kompaniju.', NULL, NULL),
(4651, 40, 2086, 'Naš biznis model se ogleda u naplati provizije od 7% vlasnicima projekata tek nakon uspešno završenog dijela projekta prilikom isplate novca za odrađeni dio posla, i 8% provizije od zarade radne snage, što čini ukupnu zaradu od 14,44% po ceni projekta.', NULL, NULL),
(4652, 41, 2086, 'Osnivači su se okupili od početka 2020. dok smo trećeg člana (CTO) uvrstili od početka 2021. kada smo sa Alpha verzije krenuli u razvoj MVP. \r\n\r\nQuantum je prošao startup programe gdje smo validirali ideju, te unapredili biznis plan, finansijsku projekciju uz pomoć mentora (Luka Sučić, Malcolm Duerod, Luka Prišunjak). Cilj je bio povezivanje sa mentorima, a tu ističemo učešće u Tech Boost programu Fondacije 787 i EFSE Entrepreneurship Academy. Tu smo znatnije revidirali ciljane korisnike i vrijednosti koje im donosimo. \r\n\r\nU Alpha verziji, kroz koju smo dobili bazu od 70 korisnika sa kojima smo radili inicijalne intervjue 1 na 1, smo revidirali potrebe korisnika.\r\n\r\nIstičemo učešće u Investment readiness programu (Efino i Swiss EP) gdje smo prošli kroz Due Diligence verifikaciju i unapredili pitch deck i executive summary, i investiciju od $12.000 od strane angel investitora Saše Krstića.', NULL, NULL),
(4653, 44, 2086, 'Investment Readiness - Efino & Swiss EP (Mladenov intervju nakon ovog programa - https://swissep.org/our-impact/success-stories/can-a-mentor-help-you-grow-your-startup)\r\nBold Start - Fondacija 787 i US Embassy\r\nTech Boost program - Fonacija 787 i EFSE Entrepreneurship Academy\r\nPodim Digital Experience, Maribor, Slovenia\r\nElevator Lab Fintech Program - Raiffeisen Bank International', NULL, NULL),
(4654, 45, 2086, 'Investicija od strane angel investitora u iznosu od $12.000 za 6% vlasništva.', NULL, NULL),
(4655, 48, 2086, 'Od programa očekujemo povezivanje sa mentorima koji nam mogu pomoći u fazi razvoja minimalno održivog proizvoda kao i povezivanje sa lokalnim startapima sa kojima bismo mogli ostvariti partnerstva. Smatramo da nam je najpotrebnija podrška u segmentu osnivanja kompanije, pravnog savetovanja i prikupljanja lokalnih ranih korisnika.', NULL, NULL),
(4656, 49, 2086, 'Budući da smo sredstva dobijena od angel investitora usmjerili u razvoj MVP verzije proizvoda, smatramo da bi sredstva koja možemo dobiti kroz Raising Starts program mogli usmjeriti na pokrivanje troškova full time zaposlenja bar jednog od direktora, validiranje na lokalnom tržištu, kupovinu potrebnih licenci za objavljivanje aplikacije i dalja unapređenja proizvoda na osnovu feedback-a korisnika. U trenutnoj fazi smatramo da nam je za navedene aktivnosti potrebno €9000 sa obzirom da smo prethodno prikupljenih $12 000 upotrebili za razvoj MVP verzije proizvoda.', NULL, NULL),
