(4672, 89, 2098, 'Doktor ekonomskih nauka, magistar zaštite životne sredine, inženjer elektrotehnike.\r\n- Visoka škola za menadžment i ekonomiju u Kragujevcu, radi kao profesor i rukovodilac Inovacionog centra, uža specijalnost: menadžment novih tehnologija i inovacija, od 19.12.2016.\r\n- Institut primenjenih nauka u Beogradu, radi kao naučni saradnik, od 01.01.2020.\r\n- U Švedskoj radio na podizanju inovativnih startap kompanija od 2015 - 2020.\r\n- Međunarodna naučno - inovaciona organizacija \"Ekološka energija\" u Beogradu, predsednik Upravnog odbora; glavni inženjer, konsultant i vođa na inovacionim projektima koji su rađeni u Srbiji (podrška Grada Beograda), Nemačkoj, USA, Švedskoj, Rusiji, Japanu i Kini. Od 11.11.2011. - i dalje u toku.\r\n- Zavod za ekonomiku domaćinstva Srbije –istraživanje i razvoj- u Beogradu, radio kao stručni saradnik na inovacionim projektima i informacionim sistemima koje su rađeni u zmlji i inostranstvu, od 01.12.2007. do 30.09.2011.\r\n- Razvoj poslovanja kompanije Novi Comp od 2002-2008.', NULL, NULL),
(4673, 90, 2098, 'Kreator ideje, radi na tehničkom razvoju inovacije.\r\nPotpuno posvećen.', NULL, NULL),
(4674, 91, 2098, '- Visoka škola za menadžment i ekonomiju u Kragujevcu, radi kao profesor i rukovodilac Inovacionog centra, uža specijalnost: menadžment novih tehnologija i inovacija, od 19.12.2016.\r\n- Institut primenjenih nauka u Beogradu, radi kao naučni saradnik, od 01.01.2020.', NULL, NULL),
(4675, 89, 2099, 'Ima preko 37 godine radnog staža, tokom kojih je radio u većem broju naučno- istraživačkih ustanova, preduzeća i organa državne uprave.\r\n·       Prvo je radio kao asistent-pripravnik na predmetu: Tržište i promet proizvoda poljoprivrede i prehrambene industrije, na Poljoprivrednom fakultetu u Zemunu.\r\n·       Potom je radio kao rukovodilac investicija u ZZ „Izvor“ Žagubica. \r\n·       U septembru mesecu prelazi u Institut za mehanizaciju poljoprivrede i radio je na mestu direktora sektora za nauku. \r\n·       Deo 1996. i 1997. godine radio je kao direktor marketinga RO „Dahlia“ Zemun – Beograd.\r\n·       Od 1997. godine do 31.05.2000. godine radio je kao Savetnik za međunarodnu saradnju u Saveznom ministarstvu za poljoprivredu.\r\n·       Od 01. juna 2000. do 30. juna 2015. godine, bio je zaposlen u Institutu za ekonomiku poljoprivrede. Bio je direktor Instituta.', NULL, NULL),
(4676, 90, 2099, 'Radi na ekonomskim analizama u poljoprivredi, na dokazivanju ekonomičnosti proizvoda na tržištu.\r\nPotpuno posvećen.', NULL, NULL),
(4677, 91, 2099, 'Predaje na osnovnim akademskim studijama (OAS), master akademskim studijama (MAS) i doktorskim akademskim studijama (DAS) na Fakultetu za biofarming Bačka Topola, Megatrend Univerziteta u Beogradu i na osnovni akademskim studijama OAS na Poljoprivrednom fakultetu u Bijeljini, Univerzitet Bijeljina, Republika Srpska, BiH.', NULL, NULL),
(4678, 89, 2100, 'Doktor poljoprivrednih nauka.\r\nIma preko 37 godine radnog staža, tokom kojih je radila u većem broju naučno- istraživačkih ustanova   organa državne uprave.\r\n\r\n·       Prvo je zaposlenje bilo u organu uprave SO Žagubica, kao poljoprivredni i vodoprivredni isnpektor \r\n\r\n·       Zatim je od 1987. godine radila  u SOUR PIK „Požarevac“ kao rukovodilac sektora za održavanje vodoprivrednih objekata PIK Požarevac \r\n·       Dalje profesionalno kretanje bilo je  u Institutu za mehanizaciju poljoprivrede u Zemun Polju u laboratoriji za fiziku zemljišta.\r\n. Integracijom  Instituta za mehanizaciju i Instituta za kukuruz „Zemun Polje“ radila je u kao istraživač u Laboratoriji za tehnologiju proizvodnje i iskorišćavanje kukuruza.', NULL, NULL),
(4679, 90, 2100, 'Radi na poslovima provere efikasnosti uređaja na terenu, posle tretiranja korova, vrši analize na korovu.\r\nPotpuno posvećena.', NULL, NULL),
(4680, 91, 2100, 'Predaje na osnovnim akademskim studijama (OAS), master akademskim studijama (MAS) i doktorskim akademskim studijama (DAS) na Fakultetu za biofarming Bačka Topola, Megatrend Univerziteta u Beogradu i na osnovni akademskim studijama OAS na Poljoprivrednom fakultetu u Bijeljini, Univerzitet Bijeljina, Republika Srpska, BiH.', NULL, NULL),
(4681, 89, 2101, 'Doktor ekonomskih nauka.\r\nRedovni profesor i naučni savetnik.\r\n		Naime, učestvovao je u preko 20 projekata iz sledećih oblasti: finansijske analize; sprovođenje različitih tipova budžetskog konsaltinga; izrada normativnih akata iz oblasti finansija kao i implementacije međunarodnih računovodstvenih standarda u javni sektor.\r\nObavljao ekspertize za firmu HLB-DST revizija u Beogradu, Srpsku akademiju nauka i umetnosti u Beogradu, radio recnzije međunarodnih časopisa između kojih i za časopis Acta Oeconomica (published in English in Hungary since 1966 by the Hungarian Academy of Sciences).', NULL, NULL),
(4682, 90, 2101, 'Radi na poslovima finansijske i ekonomske analize tržišta.\r\nPotpuno posvećen.', NULL, NULL),
(4683, 91, 2101, 'Zaposlen od 2020. u Sektoru za ljudske resurse Ministarstva odbrane na poslovima interne kontrole. Redovan profesor na Vojnoj Akademiji.', NULL, NULL),
(4684, 89, 2102, 'Diplomirani ekonomista.\r\nU 2011. godini, Marko Stanković je sa partnerima osnovao Medjunarudna naučno – inovativnu organizaciju »Ekološka energija«, gde radi na inovacionim projektima i inovativnim idejama sa mladim ljudima, u cilju razvoja ideja i kreiranju inovacionih proizvoda na polju ekologije.', NULL, NULL),
(4685, 90, 2102, 'Asistent na projektu, radi na brendiranju proizvoda i ekonomskim tržišnim analizama.\r\nPotpuno posvećen.', NULL, NULL),
(4686, 91, 2102, '-Radi pri Međunarodnoj naučno inovacionoj organizaciji \"Eco energy\", na inovativnim projektima iz oblasti zaštite životne sredine.', NULL, NULL),
(4687, 89, 2103, 'Doktor biotehničkih nauka, zaposlena od 2012. godine u Kompaniji Dunav osiguranje a.d.o. gde je učestvovala u razvoju i implementaciji novih proizvoda osiguranja, od 2019. godine u vidu dopunskog rada je angažovana kao docent na Poljoprivrednom fakultetu Univerziteta Bijeljina na OAS i kao gostujući profesor u Akademiji strukovnih studija, Odsek za poljoprivredno-poslovne studije i turizam na OAS i MAS.', NULL, NULL),
(4688, 90, 2103, 'Radi na poslovima provere efikasnosti uređaja na terenu, pri tretiranja korova.\r\nPotpuno posvećena.', NULL, NULL),
(4689, 91, 2103, 'Docent na Poljoprivrednom fakultetu Univerziteta Bijeljina na OAS - full-time.\r\nGostujući profesor u Akademiji strukovnih studija, Odsek za poljoprivredno-poslovne studije i turizam na OAS i MAS - part-time.', NULL, NULL),
(4690, 89, 2104, 'Srednja stručna sprema.\r\n • U metalskoj industriji 30 godina; \r\n• Poseduje jedan model zasticen patentom iz masinske oblasti; \r\n• Iskustvo u TIG, MIG-MAG zavarivanju; \r\n• U radu sa inox-om:\r\n• Proizvodnja elemenata i ugradnja gotovih proizvoda od inoksa \r\n• Konstruisanje tehničkih crteža u SolidWorks-u; \r\n• Obrada inoksa (brušenje, poliranje, sečenje, savijanje); \r\n• Rad na glodalici, strugu\r\n• U proizvodnji ograda od inoksa i razne opreme; \r\n• Resavanje tehnickih problema.', NULL, NULL),
(4691, 90, 2104, 'Radi na poslovima mašinske konstrukcije i dizajna uređaja i elektroda.\r\nPotpuno posvećen.', NULL, NULL),
(4692, 91, 2104, 'Zaposlen u privatnoj firmi na proizvodnji prohromskih elemenata, opreme, delova i ograda.', NULL, NULL),
(4693, 63, 2105, 'MOS aplikacija predstavlja softversko rešenje kojim se na jednostavan način omogućava krajnjim korisnicima da saznaju najpovoljnije uslove osiguranja od različitih osiguravajućih kuća. Takodje, primenom blockchain tehnologije, prateći aktivnosti svakog korisnika aplikacija ga nagradjuje MOS tokenima kojima ostvaruje benefite u svim narednim polisama kod svih osiguravajućih kuća. Korišćenjem ove tehnologije osiguravači su sigurni u podatke o samim korisnicima a korisnici znaju da njihove aktivnosti u osiguranju mogu da ispravno budu vrednovane prilikom definisanja premije osiguranja.', NULL, NULL),
(4694, 71, 2106, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4695, 17, 2107, 'MOS aplikacija predstavlja softversko rešenje kojim se na jednostavan način omogućava krajnjim korisnicima da saznaju najpovoljnije uslove osiguranja od različitih osiguravajućih kuća. Takodje, primenom blockchain tehnologije, prateći aktivnosti svakog korisnika aplikacija ga nagradjuje MOS tokenima kojima ostvaruje benefite u svim narednim polisama kod svih osiguravajućih kuća. Korišćenjem ove tehnologije osiguravači su sigurni u podatke o samim korisnicima a korisnici znaju da njihove aktivnosti u osiguranju mogu da ispravno budu vrednovane prilikom definisanja premije osiguranja.', NULL, NULL),
(4696, 22, 2107, 'Saradjivali smo prilikom stvaranja sajtova i aplikacija koje smo napravili do sada (putnoosiguranje.info, osiguranje.srb, osiguranje.shop, kao i na aplikaciji: autoosiguranje kalkulator)\r\nImamo i druga iskustva u timskom radu, jer smo individualno radili i saradjivali radeći na različitim projektima i sa drugim kolegama.', NULL, NULL),
(4697, 23, 2107, 'Smatramo da smo sazreli, da smo stekli dovoljno iskustva na temu programa i usluga u osiguranju. Ono što smo prethodno uradili pokazalo se kao dobra rešenja, te smo mišljenja da smo  spremni da ideju koja je za nas mnogo veća i ozbiljnija nego ijedna do sada sprovedemo u delo. Želja nam je da radimo u kvalitetnom okruženju, naučimo i primenimo nova rešenja i budemo u društvu najkvalitenijih mentora.', NULL, NULL),
(4698, 24, 2107, 'Vaša prečica do sigurnosti', NULL, NULL),
(4699, 25, 2107, 'Kupci osiguranja žele na jednom mestu,podatke o proizvodu,prednostima i manama,poredjenje sa sličnim ponudama na tržištu i ono najbitnije hitnu,brzu i kvalitetnu uslugu.Prateći www.svijetosiguranja.eu,www.insurancejournal.com,www.riskandinsurance.com,kao i izveštaje u globalnoj industriji osiguranja poput  www.sigma-explorer.com, zaključujemo da industrija osiguranja žurno ulazi u digitalizaciju.Problem posmatramo iz dva ugla:\r\n	Iz ugla osiguranika-krajnjeg korisnika. Nemogućnost jednostavnog I jasnog prikaza svih ponuda za konkretno osiguranje,poređenje cene, kvaliteta…\r\n	Iz ugla osiguravajuće kuće. Nemaju jedinstven prikaz potencijalnih klijenata, naročito razvrstan po polu, uzrastu, primanjima, visinom pokrića koju žele, njihovim individualnim potrebama \r\nŽelimo kompletnu personalizaciju osiguranja uz pomoć aplikacije i sajta-da kupci upravljaju svojim potrebama a da osiguravači bolje upoznaju navike i potrebe svojih klijenata i na nagrade ih za buduće realizovane polise.', NULL, NULL),
(4700, 26, 2107, 'U prvoj fazi tržište Srbije,(potencijal tržišta za PZO 40.mil.EUR) zbog kontakata i saradnje sa 5 najvećih OD na tržištu.U naredne dve god. prodor u regionu Balkana,zbog sličnog mentaliteta i navika korisnika.Primera radi (www.nbs.rs),tržište prodaje putnih osiguranja,samo u Srbiji iznosilo je u 2019-oj,pre Covida 2,5 milijarde dinara, a sve vrste životnih osiguranja 22,5 milijardi.U ovoj,godini oporavka,očekuju se slične ili veće vrednosti,a u narednim dalji rast premije.Tržište osiguranja Srbije, će na kraju ove godine dostići vrednost od milijardu evra premije, na šta oko polovina ide na individiulane proizvode – poput prethodno navedenih, a uz njih idu i osiguranje nepokretnosti, kasko osiguranje vozila i naravno obavezno osiguranje vozila-kao dominantno na tržištu.Preimudjstvo u širenju je što iste kuće rade na teritoriji bivše Jugoslavije i prepoznatljive su u ovoj regiji, odnosno radi se o potencijalnom tržištu od oko 200 mil. evra premije, samo za ovu vrstu porizvoda.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(4701, 27, 2107, 'Ciljno tržište su pre svega mladi,poslovni ljudi,porodice.Uža grupa predstavlja putnike,naročito turiste.Po informacijama iz OD (Dunav,Triglav,Generali...) kupci nabavljaju osiguranje u poslednja dva dana pred put, neretko i pred sam polazak,čime utiču na pravilan izbor. Problem rešavamo krajnjim kupcima,što im na jednom mestu, u slučaju putnog osiguranja i niza pitanja na koje bi dali odgovore (u zavisnosti od zemlje gde putuju, broja dana, visine pokrića, zdravstvenog stanja, onime čime će se baviti tamo, covid i drugim pokrićima...) Aplikacija je za one koji žele da na jednom mestu imaju info o svim dostupnim proizvodima,potencijalnim popustima,aktuelnim akcijama...Istražujući u svom okruženju zaključili smo: da su informacije najčešće šture, teže se dolazi do kompletnih i uporedivih podataka i cifara... Još jedan problem koji bismo rešili kupcima je da na  jednom mestu imaju evidenciju o svim polisama i ponudama koje imaju i kod kojih društava za osiguranje.', NULL, NULL),
(4702, 28, 2107, 'Inovacija ide kroz tri nivoa: \r\n1. sam proizvod kao alat kojim se omogućava da se dobije uporedni pregled ponuda \r\n2. jeste usluga naših online agent osiguranja koji pruža kompletnu podršku u odabiru \r\n3. je skup svih informacija (kroz velike baze podataka) na jednom mestu potrebnih da se osiguranje bolje razume i donese prava odluka o najboljoj ponudi.\r\nPutem same aplikacije biće moguće automatizovano naručivanje polise i prijem u pdf dokumentu, bez odlaska u agenciju ili osiguravajuću kuću.\r\nPoseban akcenat stavljamo na evidenciju polisa putem QR koda i uz pomoć njega dokaz o validnosti polise, zdravstvenom stanju klijenta i nizu drugih infromacija bitnih i za klijenta i za osiguravača...', NULL, NULL),
(4703, 30, 2107, 'Trenutna rešenja se ogledaju u odlaske u filijale osiguravajućih kuća,pozivanje telefonom,ili traženje informacija putem meilova,ili web shopova svake od kuća pojedinačno.To iziskuje vreme i vodjenje evidencije i uporedjivanje svih ponuda,dolazeći u problem kupovinom najeftinije ponude, a ne polise koja daje najpotpunije pokriće.Kupujući tako, kupac na kraju ne bude zadovoljan,i onda ga osiguravajuća kuća gubi kao klijenta i za ovaj i za sve svoje druge proizvode koje ima u ponudi. \r\nUz pomoć aplikacije, uz kalkulatore za svaki od programa, vršila bi se predselekcija klijenata za svaku od osiguravajućih kuća, a potencijalni kupci bi osim cene dobijali i  kompletna objašnjenja i uslove osiguranja – kao i razlike i povoljnosti od osiguravajućeg društva do društva.\r\nNema velike konkurencije kako na Srpskom tržištu,sve je još u povoju i sa velikim investicijama koje se plasiraju na tržištu i polako zauzimaju svoje mesto:www.osiguranik.com, www.laqo.hr,www.wefox.com', NULL, NULL),
(4704, 29, 2107, 'Kako je osiguranje široko područje nejasno običnom gradjaninu, neophodne su jasne informacije kako bi doneo najbolju odluku. Naš online alat bi im omogućio da imaju jasno poredjenje ponuda dostupnih na tržištu (obima pokrića i cena). Time se omogućava da odaberu polisu sa najboljim pokrićem za sebe, po odgovarajućoj ceni. Mogli bi da dobiju jasne informacije šta koje pokriće obuhvata i na šta treba obratiti pažnju. Takodje jako bitno, mogli bi da pročitaju iskustvo drugih klijenata. Pokriće polise, cena, tudje iskustvo i online agenti je sve što im je potrebno da najlakše donesu odluku i budu zadovoljni. \r\nOsiguravajuće kuće dobijaju svoje mesto plasiranja usluga gde neko drugi za njih obavlja usluge marketinga, informisanja, podrške. Dakle, benefiti su sledeći: \r\n➢	Najnovije informacije sa tržišta na jednom mestu (ponude, popusti, akcije...),\r\n➢	Poredjenje ponuda i kupovina na jednom mestu,\r\n➢	Kontinuirana edukacija, primeri i saveti, \r\n➢	Nagrađivanje za naredna osiguranja.', NULL, NULL),
(4705, 32, 2107, 'Inovativan je jer koristi AI za prikupljanje podataka o navikama potrošača i ostvarivanje predikcije. Sa druge strane radi predselekciju potencijalnih korisnika.Time se korisnik usmerava ka pravom individuanom rešenju i najkvalitetnijoj ponudi – opciji kod osiguravajuće kompanije koja najbolje pokriva njegove potrebe. Što više podataka, to je ponuda kredibilnija i personalizovanija, što je opet benefit u odnosu na druge.Poslednjih nekoliko godina se intenzivno bavimo ovom temom (www.osiguranje.srb,www.putnoosiguranje.info) \r\nNakon toga su se pojavili slični sajtovi i kalkulatori ali se na njima propagiraju samo kuće sa kojima imaju najbolju saradnju – gde mislimo na visinu provizije, pa se postavlja pitanje objektivnosti u prepoprukama i onoga što se nudi potencijalnim kupcima!?! Shvatili smo da konkurenti ne koriste ovu vrstu tehnologije za praćenje navika potrošača i krajnju ponudu ne predstavljaju sveobuhvatno, ali i jednostavno, jedinstveno i u skladu sa potrebama korisnika.', NULL, NULL),
(4706, 37, 2107, '-', NULL, NULL),
(4707, 40, 2107, 'Osnovni prihod bi bio od provizije koja bi se ostvarivala od osiguravajućih kuća, prilikom prodaje njihovih polisa. U zavisnosti od vrste osiguranja, kao i time da li prodaja ide preko zastupnika u osiguranju, brokera ili putem interneta, provizije se kreću od 10 -25%. Osiguravači su spremni da podrže ovakve sajtove i da delom i plaćaju oglasni prostor na njima – što je dodatna mogućnost zarade. Takodje postoji mogućnost uvezivanja sa sajtovima i ljudima koji se bave sličnim poslovima i propagiraju putem blogova, instagram, facebook i youtube kanalima. Primera radi:\r\n➢	putno zdravstveno osiguranje = turističe organizacije, agencije,hoteli...\r\n➢	obavezno osiguranje motornih vozila = agencije za registraciju i tehnički pregledi,\r\n➢	kasko osiguranje = prodavci novih i polovnih vozila,\r\n➢	osiguranje kuća i stanova = prodavci nekretnina itd.itd.', NULL, NULL),
(4708, 41, 2107, 'Iz godine u godinu smo, pravili sajtove i kalkulatore, pomažući ljudima da dodju do osnovnih informacija za putno i osiguranje vozila.Napravili smo i app AO kalkulator i postavili na play prodavnicu koja i danas funkcioniše. Zaključili smo da treba stvoriti jedinstven sajt i aplikaciju za osnovne proizvode koje korisnici osiguranja kupuju i obezbediti im kompletnu podršku, kalkulatore, informacije i odgovore na, po mogućstvu sva pitanja. \r\nPonosni smo i ističemo da u svom radu imamo mentore i eksperte sa kojima smo u stalnom kontaktu i dobijamo pregršt saveta u kom pravcu da razvijamo ideju, ovde predstavljamo trojicu sa višedecenijskim iskustvom u svojim branšama (finasije, osiguranje i IT tehnologije)\r\nDr Slavimir Stošović  https://www.linkedin.com/search/results/all/?keywords=slavimir%20sto%C5%A1ovi%C4%87&origin \r\nDr Dejan Mandić  https://www.linkedin.com/in/dejan-mandi%C4%87-383912118/ \r\nMr Nikola Pejović https://www.linkedin.com/search/results/all/?keywords=nikola%20pejovic&origin', NULL, NULL),
(4709, 44, 2107, 'Nismo', NULL, NULL),
(4710, 45, 2107, 'NISMO IMALI SPOLJNIH IZVORA FINASIRANJA.\r\nUložili smo nasa sredstava u iznosu od 3.500 Eur za dosadašnji dokaz koncepta, stvarajući kalkulator i prethodno navedene sajtove.', NULL, NULL),
(4711, 48, 2107, 'Korak po korak. Za početak očekujemo da udjemo u uži izbor i budemo izabrani. Zatim da dosta toga novog naučimo u formiranju startapa, njegovom podizanju i \"stavljanju na noge\"  i ono najbitnije da svi zajedno uz pomoć savetnika i metora uspemo u tome. Potreban nam je i značajan  finasijski podsticaj da bi sve ovo uspelo.', NULL, NULL),
(4712, 49, 2107, 'Prema našim planovima i kalkulacijama, računamo na maksimalna sredstva, koja su nam potrebna za izradu kompletne infrastrukture sajta i aplikacije, njihovo održavanje, nadogradnju, kao i nadoknade za učesnike u projektu. Računali smo da se trećina tih sredstava utroši na marketing, internet prezentacije i propagiranje naših rešenja  na društvenim mrežama.', NULL, NULL),
