(4731, 63, 2121, 'Cleanish predstavlja softversko rešenje koje pruža građanima mogućnost da putem svojih mobilnih telefona zabeleže i prijave konkretan problem na teritoriji svojih opština. Za razliku od drugih sličnih rešenja, Cleanish koristi rešenje zasnovano na veštačkoj inteligenciji koja identifikuje problem, prepoznaje kvantitet i kvalitet otpada i zajedno sa ostalim relevantnim podacima kao što su lokacija ili nadležnost, šalje prijavu direkno nadležnoj gradskoj ili komunalnoj instituciji na postupanje, sa praćenjem toka postpuanja po podnetoj prijavi.', NULL, NULL),
(4732, 71, 2122, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4733, 17, 2123, 'Cleanish predstavlja softversko rešenje koje pruža građanima mogućnost da putem svojih mobilnih telefona zabeleže i prijave konkretan problem na teritoriji svojih opština. Za razliku od drugih sličnih rešenja, Cleanish koristi rešenje zasnovano na veštačkoj inteligenciji koja identifikuje problem, prepoznaje kvantitet i kvalitet otpada i zajedno sa ostalim relevantnim podacima kao što su lokacija ili nadležnost, šalje prijavu direkno nadležnoj gradskoj ili komunalnoj instituciji na postupanje, sa praćenjem toka postpuanja po podnetoj prijavi.', NULL, NULL),
(4734, 22, 2123, 'Snežana i Aleksandar se poznaju 10 godina i radili su zajedno na preko 10 aktivističkih (domaćih i evropskih projekata) koji su za cilj imali zaštitu životne sredine i uključivanje građana. Sredinom godine timu se pridružuje Dejan koji daje domensko znanje iz oblasti veštačke inteligencije o alogirtamskog postavljanja  konkretnog projekta.', NULL, NULL),
(4735, 23, 2123, 'Program Raising Starts prepoznali smo kao priliku da učimo kroz razvoj naše poslovne ideje, a da ujedno i razvijemo proizvod koji će pored održivog modela doprineti rešavanju problema u našem okruženju. Prateći prezentacije programa, kao i informacije koje smo dobili kroz razgovore sa učesnicima prvog poziva, verujemo da će nam ovaj program omogućiti da naša ideja postane stvarnost, da svojim znanjem i iskustvom ponudimo zajednici jedno novo rešenje koje će unaprediti naše okruženje, rešenje koje je poslovno održivo sa vidljivim daljim razvojem.', NULL, NULL),
(4736, 24, 2123, 'Cleanish- Čistije!', NULL, NULL),
(4737, 25, 2123, 'Dovoljno je da gradom pešačite 10 minuta i da razgledajući okruženje primetite neki od komunalnih problema - otpad, grafite, loše ulično osvetljenje... probleme o kojima trebaju da brinu javne institucije ili kompanije kojima su ti poslovi povereni. Neretko se dešava da nadležne službe iz različitih razloga ne stignu da urade svoj posao kako treba, pa naše okruženje deluje prljavo. Sa druge strane, građani često pokušavaju da budu aktivni i da prijave probleme, ali vrlo često prijave stižu na pogrešnu adresu, ne sadrže dovoljno podataka ili je nemoguće pratiti postupanje do konačnog rešenja. Sve to građane čini nezadovoljnim, nadležene službe neefikasnim, dok problemi u okruženju čekaju na neko rešenje. Verujemo da na problem može pozitivno uticati rešenje koje će unaprediti komunikaciju izmedju građana i nadležnih službi, kroz jednostavno i intuitivno softversko rešenje i pogućnost praćenja postupanja.', NULL, NULL),
(4738, 26, 2123, 'Primarno ciljano tržište u prve dve godine čini 174 jedinica lokalanih samouprava na teritoriji Republike Srbije - 28 gradova i 145 opština (što uključuje i Grad Beograd), odnosno gradske i opštineske komunalne službe, javna komunalna preduzeća i službe komunalne milicije. Imajući u vidu da je da je nadležnost nad rešavanjem komunalnih problema slična i u drugim državama, nakon razvoja i testiranja Cleanish aplikacije u realnim uslovima i sa značajnim rezultatima, ista će u kratkom vremenskom roku imati mogućnost implementacije u različitim okruženjima.\r\nSekundarno tržište čine privatna komunalna preduzeća, društveno odgovorne organizacije, nevladine organizacije koje se bave angažovanjem građana, ministarstva, organi autonomne pokrajine i upravnih okruga.\r\nInicijalno testiranje aplikacije biće realizovano u saradnji sa GO Palilula, Grad Niš i nadležnim opštinskim komunalnim službama', NULL, NULL),
(4739, 27, 2123, '1. Građanima - jer Cleanish omogućava da na jednostavan način prijave komunalne probleme koje vide u svom okruženju, kao i da prate postupanje po podnetoj prijavi;\r\n2. JLS i nadležnim službama koje brinu o komunalnom redu - jer dobijaju prijave koje su potpune, sa svim neophodnim detaljima za postupanje u adekvatnom roku i na adekvatan način. \r\nUnapređenjem rada komunalnih službi i njihove saradnje građanima, odnosno efikasnim postupanjem po prijavama dobiće se čistije okruženje zbog koga će svi akteri biti zadovoljniji.', NULL, NULL),
(4740, 28, 2123, 'Cleanish aplikacija putem veštačke inteligencije, istreniranim modelom prepoznavanja i klasifikacije otpada i definisanjem tačne lokacije omogućava brzu i preciznu komunikaciju između građana i nadlezžnih komunalnih službi. Klasifikacijom otpada automatski se definiše i nadležna institucija zadužena za postupanje (komunalna inspekcija, vodoprivredna inspekcija, reciklažno postrojenje ili javno komunalno preduzeće). Na ovaj način se ubrzava proces komunikacije ali i skraćuje vreme potrebno za pravovremenu reakciju i u startu definišu nadležni partneri.', NULL, NULL),
(4741, 30, 2123, 'Komunikacija komunalnih službi sa građanima najčešće je zasnovana na pisanim prijavama - građani podnose prijavu na šalteru, prijave putem mejla, korišćenjem kontakt formi na sajtovima gradova i opština. U svim navedenim slučajevima, podnosilac prijave ne može da prati postupanje (osim ako se ne interesuje telefonom), a ukoliko ne zahteve u podnesku, može ostati i bez odgovora. Sa druge strane, komunalne službe se često susreću sa nepotpunim prijavama koje zahtevaju dopunu ili su neosnovane, odnosno upućene pogrešnoj službi. Informacije koje dobiju od gradjana su neprecizne i u domenu klasifikacije otpada, lokacije i često ne postoji informacija o samoj osobi koja prijavljuje problem. Verodostojnost usmenih prijava je pod velikim znakom pitanja a Inspektori komunalnih službi moraju da obiđu veliki teren a nemaju precizne informacije o problemu.', NULL, NULL),
(4742, 29, 2123, 'Efikasnost - nadležne komunalne službe dobijaju prijave sa svim potrebnim detaljima da planiranje nadzora i postupanje po istim;\r\nTranspartntnost - građani kao podnostici prijava mogu da prate tok postupanja po podnetim prijavama i da po završetu dobiju odgovor o učinjenom;\r\nStatistički podaci - nadležne službe će nakon godinu dana imati set kvalitetnih podataka iz realinog okruženja koje će omogućiti bolje planiranje i rad komunalnih služni;\r\nUšteda - povećanjem efikasnosti, smanjenjem broja nepotpunih i neosnovanih prijava građana smanjiće se i broj nadzora/postupanja bez rezultata, a samim tim i unaprediti ekonomično poslovanje služnu.\r\nBolji utisak javnosti - komunikacija i aktivno postupanje po prijavama građana omogućiće bolju ugled nadležnih komunalnih službi u javnosti;', NULL, NULL),
(4743, 32, 2123, 'Smatramo da Cleanish predstavlja mogućnost za značajno poboljšanu komunikaciju između građana i komunalnih službi jer upotrebom veštačke inteligencije i senzora na telefonu, kroz predefinisane odgovore i intuitivni interfejs, omogućava građanima da efikasno i dvosmerno komuniciraju sa nadležnim komunalnim službama, odnoso inicira postupanje komunalnih službi sa svim relevantnim podacima za efikasno postupanje.', NULL, NULL),
(4744, 37, 2123, 'Upoznati smo sa procedurama i troškovima zaštite intelektualne svojine. Za sprovođenje provesa zaštite, kao konsultant biće angažovana Aleksandra Vasić, asistent Pravnog fakulteta u Nišu, sa kojom smo već  u predhodnom projektu prošli celokupan proces zaštite patenta za teritoriju Srbije.', NULL, NULL),
(4745, 40, 2123, 'Prodajni model baziran je na godišnjim pretplatama, a iznos paketa zasniva se na skaliranju cene u odnosu na veličinu jedinice lokalne samouprave, broj korisnika i očekivani prijava. Prosečna mesečna pretplata za osnovnu uslugu iznosi 20.000,00 dinara mesečno, odnosno 240.000,00 dinara na godišnjem nivou. Za održivo poslovanje kompanije, na osnovu fiksnih i varijabilnih troškova potrebno je prodati 10 osnovnih paketa. Prodaja će se vršiti kroz različite pristupe u akviziciji potencijalnih kupaca direktnom prodaju, kao i putem edukacije zaposlenih u nadležnim službama, saradnju sa Stalnom konferencijom gradova i opština.', NULL, NULL),
(4746, 41, 2123, 'Do sada smo razvili prototip Cleanish koji je postavljen na gplay-u. Ovaj deo je uradjen bez veštačke inteligencije i predstavlja kopiju naše pređašnje aplikacije koja je imala zavidnu iteraciju sa građanima u kontekstu prijavljivanja lokalnih problema. Na toj ideji i partnerstu smo radili poslednje dve godine i uspeli da krenemo u ozbiljnu realizaciju sa niškom opštinom Palilula. Uključivanjem Dejana Batanjca u naš tim dobijamo na ubrzanju i domenskoj ekspertizi iz veštačke inteligencije koja će u znatnoj meri da doprinese dodatoj vrednosti za potencijalne parntere i korisnike. U predhodnoj aplikaciji imali smo preko 200 iteracija sa građanima opštine Palilula i preko 80% rešenih problema.', NULL, NULL),
(4747, 44, 2123, 'Učestvovali smo na takmičenju Balkathon i ušli u uži izbor nakon rada sa mentorima. Takodje, prošli smo neke od zanimljivih obuka u razvoju poslovanja (lean i kanvas) kako bi bolje i preciznije definisali naš projekat. Obuke su rađene u okviru Naučno tehnološkog parka a naša ideja bila je pobednička na kreni konferenciji (www.kreni.org) na kojom smo radili sa 5 različitih domaćih i inostranih mentora.', NULL, NULL),
(4748, 45, 2123, 'Sa Ambasadom Švedske dogovoreno je sufinansiranje u iznosu od 2000 eura za razvoj inicijalne aplikacije, koja će u partnerstvu sa opštinom Palilula biti testirano sa nadležnom komunalnom inspekcijom. Finansiranje je dobijeno preko udruženja Mladi ambasadori koje je realizovalo konferenciju KreNi.', NULL, NULL),
(4749, 48, 2123, 'Od Raising Starts programa očekujemo da nam kroz eduktivini proces i finansijsku podršku pomogne da razvijemo proizvod koji će biti spreman za tržište, kao i da nam pruži znanja i vidljivost koja će omogućiti bolje uslove za plasman i skaliranje proizvoda na tržištu.', NULL, NULL),
(4750, 49, 2123, 'U skladu sa predviđenim budžetom Raising Starts programa, predviđeni iznos od 15000 CHF biće u najvećoj meri utrošen na razvoj i treniranje veštačke inteligencije kako ni se procenat preciznosti podigao iznad 95%, razvoji interfejsa - android i iOS aplikacije sa pozadinskim panelom za administratora, kao i za troškove marketinga koji će pored promotivne kampanje i promotivnih akcija, obuhvatiti obilaske gradova i opština u Srbiji.', NULL, NULL),
