(4762, 90, 2132, 'Potpuno posvećen', NULL, NULL),
(4763, 91, 2132, '30% svog vremena angažovan na drugim AI projektima i obrazovanju mladih kadrova', NULL, NULL),
(4764, 71, 2136, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4765, 71, 2137, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4766, 63, 2138, 'Tim Niledis razvija inovativni softverski proizvod FrizMo za virtuelno ispobavanje frizura, zasnovan na primeni veštačke inteligencije.\r\nNa osnovu fotografije lica korisnika i fotografije lica bilo koje osobe čiji izgled frizure korisnik želi da proveri na sebi, softver generiše novu sliku koja prikazuje izgled korisnika sa novom, željenom frizurom.\r\nZahvaljujući primeni veštačke inteligencije, generisana slika daje veran prikaz izgleda korisnika sa izmenjenom frizurom.\r\nZa razliku od postojećih rešenja, naš pristup ne zahteva predefinisane šablone frizura, već korisnicima daje punu slobodu u izboru stila frizure i efekata na kosi bez potrebe za dodatnim podešavanjanjem detalja na slici.', NULL, NULL),
(4767, 71, 2139, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4768, 17, 2140, 'Tim Niledis razvija inovativni softverski proizvod FrizMo za virtuelno ispobavanje frizura, zasnovan na primeni veštačke inteligencije.\r\nNa osnovu fotografije lica korisnika i fotografije lica bilo koje osobe čiji izgled frizure korisnik želi da proveri na sebi, softver generiše novu sliku koja prikazuje izgled korisnika sa novom, željenom frizurom.\r\nZahvaljujući primeni veštačke inteligencije, generisana slika daje veran prikaz izgleda korisnika sa izmenjenom frizurom.\r\nZa razliku od postojećih rešenja, naš pristup ne zahteva predefinisane šablone frizura, već korisnicima daje punu slobodu u izboru stila frizure i efekata na kosi bez potrebe za dodatnim podešavanjanjem detalja na slici.', NULL, NULL),
(4769, 22, 2140, 'Duži niz godina smo sve tri radile u internacionalnoj kompaniji, u IT sektoru. Jelena i Zorica su radile u istom timu i na zajedničkim projektima. Do sada nismo zajedno radile na razvoju neke druge startap ideje.', NULL, NULL),
(4770, 23, 2140, 'Za prijavu za ovaj Program motivisalo nas je:\r\n-Sticanje neophodnog znanja za započinjanje i održanje sopstvenog biznisa uz podršku kvalifikovanih timova i mentora;\r\n-Mogućnost da se kroz pokretanje sopstvenog biznisa postignu samostalnost i sloboda u sprovođenju sopstvenih poslovnih ideja u delo;\r\n-Šansa za dobijanje finansijske podrške u započinjanju sopstvenog biznisa;\r\n-Kompleksnost problema koji želimo da rešimo;\r\n-Želja za učenjem i ovladavanjem novim tehnologijama;\r\n-Širenje kruga poslovnih prijatelja i saradnika;\r\n-Saznanje da je naša ideja prijemčiva i atraktivna za širok krug korisnika, uključući individualne korisnike, male privrednike i kompanije;\r\n-Uključivanje članova porodice u zajedničke poslovne poduhvate;\r\n-Razvoj i produktizacija softverskog proizvoda koji će se koristiti u svakodnevnom životu;\r\n-Mogućnost da se kroz učešće u razvoju preduzetništva na našim prostorima doprinese razvoju lokalne zajednice.', NULL, NULL),
(4771, 24, 2140, 'Inspirisan promenom', NULL, NULL),
(4772, 25, 2140, 'Bavimo se problemom virtuelnog isprobavanja u industriji lepote, kao globalnog trenda (engl. virtual try-on). Na tržištu industrije lepote postoji potreba za virtuelnim eksperimentisanjem u vezi sa izgledom i isprobavanjem različitih stilova frizura, efekata na kosi ili kozmetičkih proizvoda pre konkretne promene izgleda u realnosti. Virtuelna realnost nudi rešenje u vidu slike koja predstavlja kombinaciju karakteristika iz realnog sveta i virtuelnog sveta. U problemu koji rešavamo, sliku lica korisnika potrebno je uklopiti sa slikom izabrane frizure. Problem koji rešavamo je kompleksan jer korisnik pri izboru željene frizure nema nikakvih ograničenja. Osim toga, nezavisno od alata primenjenih za obradu i generisanje slike, potrebno je ostvariti visoku rezoluciju i vernost prikaza virtuelno izmenjenog izgleda da bi korisnik bio zadovoljan, što je izuzetno težak zadatak.\r\nZa problem smo saznali iz ličnog iskustva, a nakon toga smo svoja zapažanja potvrdili istraživanjem tržišta.', NULL, NULL),
(4773, 26, 2140, 'Naše ciljno tržište je globalno tržište IT softvera i servisa za virtuelno isprobavanje proizvoda. Prema izveštaju sa sajta https://www.fortunebusinessinsights.com/industry-reports/virtual-fitting-room-vfr-market-100322, vrednost ovog tržišta u 2021. je iznosila $3.50 mlrd, sa očekivanim rastom do $12.97 mlrd, u 2028. i CAGR od 20.6% u periodu 2021-2028. Glavni pokretač je povećanje obima elektronske kupovine, pri čemu se virtuelno isprobavanje proizvoda pokazalo kao konkurentska prednost, a kompanije koje nude tu funkcionalnost imale su porast prihoda čak i u uslovima pandemije.\r\nNaš fokus je segment softvera i servisa za virtuelno isprobavanje frizura. Ispitivanja lokalnog tržišta pokazala su da koncept virtuelnog isprobavanja na našim prostorima još nije prepoznat i zato u prvoj fazi realizacije naše strategije izlaska na tržište, targetiramo lokalno tržište, Srbiju. U drugoj fazi planiramo izlazak na tržište balkanskih zemalja, a u trećoj na globalno tržište.', NULL, NULL),
(4774, 27, 2140, 'Naši potencijalni kupci su:\r\n-Kompanije koje proizvode kozmetičke proizvode i sredstva za negu kose;\r\n-Prodajni centri, prodavnice i platforme za elektronsku kupovinu;\r\n-Individualni korisnici, frizerski saloni i saloni lepote.\r\n\r\nDo sada smo ostvarili kontakte sa nekoliko lokalnih frizerskih salona i osoba iz našeg okruženja,  radi provere potencijala ideje i prikupljanja specifikacija proizvoda koji bi nas usmerili ka dizajnu prilagođenom krajnjem korisniku. Na osnovu prikupljenih informacija došli smo do saznanja da je za većinu potencijalnih kupaca koncept virtuelnog isprobavanja nepoznat i da postoji veliko interesovanje da se takva ideja realizuje i na našim prostorima.', NULL, NULL),
(4775, 28, 2140, 'Naš tim razvija softver za virtuelno isprobavanje frizura i preparata za kosu. Na osnovu fotografije lica korisnika i fotografije lica bilo koje osobe čiji izgled frizure korisnik želi da proveri na sebi, softver generiše novu sliku koja prikazuje virtuelno izmenjen izgled korisnika sa željenom frizurom i bojom kose. Zahvaljujući primeni mašinskog učenja, generisana slika predstavlja prirodan i veran prikaz izgleda korisnika sa izmenjenom frizurom. Naš pristup je jedinstven jer, za razliku od postojećih rešenja, ne zahteva predefinisane šablone frizura, već korisnicima daje punu slobodu u izboru stila frizure i efekata na kosi bez potrebe za dodatnim podešavanjanjem detalja na slici.', NULL, NULL),
(4776, 30, 2140, 'Tokom poslednjih nekoliko godina, na globalnom tržištu pojavila su se rešenja za virtuelno isprobavanje frizura,  razvijena uglavnom od strane startapova. Kompanije iz sektora lepote koje žele da unaprede svoje poslovanje i uključe ovakava rešenja u svoju ponudu klijentima, zbog kompleksnosti i cene razvoja uglavnom kupuju gotova rešenja, ili se vrši akvizicija startapova koji su se već dokazali na tržištu.\r\nIndividualnim korisnicima dostupne su on-line aplikacije na sajtovima kompanija i elektronskih prodavnica, na mobilnim telefonima (Modiface, Celebrity, Try On, HairStyle i druge), ili programi za obradu fotografije (PixLR, PhotoVisi, Photo505, Photoshop i druge).\r\n\r\nNa lokalnom (srpskom) tržištu aplikacije za virtuelno isprobavanje frizura za sada koristi samo uži krug individualnih korisnika, dok potencijal primene u frizerskim salonima, salonima lepote, prodajnim centrima, kompanijama i elektronskoj kupovini još uvek nije prepoznat.', NULL, NULL),
(4777, 29, 2140, 'Kompanijama koje proizvode ili prodaju kozmetičke preparate donosimo sledeće:\r\n-Povećanje obima poslovanja i zarade, ako svojim kupcima ponude opciju virtuelnog isprobavanja frizura, boja i drugih kozmetičkih proizvoda u prodajnim centrima, elektronskim prodavnicama, kao i u marketinškim kampanjama;\r\n-Manje nezadovoljnih kupaca i manje povraćaja neodgovarajuće robe.\r\n\r\nFrizerskim salonima i salonima lepote omogućavamo:\r\n-Unapređenje poslovanja i povećano interesovanja klijenata za njihove usluge, zbog korišćenja naprednih tehnologija u svakodnevnom radu;\r\n-Mogućnost da frizer uporedi svoj rad sa slikom dobijenom iz aplikacije.\r\n\r\nIndividualnim korisnicima pružamo:\r\n-Veće zadovoljstvo zbog mogućnosti  odabira odgovarajuće frizure i boje kose, ili unapred  odustajanje od početne ideje u slučaju nezadovoljstva svojim virtuelnim izgledom;\r\n-Mogućnost eksperimentisanja svom izgledom;\r\n-Povećanje samopouzdanja.', NULL, NULL),
(4778, 32, 2140, 'Softverske aplikacije za virtuelno isprobavanje frizura koje su do sada razvijene najčešće koriste predefinisane šablone frizura i efekata na kosi, koje korisnik bira po želji. U većini slučajeva, prikaz željenje frizure dobija se uz dodatna ručna podešavanja slike, što zahteva značajan utrošak vremena. U nekim aplikacijama nije potrebna dodatna intervencija od strane korisnika, ali je kvalitet prikaza slabiji. Naš softver:\r\n-daje fleksibilnost u izboru željene frizure jer ne koristi predefinisane šablone frizura,\r\n-korisniku omogućava da izabere bilo koju sliku frizure koja mu se dopada i koju zeli da virtuelno isproba na sebi,\r\n-ne zahteva nikave dodatne intervencije na slici lica, ili slici frizure radi podešavanja uklapanja lica i nove frizure,\r\n-generise sliku lica sa novoizabranom frizurom koja izgleda prirodno, zahvaljujući primeni najnovijih tehnologija zasnovanih na veštačkoj inteligenciji.', NULL, NULL),
(4779, 37, 2140, 'Istraživali smo mogućnosti za zaštitu prava intelektualne svojine nad softverom. \r\nNama prihvatljive opcije za sada su autorsko pravo i poslovna tajna.\r\nNakon razvitka prototipa razmotrićemo potrebu i uslove prijavljivanja patenta za tehničku inovaciju.\r\nStartap Niledis bio bi vlasnik prava intelektualne svojine za svu vrednost stvorenu tokom trajanja Programa.', NULL, NULL),
(4780, 40, 2140, 'Naš startap planira da zaradjuje od:\r\n-Prodaje licenci - prava korišćenja razvijenog softvera. Cena licence bila bi određena u zavisnosti od kategorije klijenta, nivoa funkcionalnosti i paketa usluga. Planiran je razvoj nekoliko verzija softvera sa različitim nivoom funkcionalnosti i paketom usluga:\r\n        -Osnovni paket - besplatan;\r\n        -Standardni paket;\r\n        - Premijum paket\r\n-Periodičnog redovnog održavanja softvera u produkciji;\r\n-Pruzanja usluga u razvoju i modifikaciji osnovne verzije softvera radi prilagođavanja potrebama klijenta.\r\n-Pružanja usluga kompanijama u vidu napredne analitike i personalizovane preporuke na osnovu podataka prikupljenih od korisnika softvera, a u skladu sa GDPR regulativom.', NULL, NULL),
(4781, 41, 2140, 'Naš tim je oko razvoja ideje okupljen 5 nedelja.\r\nZa to vreme sakupili smo informacije od potencijalnh kupaca i ispitali zainteresovanost frizerskih salona i pojedinaca, za potrebom  aplikacije. \r\nUporedili smo koncept razvoja naše aplikacije sa već postojećim na tržištu  i procenili  kvalitet softverskih rešenja koja na sličan način tretiraju problem virtuelnog prikaza.\r\nZainteresovali smo članove naših porodica, posebno omladince, kako bi se aktivno uključili u realizaciju projekta od samog početka.\r\nIspitali smo potencijal ideje kroz istraživanje lokalnog tržišta frizerskih usluga i istraživanje globalnog tržišta industrije lepote. Istraživanje je pokazalo da, zbog rastućih zahteva kupaca, virtuelno isprobavanje postaje ne samo globalni trend u industriji lepote, već i potreba.', NULL, NULL),
(4782, 44, 2140, 'Do sada nismo učestvovali u mentorskim, niti startap programima.', NULL, NULL),
(4783, 45, 2140, 'Za sada nemamo dodatnih izvora finansiranja, ali planiramo  da u naredna dva meseca:\r\n- Razgovaramo sa kompanijama, potencijalnim partnerima;\r\n- Konkurišemo kod drugih fondova za podršku razvoju preduzetništva;\r\n- Razgovamo sa dobavljačima računarske opreme i ponuđačima  usluga radi ugovaranja nabavke pod najpovoljnijim uslovima.', NULL, NULL),
(4784, 48, 2140, 'Od učešća u Programu očekujemo:\r\n-Razvoj preduzetnickog duha;\r\n-Stizanje veština i novih znanja vezanih za pokretanje posla, razvoj  proizvoda,  nalaženje investitora, razvoj poslovanja i biznis modela i upravljanje preduzećem;\r\n-Podršku u plasiranju krajnjeg proizvoda;\r\n-Proširenje naše mreže kontakata;\r\n-Upoznavanje sa važećim pravnim i poreskim procedurama za pokretanje startapa;\r\n-Upoznavanje sa drugim programima i mogućnostima za podršku razvoju preduzetništva.\r\nSmatramo da nam je podrška najpotrebnija upravo u fazi osnivanja startapa i započinjanja posla.', NULL, NULL),
(4785, 49, 2140, 'Finansijska sredstva potrebna u trenutnoj fazi (razvoj prototipa, 1 godina) iznose ukupno 120,000 EUR, i to:\r\n1. Zaposleni - 90,000\r\n2. Angažovani - 9,000\r\n3. Knjigovođa, pravnik - 2,400\r\n4. Računarska i druga oprema - 10,000\r\n5. Najam prostora, režijski troškovi - 3,600\r\n6. Ostali troškovi poslovanja - 5,000', NULL, NULL),
