(4789, 83, 2146, NULL, NULL, NULL),
(4790, 89, 2147, 'Obrazovanje:\r\nUniverzitet u Nišu, Elektronski fakultet (program - 5 godina studija)\r\nIskustvo:\r\nPreko 20 godina iskustva na pozicijama softverskog inženjera i trenera za korišćenje specijalizovanih programa. Veliko iskustvo u dizajniranju, razvoju i implementaciji integrisanih IT rešenja, od inicijalnih zahteva korisnika i analize poslovnih procesa, do prihvatanja rešenja od strane korisnika, i to u različitim oblastima poslovanja uglednih trgovačkih, medicinskih, turističkih i osiguravajućih društava. Značajno iskustvo u dizajniranju, razvoju i implementaciji  IT rešenja za potrebe automatizacije prodaje, računovodstva, knjigovodstva, obračuna zarada i kadrovske evidencije, analize profita, praćenja proizvodnje. Pružajući usluge održavanja i unapređenja sitema.', NULL, NULL),
(4791, 90, 2147, 'Uloga: zadužena za finansije i vođenje projekta\r\nU manjoj meri posvećena, 13 sati nedeljno u početnom periodu', NULL, NULL),
(4792, 91, 2147, 'Analitičar informacionih sistema, konsultant u Philip Morris International\r\nAngažovanje: 40 sati nedeljno', NULL, NULL),
(4793, 89, 2148, 'Obrazovanje:\r\nUniverzitet u Nišu, Elektronski fakultet (osnovne studije, magistarske studije)\r\nIskustvo:\r\nViše od 26 godina iskustva u oblasti informacionih tehnologija, od toga:\r\n- 5 godina u istraživanju i razvoju algoritama i softverskih alata za obradu slike, video zapisa i teksta, zasnovanih na primeni veštačke inteligencije. Kao  član tima, radila na razvoju modela mašinskog učenja za primene u platformi za e-učenje, klasifikaciju slika i predikciju vremenskih serija. Radila na dokazu koncepta za primene veštačke inteligencije u detekciji defekata. Učestvovala u radu 3 startapa;\r\n- 12 godina na poziciji analitičara informacionih sistema, na poslovima planiranja i vođenja projekata, implementaciji i održavanju fabričkih IT sistema u proizvodnji i upravljanju fabričkim IT servisima;\r\n- 4 godine rada na istraživačko-razvojnim projektima u oblasti adaptivne i slepe obrade signala;\r\n- 5 godina angažovanja u nastavi i na istraživačko-razvojnim projektima u visokoškolskim ustanovama.', NULL, NULL),
(4794, 90, 2148, 'Uloga: kreator ideje, zadužena za tehnologiju i razvoj\r\nU većoj meri posvećena, 32 sati nedeljno', NULL, NULL),
(4795, 91, 2148, 'Privatni preduzetnik, računarsko programiranje\r\nAngažovanje: 20 sati nedeljno', NULL, NULL),
(4796, 89, 2149, 'Obrazovanje:\r\nUniverzitet u Nišu, Elektronski fakultet (program - 5 godina studija)\r\nIskustvo:\r\nVise od 20 godina  iskustva  u informacionim tehnologijama \r\n-Podrška u različitim poslovnim područjima \r\n- Prodaja -  dizajn, održavanje i podrška Sales & Marketing aplikacije, učešće u dizajnu hand held aplikacije i kreiranju novog distributibnog modela prodaje u Srbiji, razvijanje reporting sistema, prva linija korisničke podrške\r\n-Finansije  - održavanje i podrška sistemu Obračun plata, podrška SAP korisnicima \r\n-Učešće u dizajnu, razvoju i implementaciji lokalnih aplikacija na našem i inostranom tržištu', NULL, NULL),
