(4808, 25, 2158, 'Resavamo problem cene baterija potencialnim kupcima,globalni problem preciscavanje vazduha u atmosveri.Po prvi put zeleni donosi prihod vlasniku kupcima zelenih bicikala kada isporucuju elektricnu enrgiju drzacima parking elektrana na parkingu ,od strane investitora drzaca parking elektrana.Resava globalni problem nepokrivenosti  i neiskoriscenosti parking prostora  i puteva solarnim elektranama sa zelenih bicikala.Gabariti zelenog bicikla ne prelaze gabarite obicnih bicikla po duzini,sirini pa u cilju odrzanja industrije sprecava zakrcenje saobracaja do dolaska na radno mesto .sto su ujedinjene nacije i prepoznale 3.jun dan bicikla.', NULL, NULL),
