(4812, 30, 2158, 'Trenutno potencialni kupci resavaju problem elektricnim biciklima  sa baterijama uz dodatak solarni punjac baterija na ramu bickla,ili obicnom biciklom.', NULL, NULL),
(4813, 29, 2158, 'Glavni benefiti nema utroska enrgenata novca  za pogonsko kretanje zelenog bicikla,nus pojavom filtracije cetvrtog ekoloskog energenta  u predelu nozdrva vozaca  i same okoline  kupcima resava problem ocuvanja ili ozdravljena  zdravlja pluca.od udara svih aero bioloskih,hemiski i pm cestica prasina .Jedinstvenostvenost,samopunjujuci nez avistan, 100 %ekoloski.isporucuje parkig elektranama elektricnu energiju sa panela  uz mogucnost zarade kupcu.', NULL, NULL),
(4814, 32, 2158, 'Hibridno solarno vazdusni bicikl (Zeleni bicikl).Globalno preciscava vazduh,koristi,100% zelenu energiju, broj 1 u sluzbi  ocuvanja preporuka  zdravlja pluca vozaca  .Novina je drzac parking elektrane za hibridno solarne vazdusne bicikle.', NULL, NULL),
(4815, 37, 2158, 'Planiramo da predam,uradjeni patentni zahtev za zastitu  intelektualne svojine u konsultaciji sam sa zavodom za zastitu patenta predaja patentnog zahteva do ..15.01.2022g.Vlasnici bi bili Djordjevic Vesna i Popovic Sinisa', NULL, NULL),
(4816, 40, 2158, 'Da prisvojena vrednost start upa bude manja od vrednosti kupca koji prisvaja,da siri svoje trziste  i da preti trziste  dodatnim stalnim inovacijama na proizvodu  zbog zastite od  sigurnog ocekivanog udara nemilosrdne  konkurencije .', NULL, NULL),
(4817, 41, 2158, 'Izradjena su  dva  prototipa hibridnog,solarnog,vazdusnog bicikla  i trocikla trocikal je testiran 3 godine ,na podrucju Leskovca i okoline.U pogledu osencenja,sunce iza oblaka,godisnje doba,brzine kretanja u rasponu od 20 do 30 km.h.Dok je hibridno solarni bicikal testiran u tajnosti 4 godine na podrucju  obilaska.brestovackog jezera,slavnik,radan planine na uspone i izdrzljivost konstrukcije na  vestacki izazvane padove radi isprobavanja bezbednosti  solarnog panela kao i  neutralizacija od udare bocnih  vetrova  kako bi zeleni bicikal ostao stabilan u kretanju  i spsoban da se krece  i na peskovite terene..Razvijeno automatsko komprimovanje zelenom elektricnom energijom mono kristalnog panela  cetvrtog energenta vazduha  kontinuirano to jest i kada je sunce iza oblaka pritisak u rezervoaru raste .', NULL, NULL),
(4818, 44, 2158, 'konkurisala sam ranije u RAS dobila minimalna novcana sretstva za kupovinu masina za proizvodnju Tajlanskog sladoleda,po ugovoru i uz saradnju sa mentorom ispostovala ugovor u kome sam bila obavezana da odrzim radnju u trajanju od 2 godine od dana potpisivanja ugovora .Posto sam krenula sa idejom promenila sam interesovanje i uspela da napravimo jedinstveni solarni vazdusni bicikl,za kojim imam veliko interesovanje ljudi koji bi hteli da kupe.', NULL, NULL),
(4819, 45, 2158, 'Bili smo ucesnici u takmicenju za najbolju tehnolosku inovaciju prvi put pre 8 godina za antikancerogenu skaru na cumuru bez salivacije masti u cumuru,odustali smo zbog emisije stetnih gasova u atmosferi ,kao i ucesnici i ovogodisnjeg  takmeicenja 2021g. za Solarni vazdusni bicikl.Nismo uzimali nikakve kredite vezano za inovacije raspolazemo iskljucivo nasim sopstvenim sretstvima i jakom voljom i zeljom.Sada sobzirom da imamo interesovanje potencionalnih kupaca zelja nam je da nasu inovaciju komercializujemo.', NULL, NULL),
(4820, 48, 2158, 'sve do izlaka prvog proizvoda na nase trziste koje mislim da i nije toliko zahtevno .', NULL, NULL),
(4821, 49, 2158, 'Samo u fazi beta razvijen proizvod ,.hibridnog solarnog vazdusnog bicikla minimum,10000. Eura. za kupovinu repromateriala proizvoda  i polu proizvoda,kako bi izradili zeleni bicikl,troskovi i pomoc u uvodjenja novih evrposkih standarda za hibridno vazdusne solarne bicikle,dozvola ,atesta, kod nas i td.  (kasnije kada proizvod zazivi  osim sklapanje ili uvoz mikro kontrolera,solarnih mono kristalnih panela misljenja sam sve ostalo bi  proizvodilli u  srbiji.)', NULL, NULL),
