(4839, 63, 2170, 'Sveobuhvatno smart city 2.0 rešenje - monitoring i menadžment sistem, koji prikuplja ključne podatke putem mobilnog hardware-a postavljenog na bilo koju vrstu vozila.', NULL, NULL),
