(4842, 17, 2172, 'Sveobuhvatno smart city 2.0 rešenje - monitoring i menadžment sistem, koji prikuplja ključne podatke putem mobilnog hardware-a postavljenog na bilo koju vrstu vozila.', NULL, NULL),
(4843, 22, 2172, 'Kao tim do sada nismo saradjivali na zajednickom projektu i ovo je prvi put. Ipak vecina clanova tima ima iskustvo razvoja jednog ili vise startapa u prethodnih 10 godina. Neki clanovi tima su vrlo aktivni na startap sceni Srbije i godinama unazad na razlicite nacine pomazu razvoj startap ekosistema.', NULL, NULL),
(4844, 23, 2172, 'Glavni cilj naše prijave je prilika da radimo sa najboljim mentorima iz industrije koji imaju relevantno iskustvo u B2B i B2G biznis modelingu. \r\nNakon tri meseca, planiramo da imamo završen funkcionalni prototip spreman za prezentaciju za pilot projekte i jasno razrađen biznis model i strategiju formiranja cena, do kojih bismo došli u saradnji sa mentorima. \r\nImajući u vidu pozitivna iskustva startup timova iz prve kohorte programa Raising Starts, odlučili smo da se prijavimo i pokušamo da iskoristimo ovu priliku.', NULL, NULL),
(4845, 24, 2172, 'Smart City 2.0', NULL, NULL),
(4846, 25, 2172, 'Problemi iz kojih potiče prostor za unapređenje u trenutnoj praksi pametnog gradskog menadžmenta su: \r\n- Nedovoljna efikasnost komunalnih službi\r\n- Nedostatak automatizovanog sistema otkrivanja, uklanjanja i dokumentovanja svakodnevnih komunalnih problema \r\n- Neadekvatani sistemi za upravljanje saobraćajem\r\n- Nedostupnost podataka u realnom vremenu\r\n- Statično prikupljanje podataka koje je ograničeno na fiksno područje koje imaju skupljači podataka koje je obično u gradskom centru i kritičnim tačkama\r\n- Podaci se prikupljaju pojedinačno sa različatih uređaja i nisu integrisani, pa ne postoji kompletna slika za informisano donošenje odluka i razvoj strategija koje će doprineti poboljšanju kvaliteta života u urbanim sredinama', NULL, NULL),
(4847, 26, 2172, 'Ključna tržišta su pre svega UAE i EU, a interesantna i SAD, Azija, Australija i Bliski istok. Vrednost smart city industrije 2022. mogla bi da dostigne 1933 miliarde $ (Market Research Future). Globalna vrednost industrije do 2026. dostići će 2500 milijardi $ (2,5 triliona) (Reportlinker, maj 2021).  Prema svim procenama, industrija će rasti po CAGR 21+ % barem u narednih 5 godina. KMPG procenjuje da će se u UAE investicije duplirati u periodu 2019-2022. Samo plan Za pametni Dubaji vredan je 7-8 milijardi $. Nemačka će u regione inestirati više od 40 milijardi $ u narednih 5-6 godina (Reportlinker). ERDF uložio je više od 15 milijardi EUR u proteklih 6 godina u održive projekte na lokalnom nivou. Tražnja vredna više od 52 milijarde $ projektovana je u ostatku Evrope (Reportlinker). Industrija automatizacije čija je vrednost 2025. projektovana na 414 milijardi $ (CCB isto deo zbog AI komponente i automatizacije putem platforme), značajno doprinosi trendu.', NULL, NULL),
(4848, 27, 2172, 'Naš proizvod je B2B i B2G orijentisan, što najviše zavisi od konkretnog tržišta.\r\n\r\nJedan profil korisnika su lokalne samouprave i komunalna preduzeća koja imaju potrebu za podacima u realnom vremenu i široku pokivenost.\r\n\r\nDrugi tip korisnika su pružaoci komunalnih usluga, privatne kompanije koje se bave poslovima gradskog održavanja. Oni imaju obavezu redovnog održavanja i u slučaju propusta plaćaju penale.\r\n\r\nJedni ili drugi su korisnici, s tim što mogu i lokalne samouprave da pruže ovaj sistem kao podršku pružaocima komunalnih usluga, bilo da su oni u sklopu gradske uprave ili privatni. \r\n\r\nTreći tip korisnika su kompanije zainteresovane za ovu vrstu podataka, kao i udruženja i predstavnici NVO sektora.', NULL, NULL),
(4849, 28, 2172, 'Naša inovacija je smart city 2.0 monitoring i menadžment sistem, koji prikuplja podatke putem mobilnog hardware-a postavljenog na bilo koju vrstu vozila - CloudCity Box (CCB). \r\nPrva komponenta CCB-a putem kamere i AI sistema prepoznaje komunalne probleme, registruje ih i automatski putem platforme kreira radne naloge i šalje ih komunalnim službama.\r\nDruga komponenta CCB-a putem seta senzora prikuplja podatke o ključnim parametrima kvaliteta života koji se prikazuju na korisničkom interfejsu u vidu heat mapa u realnom vremenu. Sistem ih analizira i sugeriše odluke koje vode optimizaciji komunalnih delatnosti, unapređenju sigurnosti, blagostanja i poboljšanju kvaliteta života u gradovima.', NULL, NULL),
(4850, 30, 2172, 'Trenutno se ovi problemi rešavaju korišćenjem standardnih kamera i senzora, koje su danas u širokoj upotrebi uglavnom na centralnim gradskim lokacijama u mnogim mestima. \r\n\r\nOvo rešenje se primenjuje godinama u nazad i tržište je spremno da prihvati nova rešenja, koja će drastično unaprediti kvalitet podataka i time odluka koje se na bazi njih donose. Pored toga, postavaljanje i održavanje ove strukture je u odnosu na rešenje koju Smart City Technologies planira da ponudi skupo i neefikasno. Cloud City Box predstavljaće revoluciju na smart city tržištu, a Smart CIty Technologies biće jedan od pionira razvoja Smart City 2.0 koncepta u regionu i šire.', NULL, NULL),
(4851, 29, 2172, 'Rasprostranjenost CCB predstavlja optimizaciju, pruža data set iste veličine sa celokupne površine grada uz mnogo manje uređaja. Kvalitet podataka je znatno poboljšan jer se parametri na istim lokacijama mere različitim uređajima. Kombinacija senzora i kamere omogućava prikupljanje relevantnih podataka o komunalnim problemima i najvažnijim parametrima kvaliteta uslova života. Arhitektura hardware-a daje kompaktan i moderan dizajn, koji je jednostavno prikačiti na vozila komunalnih službi, javnog prevoza, policije… Ova vozila tako postaju u mobilni data logeri. Specijalno trenirani AI registruje komunalne probleme koje treba ukloniti i u roku od nekoliko sekundi šalje podatke, a platforma automatski kreira radni nalog koji sadrži fotografiju, geo lokaciju i vreme i prosleđuje ga nadležnoj službi. Unikatna user friendly korisnička platforma obrađuje podatke o zagađenju vazduha, nivou buke i toplote i svetlosnom zagađenju i prikazuje ih u realnom vremenu kroz interaktivne heat mape.', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(4852, 32, 2172, 'Naše rešenje je jedinstveno po tome što po prvi put predstavlja mobilni uređaj za prikupljanje podataka o komunalnim problemima i situaciju vezanu za ključne parametre kvaliteta života u urbanim sredinama. Na ovaj način prikupljanje podataka nije ograničeno samo na fiksnu infrastrukturu na ključnim mestima, već je moguće prikupljati podatke sa cele površine grada.', NULL, NULL),
(4853, 37, 2172, 'Planiramo da zaštitimo dizajn hardvera i delova softvera, a paralelno s razvojem rešenja istražujemo rasličite mogućnosti u ovoj oblasti.', NULL, NULL),
(4854, 40, 2172, 'Kao inicijalni i osnovni izvor prihoda vidimo prodaju i instalaciju opreme, održavanje sistema i korisničku pretplatu (više paketa). Postoji ideja za više različitih izvora prihoda i širenje biznis modela, na čemu radimo i u čemu vidimo ključno polje za konsultacije sa mentorom sa programa poput Raising Starts.', NULL, NULL),
(4855, 41, 2172, 'Od ideje do danas, oformljen je tim koji radi na razvoju ideje već 6 meseci. Idea stage je završen, rešenje konceptualno razrađeno u potpunosti. Sada je spremno i nalazi se u fazi prototipiranja, za šta je potrebno dodatno finansiranje. Razvoj je uveliko u toku, posebno po pitanju software-a i AI rešenja, čiji prvi testovi su urađeni i dali pozitivne rezultate. U toku je nabavka komponenti za prototip hardware-a. Obavljeno je više razgovora sa relevantnim ljudima iz industrije i potencijalnim korisnicima. Povratna informacija je bez izuzetka bila pozitivna i verujemo da tržište iščekuje Cloud City. Iz ovih razgovora smo istovremeno dosta naučili i implementirali stečene uvide u dosadašnji razvoj ideje.', NULL, NULL),
(4856, 44, 2172, 'Cloud City nije učestvovao, ali imamo prethodnih iskustava iz internacionalnih akceleratora, poput EIT Climate-KIC (EU), EIT Urban Mobility (EU), Start AD Hardware Launchpad (NYU), Pioneers of Balkans (World Bank)', NULL, NULL),
(4857, 45, 2172, 'Ne, ali su do sada uložena sredstva iz privatnih fondova', NULL, NULL),
(4858, 48, 2172, 'Osnovna svrha naše aplikacije je mogućnost rada sa najboljim mentorima iz industrije koji imaju relevantno iskustvo sa B2B i B2G poslovnim modeliranjem.\r\n\r\nNakon 3 meseca programa, planiramo da funkcionalni prototip bude spreman za prezentaciju za pilot projekat.\r\n\r\nTakođe očekujemo da sa mentorima razvijemo jasan poslovni model i strategiju određivanja cena.', NULL, NULL),
(4859, 49, 2172, '30.000 EUR za zarvršetak funkcionalnog protpotipa.', NULL, NULL),
