(4864, 89, 2180, 'University of Cambridge\r\nAssociate\'s Degree, Business, Management, Marketing · (2009 - 2011)\r\n\r\nSerijski preduzetnik sa značajnim iskustvom u oblasti pametnih gradova i urbane mobilnosti.', NULL, NULL),
(4865, 90, 2180, 'Kreator ideje. U velikoj meri posvećen ovom projektu (80%) i direktor kompanije.', NULL, NULL),
(4866, 91, 2180, 'Serijski preduzetnik. Nema drugi full-time posao.', NULL, NULL),
(4867, 89, 2181, 'Višegodišnje iskustvo u radu sa startap kompanijama i preduzetnicima, kao i u sektoru razvoja i podrške inovaicionom ekosistemu.', NULL, NULL),
(4868, 90, 2181, 'U većoj meri posvećen. Zadužen za poslovni razvoj projekta i operativnu koordinaciju.', NULL, NULL),
(4869, 91, 2181, 'Više fleksibilnih angažmana, bez fiksnog radnog vremena.', NULL, NULL),
(4870, 89, 2182, 'Doktor elektrotehničkih nauka u oblasti elektronike, sa značajnim brojem projekata.', NULL, NULL),
(4871, 90, 2182, 'Predvodi razvoj hardware-a. Posvećen 50% ovom projektu.', NULL, NULL),
(4872, 91, 2182, 'Vanredni profesor na Katedri za elektroniku Elektrotehničkog fakulteta Univerziteta u Beogradu.', NULL, NULL),
(4873, 89, 2183, 'Serijski preduzetnik. Bivši profesor u Elektrotehničkoj školi „Nikola Tesla“ u Beogradu. Ekspert za Data Science i ML.', NULL, NULL),
(4874, 90, 2183, 'Predvodi razvoj AI rešenja za CCB. Posvećen 50% projektu. AI je već inicijalno testiran i dao dobre rezultate.', NULL, NULL),
(4875, 91, 2183, 'Serijski preduzetnik angažovan na svojim biznisima, bez fiksnog radnog vremena.', NULL, NULL),
(4876, 89, 2184, 'Računarski fakultet. Mladi inovator sa više uspešnih preduzetničkih poduhvata i oblasti hardware-a i software-a.', NULL, NULL),
(4877, 90, 2184, 'Predvodi razvoj CCB platforme i korisničkog interfejsa. Trenutno delimično posvećen.', NULL, NULL),
(4878, 91, 2184, 'Angažovan na više sopstvenih projekata.', NULL, NULL),
(4879, 71, 2186, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4880, 63, 2187, 'Naša aplikacija je orijentisana na ugostiteljstvo. Omogućava brži i lakši način nalaženja kako poslova, kada su radnici u pitanju, tako i radne snage kada su u pitanju ugostiteljski objekti. Platforma sadrži mogućnost kreiranja prethodnog radnog iskustva sa strane radnika koja mora biti potvrđena od navedenih objekata. Pri potvrdi stiče se mogućnost međusobnog ocenjivanja. Time smo omogućili uvid u kvalitet radnika, kao i kvalitet radnog okruženja u navedenom ugostiteljskom objektu. Ugostitelj ima mogućnost postavljanja oglasa u kojima navodi koje pozicije su mu potrebne. Na osnovu pristiglih prijava odlučuje ko ispunjava kriterijume za datu poziciju. U tome mu pomaže mogućnost pregleda istorije prethodnog radnog iskustva kandidata kao i njegovih ocena i komentara. Takođe, pri traženju posla, radnik ima mogućnost da vidi ocene i komentare ugostiteljskog objekta, koje su mu dodelili bivši ili trenutno zaposleni. U ocenjivanju može učestvovati i gost  koji ima mogućnost ocenjivanja kako ugostiteljskog objekta koji je posetio, tako i radnika koji ga je uslužio. Na osnovu svega navedenog, dobija se jedinstveni informacioni sistem koji omogućava jednostavnije nalaženje poslova u oblasti ugostiteljstva.', NULL, NULL),
(4881, 71, 2188, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4882, 17, 2189, 'Naša aplikacija je orijentisana na ugostiteljstvo. Omogućava brži i lakši način nalaženja kako poslova, kada su radnici u pitanju, tako i radne snage kada su u pitanju ugostiteljski objekti. Platforma sadrži mogućnost kreiranja prethodnog radnog iskustva sa strane radnika koja mora biti potvrđena od navedenih objekata. Pri potvrdi stiče se mogućnost međusobnog ocenjivanja. Time smo omogućili uvid u kvalitet radnika, kao i kvalitet radnog okruženja u navedenom ugostiteljskom objektu. Ugostitelj ima mogućnost postavljanja oglasa u kojima navodi koje pozicije su mu potrebne. Na osnovu pristiglih prijava odlučuje ko ispunjava kriterijume za datu poziciju. U tome mu pomaže mogućnost pregleda istorije prethodnog radnog iskustva kandidata kao i njegovih ocena i komentara. Takođe, pri traženju posla, radnik ima mogućnost da vidi ocene i komentare ugostiteljskog objekta, koje su mu dodelili bivši ili trenutno zaposleni. U ocenjivanju može učestvovati i gost  koji ima mogućnost ocenjivanja kako ugostiteljskog objekta koji je posetio, tako i radnika koji ga je uslužio. Na osnovu svega navedenog, dobija se jedinstveni informacioni sistem koji omogućava jednostavnije nalaženje poslova u oblasti ugostiteljstva.', NULL, NULL),
(4883, 22, 2189, 'Sarađivali smo samo na fakultetskim projektima.', NULL, NULL),
(4884, 23, 2189, 'Verujemo da naša ideja može da dovede do revolucije u svetu ugostiteljstva. Mentorski rad sa iskusnim ljudima koji su se susretali sa svim izazovima i poteškoćama koje nas očekuju je naš najveći motiv za prijavu. Očekujemo da uz stečeno znanje kroz mentorski rad našu platformu podignemo na još viši nivo kako u marketinškom pogledu tako i u pogledu funkcionalnosti.', NULL, NULL),
(4885, 24, 2189, 'Ugostitelj po tvojoj meri!', NULL, NULL),
(4886, 25, 2189, 'Razgovarajući sa pojedinim ugostiteljima o problematici zapošljavanja,  došli smo na ideju da razvijemo naš softver. Ovaj problem nije vezan samo za Srbiju, već je globalno rasprostranjen. Ovom aplikacijom rešavamo problem pronalaska kvalitetnog radnika sa strane ugostitelja, tako i kvalitetnog radnog okruženja sa strane radnika.', NULL, NULL),
(4887, 26, 2189, 'Ugostiteljstvo  je jaka privredna grana u Srbiji. Masovno se otvaraju novi ugostiteljski objekti i samim tim se povećava potražnja za radnom snagom. Pored toga, fluktuacija zaposlenih je velika zbog povećanog odlaska radne snage na privremeni rad u inostranstvo. Prva faza našeg razvoja odnosi se na teritoriju Republike Srbije. U drugoj fazi očekujemo ekspanziju na zemlje regiona (Crna Gora, Hrvatska, Slovenija, Bosna i Hercegovina). Treća faza predstavlja prisustvo platforme na globallnom nivou, krenuvši od zemalja Evropske unije pa sve do USA.', NULL, NULL),
(4888, 27, 2189, 'Našom platformom ćemo omogućiti ugostiteljima da brzo i jednostavno reše problem pronalaska kvalitetne radne snage. Takođe, radnicima nudimo mogućnost lakšeg nalaženja posla u objektima koji odgovaraju njihovim kriterijumima. Omogućili smo ugostiteljskom objektu uvid u kvalitet usluge zaposlenog kroz ocene gostiju.', NULL, NULL),
(4889, 28, 2189, 'Inovativni proizvod predstavllja dvosmerno ocenjivanje na relaciji:\r\n1) ugostiteljski objekat - radnik (bivši/trenuitni)\r\n2) radnik (bivši/trenuitni) - ugostiteljski objekat\r\n3) gost - radnik (trenutno zaposlen u objektu)\r\n4) gost - ugostiteljski objekat.\r\n\r\nKorišćene tehnologije: SpringBoot, Angular, MySQL, Minio, DigitalOcenCloud\r\nDvosmerna komunikacija predstavlja jedinstvenu funkcionalnost koju drugi nisu implementiarli na tržištu.', NULL, NULL),
(4890, 30, 2189, 'Trenutno se ovaj problem rešava pomoću društvenih mreža objavljivanjem fotografija koje predstavljaju oglas za posao. U ovom trenutku, u Srbiji postoji samo jedna Viber grupa koja ima preko 20000 članova i to je jedini način gde se na jednom mestu može naći oglas za posao u ugostiteljstvu ali bez ikakve komunikacije i uvida u kvalitet radnika/objekta.', NULL, NULL),
(4891, 29, 2189, 'Naša platforma predstavlja jedinstvenu društvenu mrežu koja okuplja ugostitelje širom sveta i pruža visok kvalitet informacija.', NULL, NULL),
(4892, 32, 2189, 'Kvalitetna i verifikovana radna biografija radnika kao i ucinak na radnom mestu koji se ogleda kroz njegove ocene i komentare kako od strane ugostiteljskih objekata tako i od strane gostiju koje je usluzivao. Takođe, radnik ima uvid u ocene i komentare, samim tim i u kvalitet, ugostiteljskog objekta na osnovu iskustava bivših ili trenutno zaposlenih.', NULL, NULL),
(4893, 37, 2189, 'Vlasnici intelektualne svojine bi bili nas trojica osnivača.', NULL, NULL),
(4894, 40, 2189, 'Mesečnim pretplatama ugostiteljskim objektima koje će biti dostupne na mesečnom, polugodišnjem i godišnjem nivou.', NULL, NULL),
(4895, 41, 2189, 'Do sada smo napravili MVP i u fazi smo testiranja funkcionalnosti aplikacije. Od inicijalne ideje je prošlo godinu dana, dok smo u procesu razvoja poslednjih osam meseci. U prethodnom periodu bavili smo se i istraživanjem tržišta. Kroz povratne informacije smo shvatili da je ova aplikacija preko potrebna tržištu ugostitellja i ima velik potencijal za funkcionalni razvoj.', NULL, NULL),
(4896, 44, 2189, 'Nismo učestvovali.', NULL, NULL),
(4897, 45, 2189, 'Nismo prikupili nikakav eksterni izvor finansiranja do sada. Finansiramo se iz ličnih sredstava.', NULL, NULL),
(4898, 48, 2189, 'Mentorstvo nam je najpotrebnije u oblasti prava i marketinga. S obzirom da koristimo veliki broj informacija potrebna nam je pomoć oko GDPR-a (General Data Protection Regulation).', NULL, NULL),
(4899, 49, 2189, 'U trenutnoj fazi nam je potrebno 12000-15000 CHF. Sredstva bi bila uložena za pravne usluge, plaćanje redizajna platforme kao i u marketing.', NULL, NULL),
