(4913, 71, 2202, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(4914, 71, 2203, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(4915, 63, 2208, 'Protokol.io je flex-code platforma za Razvoj, Integraciju, Automatizaciju i Distribuciju digitalnih alata i servisa namenjenim digitalnoj transformaciji malih i srednjih preduzeća i preduzetnika u skladu sa potrebama korisnika.', NULL, NULL),
(4916, 71, 2209, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4917, 17, 2210, 'Protokol.io je flex-code platforma za Razvoj, Integraciju, Automatizaciju i Distribuciju digitalnih alata i servisa namenjenim digitalnoj transformaciji malih i srednjih preduzeća i preduzetnika u skladu sa potrebama korisnika.', NULL, NULL),
(4918, 22, 2210, 'Sarađivali na ranijim projektima od 2014. godine, na protokol.io radimo od 2019. godine', NULL, NULL),
(4919, 23, 2210, 'Motiv za prijavu na ovaj konkurs je prvenstveno mogućnost da uz vašu pomoć steknemo nove veštine i znanja koja nam mogu omogućiti da svoj proizvod bolje plasiramo na tržište i prilagodimo targetiranoj demografiji potencijalnih klijenata, na šta bismo u slučaju osvajanja nagrade i utrošili sredstva.', NULL, NULL),
(4920, 24, 2210, 'protokol.io vam obezbeđuje najbolje alate za digitalnu transofrmaciju vašeg poslovanja,\r\nvodite svoj posao, nama prepustite tehnologiju.\r\n\r\nprotokol.io provides best tools for digital transformation according to your needs\r\nrun your business, we handle the tech', NULL, NULL),
(4921, 25, 2210, 'protokol.io je platforma za razvoj, upravljanje, integraciju i automatizaciju digitalnih alata i servisa kao i njihovu distribuciju u vidu WebApp, Desktop client ili PWA aplikacija po meri i potrebama klijenta.\r\nNaša platforma je bazirana na holističkoj flex-code filosofiji koja omogućuje klijentima da sve svoje potrebe u pogledu poslovnih alata mogu dobiti korišćenjem naše platforme na jednostavan način bez potrebe za visoko tehničkim znanjem (citizen developer).\r\nPrvenstveno ovakva platforma pokazuje se kao potreba na globalnom tržištu u jeku ere digitalizacije i digitalne transformacije poslovanja te nam je cilj da olakšamo tranziciju svim malim i srednjim subjektima na tržištu koji imaju problem za implementacijom digitalnih rešenja što u pogledu stručnosti i znanja, kao i u pogledu potrebnih resursa za održavanjem istih.', NULL, NULL),
(4922, 26, 2210, 'Naš proizvod je moguće plasirati na globalno tržište koje broji preko 200 miliona malih i srednjih preduzeća dok je vrednost tržišta  digitalne transformacije procenjena na 1.8 triliona $ u 2021. godine sa projekcijom rasta od 200% do 2025. godine (izvor: https://www.statista.com/statistics/1261592/global-smes/ , https://www.statista.com/statistics/870924/worldwide-digital-transformation-market-size/ )\r\nNaš cilj je 100 korisnika u prva dva kvartala 2022, kao i 1000 korisnika zaključno sa četvrtim kvartalom 2022, i 10 000 korisnika zaključno sa 2023. godinom.', NULL, NULL),
(4923, 27, 2210, 'Protokol.io je namenjen sektoru srednjih i malih preduzeća i preduzetnicima, koji su prinuđeni da koriste ili neadekvatne alate koji im ređavaju određene segmente posla a kojima takođe skuplja postojeća rešenja na tržištu ne odgovaraju što zbog kompleksnosti i nemogućnosti da se prilagode njihovim potrebama tako i po ceni.', NULL, NULL),
(4924, 28, 2210, 'protokol.io je flex-code platforma za razvoj digitalnih alata i servisa za sektor malih i srednjih preduzeća i preduzetnika, stvorena koristeći web bazirane tehnologije kao što su Mysql, Vue.js, Go lang, electron.js...', NULL, NULL),
(4925, 30, 2210, 'Trenutno potencijalni kupci našeg rešenja su prinuđeni koristiti više različitih alata različitih proizvođača (najrazličitiji office i pomoćni alati),  za svaki poseban segment radnog procesa tj. poslovanja ili pak koriste daleko kompleksnija rešenja koja pokrivaju širi spektar okolnosti u odnosu na ono što im je potrebno (SAP i druga ERP rešenja).', NULL, NULL),
(4926, 29, 2210, 'Mnoga postojeća rešenja pokušavaju segmentarno rešiti određene segmente poslovanja, dok Protokol.io nudi inovativan pristup kojim je omogućeno korisniku da kreira sve potrebne digitalne alate istovremeno integrišući postojeće i automatizujući njihovu međusobnu interakciju po meri i potrebi korisnika na način kako on to smatra, a uz pomoć flex-code principa (duboko customabilan low-code) kojim omogućujemo konitinuirani razvoj i unapređivanje kao i distribuciju putem WebApp, PWA ili Desktop aplikacija sve u okviru naše platforme.', NULL, NULL),
(4927, 32, 2210, 'Iako su i sami računari nastali kao alat za unapređenje poslovanja od ere IBM-a, način na koji isti unapređuju poslovanje se menja te smatramo da je naš pristup u pogledu inovativnosti taj da svaki naš korisnik iz sektora malih i srednjih preduzeća ili eventualno novog startapa, može na kvalitetan, brz i jednostavan način razviti, testirati, integrisati i automatizovati sve svoje procese kako interno tako i eksterno koristeći protokol.io kao jednu tačku upravljanja a putem holističke flex-code filosofije, povoljnije, efikasnije i jednostavnije od drugih proizvoda koji pokušavaju u određenoj meri rešiti slične probleme.', NULL, NULL),
(4928, 37, 2210, 'Vlasnik intelektualne svojine u smislu atorskog dela na softverskom kodu platforme je protokol cloud solutions doo Mladenovac čiji smo vlasnici i osnivači.\r\nIntelektualna svojine je zaštićena pred Zavodom za Intelektualnu svojinu Republike Srbije.', NULL, NULL),
(4929, 40, 2210, 'Poslovni model je zasnovan na mesečnoj i godišnjoj pretplati za korišćenje platforme zavisno od potreba korisnik kao i kompleksnosti njihovih potreba.', NULL, NULL),
(4930, 41, 2210, 'Naša platforma je već u fazi prodaje na tržištu, od novembra 2021. godine i imamo jednog kupca koji se pretplatio na duži period dok smo u pregovorima sa još zainteresovanih klijenata a u toku smo pregovora sa jednom od regionalnih banaka oko partnerstva.', NULL, NULL),
(4931, 44, 2210, 'Ne', NULL, NULL),
(4932, 45, 2210, 'ne, do sada se isključivo finansiramo iz sopstvenih sredstava.', NULL, NULL),
(4933, 48, 2210, 'Motiv za prijavu na ovaj konkurs je prvenstveno mogućnost da uz vašu pomoć steknemo nove veštine i znanja koja nam mogu omogućiti da svoj proizvod bolje plasiramo na tržište i prilagodimo targetiranoj demografiji potencijalnih klijenata, na šta bismo u slučaju osvajanja nagrade i utrošili sredstva.', NULL, NULL),
(4934, 49, 2210, 'iznos od oko 20 000 EUR bi nam pomogao u bržem razvoju predviđenih modula koje bi zaokružile našu ponudu i otvorile novi set funkcionalnosti, dok bi smo drugu polovinu sredstava utrošili na razvoj marketinga platforme i izlazak na regionalno ili određena inostrana tržišta.', NULL, NULL),
