(4946, 63, 2222, 'Inovacija pod nazivom \"Somnium\", sastoji se od 3 dela: mobilna aplikacija, narukvica i uređaj za emitovanje zvučnih frekvencija. Ovaj sistem ima za cilj emituvanje zvučnih frekvencija koje bi umirivale nervni sistem slušaoca i tako mu omogućile da lakše zaspi i ustane odmorniji.', NULL, NULL),
(4947, 71, 2223, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(4948, 17, 2224, 'Inovacija pod nazivom \"Somnium\", sastoji se od 3 dela: mobilna aplikacija, narukvica i uređaj za emitovanje zvučnih frekvencija. Ovaj sistem ima za cilj emituvanje zvučnih frekvencija koje bi umirivale nervni sistem slušaoca i tako mu omogućile da lakše zaspi i ustane odmorniji.', NULL, NULL),
(4949, 22, 2224, 'Većina članova je već sarađivalo na nekoliko projekata, uključujući \"Takmičenje za najbolju tehnološku inovaciju\" na kome smo u studentskoj kategoriji zauzeli 2. mesto, a u kategoriji realizovanih inovacija 18.', NULL, NULL),
(4950, 23, 2224, 'Dodatno znanje u vezi poslovanja, kao i novčana podrška koja bi nam dosta značila u razvoju naših ideja.', NULL, NULL),
(4951, 24, 2224, 'Inovacija je zauvek!', NULL, NULL),
(4952, 25, 2224, '„Somnium“ je sistem koji smiruje i opušta organizam pomoću zvučnih frekvencija, što dovodi do lakšeg uspavljivanja i kvalitetnijeg sna, samim tim i kvalitetnijeg života. S obzirom na to da san predstavlja jednu od osnovnih životnih potreba koja utiče na funkcionisanje ljudi, ovaj proizvod sa sobom nosi i niz drugih pogodnosti, kao što su povećanje produktivnosti, koncentracije, bolje raspoloženje, jači imunitet, lakše buđenje, osećaj odmora. Redovan raspored spavanja biće bolje održiv jer će korisnici moći lakše da utonu u san. Njegovim korišćenjem smanjuje se rizik od depresije, anksioznosti, poremećaja u dnevnim životnim rutinama', NULL, NULL),
(4953, 26, 2224, 'Naši ciljni kupci se nalaze na teritoriji Republike Srbije i starosti su od 25 do 35 godina. Osobe ove starosti obično imaju novorođenčadi ili decu mlađeg uzrasta koja zahtevaju veću brigu i posvećenost roditelja, što doprinosi stresu i neispavanosti. Frilenseri i preduzetnici imaju visoke zarade i mogu sebi priuštiti ovaj proizvod.  Pošto su u pitanju ambiciozni ljudi, zanima ih kako svoje vreme mogu iskoristiti produktivnije i zaraditi više novca.\r\n\r\nU naredne 2 godine planiramo proširiti tržište na zemlje Evropske unije.\r\n\r\nIzvori: https://www.danas.rs/vesti/ekonomija/apr-u-srbiji-400-646-privrednih-subjekata/\r\nhttps://data.stat.gov.rs/Home/Result/1104010102?languageCode=sr-Latn', NULL, NULL),
(4954, 27, 2224, 'Naši ciljni kupci u tekućoj godini su preduzetnici, studenti i frilenseri koji su pod stalnim stresom. Ukupan broj preduzetnika u Srbiji iznosi oko 250 hiljada, a frilensera i studenata između 200 i 250 hiljada. Zbog neizvesnosti posla kojim se bave i prevelikih obaveza često rade preko 8 sati dnevno, što dovodi do manje koncentracije i više grešaka. Frilenseri provode puno vremena gledajući u monitor računara koji zbog plavog svetla otežava uspavljivanje. Pored toga, imaju manjak fizičke aktivnosti. Često rade kasno zbog razlike u vremenskim zonama.', NULL, NULL),
(4955, 28, 2224, 'Sistem se sastoji od 3 komponente. Prva komponenta jeste mobilna aplikacija koja služi za podešavanje sistema  na osnovu prikupljenih podataka na cloud-u i obrađenih uz pomoć veštačke inteligencije, na taj način će svaki uređaj biti konfigurisan po potrebama korisnika. Druga komponenta jeste narukvica od biorazgradivog materijala koju će korisnik nositi tokom sna, a ima zadatak da meri biološke parametre i konfiguriše sistem. Treći deo je sam uređaj koji emituje muziku i zvučne frekvencije. Te frekvencije će biti tako podešene da umirujuće deluju na nervni sistem čoveka i tako ga opuštaju. To će rezultovati lakšim uspavljivanjem i boljim odmorom.', NULL, NULL),
(4956, 30, 2224, 'Istraživanjem smo saznali da postoje razni uređaji koji nude slična rešenja. Međutim, većina njih se fokusira samo na emitovanju opuštajuće muzike, za razliku od našeg sistema koji pored opuštajuće muzike emituje zvučne frekvencije koje direktno utiču na nervni sistem. Pored toga, postojeći uređaji funkcionišu samostalno. Naš sistem, za razliku od njih, podrazumeva integraciju više uređaja radi postizanja boljih rezultata i lakšeg rukovanja.', NULL, NULL),
(4957, 29, 2224, '„Somnium“ je sistem koji smiruje i opušta organizam pomoću zvučnih frekvencija, što dovodi do lakšeg uspavljivanja i kvalitetnijeg sna, samim tim i kvalitetnijeg života. S obzirom na to da san predstavlja jednu od osnovnih životnih potreba koja utiče na funkcionisanje ljudi, ovaj proizvod sa sobom nosi i niz drugih pogodnosti, kao što su povećanje produktivnosti, koncentracije, bolje raspoloženje, jači imunitet, lakše buđenje, osećaj odmora. Redovan raspored spavanja biće bolje održiv jer će korisnici moći lakše da utonu u san. Njegovim korišćenjem smanjuje se rizik od depresije, anksioznosti, poremećaja u dnevnim životnim rutinama. Osobama koje zbog propisanih terapija ne bi smele da konzumiraju lekove za spavanje, ovaj proizvod bi bio od značaja jer njegovim korišćenjem se ne poništava dejstvo terapije i ne može doći do neželjenih dejstava.', NULL, NULL),
(4958, 32, 2224, 'Na tržištu postoji veći broj firmi koje nude slično, ali ne i isto rešenje. One nude rešenja površinskog tipa, u smislu reprodukcije korisnički odabranog zvuka prirode ili žanra muzike. Naš prozivod se fokusira na korišćenje odgovarajućih zvučnih frekvencija, za koje je naučno dokazano da imaju delotvorne efekte na raspoloženje korisnika, odnosno imaju mnogo značajniji uticaj na nervni sistem i poboljšanje kognitivnih fukncija.', NULL, NULL),
(4959, 37, 2224, 'Planiramo zaštititi koncept rada i rezultate istraživanja zvučnih frekvencija, nakon detaljnog informisanja na tu temu.', NULL, NULL),
(4960, 40, 2224, 'Prihod planiramo da ostvarimo prodajom proizvoda.', NULL, NULL),
(4961, 41, 2224, 'Naš tim je učestvovao na takmičenju za najbolju tehnološku inovaciju i osvojio 2. mesto u kategoriji studentskih timova. Nakon toga smo dobili prostor u StartUp centru na Elektronskom fakultetu za nastavak razvoja naše ideje. Za to vreme smo krenuli sa istraživanjem koncepta i shvatili da su nam potrebne dodatne investicije da bismo stigli do realizacije. Pošto je problem spavanja, široko rasprosranjen zbog ubrzanog načina života, dosta ljudi se zainteresovalo za našu ideju.', NULL, NULL),
(4962, 44, 2224, 'Učestvovali na takmičenju za najbolju tehnološku inovaciju 2021. godine u kategoriji studenata i kategoriji realizovanih ideja.', NULL, NULL),
(4963, 45, 2224, 'Dobijena novčana nagrada od 155.400 RSD neto,\r\n\r\nNapomena: na ovom takmičenju smo učestvovali pod nazivom Focus', NULL, NULL),
(4964, 48, 2224, 'Od programa očekujemo dodatnu edukaciju o razvoju poslovanja i novčanu podršku za razvoj proizvoda. Najpotrebnija nam je novčana pomoć koja će se iskoristiti za istraživanje uticaja frekvencija na čovekov nervni sistem.', NULL, NULL),
(4965, 49, 2224, 'Biće nam potrebno oko 10.000 eura od čega će najveći deo biti izdvojen za istraživanja uticaja zvučnih frekvencija na nervni sistem.', NULL, NULL),
