(4999, 63, 2251, 'Virtuelni Vodič je mobilna i Web aplikacija čija je glavna funkcionalnost kao što i samo ime kaže virtuelno vođenje turista kroz unapred kreirane turističke rute. Imaćete digitalnog, tj virtuelnog vodiča u svom džepu. Mobilna aplikacija će sadržati listu ruta nekog grada i kada se neka od ruta pokrene aplikacija otvara mapu tog dela Srbije na kojoj će biti ucrtana ruta sa tačkama tj lokacijama koje treba obići. Korisnik će videti svoju trenutnu lokaciju na toj mapi kao i najbliži put do početka turističke rute. Kada se korisnik približi početku ali i svakoj karakterističnoj tački koju treba obići, aplikacja će korišćenjem APIja za geolokaciju automatski pokrenuti audio snimak i tekst koji će se pojaviti i dati detaljan opis tog lokaliteta. Nakon odslušanog opisa korisniku će se ponovo na telefonu pojaviti mapa i ruta i on će moći da nastavi svoj obilazak. Pored ove glavne funkcionalnosti aplikacija može imati i niz drugih funkcionalnosti (zabavnog karaktera kao što je treasure hunt - učesnici trebaju da pronađu neki lokalitet i dobijaju odredjene poene ali će služiti i kao platforma za marketing i reklamiranje ostalih preduzetnika sa lokala u vidu listi restorana u blizini, taksi službi, apartmana, hotela i slično) ali o tome ćemo više pričati nadam se uživo. Takođe jedan od ciljeva nam je da u saradnji sa lokalnim zajednicama na što više lokaliteta postavimo QR kodove koji bi vodili do sajta na kome bi turisti besplatno mogli da se informišu o tom lokalitetu. Opisi lokaliteta i rute bi bile napisane i snimljene na srpskom, engleskom i nemačkom jeziku.', NULL, NULL),
(5000, 71, 2252, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5001, 17, 2253, 'Virtuelni Vodič je mobilna i Web aplikacija čija je glavna funkcionalnost kao što i samo ime kaže virtuelno vođenje turista kroz unapred kreirane turističke rute. Imaćete digitalnog, tj virtuelnog vodiča u svom džepu. Mobilna aplikacija će sadržati listu ruta nekog grada i kada se neka od ruta pokrene aplikacija otvara mapu tog dela Srbije na kojoj će biti ucrtana ruta sa tačkama tj lokacijama koje treba obići. Korisnik će videti svoju trenutnu lokaciju na toj mapi kao i najbliži put do početka turističke rute. Kada se korisnik približi početku ali i svakoj karakterističnoj tački koju treba obići, aplikacja će korišćenjem APIja za geolokaciju automatski pokrenuti audio snimak i tekst koji će se pojaviti i dati detaljan opis tog lokaliteta. Nakon odslušanog opisa korisniku će se ponovo na telefonu pojaviti mapa i ruta i on će moći da nastavi svoj obilazak. Pored ove glavne funkcionalnosti aplikacija može imati i niz drugih funkcionalnosti (zabavnog karaktera kao što je treasure hunt - učesnici trebaju da pronađu neki lokalitet i dobijaju odredjene poene ali će služiti i kao platforma za marketing i reklamiranje ostalih preduzetnika sa lokala u vidu listi restorana u blizini, taksi službi, apartmana, hotela i slično) ali o tome ćemo više pričati nadam se uživo. Takođe jedan od ciljeva nam je da u saradnji sa lokalnim zajednicama na što više lokaliteta postavimo QR kodove koji bi vodili do sajta na kome bi turisti besplatno mogli da se informišu o tom lokalitetu. Opisi lokaliteta i rute bi bile napisane i snimljene na srpskom, engleskom i nemačkom jeziku.', NULL, NULL),
(5002, 22, 2253, 'Od nas četvoro kao što možete videti u priloženom video materijalu nas troje smo članovi studentske organizacije BEST Niš u kojoj smo prošli kroz veliki broj različitih obuka počevši od marketinga, HRa, vodjenja projekata pa sve do dizajniranja i programiranja. Učestvovali smo u organizovanju brojnih događaja od kojih ću napomenuti samo par kao što su sajam stručnih praksi JobFair, inženjersko takmičenje EBEC, letnji akademski kurs BEST Week i mnoge drudge. Petar nije član besta ali smo on i ja (Uroš) kroz gotovo celu osnovnu i sredju školu radili veliki broj školskih projekata zajedno. Niko od nas do sada nije razvijao ni jednu StartUp ideju.', NULL, NULL),
(5003, 23, 2253, 'Ja sam već više meseci pratio, planirao i razrađivao ideju pokretanja Start Upa ali me je prilično brinuo i kočio administrativni deo StartUpa odnosno pravni propisi vezani za pokretanje i poslovanje istog i kada sam video da je to sastavni deo ovog projekta tj da će postojati ozbiljna obuka i mentorska podrška iz te oblasti odmah sam popričao sa par prijatelja od kojih je većina sada u timu i svi smo se složili da je ovo prilika koju ne treba propustiti. Ovaj StartUp bi svakako nastao ali je program uticao na to da on sa nastajanjem može i terba da krene upravo sada.', NULL, NULL),
(5004, 24, 2253, 'Virtuelni vodič, za turistu novog doba!', NULL, NULL),
(5005, 25, 2253, 'Petar i ja se bavimo iznajmljivanjem smeštaja i gotovo uvek nam se ponavlja ista situacija. Kada turisti, naročito oni koji prvi put dolaze u Sokobanju dođu kod nas, uvek imaju ista pitanja. Šta mi možemo da posetimo i vidimo? Kako do tamo da se dođe? Da li imate neku preporuku za neku kafanu ili prodavnicu? \r\n\r\nPostoji google ili mogu da nadju sve podatke na sajtu turističke organizacije Sokobanje ali uvek radije pitaju nas da im mi to kažemo. Možda se ne snalaze dobro sa traženjem, možda nama sa lokala više veruju u tačnost informacija, možda se plaše da će nešto propustiti da nađu ili im je tako jednostavno lakše ali činjenica je da iz našeg ličnog iskustva turisti gotovo uvek postave ta tri pitanja.  Takođe i ja kada sam išao na odmor imao sam identična pitanja i probleme, šta obići, kako i gde. Turisti bi na aplikaciji imali pouzdane i detaljne informacije, lokalni preduzetnici bi imali platformu za promociju a ja ne bih morao jednu istu rečenicu da ponavljam svakom novom gostu.', NULL, NULL),
(5006, 26, 2253, 'Primarni korisnici naše aplikacije bi bili turisti koji prvi put dolaze u Sokobanju i znaju da koriste pametne telefone. Po podacima do kojih sam ja došao, Sokobanju je ove godine posetilo oko 27 000 turista a Niš oko 10 000. Ako pođemo od pretpostavke da naša aplikacija postoji u ta dva grada i da barem 30% njih ima telefon ili se nalazi u grupi u kojoj barem jedna osoba poseduje pametni telefon sa aplikacijom to je potencijalno oko 12 000 ljudi koji bi bili u posrednom ili neposrednom kontaktu sa aplikacijom i samim tim naši korisnici. Sekundari korisnici bi bili brojni lokalni preduzetnici: kafane, taksi službe, apartmani, hoteli koji bi mogli da se reklamiraju na našoj aplikaciji. Ideja je da se prvo krene od Niša i Sokobanje jer su to naši gradovi u kojima živimo i o kojima imamo najviše znanja i kontakata a kasnije se može proširiti i na celu Srbiju, a i šire.', NULL, NULL),
(5007, 27, 2253, 'Postoje dve ciljne velike grupe koje se kasnije mogu deliti. Prva su turisti koji žele da obiđu sve zanimljive lokalitete i da na kvalitetan način dobiju zanimljive podatke o njima kao i lokalni preduzetnici kojima je cilj da promovišu svoj proizvod istim tim turistima. Kao što sam o ovome već pisao u pitanju o tome koji se problem rešava sada ću ukratko da ponovim. Ja sam do ideje za ovu aplikaciju došao kroz lično iskustvo rada sa turistima kojima sam više puta objašnjavao šta trebaju da posete u Sokobanji i kako je najbolje da tamo stignu.\r\n\r\nIako postoji google ili mogu da nadju sve podatke na sajtu turističke organizacije Sokobanje oni uvek radije pitaju nas. Možda se ne snalaze dobro sa traženjem, možda nama sa lokala više veruju u tačnost informacija, možda se plaše da će nešto propustiti da nađu ili im je tako jednostavno lakše ali činjenica je da iz našeg ličnog iskustva turisti gotovo uvek pitaju nas, ljude od kojih iznajmljuju smeštaj.', NULL, NULL),
(5008, 28, 2253, 'Ja bih našu aplikaciju svrstao u oblasti pametnih gradova i pametnog turizma jer omogućava turistima da korišćenjem svog telefona dođu do podataka i informacija koje ih zanimaju. Planirana tehnologija za izradu ove aplikacije su Progresivne Web aplikacije (PWA) jer omogućavaju da se jadan isti kod koristi na više uređaja. Poseduju odličnu podršku od strane Microsofta i Googla jer rade sa njihovim browserima i zato su idealne za Web i Android aplikacije. Imaju malo slabiju podršku na iOSu jer Apple forsira svoje proizvode ali milsim da ove sve funkcije koje su nama potrebne rade i na iOSu a ako i ne rade naći ćemo već neko rešenje.', NULL, NULL),
(5009, 30, 2253, 'Najčešće pitaju nas sa lokala da ih uputimo. Najbolje rešenje je da se koristi Google, pre svega Google Maps, međutim u praksi se pokazalo da turistima mnogo više odgovara da neko umesto njih istraži i da im onda ispriča već sažete podatke jer se boje da će nešto propustiti ili im je tako lakše, ili nemaju vremena. A kada i koriste Google Maps obično koriste da bi našli jedno ili dva konkretna lokaliteta koje već žele da posete a vrlo retko za istraživanje.', NULL, NULL),
(5010, 29, 2253, 'Imaće svog digitalnog vodiča u džepu koji će ih voditi u obilazak a te obilaske ćemo mi da kreiramo, da istražimo sve detalje i napravimo najoptimalnije rute za što je moguće bolje iskustvo svih turista. Takođe ako veliki broj ljudi koristi aplikaciju biće to idealno mesto za lokalne preduzetnike da reklamiraju svoje proizvode i usluge.', NULL, NULL),
(5011, 32, 2253, 'Ne postoji ni jedna aplikacija u Srbiji koja će vam predložiti rute i lokacije koje možete obići i onda vas voditi do svake od njih usput vam pričajući priču i istoriju tih lokaliteta. Najbliža aplikacija koja postoji je Google Maps ali ona samo daje ogromnu količinu podataka, lokacije koje nisu adekvatno grupisane, bez direktnih opisa za koje već morate da napustite aplikaciju i odete na Google Chrome, bez lokalnog znanja koje ljudi sa lokala poseduju, i jednostavno prepuštaju turiste da se sami snalaze. Oni koji to umeju i žele će se verovatno i snaći a za sve ostale tu je virtuelni vodič koji će im dati predloge svih ruta i onda ih voditi do ali i kroz njih. Google i Google Maps daju suve podatke, mi ih grupišemo, daodajemo iskustvo sa lokala, kreiramo priču i prilagođavamo korisniku.', NULL, NULL),
(5012, 37, 2253, '/', NULL, NULL),
(5013, 40, 2253, 'Postoji nekoliko modela koje smo razmatrali ali onaj za koji verujemo da je najbolji i da najviše odgovara sadašnjem stanju digitalnog tržišta je da kreiramo što više audio i video materijala, što više ruta, lokacija i da ih lepo sistematizujemo i prikažemo u aplikaciji ali i na društvenim mrežama i da tako napravimo najbolji mogući doživljaj i iskustvo za turiste i da privučemo što je veći broj turista moguće da koristi našu aplikaciju.\r\n\r\nNovac bi dobijali od oglašavanja preduzetnika sa lokala koji bi reklamirali svoje apartmane, hotele, kafane, taksi službe i slično a sve u zavisnosti od vidljivosti u našoj aplikaciji. Na godišnjem ili mesečnom nivou. \r\n\r\nJa lično na sajtu na kome oglašavam svoje apartmane godišnje plaćam 5 000 dinara dok je za top 10 mesta na toj listi cena od 10 000 do 15 000 dinara. Na sajtu za oglašavanje Booking koji uzima procenat od izdavanja na mesečnom nivou u toku 4 meseca najveće sezone imamo plaćanja od 40 do 60 eura mesečno', NULL, NULL),
(5014, 41, 2253, 'Za sada smo samo kroz razgovor sa turistima ispitali njihove probleme i potrebe, dobili potvrdu da žele da isprobaju aplikaciju i da bi im ona dosta koristila i dobili potvrdu od par vlasnika apartmana da ukoliko bi mogli da im pokažemo da smo privukli turiste da koriste aplikaciju da bi oni želeli da se reklamiraju na njoj.', NULL, NULL),
(5015, 44, 2253, 'Ne', NULL, NULL),
(5016, 45, 2253, 'ne', NULL, NULL),
(5017, 48, 2253, 'Najviše bi nam značila pravna i ekonomska pomoć i podrška oko osnivanja startupa, vođenja finansija, plaćanja poreza, kreiranje ugovora sa radnicima i drugim pravnim licima i slično. Druga stvar koja bi nam značila je finansijska pomoć oko nabavke opreme za snimanje i kreiranje  audio i video sadržaja.', NULL, NULL),
(5018, 49, 2253, 'Za tehničke stvari: nabavka opreme za snimanje (2 mikrofona, kamera, fotoaparat i dron sa kamerom), plaćanje hostinga i slično oko 3000 CHF\r\nObilazak lokacija na kojima će se praviti rute radi prikupljanja podataka (smeštaj, prevoz hrana) 100-200 CHF po lokaciji za 10 lokacija (ne računajući Sokobanju i Niš) bi ispalo 1000-2000 CHF\r\nNovčana kompenzaciju za uložen trud i rad na projektu naročito članovima tima koji nemaju udela u vlasništvu firme. Postoji mogućnost privremenog uključivanja jednog dodatnog programera. Za ove svrhe bih odvojio oko 2000-3000 CHF', NULL, NULL),
(5019, 52, 2253, 'uros.zivkovic96@gmail.com', NULL, NULL),
