(5038, 71, 2268, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(5039, 63, 2269, 'Okarina predstavlja bezglutenski hleb koji je formulisan tako da njegov sastav ispunjava sve uslove ljudi koji imaju posebne potrebe u ishrani. Ne sadrži gluten, ne sarži šećer, ne sadrži laktozu, bogat je dijetnim vlaknima i sadrži visok sadržaj potreina. Sve to ga čini pogodnim za konzumaciju ljudi koji imaju celijakiju, insulinsku rezistenciju, dijabetes ili intoleranciju na laktozu, kao I ljudi koji žele da se hrane zdravije.\r\n\r\nOno što je, takođe, karakteristično za ovaj proizvod je to što koristi nusproizvode iz industrije soje prilikom postupka dobijanja sojinog mleka. Ovaj nusproizvod povećava i sam kvalitet sastava proizvoda kakvog na tržištu nema i koji se ne može postići korišćenjem samo bezglutenskog brašna. Pored toga korišćenjem nusproizvoda podstiče se i ekološka svest kao i podržavanje cirkularne ekonomije i smanjenje proizvodnje otpada iz prehrambene industrije.', NULL, NULL),
(5040, 71, 2270, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5041, 17, 2271, 'Okarina predstavlja bezglutenski hleb koji je formulisan tako da njegov sastav ispunjava sve uslove ljudi koji imaju posebne potrebe u ishrani. Ne sadrži gluten, ne sarži šećer, ne sadrži laktozu, bogat je dijetnim vlaknima i sadrži visok sadržaj potreina. Sve to ga čini pogodnim za konzumaciju ljudi koji imaju celijakiju, insulinsku rezistenciju, dijabetes ili intoleranciju na laktozu, kao I ljudi koji žele da se hrane zdravije.\r\n\r\nOno što je, takođe, karakteristično za ovaj proizvod je to što koristi nusproizvode iz industrije soje prilikom postupka dobijanja sojinog mleka. Ovaj nusproizvod povećava i sam kvalitet sastava proizvoda kakvog na tržištu nema i koji se ne može postići korišćenjem samo bezglutenskog brašna. Pored toga korišćenjem nusproizvoda podstiče se i ekološka svest kao i podržavanje cirkularne ekonomije i smanjenje proizvodnje otpada iz prehrambene industrije.', NULL, NULL),
(5042, 22, 2271, 'Kao tim sarađivali smo zajedno na takmičenju Ekotrofelija 2021. godine.', NULL, NULL),
(5043, 23, 2271, 'Najviše nas je motivisalo to što imamo tim i proizvod koji bismo voleli da zaživi, kao I želju da se ljudima koji imaju specifične potrebe u ishrani ili ljudima koji jednostavno žele da se hrane zdravije obezbede proizvodi u kojima mogu da uživaju, a ujedno imajući pozitivne efekte na njihovo zdravlje. Verujemo da Rasing Starts može da nam pomogne da ostvarimo naš cilj.', NULL, NULL),
(5044, 24, 2271, 'Stari ukus za novo doba', NULL, NULL);
INSERT INTO `text_values` (`id`, `attribute_id`, `instance_id`, `value`, `created_at`, `updated_at`) VALUES
(5045, 25, 2271, 'Našim proizvodom tržištu nudimo hleb jedinstvenog sastava, koji zadovoljava potrebe ljudi sa specifičnim potrebama u ishrani. Verzije zdravijih hlebova postoje, ali svi na trenutnom tržištu Srbije ne ispunjavaju sve uslove koji su ciljnoj grupi potrebni. Sadrže komponente koje bi ciljna grupa trebalo da izbegne kao što su gluten, šećere i/ili laktozu. Sa druge strane su siromašni komponentama koje su ciljnoj grupi potrebne kao što su proteini i vlakna.\r\n\r\nPored toga ovaj proizvod rešava i problem otpada koji nastaje dobijanjem sojinog mleka i time doprinosi očuvanju životne sredine. \r\n\r\nGlobalno interesovanje za zdravijom ishranom i implemetacija cirkularnih ekonomijaj u cilju zaštite životne sredine je u porastu. Prehrambena industrija se sve više okreće zdravijoj verziji proizvoda upravo zbog velike potrebe tržišta.', NULL, NULL),
(5046, 26, 2271, '1. Total Available Market- Prema Republičkom zavodu za statistiku Srbije, procenjen broj stanovnika u Republici Srbiji u 2019. godini je 6.945.235 stanovnika, od čega 85,7%  aktivno konzumira hleb, što daje broj od 5.952.066 stanovnika; 2. Serviceable Available Market-Segment tržišta koji će biti obuhvaćen direktnom uslugom bazira se na teritoriji Beograda gde živi 1.166.800  stanovnika, od čega 999.948 konzumira hleb; 3. Service Obtainable Market- 49,7% stanovnika Beograda je zaposleno od čega 50% ima platu bar 47.682RSD. Primenom navedenih procenata na ranije naveden broj stanovnika Beograda i procenta korisnika koji su u anketi iskazali spremnost na konzumaciju hleba Okarina (77,2%), dobijamo 223.841 stanovnika. Realno tržište hleba Okarina na godišnjem nivou iznosi 74.074 vekni hleba/godina redukcija tržišta nastala je kao posledica ograničenog kapaciteta proizvodnje SME. Uključujući prodajnu cenu proizvoda od 150 RSD, vrednost tržišta iznosi 11.111.100 RSD.', NULL, NULL),
(5047, 27, 2271, 'Primarna ciljna grupa – Korisnik koji pripada prvom segmentu ciljne grupe se posmatra nezavisno od pola, mesečnih primanja i uzrasta. On/Ona imaju neku od navedenih dijagnoza:  alergija na gluten, dijabetes, celijakija, insulinska rezistencija. Zbog svog zdravstvenog stanja, ovaj korisnik ne može da konzumira nijedan hleb koji se trenutno nudi na tržištu, zato očekujemo najveću responzivnost kod njega. Sekundarna ciljna grupa - Korisnik koji pripada drugom segmentu ciljne grupe ima između 26 i 58 godina, zaposlen je i ima mesečna primanja u minimalnom iznosu od 47.682 RSD. Konzumira hleb uz najmanje jedan obrok dnevno, a hleb nabavlja dva ili više puta nedeljno. Pokazao je izvestan nivo svesti o globalnoj ekološkoj krizi i speman je da svoje svakodnevne navike usmeri ka poboljšanju iste. Iskazuje želju da investira u poboljšanje kvaliteta svoje svakodnevne ishrane I smatra da se u manjoj ili većoj meri bavi svojom ishranom, prati dijete ili specijalne forme ishrane.', NULL, NULL),
(5048, 28, 2271, 'Naš proizvod je Okarina bezglutenski hleb. Jedinstvene formulacije bez šećera, bogat dijetnim vlaknima, izvor proteina i namenjen ljudima koji imaju specifične potrebe u ishrani, kao što su insulinska rezistencija, dijabetes, celijakija, intoleracija na gluten i intoleracija na laktozu.', NULL, NULL),
(5049, 30, 2271, 'Potencijalni kupci kupuju hleb koji nije adekvatnog sastava, sami prave hleb kod kuće ili izbegavaju hleb.', NULL, NULL),
(5050, 29, 2271, 'Okarina hleb je proizvod sa bogatim nutritivnim sastavom, izvor proteina, bogat vlaknima, bez glutena i bez šećera, omogućava ljudima adekvatnu ishranu za njihovo zdravstveno stanje.', NULL, NULL),
(5051, 32, 2271, 'Naš proizvod je značajno poboljšan zato što na trenutnom tržištu ne postoji hleb ovakvog sastava, nijedan hleb ne sadrži nusproizvode soje i ne ispunjava sve navedene uslove:  bogat vlaknima, izvor proteina, bez šećera, bez glutena i bez laktoze.', NULL, NULL),
(5052, 37, 2271, 'Nismo, ali ukoliko postoji osnov za patentiranje, vlasnici patenta bi bili članovi tima koji su učestvovali u razvoju proizvoda.', NULL, NULL),
(5053, 40, 2271, 'Na osnovu detaljne analize:\r\n\r\nProdajna cena hleba „Okarina“ je pocenjena na iznos od 150 dinara po pakovanju. Predviđeno je da se u prvoj godini poslovanja proizvede 37.037 komada pakovanog proizvoda, imajući u vidu da će se hleb plasirati pre svega na teritoriji Beograda i prisutne konkurencije na tržištu. Ovaj broj čini 16% tržišnog udela procenjenog na osnovu SOM-a. U drugoj godini sa pozicioniranjem proizvoda na tržištu, predvideli smo proizvodnju 57.715 komada pakovanog proizvoda što predstavlja 25% procenjenog tržišnog udela, dok bi se u trećoj godini taj broj popeo na 74.047 komada pakovanog proizvoda što bi pokrilo oko 33% potencijalnog Beogradskog tržišta i predstvaljalo maximalno dozvoljenu proizvodnju hleba na godišnjem nivou za SME prema Pravilniku.', NULL, NULL),
(5054, 41, 2271, 'Početna postava studenata koji su trebali da rade na projektu se izmenila od prijave na takmičenje do samog takmičenja kakva je sad. Neke devojke su kasnije došle u tim ali su mu bile posvećene kao da su tu od starta I na spontani način sklopila se sjajna ekipa za rad, a i za druženje. Na takmičenju Ekotrofelija smo dobile posebnu nagradu za veštine prezentovanja od firme Desing i poziv da nastavimo da saradjujemo sa NTP-om. Na radionici Park up smo skupile nova znanja, poznanstva i lepe uspomene. Kada smo dobili mejl  i za ovaj program, jednoglasno smo odlučile da se prijavimo.', NULL, NULL),
(5055, 44, 2271, 'Učestvovali smo na takmičenju Ekotrofelija i bili na radionici ParkUp 2021. godine.', NULL, NULL),
(5056, 45, 2271, 'Osvojili smo novčanu nagradu od kompanije Desing u iznosu od 1000e.', NULL, NULL),
(5057, 48, 2271, 'Potrebna nam je novčana podrška, dorada kanala komunikaciuje sa potrošačima i pomoć da adekvatno izađemo na tržište.', NULL, NULL),
(5058, 49, 2271, 'Za pokretanje biznisa proizvodnje hleba „Okarina“ potrebno je uložiti oko 1.256.262 dinara u procesnu opremu.', NULL, NULL),
