(5083, 63, 2292, 'UV sterilizator vazduha sa fiokom za sterilizaciju predmeta.', NULL, NULL),
(5084, 71, 2293, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5085, 17, 2294, 'UV sterilizator vazduha sa fiokom za sterilizaciju predmeta.', NULL, NULL),
(5086, 22, 2294, 'Do sada smo kao tim radili na raznim prototipima ovog istog projekta.', NULL, NULL),
(5087, 23, 2294, 'Da se prijavimo na ovaj program, motivisala nas je mogućnost napretka i poboljšanja našeg projekta.', NULL, NULL),
(5088, 24, 2294, 'Gde vazduh postaje čist.', NULL, NULL),
(5089, 25, 2294, 'Pokušavamo da rešimo problem virusa i bakterija u zatvorenim prostorima i na predmetima manjih površina.', NULL, NULL),
(5090, 26, 2294, 'Naše ciljano tržište jesu frizerski saloni za početak, a planiramo i da unapredimo proizvod da se koristi u medicinske svrhe. Na sajtu statista.com, videli smo da veličina tržišta da raste najviše zbog pandemije korona virusa. Vidimo veliki prostor za širenje našeg biznisa po Balkanu(Grčka, Bugarska, BiH, Hrvatska, Crna Gora, Slovenija). Posle toga planiramo da se proširimo na Evropsku uniju.', NULL, NULL),
(5091, 27, 2294, 'Naša persona je uplašena od potencijalnih zaraza. Nervira je stalno prskanje telefona (ili bilo kog drugog predmeta) alkoholom. Vlasnik/ca salona lepote /frizerskog salona. U bliskom kontaktu sa kupcima, pa joj je potreban sterilizator vazduha. Kod kuće je čekaju mala deca, pa s tim još više brine o higijeni. Intervju smo sproveli sa dve persone koje su bile oduševljene idejom. Zaključili smo da je potrebno još rada, ali da smo na dobrom putu.', NULL, NULL),
(5092, 28, 2294, 'Razvijamo sterilizator vazduha i predmeta. UV lampa koja se nalazi unutar kutije ubija sve mikroorganizme. Dobili smo ideju da unutar sterilizatora vazduha, ugradimo fioku u koju mogu stati predmeti koji se koriste svakodnevno, osim novca i papira. Naš proizvod je jedinstven zato što je lako prenosiv i može biti uključen dok su osobe u prostoriji (dok kod dosta proizvoda to nije slučaj).', NULL, NULL),
(5093, 30, 2294, 'Potencijalni kupci trenutno koriste alkohol za dezinfekciju predmeta, ali to ima veliku manu - upropašćavanje kože na rukama. Takođe neki potencijalni kupci znaku za taj problem, ali ne znaju kako da ga reše.', NULL, NULL),
(5094, 29, 2294, 'Prenosiv, ne troši puno struje, ubija sve mikroorganizme.', NULL, NULL),
(5095, 32, 2294, 'Naš proizvod je značajno poboljšan jer ni jedan od sterilizatora vazduha ne poseduje fioku za sterilizaciju predmeta.', NULL, NULL),
(5096, 37, 2294, 'Nismo', NULL, NULL),
(5097, 40, 2294, 'Naš startap planira da zarađuje od prodaje proizvoda, održavanja, iznajmljivanja i partnerstva sa drugim kompanijama.', NULL, NULL),
(5098, 41, 2294, 'Naš tim radi zajedno već osam meseci. Razvili smo tri prototipa. Prvi je bio neuspešan, sa velikom koncentracijom ozona. Drugi smo savršeno naštelovali da pravi srazmernu koncentraciju ozona koja prečišćava vazduh. Prototip koji trenutno razvijamo, pravi razliku u vremenskom prečišćavanju koje će biti bolje i detaljnije nego kod prethodnog prototipa.', NULL, NULL),
(5099, 44, 2294, 'Nismo', NULL, NULL),
(5100, 45, 2294, 'Nismo', NULL, NULL),
(5101, 48, 2294, 'Od učešća očekujemo da prođemo u dalje faze programa. Smatramo da nam je podrška najpotrebnija kod samog pravljenja fizičkog proizvoda.', NULL, NULL),
(5102, 49, 2294, 'Trenutno nam je potrebno oko 10 000e, za poboljšanje samog proizvoda, testiranja i hardverske komponente koje će nam biti potrebne za izradu novih kutija.', NULL, NULL),
(5103, 52, 2294, NULL, NULL, NULL),
(5104, 66, 2297, NULL, NULL, NULL),
(5105, 76, 2298, NULL, NULL, NULL),
(5106, 83, 2300, NULL, NULL, NULL),
(5107, 71, 2301, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(5108, 89, 2302, 'Radio sam za Delhta Holding 8 meseci gde sam imao prilike da učestvujem u stvaranju e-commerce platforme Ananas. Bio sam član prodajnog tima ali sam takođe učestvovao i u operacijama drugih timova. Trenutno radim u Delhaize Srbija gde učestvujem na stvaranju novog Loylty programa za kompaniju. Direktno sam uključen u rad više stremova (marketing, IT, prodaja, pravna služba). \r\n Završio sam srednju školu Rabun Gap u SAD, a nakon toga Davidson College gde sam bio član košarkaškog tima. Tokom svoje košarkaške karijere igrao sam za U16,U18 reprezentacije Srbije sa kojom sam tada osvojio treće mesto u Evropi. Nakon studija dobio sam priliku da radim za NBA tim Charlotte Hornets. Moje vreme provedeno u Hornets-ima sam proveo pomažući trenerima u pripremi treninga i utakmica. Radio sam sa skautima u analiziranju igrača za predstojeći draft. Takođe, imao sam priliku da radim individualno sa igračima.', NULL, NULL),
(5109, 90, 2302, 'U većoj meri posvećen i planira da da otkaz u Delhaize i u potpunosti se posveti projektu čim bude dovoljno finansijskih sredstava. Dušan je kreator ideje i sa Dejanom radi na razvoju i unapređenju proizvoda.', NULL, NULL),
(5110, 91, 2302, '-	Trenutno radim puno radno vreme za kompaniju Delhaize Srbija na poziciji Loyalty Expert. Pored toga završavam i master studije na kojim mi je ostalo dva ispita na Fakultetu tehničkih nauka u Novom Sadu, smer projektni menadžment.', NULL, NULL),
(5111, 89, 2303, 'Radim kao docent na Fakultetu tehničkih nauka u Novom Sadu, na Departmanu za proizvodno mašinstvo. Diplomirao sam 2005. na istom fakultetu, zatim odbranio magistarsku tezu 2013, a doktorsku disertaciju 2017. Od 2011. do 2018. radim kao asistent, a nakon odbrane doktorata 2018. dobijam zvanje docenta. Osnivač sam Laboratorije za aditivnu i virtuelnu proizvodnju, a trenutno sam na funkciji šefa Laboratorije za tehnologije plastičnog deformisanja. Objavio sam 100+ naučnih radova i bio uključen u četiri međunarodna, četiri nacionalna i tri bilateralna projekta. Svoje znanje iz konstruisanja i poznavanja tehnologija 3D štampe iskoristio sam za izradu low-budget proteza ruke za decu. Takođe u uskoj saradnji sa Kliničkim centrom Vojvodine i Stomatološkim fakultetom u Beogradu radio sam na izradi implanata za rekonstrukciju koštanih tkiva.', NULL, NULL),
(5112, 90, 2303, 'U većoj meri posvećen i u potpunosti će se posveti projektu čim bude dovoljno finansijskih sredstava', NULL, NULL),
(5113, 91, 2303, 'Radim puno radno vreme kao docent na Fakultetu tehničkih nauka u Novom Sadu', NULL, NULL),
(5114, 89, 2304, 'Završio sam finansije u SAD 2011. godine. Trenutno sam zaposlen kao investicioni savetnik za preduzetnike u Istočnoj Evropi. Imam iskustva sa startapom kroz rad u Linguado, koji je mobilna aplikacija koja omogućava globalno povezivanje osoba radi učenje jezika, imerzije, saveta za putovanja i kulturne razmene. Linguado timu sam se pridružio u prvoj fazi testiranja sa ciljem da vodim finansije i ubrzo preuzeo da vodim rast platforme zbog razumevanja u analitiku i optimizaciju gde smo za 18 meseci stigli od 650 do 150,000+ korisnika. Ovaj rezultat smo ostvarili na način da smo prvo zaposlili osobu sa iskustvom plasiranja reklama na Facebooku, nakon toga kroz AB testiranje smo promenili strategiju reklama. Istovremeno, iskoristio sam priliku kada je Instagram pokrenuo Reels, gde su reklame bile jeftinije a efikasnije', NULL, NULL),
(5115, 90, 2304, 'U većoj meri posvećen, i nastaviće da radi na projektu pola radnog vremena.', NULL, NULL),
(5116, 91, 2304, 'Radim puno radno vreme za Citi banku na poziciji investicionog savetnika.', NULL, NULL),
(5117, 63, 2308, 'LEPO JE REVOLUCIJONARNI SISTEM ZA TOTALNO AUTOMATSKO CISCENJE NEBODERA I VISOKIH ZGRADA. ELEGANTAN SISTEM KOJI OMOGUCAVA PRIKAZIVANJE KOMERCIJALNIH MATERIJALA TOKOM CISCENJA UZ VISOKU EFIKASNOST PRANJA I SAKUPLJANJA OTPADNE VODE.', NULL, NULL),
(5118, 71, 2309, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5119, 17, 2310, 'LEPO JE REVOLUCIJONARNI SISTEM ZA TOTALNO AUTOMATSKO CISCENJE NEBODERA I VISOKIH ZGRADA. ELEGANTAN SISTEM KOJI OMOGUCAVA PRIKAZIVANJE KOMERCIJALNIH MATERIJALA TOKOM CISCENJA UZ VISOKU EFIKASNOST PRANJA I SAKUPLJANJA OTPADNE VODE.', NULL, NULL),
(5120, 22, 2310, 'Osim za Lepo system nismo saradjivali ranije. Osnivaci su brat i sestra.', NULL, NULL),
(5121, 23, 2310, 'Mentorska i finansijska podrska koju nudi Raising Starts', NULL, NULL),
(5122, 24, 2310, 'LEPO for the better view on the world', NULL, NULL),
(5123, 25, 2310, 'Resavamo probleme koji nastaju sadasnjim metodama ciscenja nebodera:\r\n1. Sigurnost ljudi koji se bave ovim ekstremno rizicnim poslom\r\n2. Disperziju vode\r\n3. Zagadjenje vazduha\r\n4. Ustedu novca i vremena', NULL, NULL),
(5124, 26, 2310, 'Najvise smo se fokusirali na Americko i Azijsko Trziste.\r\nNaše tržište uključuje nove zgrade.\r\nOdlučili smo da se trenutno fokusiramo na nove zgrade, jer kupci već imaju ugovore sa konkurentima koji obavljaju tradicionalnu metodu čišćenja zgrada.\r\nLEPO sistem će tako biti integrisan i postati sastavni deo svake nove izgradnje.\r\nKoliko je veliko trziste moze te videti na sledecem izvoru: https://skyscraperpage.com', NULL, NULL),
(5125, 27, 2310, 'Nasi potencijalni klijenti su: \r\nVlasnici hotela, restorana, tržnih centara, industrijskih zgrada, srednje visokih zgrada, kompanija za razvoj nekretnina itd.\r\nZa cetri godine rada prvih tri godine smo posvetili, pored ostalog, i prezentaciji naseg projekta potencijalnim klijentima u Dubaju, Abu Dabiju, New Yorku, Chicagu, Hong Kongu, kao i u Evropskim gradovima. Pozitivan feedback od strane razanih kompanija koje se bave konstrukcijom ciljanih objekata nas je ohrabrio da idemo dalje i da napravimo projekat koji ce zadovoljiti potrebe klijenata. Takodje smo sproveli anketu medju ljude koji se bave ovim poslom, i na anase odusevljenje 100% posto radnika je reklo da bi volelo da vidi masinu kakao jednoga dana \"radi\" ovaj posao (anketu smo sproveli u Italiji).', NULL, NULL),
(5126, 28, 2310, 'Lepo system je robot koji bez vidljivih \"pomagala\" cisti efikasno spoljasnju fasadu nebodera, koristeci toplu vodu. Sadrzi pumpu za preciscavanje prljave vode. Takodje na spoljasnjem delu robota postoji displey koji sluzi za pustanje komercijalnog materijala. Elegantan, moze da pere nocu i takodje lak za programiranje uz pomoc aplikacija na tabletu.', NULL, NULL),
(5127, 30, 2310, 'Trenutno nebodere peru ljudi, ili masine koje ne koriste najnovije tehnologije, pa postoji disperzija vode i deterdzenata. Pored mnogo vremena koje je potrebno da se jedna povrsina nebodera opere, problem je i u visokim cenama za jendo pranje.', NULL, NULL),
(5128, 29, 2310, '1. Sigurnost\r\n2. Inovacija u ciscenju\r\n3. Ustedu vremena i novca\r\n4. Nema fise disperzije vode i zagadjenost vazduha\r\n5. Zaradu zahvaljujuci komercijalnim reklamama', NULL, NULL),
