(5181, 89, 2335, 'Product-minded Senior Machine Learning Engineer / Software Engineer with 6+ years of experience. Adept in\r\nmanaging and leading multi-cultural teams, product/project design and management, architecture and building\r\ncloud and AI applications for different industries, applying classical and deep learning algorithms, managing\r\nend-to-end ML pipelines (MLOps) with solid fundamentals in software engineering and best practices. Interested in\r\ndeep learning, computer vision, reinforcement learning, MLOps, ML model compilers and deployment on low-power\r\nedge devices.\r\n\r\n- Master Informaticar, Matematicki fakultet, Univerzitet u Beogradu', NULL, NULL),
