(5184, 89, 2336, 'Vladimir Mujagic is a senior software engineer with 6+ years of experience in the design and implementation of various computer systems, interested and working with cloud, artificial intelligence (DL), embedded, and open-source technologies. Currently working on optimized deployment of SoTa computer vision algorithms on deep edge, focusing on NVIDIA Jetson, RaspberryPI and i.MX devices, also interested in developing end-to-end deep learning pipelines (training, compression, quantization, export, deployment, evaluation, testing).\r\n\r\n- Diplomirani informaticar, Matematicki fakultet, Univerzitet u Beogradu', NULL, NULL),
(5185, 90, 2336, '- Co-Founder startupa, zaduzen za businees razvoj\r\n- Kreator ideje, u vecoj meri posvecen', NULL, NULL),
(5186, 91, 2336, 'full-time', NULL, NULL),
(5187, 63, 2339, 'Naša inovacija odnosi se na volonterski servis koji se sastoji iz nekoliko različitih timova - tim za kreativno pisanje, HR tim, tim za održavanje društvenih mreža, tim za organizaciju događaja i tim za IT i administraciju. Edukacijom volontera u oblastima koje su aktuelne u današnje vreme, pripremamo ih za ulazak na tržište rada. U skladu sa svojim potrebama, kompanije nas kontaktiraju kako bismo pronašli adekvatno pripemljenog volontera za raspisanu poziciju. Inovacija je finansijski održiva, jer nam kompanije plaćaju za HR uslugu, a održivost sa aspekta ljudskih resursa ogleda se u tome što kada se volonteri zaposle u nekoj kompaniji nakon volontiranja u Youth Hub-u, na njihovo mesto dolaze novi volonteri koji će prolaziti kroz isti proces edukacije i volonterskog rada.\r\n\r\n,,Videti nešto što je svako od nas već video, ali pomisliti ono što do sada niko nije pomislio.\'\' - Albert Sent Đerđ, o otkrićima', NULL, NULL),
(5188, 71, 2340, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5189, 17, 2341, 'Naša inovacija odnosi se na volonterski servis koji se sastoji iz nekoliko različitih timova - tim za kreativno pisanje, HR tim, tim za održavanje društvenih mreža, tim za organizaciju događaja i tim za IT i administraciju. Edukacijom volontera u oblastima koje su aktuelne u današnje vreme, pripremamo ih za ulazak na tržište rada. U skladu sa svojim potrebama, kompanije nas kontaktiraju kako bismo pronašli adekvatno pripemljenog volontera za raspisanu poziciju. Inovacija je finansijski održiva, jer nam kompanije plaćaju za HR uslugu, a održivost sa aspekta ljudskih resursa ogleda se u tome što kada se volonteri zaposle u nekoj kompaniji nakon volontiranja u Youth Hub-u, na njihovo mesto dolaze novi volonteri koji će prolaziti kroz isti proces edukacije i volonterskog rada.\r\n\r\n,,Videti nešto što je svako od nas već video, ali pomisliti ono što do sada niko nije pomislio.\'\' - Albert Sent Đerđ, o otkrićima', NULL, NULL),
(5190, 22, 2341, 'U prethodnom periodu, sarađivali smo na realizaciji nekoliko projekata, na kojima je svaki od članova tima imao drugačija zaduženja. Sa pojedinim članovima sarađivala sam i kao deo nekih drugih organizacija, tako da se vrlo dobro poznajemo. Trenutno svi članovi rade na istom projektu. \r\nKao tim, imali smo prilike da rešavamo teške i komplikovane situacije, pružamo podršku jedni drugima tokom planiranja i realizacije događaja. Dobar tim je pola posla.', NULL, NULL),
(5191, 23, 2341, 'Motivisalo nas je to što je Raising Starts prvi pre-seed program u Srbiji, koji nam može pomoći da razvijemo svoju inovativnu ideju. Mogućnost da dobijemo mentorsku i svaku drugu podršku od velikog je značaja za dalji razvoj naše organizacije. Pored toga, činjenica da ovaj program realizuje Naučno-tehnološki park Beograd u saradnji sa Naučno-tehnološkim parkom Čačak i Naučno-tehnološkim parkom Niš, a uz podršku Vlade Švajcarske, doprinosi većoj motivaciji celokupnog tima. \r\nTakođe, javlja se mogućnost da se usavršimo kao tim i pojedinci, uz doprinos omladinskom sektoru širom države. Želimo da pravimo okruženje u kom će se mladi osećati sigurno da slobodno prave prve korake ka ličnom razvoju i građenju sopstvenih karijera. \r\nKao tim mladih ljudi koji su relativno skoro napravili prve korake ka karijeri kojoj težimo, znamo koliko je teško pronaći prvi posao, praksu i steći inicijalno radno iskustvo. Nekad smo imali utisak da nismo dovoljno dobri, da nemamo dovoljno znanja, da su svi bolji od nas, nismo znali gde da tražimo same oglase.', NULL, NULL),
(5192, 24, 2341, '“practice to practice”', NULL, NULL),
(5193, 25, 2341, 'U toku realizacije CONNECTING događaja razgovarali smo sa predstavnicima kompanija koje se bave IT-jem i digitalnim marketingom. Od njih smo dobili povratne informacije da im je jako teško da nađu zaposlene, jer nisu edukovani u skladu sa potrebama njihovih kompanija.\r\nIz Nacionalne službe za zapošljavanje smo dobili informaciju da oni sprovode programe neformalnog obrazovanja za nezaposlena lica, naročito za oblasti IT-a i digitalnog marketinga, a odogovor predstavnika kompanija na to je bio da takve vrste obuka nisu prilagođene potrebama kompanija, odnosno tržišta i da kad su se kreirali takvi programi njih niko nije pitao da učestvuju u kreiranju programa edukacije za nezaposlena lica.\r\nProblem je vrlo težak, jer zahteva međusektorsku saradnju tri potpuno različita sektora: javnog, privatnog i neprofitnog.', NULL, NULL),
(5194, 26, 2341, 'Ciljna grupa su mladi uzrasta od 18 do 30 godina. Ova ciljna grupa je uzeta, jer se mladima nazivaju osobe uzrasta od 15 do 30 godina (prema Zakonu o mladima), a da bi mladi bili angažovani od strane kompanije, moraju biti punoletni. \r\nZemlje širenja tržišta u naredne 2 godine su sledeće zemlje: Hrvatska, Bosna i Hercegovina, Crna Gora, Slovenija, Albanija, Severna Makedonija, Grčka, Bugarska, Rumunija.\r\nNa teritoriji Srbije postoji 400646 aktivnih privrednih subjekata (https://www.srbija.gov.rs/vest/511527/porast-registrovanih-privrednih-subjekata-u-2020-godini.php), a na sajtu Infostuda postoji 1695 kompanija koje traže zaposlene (https://poslovi.infostud.com/).', NULL, NULL),
(5195, 27, 2341, 'Javnom sektoru doprinosimo kroz smanjenje nezaposlenosti, a privatnom sektoru obezbeđujemo stručni kadar u skladu sa potrebama tržišta i kompanija. \r\nKada je reč o neprofitnom sektoru, volonterima obezbeđujemo pripremu za radnu praksu i/ili zaposlenje u kompanijama koje su u potrazi za kadrovima. Pored ova tri sektora, problem rešavamo i mladima, jer ih na ovaj način motivišemo da se više angažuju na polju rešavanja problema vezanog za stručno osposobljavanje i/ili zaposlenje. \r\nUtičemo na zadržavanje mladih u državi i sprečavanje ‘’odliva mozgova’’. Glavne karakteristike mladih su manjak znanja, iskustva, samopouzdanja, motivacije, proaktivnosti, nedostatak podrške od strane zajednice u kojoj žive. \r\nUkoliko posmatramo javni sektor, možemo reći da on ne može dovoljno brzo da se prilagodi promenama na tržištu rada, jer utiče na celokupnu privredu. \r\nKod privatnog sektora, naš fokus je na start up-ima, jer mladi mogu lakše da se povežu sa misijom i vizijom dok je kompanija u začetku.', NULL, NULL),
(5196, 28, 2341, 'S obzirom da mi nismo IT startap, ne koristimo neku od digitalnih tehnologija. Mi predstavljamo inkubator ideja mladih. Uz podršku mentora i Youth Hub zajednice, mladi imaju priliku da svakodnevno rade na sebi i usavršavanju, dobijaju feedback o tome šta rade dobro i šta mogu da poboljšaju, smernice i savete u kom pravcu mogu da se razvijaju kako bi dosegli svoje željene karijere. \r\nS druge strane, kompanije imaju veliku bazu mladih i motivisanih ljudi kojima mogu da pristupe, kontaktiraju ih i ponude posao. Pored toga, Youth Hub tim može da im pomogne u pronalasku idealnog kandidata putem velike mreže volontera.', NULL, NULL),
(5197, 30, 2341, 'Kompanije danas zapošljavaju ljude kroz proces selekcije i regrutacije, koji može biti manje ili više zahtevniji u zavisnosti od složenosti i odgovornosti koje nosi određena radna pozicija. Celokupan proces pronalaska odgovarajućeg kandidata, prolazi kroz nekoliko faza. Svaka kompanija ima proces selekcije koji je svojstven samo njima i prilagođen njihovom sistemu rada. Proces selekcije najčešće obuhvata sledeće aktivnosti: prikupljanje i skeniranje radnih biografija ili online prijava, telefonski intervjui, online intervjui, video intrevjui, interju 1-na-1, panel intervju, kaskadni intervju, testiranje  (testovi znanja, psihološki testovi, manuelni testovi, test vožnje) i centar procene (obuhvata simulacije najčešćih radnih situacija, odnosno grupne i individualne vežbe) . Celokupan proces selekcije najčešče traje jedan do dva meseca.', NULL, NULL),
(5198, 29, 2341, 'Benefiti koje pružamo korisnicima su sledeći:\r\n- mladi uspostavljaju kontakte sa kompanijama, kako bi se zaposlili ili dobili praksu;\r\n- kompanije dobijaju osnažene, motivisane i spremne mlade ljude koji su spremni za ulazak u poslovni svet;\r\n- smanjuje se broj nezaposlenih mladih, što povoljno utiče na ekonomiju države;\r\n- mladi stiču više samopouzdanja, kako bi bili spremni za uspostavljanje kvalitetnih međuljudskih odnosa\r\n- mladi, kroz volonterski angažman u Youth Hub-u, stiču nove poznanike i prijatelje koji im mogu pomoći u ličnom i profesionalnom razvoju.', NULL, NULL),
(5199, 32, 2341, 'Naša usluga je značajno poboljšana, jer predstavlja volonterski servis koji je održiv i finansijski i sa aspekta ljudskih resursa. Finansijski je održiv, jer nam kompanije plaćaju za HR uslugu, a održivost sa aspekta ljudskih resursa ogleda se u tome što kada se volonteri zaposle u nekoj kompaniji nakon volontiranja u Youth Hub-u, na njihovo mesto dolaze novi volonteri koji će prolaziti kroz isti proces edukacije i volonterskog rada.', NULL, NULL),
(5200, 37, 2341, NULL, NULL, NULL),
(5201, 40, 2341, 'Startap planira da zarađuje od pružanja HR usluga kompanijama.', NULL, NULL),
(5202, 41, 2341, 'Ideja o uspostavljanju startapa javila se pre 6 meseci, kada smo razmišljali na koji način da animiramo mlade da se više angažuju kada je reč o volontiranju. Situacija sa koronavirusom navela nas je na razmišljanje na koji način možemo pomoći mladima da se pokrenu i preduzmu inicijativu, ali nas je takođe navela kako da pomognemo javnom i privrednom sektoru u ovako izazovnoj situaciji. Konkretne korake preduzeli smo u novembru mesecu kada smo raspisali poziv za priključivanje našoj volonterskoj bazi. Već u decembru ove godine održali smo prvi sastanak volonterskih timova i ubrzo imali po nekoliko volontera angažovanih na tri događaja u Novom Sadu. Kao povratnu informaciju, dobili smo predlog za saradnju od paneliste na jednom od događaja u smislu želje za angažovanjem nekog od naših volontera na poziciji praktikanta u oblasti copywritinga. Rezultat toga je da jedan od volontera u januaru sledeće godine počinje da radi praksu u kompaniji koja se bavi digitalnim marketingom.', NULL, NULL),
(5203, 44, 2341, 'Aleksandra Jovanović je učestvovala učestvovala u OPENS-ovom mentorskom programu (Omladinska prestonica Evrope Novi Sad) u oblasti pisanja projekata za međunarodne i domaće fondove kao menti, od septembra do decembra 2021. godine.', NULL, NULL),
(5204, 45, 2341, 'Nismo do sada prikupili bilo koji izvor finansiranja.', NULL, NULL),
(5205, 48, 2341, 'Očekujemo najpre mentorsku podršku, a zatim i finasijsku podršku. Podrška nam je potrebna u procesu edukacije volontera', NULL, NULL),
(5206, 49, 2341, 'Želimo da volonterimo obezbedimo što kvalitetnije kurseve, obuke, radionice i sl.', NULL, NULL),
