(5254, 17, 2373, 'Mobilna aplikacija za vođenje statistike na košarkaškim utakmicama.', NULL, NULL),
(5255, 22, 2373, 'Miloš Nišić i Mihailo Ljubinac rade zajedno u novosadskoj firmi Xcentric IT.', NULL, NULL),
(5256, 23, 2373, 'Motivaciju za prijavu za ovaj Program smo pronašli u učenju i napretku — kako same aplikacije, tako i nas kao učesnika u kreiranju iste. \r\nTo bismo pre svega dobili kroz mentorstvo koje se nudi, a takođe i kroz finansijsku podršku uz koju bi sve bilo mnogo lakše.', NULL, NULL),
(5257, 24, 2373, 'Trenutno nemamo slogan.', NULL, NULL),
(5258, 25, 2373, 'Problem koji aplikacija rešava je vođenje statistike na košarkaškim utakmicama na kojima organizator ne nudi tu mogućnost (rekreativne lige, niži rangovi takmičenja, takmičenja za mlađe kategorije i sl). Problem je globalan, odnosno postoji na svim mestima gde se igra košarka. \r\nZa problem smo saznali, između ostalog, igrajući zajedno rekreativnu košarkašku ligu u Novom Sadu. Tamo se statistika beleži na svakom meču (oko 30 mečeva za vikend) pomoću papira i olovke. Kasnije se vrši prebrojavanje i beleženje u excel tabele, a nakon toga deli na društvene mreže.\r\nTakođe, Mihailo Ljubinac kao trener mlađih kategorija nema pristup statistici svoje ekipe nakon odigrane utakmice.', NULL, NULL),
(5259, 26, 2373, 'Ciljano tržišta su košarkaški klubovi, košarkaške lige, kao i svi ljudi koji prate košarkaške utakmice svojih rođaka, prijatelja i sl.\r\nAplikacija bi u startu bila namenja za srpsko, englesko, rusko, špansko govorno područje. Širenje bi se nastavilo ka azijskom tržištu gde je košarka u ekspanziji.\r\n\r\nŠto se tiče samih podataka, samo na teritoriji Vojvodine postoji 5 liga koje organizuje Košarkaški savez Srbije na kojima se ne beleži statitstika sa utakmica. U tih 5 liga igra 43 tima. \r\nTakođe, u Novom Sadu postoje bar 2 rekreativne lige, gde se samo u jednoj takmiči preko 50 ekipa.\r\nPored toga, samo na teritoriji Novog Sada postoji veliki broj takmičenja za mlađe kategorije, u kojima nastupa veliki broj timova.', NULL, NULL),
(5260, 27, 2373, 'Kao što je navedeno u ciljnom tržištu, problem se rešava košarkaškim klubovima, ligama i ljudima koji prate košarku.\r\nSa istima je ostvarena komunikacija i predstavljena im je ideja. U pitanju su vlasnici rekreativne košarkaške lige, upravnici nekoliko košarkaških klubova, kao i ljudi koji prate košarku. Dobijena informacije su pozitivne i to je jedan od razloga za nastavak rada na aplikaciji, kao i prijavi za ovaj Program.', NULL, NULL),
(5261, 28, 2373, 'Ova aplikacija služi za vođenje statistike na košarkaškim utakmicama. Glavne karakteristike aplikacije su jednostavno korišćenje, evidencija o odigranim susretima i brzo deljenje statistike sa utakmica.\r\nOno na čemu je bio akcenat i šta čini ovu aplikaciju drugačijom od sličnih je jednostavan korisnički interfejs i jednostavnost prilikom korišćenja, kao i to što je aplikacija rađena za mobilne telefone i za njeno korišćenje nije potreban računar.\r\nAplikacija se trenutno razvija za Android uređaje u programskom jeziku Java. Pored toga, za skladištenje podataka i autentifikaciju korisnika koristi se Firebase platforma.', NULL, NULL),
(5262, 30, 2373, 'Potencijalni kupci navedeni problem rešavaju beleženjem statistike na papiru, ili ga ne rešavaju. Takođe, postoje aplikacije koje koriste profesionalni klubovi i lige, koje nisu dostupne klubovima, ligama i ljudima niže platežne moći. Takođe, takve aplikacije su uglavnom aplikacije za računare, a ne za mobilne uređaje.', NULL, NULL),
(5263, 29, 2373, 'Benefiti za sve mogu biti u ušteđenom vremenu i novcu — ukoliko se koriste papir i olovka za beleženje statistike — pri čemu su uglavnom potrebna 2 čoveka da bi se taj posao obavio  (koja su vrlo verovatno i plaćena, ako se radi o komercijalnim takmičenjima ). Takođe, jedan od benefita je i taj što se na jednostavan način statistika može deliti među ljudima, saigračima, trenerima, klubovima…', NULL, NULL),
(5264, 32, 2373, 'Kao što je rečeno, fokus je bio na dizajnu i jednostavnosti korišćenja, što se razlikuje od već postojećih sličnih aplikacija. Takođe, postoji razlika i u broju funkcionalnosti.', NULL, NULL),
(5265, 37, 2373, 'Trenutno nismo zaštitili ništa. U planu je upoznavanje sa tim delom.', NULL, NULL),
(5266, 40, 2373, 'Prodajom reklama, prodajom dodatnih funkcionalnosti aplikacije, pretplatom (za takmičenja i klubove)', NULL, NULL),
(5267, 41, 2373, 'Ideja za aplikaciju je potekla u martu 2020. godine. Igrajući rekreativnu košarkašku ligu dugo smo čekali da se objave rezultati sa utakmica, kao i statistika igrača sa svake od njih. U želji da popunimo cv nekim projektom, pred traženje poslova startovali smo sa radom na aplikaciji, a ideja je bila ta kako da ubrzamo proces dobijanja rezultata i statistike sa utakmica. Od tada je napravljena full verzija, koja je zatim skalirana na lite verziju koja bi bila dostupna na google play store-u, za početak besplatno. U međuvremenu, aplikacija je testirana na utakmicama uživo i sada se nalazi u završnoj fazi izrade. Pokrenuta je instagram stranica za promociju aplikacije i planiraju se dalji koraci u toj oblasti.', NULL, NULL),
(5268, 44, 2373, 'Nismo.', NULL, NULL),
(5269, 45, 2373, 'Nismo.', NULL, NULL),
(5270, 48, 2373, 'Očekujemo da dođemo do novih saznanja i pomoći pre svega u refaktorisanju koda, plasiranju proizvoda, kao i u dobijanju informacija o daljem razvoju i naplati.', NULL, NULL),
(5271, 49, 2373, 'Finansijska sredstva bi bila potrebna za promociju, pokretanju preduzeća, patentiranje proizvoda, za plaćene alatke koje bi se koristile u procesu proizvodnje (za dizajn, promociju, testiranje).', NULL, NULL),
