(5296, 63, 2394, 'Naše idejno rešenje inovacije predstavlja žardinjera sa integrisanim delom za boravak napuštenih životinja. Ova vrsta urbanog mobilijara bi omogućila i mesto za sedenje (odmor), mesto za zelenilo, dok bi najvažnija namena proizvoda bila sklonište za pse i mačke lutalice. Proizvod bi bio izrađen od ekoloških materijala dostupnih na području na kojem bi bio postavljen kako bi se na najbolji način uklopio uz postojeće okruženje i klimu.  Zemlja ispod i iznad žardinjere bi imala funkciju prirodnog toplotnog izolatora prostora u kojem bi boravile životinje.', NULL, NULL),
(5297, 71, 2395, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5298, 17, 2396, 'Naše idejno rešenje inovacije predstavlja žardinjera sa integrisanim delom za boravak napuštenih životinja. Ova vrsta urbanog mobilijara bi omogućila i mesto za sedenje (odmor), mesto za zelenilo, dok bi najvažnija namena proizvoda bila sklonište za pse i mačke lutalice. Proizvod bi bio izrađen od ekoloških materijala dostupnih na području na kojem bi bio postavljen kako bi se na najbolji način uklopio uz postojeće okruženje i klimu.  Zemlja ispod i iznad žardinjere bi imala funkciju prirodnog toplotnog izolatora prostora u kojem bi boravile životinje.', NULL, NULL),
(5299, 22, 2396, 'Sarađujemo kao tim od samog početka studija. Kroz period studiranja smo ostvarili izuzetdno dobre rezultate, a u poslednjih godinu dana mogli bismo da istaknemo 1. mesto na 30. Međunarodnom Salonu Urbanizma kao i osvojena 1. nagrada na Hakatonu, u okviru projekta \"Budući gradovi jugoistočne Evrope\".', NULL, NULL),
(5300, 23, 2396, 'Smatramo da kroz ovaj program možemo dobiti veliku podršku i znanje kako bismo svojim idejama dopreli do što veće populacije i unapredili životni prostor.', NULL, NULL),
(5301, 24, 2396, 'Obey your pubic', NULL, NULL),
(5302, 25, 2396, 'Uvideli smo značajan problem sa psima koji su ostavljeni sami sebi na milost i nemilost. Nisu u azilima i nisu vlasnički psi, žive na javnim prostorima i zimi im je potrebno sklonište. Mi pokusavamo da im omogućimo bezbedno okruženje i da ih zastitimo od hladnoce i smrzavanja. Smatramo da problem postoji na globalnom nivou i da bismo na ovaj način grupisali životinje na prostorima predviđenim isključivo za njih. U toku hladnijeg perioda godine životinje traže utočište u ulazima stambenih zgrada, ulaze u tržne centre, obrazovne ustanove i ostale javne objekte i na taj način mogu povrediti ljude, pre svega decu. Sa ovim problemom suočavamo se u svakodnevnom životu.', NULL, NULL),
(5303, 26, 2396, 'Istocna evropa, evropske organizacije koje pomazu zivotinjama (four paws) itd', NULL, NULL),
(5304, 27, 2396, 'Kupci – ekološki orijentisani koji imaju razvijenu empatiju I vole životinje. \r\nGeografska segmentacija tržišta – prema klimi, zemlje koje imaju hladne zime\r\nregion –istočna evropa (The World Health Organization estimates there are 200 million stray dogs worldwide and many of them are living in Eastern Europe.)\r\nzemlje koje imaju najrazvijeniju svest o ekologiji, među zemljama istočne evrope\r\n\r\nDemografska segmentacija – \r\nStarost – od 25 do 65 god\r\nPrihodi – ljudi koji raspolazu nekim vecim budžetima I donose odluke.\r\n\r\nPsihografska segmentacija –Ličnost – razvijena empatija\r\nMotivi – briga o životinjama, stvaranje lepšeg okruženja za sve, poboljšanje I unapređivanje\r\nŽivotni stilovi – obrazovanje (vise obrazovane osobe), angažovani u nekim od neprofitnih organizacija, udruženja, fondacija, koja se bave pravima I zaštitom životinja.', NULL, NULL),
(5305, 28, 2396, 'U ovom trenutku razvijamo žardinjeru sa integrisanim skloništem za životinje i klupom. U planu nam je razvijanje smart proizvoda i usluga iz oblasti arhitekture i ekologije u cilju očuvanja i unapređenja životne sredine. Proizvod koji trenutno razvijamo vršio bi tri funkcije (žardinjera, klupa i sklonište za životinje).', NULL, NULL),
(5306, 30, 2396, 'Trenutno nikako ne rešavaju problem', NULL, NULL),
(5307, 29, 2396, 'spašavavamo živote pasa, najveći nivo sreće koji možemo doprineti ljudima\r\nSklonili bismo životinje iz ulaza stambenih zgrada i javnih objekata (obrazovne ustanove, tržni centri itd)\r\nProizvod koji trenutno razvijamo vršio bi tri funkcije (žardinjera, klupa i sklonište za životinje) i na taj način bismo našim kupcima bismo smanjili troškove (umesto tri proizvoda kupuju jedan)', NULL, NULL),
