(5315, 49, 2396, 'Za proizvodnju jedne žardinjere potrebno nam je okvirno 1000 evra. \r\nU ovu cenu protoripa spada potreban materijal noseće konstukcije kao i izrada i oblikovanje sirovine. \r\nPotrebna količina čeličnih profila 50x50mm za izradu podkonstiukcije je oko 21m.\r\nPotrebna količina čeličnog lima debljine 2mm je oko 145kg.\r\nCena izrade prototipa nije precizno definisana.\r\nZavršna faza zažtite od atmosferskih uticaja je tehnikom plastifikacije. \r\nU ovu cenu nisu uračunati troškovi distribucije i promeocije.', NULL, NULL),
