(5350, 24, 2423, 'ODRŽIVA POLJOPRIVREDA', NULL, NULL),
(5351, 25, 2423, 'Pokušaćemo sa izradom kvalitetnog softvera i aplikacije da povežemo nekoliko baza podataka ( strukturu proizvodnje polj.proizvođača, regestrovane pesticide, momenat tretmana i količinu sredstava). Rešiće se problem načina i vremena tretiranja poljoprivrednih vrsta i dobiti jedan kontrolisan proizvod koji će biti bezbedan jer će se raditi po preporuci koji će korisnici dobiti putem sms poruke. Ovaj problem postoji globalno i u srbiji zakon koji je ovo definisao trebalo bi da počne da se primenjuje od januara 2022 godine.', NULL, NULL),
(5352, 26, 2423, 'Prvo u početku implementacije tržište bib bilo moravički okrug gde bi se dobili reprzentativni uzorci na osnovu kojih bi se softver \"nahrnio\" neophodnim podacima, a u narednoj fazi cela Srbija. U naredne dve godine države balkana koje imaju iste ili slične probleme u voj oblasti.', NULL, NULL),
(5353, 27, 2423, 'Poljoprivredni proizvošači\r\nFirme koje se bave organizovanjem i otkupom poljoprivrednih proizvoda\r\nMinistarstvo poljoprivrede, šumarstva i vodoprivrede\r\nMinistarstvo ekologije....', NULL, NULL),
(5354, 28, 2423, 'Ono što je bitno reći da sada na tržištu ima dosta sličnih softverskih rešenja ali koja is sopstvenog iskustva ne rešavaju probleme odnosno nisu primenjivi u praksi iz razno raznih razloga. Iskustvo stečeno u decenijskom radu u organizovanju i vošenju poljoprivredne proizvodnje omogućiće nam da napravimo softver i aplikaciju koja če pomoći i poljoprivrednim proizvošaćima da dobijupravu infornaciju sa čime i u kojoj količini smeju da tretiraju svoje useve ada proizvod njihov bude bezbedan po krajne korisnike.', NULL, NULL),
(5355, 30, 2423, 'Trenutno kupci su oslonjeni na svoje znanje iz te oblasti a nisu u stanju da prate šta je to dozvoljenoo zakonski ili ne i na poljoprivredne apoteke gde im se pesticidi prodaju bez provere da taj pesticid u tom periodu sme da se koristi.', NULL, NULL),
(5356, 29, 2423, 'Bolji rezultat tretmana svojih useva, smanjenje troškova jer će kupiti samo ono što im u tom trenutko treba , smanjenje eventualnih konsekvenci za ostatke pesticida što je jako bitno za otkupljivače i najbitnije krajmji konzument će biti siguran u proizvod koji je kupio.', NULL, NULL),
