(5378, 63, 2437, 'Aplikacija za audio knjige na srpskom jeziku. Ponudićemo na našem jeziku aplikaciju koju će korisnici moći da koriste gde god se nalazili, odnosno imaće opciju za offline režim, intuitivne, lako navodljive opcije za poglavlja, beleški, podešavanja brzine zvuka kao i mogućnost da mesečne pretplate i što veći broj audio knjiga po potrebi korisnika.', NULL, NULL),
