(5380, 17, 2439, 'Aplikacija za audio knjige na srpskom jeziku. Ponudićemo na našem jeziku aplikaciju koju će korisnici moći da koriste gde god se nalazili, odnosno imaće opciju za offline režim, intuitivne, lako navodljive opcije za poglavlja, beleški, podešavanja brzine zvuka kao i mogućnost da mesečne pretplate i što veći broj audio knjiga po potrebi korisnika.', NULL, NULL),
(5381, 22, 2439, 'Radili smo kao članovi tima ELSA (European Law Students\' Association) kao direktor (Branko Ivić) i zamenik direktora (Aleksandar Petrović).', NULL, NULL),
(5382, 23, 2439, 'Najviše nas je motivisala mentorska podrška iskusnih ljudi u vođenju kompanija. Generalno, motivisao nas je ceo paket koji smatramo ključnim za razvoj Startapa.', NULL, NULL),
(5383, 24, 2439, 'Oslušni svet knjiga po želji', NULL, NULL),
(5384, 25, 2439, 'Na našem tržištu ne postoji izdavčka kuća koja izradjuje audio knjige na srpskom jeziku, time bismo mi bili prvi koji to pokreću i jedini bismo bili na našem tržištu.', NULL, NULL),
(5385, 26, 2439, 'Prvenstveno domaće tržište, uz to podrazumevamo i našu dijasporu. Procenjena veličina tržišta bi odgovarala tržištu Finske, iako ima znatno duplo manje stanovnika od Srbije uključujući i našu dijasporu ipak treba uzeti da je nivo digitalizacije u Srbiji niži pa samim tim ne bismo mogli da uključimo oko deset miliona ljudi već potencijal bi bio oko pet miliona ljudi a potencijalni broj korisnika bi mogao da dođe do bar sto hiljada na godišnjem nivou. Prihod audio knjiga u Finskoj je dostigao vrednost od $23 miliona u 2020. https://www.statista.com/statistics/872661/audiobook-sales-in-finland/ \r\nTržiste pored domaćeg i dijaspore, bi obuhvatalo tržište Crne Gore i Bosne i Hercegovine.', NULL, NULL),
(5386, 27, 2439, 'Rešavamo problem ljudima koji nemaju vremena za čitanje i upravo Sluš to omogućava, zatim za auditivne tipove ličnosti što podrazumeva da najbolje i najlakše im je da upijaju sadržaj knjige slušajući nego čitajući, uz to za slepe ljude da konačno imaju najbolju naraciju I da deca imaju svoj tip audio knjiga a majke da decu obrazuju na zanimljiv način. Mogućnost slušanja tokom radnji nekih mehaničkih radnji, brzina zvuka da se podešava pa samim tim da ako im mozak radi brže da se prilagode tome, beleške da upišu na određenoj minutaži', NULL, NULL),
(5387, 28, 2439, 'Kao glavne karakteristike smatramo da treba da imaju širok asortiman, opciju da mogu da slušaju audio knjige u offline režimu, da imaju opciju za brz prikaz poglavlja i mesto gde mogu brzo da upišu beleške, da mogu pre kupovine da odslušaju deo audio knjige da čuju kako zvuči i, krajnje, da mogu da podese brzinu.\r\nPrimarno bismo probali sa Web-aplikacijom a ako to ne bude sa zadovoljavajućim kvalitetom onda ćemo gledati hibridnu aplikaciju da napravimo. \r\nJedinstvenim ga čini to što ćemo biti prvi sveobuhvatni startup za audio knjige na srpskom jeziku.', NULL, NULL),
(5388, 30, 2439, 'Potencijalni kupci koji znaju engleski jezik trenutno koriste Audible. A uz to koriste ilegalno reprodukovane audio knjge na srpskom jeziku preko Youtube-a, pravnim putem ćemo da se potrudimo da se izbriše taj materijal.', NULL, NULL),
(5389, 29, 2439, 'Glavni benefiti su da mogu da slušaju knjigu uprkos tome što nekad nemaju vremena, na primer ako su satima dnevno u saobraćaju i time mogu da naprave produktivno svoje vreme koje obično smatraju da je gubljenje vremena. \r\nMogli bi da imaju dodatnu vrednost što knjiga ne može da doprinese poput intervjua sa autorom.', NULL, NULL),
(5390, 32, 2439, 'Proizvod je poznat u mnogim državama, ali je nedovoljno primenjen na našem tržištu. \r\nPrimera radi, veličina Audible-a je trenutno preko $3,3 milijardi prihoda, na ruskom tržištu je preko $80 000 000, a na tržištu najsličnijem srpskom poput Češkog tržišta prihod je preko $5 000 000.', NULL, NULL),
