(5412, 17, 2454, 'Vestacka inteligencija holisticki integrise nutricionistu, licnog trenera i metodu promene navika korisnika za trajnu transformaciju tela :\r\n1. Sistem algoritama koji cini AI nutricionistu, u realnom vremenu korisniku daje smernice za ishranu nezavisno od obroka koji zeli korisnik, na taj nacin se postize telesna transformacija bez restrikcija i okidaca zavisnosti od hrane, kao i bez prethodnog planiranja obroka sto je mnogima prepreka.\r\n\r\n2. Korisnik bez ikakvog predznanja i iskustva trenira jer algoritam prilagodjava treninge korisniku sa izuzetnom preciznoscu doziranja opterecenja, sto korisniku pruza osecaj postignuca i vecu motivaciju kroz licni progres.\r\n\r\n3. Funkcija promena navika korisnika omogucava da vodjenim koracima promeni svoje ponasanje dugorocno i uspostavi mentalne temelje za trajni rezultat, sto su zapravo jace telo i um i samopouzdanje.', NULL, NULL),
(5413, 22, 2454, 'Ceo tim je u originalnoj postavi ucestvovao u prizvodnom procesu od dizajna do proizvoda na trzistu. Svi clanovi tima su eksterni saradnici startupa. Trenutna postava tima ima prednost u pogledu vestina i iskustva svih clanova, jer su vecina seniorskog ranga sposobnosti. \r\nMana tima je sto nemamo Marketing experta. \r\nOno cemu tezimo je da se uspostavi stabilan prihod startapu kako bi mogao  na neodredjeno da se zaposli radnik na poziciji Front End Developera i honorarno placa Marketing Expert koji bi upravljao  socijalnim mrezama i marketing strategijom', NULL, NULL),
(5414, 23, 2454, 'Mi smo “bootstraping” startup bez ikakvih pomocnih investicija i sav kapital je dosao licno od osnivaca. Sam razvoj proizvoda je kostao oko 30.000eura. Sad nam je najpotrebniji marketing kako bi povecali svest ciljne grupe o nasem prisustvu na trzistu. MVP je vise puta unapredjen, a ceka nas jos ulaganja za dalja poboljsanja. Dokaz da je nas proizvod prihvacen je i skorasnji pocetak saradnje sa kompanijom “Levi9” koja je nas proizvod uvrstila u wellbeing paket namenjen osoblju', NULL, NULL),
(5415, 24, 2454, 'Many people feel uncomfortable in their body, that’s why we guide them with diet and training towards confidence and a strong body.', NULL, NULL),
(5416, 25, 2454, 'Mnogi ljudi se osecaju neprijatno u svom telu i muce sa pravilnom ishranom i treningom i zavisnoscu od hrane.\r\nFitneses pomaze njihovu transformaciju kroz personalizovanu ishranu i trening i psiholoske metode  kako bi se osecali samouvereno uz  jace telo i mentalni sklop. \r\n\r\n\r\nUsluga koja pruza nas proizvod, „Fitnesses“ aplikacija resava 2 znacajna problema: \r\n1) na globalnom nivou se bori protiv *gojaznosti, dijabetesa i kardiovaskularnih bolesti direktnim uticajem na zdravlje i psihu korisnika. \r\n\r\n2) na individualnom nivou, pruza vece samopouzdanje, bolje kardiorespiratorno zdravlje, jace telo i zadovoljstvo sobom. \r\n\r\n\r\n*Samo u SAD 2005. Godine potroseno je $190 milijardi, odnosno 21% medicinskih troskova uzrokovanih gojaznoscu. Procenjuje se da ce do 2030. Godine, troskovi rasti za $48-66 milijardi godisnje samo u SAD. \r\nIzvor: https://www.hsph.harvard.edu/obesity-prevention-source/obesity-consequences/economic/#references', NULL, NULL),
(5417, 26, 2454, 'Fitness Apps market Europe:\r\n• Projektovani prihodi u ovom trzistu dosezu US$2,143.77m u 2021\r\n• Projektovana godisnja stopa rasta prihoda (CAGR 2021-2025) od 20.26%, sto rezultira velicinom trzista u vrednosti od  US$4,484.14m do 2025.\r\n\r\nIzvor: https://www.statista.com/outlook/dmo/digital-health/digital-fitness-well-being/digital-fitness-well-being-apps/fitness-apps/europe\r\n\r\nFitness Apps market USA :\r\n• Projektovani prihodi u ovom trzistu dosezu US$1,728.91m u 2021.\r\n• Projektovana godisnja stopa rasta (CAGR 2021-2025) od 15.52%, sto rezultira velicinom trzista u vrednosti od  US$3,079.30m by 2025.\r\n\r\nIzvor: https://www.statista.com/outlook/dmo/digital-health/digital-fitness-well-being/digital-fitness-well-being-apps/fitness-apps/united-states?currency=usd\r\n\r\nFitness Apps market Australia:\r\n• Projektovani prihodi u ovom trzistu dosezu US$264m u 2021.\r\n• Projektovana godisnja stopa rasta (CAGR 2021-2025) od 12.31%, sto rezultira velicinom trzista u vrednosti od US$419m do 2025.', NULL, NULL),
(5418, 27, 2454, 'Osobe oba pola, 20-40 godina starosti nezadovoljni izgledom I samopouzdanjem. Istrazivanje je sprovedeno godinu dana pre pocetka razvoja, anketiranjem kupaca konkurencije. Uradjena je anketa sa 250 ljudi o  zeljenim uslugama I nezadovoljstvima konkurentnim aplikacijama koje koriste', NULL, NULL),
(5419, 28, 2454, 'Aplikacija ima 3 glavna „servisa“ za menjanje tela i uma: \r\n1. WORKOUT – AI algoritam koji daje istovremeno vodjstvo pocetnicima i flexibilnost za naprednije korisnike. Korisnik bez ikakvog predznanja o fitnessu moze da trenira jer dobija video instrukcije, i preporuke za tezinsko opterecenje sa izvanrednom preciznoscu, sto pogoduje korisniku.\r\n2. DIET- AI algoritam sa INOVATIVNOM fleksibilnoscu, omogucava korisniku da menja telesnu tezinu uz proaktivne nutritivne preporuke, bez eliminisanja namirnica.\r\n3. HABITS – pomaze korisniku u promeni navika sto je krucijalno za odrzivi napredak. Korisnik ima predlozenu listu navika i uputstvo za svaku, kako bi je lakse promenio i dostigao svoj cilj.', NULL, NULL),
(5420, 30, 2454, 'Konkurencija je jaka zbog malih barijera ka trzistu, a navedena su tri jaka direktna konkurenta i njihov udeo trzista: \r\n\r\nMyfitnesspal\r\nVelicina trzista 2021 ( Europe + USA + Australia) = $4,135,000,000\r\nUdeo trzista = 3.09%\r\n*Udeo trzista izracunat na osnovu prihoda konkurenta u 2020.     $128,000,000\r\n\r\n\r\nFreeletics\r\nVelicina trzista 2021 ( Europe + USA + Australia) = $4,135,000,000\r\nUdeo trzista = 0.67%\r\n* Udeo trzista izracunat na osnovu prihoda konkurenta u 2019     $27,800,800\r\n\r\n\r\nSweat\r\nVelicina trzista 2021 ( Europe + USA + Australia) = $4,135,000,000\r\nUdeo trzista = 2.4%\r\n* Udeo trzista izracunat na osnovu prihoda konkurenta u 2020     $99,500,000', NULL, NULL),
(5421, 29, 2454, 'Ni jedan konkurent ne pokriva celu sliku problema prisutnog kod gojaznih ljudi koji ukljucuje zavisnost od hrane. \r\nZavisnost od hrane je konzumiranje iste radi stimulisanja lucenja dopamina ( hormona srece) kako bi se potisnule negativne emocije, I ovaj poremecaj ima 1.5 milijarda ljudi. Ovo destruktivno ponasanje izaziva ponovno gojenje i stalni fizicki I mentalni poremecaj licne percepcije\r\n\r\nMi pomazemo ljudima da se oslobode zavisnosti od hrane i izgrade zdravo telo I pouzdanje tako sto uklanjamo barijere u njihovoj transformaciji kroz: \r\n\r\n•	Edukativne blogove I eBook na temu zavisnosti od hrane\r\n•	Trenazno I nutritivno navodjenje bez eliminisanja namirnica( sto smanjuje zudnju za hranom I zavisnost), i\r\n•	Vodjeno menjanje navika korisnika, krucijalno za dugorocne rezultate.', NULL, NULL),
(5422, 32, 2454, 'DIET feature-    AI nutricionista sa INOVACIJOM procesa koju ne poseduje ni jedan od vodecih konkurenata na trzistu, a to je flexibilnost koju pruza algoritam sto znaci za korisnika:\r\n•	Moze da jede sve sto pozeli, i pritom da dostigne svoj cilj jer algoritam u sekundi izracunava i preporucuje kolicinu hrane koju korisnik treba da pojede. \r\n•	Ukoliko korisnik pojede vise nego sto je preporuceno za obrok, algoritam iste sekunde preracunava sledece obroke i prilagodjava nutritivne preporuke kako bi korisnik uspeo da ostvari svoj cilj.\r\n•	Ukoliko korisniku fali odredjeni makronutrijent sto je esencijalno za manipulaciju telesnim izgledom, aplikacija ce ga upozoriti pravovremeno i preporuciti mu listu namirnica sa potrebnim makronutrijentom da odabere sta mu je na raspolaganju u tom trenutku.', NULL, NULL),
(5423, 37, 2454, 'Zasticen je logo i potpisan je ugovor o poslovnoj tajni i poverljivosti podataka sa osobljem angazovanom u proizvodnom procesu', NULL, NULL),
(5424, 40, 2454, '2022 planiran prihod/profit: EUR 70.200/ 15,346 \r\n2023 planiran prihod/profit: EUR 147,420/ 32,425  \r\n2024 planiran prihod/profit: EUR 294,840/ 39,248\r\n2025 planiran prihod/profit: EUR 589,680/ 125,984\r\n2026 planiran prihod/profit: EUR 1,179,360/ 392,907', NULL, NULL),
(5425, 41, 2454, 'Tim je okupljen 2 godine, razvio je uspesno MVP koji je dosta poboljsan na osnovu kritike test korisnika. Proizvod je plasiran na trziste u novembru 2021 ali potreban je angazman marketing experta koji ce se baviti socijalnim mrezama I razvojem strategije. \r\nPrihvacenost proizvoda je pokazana dogovorenom saradnjom sa kompanijom Levi9 koja je uvrstila aplikaciju u wellbeing paket zaposlenima ciji potencijal je oko 700 ljudi/korisnika. Sa istom kompanijom je dogovoreno i predavanje zaposlenima na temu wellbeinga sto ce pojacati kredibilitet brenda. \r\nDo sad je aplikaciju preuzelo individualno 150 korisnika, ali to je nedovoljan broj jer prosek zadrzavanja korisnika nakon 30 dana statisticki iznosti 4% za fitness aplikacije, sto znaci da nam je potreban mnogo veci broj preuzimanja aplikacije, za sta je potrebno promovisanje na trzistu, a to opet zahteva marketing budzet I experta iz tog polja.', NULL, NULL),
