(5428, 48, 2454, 'Najvise nam treba pomoci u oblasti marketinga I budzet za isti, zatim budzet za poboljsanja funkcija na osnovu prikupljenog “feedback-a” korisnika.', NULL, NULL),
(5429, 49, 2454, 'Potrebno nam je 10.000 CHF:\r\nTroskovi  naknada- za poboljsanje funkcija trazenih od korisnika ( ugovor u privremenim poslovima)  - CHF 5,000.00\r\nTroskovi cloud servera I licenci – 9 meseci trajanje - CHF 1,485.00\r\nMarketing – Promocija putem socijalnih mreza(paid ads, influenseri)  - CHF 1,500.00\r\nMacbook Pro 16GB / 256GB SSD - CHF 1,991.60', NULL, NULL),
