(5440, 89, 2463, 'Graficki dizajner preko 20 godina\r\nAlati:\r\n- Figma\r\n- Sketch\r\n- Invision\r\n- Adobe XD\r\n- Photoshop\r\n- Illustrator\r\n- InDesign\r\n\r\nVestine: \r\n- UX/UI design\r\n- Interaction design\r\n- Product design\r\n- UX reserach\r\n- Prototyping & wireframing\r\n- Design thinking\r\n- Agile methodology\r\n- Branding & identity\r\n- Typography\r\n- Visual design', NULL, NULL),
(5441, 90, 2463, 'Delimicno posvecen\r\nUX/UI Designer', NULL, NULL),
