(5443, 89, 2464, 'Faculty of Organizational Sciences:\r\nBachelor of Information Technology \r\nRadio kao full-stack developer 10 godina, nakon cega je unapredjen u team lead-a za kriticne segmente proizvoda. \r\nNakon toga je prebacen na drugi proizvod gde je unapredjen u menadzera razvoja zaduzenog za transfer proizvoda na novu arhitekturu. Trenutni tim je zaduzen za mikroservise i core DevOps.\r\nTakodje je bio angazovan kao konsultant na brojnim freelance projektima sa React, React-native, Angular..', NULL, NULL),
