(5446, 71, 2466, 'Klijent je izabrao program i počeo sa popunjavanjem forme.', NULL, NULL),
(5447, 63, 2467, 'Spajanje skladištenja u oblaku (cloud storage i elementi cloud computinga) sa kriptografijom i kompresijom, tako se korisniku omogućuje više usluga koje su pre bile odvojene (šifrovanje, cloud storage, kompresija, autentifikacija podataka) na jednom mestu. Kada se sa softverskim rešenjem kombinuje naš hardver, onda nastaje ceo eko-sistem koji omogućava još efikasnije sprovođenje ideje.', NULL, NULL),
(5448, 71, 2468, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5449, 17, 2469, 'Spajanje skladištenja u oblaku (cloud storage i elementi cloud computinga) sa kriptografijom i kompresijom, tako se korisniku omogućuje više usluga koje su pre bile odvojene (šifrovanje, cloud storage, kompresija, autentifikacija podataka) na jednom mestu. Kada se sa softverskim rešenjem kombinuje naš hardver, onda nastaje ceo eko-sistem koji omogućava još efikasnije sprovođenje ideje.', NULL, NULL),
(5450, 22, 2469, 'Dimitrije Mikarić osvaja 2. mesto na takmičenju za biznis ideju pri Startap centru (koji je deo Biznis inkubatora Kruševac) na takmičenju za poslovnu ideju u 2021. godini, u 2020. godini vodio je svoj biznis koji se zasnivao na kopanju kriptovaluta (i koji je početkom 2021. zatvoren, sa profitom)\r\n\r\nPetar Binić srednjoj ekonomskoj školi bio na \"berzi\" (simulirano poslovanje), dobio 5 na maturskom radu iz računovodstva (tema: kalkulacije), aktivno razvija biznis ideju zajedno sa nosiocem ideje.', NULL, NULL),
(5451, 23, 2469, 'U trenutku kada saznajemo za ovaj program preko prezentacije u Biznis Inkubatoru Kruševac program nam je već zvučao primamljivo, zbog prilike da se ostvari saradnja i dobije znanje i edukacija od strane stručnjaka i onih uspešnih u biznisu, ali nam se program svideo i zbog prilike da se povežemo sa svojim vršnjacima i zajedno sa njima razvijemo veštine prezentovanja, javnog nastupa, kreiranja i održavanja firme.', NULL, NULL),
(5452, 24, 2469, 'Pouzdano. Bezbedno. Brzo.', NULL, NULL),
(5453, 25, 2469, 'Problem back-up rešenja. Problem privatnosti gde korisnik poverava svoje najosetljivije podatke potpunom strasncu. Ovaj problem postoji globalno, jer mašine \"crkavaju\" i podaci se gube svakodnevno. Za ovaj problem smo saznali na teži način kada nam je hard disk u računaru otkazao. Ovaj problem je težak jer konvencionalna back-up rešenja često nisu brzo dostupna, ili su često preskupa u odnosu na dobit, ili nisu privatna. Mi bi smo spojili brzinu pristupa, privatnost i cenu pogodnu za korisnika.', NULL, NULL),
(5454, 26, 2469, 'Tržište koje uključuje javne institucije, mikro, mala i srednja preduzeća koja najčešće nemaju back-up rešenja te su izložena opasnosti od gubitka podataka ključnih za poslovanje. U naredne dve godine potencijalna geografska ekspanzija zahvatila bi Severnu Makedoniju, BiH, Hrvatsku i Crnu Goru.', NULL, NULL),
(5455, 27, 2469, 'Naši potencijalni kupci jesu kompanije koje imaju profit ali pate od manjka pouzdanosti u svojoj IT infrastrukturi (bez backupa, sa slabim šiframa...). Oni strahuju od gubitka podataka i zato se okreću nama. U razgovoru sa nekoliko takvih malih kompanije zaključujemo da veči deo njih ni nema svest o tome da jedna greška pri funkcionisanju mašine može potpuno ugroziti njihovo poslovanje ako sa sobom odnese ključne podatke. Dok je manjina onih sa kojima smo pričali svesna problema, ali smatra da nije neophodno preduzeti nešto jer bi to bilo mahom preskupo. Najmanji deo je onih koji već imaju back-up rešenje', NULL, NULL),
(5456, 28, 2469, 'Koristili bi smo cloud computing za kompresiju.\r\n\r\nNaš proizvod je jedinstven po tome što objedinjuje usluge koje su pre bile odvojene u jednu. Tako kod nas je moguće i šifrovati podatke, podići ih u cloud, izvršiti dobru kompresiju i kasnije ih preuzeti u najkraćem roku. Ostale kompanije na tržištu svaku od tih usluga nude zasebno i većinom nekoherentno, tako da klijent mora biti korisnik usluga nekoliko kompanija, a mogao bi da bude korisnik samo jedne usluge - naše. Zadovoljavamo potrebu kupca da bude siguran da mu podaci neće nestati zajedno da \"crkavanjem\" hard diska, potrebu za privatnošću, potrebu za efikasnom skladištenju podataka.', NULL, NULL),
(5457, 30, 2469, 'Google Drive, Dropbox, rezervni hard diskovi, diskovi, \"fleške\", ili ga jednostavno ne reševaju, \"kud puklo nek puklo\" princip.', NULL, NULL),
(5458, 29, 2469, 'Benefit je to što ne moraju da se rastežu sa velikim brojem onih koji pružaju uslugu, i da se pitaju jesu li te usluge kompatabilne jedna sa drugom. Jedinstveno je jer bi smo mi bili one-stop-shop po prihatljivoj ceni sa kapacitetom da se svakom kupcu posvetimo lično, za razliku od Gugla na primer, gde kao korisnik dobiti tehničku podršku od čoveka jeste teško.', NULL, NULL),
(5459, 32, 2469, 'Značajno je poboljšan jer objedinjuje prethodno razdvojene usluge, zato što bi smo bili od retkih koji bi imali i svoj hardver i svoj softver.', NULL, NULL),
(5460, 37, 2469, 'Vlasnik intelektualne svojine po pitanju softvera i spoja softver-hardver rešenja bio bi Dimitrije Mikarić.', NULL, NULL),
(5461, 40, 2469, 'Tako što bi prodavao skladišteni prostor i usluge kriptovanja, kompresije i dostupnosti podataka bilo kad i bilo gde korisnicima. Uz asortiman dodatnih usluga kao što je lokalno rađenje back-upa osnovno unapređenje op-sec praksi naših klijenata.', NULL, NULL),
(5462, 41, 2469, 'Oko mesec dana razvijamo ideju, ja, Dimitrije Mikarić, uključujem Petra Binića pre oko tri nedelje, kada shvatam da cela tehnologija pada u vodu bez finansijske i logističke podrške. Eksperti sa kojima smo se konsultovali su se složili sa nama da su naše usluge potrebne tržištu, a prilikom neformalnog razgovora sa potencijalnim kupcem dobili smo informaciju da je uključenje kriptografije u našu ideju sjajno rešenje baš za njega, jer tako možemo čuvati osetljive podatke a da ne ugrozimo klijenta.', NULL, NULL),
(5463, 44, 2469, 'Dimitrije Mikarić je učestvovao na programu Startup centra pri Biznis inkubatoru u Kruševcu, takmičenje za najbolju poslovnu ideju, gde je osvoio 2. mesto.', NULL, NULL),
(5464, 45, 2469, 'Nismo.', NULL, NULL),
(5465, 48, 2469, 'Očekujemo nova znanja, podršku eksperata na nivou razvoja tehnologije, ali i sugestije koje bi unapredile naše poslovanje, i finansijsku podršku. Najpotrebniji su nam startni kapital i mišljenja eksperata.', NULL, NULL),
(5466, 49, 2469, 'Procenjujemo da nam je potrebno oko 13000 CHF i to za:\r\n\r\n1) razvoj odgovaraćujeg softvera\r\n2) pribavljanje i izrada odgovarajućeg hardverskog rešenja, tj. kupovanje delova koje ćemo posle kombinovati u hardverskom rešenju\r\n3) Za istraživanje tržišta\r\n4) Za izradu prototipa i alfa verzija hardvera i softvera', NULL, NULL),
