(5474, 89, 2477, 'Završio Ekonomsko-trgovinsku školu u Kruševcu sa odličnim prosekom i trenutno je student na Ekonomskom fakultetu u Nišu na smeru Finansije, bankarstvo i osiguranje.', NULL, NULL),
(5475, 90, 2477, 'U većoj meri posvećen, kako ima dobru školsku osnovu biće zadužen za izradu budžeta, angažovanje pomoći pri knjigovodstvu i računovodstvu, baviće se marketinškim aktivnostima, radiće fakture, zajedno sa kreatorom ideje pregovarati sa klijentima', NULL, NULL),
(5476, 91, 2477, 'Student osnovnih studija na 1. godini', NULL, NULL),
