(5478, 71, 2481, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(5479, 63, 2482, 'Dobbli je platforma koja nudi mogućnost vlasnicima i agencijama za nakretnine da naprave virtuelnu turu svoje nekretnine  putem naše mobilne aplikacije i potom je oglase.', NULL, NULL),
(5480, 71, 2483, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5481, 17, 2484, 'Dobbli je platforma koja nudi mogućnost vlasnicima i agencijama za nakretnine da naprave virtuelnu turu svoje nekretnine  putem naše mobilne aplikacije i potom je oglase.', NULL, NULL),
(5482, 22, 2484, 'Započinjali smo jedan projekat koji nije dogurao dalje od idejnog koncepta. Dobbli je prvi projekat kojem smo se skroz posvetili i razvili proizvod.', NULL, NULL),
(5483, 23, 2484, 'Za program Raising Starts smo odbijeni prošle godine, shvatili smo da je validacija nas kao tima jednako važna kao validacija same ideje. Usredsredili smo se na naše nedostatke u vidu ozbiljnosti koje smo pružali našoj ideji i upravo iz tog razloga tadašnji koncept je prerastao u funckionalni prototip koji danas očekuje beta testiranje.\r\nSmatramo da je vaš program odskočna daska za jedan startap u početku kome treba kako finansijska tako i stručna(administrativna) pomoć.', NULL, NULL),
(5484, 24, 2484, 'Najkompletnije iskustvo vašeg budućeg doma.', NULL, NULL),
(5485, 25, 2484, 'Dobbli pomaže vlasnicima i agencijama da kompletnije i realnije prikažu svoju nekretninu i na taj način je brže prodaju ili iznajme. Jer ce kupac steći bolji utisak o prostoru i lakše doneti odluku. \r\nProblem nedovoljnog vizuelnog prikaza nekretnina je prisutan globalno, a u većoj meri na područjima van Amerike gde virtuelne ture polako postaju standard prikaza jedne nekretnine. Ovaj problem je daleko izraženiji kod fizičkih lica, jer mogućnost pravljenja 360 virtuelne ture ima samo mali procenat agencija koje poseduju specijalizovane kamere. Naša platforma omogućava pravljenje 360 virtuelnih tura svakoj osobi sa mobilnim uređajem.\r\nIz pozicije vlasnika koji želi da napravi virtuelnu turu svoje nekretnine, \r\novaj problem je težak za rešavanje, jer da bi to postigao mora da kupi skupu specijalizovanu kameru, što nije isplativo za svrhe samo jedne nekretnine.\r\nProblem smo uočili iz drugog ugla, kao osobe koje su tražile nekretninu za iznajmljivanje.', NULL, NULL),
(5486, 26, 2484, 'Glavni izvor prihoda i samim tim primarno tržište koje targetiramo jeste tržište agenata. U Srbiji ima 714 aktivnih agencija za nekretnine, zaključno sa tržištem u Hrvatskoj(702), Sloveniji(222), Crnoj Gori(201) i Bosni i Hercegovini (113) ukupan broj iznosi 1952 agencije (Izvor: https://www.srbija-nekretnine.org/agencije).\r\nBroj aktivnih agencija u Evropi iznosi 247.000, a veličina tog tržišta je 52 milijarde na godišnjem nivou (Izvor https://www.ibisworld.com/eu/industry/real-estate-agencies/3845/).\r\nEkspanziju ćemo početi lokalno u našoj zemlji, a potom nastaviti na susedne koje su navedene izvan. Brzina širenja zavisi od mnogo faktora, ali smatramo da ćemo u periodu od dve godine zauzeti značajan deo tržišta u Srbiji, hrvatskoj, Sloveniji, Crnoj gori i Bosni i Hercegovini.', NULL, NULL),
(5487, 27, 2484, 'Rešavamo problem vlasnicima nekretnina i agencijama koji žele da prodaju ili iznajme nekretninu, a samim tim i kupcima koji će imati bolji uvid u prostor i time moći lakše da se odluče za željenu nekretninu. Komunikaciju smo ostvarili u vidu sprovođenja ankete sa agencijama. Na anketu je odgovorilo 15 agencija , sve agencije spremne na mogućnost korišćenja novog sajta za nekretnine- Trecina agencija nije zadovoljna učinkom, iskustvom pri korišćenju sajta i iznosom koji plaćaju usluge sajta. Dok polovina agencija nije zadovoljna izgledom oglasa na postojećim sajtovima po čemu ćemo mi takođe biti superiorniji od konkurentnih sajtova za nekretnine. 90% Ispitanih agencija ne pravi virtuelne ture nekretnina, ali planiraju da to rade u budućnosti. I od broja je 80% otvoreno za mogućnost da koristi našu platformu. Zaključci do kojih dolazimo jesu da potreba i interesovanje za Dobbli platformom postoje na našem tržištu.', NULL, NULL),
(5488, 28, 2484, 'Glavna karakteristika naše platforme jeste mogućnost da se unutar nje napravi kompletna virtuelna tura nekretnine i odma zatim oglasi kroz jedan intuitivan proces. \r\nOd tehnologija naša platforma koristi kompijutersku viziju.\r\nMobilna aplikacija je napravljena uz pomoć Fluter/Java/OpenCV tehnologije, a web aplikacija uz pomoć ReactJS i NodeJS-a.\r\nNaš platforma je jedinstvena u odnosu na druge sajtove upravo iz gore pomenutih razloga, dakle jedninstveno rešenje koje nudi sve što je jednom vlasniku ili ageniji potrebno da kompletno prikaže svoje nekretninu kupcu i oglasi je.', NULL, NULL),
(5489, 30, 2484, 'Ukoliko kupci žele da pogledaju nekretninu ili je vlasnici ili agencije oglase, to mogu učiniti na običnim sajtovima za nekretnine poput: 4Zida, Halooglasa, Indomia, itd. Ukoliko kupac želi da pogleda nekretnine koje imaju standardizovan prikaz virtuelne ture, mogu to uraditi na sajtu CityExpert, ali predstavljaju običnu agenciju koja ima specijalizovane kamere za slikanje, nisu platforma koju mogu svi da koriste. Trenutan način pravljenja 360 virtuelne ture je moguć ukoliko se kupi specijalizovana 360 kamera za te svrhe. Te slike se posle moraju ubaciti u drugi program koji sluzi za povezivanje tih slika na osnovu 2d plana nekretnine koji morate posedovati.', NULL, NULL),
(5490, 29, 2484, 'Dobbli platforma će vlasnicima i agencijama nuditi mogućnost da brzo i lako naprave oglas za nekretninu i virtuelnu turu te nekretnine. Samo uz pomoć mobilne aplikacije na njihovom telefonu oni će slikati panoramske slike soba i potom ih povezati u jednu celinu, bez potrebe da nose specijalizovanu kameru sa stativom svugde sa sobom ili te slike prvo eksportuju na kompijuter gde ce ih naknadno uredjivati i spajati. Usluge oglašavanja i pravljenja virtuelne ture će biti mnogo povoljniji od solucije da na drugoj platformi plaćaju usluge oglašavanja i dodatno kupe specijalizovanu kameru. Tokođe izgled same platforme i izgled oglasa je moderniji od evropskih platformi uopšte a pogotovo od onih u Srbiji kao početnom tržištu.', NULL, NULL),
(5491, 32, 2484, 'Sajtovi za nekretnine i mogućnost da se napravi virtuelna tura nekretnine već postoje. Naša inovativnost je tome što smo prva platforma za nekretnine koja nudi mogućnost pravljenja virtuelne ture pomoću samo jedne mobilne aplikacije na vašem telefonu. Dakle korisnik slika svaku sobu i istog momenta poveže sve sobe u jednu celinu po imenu virtuelna tura kroz koju kupac kasnije u oglasu može interaktivno da se kreće. Proces je brži od drugih rešenja, intuitivan za upotrebu i nema potrebe za dodatnom obradu na nekoj desktop aplikaciji. Iz tog razloga smo označili da smo \r\nznačajno poboljšan proizvod ili usluga.', NULL, NULL),
(5492, 37, 2484, 'Planiramo zaštiti žig, ime i slogan na međunarodnom nivou.\r\nTrejdmark bi bio kolektivan među nama trojicom kao osnivačima.', NULL, NULL),
(5493, 40, 2484, 'Glavni izvor prihoda će biti subscription model koji će se naplaćivati agencijama na mesečnom nivou. Dodatan izvor prihoda će biti jednokratne naplate za isticanje oglasa u pretrazi kao i naplaćivanje običnom vlasniku oglašavanje druge nekretnine na platformu, budući da će oglašavanje prve nekretnine uvek biti besplatno.', NULL, NULL),
(5494, 41, 2484, 'Tim je okupljen malo više od godinu dana oko razvoja ove ideje. Napravljena je web aplikacija i mobilna aplikacija koje su trenutno u procesu alfa testiranja. Obratili smo se našoj ciljnoj grupi (agencijama) i potvrdili da postoji potražnja za platformom poput naše na tržištu. Dvanaest od petnarst agencija koje su odgovorile na anketu su zainteresovane za saradnju u budućem periodu i žele da ih obavestimo kada platforma izađe na tržište.', NULL, NULL),
(5495, 44, 2484, 'Nismo', NULL, NULL),
(5496, 45, 2484, 'Nismo', NULL, NULL),
(5497, 48, 2484, 'Od učešća u programu očekujemo primenjivo znanje koje možemo da steknemo od vas i vaše startap zajednice. Vidljivost prema investitorima koju ostvarujete i pomoć na administrativnom planu. Kombinacija stvari nabrojanih iznad predstavlja odskočnu dasku za mladi tim poput nas i pruža nam priliku da se više usredsredimo na razvijanje proizvoda u odgovarajućim pravcima za stvarni svet i za šta nas sve očekuje u njemu. Dakle, ako nas pitate šta nam je najpotrebnije, rekli bismo da je to zdravo okruženje u kojem mi kao startap možemo da rastemo.', NULL, NULL),
(5498, 49, 2484, 'Direktnu bazu svih vlasnika koji oglašavaju i agencija imamo na postojećim sajtovima za nekretnine. Što znači da do korisnika koji će nam donositi zaradu možemo doći bez utroška materijalnih sredstava. Novac nam je potreban za promovisanje platforme do onih korisnika koji žele da kupe ili iznajme nekretnine, povećanjem njih će rasti i kredibilitet nas kao platforme. Takođe nam je potreban za registrovanje Logo-a i imena na međunarodnom nivou. Smatramo da je za početnu fazu pomoć od devet hiljada evra koju vi nudite dovoljna za održivost našeg koncepta i skaliranje na našem tržištu.', NULL, NULL),
