(5519, 24, 2504, '\"Živim brzo, a hranim se sa sela\"', NULL, NULL),
(5520, 25, 2504, 'Plasman poljoprivrednih proizvoda i dostupnost stanovnicima vecih gradova direktnu kupovinu od proizvođača sa sela', NULL, NULL),
(5521, 26, 2504, 'Tržište su prvenstveno gradovi u Srbiji, a kasnije kada se logistika razvije i izvoz', NULL, NULL),
(5522, 27, 2504, 'Problem se rešava prvenstveno malim poljoprivrednim proizvodjačima, u najvećem broju žene kojima je to jedini izvor prihoda. Poljoprivredni proizvođači su i u najnepovoljnijoj situaciji na tržištu rada, većina njih nema plaćene doprinose, a samim tim ni pristup zdravstvenoj zaštiti\r\nDruga zainteresovana strana jesu žitelji gradova koji žele kupovati domaće proizvode direktno od proizvođača\r\nTestirana je amaterska platforma od marta do maja 2020 godine, promet preko platforme je bio oko milion dinara', NULL, NULL),
(5523, 28, 2504, 'Web platrforma i logistički centar - posredovanje izmedju proizvođača i potrošača, na tržištu ne postoji ništa slično', NULL, NULL),
(5524, 30, 2504, 'Kupuju u velikim marketima hranu iz uvoza i po višim cenama', NULL, NULL),
(5525, 29, 2504, 'Poljoprivredni proizvođač će moći da se bavi onim što najbolje radi, proizvodnjom proizvoda i unapređivanjem svoje ponude, bez gubljenja vremena na traženje tržišta za plasman proizvoda i bez opterećenja transportnim troškovima i troškovima pijačnina \r\nKupci poručuju hranu sa sela iz svog doma, dobijaju hranu na kućnu adresu bez odlazaka na pijace i markete', NULL, NULL),
(5526, 32, 2504, 'Ne postoji takav vid trgovine na tržištu ima sličnih....facebook grupa ...online prodavnica, ni u jednoj nije zaokruzen sistem', NULL, NULL),
(5527, 37, 2504, 'Danijela Hamadto, Luka Savović', NULL, NULL),
(5528, 40, 2504, 'Pružanjem posredničkih usluga', NULL, NULL),
(5529, 41, 2504, 'Ideja je zaživela pre 2 godine u okviru jednog projekta, sproveli smo potpuno razvoj platforme i testirali je, kada smo bili nadomak legalizacije i pronalaska rešenja za logistički centar... Osoba koju smo zadužili da bude vodeća na projektu je ugasila platformu i pretvorila u sajt jednog udruzenja, od tada radimo kontinuirano na toj ideji sa novim timom, od platforme ostala je jedna mala facebook stranica koju smo poklonili poljoprivrednicama iz kolubarskog okruga i koja i danas živi', NULL, NULL),
