(5546, 71, 2516, 'Klijent je uspešno popunio formu za prijavu na program.', NULL, NULL),
(5547, 63, 2517, 'Obrazovanje u svetu u poslednjih nekoliko godina doživljava velike transformacije, STEAM metode preuzimaju primat. Mi smo kroz udruženje u poslednjih nekoliko godina edukovali veliki broj dece koristeći \"Educatin\" setove kompanije Lego koji su podrška robotici i programiranju. Koristeći Lego pametne seteve shvatili smo principe ovog načina učenja i počeli da razvijamo sopstvene setove namenjene za učenje elektronike i robotike kroz igru.', NULL, NULL),
(5548, 71, 2518, 'Potencijalni klijent je napravio je profil i izrazio interesovanje za izbor programa.', NULL, NULL),
(5549, 17, 2519, 'Obrazovanje u svetu u poslednjih nekoliko godina doživljava velike transformacije, STEAM metode preuzimaju primat. Mi smo kroz udruženje u poslednjih nekoliko godina edukovali veliki broj dece koristeći \"Educatin\" setove kompanije Lego koji su podrška robotici i programiranju. Koristeći Lego pametne seteve shvatili smo principe ovog načina učenja i počeli da razvijamo sopstvene setove namenjene za učenje elektronike i robotike kroz igru.', NULL, NULL),
(5550, 22, 2519, 'Zajedno smo radile na osmišljavanju i formiranju Dečijeg Inovacionog Centra.', NULL, NULL),
(5551, 23, 2519, 'Naš plan je bio da se obratimo Naučno tehnološkom parku Beorgad za podršku u smislu korišćenja 3d štampača i Lasera kako bi smo testirali našu ideju i onda smo na Vašm sajtu videli ovaj poziv i shvatili da možemo da odemo korak dalje.', NULL, NULL),
(5552, 24, 2519, 'Igrom do znanja', NULL, NULL),
(5553, 25, 2519, 'U ovom trenutku smo bazirani na tržište Srbije na kome se ne mogu kupiti STEAM setovi, kompanija Lego čije setove koristimo u okviru Dečijeg Inovacionog Centra nije dala licencu za prodaju njihovh Education proizvoda nikome u Srbiji postoje samo cubroid STEAM seovi čija je cena 40.000 dinara i po toj ceni su prodali samo 7 setova u protekloj godini. Naša ideja je da rešimo ovaj problem na našem tržištu izradom STEAM seta za elektroniku i robotiku koji će biti cenovno prihvatljiv. Taakodje želimo da izadjemo i na svetsko tržište na kome nepostoje STEAM setovi za učenje elektronike.', NULL, NULL),
(5554, 26, 2519, 'Tržičte Srbije- proizvod namenjen deci osnovnih škola koja imaju afinitet ka prirodno matematičkim naukama i žele dodatno da se usavrše, procena oko 15.000 korisnika.\r\nU naredne dve godine planiramo da izađemo na tržište Hrvatske, Makedonij,  Bih i Crne gore 30.000 korisnika.', NULL, NULL),
(5555, 27, 2519, 'Roditelji dece koja pohadjaju osnovne škole. Populacija koja želi da usmeri svoju decu na pravi put kroz obrazovanje. Na žalost redovni školski sistem je primoran da  u periodu Covid pandemije limitira redovne školske akticnosti na minimum tako da dodatne školske  aktivnosti gotovo da i ne postoje. Naša ideja može da reši ovaj problem i snažna je podrška roditeljima talentovane i ambiciozne dece koja će moći korišćenjem našeg proizvoda \"Tinkering STEAM set\" da kvalitetno oskoriste slobodno vanškolsko vreme i da kroz igru i zabavu  uđu u svet nauke i tehnološkog napretka.', NULL, NULL),
(5556, 28, 2519, 'Pametni set za učenje elektronike i robotike kroz igru i zabavu. Naziv \"Tinkering STEAM set\".\r\nSTEAM tehnologija.', NULL, NULL),
(5557, 30, 2519, 'Tržište smo detaljno ispitali kroz praktične i konkretne primere, Dečiji Inovacioni Centar koji smo pokrenuli je koncipiran na STEAM učenje, Lego Educatin setove smo morali da nabavljamo iz Grčke jer u Srbiji niko nije dobijo licencu za distribuciju ovih proizvoda, čak i regionalni centar u Sloveniji Legama nema prvao da izveze setove u Srbiju. \r\nCubroid  STEAM setove uvozi Pcpractic , maloprodajna cena je 40.000 dinara što je duplo veća cena od sličnih Lego setova tako da je ovaj proizvod nekonkurentan.\r\nNaš proizvod će na tržištu koštatio od 5.000-8.000 dinara.', NULL, NULL),
(5558, 29, 2519, 'Donosimo pristupačan STEAM set, koji će pored toga što će biti dostupan u radnjama za široku populaciju imati i besplatan softver i 10 primernih lekcija na https://www.youtube.com/.', NULL, NULL),
(5559, 32, 2519, 'Još niko nije patentirao STEAM set koji za bazu ima elektroniku.', NULL, NULL),
