(5562, 41, 2519, 'Kroz  Dečiji Inovacionoi Centar  do sada je prošlo više od 2000 dece, najuspešniji su učestvovali na prestižnom takmičenju FLL Challenge na kome smo imali zapažene rezultate na Evropskim i Svetskim prvenstvima. Jedna od disciplina na takmičenju je inovacioni projekat i to je kategorija u kojoj smo do sad dobijali najviše bodova. Shodno kriterijumima bodovanja na ovom takmičenju i ulaznim parametrima za bodovanje naš projekt \"Tinkering STEAM set\" će imati najviše ocene. Na ovom projektu radimo nekoliko meseci i nastao je kao plod potreba naše škole kojoj su bili potrebni novi sadržaji. Plan nam je da se sa projektom pojavimo na takmičenju nakon patentiranja i usavršavanj i izrade prototipa nakon reaizacije projekta sa Vašom ustanovom. Naš tim ima stručnu podršku profesora ETF Beograd, Koste Jovanovića i Zaviše Gordića, kao i profesora Slavenka Stojadinovica sa proizvodnog mašinstva Mašinskog fakulteta u Beogradu', NULL, NULL),
