(5580, 17, 2532, '2D platformer igra koja svojom pričom adresira probleme sa kojima se susreću mladi roditelji.', NULL, NULL),
(5581, 22, 2532, 'Članovi tima Rastko Marjanović i Veljko Arsić već 4 godina sarađuju na različitim projektima u okviru fakulteta Informacionih tehnologija, Univerziteta Metropolitan. \r\nŽelja za primenom stečenog znanja i razvoj samostalnih video igara okupila je neformalni WizArt tim pre godinu ipo dana. Pored Rastka Marjanovića i Veljka Arsića članovi tima su: \r\nDo sada smo uspešno kreirali i publikovali dve video igre:\r\nCyberDrive (3D Infinite Runner igru)\r\n https://play.google.com/store/apps/details?id=com.ConstellationGames.CyberDrive\r\ni\r\n2D Tap Swordsman\r\n https://play.google.com/store/apps/details?id=com.FrostlabInteractive.TapSwordsman\r\n \r\nPre šest meseci timu WizArt entertaiment priključila se Kristina Nikičević, psiholog. Od tada intenzivno radimo na razvoju igre Somewhere in Between koju želimo da na pravi način plasiramo našim ciljnim igračima uz pomoć Raising Starts programa.', NULL, NULL),
(5582, 23, 2532, 'Nаš tim ima znanja i praktičnog iskustva u tehničkom razvoju video igre i psihološkom razumevanju problema koji rešavamo. U dosadašnjem radu shvatili smo da je određivanje ciljnih korisnika i plasman na tržište jako bitan i kompleksan u čemu nemamo preterano iskustva. \r\nRaising Starts za nas predstavlja idealan program kroz koji možemo da usavršimo naše zananje, pravilno odredimo naše ciljne korisnike, načine na koje ih zainteresovati za našu igru i kako od svega napraviti biznis koji donosi novac.\r\n Takodje pružanje modernih resenja na probleme koji su sve češći u društvu. Otvaranjem naše kompanije pružila bi se mogućnost otvaranja novih kreativnih radnih mesta za mlade talentovane ljude kojima je motivacija kreiranje video igara sa unosnom pričom ,grafikom i kompleksom mehanikom.', NULL, NULL),
(5583, 24, 2532, 'Vizuelna magija je ključ do sreće', NULL, NULL),
(5584, 25, 2532, 'Postati roditelj se obično zamišlja kao radostan i ugodan životni događaj. Međutim rođenjem deteta se život roditelja strahovito menja. Zbog velikog broja novih obaveza roditelji nisu u mogućnosti da održe dotadašnji stil života te dolazi do depresije i mentalnih problema.\r\n \r\nPrema theworldcounts.com, na globalnom nivou se rodi oko 140 miliona beba svake godine. Post-natalna depresija je jedan od rastućih problema kod mladih roditelja. Mentalno stanje sa kojim se bore majke I očevi dok ocekuju ili nakon dobijanja bebe, po globalnim statistikama zahvata 16% žena i 5% muškaraca. Što znači da oko 30 miliona osoba svake godine mora da potraži pomoć kako bi prevazišla ove probleme zato što nisu spremni na njih.  \r\nRešavanje bilo kog problema vezanog za depresiju je veoma teško zbog manjka svesti o postojanju samog problema i zbog manjka inicijative za rešavanje istog.', NULL, NULL),
(5585, 26, 2532, 'Ciljna tržišta su visoko razvijene zemlje (population.un.org) i roditelji koji očekujue rođenje deteta (brojevi su na godišnjem nivou): \r\nSAD - 8 miliona \r\nKanada - 1 million \r\nAustralija i Novi zealand - 1 million i\r\nzemlje Evropske unije - 8 miliona\r\n \r\nPo statistikama to zahvata 46% mladih mama u Americi što je više od 22 miliona. Na dan se rodi negde oko 9000 beba kod milenijalskih porodica.  \r\nU 2022. godini planiramo izradu MVP verzije igre i plasiranje na test tržište Srbije i zemalja u regionu.\r\nU 2023. godini planiramo izradu MMP verzije i plasman na tržište Kanade, Australiej i Novog zelanda\r\nU 2024. godini planiramo plasman na tržištu SAD.', NULL, NULL),
(5586, 27, 2532, 'Prevashodno mlade roditelje izmedju 20 do 30 godina. Mladim roditeljima koji traže laksi I kreativni način da prodju kroz ceo proces ocekivanja i dobijanja bebe. Ciljna grupa mladih roditelja su oni roditelji koji vole da igraju igre. Veličina i sam rast ove grupe je iz svake godine sve veća. Ispitivanja i postojanje problema smo odradili sa 25 prijatelja i poznanika koji su postali roditelji u poslednje 5 godina po principu “maminog testa”.\r\n \r\nOsim roditelja koji iščekuju bebe igra je namenjena i svim ljubiteljima 2D platformer igara za koje je potražnja svake godine oko 16% veća. Mimo toga što je 2D platformer igra, igrica će biti namenjena ljubiteljima Ghibli stila i knjige “Mali Princ”.', NULL, NULL),
(5587, 28, 2532, 'Razvijamo 2D platformer video igru, koja svojom pričom i karakterima pravi paralelu između igre i stvarnog života. Video igra omogućava korisnicima da se povežu na dubljem nivou i pripreme na život nakon rođenja deteta.\r\n \r\nVideo igra je u procesu razvoja i kreiran je prvi prototip. Za razvoj igre se koristi Unity game engine sa mehanikom igre koja omogućava direktnu konekciju sa svetom igre i jedinstvenim AI sistemom. Razvoj igre u Unity game Enginu će omogućiti jednostavno kreiranje igre namenjene pametnim mobilnim uređajima, tabletima i personalnim računarima.', NULL, NULL),
(5588, 30, 2532, 'Tradicionalno problem post-natalne depresije se rešava posetama stručnjacima (psiholozima ili psihijatrima). Alternativni pristup jesu mobilne aplikacije ili web resursi koji nisu ni malo zabavni mladim roditeljima koji očekuju rođenje deteta i ne očekuju da će upasti u probleme. Potencijalni kupci trenutno nemaju neki način da kroz zabavu reše ili barem olaksaju sebi problem. Sa druge strane postoje 2D platformer igare koje adresiraju neke druge probleme ili jednostavno imaju privlačnu priču.', NULL, NULL),
(5589, 29, 2532, 'Naša igra donosi kreativan i novi način za pripremu za život nakon rođenja deteta i prolaženje kroz potencijalne problem. Stanje uma koje imaju igrači tokom igranja neke igrice vrlo često pomaže da priču dožive na ličnijem nivou. Proživljavanje događaja u bezbednom okruženju video igre doprinosi psihičkoj pripremi za slične događaje u stvarnom životu. Naša igrica sa svojom pričom koja će kroz metafore i konkretne primere pokazati igračima način ili barem pristup ka bržem rešavanju problema.', NULL, NULL),
(5590, 32, 2532, 'Za razliku od postojećih pristupa: web sajtovi, forumi, mobilne aplikacije ili razgovor sa stručnjakom, naše rešenje nudi jedinstven priistup rešavanju problema post-natalne depresije igranjem video igre i indirektno adresira mentalno stanje roditelja tokom i nakon dobijanja novorodjenčeta.', NULL, NULL),
(5591, 37, 2532, 'Sproveli smo istraživanje i konsultacije sa nastavnicima Univerziteta metropolitan, stručnjacima u oblasti zaštite intelektualne svojine. Prema Evropskoj konvenciji o patentima video igre nije moguće patentirati. Tako da nam je plan da zaštitimo Žig i Industrijski dizajn igre.', NULL, NULL),
(5592, 40, 2532, 'Primarne analize sličnih proizvoda pokazuju da najviše uspeha imaju video igre i aplikacije koje prodaju digitalne kopije i imaju mikrotransakcije. U svakom sliučaju potrebno je sprovesti dodatna istraživanja i pronaći optimalan model monetizacije.', NULL, NULL),
(5593, 41, 2532, 'Do sada smo definisali i potvrdili problem koji rešavamo sa ciljnim korisnicima. Kreirali smo inicijalni biznis plan i pitch. Kreirali smo prvi prototip igre koji sadrži deo prvog, početnog nivoa. Programeri su razvili prototip osnovne mehanike i trenutno rade na integraciji priče. Ovaj tim postoji godinu i po, a na ovom projektu radimo oko 6 meseca, gde je inicijalni period proveden u razvijanju same ideje i njenoj verifikaciji.', NULL, NULL),
(5594, 44, 2532, 'U okviru fakulteta smo učestvovali u razvoju biznis plana razvoja naše igre na predmetu AD455 Timski razvoj video igara.', NULL, NULL),
