(5632, 17, 2554, 'Korišćenje stabljika industrijske konoplje umesto drveta za izradu gradivnog materijala sa istim i/ili poboljšanim karakteristikama, uz značajnu uštedu resursa.', NULL, NULL),
(5633, 22, 2554, 'Budući da zajedno studiramo na Fakultetu organizacionih nauka, koleginica Ema i ja (Andrea) smo imale priliku da zajedno radimo na nekoliko projekata koje su studije zahtevale, kao članovi većeg tima, a i kao samostalni tim od dva člana. Jedan od tih projekata predstavljao je upravo simulaciju razvijanja startap ideje inovativnog tehnološkog proizvoda, gde smo imale priliku da se upoznamo sa ključnim koracima plasiranja proizvoda na tržište, i svime što tome prethodi. LEAN startap metodologija, istraživanje tržišta, projektovanje ciljne grupe prema važećim statističkim podacima, komponente marketing miksa su samo neka od znanja koje smo usvojile kroz uspešno realizovanje ovih projekata. Pored toga, već nam je poznat rad u timu, kako sa drugim članovima, tako i međusobno – imamo potpunu slobodu i ustanovljenu dinamiku rada i disciplinu, koja se do sada pokazala kao veoma uspešna. Međutim, ovo je prvi put da svi zajedno radimo na istom projektu.', NULL, NULL),
(5634, 23, 2554, 'Svesni smo da je inovativan proizvodni proces i njegova uspešna implementacija jedan od najvećih izazova s kojim se suočava svako mlado preduzeće. \r\nS tim u vidu, prednosti koje program Raising Starts pruža kroz materijalnu i nematerijalnu pomoć (mentorstvo, pristup laboratorijama, stručna ekspertiza iz ključnih oblasti poslovanja i razvoja proizvoda, networking...) su od ključnog značaja za uspešnu realizaciju naše ideje.\r\nPored toga, startap kultura u Srbiji je daleko nerazvijenija u poredjenju sa ostatkom Evrope, te su šanse sa kojima se startapovi susreću po osnivanju ograničene. Program Raising Starts kao poslovni inkubator postavlja temelj svakom učesniku da doprinese svojoj zajednici, pa i šire, na inovativan način.', NULL, NULL),
(5635, 24, 2554, 'Changing the environment - stalk by stalk.', NULL, NULL),
(5636, 25, 2554, 'Jedan od rastućih problema današnjice jeste koncept održivog razvoja, kako da se olakša i ubrza njegova implementacija u svim sferama ljudskog postojanja – pa tako i u industriji. Globalno zagrevanje, konstantno zagađivanje okoline, kao i prekomerna eksploatacija prirodnih resursa su samo neki od negativnih posledica uticaja čoveka i industrije na planetu. Naš cilj jeste da u što većoj meri umanjimo ovaj negativan uticaj pružanjem inovativnog rešenja koje bi samo po sebi imalo pozitivne ekološke efekte. Ujedinjene Nacije su kroz inicijativu Sustainable Development Goals - SDGs ovo prepoznale kao globalnu pretnju koju teže da eliminišu postizanjem 17 ciljeva do 2030. godine. Naša inovacija doprinosi ispunjenju bar 6 od 17 ovih ciljeva. Kad je u pitanju eksploatacija prirodnih resursa, krčenje šuma je jedan od najvećih činilaca jednačine.', NULL, NULL),
(5637, 26, 2554, 'Model poslovanja-B2B,koja imaju bilo kakvu potrebu za našim proizvodom. Budući da je to supstitut za drvo kao materijal za dalju preradu, to bi pretežno bili proizvođači nameštaja koji imaju svoje fabrike i ekspoziture za veleprodaju sopstvenih proizvoda Iostalog nameštaja.Prema podacima Razvojne agencije Srbije(https://ras.gov.rs/),drvna industrija u Srbiji trenutno se nalazi u razvoju, čak je ni aktuelna pandemija nije usporila.Drvnu industriju i industriju nameštaja u našoj zemlji čine 3.734preduzeća, prema podacima iz 2020. godine. Kontinuirani pozitivan trend rastaukupnih prinosa ovog sektora tokom poslednjih nekoliko godina,kao i veoma povoljan geografski položaj srpskog tržišta obezbedili su da Srbija kao proizvodno čvorište bude primamljiva ne samo domaćim preduzećima,već i brojnim stranim investitorima,što nama ide u korist jer povećava broj potencijalnih budućih saradnika.Konkretno, to bi najpre bile države balkanskog regiona,kao što su Slovenija,Hrvatska,Severna Makedonija..', NULL, NULL),
(5638, 27, 2554, 'Poznajući specifikacije našeg proizvoda, jasno je da postoji pregršt mogućih klijenata, samo je potrebno izabrati one prave. To bi bili oni čiji se interesi poklapaju sa našim – očuvanje životne sredine i ekološki svesno poslovanje. Model održivog poslovanja predstavlja zajednički interes svih kompanija na globalnom nivou, te smatramo da bi naš proizvod predstavljao inovativno, ali ne i radikalno, veoma povoljno rešenje za prethodno pomenute probleme u industriji. Rani usvajači bile bi kompanije sa kojima smo već stupili u kontakt, a koje su iskazale interesovanje za naš proizvod. Prema našim preliminarnim procenama, plasirali bismo proizvod čija je cena koštanja znatno niža od cene koštanja drveta, a samim tim i prodajna cena bila bi povoljnija za same kompanije. Finalni korisnik - onaj kod koga bi gotov proizvod zapravo završio, predstavlja širok pojam, zbog svestranosti i velikih primena.', NULL, NULL),
(5639, 28, 2554, 'Trenutno smo u fazi razvoja supstituta drveta na bazi industrijske konopljke bez vezivnog sredstva, ali takodje imamo i proizvod sa ekološkim vezivnim sredstvom na bazi skroba. U odnosu na trenutno rešenje koje drvna industrija nudi, naš proizvod koristi rapidno obnovljiv izvor resursa koji može rešiti problem masovnog krčenja šuma, karakteristikama nikako ne odstupa drvetu visokog kvaliteta kao što je na primer orah, već ima do 20% veću gustinu, vreme potrebno za obnovu flore je 100 puta brže, dok po zasadjenom hektaru dobijamo 25% kiseonika nego po ekvivalentnoj površini šume', NULL, NULL),
(5640, 30, 2554, 'Osvešćenost šire javnosti o ovom problemu trenutno nije na zadovoljavajućem nivou, i jedan od naših ciljeva je da to promenimo. Drvna industrija funkcioniše po istom modelu po kom je funkcionisala i na samom začetku - mi mislimo da je zrela za promenu. Sirovine koje su trenutno dostupne na tržištu, kao što su hrast, orah, bukva, bagrem i jasen, imaju znatno niži koeficijent obrta u odnosu na industrijsku konoplju. Zapravo, kompanije u ovoj industrijskoj grani ne rade ni približno dovoljno po ovom pitanju, i može se reći da je ovakav način gradnje skoro potpuno nepoznat današnjoj populaciji, jer je sama biljka prolazila kroz razne zakonske restrikcije i samim tim bivala isključena iz proizvodnje i upotrebe.', NULL, NULL),
(5641, 29, 2554, 'Kao što je već pomenuto, naš proizvod predstavljao bi supstitut za postojeći materijal – drvo. Međutim, korišćenje industrijske konoplje, tačnije njenih stabljika, ima nekoliko prednosti u odnosu na korišćenje drveta. Prva, i najvrednija u svetu biznisa, jeste smanjen utrošak vremena.Ovo je naravno veoma povoljno za poljoprivredu, kao i za ekonomiju i privredu u celini. Sami operativni troškovi su znatno manji, budući da je proces obrade prost i zahteva malu količinu dodatnih sirovina, od kojih smo se mi opredelili za potpuno organske supstance, i doslovno je moguće obaviti ga ručno – bez da finalni proizvod zbog toga ispašta. Podjednako je čvrst, homogen i upotrebljiv kao i automatski obrađen i dobijen proizvod, a čak i čvršći i otporniji od drveta u nekim aspektima. U teoriji, ako se izgradi dovoljno novih struktura od konoplje umesto od betona, čelika ili drveta, građeviska industrija bi mogla dramatično da se približi neto nultoj emisiji ugljenika.', NULL, NULL),
(5642, 32, 2554, 'Uzimajući u obzir da se samo jedna kompanija na svetu bavi preradom industrijske konoplje kao supstitutu za drvo, može se reći da je proizvod postojeći. Inovacija leži u vezivnom sredstvu, kojeg nema već pokušavamo da imitiramo drvo na molekularnom nivou spajanjem molekula glukoze kao i samo trenje koje drži vlakna gusto spojena. Ovom metodom možemo postići gustinu koje je do 40% veća od postojećeg supstituta sa vezivnim sredstvima.', NULL, NULL),
(5643, 37, 2554, NULL, NULL, NULL),
(5644, 40, 2554, 'Glavni prihodi bi poticali od B2B modela poslovanja. Alokacijom novčanih sredstava na sve ključne administrativne funkcije u preduzeću, postarali bismo se da deo tih sredstava bude uložen u razvoj marketinga i plasmana proizvoda kako bismo ga približili krajnjim korisnicima. Cena proizvoda bila bi formirana po metodi \"troškovi plus\".', NULL, NULL),
(5645, 41, 2554, 'Naš tim je aktivno okupljen oko razvoja ideje tek dva meseca, s obzirom da je ona začeta mnogo ranije. Ekspanzijom našeg tima smo uspeli da dotaknemo aspekte i tehnološkog i poslovnog razvoja. Sa tehnološke tačke gledišta uspeli smo da napravimo alfa verziju proizvoda – prototip i utvrdimo njegove komponente i način proizvodnje. Što se tiče poslovnog razvoja, kroz neformalan razgovor sa nekim od potencijalnih klijenata, potvrdili smo našu pretpostavku/hipotezu o zainteresovanosti za buduću saradnju. Takođe, uspostavili smo dogovor sa kompanijom BioSativa d.o.o. i udruženjem “Konoplja” koji nas trenutno snabdevaju potrebnim količinama sirovine. Preciznije, trenutno smo u preliminarnoj fazi obrazovanja ugovora sa gore navedenim preduzećem kojim ćemo osigurati repro materijal u količini od 5.000 tona godišnje.', NULL, NULL),
(5646, 44, 2554, '/', NULL, NULL),
(5647, 45, 2554, '/', NULL, NULL),
(5648, 48, 2554, 'Planiramo da maksimalno iskoristimo prednosti koje program pruža. Očekujemo da steknemo nove veštine i unapredimo postojeće, proširimo mrežu poznanstava sa ljudima koji dele iste vrednosti kao i mi, i da uz pomoć ovog Programa ispunimo sve kratkoročne ciljeve vezane za razvoj proizvoda i poslovanja. Podrška za istraživanje i automatizaciju proizvodnje bi nam bila od najvećeg značaja - automatizacija bi dovela do znantno konkurentnije pozicije na tržištu dok bi istraživanje usavršilo sam proizvod.', NULL, NULL),
(5649, 49, 2554, 'Što se razvoja proizvodnje tiče potrebna nam je presa potiska do 100 tona čija je prodajna cena između 9.000 - 11.000 evra. Pored toga za razvoj marketinga i poslovanja potreban iznos bio bi izmedju 3 i 4 hiljade evra.', NULL, NULL),
